INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(172906, 'ruRU', 'Ха, лучше пусть деньги уплывают из его кармана, чем из моего!', '', 29981),
(172905, 'ruRU', 'Газлоу сказал, что лично тебе заплатит. Похоже, он ненавидел мерзавца еще больше, чем я!', '', 29981),
(172903, 'ruRU', 'Я начну подготовку.', '', 29981),
(172728, 'ruRU', 'Пернатый неуправляем! Держитесь!', 'Пернатый неуправляем! Держитесь!', 29981),
(172721, 'ruRU', 'Делорми, могу я одолжить у тебя хрононить?', 'Делорми, могу я одолжить у тебя хрононить?', 29981),
(172671, 'ruRU', 'Конечно! Поверь, мы еще даже не знаем истинных пределов его мощи!', '', 29981),
(172670, 'ruRU', 'Магни, как думаешь, мы можем сделать Сердце Азерот еще сильнее?', 'Магни, как думаешь, мы можем сделать Сердце Азерот еще сильнее?', 29981),
(172622, 'ruRU', '', 'Позволь согреться в лучах твоего величия, дай сил защитить твоих детей.', 29981),
(172621, 'ruRU', '', 'Одари эти инструменты своим благословением...', 29981),
(172620, 'ruRU', '', 'Элуна, услышь меня...', 29981),
(172619, 'ruRU', 'Одари нас своей силой, помоги защитить твоих детей.', '', 29981),
(172618, 'ruRU', 'Одари нас своей благодатью.', '', 29981),
(172617, 'ruRU', 'Мать-Земля, помоги нам.', '', 29981),
(172614, 'ruRU', 'До какой из этих цветастых статуй ты хочешь добраться?', 'До какой из этих цветастых статуй ты хочешь добраться?', 29981),
(172613, 'ruRU', 'Просто спустись по лестнице до террасы со всеми святилищами, там его и найдешь.', 'Просто спустись по лестнице до террасы со всеми святилищами, там его и найдешь.', 29981),
(172612, 'ruRU', 'Жаба? Зачем тебе жаба? Ладно, ее алтарь на северо-западе, где все ремесленники обитают.', 'Жаба? Зачем тебе жаба? Ладно, ее алтарь на северо-западе, где все ремесленники обитают.', 29981),
(172611, 'ruRU', 'Просто спустись по лестнице до террасы со всеми святилищами, там его и найдешь.', 'Просто спустись по лестнице до террасы со всеми святилищами, там его и найдешь.', 29981),
(172610, 'ruRU', 'Святилище говорливого скелета у западной стены этой пирамиды.', 'Святилище говорливого скелета у западной стены этой пирамиды.', 29981),
(172609, 'ruRU', 'Кажется, это где-то рядом с Великой Печатью.', 'Кажется, это где-то рядом с Великой Печатью.', 29981),
(172608, 'ruRU', 'Алтарь кошачьего бога стоит в восточной части пирамиды.', 'Алтарь кошачьего бога стоит в восточной части пирамиды.', 29981),
(172581, 'ruRU', '', 'Я прослежу за тем, как ты управляешься с нитью, и решу, заслуживаешь ли ты права называться хроноткачом.', 29981),
(172576, 'ruRU', '', 'И еще кое-что. Мне кажется, я поняла, как получить линзу, которую земельники использовали у алтарей.', 29981),
(172575, 'ruRU', '', 'Они все в Кул-Тирасе. Возможно, тебе стоит присоединиться к Армии Чести в их следующем нападении.', 29981),
(172574, 'ruRU', '', 'Кажется, я знаю, где искать дальше, но это будет... куда более враждебная территория.', 29981),
(172573, 'ruRU', '', 'Пока тебя не было, я изучала журнал, стараясь понять, где искать остальные алтари.', 29981),
(172522, 'ruRU', 'Ты найдешь святилище Па\'ку у основания лестницы, ведущей на Террасу посланников.', 'Ты найдешь святилище Па\'ку у основания лестницы, ведущей на Террасу посланников.', 29981),
(172521, 'ruRU', 'Святилище Краг\'вы ты найдешь в северо-западном углу пирамиды, у Террасы ремесленников.', 'Святилище Краг\'вы ты найдешь в северо-западном углу пирамиды, у Террасы ремесленников.', 29981),
(172520, 'ruRU', 'Святилище Кимбула ты найдешь в восточной части пирамиды, у самых джунглей.', 'Святилище Кимбула ты найдешь в восточной части пирамиды, у самых джунглей.', 29981),
(172519, 'ruRU', 'Святилище Гонка ты найдешь у основания лестницы на Террасе посланников.', 'Святилище Гонка ты найдешь у основания лестницы на Террасе посланников.', 29981),
(172518, 'ruRU', 'Святилище Бвонсамди ты найдешь на лестнице в западной части пирамиды.', 'Святилище Бвонсамди ты найдешь на лестнице в западной части пирамиды.', 29981),
(172517, 'ruRU', 'Святилище Акунды ты найдешь на лестнице к востоку от Великой Печати.', 'Святилище Акунды ты найдешь на лестнице к востоку от Великой Печати.', 29981),
(172516, 'ruRU', '', 'И, наконец, нужно совершить ритуал единения.', 29981),
(172496, 'ruRU', 'Чье святилище тебе нужно?', 'Чье святилище тебе нужно?', 29981),
(172489, 'ruRU', 'Святилище Па\'ку', 'Святилище Па\'ку', 29981),
(172488, 'ruRU', 'Святилище Краг\'вы', 'Святилище Краг\'вы', 29981),
(172487, 'ruRU', 'Святилище Кимбула', 'Святилище Кимбула', 29981),
(172486, 'ruRU', 'Святилище Гонка', 'Святилище Гонка', 29981),
(172485, 'ruRU', 'Святилище Бвонсамди', 'Святилище Бвонсамди', 29981),
(172484, 'ruRU', 'Святилище Акунды', 'Святилище Акунды', 29981),
(172483, 'ruRU', 'Святилища лоа', 'Святилища лоа', 29981),
(172475, 'ruRU', 'Испытания ждут тебя. Подойди к фолиантам и обрети знание, которое ищешь.', '', 29981),
(172437, 'ruRU', '%s и $n столкнулись, вызвав обширное извержение!', '%s и $n столкнулись, вызвав обширное извержение!', 29981),
(172436, 'ruRU', 'У |3-1(%s) закончился \"Нестабильный резонанс\", и произошло обширное извержение!', 'У |3-1(%s) закончился \"Нестабильный резонанс\", и произошло обширное извержение!', 29981),
(172435, 'ruRU', '|TInterface\\Icons\\SPELL_SHADOW_DEATHSEMBRACE:20|t|cFFFF0000%s|r начинает применять |cFFFF0000|Hspell:293653|h[Нестабильный резонанс]|h|r!', '', 29981),
(172433, 'ruRU', 'Может, тебе удастся найти среди их добычи еще живого и спасти его.', '', 29981),
(172432, 'ruRU', 'Поищи на востоке. На Горном подъеме много свирепых йети, и они любят поохотиться на оленей.', '', 29981),
(172431, 'ruRU', 'В этом испытании тебе нужно найти раненое существо и исцелить его. Естественно, ценой своей жизненной силы.', '', 29981),
(172429, 'ruRU', 'Что делать с этим \"Писанием о жертве\"?', 'Что делать с этим \"Писанием о жертве\"?', 29981),
(172428, 'ruRU', 'Твои испытания – в этих книгах. Выбирай любую.', '', 29981),
(172413, 'ruRU', 'Ты заплатишь за свои наглые обвинения!', '', 29981),
(172412, 'ruRU', 'Жульничество?! Как ты смеешь!', '', 29981),
(172411, 'ruRU', 'Что за варварство? Это были мои любимые кости!', '', 29981),
(172410, 'ruRU', 'Что значит, мой ход не засчитан?!', '', 29981),
(172409, 'ruRU', 'Добро пожаловать в мой магазин, $r. Могу я предложить свои лучшие ткани?$b$bИли, может, ты желаешь научиться шить из них одежду исключительной силы?', '', 29981),
(172408, 'ruRU', 'Привет, $gбратишка:сестренка;! Да ты никак любишь делать из кожи всякие классные штуки?$b$bНу так ты по адресу. Лучше меня тут кожевничеству никто не обучит.', '', 29981),
(172407, 'ruRU', 'Че как, $c? Хочешь, чтоб где-нибудь бомбануло похлеще, чем в Силитусе?$b$bТак тебе повезло! Со мной все твои взрывные мечты станут явью!$b$bГлянешь, что у меня есть?', '', 29981),
(172403, 'ruRU', 'Ты не против, если играть будем моими костями?', '', 29981),
(172402, 'ruRU', 'Кости, не подведите меня!', '', 29981),
(172401, 'ruRU', 'Давай, косточка! Папочке нужна победа!', '', 29981),
(172399, 'ruRU', 'Твоя подготовка окончена. Ступай к грифонам на корме судна.', 'Твоя подготовка окончена. Ступай к грифонам на корме судна.', 29981),
(172397, 'ruRU', 'Мы быстро тебе наковальню сделаем!$b$bНо... ты особо не болтай об этом, пока мы не закончили.', '', 29981),
(172391, 'ruRU', 'Твоя подготовка окончена. Ступай к вивернам на корме судна.', 'Твоя подготовка окончена. Ступай к вивернам на корме судна.', 29981),
(172380, 'ruRU', 'Я вижу, собравшиеся полны гнева и негодования. У меня на родине были случаи, когда эти чувства приобретали реальную форму и становились угрозой, если мы слишком долго пытались их подавить.\n\nБейн должен был что-то сделать, иначе его гнев превратился бы в еще большую угрозу для всей Орды.\n\nМы все должны извлечь из этого урок.', '', 29981),
(172365, 'ruRU', '', 'Интересно, Зукаши специально дожидался, когда я использую эти шары, чтобы посмотреть, что получится? Он настоящий ребенок.', 29981),
(172364, 'ruRU', '', 'Фу, мне нужно помыться.', 29981),
(172363, 'ruRU', '', 'Ясно, значит, это не те ингредиенты. Метод исключения, все дела. Верно, $n?', 29981),
(172362, 'ruRU', 'Он всегда был как ребенок. Интересно, он дожидался, пока я не использую эти шары? Просто, чтобы посмотреть на результат.', '', 29981),
(172361, 'ruRU', 'Это вполне в духе Квентина – использовать ингредиент, способный привести к таким результатам.', '', 29981),
(172360, 'ruRU', 'Если сразу не вышло, смешаем еще раз. И еще. Так ведь? По крайней мере мы исключаем из списка неверные ингредиенты.', '', 29981),
(172354, 'ruRU', 'А что это у тебя в кармане?$b$bОдин из моих камней трансмутации?! Ого, и какой тебе достался?$b$b<Вы показываете камень Сайласу.>$b$bХа-ха, да, славная штучка. Я вроде даже когда-то его рецептом пытался торговать...$b$bНадеюсь, тебе он понравился! И не забудь про мой карнавал. Там такие чудеса есть, что тебе и не снились!', '', 29981),
(172353, 'ruRU', 'Знаешь... Скажу тебе прямо, я скучаю по Хати. Сердце у малыша золотое.', '', 29981),
(172352, 'ruRU', 'Ха! Мы ему нравимся!', '', 29981),
(172350, 'ruRU', 'Закончим этот разговор позже, Бронзобород. $p уже здесь.', '', 29981),
(172342, 'ruRU', '', 'Поговорить с Дереком... После стольких лет...\n\n<Джайна качает головой.>\n\nМне многое нужно обдумать.', 29981),
(172341, 'ruRU', 'Нам есть чему поучить орков этого мира.', 'Нам есть чему поучить орков этого мира.', 29981),
(172340, 'ruRU', 'Мне до сих пор снится Дренор. Уцелел ли мой родной мир?\n\nАррх, не доведут такие мысли до добра.', 'Мне до сих пор снится Дренор. Уцелел ли мой родной мир?\n\nАррх, не доведут такие мысли до добра.', 29981),
(172339, 'ruRU', 'Лок\'тар огар!', 'Лок\'тар огар!', 29981),
(172338, 'ruRU', 'Вождь Адский Крик почти наверняка мертв. И если это так, он точно погиб как герой.', 'Вождь Адский Крик почти наверняка мертв. И если это так, он точно погиб как герой.', 29981),
(172337, 'ruRU', 'От этого мира разит порчей.', 'От этого мира разит порчей.', 29981),
(172336, 'ruRU', 'Если кто-то из светоносных предателей явится в этот мир, я буду готов!', 'Если кто-то из светоносных предателей явится в этот мир, я буду готова!', 29981),
(172335, 'ruRU', 'Какая судьба постигла наших братьев и сестер?', 'Какая судьба постигла наших братьев и сестер?', 29981),
(172334, 'ruRU', 'Воевода Гейя\'ра была правой рукой вождя. Нет в этом мире более храброго орка, чем она.', 'Воевода Гейя\'ра была правой рукой вождя. Нет в этом мире более храброго орка, чем она.', 29981),
(172333, 'ruRU', '', 'Как приятно вновь оказаться дома.', 29981),
(172275, 'ruRU', 'Давно тут стоишь?', '', 29981),
(172274, 'ruRU', '', 'Ты знаешь, где мы оказались?', 29981),
(172242, 'ruRU', 'Я давно наблюдаю за тобой, $p.', '', 29981),
(172239, 'ruRU', 'Также на арене – сэр Филипп Картер Трейси!', '', 29981),
(172216, 'ruRU', '', 'Увы, но мое время тут истекло. Вынуждена откланяться. Было приятно иметь с тобой дело!', 29981),
(172215, 'ruRU', '', 'Какое интересное время. Так, посмотрим. Судя по твоему наряду, сейчас...\n\nДа, та самая эпоха. Чудесно! Итак, коллега-портной, если тебе интересно не только мое общество, позволь предложить выкройки, которые у меня есть на продажу.\n\nИ не бойся, я не заберу все твое золото. Для оплаты я предпочитаю ткани.', 29981),
(172198, 'ruRU', '%s – владыка Черной горы!', '', 29981),
(172189, 'ruRU', 'Уа-ах... Я и не думал, что на это уйдет столько сил. Мне нужно немного передохнуть.', '', 29981),
(172176, 'ruRU', 'Начинай ритуал.', 'Начинай ритуал.', 29981),
(172168, 'ruRU', 'И под \"привлекают\" он имеет в виду, что тебя сожрут, стоит тебе хоть как-то засветиться.', '', 29981),
(172167, 'ruRU', 'И берегись китовых акул. Возможно, их привлекают светящиеся объекты.', '', 29981),
(172166, 'ruRU', 'Он имеет в виду, что как только ты наберешь достаточно данных, поговори со мной и я поделюсь парой крутых прибамбасов.', '', 29981),
(172165, 'ruRU', 'Твое добровольное участие в нашем эксперименте будет вознаграждено.', '', 29981),
(172164, 'ruRU', 'Круто, да? Кстати, \"Эдгар\" – это наша субмарина.', '', 29981),
(172163, 'ruRU', 'Все данные будут поступать непосредственно из твоего шлема.', '', 29981),
(172162, 'ruRU', 'Доставь этих существ сюда, чтобы \"Эдгар\" смог их изучить.', '', 29981),
(172161, 'ruRU', 'Что, трудно сказать \"светящихся\", как все нормальные ребята?', '', 29981),
(172160, 'ruRU', 'Я определил три уникальных вида люминесцентных созданий в непосредственной близости.', '', 29981),
(172158, 'ruRU', 'Он мертв. Где моя плата?', 'Он мертв. Где моя плата?', 29981),
(172157, 'ruRU', 'От него остались только клочки, разбросанные по пустыне. Маленькие такие. Микроскопические ошметки подлеца, перемешанные с песком. Он на 100% мертв. Я обгорел на солнце, пока собирал его по всей округе. А когда закончил, собрал в кучку и взорвал еще раз. Ага. Он мертв. Мертвее не бывает.', 'От него остались только клочки, разбросанные по пустыне. Маленькие такие. Микроскопические ошметки подлеца, перемешанные с песком. Он на 100% мертв. Я обгорела на солнце, пока собирала его по всей округе. А когда закончила, собрала в кучку и взорвала еще раз. Ага. Он мертв. Мертвее не бывает.', 29981),
(172156, 'ruRU', 'Вот это приятные новости. Рад иметь с тобой дело, $p.', '', 29981),
(172155, 'ruRU', 'Эй! $N!\nС моим неудачным капиталовложением покончено? С этим Гриззеком Пеногоном.\n\nТолько не скупись на детали! Выкладывай!', '', 29981),
(172154, 'ruRU', 'Пусть сразу убегает, если все-таки вляпается!', '', 29981),
(172153, 'ruRU', 'Никогда не ввязывайся в политику! Никогда!', '', 29981),
(172152, 'ruRU', 'А, и... поблагодари за меня Газлоу. Я ему обязан, и расплачусь одним советом, который ты и передашь.', '', 29981),
(172151, 'ruRU', '', 'Помни: мы не встречались!', 29981),
(172150, 'ruRU', 'Привет, Саффи!', '', 29981),
(172149, 'ruRU', 'Время до цели: приблизительно двадцать секунд.', '', 29981),
(172148, 'ruRU', 'Соединение восстановлено.', '', 29981),
(172147, 'ruRU', 'Соединение потеряно. Ошибка 37. Выполняю коррекцию.', '', 29981),
(172146, 'ruRU', 'Попытка восстановления.', '', 29981),
(172145, 'ruRU', 'Ослабление сигнала. Обнаружены атмосферные возмущения.', '', 29981),
(172144, 'ruRU', 'Эй, $p! Сюда!', '', 29981),
(172143, 'ruRU', 'Помни, я заплачу вдвойне!', '', 29981),
(172139, 'ruRU', 'Ха-ха-ха-ха-ХА-ХА-ХА!', '', 29981),
(172134, 'ruRU', 'Народ, наши инвестиции принесли плоды! Айда на поиски новой наживы.', '', 29981),
(172130, 'ruRU', 'Лады, ребятки, нам заплатили! По первому кругу – угощаю!', '', 29981),
(172100, 'ruRU', 'Джо\'нок пришел на зов королевы зандаларов.\n\nЧего тебе, кроха?', '', 29981),
(172099, 'ruRU', 'Только посмотри на эти фолианты! Свитки! Книги!\n\nЯ знал, что зандалары накопили много знаний, но этого хватит, чтобы занять меня на десятки лет!\n\nСтарина Торга был прав, как и всегда. Лучшие истории получаются из самых необычных приключений.\n\nМне уже не терпится узнать, что будет дальше!', '', 29981),
(172098, 'ruRU', '', '<Мастер клинка Каджа увлечена разговором с генералом Ракирой.>', 29981),
(172097, 'ruRU', '', '<Генерал Ракира увлечена разговором с мастером клинка Каджей.>', 29981),
(172096, 'ruRU', 'Ветра меняются... Ты ощущаешь это в воздухе?', '', 29981),
(172095, 'ruRU', '', 'А, $n!\n\nПока королева Таланджи занимается восстановлением нашей империи, Совет Занчули должен позаботиться о том, чтобы подданные не волновались и дали ей время завершить начатое.\n\nСреди жрецов до сих пор не утихли разные слухи и сомнения, но со временем и они признают в Таланджи достойного лидера, как это сделала я.', 29981),
(172094, 'ruRU', '', 'Свет лоа да озарит твой путь, $n.', 29981),
(172093, 'ruRU', '', 'Как сказал бы мой отец, хорошо быть королевой.\n\nЯ очень по нему скучаю. Раньше я и не надеялась стать достойной его. Но теперь понимаю, что даже мудрейшие и старейшие из нас не могут предвидеть всего. Даже пророк Зул не смог.\n\nЧто ждет нас впереди, я не знаю. Но Зандалар возвысится и будет готов к любым переменам.\n\nВ этом я уверена.', 29981),
(172088, 'ruRU', 'Не для того меня сестра подписала на это задание, чтобы я в штормградских барах прохлаждался.\n\nСкоро, очень скоро мы вновь схлестнемся с Ордой. Море зовет, уж это никогда не меняется.', '', 29981),
(172087, 'ruRU', 'Эхей, $n.\n\nАртиллерия этого города внушает уважение. Теперь я понимаю, как он так долго продержался.\n\nНапоминает о родине, право слово.', '', 29981),
(172086, 'ruRU', '', 'Надеюсь, мы здесь не в качестве украшений, $n.\n\nДля наших друзей из Орды я достаточно гарпунов припасла.', 29981),
(172084, 'ruRU', 'Рад новой встрече, $n!\n\nЯ надеялся, что ты заглянешь. Без Дориан тут совсем тихо стало.\n\nОй, только пойми меня правильно, я люблю тишину. Да и до Бреннадама всегда рукой подать, если не будет хватать общения. Моя старушка все равно никогда не любила праздной болтовни.\n\nОна сказала, что скоро навестит. Было бы славно.\n\n<Что-то довольно напевая под нос, Сэл возвращается к уходу за садом.>', '', 29981),
(172082, 'ruRU', 'Раньше быть жрецом моря значило плавать по всему свету. Мне не терпится узнать, куда нас приведут эти дивные новые течения.', '', 29981),
(172081, 'ruRU', '', 'У Томаса Зеллинга есть... была семья. Он взял с меня обещание защитить их, даже когда они посчитали его монстром и отвергли. Это обещание я не нарушу никогда.\n\nЕсли они когда-нибудь спросят, какая судьба постигла их мужа и отца, я скажу, что он погиб героем. Мы, Отрекшиеся, приходим в мир со свободной волей. Вот что отличает нас от Плети. Сильвана Ветрокрылая когда-то гордилась этим.\n\nНо после всего, что я видела на этой войне, я не уверена, что это все еще так.', 29981),
(172080, 'ruRU', 'Когда-то Тирион Фордринг пожертвовал всем, чтобы сохранить мне жизнь, по зову чести. Бейн поступил так же. И сейчас мы накажем его за это?\n\nБоюсь, Орда превращается в то, что мы когда-то ненавидели, $c. И мне это не по душе.', '', 29981),
(172079, 'ruRU', '', 'Видишь, что случилось с Бейном? И с Зеллингом? Вот потому нам нужно залечь на дно, не привлекать внимания и следовать приказам вождя. Пока что.\n\nОшибка Бейна не в том, что он выступил против Сильваны. А в том, что он сделал это слишком рано.', 29981),
(172078, 'ruRU', 'Кое-кому нужно услышать об этом, $n.\n\nИ они услышат.', '', 29981),
(172077, 'ruRU', '', 'И это принципы Орды? Брать под стражу тех, кто был движим честью и состраданием?\n\nБыть может, моему народу не следовало покидать Крутогорье.', 29981),
(172076, 'ruRU', '', 'Наше восстание против Элисанды было справедливым, но в результате я получила клинок в спину. Надеюсь, Бейна минует подобная судьба.\n\nНочнорожденные недавно примкнули к Орде. Возможно, мне следует попросить совета у Лор\'темара. Он понимает, через что прошел мой народ, и я многое почерпнула из наших с ним разговоров.', 29981),
(172075, 'ruRU', '', 'Вождь – не орк, но демонстрирует силу, наказывая предавшего и обманувшего ее таурена.\n\nТот, у кого нет верности, не знает и о чести.', 29981),
(172074, 'ruRU', '', 'Без защиты Орды мой народ достался бы на растерзание Альянсу. Мы многим обязаны вождю... но мы не будем слепо следовать за ней.\n\nБейн Кровавое Копыто проявил благородство и уважение к зандаларам. Он заслуживает возможности предстать перед обвинителями и ответить за предполагаемое преступление.', 29981),
(172073, 'ruRU', 'Тут творится скверное джуджу. Орда должна быть едина, если нам нужна победа в этой войне. Но Сильвана... с ней сохранить единство будет непросто.\n\nА это... лишь подливает масла в огонь.', '', 29981),
(172072, 'ruRU', 'Я не могу осуждать мотивы Бейна, несмотря на всю радикальность его действий. Его мятеж выявил в Орде раскол, назревавший с самой атаки на Тельдрассил.\n\nМеня страшит, что он поставил под удар собственный народ, открыто выступив против Сильваны. Как поставлю и я, если приму его сторону.\n\nНастали тяжелые времена. Мы должны быть осторожны... и осмотрительны.', '', 29981),
(172071, 'ruRU', 'Какая неожиданность!\n\nЭх, если бы я знал, что будет так зрелищно... Содрал бы ВДВОЕ большую плату!', '', 29981),
(172051, 'ruRU', '', 'Ты уж позаботься о Пернатом, $p!', 29981),
(172050, 'ruRU', 'Все, пупсик, мы упаковались и готовы отправляться. Ты только скажи.', '', 29981),
(172049, 'ruRU', '', 'Нам пора двигать. Дуболомы Галливикса вот-вот нас найдут!', 29981),
(172048, 'ruRU', 'Эхей, спасибо, что не собираешься болтать обо мне Галливиксу.', '', 29981),
(172047, 'ruRU', '', 'Будем на связи. Наверно. Не знаю.', 29981),
(172046, 'ruRU', 'Здравствуй, богатеище.\n\nДжани будет пристально следить за новой королевой. Подобные ей не поклоняются кому-то вроде меня. Но вот заблестит золотце, и решимость начинает таять.\n\nНу а те, кого Таланджи позабудет, еще придут ко мне.\n\nДо встречи, богатеище.', '', 29981),
(172043, 'ruRU', 'Ошибка 37! Ошибка 37! Перезагрузка!', 'Ошибка 37! Ошибка 37! Перезагрузка!', 29981),
(172042, 'ruRU', 'Перегрузка системы! Очистка кеша!', 'Перегрузка системы! Очистка кеша!', 29981),
(172041, 'ruRU', 'Требуется ввод информации! Нажмите любую кнопку!', 'Требуется ввод информации! Нажмите любую кнопку!', 29981),
(172020, 'ruRU', 'Отвези меня домой.', 'Отвези меня домой.', 29981),
(172019, 'ruRU', '', 'Ох... прости, мне нужно восстановить силы.', 29981),
(172018, 'ruRU', 'Дай попробовать еще раз.', 'Дай попробовать еще раз.', 29981),
