(171879, 'ruRU', 'Аванпост искателей', 'Аванпост искателей', 29981),
(171878, 'ruRU', 'Крааль боевых ящеров', 'Крааль боевых ящеров', 29981),
(171877, 'ruRU', 'Атал\'Грал', 'Атал\'Грал', 29981),
(171876, 'ruRU', 'Фактория тортолланов', 'Фактория тортолланов', 29981),
(171875, 'ruRU', 'Зеб\'ахари', 'Зеб\'ахари', 29981),
(171874, 'ruRU', 'Тропа Эрнестуэя', 'Тропа Эрнестуэя', 29981),
(171873, 'ruRU', 'Атал\'Дазар', 'Атал\'Дазар', 29981),
(171872, 'ruRU', 'Сад лоа', 'Сад лоа', 29981),
(171871, 'ruRU', 'Порт Зандалара', 'Порт Зандалара', 29981),
(171870, 'ruRU', 'Великая Печать', 'Великая Печать', 29981),
(171869, 'ruRU', 'Вот все места, куда я смогу вас безопасно перенести.', '', 29981),
(171868, 'ruRU', 'Куда ты можешь меня доставить?', 'Куда ты можешь меня доставить?', 29981),
(171867, 'ruRU', 'Что пожелаете?', '', 29981),
(171863, 'ruRU', 'Я еще вернусь.', 'Я еще вернусь.', 29981),
(171849, 'ruRU', 'Вы слышали эту крысу. Вперед, ребята!', '', 29981),
(171848, 'ruRU', 'Готово! Вот, пожалуйста.', '', 29981),
(171847, 'ruRU', 'Я это для тебя мигом сделаю, $n!', '', 29981),
(171846, 'ruRU', 'Еще одна глава?! Тебе повезло, я еще не вернул эти книги!', '', 29981),
(171843, 'ruRU', 'Вы хотите купить редкие шкуры Шезы за', 'Вы хотите купить редкие шкуры Шезы за', 29981),
(171842, 'ruRU', 'Шеза говорила о 1000 золотых.', 'Шеза говорила о 1000 золотых.', 29981),
(171841, 'ruRU', '', '...А теперь нужно вырезать на костях руны силы.', 29981),
(171840, 'ruRU', '', 'Хм... На этой чешуе осталось немного мяса. Ванная для известкования отчистит все лишнее.', 29981),
(171839, 'ruRU', 'Я просил по-хорошему.', 'Я просила по-хорошему', 29981),
(171838, 'ruRU', 'Руки Орды, может, и в крови, но смывать ее рано, пока существует Альянс.', '', 29981),
(171810, 'ruRU', '', 'Я начну их вымачивать, чтобы они были готовы, как только понадобятся.', 29981),
(171807, 'ruRU', '', 'Никогда не забывай о Тельдрассиле.$b$bМы заставим Орду ответить за причиненное зло.$b$bИ еще – не трогай миску Хруста. А то тебе повезет, если отделаешься только сломанной рукой.', 29981),
(171802, 'ruRU', '', 'Добро пожаловать в мой магазин, |3-6($c).$b$bТебе интересны мои товары – или ты хочешь $uсам:сама; научиться делать такие?', 29981),
(171801, 'ruRU', 'Вот перевод твоего тома, $n. То еще чтиво, по правде говоря.', '', 29981),
(171800, 'ruRU', 'Да? Да! Вот оно что! Так, где там мои блокноты... А, вот.', '', 29981),
(171799, 'ruRU', 'О! Так вот что эта руна значит. Интересно...', '', 29981),
(171798, 'ruRU', 'Все удалось собрать? Неплохо, $n. А теперь приступим к переводу.', '', 29981),
(171797, 'ruRU', 'Приветствую, дорогой покупатель. Я вожу экзотические товары с великого севера!$b$bПосмотри, что у меня есть!', '', 29981),
(171796, 'ruRU', '', 'Вот, пожалуйста. Прошу, будь осторожнее. Это очень древняя вещь.', 29981),
(171795, 'ruRU', '', 'Вот!', 29981),
(171794, 'ruRU', '', 'Ах да, сейчас-сейчас...', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171758, 'ruRU', '<Дитя Торкали ласково тычется в вас носом.>', '', 29981),
(171757, 'ruRU', 'Дитя Торкали прижимается липкой мордой к вашим рукам и радостно урчит.', '', 29981),
(171756, 'ruRU', 'Дитя Торкали с энтузиазмом принимается жевать фрукт!', '', 29981),
(171755, 'ruRU', '<Погладить дикорога.>', '<Погладить дикорога.>', 29981),
(171754, 'ruRU', '<Предложить |TINTERFACE\\ICONS\\INV_MISC_FOOD_106_FJORDPEACH.BLP:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[сочное манго]|h|r>', '<Предложить |TINTERFACE\\ICONS\\INV_MISC_FOOD_106_FJORDPEACH.BLP:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[сочное манго]|h|r>', 29981),
(171753, 'ruRU', '<Взять фрукт.>', '<Взять фрукт.>', 29981),
(171752, 'ruRU', '', 'Моей лоа чужды вычурные храмы и сверкающие идолы. Весь Зандалар – ее храм, а все, кто странствует по миру – ее паства. \n\nВеликая Мать, Странница, Живая Гора, Крепость – это все ее имена. Я смиренная служительница лоа добычи и желаю, чтобы эта малютка не знала горя.\n\nНадеюсь, вместе мы сможем добиться этого, а?', 29981),
(171751, 'ruRU', '', 'Обычно детеныши растут среди своих сородичей, в окружении братьев и сестер.\n\nЯ понимаю, почему ей одиноко, но, возможно, мы найдем способ поднять ей настроение.\n\nУтром по дороге из города я нашла сочный фрукт. \n\nВдруг он ей придется по вкусу?', 29981),
(171748, 'ruRU', 'Хотите убить меня? Нет уж, лучше я вас!', '', 29981),
(171747, 'ruRU', 'Анар\'ала белоре!', '', 29981),
(171746, 'ruRU', 'Я тебе не по зубам.', '', 29981),
(171745, 'ruRU', 'Вам просто... повезло.', '', 29981),
(171744, 'ruRU', 'Отличная работа!', '', 29981),
(171743, 'ruRU', 'Я тебе не по зубам.', '', 29981),
(171742, 'ruRU', 'Хотите испытать меня?', '', 29981),
(171741, 'ruRU', 'Тщательно перебрав остатки, вы находите некое подобие расколотого надвое ядра с несколькими кусочками самоцвета, подобного тому, что вы ищете.$b$bПохоже, создатель этих существ использовал те самые самоцветы, которые использовались при строительстве алтаря.', '', 29981),
(171740, 'ruRU', '<Предложить |TINTERFACE\\ICONS\\INV_RaptorBaby_red.blp:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[ящера-пищалку]|h|r>', '<Дитя Торкали нетерпеливо ерзает от восторга, завидя ящера-пищалку.>', 29981),
(171739, 'ruRU', '<Дитя Торкали нетерпеливо ерзает от восторга, завидя ящера-пищалку.>', '', 29981),
(171735, 'ruRU', '1250 золотых.$b$bЭто твой последний шанс, |3-6($r). Что ты выберешь?$b$bСделку или похороны?', '', 29981),
(171734, 'ruRU', 'Подбор', 'Подбор', 29981),
(171733, 'ruRU', '', 'Ой, нет, нет, нет. Это не лучший пример для подрастающей молодежи!', 29981),
(171732, 'ruRU', '', 'Бывало и хуже… Но ведь для тебя это не предел?', 29981),
(171729, 'ruRU', '', 'Тебе удалось впечатлить деток. Смотри, как у них глаза загорелись!', 29981),
(171724, 'ruRU', '', 'Изумительно! Знаешь, если не сложится на геройском поприще, подумай об учительской карьере.', 29981),
(171722, 'ruRU', '', 'До того, как юный тортоллан напишет свой первый свиток, ему следует научиться основам начертания. Поучишь молодежь?', 29981),
(171721, 'ruRU', '', 'Еще одна черепаха добралась до воды!', 29981),
(171720, 'ruRU', '', 'Все творения природы должны жить в гармонии. Но все равно, мои любимцы – маленькие черепашки!', 29981),
(171719, 'ruRU', '', 'Малыши-крабы нуждаются в помощи! Не могу смотреть, как живые создания страдают. Ты ведь вмешаешься?', 29981),
(171718, 'ruRU', 'Вы хотите купить редкие шкуры Телониса за', 'Вы хотите купить редкие шкуры Телониса за', 29981),
(171717, 'ruRU', '', 'Приходи утром. Она будет рада видеть тебя снова. Постарайся ее не разочаровать, ладно?', 29981),
(171716, 'ruRU', '', 'Не бойся, это не магическое наваждение.', 29981),
(171715, 'ruRU', '', 'Я останусь здесь и буду готова помочь советом. Но воспитание этой малышки целиком ляжет на твои плечи.', 29981),
(171714, 'ruRU', '', 'Я прибыла проследить за тем, чтобы о дочери моей лоа правильно заботились.', 29981),
(171713, 'ruRU', '', 'Здравствуй, $n. Я Ли\'зел, жрица Торкали.', 29981),
(171712, 'ruRU', '', 'Я все гадала, вмешается ли Великая странница.', 29981),
(171711, 'ruRU', 'Это же грабеж средь бела дня!', 'Это же грабеж средь бела дня!', 29981),
(171710, 'ruRU', 'Конечно, я их куплю.', 'Конечно, я их куплю.', 29981),
(171709, 'ruRU', 'Мне жаль это слышать.$b$bРебята, постарайтесь не слишком тут все запачкать. Я бы не хотел снова переезжать.', '', 29981),
(171708, 'ruRU', 'Ну что ж, ребята! Дело сделано.$b$bПойдем-ка в лучшее заведение и отпразднуем эту чудесную сделку!', '', 29981),
(171707, 'ruRU', 'Что ж, поговорим по-плохому.', 'Что ж, поговорим по-плохому.', 29981),
(171706, 'ruRU', 'Ладно, сколько ты хочешь за шкуры?', 'Ладно, сколько ты хочешь за шкуры?', 29981),
(171705, 'ruRU', 'Хм... $uДерзкий:Дерзкая;?$b$bПослушай, |3-6($r), ты мне нравишься, поэтому я дам тебе шанс передумать. Хорошенько взвесь все \"за\" и \"против\".$b$bУ моих ребят давно кулаки чешутся, а это дело – не то, из-за чего стоит попрощаться с жизнью.$b$bНу, что скажешь?', '', 29981),
(171704, 'ruRU', 'Отдай шкуры, или в этом мире станет парочкой грабителей меньше.', 'Отдай шкуры, или в этом мире станет парочкой грабителей меньше.', 29981),
(171703, 'ruRU', 'Великолепно! Говорил я этой кучке негодяев, есть еще в мире порядочные люди.$b$b<Он берет ваше золото и дает вам маленький серебряный ключ.>$b$bБыло нескрываемым удовольствием иметь дело с $uтаким любезным господином:такой любезной госпожой;.$b$bНадеюсь, все твои прочие начинания будут столь же легко осуществимыми и плодотворными.', '', 29981),
(171702, 'ruRU', 'О-о-о! Это мне нравится! Хоть кто-то понимает, как делается бизнес, и ведет себя при этом как $uучтивый джентльмен:истинная леди;.$b$bСначала я собирался заломить цену, но раз уж ты $uоказался столь... дипломатичен:оказалась столь дипломатична;, не могу не ответить взаимностью.$b$b1250 золотых. Если у тебя хватит монет, ты получишь свои драгоценные шкуры, и мы расстанемся друзьями.$b$bЧто скажешь?', '', 29981),
(171701, 'ruRU', 'Давай не будем прибегать к насилию. Я просто хочу купить шкуры.', 'Давай не будем прибегать к насилию. Я просто хочу купить шкуры.', 29981),
(171692, 'ruRU', 'Добрый день.$b$bПозволь предложить твоему вниманию мой ассортимент кожи.$b$bЦены более чем доступные... Можно сказать, от себя отрываю.', '', 29981),
(171686, 'ruRU', 'Я бы с удовольствием послушал еще, но мне нужно взять этот кодекс и идти.', 'Я бы с удовольствием послушала еще, но мне нужно взять этот кодекс и идти.', 29981),
(171685, 'ruRU', 'Именно! Нага спрашивает о его самочувствии. И знаешь, что он ей отвечает? \n\n<Тупа достает книгу и начинает водить пальцем по страницам в поисках нужного абзаца. Затем он прочищает горло и зачитывает:>\n\n\"Сперва я подумал, что спасен. Но глядя в твои глаза, я понял, что все еще тону в бездонном море\". И она тоже начинает флиртовать с ним!\n\nНага и человек ведут фривольную беседу! Вот за что я люблю выдуманные истории! А тебе они нравятся?', '', 29981),
(171684, 'ruRU', 'Невероятно! Нагу?!', 'Невероятно! Нагу?!', 29981),
(171679, 'ruRU', 'Позже герой приходит в себя на берегу довольно большого острова. Его раны перемотаны водорослями, а где-то рядом звучит прекраснейший голос, напевающий песню. \n\nМарк озирается, чтобы узнать, чей же это голос, и видит... такого, конечно, на самом деле не может быть, но видит он нагу!', '', 29981),
(171678, 'ruRU', 'Что же было дальше?', 'Что же было дальше?', 29981),
(171677, 'ruRU', 'Очень интересно, но как насчет кодекса?..', 'Очень интересно, но как насчет кодекса?..', 29981),
(171676, 'ruRU', 'Все начинается с того, что Марк попадает в плен к пиратам. Впрочем, вскоре ему удается убедить их освободить его. \n\nНо тут пиратский корабль атакует самый настоящий кракен! \n\nПосле долгого боя, сопровождаемого отборной бранью, пучина поглощает и корабль, и Марка!', '', 29981),
(171674, 'ruRU', 'Несчастные слепые глупцы!', '', 29981),
(171673, 'ruRU', 'Моих слуг постигла неудача... Возможно, потребуется еще одно предупреждение!', '', 29981),
(171672, 'ruRU', 'Тень... лишь бледная тень... подлинного могущества Хранителя Магии!', '', 29981),
(171671, 'ruRU', 'Много неустойчивой энергии... но чтобы уничтожить вас, я готов рискнуть!', '', 29981),
(171670, 'ruRU', 'Если бы вы только могли понять!', '', 29981),
(171669, 'ruRU', 'Ну что, теперь тебе понятно? Или нет?', '', 29981),
(171668, 'ruRU', 'Сожалею, это было необходимо.', '', 29981),
(171667, 'ruRU', 'Все, что я делал... было во имя Азерота...', '', 29981),
(171666, 'ruRU', 'Ха! Я вас уже заждался. Надеюсь, вы готовы к настоящему бою.', '', 29981),
(171665, 'ruRU', 'Вы... победили. Интересно, хватит ли вам сил, чтобы одержать верх... над ним.', '', 29981),
(171664, 'ruRU', 'Не стоило дразнить быка...', '', 29981),
(171663, 'ruRU', 'С тобой покончено!', '', 29981),
(171662, 'ruRU', 'Встать!.. Размазня!', '', 29981),
(171661, 'ruRU', 'А как вам ЭТО?', '', 29981),
(171660, 'ruRU', 'И это все, на что вы способны?', '', 29981),
(171659, 'ruRU', 'Похоже, мне придется заняться этим самому. Чудесно!', '', 29981),
(171657, 'ruRU', '', 'Восстань, защитник мой!', 29981),
(171656, 'ruRU', 'Ха-ха-ха, это только разминка!', '', 29981),
(171655, 'ruRU', 'Сражайтесь!', '', 29981),
(171654, 'ruRU', 'Покажите мне, на что способны!', '', 29981),
(171653, 'ruRU', 'Не щадите никого!', '', 29981),
(171652, 'ruRU', 'Достойная... смерть.', '', 29981),
(171651, 'ruRU', 'Выше ногу! Или у тебя с этим проблемы?', '', 29981),
(171650, 'ruRU', 'Что тебе дома не сиделось?', '', 29981),
(171646, 'ruRU', 'В каждом из нас есть свой демон...', '', 29981),
(171645, 'ruRU', 'Мне нет равных!', '', 29981),
(171644, 'ruRU', 'Умри, смертное ничтожество!', '', 29981),
(171643, 'ruRU', 'Да... да!', '', 29981),
(171642, 'ruRU', 'Смерть, смерть!', '', 29981),
(171641, 'ruRU', 'Вот так, да!', '', 29981),
(171640, 'ruRU', 'Ну, кто теперь главный?', '', 29981),
(171639, 'ruRU', 'Вы не можете убить меня, глупцы! Я вернусь... Я...', '', 29981),
(171638, 'ruRU', 'Мне и кости не нужны, чтобы одолеть вас!', '', 29981),
(171637, 'ruRU', 'Моя дряхлая плоть лишь мешала в бою!', '', 29981),
(171636, 'ruRU', 'Нет! Я не могу... снова... проиграть.', '', 29981),
(171635, 'ruRU', 'Бренная плоть.', '', 29981),
(171634, 'ruRU', 'Пора заканчивать этот фарс!', '', 29981),
(171633, 'ruRU', 'Трагично.', '', 29981),
(171632, 'ruRU', 'Ты испортил мой торжественный выход, гнусная крыса.', '', 29981),
(171631, 'ruRU', 'Ты и правда считаешь, что участники вашего жалкого турнирчика смогут одолеть посланника Короля-лича?', '', 29981),
(171630, 'ruRU', 'Я доведу начатое до конца.', '', 29981),
(171629, 'ruRU', 'Защищайтесь, хотя вряд ли это поможет...', '', 29981),
(171628, 'ruRU', 'Плоть... слаба!', '', 29981),
(171627, 'ruRU', 'Покажите мне все, на что вы способны!', '', 29981),
(171626, 'ruRU', 'АААААААА! Узрите же ярость железа и стали!', '', 29981),
(171625, 'ruRU', 'Освобождаю тебя от проклятья жизни!', '', 29981),
(171624, 'ruRU', 'Болвин умьёл марньяр!', '', 29981),
(171623, 'ruRU', 'Я величайший из сыновей своего отца! Пришел ваш конец!', '', 29981),
(171622, 'ruRU', 'Это невозможно... Плоть не может быть сильнее!', '', 29981),
(171621, 'ruRU', 'Поджарьтесь!', '', 29981),
(171620, 'ruRU', 'Истекайте кровью!', '', 29981),
(171619, 'ruRU', 'За меня... отомстят...', '', 29981),
(171618, 'ruRU', 'Ничтожество.', '', 29981),
(171617, 'ruRU', 'Эта смерть – не последняя.', '', 29981),
(171616, 'ruRU', 'Пойдешь на корм!', '', 29981),
(171614, 'ruRU', 'Ощутите мой гнев!', '', 29981),
(171613, 'ruRU', 'Подходите! Я накормлю зверей вашим мясом.', '', 29981),
(171612, 'ruRU', 'Разлом! Я отомщу за тебя! Враги. Умоются. Кровью.', '', 29981),
(171611, 'ruRU', 'Этот гнев... Почувствуйте ярость волка!', '', 29981),
(171610, 'ruRU', '', 'Чтобы бросить вызов госпоже иллюзий, нужна немалая храбрость. Ну что ж... Посмотрим, на что вы способны.', 29981),
(171609, 'ruRU', '', 'Что, глаза разбегаются?', 29981),
(171608, 'ruRU', '', 'Ох, не запачкай ковер своей кровью.', 29981),
(171607, 'ruRU', '', 'Пепел к пеплу, прах к праху!', 29981),
(171606, 'ruRU', '', 'Может, в следующий раз вам повезет больше!', 29981),
(171605, 'ruRU', '', 'Давайте, испытайте удачу. Ха-ха-ха...', 29981),
(171604, 'ruRU', '', 'Оказывается... умирать... больно...', 29981),
(171603, 'ruRU', '', 'Слуги мои, дети разрушителя мира, взываю к вам! Священные покои нашего отца осквернены! Убейте чужаков!', 29981),
(171602, 'ruRU', '', 'Моя гибель откроет бесконечную череду смертей. Мое бремя ложится на вас.', 29981),
(171601, 'ruRU', '', 'Жертва для тебя, господин.', 29981),
(171600, 'ruRU', '', 'Узрите мощь, дарованную мне Смертокрылом! Почувствуйте ярость земли!', 29981),
(171599, 'ruRU', '', 'Мир переродится в пламени!', 29981),
(171597, 'ruRU', 'Стройся! В атаку!', '', 29981),
(171596, 'ruRU', 'Я никогда не упускаю добычу!', '', 29981),
(171595, 'ruRU', 'Я сам стал... добычей...', '', 29981),
(171593, 'ruRU', 'Так-так! Еще одна шайка воришек решила увести мою лошадь?', '', 29981),
(171591, 'ruRU', 'Вперед, Полночь, к победе!', '', 29981),
(171590, 'ruRU', 'Верная Полночь... Сколько лет мы охотились вместе, добывая дичь к хозяйскому столу...', '', 29981),
(171589, 'ruRU', 'Теперь мы охотимся ради веселья и славы!', '', 29981),
(171588, 'ruRU', 'Еще один трофей в коллекцию!', '', 29981),
(171587, 'ruRU', 'Легкая добыча!', '', 29981),
(171585, 'ruRU', 'У них не было шансов! Убивать – мое призвание!', '', 29981),
(171584, 'ruRU', 'Замрите и узрите свет!', '', 29981),
(171583, 'ruRU', 'И застелют небо грозовые тучи, и прольются смертоносным ливнем!', '', 29981),
(171582, 'ruRU', 'ХА!', '', 29981),
(171581, 'ruRU', 'Другие позавидуют твоей участи!', '', 29981),
(171580, 'ruRU', 'Вас ждет омут безумия!', '', 29981),
(171579, 'ruRU', 'Никто не превзойдет силу шторма.', '', 29981),
(171578, 'ruRU', 'Заседание Железного Собрания объявляется закрытым!', '', 29981),
(171577, 'ruRU', 'Кто бы вы ни были – жалкие бродяги или великие герои... Вы всего лишь смертные!', '', 29981),
(171576, 'ruRU', 'Я так просто не сдамся! Нет, у меня есть еще пара трюков в запасе...', '', 29981),
(171575, 'ruRU', 'Хватит меня мучить!', '', 29981),
(171574, 'ruRU', 'Этот кошмар когда-нибудь закончится?', '', 29981),
(171573, 'ruRU', 'Убирайтесь в холодный мрак!', '', 29981),
(171572, 'ruRU', 'Горите, выродки!', '', 29981),
(171571, 'ruRU', 'Знайте же: и побитый пес может укусить!', '', 29981),
(171570, 'ruRU', 'Наконец-то кошмар закончился...', '', 29981),
(171569, 'ruRU', 'Я не какой-то жалкий фокусник! Я Ниелас Аран!', '', 29981),
(171568, 'ruRU', 'Кто вы? Что вам нужно? Прочь от меня!', '', 29981),
(171567, 'ruRU', 'Умоляю, хватит! Мой сын... он сошел с ума!', '', 29981),
(171565, 'ruRU', '', 'Пламя в помощь тени!', 29981),
(171564, 'ruRU', '', 'Сакролаш!', 29981),
(171563, 'ruRU', '', 'Эдир Хараш!', 29981),
(171562, 'ruRU', '', 'Дер\'ек... манул.', 29981),
(171561, 'ruRU', '', 'Да поглотит тебя пламя!', 29981),
(171560, 'ruRU', '', 'Удача отвернулась от вас!', 29981),
(171559, 'ruRU', 'Ох уж эта молодежь. Вечно куда-то спешите. Ладно, держи кодекс.$b$bЕсли захочешь услышать всю историю о Марке, ты знаешь, где меня найти.', '', 29981),
(171558, 'ruRU', 'Ваша смерть будет быстрой, чужаки. Сидели бы вы лучше дома...', '', 29981),
(171557, 'ruRU', 'Мои орлы пожрут ваши души! Ваши жертвы будут не напрасны!', '', 29981),
(171556, 'ruRU', 'Не ной!', '', 29981),
(171555, 'ruRU', 'Ничего у тебя не вышло!', '', 29981),
(171554, 'ruRU', 'Пируйте, братья мои!', '', 29981),
(171553, 'ruRU', 'Вам не победить... мой дух...', '', 29981),
(171552, 'ruRU', 'Мне надоело тратить на вас время!', '', 29981),
(171551, 'ruRU', 'Я – охотник! Вы – добыча!', '', 29981),
(171550, 'ruRU', 'Как интересно! И что же там произошло?', 'Как интересно! И что же там произошло?', 29981),
(171549, 'ruRU', 'Это безумно интересно, но я бы хотел просто одолжить кодекс, если можно.', 'Это безумно интересно, но я бы хотела просто одолжить кодекс, если можно.', 29981),
(171548, 'ruRU', 'Скарвальд, некомпетентное ты ничтожество! Вернись и сделай хоть что-нибудь полезное!', '', 29981),
(171547, 'ruRU', 'Ты мне еще пригодишься.', '', 29981),
(171546, 'ruRU', 'Нет... смерти... почетнее...', '', 29981),
(171545, 'ruRU', 'До... скорой... встречи...', '', 29981),
(171544, 'ruRU', 'Конечно, зачем напрягаться, пытаясь оценить обстановку, недоумок! Лучше сразу полезть на рожон!', '', 29981),
(171543, 'ruRU', 'Да, конечно. Занятнейшее чтиво, скажу я тебе.$b$bОднако же мне попались и другие книги. Одна из них тебя наверняка заинтересует куда больше, ведь она повествует о приключениях и о разбитых сердцах!$b$bГлавного героя зовут Марк, и он путешествует по всему миру, соблазняя одну женщину за другой!$b$bТам такое происходит, что тебе и не снилось!', '', 29981),
(171542, 'ruRU', 'Я слышал, в недавних странствиях тебе попался древний кодекс земельников. Можешь одолжить?', 'Я слышала, в недавних странствиях тебе попался древний кодекс земельников. Можешь одолжить?', 29981),
(171541, 'ruRU', 'Приключения заждались тебя, $gюный воин:юная воительница;!', '', 29981),
(171540, 'ruRU', 'Ну конечно! Только не сочти за бестактность – я гораздо сговорчивее, когда слышу звон монет.$b$bПлати – и бери все что хочешь.', '', 29981),
(171539, 'ruRU', 'У тебя могут быть свитки, которые я ищу.', 'У тебя могут быть свитки, которые я ищу.', 29981),
(171538, 'ruRU', 'Приветствую, дорогой покупатель. Я вожу экзотические товары с великого севера!$b$bПосмотри, что у меня есть!', '', 29981),
(171537, 'ruRU', 'Ты погубишь Орду!', '', 29981),
(171536, 'ruRU', 'Ты предаешь Орду!', '', 29981),
(171535, 'ruRU', 'Неужели мы все для тебя просто пешки?', '', 29981),
(171534, 'ruRU', 'Я вернул Дерека Праудмура его семье.', '', 29981),
(171533, 'ruRU', '', 'Ему помогли, так ведь?..', 29981),
(171532, 'ruRU', '', 'В наших рядах завелись предатели.', 29981),
(171531, 'ruRU', '', 'Вот, пожалуйста. Прошу, будь осторожнее. Это очень древняя вещь.', 29981),
(171530, 'ruRU', '', 'Вот!', 29981),
(171529, 'ruRU', '', 'Ах да, сейчас-сейчас...', 29981),
(171528, 'ruRU', 'Я ищу книгу о рунах и резных письменах. Можно одолжить твою?', 'Я ищу книгу о рунах и резных письменах. Можно одолжить твою?', 29981),
(171527, 'ruRU', 'Дитя Торкали мигом сметает корм и смотрит на вас выжидающе.', '', 29981),
(171526, 'ruRU', 'Дитя Торкали съедает всю еду, что была у вас в руках, а затем обнюхивает все вокруг, пытаясь найти еще.', '', 29981),
(171525, 'ruRU', 'Дитя Торкали ест так быстро, что разбрасывает еду повсюду вокруг себя. Она смотрит на вас и издает трубный возглас, требуя еще.', '', 29981),
(171524, 'ruRU', 'Дитя Торкали съедает корм и тут же проверяет, нет ли у вас в руках еще.', '', 29981),
(171523, 'ruRU', 'Дитя Торкали нюхает корм и смотрит на вас выжидающе.', '', 29981),
(171521, 'ruRU', 'Дитя Торкали зевает и укладывается поудобнее.', '', 29981),
(171520, 'ruRU', '<Дитя Торкали ищет в вашей руке что-нибудь съестное.>', '', 29981),
(171519, 'ruRU', '<Дитя Торкали ерзает на месте, завидя вас.>', '', 29981),
(171518, 'ruRU', '<Дитя Торкали нюхает вашу руку.>', '', 29981),
(171517, 'ruRU', '<Дитя Торкали моргает, доверчиво глядя на вас снизу вверх.>', '', 29981),
(171516, 'ruRU', '<Дитя Торкали срывает лист, предлагая его вам.>', '', 29981),
(171515, 'ruRU', '<Дитя Торкали кружится на месте, завидя вас.>', '', 29981),
(171514, 'ruRU', '<Дитя Торкали слегка касается рогом вашей руки.>', '', 29981),
(171513, 'ruRU', '<С вашим приближением дитя Торкали перетаптывается с ноги на ногу.>', '', 29981),
(171512, 'ruRU', '<Дитя Торкали издает тихий приветственный трубный возглас.>', '', 29981),
(171511, 'ruRU', 'Я благодарен Элуне за то, что мы живы, и за сильных союзников, благодаря которым у нас есть и время, и ресурсы, чтобы восстановить силы.', '', 29981),
(171510, 'ruRU', 'Дитя Торкали охотно поедает траву из корзины с подношениями.', '', 29981),
(171501, 'ruRU', '', 'Была рада знакомству, $n. Быть может, мы еще встретимся в другом времени.', 29981),
(171484, 'ruRU', '', 'Поторопимся, $n. Боюсь, у меня мало времени – и кто знает, куда заведет нас эта охота', 29981),
(171480, 'ruRU', 'Меня прислала Шеза. Я пришел поговорить о товаре.', 'Меня прислала Шеза. Я пришла поговорить о товаре.', 29981),
(171460, 'ruRU', '', 'Где-то рядом должен быть разрыв. Давай скорее залатаем его.', 29981),
(171459, 'ruRU', 'Послушай, ты, похоже, $gславный малый:славная малая;.\n\nТак что плати и вали отсюда. Или мне придется шепнуть на ушко ребятам из отдела возврата активов Торговой компании, чтобы они прошерстили твои сумки. Вдруг они найдут в них что-нибудь, что по праву принадлежит конторе.\n\nИ поверь, ты будешь $gочень удивлен:очень удивлена; количеству найденного.\n\nСечешь?', '', 29981),
(171458, 'ruRU', 'Верно! Раньше цена была 1000 золотых.\n\nНо она совсем забыла о моих \"комиссионных\".\n\n1250 золотых, и торг здесь неуместен!\n\nХотя, учитывая, что предложение ограничено, а спрос неожиданно повысился, дальнейшее повышение цены кажется финансово оправданным.\n\n<На его лице проступает широкая желтозубая ухмылка.>', '', 29981),
(171457, 'ruRU', 'Корова объяснила ситуацию, да? В общем, деньги не пахнут. Мне без разницы, кому достанется товар.\n\nЕсли тебе нужно содержимое сундука, внеси оплату в размере 1250 золотых — и товар твой!', '', 29981),
(171456, 'ruRU', 'Эй, привет! Я вижу блеск в твоих умных глазах.\n\nТы ведь не откажешься приобрести хорошей кожи?', '', 29981),
(171451, 'ruRU', '', 'Нам выпало то еще путешествие, $n. Но тебе нужно уделить время другим делам.\n\nТы $gготов:готова;?', 29981),
(171450, 'ruRU', 'Пора отправляться.', 'Пора отправляться.', 29981),
(171442, 'ruRU', '', 'Но ничего. Сейчас я покончу с вами $uобоими:обеими;.', 29981),
(171441, 'ruRU', '', 'Вижу, ты выбралась из моей ловушки. В час нужды мы способны проявлять невероятную стойкость.', 29981),
(171428, 'ruRU', '', 'Меня разрывает... на части... Возьми мою нить. Закрой... порталы! А-а-а!', 29981),
(171427, 'ruRU', '', '$n! Помоги! Это была... ловушка...', 29981),
(171426, 'ruRU', '', 'Я обыщу окрестности, чтобы узнать, пытался ли Мерек передать мне что-то важное.', 29981),
(171425, 'ruRU', '', 'В моем ордене учат оставлять такие неявные подсказки, что их заметит только другой темный следопыт.', 29981),
(171423, 'ruRU', '', 'Пока ты ищешь следы, я проведу собственное расследование.', 29981),
(171416, 'ruRU', '', 'Постой, $n! Не трогай этот портал!', 29981),
(171415, 'ruRU', '<Активировать подпрограмму возвращения.>', '<Активировать подпрограмму возвращения.>', 29981),
(171404, 'ruRU', 'Хотите знать больше? Возьмите брошюру. У нас много разных.', 'Хотите знать больше? Возьмите брошюру. У нас много разных.', 29981),
(171403, 'ruRU', 'Не верьте лжецам из Альянса. Им наплевать на вас.', 'Не верьте лжецам из Альянса. Им наплевать на вас.', 29981),
(171401, 'ruRU', 'Пожертвуйте на нужды Алого братства! Помогите нам – и мы поможем вам!', 'Пожертвуйте на нужды Алого братства! Помогите нам – и мы поможем вам!', 29981),
(171400, 'ruRU', 'Нежити не жить!', 'Нежити не жить!', 29981),
(171399, 'ruRU', 'Повторяйте со мной: Лордерон – для живых!', 'Повторяйте со мной: Лордерон – для живых!', 29981),
(171398, 'ruRU', 'Вы разве не хотите, чтобы вашу землю очистили от этой поганой нежити?', 'Вы разве не хотите, чтобы вашу землю очистили от этой поганой нежити?', 29981),
(171397, 'ruRU', 'Ха-ха! Сюда!', '', 29981),
(171396, 'ruRU', 'Я устал от ненависти.', 'Я устала от ненависти.', 29981),
(171395, 'ruRU', 'Разве в этом дух старого Лордерона?', 'Разве в этом дух старого Лордерона?', 29981),
(171391, 'ruRU', 'Приказ распознан. Передача прервана.', '', 29981),
(171390, 'ruRU', '', 'Пернатый! Как ты... Пернатый! Прервать передачу! Прервать...', 29981),
(171389, 'ruRU', 'Привет, Саффи!', '', 29981),
(171388, 'ruRU', 'Нахожусь в радиусе передачи. Начинаю передачу.', '', 29981),
(171386, 'ruRU', 'Возобновляю выполнение протокола', '', 29981),
(171383, 'ruRU', 'Слабый сигнал. Повторная калибровка.', '', 29981),
(171382, 'ruRU', 'Отплытие', 'Отплытие', 29981),
(171381, 'ruRU', '<Начать отладку.>', '<Начать отладку.>', 29981),
(171380, 'ruRU', 'Пр... <шипение> ...и-и-ивет!', '', 29981),
(171377, 'ruRU', '', '', 29981),
(171376, 'ruRU', 'Сигнал найден. Активация протокола \"Найти Саффи\".', '', 29981),
(171375, 'ruRU', 'Маяк возвращения активирован. Поиск сигнала.', '', 29981),
(171374, 'ruRU', 'Нежить – это чума. В этом сомнений нет.', 'Нежить – это чума. В этом сомнений нет.', 29981),
(171373, 'ruRU', 'Не со всем я, конечно, согласен...', 'Не со всем я, конечно, согласна...', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171372, 'ruRU', 'В братстве правду говорят.', 'В братстве правду говорят.', 29981),
(171371, 'ruRU', 'Самое время привести этот мир в равновесие, как ты считаешь?', '', 29981),
(171335, 'ruRU', 'Чудовища... вы все чудовища...', 'Чудовища... вы все чудовища...', 29981),
(171334, 'ruRU', 'За... Лордерон...', 'За... Лордерон...', 29981),
(171333, 'ruRU', 'Грязные... твари...', 'Грязные... твари...', 29981),
(171332, 'ruRU', 'Наше королевство... снова будет... великим...', 'Наше королевство... снова будет... великим...', 29981),
(171331, 'ruRU', 'Вы – черное пятно... на этой земле...', 'Вы – черное пятно... на этой земле...', 29981),
(171330, 'ruRU', 'Мерзкая нечисть!', 'Мерзкая нечисть!', 29981),
(171329, 'ruRU', 'Мы вернем Лордерону былую славу!', 'Мы вернем Лордерону былую славу!', 29981),
(171328, 'ruRU', 'За Алое братство!', 'За Алое братство!', 29981),
(171327, 'ruRU', 'Вы заплатите за то, что явились сюда!', 'Вы заплатите за то, что явились сюда!', 29981),
(171326, 'ruRU', 'Лордерон принадлежит НАМ!', 'Лордерон принадлежит НАМ!', 29981),
(171325, 'ruRU', '', 'Поспешим же!', 29981),
(171324, 'ruRU', 'Делорми, я готов.', 'Делорми, я готова.', 29981),
(171323, 'ruRU', '', 'Мне кажется, я знаю, где и когда нам следует начать поиски. Скажи, когда подготовишься.', 29981),
(171321, 'ruRU', 'До свидания, $gзащитник:защитница; природы. Надеюсь, наши пути еще пересекутся.', '', 29981),
(171320, 'ruRU', 'Ты можешь выбрать любое качество духа Хати – и оно станет твоим до тех пор, пока ты будешь бороться с теми, кто желает зла нашему миру.', '', 29981),
(171319, 'ruRU', 'Положи на нее руку и вспомни испытания, которые тебе довелось пройти вместе с Хати.', '', 29981),
(171318, 'ruRU', 'Как только Грозовая искра окажется на месте, мы увидим, на что она по-настоящему способна.', '', 29981),
(171317, 'ruRU', 'О, $p! А я как раз думал, куда ты $gзапропастился:запропастилась;?', '', 29981),
(171316, 'ruRU', '', 'Что-нибудь понравилось? Ты можешь получить это бесплатно!', 29981),
(171315, 'ruRU', '', 'Теперь, когда ты знаешь, как это делается, попробуй $gсам:сама;. Вот, возьми мою нить.', 29981),
(171314, 'ruRU', '', 'А вот и разрыв! Я все сделаю, но ты смотри внимательно.', 29981),
(171312, 'ruRU', 'Ух ты... мертвец!', '', 29981),
(171311, 'ruRU', 'За тобой последуют тысячи.', '', 29981),
(171310, 'ruRU', 'Да Амани ди чука!', '', 29981),
(171309, 'ruRU', 'Знакомьтесь, мои новые братишки: клык и коготь!', '', 29981),
(171308, 'ruRU', 'Никому не спрятаться от орла!', '', 29981),
(171307, 'ruRU', 'Не нужно смотреть в небо, чтобы увидеть дракондора!', '', 29981),
(171306, 'ruRU', 'Я могу умереть... но империя Амани... никогда... не падет...', '', 29981),
(171305, 'ruRU', 'Вот почему меня зовут НЕПОБЕДИМЫМ!', '', 29981),
(171304, 'ruRU', 'Сейчас-сейчас. Выучил вот пару новых фокусов... вместе с братишкой-медведем.', '', 29981),
(171303, 'ruRU', 'Зандалары делают нас сильнее. Больше никто не посмеет обижать Амани!', '', 29981),
(171302, 'ruRU', '', 'Есть лишь один путь к просветлению! СМЕРТЬ!', 29981),
(171301, 'ruRU', '', 'Купайся в его силе! Восстань как воплощение ярости господина!', 29981),
(171300, 'ruRU', '', 'За господина я умру и тысячу раз... Тыся...', 29981),
(171299, 'ruRU', '', 'Еретики! Вы поплатитесь за ваше вторжение!', 29981),
(171298, 'ruRU', 'Вихрь погубленных душ взывает к вам!', '', 29981),
(171297, 'ruRU', 'Еще одна душа обогатит Вместилище.', '', 29981),
(171296, 'ruRU', 'Скормлю тебя машине.', '', 29981),
(171295, 'ruRU', '<Предсмертный крик>', '', 29981),
(171294, 'ruRU', 'Я вырву душу из твоего тела!', '', 29981),
(171293, 'ruRU', 'Да хранят тебя волны, $n.', '', 29981),
(171292, 'ruRU', 'Наконец-то гости пожаловали!', '', 29981),
(171291, 'ruRU', 'Тебя не должны увидеть на этом корабле. Твой оберег привязан к порту Зандалара. Туда он тебя и доставит.', '', 29981),
(171290, 'ruRU', 'И прольется кровь.', '', 29981),
(171289, 'ruRU', 'Истина в смерти.', '', 29981),
(171288, 'ruRU', 'Не стоило и отвлекаться на тебя.', '', 29981),
(171287, 'ruRU', 'Темная сфера сделала меня НЕУЯЗВИМЫМ!', '', 29981),
(171286, 'ruRU', 'Моя королева... они идут.', '', 29981),
(171285, 'ruRU', 'Я нигде... и я везде. Я невидимый наблюдатель.', '', 29981),
(171284, 'ruRU', 'Биение ваших сердец – музыка для моих ушей.', '', 29981),
(171283, 'ruRU', 'Последнее... объятье.', '', 29981),
(171282, 'ruRU', 'Я не буду пить твою кровь раньше срока.', '', 29981),
(171281, 'ruRU', 'Бин дорай ам\'овел!', '', 29981),
(171280, 'ruRU', 'Свежая, теплая кровь... Прошло столько времени!', '', 29981),
(171279, 'ruRU', 'Так... вкусно...', '', 29981),
(171278, 'ruRU', 'И все равно я голоден. И все равно я жажду.', '', 29981),
(171277, 'ruRU', 'Я попирую вашими останками!', '', 29981),
(171276, 'ruRU', 'Договорились.', 'Договорились.', 29981),
(171275, 'ruRU', '\"Договориться\"? О чем?', '\"Договориться\"? О чем?', 29981),
(171274, 'ruRU', 'Ох...', '', 29981),
(171273, 'ruRU', 'Моя чаша полна.', '', 29981),
(171272, 'ruRU', 'Теперь вы видите, насколько мы сильны?', '', 29981),
(171271, 'ruRU', 'Кушать... подано.', '', 29981),
(171270, 'ruRU', 'Наксанар был досадным недоразумением! Сила Сферы позволит Валанару свершить отмщение!', '', 29981),
(171269, 'ruRU', 'ПАДИТЕ НИЦ перед сан\'лейн!', '', 29981),
(171268, 'ruRU', 'Вы не доберетесь до господина. Наездники на драконах, в атаку!', '', 29981),
(171264, 'ruRU', 'Я ждал слишком долго. Сейчас вы предстанете пред ликом Жнеца душ.', '', 29981),
(171260, 'ruRU', 'Глупцы! Вы сами нашли свою погибель! Вам никогда не понять, сколь велика сила, потревоженная вами. Вы сражались отчаянно, чтобы проникнуть в царство Жнеца. Теперь перед вами лежит лишь один путь. Путь проклятых.', '', 29981),
(171259, 'ruRU', 'Смерть – единственный выход!', '', 29981),
(171258, 'ruRU', 'Меня... больше... нет.', '', 29981),
(171257, 'ruRU', 'Никто не смеет бросать вызов Шадо-Пан!', '', 29981),
(171256, 'ruRU', 'Их сила тоже велика...', '', 29981),
(171255, 'ruRU', 'Я покажу вам свою силу.', '', 29981),
(171254, 'ruRU', 'Ко мне, змей! Вместе мы уничтожим этих чужаков.', '', 29981),
(171253, 'ruRU', 'Подходите... Смерть вас заждалась.', '', 29981),
(171252, 'ruRU', 'Ничтожество!', '', 29981),
(171250, 'ruRU', 'Змей, наполни меня своей силой!', '', 29981),
(171249, 'ruRU', 'Мы не смогли... даже вместе...', '', 29981),
(171248, 'ruRU', 'Молнии неведома жалость!', '', 29981),
(171247, 'ruRU', 'Галливикс говорил с тобой о Пеногоне? Я так и думал.\n\nПослушай, Гриззек ничего не смыслит в политике, но он хороший парень. Только между нами, ладно? Нам нужны такие гоблины, как он, чтобы двигать вперед инженерную мысль.\n\nПоэтому вот мое встречное предложение. Если найдешь Гриззека, скажи ему залечь на дно, а Галливиксу доложи, что $gразделался:разделалась; с ним.\n\nСделаешь так – и я заплачу тебе вдвое больше. Идет?', '', 29981),
(171246, 'ruRU', '', 'В простоте футболок кроется красота, не правда ли?', 29981),
(171245, 'ruRU', 'Эй, $n!\n\n<Газлоу оглядывается по сторонам и жестом подзывает вас к себе.>\n\nДумаю, мы сможем договориться.', '', 29981),
(171239, 'ruRU', '', 'Так... Кажется, я знаю, в каком временном отрезке я должна находиться. Нужно только переориентироваться.', 29981),
(171237, 'ruRU', 'Призвать сущность \"Жертвы Хати\".', 'Призвать сущность \"Жертвы Хати\".', 29981),
(171236, 'ruRU', 'Призвать сущность \"Укуса змеи\".', 'Призвать сущность \"Укуса змеи\".', 29981),
(171235, 'ruRU', 'Призвать сущность \"Свинобойки\".', 'Призвать сущность \"Свинобойки\".', 29981),
(171234, 'ruRU', 'Призвать сущность \"Рева элекка\".', 'Призвать сущность \"Рева элекка\".', 29981),
(171233, 'ruRU', 'Призвать сущность \"Орлиного глаза\".', 'Призвать сущность \"Орлиного глаза\".', 29981),
(171232, 'ruRU', 'Призвать сущность \"Мощи Титанов\".', 'Призвать сущность \"Мощи Титанов\".', 29981),
(171231, 'ruRU', '<Кристалл звенит от переполняющей его энергии.>', '', 29981),
(171230, 'ruRU', 'Образцы... нужно сохранить.', '', 29981),
(171229, 'ruRU', 'Природа покорна моей воле...', '', 29981),
(171228, 'ruRU', 'Эндорель ануминор!', '', 29981),
(171227, 'ruRU', 'Отправляйся на корм червям!', '', 29981),
(171226, 'ruRU', 'Твой жизненный цикл закончен.', '', 29981),
(171225, 'ruRU', 'Что вы делаете? Эти образцы очень хрупкие!', '', 29981),
(171224, 'ruRU', 'Поиграли – и хватит!', '', 29981),
(171223, 'ruRU', 'Теперь ты принадлежишь мне!', '', 29981),
(171222, 'ruRU', 'Наслаждайтесь последними мгновениями вашей жизни.', '', 29981),
(171221, 'ruRU', 'Владыка Иллидан, я...', '', 29981),
(171220, 'ruRU', 'Отлично!', '', 29981),
(171219, 'ruRU', 'Селама ам\'оронор!', '', 29981),
(171218, 'ruRU', 'У меня есть более важные дела...', '', 29981),
(171214, 'ruRU', 'Хотите увидеть силу? Я покажу вам... силу!', '', 29981),
(171213, 'ruRU', 'После этого ничего не останется!', '', 29981),
(171212, 'ruRU', 'Познакомьтесь с моим большим другом!', '', 29981),
(171211, 'ruRU', 'УБЕЙ ИХ ВСЕХ!', '', 29981),
(171210, 'ruRU', 'Топчи их! Пронзай их!', '', 29981),
(171209, 'ruRU', 'А я тебя предупреждал!', '', 29981),
(171208, 'ruRU', 'Кому нужны боги, если мы сами боги?', '', 29981),
(171207, 'ruRU', 'Какая спешка!', '', 29981),
(171206, 'ruRU', 'Даже сильнейшие... могут пасть.', '', 29981),
(171205, 'ruRU', 'Я вытащу ваши кишки, твари!', '', 29981),
(171204, 'ruRU', 'Сомкнуть ряды!', '', 29981),
(171203, 'ruRU', 'За Орду...', '', 29981),
(171202, 'ruRU', 'Я – Назгрим, кулак вождя и генерал армии Орды. Если мне суждено умереть сегодня, то я умру c честью в битве. За Орду!', '', 29981),
(171201, 'ruRU', 'Воины, бегом!', '', 29981),
(171200, 'ruRU', 'Кор\'крон, ко мне!', '', 29981),
(171199, 'ruRU', 'Я умираю... с честью... Лок\'тар огар!', '', 29981),
(171198, 'ruRU', 'Вы... долго учились... и учились хорошо... Славная битва.', '', 29981),
(171197, 'ruRU', 'Нужно лучше готовиться.', '', 29981),
(171194, 'ruRU', 'Как приятен страх...', '', 29981),
(171193, 'ruRU', 'Как сладостно отчаяние...', '', 29981),
(171192, 'ruRU', 'Стратхольмские детишки – и те защищались отчаяннее!', '', 29981),
(171191, 'ruRU', 'Сопливый червяк!', '', 29981),
(171190, 'ruRU', 'Солдаты Лордерона, восстаньте по зову господина!', '', 29981),
(171189, 'ruRU', 'Марвин, добей их...', '', 29981),
(171188, 'ruRU', 'Мужчины, женщины и дети... Никто не избежал гнева господина. Вы разделите их участь.', '', 29981),
(171187, 'ruRU', '', 'Ваши дряхлые жизни, ваши бренные желания ничего не значат... теперь вы – адепты господина! Вы будете служить нашему делу, не спрашивая ни о чем! Умереть за господина – величайшая доблесть!', 29981),
(171186, 'ruRU', '', 'Убейте их во имя господина!', 29981),
(171185, 'ruRU', '', 'Бегите, пока еще можете!', 29981),
(171184, 'ruRU', '', 'Склонитесь передо мной, черви!', 29981),
(171183, 'ruRU', '', 'Жалкое ничтожество!', 29981),
(171182, 'ruRU', '', 'Вам не скрыться от меня!', 29981),
(171181, 'ruRU', '', 'Тебе не повезло!', 29981),
(171180, 'ruRU', '', 'Господин отомстит за меня!', 29981),
(171179, 'ruRU', 'Нет же, нет! И снова нет! Ты в плохой форме.', '', 29981),
(171178, 'ruRU', 'Я сдаюсь! Я побежден. Отличная работа. Можно теперь убегать?', '', 29981),
(171177, 'ruRU', 'Желаете помериться силами? Я не отступлю!', '', 29981),
(171176, 'ruRU', 'Эй, ты! Тебе необходимо больше тренироваться.', '', 29981),
(171175, 'ruRU', 'Готовьтесь!', '', 29981),
(171174, 'ruRU', 'Молот праведника!', '', 29981),
(171171, 'ruRU', '', 'Сюрприз.', 29981),
(171170, 'ruRU', '', 'Пока-пока.', 29981),
(171168, 'ruRU', '', 'Вы... намного сильнее... чем я думала...', 29981),
(171167, 'ruRU', '', 'Ну что, приступим?', 29981),
(171166, 'ruRU', '', 'Спокойной ночи...', 29981),
(171165, 'ruRU', '', 'М-м-м, какое веселье!', 29981),
(171164, 'ruRU', '', 'Надеюсь, твои друзья продержатся дольше.', 29981),
(171163, 'ruRU', '', 'Ах! Так быстро?', 29981),
(171162, 'ruRU', 'Стоять, сухопутные крысы!', '', 29981),
(171160, 'ruRU', 'Живец, поднимай якорь и суши чертовы перья! К нам явились сухопутные крысы!', '', 29981),
(171159, 'ruRU', 'Вам каюк!', '', 29981),
(171158, 'ruRU', 'На абордаж!', '', 29981),
(171157, 'ruRU', 'Пощады не ждите!', '', 29981),
(171156, 'ruRU', 'Я продырявлю ваши шкуры!', '', 29981),
(171154, 'ruRU', 'Привыкайте к морской жизни!', '', 29981),
(171153, 'ruRU', 'Мертвецы не болтают!', '', 29981),
(171152, 'ruRU', 'Только на приманку и годишься!', '', 29981),
(171151, 'ruRU', 'Иду... на дно...', '', 29981),
(171150, 'ruRU', 'Зря вы связались с зандаларами!', '', 29981),
(171149, 'ruRU', 'На колени!', '', 29981),
(171148, 'ruRU', 'Прочь с дороги!', '', 29981),
(171147, 'ruRU', 'Я вас раздавлю!', '', 29981),
(171146, 'ruRU', 'Лэй Шэнь придает нам сил!', '', 29981),
(171145, 'ruRU', 'Мы следуем за Властелином Грома!', '', 29981),
(171144, 'ruRU', 'Разряд!', '', 29981),
(171143, 'ruRU', 'Будет больно.', '', 29981),
(171142, 'ruRU', 'Воинов Амани не остановить!', '', 29981),
(171141, 'ruRU', 'Властелин Грома... обещал...', '', 29981),
(171140, 'ruRU', 'Айкисс не... Аррр-аррр!.. умрррет...', '', 29981),
(171139, 'ruRU', 'Умррри-аррр! Не пущу к блестяшкам!', '', 29981),
(171138, 'ruRU', 'Урррмммм...', '', 29981),
(171137, 'ruRU', 'Ммм... Хотите сразиться с Айкиссом? Ак!', '', 29981),
(171136, 'ruRU', 'Айкисс рррасправится с вами, крррасавчики – да, поррежет на кусочки!', '', 29981),
(171135, 'ruRU', 'Ааарр-аррр! Вам не скрррыться!', '', 29981),
(171134, 'ruRU', 'Аррр! Блестяшки, даа. Крррасивые блестяшки! Ак! Сила, огррромная сила. Аррр-аррр! Сила в блестяшках! Арр-арр!', '', 29981),
(171133, 'ruRU', 'Вар-ёрг грамалч!', '', 29981),
(171132, 'ruRU', 'Убейте всех! Без исключений! Без пощады! Без остановки!', '', 29981),
(171131, 'ruRU', 'Разрушить все здания! Утихомирить всех живых!', '', 29981),
(171130, 'ruRU', 'Я раскрашу свое лицо вашей кровью!', '', 29981),
(171129, 'ruRU', 'Я прирожденный воин!', '', 29981),
(171128, 'ruRU', 'Моя жизнь... за бога смерти.', '', 29981),
(171127, 'ruRU', 'Я вернулся! Еще один шанс раскроить вам головы!', '', 29981),
(171126, 'ruRU', 'Мюль орм агньёр!', '', 29981),
(171125, 'ruRU', 'Нет! Я смогу это сделать... я смогу...', '', 29981),
(171122, 'ruRU', 'Если у тебя не хватает места в стойлах, можешь воспользоваться модулем биореконфигурации ИЗ-85.', '', 29981),
(171121, 'ruRU', 'Хати, малыш, я рад, что ты снова с нами. Не делай вид, что не узнаешь меня!', '', 29981),
(171120, 'ruRU', 'Пожалуй, оставлю вас наедине. Старому дворфу нужно подышать свежим воздухом.', '', 29981),
(171119, 'ruRU', 'А он любит скакать туда-сюда, все с молниями и громом.', '', 29981),
(171118, 'ruRU', 'Зайди ко мне в храм Штормов. Мне нужно кое-что тебе показать.', '', 29981),
(171117, 'ruRU', 'Получилось! Я ни минуты в тебе не сомневался!', '', 29981),
(171114, 'ruRU', 'То есть, конечно, сработало! Смотрите и восторгайтесь – Хати снова с нами!', '', 29981),
(171112, 'ruRU', 'Сработало?', '', 29981),
(171111, 'ruRU', 'Удерживаем поле... да, да, да! Нет-нет-нет-нет. Хотя... нет... да!', '', 29981),
(171110, 'ruRU', 'Смотрите, магия молний Грозовой искры затягивается стабилизационным полем! Потрясающе!', '', 29981),
(171109, 'ruRU', 'Атомный пресс принимает энергию. Великолепно! Просто великолепно!', '', 29981),
(171107, 'ruRU', 'Заряд матрицы стабилизации максимальный. Перенаправляю поток ионов на атомный пресс...', '', 29981),
(171106, 'ruRU', 'Вывожу ионные конвертеры на... полную мощность!', '', 29981),
(171105, 'ruRU', 'Просто помести Грозовую искру на консоль – и оглянуться не успеешь, как Хати снова будет с нами.', '', 29981),
(171104, 'ruRU', 'Лучше, чем хорошо, Бронзобород. Это наука!', '', 29981),
(171103, 'ruRU', 'Это... хорошо?', '', 29981),
(171102, 'ruRU', 'А вот и вы! Я как раз закончил перенаправлять конвертеры низкоионной энергии на матрицу стабилизации. Таким образом, атомный пресс должен воссоздать тело Хати из его сущности.', '', 29981),
(171099, 'ruRU', 'Знаешь... Скажу тебе прямо, я скучаю по Хати. Знаю, у него с тобой духовная связь и все дела, но... сердце у него золотое. Как ни у кого другого.', '', 29981),
(171098, 'ruRU', 'Когда-то я путешествовал себе по бескрайним просторам с Теодором и стариной Хьюи. Иногда встречал какого-нибудь коллегу-охотника.', '', 29981),
(171097, 'ruRU', 'Знаешь, $Gприятель:подруга;, порой я задумываюсь: как вообще мы попадаем в такие ситуации?', '', 29981),
(171096, 'ruRU', 'Ага, Мимирон... что бы ты там ни имел в виду.', '', 29981),
(171095, 'ruRU', 'Бронзобород, ты здесь! Прошу прощения за легкое антиперенаправление в ходе телепортации.', '', 29981),
(171094, 'ruRU', 'Этот телепорт перенесет тебя прямоком в дивную Искру Воображения! $p, пришло время наконец-то собрать твоего спутника воедино с помощью магии науки!', '', 29981),
(171092, 'ruRU', 'Так ты еще и не один?! Ничего... сейчас вы умрете!', '', 29981),
(171091, 'ruRU', '$p! Не желаешь присоединиться?', '', 29981),
(171090, 'ruRU', '', 'Орда что-то затевает, и мы узнаем, что именно... любыми способами!', 29981),
(171087, 'ruRU', '', 'Вот и все! Подслушивающее устройство снова в строю!', 29981),
(171086, 'ruRU', '', 'Еще немного, я почти справилась!', 29981),
(171085, 'ruRU', '', 'Теперь я повторно инициализирую матрицу. А потом... Стоп... А эта деталь здесь откуда?', 29981),
(171084, 'ruRU', '', 'Теперь надо повторно инициализировать силовую матрицу... Нет! Стоп! Заземлители!', 29981),
(171083, 'ruRU', '', 'Так-с... Нужно откалибровать самофланж.', 29981),
(171074, 'ruRU', 'Я тебя прикрою.', 'Я тебя прикрою.', 29981),
(171067, 'ruRU', '', 'Ярость Шадры вас уничтожит!', 29981),
(171066, 'ruRU', '', 'Смерть всем противникам империи!', 29981),
(171065, 'ruRU', '', 'Шадра... спаси меня...', 29981),
(171064, 'ruRU', '', 'Еще одно подношение лоа!', 29981),
(171063, 'ruRU', '', 'Она пожрет ваши души!', 29981),
(171062, 'ruRU', '', 'Отведай ее яду!', 29981),
(171061, 'ruRU', '', 'Твоя душа принадлежит мне!', 29981),
(171060, 'ruRU', '', 'Душелов показал мне твою душу!', 29981),
(171059, 'ruRU', '', 'Смерть уже заждалась!', 29981),
(171058, 'ruRU', '', 'Жалкие щенки. Вам не на что надеяться. Бегите, пока можете.', 29981),
(171057, 'ruRU', '', 'Вы осмелились бросить вызов владычице штормов?!', 29981),
(171056, 'ruRU', '', 'Лучше бы тебе было сбежать, щенок.', 29981),
(171055, 'ruRU', '', 'Фу!', 29981),
(171054, 'ruRU', '', 'Умри, щенок.', 29981),
(171052, 'ruRU', '', 'Вам не перегнать снежную бурю.', 29981),
(171051, 'ruRU', '', 'Лед убьет вас.', 29981),
(171050, 'ruRU', '', 'Ощутите ярость бури!', 29981),
(171048, 'ruRU', '', 'Вот, что станет с теми, кто противостоит мне!', 29981),
(171044, 'ruRU', '', 'Трусы! Стая жалких... псов...', 29981),
(171043, 'ruRU', 'Буря!', '', 29981),
(171042, 'ruRU', '...и огонь!', '', 29981),
(171041, 'ruRU', 'Для Истинной Орды нет преград!', '', 29981),
(171040, 'ruRU', 'Гнилая вода, отравленная вода!', '', 29981),
(171039, 'ruRU', 'Бесплодная, чумная земля!', '', 29981),
(171038, 'ruRU', 'Кровь Истинной Орды жаждет силы!', '', 29981),
(171037, 'ruRU', 'Стихии... что мы натворили?..', '', 29981),
(171036, 'ruRU', 'Твой череп украсит мою шею.', '', 29981),
(171035, 'ruRU', 'Теперь вы принадлежите мне.', '', 29981),
(171034, 'ruRU', 'Я вижу вас...', '', 29981),
(171033, 'ruRU', 'Пришло ваше время...', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171032, 'ruRU', 'Закрой глаза. Усни.', '', 29981),
(171031, 'ruRU', 'Все народы этого мира исчезнут без следа. Это лишь вопрос времени.', '', 29981),
(171030, 'ruRU', 'Я вижу бесконечное страдание. Я вижу муки. Я вижу ярость. Я вижу все...', '', 29981),
(171029, 'ruRU', 'Скоро мир содрогнется.', '', 29981),
(171028, 'ruRU', 'Вам конец.', '', 29981),
(171027, 'ruRU', 'Голодные черви будут пировать в ваших гниющих трупах!', '', 29981),
(171026, 'ruRU', 'Я отомщу!', '', 29981),
(171025, 'ruRU', 'Я был первым. Колесо моей жизни сделало уже не один оборот. Столько времени прошло... Мне нужно столько наверстать.', '', 29981),
(171024, 'ruRU', 'Ты мне пригодишься...', '', 29981),
(171023, 'ruRU', 'Сейчас тебе будет плохо.', '', 29981),
(171022, 'ruRU', 'Смерть не так уж страшна.', '', 29981),
(171021, 'ruRU', 'Чего вы боитесь?', '', 29981),
(171020, 'ruRU', 'Сдавайтесь.', '', 29981),
(171019, 'ruRU', 'У меня для вас кое-что есть...', '', 29981),
(171018, 'ruRU', 'Я требую должного уважения!', '', 29981),
(171017, 'ruRU', 'Колесо жизни завершило очередной оборот.', '', 29981),
(171016, 'ruRU', 'Меня нельзя победить!', '', 29981),
(171015, 'ruRU', 'Меня нельзя победить. Я сильнее всех.', '', 29981),
(171014, 'ruRU', 'Мои кулаки алые... от вашей крови!', '', 29981),
(171013, 'ruRU', 'Умираешь – так умирай!', '', 29981),
(171012, 'ruRU', 'Вы... как железо...', '', 29981),
(170997, 'ruRU', 'Ха-ха-ха! Еще одна возможность испытать свою силу!', '', 29981),
(170996, 'ruRU', 'Защищайтесь!', '', 29981),
(170995, 'ruRU', 'Убит... этими...', '', 29981),
(170994, 'ruRU', 'Ха-ха-ха!', '', 29981),
(170993, 'ruRU', 'Надо было больше тренироваться.', '', 29981),
(170992, 'ruRU', '', 'МИЛЛХАУС! Ты следующий!', 29981),
(170991, 'ruRU', '', 'Ах, ты... НИКТО не смеет поносить мои волосы!', 29981),
(170990, 'ruRU', '', 'Кого ВЗОРВАТЬ?', 29981),
(170989, 'ruRU', '', 'Сейчас будет жарко!', 29981),
(170988, 'ruRU', '', 'Тебе нигде не спрятаться от меня, Миллхаус! Нигде!', 29981),
(170986, 'ruRU', 'Мы дали отпор Плети. А вы думаете у ВАС есть шанс?', '', 29981),
(170985, 'ruRU', 'Приготовьтесь к чему-то... БОЛЬШОМУ!', '', 29981),
(170984, 'ruRU', 'Земля проглотит вас!', '', 29981),
(170983, 'ruRU', 'Я сокрушу вас, насекомые!', '', 29981),
(170982, 'ruRU', 'Кто меня остановит? Ты?', '', 29981),
(170981, 'ruRU', 'Теперь ты не помеха!', '', 29981),
(170980, 'ruRU', 'Если наши боги могут умереть... то можем и мы...', '', 29981),
(170979, 'ruRU', 'Тьма поглотит вас!', '', 29981),
(170978, 'ruRU', 'Вам не удалось убить меня... И не удастся!', '', 29981),
(170977, 'ruRU', 'Кошмарных тебе снов!', '', 29981),
(170976, 'ruRU', 'Аззага чуууго зинн!', '', 29981),
(170975, 'ruRU', 'Теперь вы принадлежите мне!', '', 29981),
(170974, 'ruRU', 'Тьма идет за вами...', '', 29981),
(170973, 'ruRU', 'Ваши души будут растерзаны!', '', 29981),
(170972, 'ruRU', 'Я не умру... так... просто...', '', 29981),
(170971, 'ruRU', 'Да затмится ваш разум.', '', 29981),
(170970, 'ruRU', 'Вглядитесь во тьму ваших душ.', '', 29981),
(170969, 'ruRU', 'Такова... моя доля.', '', 29981),
(170968, 'ruRU', 'Вы обречены!', '', 29981),
(170967, 'ruRU', 'Пути назад больше нет!', '', 29981),
(170966, 'ruRU', 'Примите свое наказание!', '', 29981),
(170965, 'ruRU', 'Эти стены станут твоей гробницей!', '', 29981),
(170964, 'ruRU', 'Ты останешься здесь... навсегда.', '', 29981),
(170963, 'ruRU', 'Всеобщий язык такой грубый... Бандал!', '', 29981),
(170962, 'ruRU', 'Шорель-аран.', '', 29981),
(170961, 'ruRU', 'Белеса менор!', '', 29981),
(170960, 'ruRU', 'Диэль ма-ан... Ориндель-о.', '', 29981),
(170959, 'ruRU', 'Диэль фин-ол.', '', 29981),
(170958, 'ruRU', 'Ша-амоор ара машол?', '', 29981),
(170957, 'ruRU', 'Шал-мор синабанол!', '', 29981),
(170956, 'ruRU', '', 'Бегите, или умрите!', 29981),
(170955, 'ruRU', '', 'Мое дело сделано.', 29981),
(170954, 'ruRU', '', 'Как и должно быть.', 29981),
(170953, 'ruRU', '', 'Это... ваша судьба.', 29981),
(170952, 'ruRU', '', 'Второго шанса не будет!', 29981),
(170951, 'ruRU', '', 'За Кель\'Талас! За Солнечный Колодец!', 29981),
(170950, 'ruRU', '', 'У меня еще много сюрпризов!', 29981),
(170943, 'ruRU', 'Я не признаю поражения! Я эредарский принц! Я...', '', 29981),
(170942, 'ruRU', 'Смирись и прими свою смерть!', '', 29981),
(170941, 'ruRU', 'Жадность и глупость погубили тебя.', '', 29981),
(170940, 'ruRU', 'Ты просто игрушка. Неинтересная игрушка.', '', 29981),
(170939, 'ruRU', 'Глупцы! Время – это огонь, сжигающий вас!', '', 29981),
(170938, 'ruRU', 'Вы противостоите не только Малчезару, но и всем подвластным мне легионам!', '', 29981),
(170937, 'ruRU', 'Как вы осмелились бросить вызов столь колоссальной мощи?', '', 29981),
(170936, 'ruRU', 'Мне открыты все реальности, все измерения!', '', 29981),
(170935, 'ruRU', 'У Теренаса был такой же взгляд в миг смерти. Он никак не мог поверить.', '', 29981),
(170934, 'ruRU', 'Захлебнись страданием!', '', 29981),
(170933, 'ruRU', 'Да... Бегите навстречу судьбе... Ее жестокие холодные объятья ждут вас!', '', 29981),
(170932, 'ruRU', 'Господин осмотрел свое королевство и признал его... негодным. Его суд был быстрым и суровым: предать ВСЕХ СМЕРТИ!', '', 29981),
(170931, 'ruRU', 'Вы увидите, как разлагается ваша плоть!', '', 29981),
(170930, 'ruRU', 'Сгиньте без следа!', '', 29981),
(170929, 'ruRU', 'Вы найдете здесь лишь смерть!', '', 29981),
(170928, 'ruRU', 'Подойдите, и мы сможем познакомиться.', '', 29981),
(170927, 'ruRU', 'В юности я едва мог нанести противнику удар. Но за годы тренировок я многому научился!', '', 29981),
(170926, 'ruRU', 'В бою нужно не только мастерски владеть оружием. Дух искусного бойца тоже должен быть силен. Я покажу вам, почему это важно.', '', 29981),
(170925, 'ruRU', 'Однажды учитель сказал мне: \"Нельзя узнать кого-то по-настоящему, пока не вступишь с ним в поединок\".', '', 29981),
(170924, 'ruRU', 'Когда один падает без сил, его место занимает другой.', '', 29981),
(170923, 'ruRU', 'Твоя техника несовершенна.', '', 29981),
(170922, 'ruRU', 'Тебе нужно продолжить тренировки!', '', 29981),
(170921, 'ruRU', 'Посмотрим, что вы можете мне противопоставить.', '', 29981),
(170920, 'ruRU', 'Наконец-то мое заточение окончено!', '', 29981),
(170919, 'ruRU', 'Рук... в беде...', '', 29981),
(170918, 'ruRU', 'Руку нужна... помощь!', '', 29981),
(170917, 'ruRU', 'Бейте... Рука!', '', 29981),
(170916, 'ruRU', 'Рук бить!', '', 29981),
(170915, 'ruRU', 'Сунь... Хэ... Помогите.', '', 29981),
(170914, 'ruRU', 'Ты... мне... не друг...', '', 29981),
(170913, 'ruRU', 'Пожалуйста, помогите...', '', 29981),
(170912, 'ruRU', 'Месть жжет, как пламя!', '', 29981),
(170911, 'ruRU', 'Феломин Ашал!', '', 29981),
(170910, 'ruRU', 'Я переверну ваш мир... вверх... дном.', '', 29981),
(170909, 'ruRU', 'Владыка, дай мне сил!', '', 29981),
(170908, 'ruRU', 'У вас такой самодовольный вид... Я знаю, о чем вы думаете, но Крепость Бурь была лишь небольшим испытанием. Неужели вы полагаете, что я доверил бы будущее какому-то слепому ночному эльфу-полукровке? Ха-ха. О, нет. Он был лишь орудием. Средством достижения иной, более высокой цели. И теперь... теперь вы уже не сможете помешать мне.', '', 29981),
(170907, 'ruRU', 'Не слишком-то... расслабляйтесь.', '', 29981),
(170906, 'ruRU', 'Моя смерть ничего не изменит! Владыка доберется до вас! Вы захлебнетесь собственной кровью! Весь мир поглотит пламя! Аххх...', '', 29981),
(170905, 'ruRU', '<Волчий вой>', '', 29981),
(170904, 'ruRU', 'Чувствуешь, как холодок пробежал по спине? Опускается туман.', '', 29981),
(170902, 'ruRU', 'Ты источаешь запах страха.', '', 29981),
(170901, 'ruRU', 'Я вырву сердце из твоей груди!', '', 29981),
(170900, 'ruRU', 'Ра ха, ра ха, ра хахахахха!', '', 29981),
(170899, 'ruRU', 'Твоя кровь пробуждает мой аппетит.', '', 29981),
(170898, 'ruRU', 'Ааааа... Свежее мясо.', '', 29981),
(170896, 'ruRU', 'deep', 'deep', 29981),
(170890, 'ruRU', 'Зачем, во имя науки, нажимать большую красную кнопку, на которой написано \"НЕ НАЖИМАЙТЕ ЭТУ КНОПКУ\"?! У нас много дел!', '', 29981),
(170889, 'ruRU', '', 'Увидимся наверху, $p.', 29981),
(170886, 'ruRU', 'Обучение окончено! Покажите мне, что вы усвоили!', '', 29981),
(170885, 'ruRU', 'Требуется коммуникабельный работник...', '', 29981),
(170884, 'ruRU', 'Пора расширить штат сотрудников!', '', 29981),
(170883, 'ruRU', 'Предпочитаю практичность и удобство.', '', 29981),
(170880, 'ruRU', 'У нас очень строгий график. Не вмешивайтесь!', '', 29981),
(170879, 'ruRU', 'Досадное недоразумение.', '', 29981),
(170878, 'ruRU', 'Похоже, я оказался сильнее.', '', 29981),
(170877, 'ruRU', 'Проект... продолжится.', '', 29981),
(170875, 'ruRU', '', 'Хорошо. Начнем.', 29981),
(170874, 'ruRU', '', 'Даже самые тягостные воспоминания отступят, если смело взглянуть им в лицо!', 29981),
(170873, 'ruRU', '', 'Отличная работа...', 29981),
(170872, 'ruRU', '', 'Да придаст мне Свет силы, чтобы стать достойным противником!', 29981),
(170871, 'ruRU', '', 'А теперь подумайте о своих прежних прегрешениях.', 29981),
(170870, 'ruRU', '', 'Отдыхай.', 29981),
(170869, 'ruRU', '', 'Покойся с миром.', 29981),
(170868, 'ruRU', 'Поезд на первом пути!', '', 29981),
(170867, 'ruRU', 'Все, приехали.', '', 29981),
(170866, 'ruRU', 'В расписании... этого не было...', '', 29981),
(170865, 'ruRU', 'Не стой на путях!', '', 29981),
(170864, 'ruRU', 'Точно... по... графику.', '', 29981),
(170863, 'ruRU', 'Занимаем места!', '', 29981),
(170862, 'ruRU', 'Поезда прибывают!', '', 29981),
(170861, 'ruRU', 'Поезд идет без остановки!', '', 29981),
(170860, 'ruRU', 'Добавим огня!', '', 29981),
(170859, 'ruRU', 'Вот и артиллерия.', '', 29981),
(170858, 'ruRU', 'Слава господину!', '', 29981),
(170857, 'ruRU', 'Прощайся с жизнью!', '', 29981),
(170856, 'ruRU', 'Смерть чужакам!', '', 29981),
(170855, 'ruRU', 'Я буду служить господину... даже после смерти!', '', 29981),
(170854, 'ruRU', 'Моя задача выполнена!', '', 29981),
(170853, 'ruRU', 'Этот вздох был для тебя последним!', '', 29981),
(170852, 'ruRU', 'Встаньте, мои воины! Встаньте и сражайтесь вновь!', '', 29981),
(170851, 'ruRU', 'А, умри!', '', 29981),
(170850, 'ruRU', 'Моли о пощаде!', '', 29981),
(170848, 'ruRU', 'Беги, трусливая тварь! Спасайся!', '', 29981),
(170846, 'ruRU', 'Ты так забавно страдаешь!', '', 29981),
(170845, 'ruRU', 'О, какая утрата... Следующий!', '', 29981),
(170844, 'ruRU', 'Давайте, покажите мне, на что вы способны!', '', 29981),
(170843, 'ruRU', 'Какой... позор...', '', 29981),
(170842, 'ruRU', 'Рабов пытать – и то было интереснее!', '', 29981),
(170841, 'ruRU', 'Мне скучно!', '', 29981),
(170840, 'ruRU', 'Я победил.', '', 29981),
(170838, 'ruRU', 'И плоть превратится в прах!', '', 29981),
(170837, 'ruRU', 'Я пытался следовать законам гостеприимства, но вы всё никак не умрете! Придется отбросить условности и просто... УБИТЬ ВАС ВСЕХ!', '', 29981),
(170836, 'ruRU', 'Разум смертных... так легко подчинить.', '', 29981),
(170835, 'ruRU', 'Приятно было познакомиться!', '', 29981),
(170834, 'ruRU', 'ХА!', '', 29981),
(170833, 'ruRU', 'Вам этого явно не хватает.', '', 29981),
(170832, 'ruRU', 'Никогда еще поражение не было таким горьким...', '', 29981),
(170831, 'ruRU', 'Я искренне рад, что вы зашли на огонек, но вам действительно пора умереть в муках!', '', 29981),
(170830, 'ruRU', 'Работа должна продолжаться!', '', 29981),
(170829, 'ruRU', 'Вы сами напросились!', '', 29981),
(170828, 'ruRU', 'Не заставляйте меня вас убивать!', '', 29981),
(170827, 'ruRU', 'Увы, это было необходимо.', '', 29981),
(170826, 'ruRU', 'Тебе не следовало приходить...', '', 29981),
(170825, 'ruRU', 'Я... это... заслужил...', '', 29981),
(170824, 'ruRU', 'У меня свои звер-ррр-рюшки есть!', '', 29981),
(170823, 'ruRU', 'Ммм... А теперь – мой ход!', '', 29981),
(170822, 'ruRU', 'Какие милые зверюшки... аррр!', '', 29981),
(170821, 'ruRU', 'У милых зверюшек есть оружие. Это не очень хорошо!', '', 29981),
(170820, 'ruRU', 'Да, жизнь так скоротечна, аррр!', '', 29981),
(170819, 'ruRU', 'Ммм... Отправляйся в лучший мир. Аррр!', '', 29981),
(170818, 'ruRU', 'Ммм... Нет жизни – нет боли. Арррххх!', '', 29981),
(170817, 'ruRU', '', 'Ощутите боль нашей неудачи.', 29981),
(170816, 'ruRU', '', 'Взываю к вам, защитники!', 29981),
(170815, 'ruRU', '', 'Нужно спасти дол.', 29981),
(170814, 'ruRU', '', 'Получится ли у вас победить?', 29981),
(170813, 'ruRU', '', 'Мы не сдержали клятву!', 29981),
(170812, 'ruRU', '', 'Мы вернемся туда, где сбились с пути. Вы... очень добры.', 29981),
(170811, 'ruRU', '', 'И тебе не удалось.', 29981),
(170810, 'ruRU', '', 'Наша судьба – безысходность. Это наше наказание.', 29981),
(170807, 'ruRU', '', 'Тал ану-мен но син-дорай!', 29981),
(170806, 'ruRU', '', 'Тепло солнца... ждет меня.', 29981),
(170805, 'ruRU', '', 'Твоя душа принадлежит бездне!', 29981),
(170804, 'ruRU', '', 'За кровь высокорожденных!', 29981),
(170803, 'ruRU', '', 'За Солнечный Колодец!', 29981),
(170802, 'ruRU', '', 'Вы безнадежно слабы!', 29981),
(170801, 'ruRU', '', 'Я навсегда избавлю вас от мании величия!', 29981),
(170800, 'ruRU', 'Что за недоноски осмелились вторгнуться сюда? Поживее, братья мои! Угощение тому, кто принесет мне их головы!', '', 29981),
(170799, 'ruRU', 'Я прошу врайкулов убить их, и что я получаю? Жалких недоумков? Во имя Имирона, УБЕЙТЕ ЖЕ ИХ!', '', 29981),
(170798, 'ruRU', 'Если еще хоть один гарпун коснется моего дракона, я сдеру с вас ваши жалкие шкуры!', '', 29981),
(170797, 'ruRU', 'Ничтожные лакеи! Ваши трупы послужат хорошей закуской для моего нового дракона!', '', 29981),
(170796, 'ruRU', 'Мьёр на ул квал!', '', 29981),
(170795, 'ruRU', 'Хо, ну и где же теперь твоя дерзость?', '', 29981),
(170794, 'ruRU', 'Я подвешу твой череп на самой высокой башне!', '', 29981),
(170793, 'ruRU', 'Арр! И это вы называете... атакой? Я... покажу вам...', '', 29981),
(170792, 'ruRU', 'Мягкие, ненадежные оболочки. Мимолетные, хрупкие жизни. Вы не можете избавиться от проклятия плоти.', '', 29981),
(170791, 'ruRU', 'Фолвин буул хром онн!', '', 29981),
(170790, 'ruRU', 'Плоть не сравнится с железом!', '', 29981),
(170789, 'ruRU', 'Армии железа заполонят этот мир!', '', 29981),
(170788, 'ruRU', 'Локен не отступится, пока Кузница снова не будет захвачена! Вы ничего... не измените.', '', 29981),
(170787, 'ruRU', '', 'Ааа!', 29981),
(170785, 'ruRU', '', 'И-нок Крайул!', 29981),
(170784, 'ruRU', '', 'Тень поглотит тебя...', 29981),
(170782, 'ruRU', '', 'Алитесс! Твое пламя бушует во мне!', 29981),
(170781, 'ruRU', '', 'Тень в помощь пламени!', 29981),
(170780, 'ruRU', 'Бум! Ха-ха-ха-ха...', '', 29981),
(170779, 'ruRU', 'Кровь... Разрушение... ВОСХИТИТЕЛЬНО!', '', 29981),
(170778, 'ruRU', 'Мне нужен образец...', '', 29981),
(170777, 'ruRU', 'Столько силы... Она будет моей!', '', 29981),
(170776, 'ruRU', 'Твоя плоть предает тебя!', '', 29981),
(170775, 'ruRU', 'Вы всего лишь... часть плана хозяина...', '', 29981),
(170774, 'ruRU', 'А, развлечемся!', '', 29981),
(170773, 'ruRU', 'Веселье только начинается.', '', 29981),
(170772, 'ruRU', 'А-а! Качественный материал.', '', 29981),
(170771, 'ruRU', 'Не волнуйся, я найду, куда тебя приспособить.', '', 29981),
(170770, 'ruRU', '', 'Идите же ко мне. Я окажу вам достойный прием.', 29981),
(170769, 'ruRU', '', 'Хватит ныть!', 29981),
(170768, 'ruRU', '', 'Твой час настал!', 29981),
(170767, 'ruRU', '', 'Сейчас вы поймете, с кем имеете дело!', 29981),
(170766, 'ruRU', '', 'Банд-ор шорель-аран!', 29981),
(170765, 'ruRU', '', 'Стража, вперед! Убейте их!', 29981),
(170764, 'ruRU', '', 'И не возвращайся!', 29981),
(170763, 'ruRU', '', 'Я еще... не начала...', 29981),
(170762, 'ruRU', '', 'Эндала финель эндаль!', 29981),
(170761, 'ruRU', '', 'Лезете в самое пекло?', 29981),
(170760, 'ruRU', '', 'Анар-эндаль дракон!', 29981),
(170758, 'ruRU', '', 'Ану... бала белоре... алон.', 29981),
(170757, 'ruRU', '', 'Хм, кажется, вы не слишком-то цените свою жизнь?', 29981),
(170756, 'ruRU', 'Я выжгу вас изнутри!', '', 29981),
(170755, 'ruRU', 'Быстрая смерть!', '', 29981),
(170754, 'ruRU', 'Вам стоило бы лучше подготовиться!', '', 29981),
(170753, 'ruRU', 'Валиона, прикончи их! Отомсти за меня!', '', 29981),
(170752, 'ruRU', 'СЛУГИ, СЖЕЧЬ ИХ!', '', 29981),
(170751, 'ruRU', 'ГОРИТЕ В ОГНЕ!', '', 29981),
(170750, 'ruRU', '', 'Это священные залы! Вас тут ждет только смерть!', 29981),
(170749, 'ruRU', '', 'Кто из вас истинно верующий?', 29981),
(170748, 'ruRU', '', 'Эй, ты! Шаг вперед!', 29981),
(170747, 'ruRU', '', 'Не думайте, что ваше святотатство останется безнаказанным!', 29981),
(170746, 'ruRU', '', 'Поднимайся! Тебе еще предстоит пострадать.', 29981),
(170745, 'ruRU', '', 'Недостойная жертва.', 29981),
(170744, 'ruRU', '', 'Слава Йогг-Сарону!', 29981),
(170743, 'ruRU', '', 'Повелитель, подарок для тебя!', 29981),
(170742, 'ruRU', '', 'Йогг-Сарон! Надели меня своей силой!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(170741, 'ruRU', 'Наследие бурь не умрет вместе со мной.', '', 29981),
(170740, 'ruRU', 'Узрите ярость молнии!', '', 29981),
(170739, 'ruRU', 'Расшифруйте вот это!', '', 29981),
(170738, 'ruRU', 'Смерть – это расплата за твое высокомерие.', '', 29981),
(170737, 'ruRU', 'Мир переживет эту несущественную потерю.', '', 29981),
(170736, 'ruRU', 'Я буду спокоен, лишь когда окончательно истреблю вас.', '', 29981),
(170735, 'ruRU', 'Заседание Железного Собрания объявляется закрытым!', '', 29981),
(170734, 'ruRU', 'И что вам дало мое поражение? Вы все так же обречены, смертные.', '', 29981),
(170730, 'ruRU', 'Я ношу эту футболку в память о жертве Тириона Фордринга.', '', 29981),
