(170302, 'ruRU', 'Иногда я думаю, что лучше б я был мертвым. В смысле, совсем мертвым.', '', 29981),
(170301, 'ruRU', 'На дне моря было холодно и темно... Зато там мне никто не докучал.', '', 29981),
(170300, 'ruRU', 'Мы еще встретимся.', '', 29981),
(170299, 'ruRU', 'Попутного ветра и верного якоря.', '', 29981),
(170298, 'ruRU', 'Новый день – новая надежда.', '', 29981),
(170297, 'ruRU', 'Волны рады всем.', '', 29981),
(170296, 'ruRU', 'Все так изменилось...', '', 29981),
(170295, 'ruRU', 'Я заставлю это проклятие служить себе.', '', 29981),
(170294, 'ruRU', 'Просто... уходи.', '', 29981),
(170293, 'ruRU', 'Прошу... оставь меня...', '', 29981),
(170292, 'ruRU', 'Когда же закончится этот кошмар?!', '', 29981),
(170291, 'ruRU', 'Во что я превратился?!', '', 29981),
(170290, 'ruRU', 'Я готов начать ритуал.', 'Я готова начать ритуал.', 29981),
(170289, 'ruRU', 'Скажи мне, когда будешь $gготов:готова;, $n.', '', 29981),
(170257, 'ruRU', 'Единовременно можно пользоваться только одним договором. Нарушать это правило смертельно опасно.', '', 29981),
(170256, 'ruRU', 'Теперь, когда ты умеешь использовать договоры, тебе следует помнить еще кое о чем.', '', 29981),
(170249, 'ruRU', 'Испытание начнется, когда будут активированы все четыре руны. В каком порядке сражаться с аватарами, решать тебе. Да пребудет с тобой удача.', '', 29981),
(170248, 'ruRU', 'Пожалуйста, иди за мной.', '', 29981),
(170245, 'ruRU', 'Не думай... что это победа...', 'Не думай... что это победа...', 29981),
(170244, 'ruRU', 'Темная Госпожа... найдет тебя...', 'Темная Госпожа... найдет тебя...', 29981),
(170243, 'ruRU', 'Праудмур... наш...', 'Праудмур... наш...', 29981),
(170242, 'ruRU', 'Твоя судьба предрешена!', 'Твоя судьба предрешена!', 29981),
(170241, 'ruRU', 'Смерть врагам Темной Госпожи!', 'Смерть врагам Темной Госпожи!', 29981),
(170240, 'ruRU', 'Гнусные изменники!', 'Гнусные изменники!', 29981),
(170239, 'ruRU', '', 'Вы заплатите... за это...', 29981),
(170238, 'ruRU', '', 'Предатели! Умрите!', 29981),
(170237, 'ruRU', 'Сильвана... уничтожит вас...', '', 29981),
(170236, 'ruRU', 'Этот пленник наш, предатели!', '', 29981),
(170235, 'ruRU', 'Праудмур принадлежит... Темной Госпоже.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(170234, 'ruRU', 'Чужаки! Вам не уйти отсюда живыми!', '', 29981),
(170233, 'ruRU', 'Ты подохнешь... смертью изменника...', '', 29981),
(170232, 'ruRU', 'На нашем корабле тебе не место, крыса!', '', 29981),
(170231, 'ruRU', 'Никакой пленник этого не стоит! Забирайте его!', 'Никакой пленник этого не стоит! Забирайте его!', 29981),
(170230, 'ruRU', 'Пожалуйста, не надо!', 'Пожалуйста, не надо!', 29981),
(170229, 'ruRU', 'Пощадите! Я просто выполнял приказы!', 'Пощадите! Я просто выполняла приказы!', 29981),
(170228, 'ruRU', 'Умри!', 'Умри!', 29981),
(170227, 'ruRU', 'Нельзя отдавать пленника!', 'Нельзя отдавать пленника!', 29981),
(170226, 'ruRU', 'На нас напали!', 'На нас напали!', 29981),
(170225, 'ruRU', '', 'С возвращением. После уничтожения особи \"Г\'уун\" уровень заражения комплекса минимальный.', 29981),
(170224, 'ruRU', 'У нас гости! Я принесу банши ваши головы!', 'У нас гости! Я принесу банши ваши головы!', 29981),
(170222, 'ruRU', 'Врываемся по твоей команде. Готовься к упорному сопротивлению.', '', 29981),
(170219, 'ruRU', 'Добро пожаловать в мой магазин, $n. Ты хочешь обучиться искусству начертания?$b$bИли, возможно, отточить свое мастерство?', '', 29981),
(170218, 'ruRU', 'В этой книге описано все, что случилось с вами в ходе испытания.', 'В этой книге описано все, что случилось с вами в ходе испытания.', 29981),
(170215, 'ruRU', 'Западная башня разрушена!', '', 29981),
(170212, 'ruRU', '...Хотя мне, наверное, не следует об этом говорить.', '', 29981),
(170209, 'ruRU', '', 'Приветствую тебя снова, хранитель Сердца Азерот.\n\nФакт очищения тобой Ульдира задокументирован и высоко оценен. Рекомендация: продолжать принимать меры во избежание полного уничтожения планеты.', 29981),
(170205, 'ruRU', 'Например, о том, как они с Ульфаром познакомились. Отличная байка!', '', 29981),
(170204, 'ruRU', 'Всегда хотел встретиться с ней. Терноманты рассказывают интересные истории!', '', 29981),
(170202, 'ruRU', 'Тебя Дориан прислала, так?', '', 29981),
(170201, 'ruRU', 'Ульфар разберется, что с ним делать. Надеюсь...', '', 29981),
(170200, 'ruRU', 'Аж мурашки по шкуре.', '', 29981),
(170199, 'ruRU', 'Какая жуткая магия в твоем обереге.', '', 29981),
(170198, 'ruRU', 'Если Сильвана узнает, что от нее утаили эту информацию, она придет в ярость. Вы точно хотите скрыть это от Натаноса?', 'Если Сильвана узнает, что от нее утаили эту информацию, она придет в ярость. Вы точно хотите скрыть это от Натаноса?', 29981),
(170187, 'ruRU', '<Placeholder: Магни встречается с МАТРИАРХом.>', '<Placeholder: Магни встречается с МАТРИАРХом.>', 29981),
(170185, 'ruRU', 'Будь начеку, Зеллинг. Королева-банши что-то затевает...', '', 29981),
(170184, 'ruRU', 'Думаю, это демонстрация силы. Вот только кому она адресована?', '', 29981),
(170183, 'ruRU', 'Мы глубоко в тылу врага, Бейн. Зачем Сильване собирать здесь совет лидеров Орды?', '', 29981),
(170174, 'ruRU', '', 'Помните, кому вы служите.', 29981),
(170173, 'ruRU', 'Я не мог спокойно смотреть на это святотатство.', '', 29981),
(170172, 'ruRU', 'Довольно!', '', 29981),
(170170, 'ruRU', 'Ты можешь думать о них что угодно и считать их врагами, потому что они служат Орде, но я все же надеюсь, что ты понимаешь мою тревогу за судьбу Велонары.', '', 29981),
(170169, 'ruRU', 'Я знаю, ты из Альянса и заботиться о благополучии темного следопыта тебе не пристало. Но пойми, Велонара ведь не только темный следопыт.', '', 29981),
(170168, 'ruRU', 'Прошу тебя, сделай все возможное, чтобы уберечь ее!', '', 29981),
(170167, 'ruRU', 'Ей глубоко небезразлична судьба ее ученика. Боюсь, это и сыграло с ней злую шутку.', '', 29981),
(170166, 'ruRU', 'Может, раньше я и испытывал к темному следопыту Велонаре романтические чувства, но теперь я вижу в ней лишь доброго друга.', '', 29981),
(170155, 'ruRU', '', 'Отлично, $n!', 29981),
(170154, 'ruRU', '', 'Рада видеть тебя, $n. Будь осторожнее, здесь полно приспешников Эшвейн.\n\n<Келси ухмыляется.> \n\nПока что.', 29981),
(170148, 'ruRU', 'Теперь, когда МАТРИАРХ здесь, в Зале Сердца, можно начать обдумывать план!\n\nНадеюсь только, что эти вычисления не займут слишком много времени...', '', 29981),
(170146, 'ruRU', '', 'Я понимаю, что Бейн торопится, но мы сначала должны как следует подготовиться.', 29981),
(170145, 'ruRU', '', 'Я доверяю мастеру Шоу и Андуину. Этого достаточно. Передай Бейну, что я согласна... Но я буду не одна и во всеоружии.', 29981),
(170141, 'ruRU', 'С этими Древними богами не соскучишься! Как я рад, что мы все остались целы.', '', 29981),
(170140, 'ruRU', 'Дерись же!', '', 29981),
(170134, 'ruRU', '', 'Рекомендуется уничтожение всех зараженных особей.', 29981),
(170133, 'ruRU', '', 'Запуск протокола усиленного обеззараживания.', 29981),
(170132, 'ruRU', 'Вот ведь! Похоже, система все еще заражена!', '', 29981),
(170131, 'ruRU', 'Но дело зашло куда дальше. Теперь он слышит все, что говорит Азерот, и чувствует ее боль.', '', 29981),
(170130, 'ruRU', 'Когда-то я шутил, что Магни готов нести весь мир на своих плечах. Не думал, что он воспримет это настолько буквально.', '', 29981),
(170118, 'ruRU', 'Ай, огонь! Я пойду отсюда!', '', 29981),
(170092, 'ruRU', '', 'Конечно, Дерек. Мы переживем любую бурю... Потому что мы – семья.', 29981),
(170091, 'ruRU', 'Ты же не оставишь меня, Джайна? Мне кажется, я не справлюсь один...', '', 29981),
(170090, 'ruRU', '', 'Нет... пока нет. Но я знаю людей, прошедших через то же, что и ты. Может, они помогут.', 29981),
(170089, 'ruRU', 'Я не могу вернуться домой, правда?', '', 29981),
(170087, 'ruRU', '', 'Не знаю... Но вместе мы найдем ответ.', 29981),
(170086, 'ruRU', 'Вам с мамой и Тандредом столько пришлось пережить... Я рад, что вы снова одна семья... только что теперь делать мне?', '', 29981),
(170085, 'ruRU', 'Ты об отце? Я уже знаю. Ордынцы пытались настроить меня против тебя, но Бейн рассказал мне правду.', '', 29981),
(170084, 'ruRU', '', 'Столько всего произошло, Дерек... Послушай, ты должен знать...', 29981),
(170083, 'ruRU', 'Джайна... неужели это ты? Я помню тебя еще ребенком... А теперь ты – лорд-адмирал.', '', 29981),
(170082, 'ruRU', 'Спасибо тебе за то, что поверила Бейну. Он был ко мне добр.', '', 29981),
(170081, 'ruRU', '', 'Он пришел к нам с миром... на этот раз.', 29981),
(170075, 'ruRU', '', 'Мы должны покончить с Королевой-банши, или эта война будет вечной.', 29981),
(170074, 'ruRU', '', 'Я оплакивала Сильвану после того, что Артас сделал с ней... Но той Сильваны больше нет. Быть может, теперь и Орда это поймет.', 29981),
(170073, 'ruRU', '', 'Вернув нам Дерека, Бейн поступил благородно. Боюсь, это может стоить ему жизни.', 29981),
(170072, 'ruRU', 'Расскажи обо всем лорд-адмиралу. Я вернусь в Боралус своим путем.', '', 29981),
(170071, 'ruRU', 'Она явно решила показать всей Орде, что не потерпит инакомыслия.', '', 29981),
(170070, 'ruRU', 'На этот раз банши превзошла саму себя.', '', 29981),
(170069, 'ruRU', 'А в этом углу... погодите, откуда у нее ракеты? И пушки? Кто все это на нее навесил? Это же гипер-мега-механочайка!', '', 29981),
(170068, 'ruRU', '', 'А в этом углу... погодите, откуда у нее ракеты? И пушки? Кто все это на нее навесил? Это же гипер-мега-механочайка!', 29981),
(170066, 'ruRU', '<Проследить за встречей лидеров Орды.>', '<Проследить за встречей лидеров Орды.>', 29981),
(170065, 'ruRU', 'Сюда, $p!', '', 29981),
(170063, 'ruRU', '', 'Удачи тебе. Надеюсь, ты найдешь мастера Шоу и остальных в добром здравии.', 29981),
(170062, 'ruRU', '', 'Заслужить ваше доверие.', 29981),
(170061, 'ruRU', '', 'Я прошла испытания лоа, но осталось последнее...', 29981),
(170060, 'ruRU', '', '...а союз с Ордой сделал нас одним из величайших королевств Азерота. Да здравствует Зандалар!', 29981),
(170059, 'ruRU', '', 'Враги и предатели попытались сломить нас... и нашу веру.', 29981),
(170058, 'ruRU', '', 'Лоа благословляли наши клинки и корабли. Мы правили морями.', 29981),
(170055, 'ruRU', 'Недавно тут пробегала Келси Стализвон, но у меня не было сил ее окликнуть. Может, ей тоже нужна помощь.', 'Недавно тут пробегала Келси Стализвон, но у меня не было сил ее окликнуть. Может, ей тоже нужна помощь.', 29981),
(170054, 'ruRU', 'Я подслушал разговор батраков. Они говорили, что вождь приказала зачистить территорию. Будь начеку.', 'Я подслушала разговор батраков. Они говорили, что вождь приказала зачистить территорию. Будь начеку.', 29981),
(170053, 'ruRU', 'Орда уничтожила наши наблюдательные посты. Я бы наверняка истек кровью, если бы не ты. Что бы там ни происходило, это очень важно.', 'Орда уничтожила наши наблюдательные посты. Я бы наверняка истекла кровью, если бы не ты. Что бы там ни происходило, это очень важно.', 29981),
(170052, 'ruRU', 'Не знаю, что они задумали, но это что-то очень важное. Они не хотят, чтобы кто-либо прознал об этом.', 'Не знаю, что они задумали, но это что-то очень важное. Они не хотят, чтобы кто-либо прознал об этом.', 29981),
(170051, 'ruRU', 'Орда все время прочесывает территорию. Будь осторожнее.', 'Орда все время прочесывает территорию. Будь осторожнее.', 29981),
(170049, 'ruRU', '', 'Дориан Этуотер нежно гладит Урагана.', 29981),
(170045, 'ruRU', '<Поприсутствовать на встрече.>', '<Поприсутствовать на встрече.>', 29981),
(170044, 'ruRU', '$c, спасибо за помощь.\n\nПора начинать представление.', '', 29981),
(170043, 'ruRU', '', 'Здравствуй, $r. Чем могу помочь?', 29981),
(170040, 'ruRU', '', '', 29981),
(170039, 'ruRU', 'Леди Джайна, к нам приближается корабль Орды.', 'Леди Джайна, к нам приближается корабль Орды.', 29981),
(170038, 'ruRU', '', '<Пока вы подходите к Джайне, она пристально вглядывается в руины Терамора.>\n\nМы стольких здесь потеряли...\n\nБыть может, и меня?..\n\nВ который раз я задаюсь вопросом... Не уподобляюсь ли я своему отцу.', 29981),
(170037, 'ruRU', '$r, добро пожаловать в низину Арати! \n\nЧем я здесь занимаюсь?\n\nПока вы убиваете друг друга, я думаю, как бы перестроить эти убогие хибары, чтобы они были достойны нашего вождя.\n\nЧто не так с этими людьми? Как можно делать такие ярко-красные крыши у каменных строений?\n\nДикари...', '', 29981),
(170036, 'ruRU', 'Герой присел отдохнуть и восполнить силы. Это испытание оказалось сложнее, чем он думал.', 'Героиня присела отдохнуть и восполнить силы. Это испытание оказалось сложнее, чем она думала.', 29981),
(170035, 'ruRU', '', 'Пожалуй, это так.', 29981),
(170034, 'ruRU', 'Она права. Сложно представить себе место, где было бы меньше ордынских шпионов.', '', 29981),
(170033, 'ruRU', '', 'Можете не доверять мне, но Андуин поручился бы и за меня, и за Бейна.', 29981),
(170032, 'ruRU', 'Леди Джайна, Валира была близким другом короля Вариана. Если она говорит, что Бейн действует против воли Сильваны – значит, так и есть.', '', 29981),
(170031, 'ruRU', 'Если нет билета, придется уйти.', 'Если нет билета, придется уйти.', 29981),
(170030, 'ruRU', 'Предъяви билет.', 'Предъяви билет.', 29981),
(170029, 'ruRU', 'Сдаюсь! Сдаюсь!', 'Сдаюсь! Сдаюсь!', 29981),
(170028, 'ruRU', 'Пойду-ка я лучше отсюда!', 'Пойду-ка я лучше отсюда!', 29981),
(170027, 'ruRU', 'А ты не из хлипких...', 'А ты не из хлипких...', 29981),
(170026, 'ruRU', 'Хватит! Ладно, я уйду.', 'Хватит! Ладно, я уйду.', 29981),
(170025, 'ruRU', 'Сейчас я тебе этот \"билет\" знаешь куда засуну?', 'Сейчас я тебе этот \"билет\" знаешь куда засуну?', 29981),
(170024, 'ruRU', 'У меня есть билет на то, чтобы начистить тебе рожу!', 'У меня есть билет на то, чтобы начистить тебе рожу!', 29981),
(170023, 'ruRU', 'Нечего мне указывать!', 'Нечего мне указывать!', 29981),
(170022, 'ruRU', 'Ты не заставишь меня уйти!', 'Ты не заставишь меня уйти!', 29981),
(170021, 'ruRU', 'Эти гоблины подрядили тебя в охранники? Ладно, вот мой билет.', 'Эти гоблины подрядили тебя в охранники? Ладно, вот мой билет.', 29981),
(170020, 'ruRU', 'Ты просто проверяешь билеты? А по доспехам и не скажешь... Вот, смотри.', 'Ты просто проверяешь билеты? А по доспехам и не скажешь... Вот, смотри.', 29981),
(170019, 'ruRU', 'Вот. До сих пор поверить не могу, что мне пришлось за него заплатить.', 'Вот. До сих пор поверить не могу, что мне пришлось за него заплатить.', 29981),
(170018, 'ruRU', '|cFF0000FF(Задание)|r Курс на Терамор!', '|cFF0000FF(Задание)|r Курс на Терамор!', 29981),
(170017, 'ruRU', 'Вот он. Я за него половину месячного жалованья отдал.', 'Вот он. Я за него половину месячного жалованья отдала.', 29981),
(170016, 'ruRU', 'Ты шутишь? По той цене, которую заломили гоблины? \n\nДа это же грабеж средь бела дня!', 'Ты шутишь? По той цене, которую заломили гоблины? \n\nДа это же грабеж средь бела дня!', 29981),
(170015, 'ruRU', 'Я в списке важных гостей. \n\nСпроси Галливикса, он подтвердит.', 'Я в списке важных гостей. \n\nСпроси Галливикса, он подтвердит.', 29981),
(170014, 'ruRU', 'Нет у меня этого дурацкого билета. И что ты теперь со мной сделаешь?', 'Нет у меня этого дурацкого билета. \n\nИ что ты теперь со мной сделаешь?', 29981),
(170013, 'ruRU', 'Билет? \n\nО, должно быть, я оставил его в кармане других штанов...', 'Билет? \n\nО, должно быть, я оставила его в кармане других штанов...', 29981),
(170012, 'ruRU', 'А у Темной Госпожи стальные нервы. Устроить встречу прямо у Альянса под носом... \n\nДемонстрация силы, не иначе!', 'А у Темной Госпожи стальные нервы. Устроить встречу прямо у Альянса под носом... \n\nДемонстрация силы, не иначе!', 29981),
(170011, 'ruRU', 'Рискованно собирать все наших лидеров здесь, на территории Альянса. \n\nЧто Сильвана хочет доказать?', 'Рискованно собирать все наших лидеров здесь, на территории Альянса. \n\nЧто Сильвана хочет доказать?', 29981),
(170010, 'ruRU', 'Что ты хочешь сказать лорд-адмиралу?', 'Что ты хочешь сказать лорд-адмиралу?', 29981),
(170009, 'ruRU', 'Я тоже за тебя поручусь. Что ты хочешь ей сказать?', 'Я тоже за тебя поручусь. Что ты хочешь ей сказать?', 29981),
(170008, 'ruRU', 'Странно собирать совет в таком месте. \n\nИнтересно, что происходит?', 'Странно собирать совет в таком месте. \n\nИнтересно, что происходит?', 29981),
(170007, 'ruRU', 'Зачем всех лидеров созвали в такую даль? \n\nДолжно быть, это очень важно.', 'Зачем всех лидеров созвали в такую даль? \n\nДолжно быть, это очень важно.', 29981),
(170005, 'ruRU', '', 'Кто лучший конь во всей долине? Ты лучший конь во всей долине!', 29981),
(170004, 'ruRU', 'Ураган отходит от вас и негодующе ржет.', '', 29981),
(170003, 'ruRU', 'Ураган раздраженно фыркает.', '', 29981),
(170002, 'ruRU', '', 'Ураган пасется за домом. Не беспокойся, на самом деле он довольно смирный... обычно.', 29981),
(169997, 'ruRU', '', '<Валира бросает на вас быстрый взгляд.>\n\nЯ делаю все, что в моих силах. Это обязанность каждого из нас.', 29981),
(169996, 'ruRU', '', '$n, тебя не удивляет, что мы всегда встречаемся при весьма печальных обстоятельствах? \n\n<Валира ухмыляется.>\n\nНадеюсь, ты сможешь убедить леди Праудмур, что я не собираюсь ее убивать? Ее наверняка порадует эта новость.', 29981),
(169995, 'ruRU', '', 'Я доверяю мастеру Шоу и Андуину. Этого достаточно. Передай Бейну, что я согласна... Но я буду не одна.', 29981),
(169994, 'ruRU', '', 'Не верите мне – отправляйтесь в Штормград, и пусть Андуин поручится за меня. Вот только у нас мало времени, леди Джайна.', 29981),
(169993, 'ruRU', '', 'Бейн идет против воли банши. Терамор выбран не для того, чтобы оскорбить вас, но из соображений секретности.', 29981),
(169992, 'ruRU', '', 'Тогда он тоже должен это услышать. Передай Бейну, что я дам согласие на встречу... после разговора с Андуином.', 29981),
(169991, 'ruRU', '', 'Я доверяла Вариану... и верю мастеру Шоу. Хорошо. Передай Бейну, что я согласна... Но я буду не одна.', 29981),
(169990, 'ruRU', '', 'У Королевы-банши глаза повсюду. Терамор – одно из немногих мест, за которыми она не считает нужным следить.', 29981),
(169989, 'ruRU', '', 'После всего, что сделала Орда, вы имеете наглость...', 29981),
(169988, 'ruRU', '', 'Бейн Кровавое Копыто хочет исправить содеянное Ордой. Он просит о тайной встрече... у берегов Терамора.', 29981),
(169987, 'ruRU', '', 'Мы готовы тебя выслушать.', 29981),
(169986, 'ruRU', '', 'Я управляю потоками времени! Вам не победить!', 29981),
(169985, 'ruRU', '', 'Волны времени сметут вас!', 29981),
(169984, 'ruRU', '', 'Я здесь доминирую, не вы!', 29981),
(169983, 'ruRU', '', 'Времена меняются! Ваша смерть все ближе!', 29981),
(169982, 'ruRU', '', 'Хотите пронзить ткань времени? Или навсегда остаться в Вечности?', 29981),
(169981, 'ruRU', '', 'Ваше время вышло!', 29981),
(169980, 'ruRU', '', 'Немыслимо! Победа должна была достаться мне...', 29981),
(169979, 'ruRU', '', 'Вы обречены на смерть.', 29981),
(169978, 'ruRU', '', 'Неизбежный исход.', 29981),
(169977, 'ruRU', '', 'Я это предвидела.', 29981),
(169976, 'ruRU', 'Я сам покончу с вами!', '', 29981),
(169975, 'ruRU', 'Вы все СГОРИТЕ!', '', 29981),
(169974, 'ruRU', 'И это все?', '', 29981),
(169973, 'ruRU', 'Никакой дисциплины.', '', 29981),
(169972, 'ruRU', 'Ничтожество.', '', 29981),
(169971, 'ruRU', 'Мы... Мы – орудие вождя... Без нас он...', '', 29981),
(169970, 'ruRU', 'Ваше время вышло.', '', 29981),
(169969, 'ruRU', 'Пламя пожрет ваши трупы.', '', 29981),
(169968, 'ruRU', 'Тебе больше негде прятаться.', '', 29981),
(169967, 'ruRU', 'Я развешу ваши трупы на воротах литейной!', '', 29981),
(169966, 'ruRU', 'Ладно, забудь.', 'Ладно, забудь.', 29981),
(169965, 'ruRU', '', 'Я позвала – они пришли. От них куда больше проку, чем от двуногих.', 29981),
(169964, 'ruRU', 'Значит, ты шаманка?', 'Значит, ты шаманка?', 29981),
(169963, 'ruRU', 'Это ты призвала элементалей?', 'Это ты призвала элементалей?', 29981),
(169962, 'ruRU', '', 'А что такое \"шаманка\"?', 29981),
(169961, 'ruRU', '', 'Не так, как дома, зато здесь есть океанский бриз.\n\nЯ скучаю по Сэлу.', 29981),
(169960, 'ruRU', '', 'Я думала, что никогда больше не выйду в море. Но вот я здесь, в роли боцмана. И собираюсь присоединиться к Альянсу.\n\n<Дориан вздыхает.>\n\nНадеюсь, Сэл справится без меня.', 29981),
(169959, 'ruRU', '', '<Дориан заметно нервничает.>\n\nНе люблю, когда за мной наблюдают.', 29981),
(169958, 'ruRU', '', 'Я согласилась тебе помочь. Уж постарайся, чтоб я об этом не пожалела.', 29981),
(169957, 'ruRU', 'Поглощение пищи', 'Поглощение пищи', 29981),
(169955, 'ruRU', 'Что же до тебя... мы попляшем на твоих костях! А теперь УМРИ!', '', 29981),
(169954, 'ruRU', 'Умри!', '', 29981),
(169953, 'ruRU', 'Умри!', '', 29981),
(169952, 'ruRU', 'Узри мою СИЛУ!', '', 29981),
(169951, 'ruRU', 'Утоните во тьме!', '', 29981),
(169950, 'ruRU', 'Свет поглотит вас!', '', 29981),
(169949, 'ruRU', 'Я заглянул в глаза Дракона, и отчаяние охватило меня...', '', 29981),
(169948, 'ruRU', '', 'В атаку! За Альянс!', 29981),
(169947, 'ruRU', '', 'Мы вывесим изодранные знамена Орды на наших стенах в назидание врагам. Покажите им, на что способны часовые!', 29981),
(169946, 'ruRU', '', 'Приветствую, герои. Часовые уже готовятся к битве. И вам лучше начать делать то же самое.', 29981),
(169945, 'ruRU', '', 'Эти вандалы хотят осквернить наши земли. Им не может быть пощады!', 29981),
(169944, 'ruRU', '', 'Братья и сестры, мы должны подготовиться к битве. Нам предстоит сразиться с самыми жестокими воинами Орды.', 29981),
(169942, 'ruRU', 'К бою! За Орду!', '', 29981),
(169941, 'ruRU', 'Не щадите псов Альянса. Расправьтесь с ними и пустите их знамена на трофеи. Лок\'тар огар!', '', 29981),
(169940, 'ruRU', 'Войдя в зал, герой обнаружил там существо, подобное тем, с которыми сражался раньше, только гораздо крупнее. Вероятно, это и было испытание, ради которого он пришел сюда.', 'Войдя в зал, героиня обнаружила там существо, подобное тем, с которыми сражалась раньше, только гораздо крупнее. Вероятно, это и было испытание, ради которого она пришла сюда.', 29981),
(169939, 'ruRU', 'Это великая честь – сражаться за Орду в ущелье Песни Войны. Так взгляните же смело в лицо врагу и сражайтесь со всей яростью!', '', 29981),
(169938, 'ruRU', 'Вперед, бойцы Орды! Нашему вождю нужна только победа.', '', 29981),
(169937, 'ruRU', 'Сегодня отличный день для битвы. Сегодня мы добьемся славы!', '', 29981),
(169932, 'ruRU', 'Герой попытался открыть одну из дверей, но она не поддавалась. Ему оставалось лишь пробиваться через существ, преградивших путь.', 'Героиня попытался открыть одну из дверей, но она не поддавалась. Ей оставалось лишь пробиваться через существ, преградивших путь.', 29981),
(169926, 'ruRU', '', 'За Осквернителей! За Орду!', 29981),
(169925, 'ruRU', '', 'Здешние ресурсы крайне важны для поддержки боеспособности нашей армии. Приказ вождя – атаковать эти земли и захватить их во что бы то ни стало. Пленных не брать!', 29981),
(169924, 'ruRU', 'Да все они хвастуны и лгуны.\n\nДержу пари, таких историй, как у меня, тебе еще никто не рассказывал.', 'Да все они хвастуны и лгуны.\n\nДержу пари, таких историй, как у меня, тебе еще никто не рассказывал.', 29981),
(169923, 'ruRU', 'Поделишься интересной байкой, $n?', 'Поделишься интересной байкой, $n?', 29981),
(169922, 'ruRU', '...Конечно, мне пришлось ее отпустить. А как бы я затащил на борт китовую акулу?\n\n<Легонько толкает вас локтем в бок.>\n\nНикак, верно? \n\nТебе что-то нужно?', '...Конечно, мне пришлось ее отпустить. А как бы я затащила на борт китовую акулу?\n\n<Легонько толкает вас локтем в бок.>\n\nНикак, верно? \n\nТебе что-то нужно?', 29981),
(169921, 'ruRU', 'Так что же... Значит, гигантское щупальце утащило тебя на морское дно, а тебе хоть бы хны – стоишь тут и рассказываешь свою историю как ни в чем не бывало?\n\n<Указывает на своего собеседника.>\n\nТы веришь в эту чепуху?\n\nЛадно. Чем могу помочь?', 'Так что же... Значит, гигантское щупальце утащило тебя на морское дно, а тебе хоть бы хны – стоишь тут и рассказываешь свою историю как ни в чем не бывало?\n\n<Указывает на своего собеседника.>\n\nТы веришь в эту чепуху?\n\nЛадно. Чем могу помочь?', 29981),
(169920, 'ruRU', '...Да говорю тебе, на этом острове были летающие обезьяны! На кой мне выдумывать?\n\n<Сконфуженно вздыхает и оборачивается к вам.>\n\n Привет. Хочешь послушать байки? Или рассказать?', '...Да говорю тебе, на этом острове были летающие обезьяны! На кой мне выдумывать?\n\n<Сконфуженно вздыхает и оборачивается к вам.>\n\n Привет. Хочешь послушать байки? Или рассказать?', 29981),
(169919, 'ruRU', 'Так вот... Я ей сказал, где можно бросить якорь...\n\n<Откашливается и смотрит на вас.>\n\nТак и будешь подслушивать или скажешь, что тебе нужно?', 'Так вот... Я ей сказала, где можно бросить якорь...\n\n<Откашливается и смотрит на вас.>\n\nТак и будешь подслушивать или скажешь, что тебе нужно?', 29981),
(169918, 'ruRU', 'Так вот... Волна была выше меня! Она захлестнула палубу...\n\n<Замечает вас и оборачивается.>\n\nО, тебе что-то нужно?', 'Так вот... Волна была выше меня! Она захлестнула палубу...\n\n<Замечает вас и оборачивается.>\n\nО, тебе что-то нужно?', 29981),
(169917, 'ruRU', 'Ты не знаешь, где живет Дориан Этуотер?', 'Ты не знаешь, где живет Дориан Этуотер?', 29981),
(169916, 'ruRU', '<Замолкает и смотрит на вас.>\n\nДа?', '<Замолкает и смотрит на вас.>\n\nДа?', 29981),
(169915, 'ruRU', '', 'Вот как. Хорошо, я выслушаю ее.', 29981),
(169914, 'ruRU', 'Король Вариан доверял.', '', 29981),
(169913, 'ruRU', '', 'Ей можно доверять?', 29981),
(169912, 'ruRU', '', 'У меня послание для лорд-адмирала.', 29981),
(169911, 'ruRU', 'Опустите оружие! Что ты здесь делаешь, Валира? Отвечай!', '', 29981),
(169910, 'ruRU', '', 'Хм... Неплохо, Шоу.', 29981),
(169909, 'ruRU', 'Покажись!', '', 29981),
(169908, 'ruRU', 'Амбиции нередко приводят к... Постойте. Здесь кто-то есть.', '', 29981),
(169907, 'ruRU', '', 'Я знала, что Эшвейн нельзя доверять, но союз с Ордой... Это уже слишком.', 29981),
(169906, 'ruRU', '', 'Поэтому наточите клинки и смажьте ядом кинжалы. Сегодня Орда завоюет низину Арати!', 29981),
(169904, 'ruRU', '', 'Приготовьтесь к битве, герои. Альянс собрал внушительное войско.', 29981),
(169903, 'ruRU', '', 'Осквернители приветствуют вас! Мы далеко от родных земель, но скоро вы почувствуете себя здесь как дома. Конечно, если выживете. Приготовьтесь!', 29981),
(169902, 'ruRU', '\"Что капает с пера, что – из открытой раны.$b$bВсе слито воедино здесь.$b$bОт черного беги и собери цвет алый – $b$bИ пусть убийца явится как есть\".', '\"Что капает с пера, что – из открытой раны.$b$bВсе слито воедино здесь.$b$bОт черного беги и собери цвет алый – $b$bИ пусть убийца явится как есть\".', 29981),
(169901, 'ruRU', 'Вдруг в голове героя зазвучал певучий голос, который декламировал стихотворение:', 'Вдруг в голове героини зазвучал певучий голос, который декламировал стихотворение:', 29981),
(169900, 'ruRU', '...а когда прояснилось, он обнаружил, что находится в странном помещении.', '...а когда прояснилось, она обнаружила, что находится в странном помещении.', 29981),
(169899, 'ruRU', 'Порядок. Теперь можно готовить корабль к отплытию.', '', 29981),
(169896, 'ruRU', 'За Альянс!', '', 29981),
(169895, 'ruRU', '<Взять ключ.>', '<Взять ключ.>', 29981),
(169894, 'ruRU', '<В страницах дневника вырезана полость, в которой спрятан ключ.>', '', 29981),
(169890, 'ruRU', 'Герои! Орда наступает – пришло время дать ей решительный отпор. Эта земля с ее ресурсами исключительно важна для победы – так сказал король. Защитим же ее во имя Альянса!', '', 29981),
(169889, 'ruRU', 'Я чую их смрад даже отсюда. Приготовьтесь, бойцы. Изрубим этих псов!', '', 29981),
(169888, 'ruRU', 'Дайте-ка я посмотрю на вас. Как по мне, превосходное войско! Наша победа будет решительной и быстрой.', '', 29981),
(169887, 'ruRU', 'Добро пожаловать в низину, герои. Лига Аратора приветствует вас. Для нас большая честь видеть вас в наших рядах.', '', 29981),
(169885, 'ruRU', 'Ага. Этуотеры живут за городом, где-то в Мертвецкой Трясине, насколько я помню. Я там нечасто бываю.', 'Ага. Этуотеры живут за городом, где-то в Мертвецкой Трясине, насколько я помню. Я там нечасто бываю.', 29981),
(169884, 'ruRU', 'Корабел, что ли? Говорят, этого старого морского волка уже нет в живых.', 'Корабел, что ли? Говорят, этого старого морского волка уже нет в живых.', 29981),
(169883, 'ruRU', 'Дориан? Ах, да. Когда я еду из форта Дэлин, мы иногда встречаемся по пути. Надеюсь, это поможет.', 'Дориан? Ах, да. Когда я еду из форта Дэлин, мы иногда встречаемся по пути. Надеюсь, это поможет.', 29981),
(169882, 'ruRU', 'Дориан Этуотер? Знаменитый корабел? По чьим чертежам построили кул-тирасский флагман? Высокий рост, недюжинная сила, может построить судно без единой мозоли на руках? Понятия не имею, кто это.', 'Дориан Этуотер? Знаменитый корабел? По чьим чертежам построили кул-тирасский флагман? Высокий рост, недюжинная сила, может построить судно без единой мозоли на руках? Понятия не имею, кто это.', 29981),
(169881, 'ruRU', 'О, конечно. Этуотер каждые пару дней проезжает здесь на своей повозке – откуда-то с севера.', 'О, конечно. Этуотер каждые пару дней проезжает здесь на своей повозке – откуда-то с севера.', 29981),
(169880, 'ruRU', 'Это же знаменитый корабел? Я точно слышал это имя...', 'Это же знаменитый корабел? Я точно слышала это имя...', 29981),
(169879, 'ruRU', 'Я сам не видел, но говорят, что Этуотер может построить корабль за один день! Передашь привет от меня?', 'Я сама не видела, но говорят, что Этуотер может построить корабль за один день! Передашь привет от меня?', 29981),
(169878, 'ruRU', 'Кто?', 'Кто?', 29981),
(169875, 'ruRU', '<Взять письмо.>', '<Взять письмо.>', 29981),
(169874, 'ruRU', '', '<Леди Джайна Праудмур вручает вам сложенное письмо.>\n\nМожешь прочесть, если хочешь. Оно немного сентиментально, но ничего слишком личного там нет.', 29981),
(169871, 'ruRU', 'Квакенбуш? Нет!\n\nКакая жалость. Он был славным малым. Такие мягкие перья... Так и хотелось потрогать. Возможно, его убили те же, кто отправил меня в этот \"отпуск\".', '', 29981),
(169870, 'ruRU', 'Бизмо, который остался в потасовочной, – самозванец! Давай разоблачим его и узнаем, что происходит на самом деле!', '', 29981),
(169869, 'ruRU', '<Рассказать Бизмо об убийстве Квакенбуша.>', '<Рассказать Бизмо об убийстве Квакенбуша.>', 29981),
(169868, 'ruRU', 'О, спасибо! Это так мило с твоей стороны!\n\nИтак, что я пропустил?', '', 29981),
(169867, 'ruRU', '<Предложить Бизмо 2 золотых, чтобы он смог попасть домой.>', '<Предложить Бизмо 2 золотых, чтобы он смог попасть домой.>', 29981),
(169866, 'ruRU', '<Предложить Бизмо свой камень возвращения, чтобы он смог попасть домой.>', '<Предложить Бизмо свой камень возвращения, чтобы он смог попасть домой.>', 29981),
(169865, 'ruRU', 'Тот, другой Бизмо, – предатель. Не знаю, кто он такой... или что он такое... но это точно не я. Я – это я!\n\nЯ расскажу тебе все, что знаю.\n\nПонятия не имею, что произошло. На меня накинулись сзади. Завязалась схватка... а потом в глазах у меня потемнело. И вот я здесь, на другом краю мира, без камня возвращения и без гроша в кармане.', '', 29981),
(169864, 'ruRU', 'Что? Бизмо? Я думал, ты в потасовочной. Что происходит?', 'Что? Бизмо? Я думала, ты в потасовочной. Что происходит?', 29981),
(169863, 'ruRU', 'Ты... из потасовочной \"У Бизмо\"? Это я! Бизмо!\n\nНАСТОЯЩИЙ Бизмо!', '', 29981),
(169862, 'ruRU', 'Встретимся в потасовочной \"У Бизмо\", $p. Мы разоблачим самозванца и раскроем это убийство!', '', 29981),
(169858, 'ruRU', 'Курс на Терамор.', 'Курс на Терамор.', 29981),
(169857, 'ruRU', 'Я жрец моря и могу повелевать волнами – они отнесут этот корабль, куда нужно.\n\nОдно твое слово – и мы отправимся в путь.', '', 29981),
(169856, 'ruRU', 'Главнокомандующий, я нашел письмо от леди Эшвейн.', 'Главнокомандующий, я нашла письмо от леди Эшвейн.', 29981),
(169855, 'ruRU', '', 'Мы еще встретимся... Я уверена.', 29981),
(169853, 'ruRU', 'Пожалуйста, вернитесь на место свидетеля, $n.', '', 29981),
(169852, 'ruRU', 'Это так. $n, еще одно лживое слово – я расценю это как неповиновение суду!', '', 29981),
(169851, 'ruRU', '', 'Ложь! Ваша честь, вы наверняка знаете, что свидетель лжет.', 29981),
(169850, 'ruRU', '', 'Ваша честь, свидетель лжет. Мы все были там. Мы видели этот грандиозный бой!', 29981),
(169849, 'ruRU', '', 'Правда? Вы ничего не помните? Хорошо, продолжим.', 29981),
(169848, 'ruRU', '', '$n, пожалуйста, помните, что вы находитесь под присягой.', 29981),
(169847, 'ruRU', '', '$n, мы расследовали это дело вместе. Вы что, были настолько невнимательны? Эх...', 29981),
(169846, 'ruRU', '', 'Странно, я думала иначе... ладно, продолжим. $n, правда ли, что из разговора с лордом Брауном вам стал известен его потенциальный мотив?', 29981),
(169845, 'ruRU', 'Прежде чем я закончу, я хочу задать вопрос вам, $n. Кто, по ВАШЕМУ мнению, убил интенданта?', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169844, 'ruRU', '', 'Все трое подозреваемых обвиняются в убийстве интенданта Квакенбуша.', 29981),
(169843, 'ruRU', 'Всем встать. Судья Бизмо покидает зал суда. Мясыш хочет есть. Заседание переносится.', '', 29981),
(169842, 'ruRU', 'Я прерываю заседание, чтобы вы могли изучить новые улики.', '', 29981),
(169841, 'ruRU', 'Командир Даало, ваш помощник нашел дополнительную информацию, относящуюся к делу.', '', 29981),
(169840, 'ruRU', 'Да, вижу. Очень необычно, но я позволяю.', '', 29981),
(169839, 'ruRU', 'Подойди.', '', 29981),
(169838, 'ruRU', 'Ваша честь, я прошу минутку внимания.', '', 29981),
(169837, 'ruRU', 'Стоп! Остановитесь!', '', 29981),
(169836, 'ruRU', 'В деле \"Альянс против Брауна, О\'Фланнерти, Лазарби и |3-1($n)\" мы...', '', 29981),
(169835, 'ruRU', 'Очень интересно! Старшина присяжных, продолжайте.', '', 29981),
(169834, 'ruRU', 'Да, Ваша честь.', '', 29981),
(169833, 'ruRU', 'Хорошо. Признаете ли вы виновным кого-либо из присутствующих в суде?', '', 29981),
(169832, 'ruRU', 'Присяжные пришли к решению, Ваша честь.', '', 29981),
(169831, 'ruRU', 'Очень хорошо. Теперь я хочу дать присяжным возможность обдумать...', '', 29981),
(169830, 'ruRU', '', 'Защита сказала свое слово, Ваша честь.', 29981),
(169829, 'ruRU', '', 'Самое очевидное тому объяснение такое: убийца Квакенбуша – это $n!', 29981),
(169828, 'ruRU', '', '$n пытается ввести нас в заблуждение. Ведет себя как преступник, который скрывает содеянное.', 29981),
(169827, 'ruRU', '', 'Я же хочу представить присяжным сделанный на камеру СЕЛФИ снимок, на котором четко видно, как $N распространяет поддельные приглашения в потасовочную \"У Бизмо\". Никакого почтения к закону!', 29981),
(169826, 'ruRU', '', 'Когда же прекратится череда этих кровавых преступлений? И наконец, $n, вы обвиняете в убийстве моего клиента-воргена.', 29981),
(169825, 'ruRU', '', 'Между тем в ходе расследования вы сами убили двух ни в чем не повинных инженеров... так?', 29981),
(169824, 'ruRU', '', 'Видите? $n имеет финансовые мотивы для совершения преступления. И вот еще что. $n, вы обвиняете в убийстве интенданта моего достопочтенного клиента-дворфа.', 29981),
(169823, 'ruRU', '', 'Но судя по записям, это ВЫ убили лорда Силистреля, чтобы получить его честно заработанное бойцовское золото! Это правда?', 29981),
(169822, 'ruRU', '', '$n, вы утверждаете, что у моего клиента-человека был мотив, чтобы убить интенданта.', 29981),
(169821, 'ruRU', '', 'Убийца Квакенбуша – это $n!', 29981),
(169820, 'ruRU', '', 'Мы бы хотели представить другую версию произошедшего.', 29981),
(169819, 'ruRU', '', 'Спасибо, Ваша честь.', 29981),
(169818, 'ruRU', 'Спасибо, обвинитель. Защита?', '', 29981),
(169817, 'ruRU', '', 'Обвинение сказало свое слово, Ваша честь.', 29981),
(169816, 'ruRU', '', 'Он был одержим демоном!', 29981),
(169815, 'ruRU', '', 'Он шпион Орды!', 29981),
(169814, 'ruRU', '', 'Ему так наскучила потасовочная \"У Бизмо\", что он стал красть у других продавцов!', 29981),
(169813, 'ruRU', '', 'Ему так наскучила потасовочная \"У Бизмо\", что он плюнул из VIP-ложи!', 29981),
(169812, 'ruRU', '', 'Чтобы подделывать приглашения ради забавы, нужно обладать значительным доходом, чему свидетельствует инкрустированный меч, найденный |3-4($n) на месте преступления.', 29981),
(169811, 'ruRU', '', 'Ему так наскучила потасовочная \"У Бизмо\", что он стал распространять поддельные приглашения.', 29981),
(169810, 'ruRU', '', 'У Гранта Лазарби были весомые причины убить Квакенбуша.', 29981),
(169809, 'ruRU', 'Нет, все было не так...', '', 29981),
(169808, 'ruRU', '', 'Он хотел отдать шляпу интенданта Королю-личу!', 29981),
(169807, 'ruRU', '', 'Он хотел продать шляпу интенданта тому, кто больше предложит!', 29981),
(169806, 'ruRU', '', 'Он хотел скормить шляпу интенданта невидимому чудовищу из Бездны!', 29981),
(169805, 'ruRU', '', 'Он хотел отдать сердце интенданта Королю-личу!', 29981),
(169804, 'ruRU', '', 'Он хотел продать сердце интенданта тому, кто больше предложит!', 29981),
(169803, 'ruRU', '', 'Он хотел скормить сердце интенданта невидимому чудовищу из Бездны!', 29981),
(169802, 'ruRU', '', 'Он хотел отдать душу интенданта Королю-личу!', 29981),
(169801, 'ruRU', '', 'Он хотел продать душу интенданта тому, кто больше предложит!', 29981),
(169800, 'ruRU', '', 'На то указывает улика, найденная на месте преступления, – загадочный свиток.', 29981),
(169799, 'ruRU', '', 'Он хотел скормить душу интенданта невидимому чудовищу из Бездны!', 29981),
(169798, 'ruRU', '', 'У повелителя теней О\'Фланнерти тоже был мотив.', 29981),
(169797, 'ruRU', 'Как... ты... смеешь?!', '', 29981),
(169796, 'ruRU', '', 'Он убил Квакенбуша, чтобы скрыть другое убийство!', 29981),
(169795, 'ruRU', '', 'Они с Квакенбушем состояли в любовном треугольнике!', 29981),
(169794, 'ruRU', '', 'Он задолжал Джайне Праудмур.', 29981),
(169793, 'ruRU', '', 'Он задолжал Траллу.', 29981),
(169792, 'ruRU', '', 'На то указывают улики, найденные на месте преступления, о чем нам говорит $n: был украден ящик с ценными товарами.', 29981),
(169791, 'ruRU', '', 'Он задолжал лорду Силистрелю.', 29981),
(169790, 'ruRU', '', 'У лорда Уинифреда Брауна были весомые причины убить Квакенбуша.', 29981),
(169789, 'ruRU', '', 'Дамы и господа присяжные, вам были представлены доказательства.', 29981),
(169788, 'ruRU', 'Пф-ф! Если маленькая шалость – это преступление, то считайте меня виновным. Я готов заплатить штраф. И давайте уже закончим с этим.', '', 29981),
(169787, 'ruRU', '', 'Ясно. И что же за преступление он совершил со скуки?', 29981),
(169786, 'ruRU', '', 'Что это был за мотив?', 29981),
(169785, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с господином Лазарби вам стал известен его потенциальный мотив?', 29981),
(169784, 'ruRU', '', 'Какие найденные вами улики указывают на господина Лазарби?', 29981),
(169783, 'ruRU', '', 'И наконец, $n, я бы хотела расспросить вас о Гранте Лазарби.', 29981),
(169782, 'ruRU', 'Простите.', '', 29981),
(169781, 'ruRU', 'Я призываю к порядку в суде!', '', 29981),
(169780, 'ruRU', 'В-в-вы не понимаете... Я... я... я...', '', 29981),
(169779, 'ruRU', '', 'Кому же он хотел отдать эту шляпу?', 29981),
(169778, 'ruRU', '', 'Кому же он хотел отдать это сердце?', 29981),
(169777, 'ruRU', '', 'Кому же он хотел отдать эту душу?', 29981),
(169776, 'ruRU', '', 'Что это был за мотив?', 29981),
(169775, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с господином О\'Фланнерти вам стал известен его потенциальный мотив?', 29981),
(169774, 'ruRU', '', '$n, вы также нашли улики, указывающие на причастность О\'Фланнерти к убийству. Что именно вам удалось обнаружить?', 29981),
(169773, 'ruRU', 'Об-об-обо мне, что ли?', '', 29981),
(169772, 'ruRU', '', 'Спасибо, Ваша честь. Теперь я бы хотела задать несколько вопросов о повелителе теней О\'Фланнерти.', 29981),
(169771, 'ruRU', 'Обвинение, пожалуйста, продолжайте.', '', 29981),
(169770, 'ruRU', 'Это неортодоксальная мера, но я все же разрешаю.', '', 29981),
(169769, 'ruRU', '$pr, твой болтливый язык доведет тебя до могилы! Защищайся!', '', 29981),
(169768, 'ruRU', '', 'Кому же он был должен?', 29981),
(169767, 'ruRU', 'НЕМЫСЛИМО!', '', 29981),
(169766, 'ruRU', '', 'Что это был за мотив?', 29981),
(169765, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с лордом Брауном вам стал известен его потенциальный мотив?', 29981),
(169764, 'ruRU', '', 'И что это была за улика?', 29981),
(169763, 'ruRU', '', '$n, правда ли, что вы нашли на месте преступления улику, указывающую на лорда Брауна?', 29981),
(169762, 'ruRU', 'Хм!', '', 29981),
(169761, 'ruRU', '', '$n, я бы хотела задать несколько вопросов о лорде Уинифреде Брауне.', 29981),
(169760, 'ruRU', '', 'Для дачи показаний приглашается $n.', 29981),
(169759, 'ruRU', 'Спасибо, Улаани. Обвинение, ваш свидетель.', '', 29981),
(169758, 'ruRU', '', 'Мои подзащитные невиновны!', 29981),
(169757, 'ruRU', 'Спасибо, обвинитель. Защита, ваше вступительное слово?', '', 29981),
(169756, 'ruRU', '', 'Троих обвиняемых подозревают в убийстве. Мы докажем, что по меньшей мере один из них виновен!', 29981),
(169755, 'ruRU', '', 'Спасибо, Ваша честь.', 29981),
(169754, 'ruRU', 'Слово общественному обвинению.', '', 29981),
(169753, 'ruRU', 'Хорошо. Присяжные, сядьте.', '', 29981),
(169751, 'ruRU', 'Помощник судьи Мясыш, пожалуйста, примите присягу у заседателей.', '', 29981),
(169750, 'ruRU', 'Присяжные! Клянетесь ли вы перед лицом Света говорить правду и только правду?', '', 29981),
(169749, 'ruRU', 'Сегодня мы рассмотрим дело \"Альянс против Брауна, О\'Фланнерти и Лазарби\".', '', 29981),
(169748, 'ruRU', 'Суд идет. Председатель – судья Бизмо. Мясыш хочет есть.', '', 29981),
(169747, 'ruRU', 'Слушайте все!', '', 29981),
(169746, 'ruRU', 'Хотя книга теперь почти полностью описывает ваше испытание, рассказ еще не закончен.', '', 29981),
(169745, 'ruRU', 'Продолжить писать рассказ.', 'Продолжить писать рассказ.', 29981),
(169744, 'ruRU', 'В глазах у героя потемнело...', 'В глазах у героини потемнело...', 29981),
(169738, 'ruRU', '$c, не трать мое время.\n\nПриходи только по важному делу.', '', 29981),
(169737, 'ruRU', 'Ничего. <Не рассказывать о задании Бейна.>', 'Ничего. <Не рассказывать о задании Бейна.>', 29981),
(169736, 'ruRU', 'Бейн Кровавое Копыто хочет дать мне секретное задание.', 'Бейн Кровавое Копыто хочет дать мне секретное задание.', 29981),
(169735, 'ruRU', 'Значит, Бейн хочет действовать скрытно? Мы должны знать, что он задумал.\n\nПока что следуй его указаниям, $n. Ты под моей защитой, так что не переживай, если придется запачкать руки, чтобы сохранить его доверие.\n\nПросто сделай все, что он скажет, а потом сообщи обо всем мне.', '', 29981),
(169734, 'ruRU', 'Что там у тебя, $n?', '', 29981),
(169733, 'ruRU', '', '$C! У меня срочное послание от верховного вождя!', 29981),
(169732, 'ruRU', 'Без тебя я бы не справился. Я этого не забуду. Береги себя, $n.', '', 29981),
(169731, 'ruRU', 'Саму сущность героя начало втягивать в книгу.', 'Саму сущность героини начало втягивать в книгу.', 29981),
(169729, 'ruRU', '\"Стоило перу героя коснуться чистого пергамента, как стало происходить нечто необыкновенное.', '\"Стоило перу героини коснуться чистого пергамента, как стало происходить нечто необыкновенное.', 29981),
(169727, 'ruRU', 'Как только моя рука прикоснулась к книге, она сама по себе стала писать.', 'Как только моя рука прикоснулась к книге, она сама по себе стала писать.', 29981),
(169721, 'ruRU', 'Встретимся на месте!', '', 29981),
(169720, 'ruRU', 'Хотя потом поболтаем, Бронзобород. Скорее возвращайтесь в мою лабораторию!', '', 29981),
(169719, 'ruRU', 'Да я как раз собира...', '', 29981),
(169718, 'ruRU', 'Ну конечно, Грозовая искра полностью заряжена сущностью Хати. Что же вы не сказали?!', '', 29981),
(169717, 'ruRU', 'Прости, Мимирон. Мы как раз закончили сбор...', '', 29981),
(169716, 'ruRU', 'Вот вы где. От вашей схватки с сущностью Хати перегорели мои реле грозолокации.', '', 29981),
(169715, 'ruRU', 'Только посмотрите! К нам летит один из малышей Мимирона.', '', 29981),
(169714, 'ruRU', '$p, пора! Собери сущность Хати с помощью Грозовой искры!', '', 29981),
(169713, 'ruRU', 'Знаю, малыш, тебе больно. Потерпи еще чуть-чуть!', '', 29981),
(169712, 'ruRU', 'Сущность Хати жалобно скулит.', '', 29981),
(169711, 'ruRU', 'Он пожертвовал собой ради всех нас. Мы обязаны помочь ему!', '', 29981),
(169709, 'ruRU', 'Я чувствую боль и смятение в душе у Хати. Какие муки ему довелось пережить!', '', 29981),
(169708, 'ruRU', 'Я постараюсь. А пока мы должны усмирить боль, терзающую Хати.', '', 29981),
(169707, 'ruRU', 'Мурадин тебя размолоти, в следующий раз поосторожнее с бородой, ладно?', '', 29981),
(169706, 'ruRU', 'Нет, я просто искал улики.', 'Нет, я просто искала улики.', 29981),
(169705, 'ruRU', '', 'Ну-с... э-э... как там бои?', 29981),
(169704, 'ruRU', 'Этот ящик совершенно пуст. Его вскрыли и забрали все содержимое.\n\nКвакенбуш был интендантом арены и распоряжался всеми ценностями. Возможно, это преступление было совершено из-за |cFF0000FFденег|r.', 'Этот ящик совершенно пуст. Его вскрыли и забрали все содержимое.\n\nКвакенбуш был интендантом арены и распоряжался всеми ценностями. Возможно, это преступление было совершено из-за |cFF0000FFденег|r.', 29981),
(169702, 'ruRU', 'Квакенбуш лежит на полу, из его широкой, покрытой перьями груди торчит меч.\n\nПохоже, этот меч и является орудием убийства.\n\nОружие инкрустировано золотом и самоцветами. Тот, кому оно принадлежало, был |cFF0000FFочень богат|r', 'Квакенбуш лежит на полу, из его широкой, покрытой перьями груди торчит меч.\n\nПохоже, этот меч и является орудием убийства.\n\nОружие инкрустировано золотом и самоцветами. Тот, кому оно принадлежало, был |cFF0000FFочень богат|r', 29981),
(169700, 'ruRU', 'Я помогу тебе, Бронзобород. Во славу природы!', '', 29981),
(169699, 'ruRU', 'Сущность Хати яростно воет!', '', 29981),
(169698, 'ruRU', 'КРОЛМИР!!!', '', 29981),
(169697, 'ruRU', 'Ай! Плохая идея! Очень плохая!', '', 29981),
(169696, 'ruRU', 'Ты чувствуешь всю боль этого места, да, мой мальчик? Ты просто испугался.', '', 29981),
(169695, 'ruRU', 'Я попробую подозвать его. Держись на расстоянии, $p.', '', 29981),
(169694, 'ruRU', 'Тихо, малыш. Тихо.', '', 29981),
(169693, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(169692, 'ruRU', 'Я слышал о том, что здесь произошло... но надеялся, что мне не придется на это смотреть.', '', 29981),
(169663, 'ruRU', 'Вы уж простите, но будет тесновато. Эти лодки на тауренов не рассчитаны.', '', 29981),
(169657, 'ruRU', 'Давай сыграем в игру. Становись рядом с предметами, которые я назову, или сгори!', '', 29981),
(169655, 'ruRU', 'Посмотрим, как ты ориентируешься на ощупь!', '', 29981),
(169629, 'ruRU', 'Ветер, наполни наши паруса! Веди нас верным курсом!', '', 29981),
(169628, 'ruRU', 'Тогда не будем терять времени. Готовы?', '', 29981),
(169627, 'ruRU', 'Были некоторые... трудности, но теперь можно отплывать.', '', 29981),
(169626, 'ruRU', 'Как-то вы долго. Я уже подумал, что вас схватили.', '', 29981),
(169625, 'ruRU', 'Хм-м... Какой сложный замок. Придется с ним повозиться...', '', 29981),
(169624, 'ruRU', '...насколько это возможно.', '', 29981),
(169623, 'ruRU', 'Вот он, в клетке! Он без сознания, но жив...', '', 29981),
(169622, 'ruRU', 'Поспешим! Праудмура наверняка держат в трюме.', '', 29981),
(169621, 'ruRU', 'Что ж... Можно и так, конечно...', '', 29981),
(169620, 'ruRU', 'Будь начеку. Команда наверняка нас услышит.', '', 29981),
(169619, 'ruRU', 'Больно мне это говорить, но быть сегодня крови.', '', 29981),
(169618, 'ruRU', 'Команда безоговорочно предана Сильване. Просто так они нас не пропустят.', '', 29981),
(169617, 'ruRU', 'Бросай абордажный крюк, $n, а я последую за тобой.', '', 29981),
(169616, 'ruRU', 'Приплыли. Жди нас, Зеллинг, а мы на палубу.', '', 29981),
(169615, 'ruRU', 'Волны милосердные, тихо и быстро несите нас к цели.', '', 29981),
(169614, 'ruRU', '\"Скорое возмездие\" стоит на якоре неподалеку отсюда. Зеллинг нас довезет.', '', 29981),
(169613, 'ruRU', 'Если мы не встретимся с ней в Тераморе, все будет напрасно.', '', 29981),
(169611, 'ruRU', '', 'Спасибо тебе, Рата. И тебе, $n. Пришло время обратиться к народу.', 29981),
(169610, 'ruRU', 'Я вижу, ты владеешь искусством начертания, как и я. Возможно, ты хочешь углубить свои знания в этом деле?$b$bТакже я могу предложить тебе материалы, если твои запасы истощились.', '', 29981),
(169609, 'ruRU', 'Здравствуй! Ты хочешь учиться искусству начертания?$b$bИли, может быть, тебе нужны материалы?', '', 29981),
(169608, 'ruRU', 'С землей нужно обращаться бережно.', '', 29981),
(169607, 'ruRU', 'По газону не ходить!', '', 29981),
(169606, 'ruRU', '$c, смотри не запачкайся.', '', 29981),
(169605, 'ruRU', 'Это пока еще мелкий дождик!', '', 29981),
(169598, 'ruRU', 'Наш следующий боец решил отвлечься от поедания самого себя и полакомиться нашим претендентом. Перед вами... Уроборос!', '', 29981),
(169597, 'ruRU', '', 'Наш следующий боец решил отвлечься от поедания самого себя и полакомиться нашим претендентом. Перед вами... Уроборос!', 29981),
(169588, 'ruRU', '', 'Свет лоа да озарит твой путь, моя королева.', 29981),
(169584, 'ruRU', 'Я загадываю... земноводную любительницу насекомых!', '', 29981),
(169583, 'ruRU', 'Я загадываю... существо из морских глубин!', '', 29981),
(169582, 'ruRU', 'Я загадываю... чугунный механизм!', '', 29981),
(169581, 'ruRU', 'Я загадываю... зверька в броне!', '', 29981),
(169580, 'ruRU', 'Я загадываю... нечто жужжащее и кусачее!', '', 29981),
(169579, 'ruRU', 'Я загадываю... пернатое существо!', '', 29981),
(169578, 'ruRU', 'Я загадываю... вкуснейшее угощение!', '', 29981),
(169577, 'ruRU', 'Я загадываю... что-то милое и пушистое!', '', 29981),
(169576, 'ruRU', 'Я загадываю... сокровище из воска, которое в особой цене у кобольдов!', '', 29981),
(169571, 'ruRU', 'Надевание...', 'Надевание...', 29981),
(169570, 'ruRU', 'Как пожелаешь.', 'Как пожелаешь.', 29981),
(169565, 'ruRU', 'Все, что дремало... скоро пробудится.', '', 29981),
(169564, 'ruRU', 'Что покоилось на дне, восстанет.', '', 29981),
(169563, 'ruRU', 'Получи мой дар и узри все истины мира.', '', 29981),
(169562, 'ruRU', 'Я направлял твою руку.', '', 29981),
(169561, 'ruRU', '', 'Босси Кософланж, которая осталась на арене, – самозванка! Давай разоблачим ее и узнаем, что происходит на самом деле!', 29981),
(169560, 'ruRU', 'Держитесь подальше от жаб, пока принцесса Таланджи вас спасает!', 'Держитесь подальше от жаб, пока принцесса Таланджи вас спасает!', 29981),
(169553, 'ruRU', 'Тут и думать нечего.', '', 29981),
(169552, 'ruRU', 'С-с-справедливо...', '', 29981),
(169551, 'ruRU', 'Угу.', '', 29981),
(169550, 'ruRU', 'Верно подмечено.', '', 29981),
(169549, 'ruRU', 'Да-да, я помню.', '', 29981),
(169548, 'ruRU', 'Их ПРАВДА убили.', '', 29981),
(169547, 'ruRU', 'Если посмотреть с этой стороны...', '', 29981),
(169546, 'ruRU', 'Интересно.', '', 29981),
(169545, 'ruRU', '<Рычит>', '', 29981),
(169544, 'ruRU', '$n? Да быть не может!', '', 29981),
(169543, 'ruRU', 'О нет! Не может быть!', '', 29981),
(169542, 'ruRU', '<Ахает>', '', 29981),
(169539, 'ruRU', '', 'Он любит поломать голову – особенно чужую! Поприветствуйте Головолома!', 29981),
(169538, 'ruRU', 'Он любит поломать голову – особенно чужую! Поприветствуйте Головолома!', '', 29981),
(169517, 'ruRU', 'Ну, это уже что-то. Спасибо тебе, $n. Как МАТРИАРХ найдет ответ – я сразу дам тебе знать.', '', 29981),
(169516, 'ruRU', '', 'Выполняю расчет...', 29981),
(169515, 'ruRU', 'Это только на анализ?.. А когда у тебя будет готовый план?', '', 29981),
(169514, 'ruRU', '', 'Подключение к архивам Зала Сердца. На подробный анализ потребуется примерно 77 циклов.', 29981),
(169513, 'ruRU', 'Вот мы и в Зале Сердца. Теперь ты скажешь нам, как спасти Азерот?', '', 29981),
(169512, 'ruRU', 'Валите его, иначе нам конец!', '', 29981),
(169511, 'ruRU', 'Гляньте, какой здоровый!', '', 29981),
(169510, 'ruRU', '', 'Система з-з-заражена.', 29981),
(169509, 'ruRU', 'Что-то не так! У нас гости!', '', 29981),
(169508, 'ruRU', 'Ничего, с такой помощью мы с чем угодно справимся. Готовьтесь!', '', 29981),
(169507, 'ruRU', '', 'Внимание: диагностика путевых врат не завершена. Вероятно, канал телепортации заражен.', 29981),
(169506, 'ruRU', 'Ого, работающие путевые врата! Скорей бы их опробовать!', '', 29981),
(169505, 'ruRU', '', 'Протокол этикета перегружен. Выполняю перезапуск.', 29981),
(169504, 'ruRU', '', 'Внимание: пересозидание неизбежно.', 29981),
(169503, 'ruRU', '', 'Ошибка. Процедура выхода не найдена.', 29981),
(169502, 'ruRU', '', 'Отбытие зафиксировано.', 29981),
(169501, 'ruRU', '', 'Активирую протокол прощания.', 29981),
(169500, 'ruRU', '', 'Вам требуются эксперименты?', 29981),
(169499, 'ruRU', '', 'Поиск в базе данных приветствий. Здравствуйте.', 29981),
(169498, 'ruRU', '', 'Ваш уровень заражения: незначительный.', 29981),
(169497, 'ruRU', '$n, я знал, что ты в беде меня не оставишь. Спасибо тебе за это.', '', 29981),
(169495, 'ruRU', 'Фермер Сян-су решил на время забыть о покое и уединении. Сейчас он преподаст пару уроков садоводства!', '', 29981),
(169494, 'ruRU', '', 'Что до тебя, $r... Я вижу, что для тебя жизнь дороже, чем вещи, и я вознагражу тебя за это. Можешь забрать и наковальню.', 29981),
(169493, 'ruRU', '', 'Ормун, ты можешь идти. Но не думай, что избежишь наказания. Мы об этом еще поговорим.', 29981),
(169492, 'ruRU', '', 'Я знала, что добродетель тебе не чужда, житель поверхности.', 29981),
(169491, 'ruRU', '', 'Ладно, забирай наковальню. Ормун будет наказан в другом месте.', 29981),
(169490, 'ruRU', '', 'Вы, жители поверхности, все одинаковые. Думаете только о себе и о том, как получить еще больше силы.', 29981),
(169489, 'ruRU', 'Хорошо.', '', 29981),
(169488, 'ruRU', '<Рычит>', '', 29981),
(169487, 'ruRU', 'Что?', '', 29981),
(169486, 'ruRU', 'Да-с-с-с...', '', 29981),
(169485, 'ruRU', 'Угумс!', '', 29981),
(169484, 'ruRU', 'Не вопрос.', '', 29981),
(169483, 'ruRU', 'Хр-р...', '', 29981),
(169482, 'ruRU', 'Всегда только правду!', '', 29981),
(169481, 'ruRU', 'Завсегда!', '', 29981),
(169480, 'ruRU', 'Ладно.', '', 29981),
(169479, 'ruRU', 'Да, конечно.', '', 29981),
(169478, 'ruRU', 'Теразан, прошу тебя. Я не думал, что это такая уж проблема.', '', 29981),
(169477, 'ruRU', '', 'Что скажешь в свое оправдание?', 29981),
(169476, 'ruRU', '', 'Что до тебя, $r... Наглость жителей поверхности не перестает удивлять меня! Как вы смеете являться сюда и красть наши тайны?!', 29981),
(169475, 'ruRU', '', 'Конечно. Ты не думал. А теперь ты ответишь за свои преступления.', 29981),
(169471, 'ruRU', 'Теперь ты сможешь изготавливать неплохое снаряжение. Но лучше бы тебе...', '', 29981),
(169470, 'ruRU', 'Какая замечательная наковальня. Что ж, $n, можно смело сказать, что техникой ты теперь владеешь.', '', 29981),
(169469, 'ruRU', 'Мы справились!', '', 29981),
(169468, 'ruRU', 'Я готов встретиться с МАТРИАРХом.', 'Я готова встретиться с МАТРИАРХом.', 29981),
(169467, 'ruRU', 'Чтобы спасти Азерот, нам понадобится помощь. Надеюсь, этот МАТРИАРХ знает, что делать.', '', 29981),
(169466, 'ruRU', 'Ты и представить не можешь, какое величие ждет меня в будущем. Я должен закончить важные расчеты. \n\nОставь меня!', '', 29981),
(169465, 'ruRU', 'Я достоин уважения, меня не могут не впустить.', '', 29981),
(169464, 'ruRU', 'Тайна спрятана здесь, я не ошибся в измерениях!', '', 29981),
(169462, 'ruRU', 'Меха-голем! Можешь кое-что сделать? $n – особый случай, требующий особого внимания. Может, придется разбираться с преследователями...', '', 29981),
(169460, 'ruRU', 'Получилось! Держитесь, сейчас нас унесет!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169457, 'ruRU', 'Я готов начать процесс извлечения.', 'Я готова начать процесс извлечения.', 29981),
(169456, 'ruRU', '', 'Приветствую. \n\nОбнаружено Сердце Азерот. Планета под угрозой полного уничтожения.', 29981),
(169452, 'ruRU', 'Заг-заг, $n.', '', 29981),
(169451, 'ruRU', 'Наши союзники-эфириалы открыли портал в Шаттрат, что в лесу Тероккар, для тех, кому нужно вернуться в Запределье.\n\nИз Шаттрата ты легко доберешься, куда тебе нужно.', '', 29981),
(169450, 'ruRU', 'Если тебе нужно вернуться в Запределье, наверху есть портал в Шаттрат, что в лесу Тероккар.\n\nЧтобы попасть в зал порталов, пройди через большой портал на верхнем ярусе башни. Портал в Шаттрат будет справа, в глубине зала.', '', 29981),
(169448, 'ruRU', 'Я должен отправиться к Темному порталу.', 'Я должна отправиться к Темному порталу.', 29981),
(169445, 'ruRU', 'Приветствую тебя, $n.', '', 29981),
(169437, 'ruRU', '', '<К платью мертвой жрицы прикреплена окровавленная записка.>\n\nМАРИОНЕТКА БВОНСАМДИ! ХРАНИТЕЛИ ВЕРЫ НЕ ПОКОРЯТСЯ ТЕБЕ.', 29981),
(169436, 'ruRU', '', '<Принцесса Таланджи склонилась перед телом жрицы и прижимает к груди окровавленный талисман.>\n\nОни бросили ее тело к моим ногам, $n.\n\nОна всего лишь поклонялась Бвонсамди.\n\nОна погибла из-за меня.', 29981),
(169420, 'ruRU', 'Нет добра. Нет зла. Нет Света! Есть только СИЛА!', '', 29981),
(169415, 'ruRU', '%s будет активирована через 3 секунды!', '', 29981),
(169412, 'ruRU', 'Я готов изготовить наковальню.', 'Я готова изготовить наковальню.', 29981),
(169400, 'ruRU', 'Ну, все все слышали. Вперед!', '', 29981),
(169399, 'ruRU', '', 'Принято. Рекомендуется открыть путевые врата. Конечные координаты закодированы в Сердце Азерот.', 29981),
(169398, 'ruRU', 'Вы уж извиняйте, но если моя птичка даже Магни поднять не может, стража до Силитуса она точно не дотащит!', '', 29981),
(169397, 'ruRU', '', 'Рекомендация: переместите МАТРИАРХа в комплекс \"Зал Сердца\".', 29981),
(169396, 'ruRU', '', 'Ошибка: комплекс \"Ульдир\" создан для карантина и экспериментов над Древними богами. Восстановление планет не входит в список доступных операций.', 29981),
(169395, 'ruRU', 'Верно! МАТРИАРХ, помоги нам! Азерот умирает, и мы ничего не можем сделать.', '', 29981),
(169394, 'ruRU', '', 'Посетитель опознан. Титул: \"Вестник\". Присутствие указывает на наличие угрозы для Азерот.', 29981),
(169393, 'ruRU', 'Приветствую! Меня зовут Магни...', '', 29981),
(169392, 'ruRU', '', 'Я – матрона репликации, инкубации и архивации. Сокращенно: МАТРИАРХ.', 29981),
(169391, 'ruRU', 'Давненько у меня не было напарников из Орды. Но если мы хотим спасти Азерот – придется действовать сообща.', '', 29981),
(169390, 'ruRU', 'Держись крепче – мы подлетаем!', '', 29981),
(169389, 'ruRU', 'Он пойдет на все, чтобы исцелить наш мир... Только на этот раз я не дам ему сделать это в одиночку.', '', 29981),
(169388, 'ruRU', 'Любую ношу на себя взвалить готов. Смелости ему не занимать... и упрямства тоже. За это и расплачивается всю жизнь.', '', 29981),
(169387, 'ruRU', 'Таков уж мой брат. Был таким с детства; и правил так же. А теперь вот стал Вестником Азерот.', '', 29981),
(169386, 'ruRU', 'Когда Магни превратился в алмаз, мы думали, что ему конец. Что он пожертвовал собой, чтобы спасти нас.', '', 29981),
(169385, 'ruRU', 'Я всегда шутил, что дай Магни волю – он обо всем мире печься будет. Кто ж знал, что он это так буквально поймет.', '', 29981),
(169384, 'ruRU', '', 'Орда – не враг нам. Прошу, прости!', 29981),
(169383, 'ruRU', '', 'Только по милости Таланджи я еще не перебила еретиков, что ей угрожают.', 29981),
(169382, 'ruRU', '', 'Мы по-разному можем отплатить за эту наглость. Я полагаюсь на мудрость Таланджи.', 29981),
(169381, 'ruRU', '', 'В наших рядах нет места слабости.', 29981),
(169380, 'ruRU', 'Скоро и остальные поймут это, Сильвана.', '', 29981),
(169379, 'ruRU', '', 'Увести его.', 29981),
(169378, 'ruRU', '', 'Нет. Предатели здесь вы.', 29981),
(169377, 'ruRU', 'Банши!', '', 29981),
(169376, 'ruRU', '', 'Благодарю за признание.', 29981),
(169375, 'ruRU', 'Ты сделала его Отрекшимся. Но ты хотела отобрать его волю, поработить разум.', '', 29981),
(169373, 'ruRU', '', '...Зеллинг?', 29981),
(169372, 'ruRU', '', 'Но и Дерек Праудмур бежал в Кул-Тирас не сам.', 29981),
(169371, 'ruRU', '', 'Большинству бояться нечего...', 29981),
(169370, 'ruRU', '', 'У меня тревожные вести.', 29981),
(169369, 'ruRU', 'Это пытка...', '', 29981),
(169368, 'ruRU', 'Пожалуйста... сними это проклятие...', '', 29981),
(169367, 'ruRU', 'Мне не сбежать...', '', 29981),
(169366, 'ruRU', 'Так холодно...', '', 29981),
(169365, 'ruRU', 'Наконец-то...', '', 29981),
(169364, 'ruRU', 'Осквернитель...', '', 29981),
(169363, 'ruRU', 'Месть...', '', 29981),
(169362, 'ruRU', 'Я... чувствую голод...', '', 29981),
(169361, 'ruRU', '|TInterface\\Icons\\ABILITY_CREATURE_DISEASE_02.BLP:20|t%s начинает применять |cFFFF0000|Hspell:291061|h[Пагубную оррозию]|h|r!', '', 29981),
(169360, 'ruRU', '', 'Носи их с гордостью, как и подобает герою Альянса и Кул-Тираса.', 29981),
(169359, 'ruRU', '', 'В знак уважения и признательности я награждаю тебя регалиями офицера кул-тирасского адмиралтейства.', 29981),
(169358, 'ruRU', '', 'Передай королю мое почтение. И куда бы тебя не занесли ветра – помни о море.', 29981),
(169357, 'ruRU', '', 'Детей Кул-Тираса всегда манили приключения. Я абсолютно уверена, что ты прославишь свою родину и весь Альянс.', 29981),
(169356, 'ruRU', '', 'Для меня честь вручить тебе этот золотой доспех – регалии наших выдающихся героев. Да пребудут с тобой милость лоа и гордость нашего народа.', 29981),
(169355, 'ruRU', '', 'Зандалары вновь явили себя миру, и ты достойно представляешь нашу великую империю.', 29981),
(169353, 'ruRU', '', 'Союз, закаленный в бою, так же прочен, как договор с лоа. Отправляйся к нашим новым братьям и сестрам. Сражайся во славу Зандалара и Орды.', 29981),
(169351, 'ruRU', '', 'Когда Альянс вторгся на наши земли, герои Орды взялись за оружие и сражались рядом с нами.', 29981),
(169348, 'ruRU', '', 'А-а! Пожалуйста! Сними чары с оберега, он меня сковывает!', 29981),
(169347, 'ruRU', '', 'А-а! Не могу... пошевелиться! Где-то рядом оберег! Сними с него чары!', 29981),
(169339, 'ruRU', '', 'Да здравствует Зандалар!', 29981),
(169338, 'ruRU', '', 'Нашу империю ждет славное будущее, и мы встретим его вместе. Вы со мной?', 29981),
(169337, 'ruRU', '', 'Но без помощи Орды нас бы сокрушила собственная гордыня. Союзники дали Зандалару новую силу.', 29981),
(169336, 'ruRU', '', 'Многие сомневались в моем решении заключить союз с Ордой.', 29981),
(169335, 'ruRU', '', 'Народ Зандалара!', 29981),
(169334, 'ruRU', 'Считай это милосердием.', '', 29981),
(169333, 'ruRU', 'Смело, но... недальновидно.', '', 29981),
(169332, 'ruRU', 'Великий магистр... вам этого не простит...', '', 29981),
(169331, 'ruRU', 'Я не затем прожил десять тысяч лет, чтобы меня одолели какие-то крысы.', '', 29981),
(169330, 'ruRU', 'Безрассудная храбрость хороша только в сказках.', '', 29981),
(169329, 'ruRU', 'Я – проводник силы Ночного Колодца! Я НОЧНОРОЖДЕННЫЙ!', '', 29981),
(169328, 'ruRU', 'Доводилось ли вам видеть такую силу? Вот уж не думаю.', '', 29981),
(169327, 'ruRU', 'Довольно! Вы что-то совсем распоясались!', '', 29981),
(169326, 'ruRU', 'Еще одна жертва моего мастерства.', '', 29981),
(169325, 'ruRU', 'Мой клинок быстрее ветра!', '', 29981),
(169324, 'ruRU', 'Никто не вспомнит ваши имена.', '', 29981),
(169323, 'ruRU', 'Ветер пронзает до костей!', '', 29981),
(169322, 'ruRU', 'Умрите от тысячи ран!', '', 29981),
(169321, 'ruRU', 'Закроете глаза... и истечете кровью!', '', 29981),
(169320, 'ruRU', 'Как вы посмели нас прервать?', '', 29981),
(169319, 'ruRU', 'Наконец-то. Я с вами быстро разберусь.', '', 29981),
(169318, 'ruRU', 'Я пролью вашу кровь за Великого магистра!', '', 29981),
(169317, 'ruRU', 'Элисанда... прости меня!', '', 29981),
(169316, 'ruRU', 'Море к морю, шторм к шторму, волна к волне.', '', 29981),
(169315, 'ruRU', 'Един этот корабль с океаном, и да едины мы станем с ним.', '', 29981),
(169313, 'ruRU', '|cFF0000FF(Задание)|r Войти в Ульдир.', '|cFF0000FF(Задание)|r Войти в Ульдир.', 29981),
(169311, 'ruRU', 'Вдохните жизнь в эти паруса, защитите нас от коварных вод!', '', 29981),
(169310, 'ruRU', 'Штормы небесные, волны морские!', '', 29981),
(169305, 'ruRU', '', 'В инженерном деле главное – понять основы. Остальное само придет.', 29981),
(169304, 'ruRU', 'Твое обличье только что менялось.\n\nПовторять процедуру так скоро я бы... не советовал.', '', 29981),
(169303, 'ruRU', 'Я пойду займусь кристаллом, а ты приготовься, а потом бей молотом со всей силы!', '', 29981),
(169302, 'ruRU', 'Принцесса, я уверен, они тебя признают.', '', 29981),
(169298, 'ruRU', 'Похоже, сущность Хати сконцентрировалась в местах, где при жизни он совершал великие жертвы. Срочно отправляйтесь в храм Штормов!', '', 29981),
(169297, 'ruRU', 'Давай-ка перенесем выплавленную руду на наковальню, и начнем работу.', '', 29981),
(169296, 'ruRU', 'Тролли Черного Копья наладили сообщение с Зандаларом. Теперь туда ходит корабль с островов Эха, что к югу от Оргриммара.\n\nКроме того, наши союзники-зандалары открыли портал прямо в свою столицу. Его ты найдешь в зале порталов.', 'Тролли Черного Копья наладили сообщение с Зандаларом. Теперь туда ходит корабль с островов Эха, что к югу от Оргриммара.\n\nКроме того, наши союзники-зандалары открыли портал прямо в свою столицу. Его ты найдешь в зале порталов.', 29981),
(169295, 'ruRU', 'Зулдазар, Зандалар', 'Зулдазар, Зандалар', 29981),
(169294, 'ruRU', 'Наши союзники-шал\'дорай открыли портал в Азсуну на Расколотых островах. Он находится в зале порталов в главных воротах Оргриммара.', 'Наши союзники-шал\'дорай открыли портал в Азсуну на Расколотых островах. Он находится в зале порталов в главных воротах Оргриммара.', 29981),
(169293, 'ruRU', 'Азсуна, Расколотые острова', 'Азсуна, Расколотые острова', 29981),
(169292, 'ruRU', 'Наши маги открыли портал прямо в Ашран на Дреноре. Он находится в зале порталов. \n\nЕсли это твое первое путешествие на Дренор, обратись к боевому магу авангарда, найдешь его возле портала.', 'Наши маги открыли портал прямо в Ашран на Дреноре. Он находится в зале порталов. \n\nЕсли это твое первое путешествие на Дренор, обратись к боевому магу авангарда, найдешь его возле портала.', 29981),
(169291, 'ruRU', 'Наши союзники в Пандарии открыли портал в деревню Лап\'дон в Нефритовом лесу. Его можно найти в зале порталов в главных воротах Оргриммара.', 'Наши союзники в Пандарии открыли портал в деревню Лап\'дон в Нефритовом лесу. Его можно найти в зале порталов в главных воротах Оргриммара.', 29981),
(169290, 'ruRU', 'Если нужно быстро попасть в Нордскол, иди в зал порталов в главных воротах Оргриммара. Маги Серебряного Авангарда открыли там портал для общего пользования.', 'Если нужно быстро попасть в Нордскол, иди в зал порталов в главных воротах Оргриммара. Маги Серебряного Авангарда открыли там портал для общего пользования.', 29981),
(169289, 'ruRU', 'Даларан, Нордскол', 'Даларан, Нордскол', 29981),
(169288, 'ruRU', '$n, а вот и ты! Я все подготовил. Одно твое слово – и мы начнем.', '', 29981),
(169287, 'ruRU', 'Маги из Траллмара открыли портал на полуостров Адского Пламени в Запределье. Если не знаешь, где его искать, подскажу: зал порталов находится в главных городских воротах.', 'Маги из Траллмара открыли портал на полуостров Адского Пламени в Запределье. Если не знаешь, где его искать, подскажу: зал порталов находится в главных городских воротах.', 29981),
(169286, 'ruRU', 'Магистры эльфов крови открыли портал из Оргриммара в Луносвет. Зал порталов находится в главных городских воротах.', 'Магистры эльфов крови открыли портал из Оргриммара в Луносвет. Зал порталов находится в главных городских воротах.', 29981),
(169285, 'ruRU', 'Луносвет, Восточные королевства', 'Луносвет, Восточные королевства', 29981),
(169284, 'ruRU', 'Если тебе нужно в Подгород, отыщи Фреззу в восточной башне дирижаблей – это на центральном плато Оргриммара. Он подробно расскажет, как попасть туда, куда тебе надо.', 'Если тебе нужно в Подгород, отыщи Фреззу в восточной башне дирижаблей – это на центральном плато Оргриммара. Он подробно расскажет, как попасть туда, куда тебе надо.', 29981),
(169283, 'ruRU', 'Подгород, Восточные королевства', 'Подгород, Восточные королевства', 29981),
(169282, 'ruRU', 'Полагаю, план мы наметим позже. Вперед!', '', 29981),
(169281, 'ruRU', 'Воссоздать Хати? Почему вы сразу не сказали?! Встретимся в Силитусе!', '', 29981),
(169280, 'ruRU', 'Остаток сущности Хати находится в Силитусе. Мимирон считает, что Хати можно воссоздать, если мы полностью соберем его сущность!', '', 29981),
(169279, 'ruRU', 'Ох, да ради всего... Мы тоже рады видеть тебя, Торим.', '', 29981),
(169278, 'ruRU', 'А, Бронзобород и $p! Отрадно видеть вас снова!', '', 29981),
(169277, 'ruRU', 'Я свободен!', '', 29981),
(169276, 'ruRU', 'Вот так! Собери сущность Хати с помощью Грозовой искры!', '', 29981),
(169275, 'ruRU', 'Кажется, у нас получается! Еще немного, $p!', '', 29981),
(169274, 'ruRU', 'Хати, я знаю, что это ты. Мы пришли помочь тебе.', '', 29981),
(169273, 'ruRU', 'Эксельсиор!', '', 29981),
(169272, 'ruRU', 'Ну же! Сургису нужна энергия!', '', 29981),
(169271, 'ruRU', 'Давайте быстрее!', '', 29981),
(169270, 'ruRU', 'Если вы не заставите эти штуки работать, я из вас ожерелье сделаю!', '', 29981),
(169266, 'ruRU', 'Задача выполнена. Новый приказ: вернуться на базу.', '', 29981),
(169265, 'ruRU', 'А в чем тогда веселье? Эй, залезай – и вперед!', '', 29981),
(169264, 'ruRU', 'Встретимся в Ульдире. Бранн, смотри не лихачь!', '', 29981),
(169262, 'ruRU', 'Сущность Хати узнает вас и приходит в замешательство.', '', 29981),
(169261, 'ruRU', '', 'Давай, выкладывай.', 29981),
(169260, 'ruRU', '', 'У меня нет времени на разговоры.', 29981),
(169259, 'ruRU', '', 'Да-да... Слушаю.', 29981),
(169258, 'ruRU', '', 'Не задерживай меня.', 29981),
(169257, 'ruRU', '', 'Увидимся в море.', 29981),
(169256, 'ruRU', '', 'Хм. Ну, ладно.', 29981),
(169255, 'ruRU', '', 'Жизнь за Зандалар.', 29981),
(169254, 'ruRU', '', 'Я взываю к свету лоа, и он отвечает мне.', 29981),
(169253, 'ruRU', '', 'Говори.', 29981),
(169252, 'ruRU', 'Если тебе нужно попасть в Боралус, найди Хикса, капитана \"Неумолимого\" – этот славный корабль регулярно ходит в Кул-Тирас. Он швартуется у самой южной пристани порта Штормграда. \n\nКроме того, жрецы моря открыли портал в свою столицу из башни магов.', 'Если тебе нужно попасть в Боралус, найди Хикса, капитана \"Неумолимого\" – этот славный корабль регулярно ходит в Кул-Тирас. Он швартуется у самой южной пристани порта Штормграда. \n\nКроме того, жрецы моря открыли портал в свою столицу из башни магов.', 29981),
(169251, 'ruRU', '', 'Слушаю тебя.', 29981),
(169250, 'ruRU', 'Если понадоблюсь, ты знаешь, где меня найти.', '', 29981),
(169249, 'ruRU', 'Заходи еще.', '', 29981),
(169248, 'ruRU', 'Славный денек, правда?', '', 29981),
(169247, 'ruRU', 'Ну здравствуй.', '', 29981),
(169246, 'ruRU', '', 'Во имя Таланджи.', 29981),
(169245, 'ruRU', '', 'Во имя Растахана.', 29981),
(169244, 'ruRU', '', 'Пусть лоа благоволят тебе.', 29981),
(169243, 'ruRU', '', 'Ди чука Зандалар!', 29981),
(169242, 'ruRU', 'Тирагардское поморье, Кул-Тирас', 'Тирагардское поморье, Кул-Тирас', 29981),
(169241, 'ruRU', '', 'Жизнь за империю.', 29981),
(169240, 'ruRU', '', 'Я служу королеве.', 29981),
(169239, 'ruRU', '', 'Я служу королю.', 29981),
(169238, 'ruRU', 'Наши союзники открыли портал в Азсуну, чтобы любой желающий мог быстро попасть на Расколотые острова. Портал находится на верхнем ярусе башни магов.', 'Наши союзники открыли портал в Азсуну, чтобы любой желающий мог быстро попасть на Расколотые острова. Портал находится на верхнем ярусе башни магов.', 29981),
(169237, 'ruRU', '', 'Что империя может сделать для тебя?', 29981),
(169236, 'ruRU', '', 'Слушаю.', 29981),
(169235, 'ruRU', '', 'Чем тебе помочь?', 29981),
(169233, 'ruRU', '', 'Приветствую.', 29981),
(169232, 'ruRU', '', 'Да здравствует Зандалар!', 29981),
(169231, 'ruRU', '', 'Свет лоа укажет тебе путь.', 29981),
(169230, 'ruRU', '', 'Ты говоришь с верховным прелатом.', 29981),
(169229, 'ruRU', 'Чем могу помочь?', '', 29981),
(169228, 'ruRU', 'Говорят, на материке сейчас славный сезон.', '', 29981),
(169227, 'ruRU', '', 'Это все?', 29981),
(169226, 'ruRU', '', 'Давай быстрей.', 29981),
(169225, 'ruRU', 'Азсуна, Расколотые острова', 'Азсуна, Расколотые острова', 29981),
(169224, 'ruRU', 'Наши союзники из Кирин-Тора открыли портал в башне магов, чтобы героям было проще попасть на Дренор. Пройдя через него, ты сразу попадешь в Ашран.', 'Наши союзники из Кирин-Тора открыли портал в башне магов, чтобы героям было проще попасть на Дренор. Пройдя через него, ты сразу попадешь в Ашран.', 29981),
(169223, 'ruRU', 'Ашран, Дренор', 'Ашран, Дренор', 29981),
(169222, 'ruRU', 'Наши союзники в Пандарии разрешили нам открыть портал в деревню Лап\'дон в Нефритовом лесу. Он находится на верхнем ярусе башни посреди Квартала магов.', 'Наши союзники в Пандарии разрешили нам открыть портал в деревню Лап\'дон в Нефритовом лесу. Он находится на верхнем ярусе башни посреди Квартала магов.', 29981),
(169220, 'ruRU', 'Если тебе нужно быстро попасть в Нордскол, зайди в зал порталов на верхнем ярусе башни магов. Маги Серебряного Союза открыли там портал, которым можно пользоваться в любое время дня и ночи.', 'Если тебе нужно быстро попасть в Нордскол, зайди в зал порталов на верхнем ярусе башни магов. Маги Серебряного Союза открыли там портал, которым можно пользоваться в любое время дня и ночи.', 29981),
(169219, 'ruRU', 'Даларан, Нордскол', 'Даларан, Нордскол', 29981),
(169218, 'ruRU', 'Экзодар, Калимдор', 'Экзодар, Калимдор', 29981),
(169217, 'ruRU', 'В башне магов открыли портал на полуостров Адского Пламени. Зал порталов находится на верхнем ярусе башни в Квартале магов.', 'В башне магов открыли портал на полуостров Адского Пламени. Зал порталов находится на верхнем ярусе башни в Квартале магов.', 29981),
(169216, 'ruRU', 'Тельдрассил, Калимдор', 'Тельдрассил, Калимдор', 29981),
(169215, 'ruRU', 'Хочешь попасть в Тельдрассил? Обратись к Перрин Плач Луны на самой южной пристани порта Штормграда. Она поможет тебе.', 'Хочешь попасть в Тельдрассил? Обратись к Перрин Плач Луны на самой южной пристани порта Штормграда. Она поможет тебе.', 29981),
(169214, 'ruRU', 'А вот и вторая цель!', '', 29981),
(169213, 'ruRU', '', 'Достойные варианты. Выбор за тобой, $n.', 29981),
(169212, 'ruRU', '', 'Очень красиво, мама.', 29981),
(169211, 'ruRU', '', '\"Песнь Тиффин\".', 29981),
(169210, 'ruRU', 'У Альянса лев на гербе. Может, \"Львиное сердце\"?', '', 29981),
(169209, 'ruRU', '\"Вестник рассвета\" хорошо подойдет.', '', 29981),
(169208, 'ruRU', '', '\"Гнев Андуина\". Орда будет в ужасе!', 29981),
(169207, 'ruRU', '', 'Такому кораблю нужно достойное имя. Есть идеи?', 29981),
(169206, 'ruRU', 'Я присмотрю за домом, дорогая. Давай, развеешься хоть!', '', 29981),
(169205, 'ruRU', '', 'Да... спасибо.', 29981),
(169204, 'ruRU', 'Вы уж простите ее, мэм, она просто стесняется. Молочка парного не хотите?', '', 29981),
(169203, 'ruRU', 'Мне пора возвращаться в контору. Удачи, и не забудь про письмо.', '', 29981),
(169202, 'ruRU', 'Дом корабела должен быть где-то в Мертвецкой Трясине.', '', 29981),
(169201, 'ruRU', 'Этот город просто кладезь слухов. Но зато мы сузили круг поиска.', '', 29981),
(169200, 'ruRU', 'Расспроси местных. А я поговорю со старым Баком – он всех помнит.', '', 29981),
(169199, 'ruRU', 'Через Бреннадам кто только не проходит. Очень может быть, что и наш корабел тут бывал.', '', 29981),
(169198, 'ruRU', 'Так точно, лорд-адмирал. За мной, $n, начнем поиски с долины Штормов – там строятся все наши корабли.', '', 29981),
(169197, 'ruRU', 'Я помогу с поисками, но что, если этот загадочный корабел вам откажет?', '', 29981),
(169196, 'ruRU', 'Цель обновлена: отомстить за Гризикса. Объект следования: |3-6($r), объект уничтожения: все враждебные цели.', '', 29981),
(169195, 'ruRU', 'Нет... что-то не так. Что такое, мой мальчик?', '', 29981),
(169194, 'ruRU', 'Ха, он помнит нас!', '', 29981),
(169193, 'ruRU', 'Хати! Иди сюда, малыш!', '', 29981),
(169192, 'ruRU', 'Не беспокойся, Торим, мы со всем разберемся!', '', 29981),
(169191, 'ruRU', 'Да она меня и в былые-то годы с трудом поднимала! Я уж лучше своим ходом.', '', 29981),
(169190, 'ruRU', 'Хати... это ты?', '', 29981),
(169189, 'ruRU', '', 'У нашего следующего бойца молотов больше, чем в кузнечном цеху. И откуда они только берутся?', 29981),
(169188, 'ruRU', 'Да брось, Магни! Эта птичка и не такие тяжести носила!', '', 29981),
(169187, 'ruRU', 'И прямиком из морозных пустошей Дренора... Пришло время для особого боя... Молотобоя!', '', 29981),
(169186, 'ruRU', 'Ваши глаза вас не обманывают, любезная публика! Встречайте, хмелевар из живописнейшей Пандарии!', '', 29981),
(169184, 'ruRU', '', 'Против нашего претендента на звание чемпиона выйдет... хмелевар? Погодите, здесь какая-то ошибка...', 29981),
(169176, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(169175, 'ruRU', 'Осторожно! Что-то здесь не так.', '', 29981),
(169174, 'ruRU', 'Режим боя: активирован. Активация ускорения.', '', 29981),
(169170, 'ruRU', 'Новый объект для следования: |3-6($r). Защищать любой ценой.', '', 29981),
(169169, 'ruRU', 'Покинуть Ульдир.', 'Покинуть Ульдир.', 29981),
(169168, 'ruRU', 'Это... смерть? Невероятно...', '', 29981),
(169167, 'ruRU', 'Старайся лучше...', '', 29981),
(169166, 'ruRU', 'Теперь мне не хватает данных только... о твоей смерти!', '', 29981),
(169165, 'ruRU', 'Такова была цена информации. Мой повелитель будет доволен.', '', 29981),
(169164, 'ruRU', 'Жаль, что пришлось убить этого безвинного торговца, чтобы все завертелось.', '', 29981),
(169163, 'ruRU', 'Наблюдать за твоими боями было любопытно... но еще интереснее следить за твоим расследованием.', '', 29981),
(169162, 'ruRU', '', 'Я давно наблюдаю за тобой, $p.', 29981),
(169159, 'ruRU', 'Аварийный режим: активирован. Возвращение на базу.', '', 29981),
(169154, 'ruRU', '', 'Встретимся на арене \"Морд\'Бой\", $p. Мы разоблачим самозванку и раскроем это убийство!', 29981),
(169153, 'ruRU', 'Обнаружены сетраки. Активация давителей...', '', 29981),
(169152, 'ruRU', 'Хакерман Гризикс: не найден. Новый владелец: |3-6($r)!', '', 29981),
(169151, 'ruRU', 'Протокол смены пассажира: активен.', '', 29981),
(169150, 'ruRU', 'Оставшаяся часть сущности Хати находится в Силитусе... в опасной близости от Раны.', '', 29981),
(169149, 'ruRU', 'Все хуже, чем я предполагал. Погодите, я отправлю сигнал в карантин!', '', 29981),
(169148, 'ruRU', 'Что такое?! С Хати все в порядке?', '', 29981),
(169147, 'ruRU', 'Силитиды? Очень подозрительно. Возможно, если обратиться к другому набору данных... о нет.', '', 29981),
(169146, 'ruRU', 'Минуточку! По протоколу триангуляции поступают новые данные. Анализирую...', '', 29981),
(169145, 'ruRU', '', '<Вздыхает> Очень жаль. Он был хорошим парнем. Возможно, его убили те же, кто отправил меня в этот \"отпуск\".', 29981),
(169144, 'ruRU', 'Сигнал, исходит из храма Штормов, что находится неподалеку. Выходит, пора навестить нашего старого друга Торима!', '', 29981),
(169143, 'ruRU', '<Рассказать Босси Кософланж об убийстве Пола Норта.>', '<Рассказать Босси Кософланж об убийстве Пола Норта.>', 29981),
(169142, 'ruRU', 'По моим расчетам, сейчас мы нашли только часть сущности Хати. Ответ на твой вопрос, Бронзобород: да, мы знаем!', '', 29981),
(169141, 'ruRU', 'Ну! Ты знаешь, где искать Хати?!', '', 29981),
(169140, 'ruRU', '', 'О, спасибо! Это так мило с твоей стороны!\n\nИтак, что я пропустила?', 29981),
(169139, 'ruRU', '<Предложить Босси Кософланж 2 золотых, чтобы она смогла попасть домой.>', '<Предложить Босси Кософланж 2 золотых, чтобы она смогла попасть домой.>', 29981),
(169138, 'ruRU', '<Предложить Босси Кософланж свой камень возвращения, чтобы она смогла попасть домой.>', '<Предложить Босси Кософланж свой камень возвращения, чтобы она смогла попасть домой.>', 29981),
(169137, 'ruRU', 'Чувствую, это еще далеко не все.', '', 29981),
(169136, 'ruRU', '', 'Та, другая Кософланж, – предательница. Не знаю, кто она такая... или что она такое... но это точно не я. Я – это я!\n\nЯ расскажу тебе все, что знаю.\n\nПонятия не имею, что произошло. На меня накинулись сзади. Завязалась схватка... а потом в глазах у меня потемнело. И вот я здесь, на другом краю мира, без камня возвращения и без гроша в кармане.', 29981),
(169135, 'ruRU', 'Что? Босси Кософланж? Я думал, ты на арене \"Морд\'Бой\". Что происходит?', 'Что? Босси Кософланж? Что происходит?', 29981),
(169134, 'ruRU', 'Сверяю полученную информацию с данными из моего архива. Посмотрим, откуда идет этот сигнал!', '', 29981),
(169133, 'ruRU', '', 'Ты... с арены \"Морд\'Бой\"? Это я! Босси Кософланж!\n\nНАСТОЯЩАЯ Босси Кософланж!', 29981),
(169132, 'ruRU', 'Протодраконы. Как любопытно!', '', 29981),
(169131, 'ruRU', '', '$n, ты лучше других разберешься с этим.', 29981),
(169130, 'ruRU', '', 'Нет. Они вправе злиться. Я прибегну к силе только в крайнем случае.', 29981),
(169129, 'ruRU', 'Похоже, с этим придется разбираться нам, $p. Во славу природы!', '', 29981),
(169128, 'ruRU', 'О нет. Возможно, мой прогноз был преждевременным. Что-то проходит через портал.', '', 29981),
(169127, 'ruRU', 'Конечно, Бронзобород!', '', 29981),
(169126, 'ruRU', 'На этот раз хоть обойдется без \"проблем с совместимостью\"?', '', 29981),
(169125, 'ruRU', 'Запускаю протокол триангуляции. Еще немного – и мы будем точно знать, где сейчас сущность Хати.', '', 29981),
(169124, 'ruRU', '', 'Я – вождь Сильвана Ветрокрылая, и я это одобряю.', 29981),
(169123, 'ruRU', 'Я – король Андуин Ринн, и я это одобряю.', '', 29981),
(169121, 'ruRU', 'Не медли, нас ждут великие научные дела.', '', 29981),
(169119, 'ruRU', 'Она первая, но не последняя. Утопи – и увидишь.', '', 29981),
(169118, 'ruRU', 'Он отдался глубинам. Теперь он принадлежит мне.', '', 29981),
(169117, 'ruRU', 'Она все голоднее... и смелее. Но вы все слепы.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169116, 'ruRU', 'Только я могу спасти тебя от того, что грядет.', '', 29981),
(169114, 'ruRU', '', 'Возвращайся в Зулдазар – там тебя ждет награда, достойная твоих подвигов.', 29981),
(169113, 'ruRU', '', 'Империя Зандалари знала много героев, но мало кто из них сравнится с тобой.', 29981),
(169112, 'ruRU', '', 'Тебе открылся мир за пределами Кул-Тираса, но пришло время вернуться к родным берегам. Я почту за честь лично наградить тебя за службу.', 29981),
(169111, 'ruRU', '', 'Тебе удалось прославить свое имя, $n. Не проходит и дня, чтобы в тавернах Боралуса не звучали тосты в твою честь.', 29981),
(169110, 'ruRU', 'Оковы того, что в глубинах, слабеют. Пощады не будет никому!', '', 29981),
(169109, 'ruRU', 'Он утопит вас всех...', '', 29981),
(169107, 'ruRU', '', 'Теперь я королева...', 29981),
(169106, 'ruRU', '', 'Но империя оградила себя от мира и постепенно пришла в упадок.', 29981),
(169105, 'ruRU', '', 'Тысячи лет эта земля принадлежала зандаларам.', 29981),
(169104, 'ruRU', '', '', 29981),
(169103, 'ruRU', '', 'Сегодня над Кул-Тирасом снова реет знамя Альянса. И что бы ни ожидало нас за горизонтом, мы справимся с этим... Вместе.', 29981),
(169102, 'ruRU', '', 'Когда-то мы позволили страху и недоверию разделить нас.', 29981),
(169101, 'ruRU', '', 'Каждый култирасец ощущает связь с морем.', 29981),
(169099, 'ruRU', '$p! А вот и ты! Нам срочно нужно поговорить.', '', 29981),
(169098, 'ruRU', 'Закончим этот разговор позже, Бронзобород. $p уже здесь.', '', 29981),
(169097, 'ruRU', 'Разрази тебя гром! Сколько раз повторять, что я не Бранн?', '', 29981),
(169094, 'ruRU', 'Обнаружена неизвестная сущность. Алгоритмы паники активированы.', '', 29981),
(169093, 'ruRU', 'Когда стрела найдет цель, спадут последние оковы.', '', 29981),
(169083, 'ruRU', 'Мертвые, подъем!', '', 29981),
(169082, 'ruRU', 'Приход ночи явит ее истинный лик. Лик разрушения.', '', 29981),
(169081, 'ruRU', 'Завеса падает. Его корона откроет путь.', '', 29981),
(169080, 'ruRU', 'Шесть мест за столом. Шесть утроб, терзаемых голодом. Одна из них поглотит остальных.', '', 29981),
(169079, 'ruRU', 'Свет заключил сделку с врагом всего сущего.', '', 29981),
(169077, 'ruRU', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t У вас почти не осталось времени! |cFFFF0000|Hspell:286480|h[Разряд защиты от взлома]|h|r скоро сработает!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t У вас почти не осталось времени! |cFFFF0000|Hspell:286480|h[Разряд защиты от взлома]|h|r скоро сработает!', 29981),
(169069, 'ruRU', '', 'Этот лес – наш союзник... вы обречены...', 29981),
(169068, 'ruRU', '', 'Калдорай вернут себе эти земли!', 29981),
(169067, 'ruRU', 'Надо было... оставаться в мастерской...', '', 29981),
(169066, 'ruRU', 'О, дружище, ты славно поджаришься!', '', 29981),
(169065, 'ruRU', 'Наши предки... прогонят вас прочь...', '', 29981),
(169064, 'ruRU', 'Вы оскверняете эти земли своим присутствием!', '', 29981),
(169063, 'ruRU', 'Мы никогда... не сдадимся...', '', 29981),
(169062, 'ruRU', 'Лок\'тар огар!', '', 29981),
(169061, 'ruRU', '', 'Вам не... победить...', 29981),
(169060, 'ruRU', '', 'Гилнеас не оставит калдорай!', 29981),
(169059, 'ruRU', 'Вам не видать... этих земель...', '', 29981),
(169058, 'ruRU', 'Теперь Темные берега принадлежат племени Пронзающего Копья!', '', 29981),
(169057, 'ruRU', 'Вы будете... сломлены...', '', 29981),
(169056, 'ruRU', 'Мы захватим эти земли во имя Азшары!', '', 29981),
(169055, 'ruRU', '', 'Мы – только начало...', 29981),
(169054, 'ruRU', '', 'Бушующее море наг смоет ваше жалкое войско!', 29981),
(169053, 'ruRU', 'Нет! Моя работа... не закончена...', '', 29981),
(169052, 'ruRU', 'Слишком поздно! Соггот восстал!', '', 29981),
(169051, 'ruRU', 'Защитная матрица неисправна... Область потеряна...', '', 29981),
(169050, 'ruRU', 'Эта область поражена. Все формы жизни будут уничтожены.', '', 29981),
(169049, 'ruRU', 'Он утопит вас всех...', '', 29981),
(169048, 'ruRU', 'Оковы того, что в глубинах, слабеют. Пощады не будет никому!', '', 29981),
(169047, 'ruRU', 'Нет! Я же... непобедим!', '', 29981),
(169046, 'ruRU', 'Отдай мне свою душу!', '', 29981),
(169045, 'ruRU', '', 'Угли... догорают...', 29981),
(169044, 'ruRU', '', 'Этот лес сгорит!', 29981),
(169043, 'ruRU', 'Цикл продолжается...', 'Победа или смерть!', 29981),
(169042, 'ruRU', 'Познайте гнев леса!', 'Победа или смерть!', 29981),
(169040, 'ruRU', 'Что здесь произошло?', 'Что здесь произошло?', 29981),
(169039, 'ruRU', 'Молчать! Шибче колотить!', '', 29981),
(169038, 'ruRU', 'Чего? Брагг, это ерунда какой-то...', '', 29981),
(169037, 'ruRU', 'Братец, нет!', '', 29981),
(169036, 'ruRU', 'Сдаваться...', '', 29981),
(169035, 'ruRU', 'Твоя крышка!', '', 29981),
(169034, 'ruRU', 'Нет! Братец не умирать!', '', 29981),
(169033, 'ruRU', 'Брагг, моя больно...', '', 29981),
(169032, 'ruRU', '...как воронье помрешь!', '', 29981),
(169031, 'ruRU', 'С дружками морды бьешь...', '', 29981),
(169030, 'ruRU', 'Не удирать!', '', 29981),
(169029, 'ruRU', 'А хотя... лучше не надо. Мне нравится это проклятье.', 'А хотя... лучше не надо. Мне нравится это проклятье.', 29981),
(169028, 'ruRU', 'Можешь вернуть меня в настоящее?', 'Можешь вернуть меня в настоящее?', 29981),
(169027, 'ruRU', 'Нет. Мы должны выяснить, что она задумала, и сорвать ее безумные планы.', '', 29981),
(169026, 'ruRU', 'Мы так близки к тому, чтобы покончить с этим конфликтом и заключить мир. Но если Сильвана найдет новое оружие и продолжит сражаться...', '', 29981),
(169025, 'ruRU', 'Очевидно, что она сражается не за Азерот. И даже не за Орду. Она объявила войну самой жизни.', '', 29981),
(169024, 'ruRU', 'Когда Сильвана Ветрокрылая стала вождем, я знал, что друзьями нам не быть... но и вражды не хотел. А потом была бойня в Арати, сожжение Тельдрассила...', '', 29981),
(169023, 'ruRU', 'Можешь показать мне, как выглядели Темные берега до этой битвы?', 'Можешь показать мне, как выглядели Темные берега до этой битвы?', 29981),
(169022, 'ruRU', 'В процессе', '', 29981),
(169021, 'ruRU', '', 'А-а! Найди оберег! Сними с него чары!', 29981),
(169020, 'ruRU', 'Открыт доступ к битве за Темные берега!', 'Открыт доступ к битве за Темные берега!', 29981),
(169017, 'ruRU', 'Измени мой облик.', 'Измени мой облик.', 29981),
(169016, 'ruRU', 'Если желаешь, я могу изменить твое плотское обличье. \n\nНо учти, что после этого твое тело некоторое время не сможет претерпевать подобные изменения, а твой разум может уже никогда не стать прежним.\n\nЯ могу тебе чем-нибудь помочь?', '', 29981),
(169015, 'ruRU', '', 'Скоро расстановка сил снова изменится. И этот клинок укажет нам путь к победе.', 29981),
(169014, 'ruRU', '', 'Война – как живое существо. Она растет и корчится в конвульсиях, пока не примет истинный облик.', 29981),
(169013, 'ruRU', '', 'Глупцы. Мальчишка лжет и себе, и своим подданным. Он даже не представляет, с чем имеет дело.', 29981),
(169012, 'ruRU', '', 'Лидеры Альянса считают, что гибель Растахана и разгром зандаларского флота сломили нас. Что Орда скоро падет.', 29981),
(169011, 'ruRU', 'Древний бог хочет разделить нас. Расколоть. Боюсь, эта война дала Н\'Зоту то, чего он хотел.', '', 29981),
(169010, 'ruRU', 'Я стал жрецом моря, чтобы использовать мощь глубин во благо Кул-Тираса. А оказалось, что все это время в них скрывалась великая тьма...', '', 29981),
(169009, 'ruRU', 'Все свою жизнь я наблюдал за морем и видел его двойственность. Оно дарует жизнь... и несет разрушение.', '', 29981),
(169008, 'ruRU', '', 'Мы справились с Г\'ууном, но Н\'Зот еще опаснее. Я молюсь, чтобы в это трудное время лоа помогли нам остановить его.', 29981),
(169007, 'ruRU', '', 'Оказалось, все это правда. Древние боги – болезнь, поразившая сердце Азерота.', 29981),
(169006, 'ruRU', '', 'В детстве я слышала рассказы о Древних богах. Думала, это просто страшилки, выдумки старейшин.', 29981),
(169005, 'ruRU', 'Надо вернуться и продолжить сражаться с Альянсом.', 'Надо вернуться и продолжить сражаться с Альянсом.', 29981),
(169004, 'ruRU', '<Взять самопальный огнестрел у Окри.>', '<Взять самопальный огнестрел у Окри.>', 29981),
(169003, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(169002, 'ruRU', '', 'На позицию. Сейчас начнется.', 29981),
(169001, 'ruRU', 'Вольным гарпунщикам любая дичь по зубам!', 'Я не припомню подобного вторжения, но мы так проучим Орду, что им больше не захочется возвращаться!', 29981),
(168996, 'ruRU', '', 'Чтобы продолжить сражаться на Дреноре, воспользуйся порталом в Ашран, что позади меня.', 29981),
(168995, 'ruRU', '', 'Чтобы продолжить сражаться на Дреноре, воспользуйся порталом в Ашран наверху.', 29981),
(168994, 'ruRU', 'Я должен помочь Кадгару. Отправь меня в Выжженные земли!', 'Я должна помочь Кадгару. Отправь меня в Выжженные земли!', 29981),
(168993, 'ruRU', '', 'Чтобы вернуться на Расколотые острова, воспользуйся порталом, что позади меня.', 29981),
(168992, 'ruRU', '', 'Что тебе нужно, $n?', 29981),
(168979, 'ruRU', '', 'Чтобы вернуться на Расколотые острова, воспользуйся порталом наверху.', 29981),
(168978, 'ruRU', 'Кирин-Тору нужна моя помощь. Отправь меня в Даларан!', 'Кирин-Тору нужна моя помощь. Отправь меня в Даларан!', 29981),
(168977, 'ruRU', '', '$c, чем могу помочь?', 29981),
(168970, 'ruRU', '', 'Осторожнее, |3-6($c). На здешние земли напала Орда.\n\nАльянс отправил группу солдат, наделенных силой Света, защитить местных жителей.\n\nС нами здесь безопасно, но мы не можем поручиться за твою безопасность за пределами Заставы Арома.\n\nЕсли увидишь ордынцев, сообщи первому офицеру Альянса, которого встретишь, и мы устраним угрозу.\n\nДайонисс ака!', 29981),
(168967, 'ruRU', 'А ну брось!', '', 29981),
(168966, 'ruRU', 'Положи на место!', '', 29981),
(168965, 'ruRU', 'А ну-ка!', '', 29981),
(168962, 'ruRU', 'Кто украл мои дрова?!', '', 29981),
(168961, 'ruRU', 'Вор!', '', 29981),
(168960, 'ruRU', 'Сейчас топором получишь!', '', 29981),
(168959, 'ruRU', 'Эй! Убери руки!', '', 29981),
(168956, 'ruRU', 'Будет не важно, как глубоко мы продвинемся на Темных берегах, если ночные эльфы обойдут нас и нападут с тыла.', '', 29981),
(168955, 'ruRU', '|TInterface\\Icons\\ABILITY_MAGE_LIVINGBOMB.BLP:20|tВаших союзников обжигают |cFFFF0000|Hspell:286987|h[раскаленные угли]|h|r – рассейте эффект, пока они не взорвались!', '|TInterface\\Icons\\ABILITY_MAGE_LIVINGBOMB.BLP:20|tВаших союзников обжигают |cFFFF0000|Hspell:286987|h[раскаленные угли]|h|r – рассейте эффект, пока они не взорвались!', 29981),
(168937, 'ruRU', '', 'Это горки любви!', 29981),
(168936, 'ruRU', '', 'На горки без билета не пустят. Берите билеты, не раздумывайте!', 29981),
(168935, 'ruRU', '', 'Прокатитесь с ветерком! Купите билеты на горки прямо сейчас!', 29981),
(168934, 'ruRU', '', 'Вы чувствуете жажду? Жажду... скорости?!', 29981),
(168933, 'ruRU', '', 'Ощутите прилив адреналина!', 29981),
(168932, 'ruRU', '', 'Прокатитесь на горках с гривернами!', 29981),
(168931, 'ruRU', 'Вам нужен билет на аттракцион ярмарки Новолуния, чтобы покататься на горках.', 'Вам нужен билет на аттракцион ярмарки Новолуния, чтобы покататься на горках.', 29981),
(168930, 'ruRU', '', 'Нам остается только уничтожить этот артефакт, чтобы избавиться от тумана... Будь проклят Альянс за эту ловушку!', 29981),
(168929, 'ruRU', '', 'Что-то не так... магия этого артефакта не рассеивается!', 29981),
(168919, 'ruRU', 'Он один сбил больше гоблинов-пилотов, чем все эскадрильи Альянса вместе взятые!', '', 29981),
(168917, 'ruRU', 'Опять этот барон! Быстрей, быстрей, быстрей!', '', 29981),
(168905, 'ruRU', '', 'Это оно!', 29981),
(168904, 'ruRU', '', 'О! Я помню это дерево!', 29981),
(168903, 'ruRU', '', 'Тоже не оно.', 29981),
(168902, 'ruRU', '', 'Это не то дерево. Идем дальше.', 29981),
(168901, 'ruRU', '', 'Меня похоронили под одним из этих деревьев с красными листьями и белой корой. Следуй за мной.', 29981),
(168900, 'ruRU', '', 'Эти бедные души попали в ловушку. Сними чары с оберега, чтобы их освободить.', 29981),
(168899, 'ruRU', '', '<вздыхает> Когда-то эти леса населяли беззаботные духи. А теперь... лучше я тебе покажу...', 29981),
(168898, 'ruRU', 'Благодарю вас. Добро пожаловать в Альянс.', '', 29981),
(168897, 'ruRU', '', 'Кул-Тирас с гордостью передает Альянсу этот корабль вместе с командой.', 29981),
(168896, 'ruRU', 'Пусть он будет достоин памяти отца.', '', 29981),
(168895, 'ruRU', 'Джайна...', '', 29981),
(168894, 'ruRU', 'Пусть солнце озаряет его паруса.', '', 29981),
(168893, 'ruRU', 'Грозное имя. Пусть враги расступаются перед ним в ужасе.', '', 29981),
(168892, 'ruRU', '', '\"Львиное сердце\".', 29981),
(168891, 'ruRU', '', '\"Песнь Тиффин\".', 29981),
(168890, 'ruRU', '', '\"Вестник рассвета\".', 29981),
(168889, 'ruRU', '', 'Нам еще рано останавливаться.', 29981),
(168888, 'ruRU', '', '\"Гнев Андуина\".', 29981),
(168887, 'ruRU', '', 'Вперед!', 29981),
(168886, 'ruRU', 'Как его назвали?', '', 29981),
(168885, 'ruRU', 'Ваша щедрость безгранична, лорд-адмирал.', '', 29981),
(168884, 'ruRU', '', 'Идем же.', 29981),
(168883, 'ruRU', '', 'Когда-то Кул-Тирас и Альянс связывала крепкая дружба. Теперь эти времена наконец-то возвращаются.', 29981),
(168882, 'ruRU', '', 'Идем дальше.', 29981),
(168881, 'ruRU', '', 'Пойдем?', 29981),
(168880, 'ruRU', '', 'Наверняка нам туда.', 29981),
(168879, 'ruRU', 'Когда вы предложили встретиться в порту, я ждал чего угодно, но это... Просто невероятно!', '', 29981),
(168878, 'ruRU', '', 'Пойдем же!', 29981),
(168877, 'ruRU', 'Вот увидишь мой следующий бомбардировщик, $p... Он тебе двери вышибет!', '', 29981),
(168875, 'ruRU', 'Привет.\n\nМаги Орды наконец-то взялись за дело все вместе, чтобы нам было проще путешествовать.\n\nЕсли ты держишь путь в один из пострадавших от Катаклизма регионов, иди к западному святилищу Земли. Найдешь его к северу от дирижаблей.', '', 29981),
(168873, 'ruRU', 'Никто не видит истинную мощь моих трансмутаций. Но я им всем покажу. Скоро они будут уважать меня...$b$bНу а тебя сюда что привело, $c? Хочешь узнать секреты алхимии?$b$bЕсли так, придется сперва потрудиться.', '', 29981),
(168872, 'ruRU', 'Приступим.', 'Приступим.', 29981),
(168871, 'ruRU', '', 'Тандред доведет его до порта Штормграда, но мне кажется, что отправить нас в плавание следует тебе. Возложи руки на штурвал, когда будешь $gготов:готова;.', 29981),
(168870, 'ruRU', 'Вы вышли из боевой зоны. Вернитесь!', 'Вы вышли из боевой зоны. Вернитесь!', 29981),
(168869, 'ruRU', 'О, не волнуйся, все шло по плану! Я просто... решил немного отдохнуть. Продолжай в том же духе.', '', 29981),
(168868, 'ruRU', 'Из меня плохое лакомство! Одни кости!', '', 29981),
(168867, 'ruRU', 'Плохая киса!', '', 29981),
(168866, 'ruRU', '<Placeholder RTC: Tidesage\'s Blessing.>', '<Placeholder RTC: Tidesage\'s Blessing.>', 29981),
(168865, 'ruRU', 'Да, брат Пайк.', 'Да, брат Пайк.', 29981),
(168864, 'ruRU', 'Я с радостью проведу обряд и благословлю корабль.\n\nДавай выйдем в бухту вместе, и я проведу должную церемонию.', '', 29981),
(168863, 'ruRU', 'Почту за честь служить на этом корабле, $n.', '', 29981),
(168862, 'ruRU', '', '\"Львиное сердце\". Превосходно.', 29981),
(168861, 'ruRU', '', '\"Песнь Тиффин\". Превосходно.', 29981),
(168860, 'ruRU', '', '\"Вестник рассвета\". Превосходно.', 29981),
(168859, 'ruRU', '', '\"Гнев Андуина\". Превосходно.', 29981),
(168858, 'ruRU', 'Сделав выбор, вы не сможете изменить его.\n\nПродолжить?', 'Сделав выбор, вы не сможете изменить его.\n\nПродолжить?', 29981),
(168857, 'ruRU', '\"Львиное сердце\".', '\"Львиное сердце\".', 29981),
(168856, 'ruRU', '\"Песнь Тиффин\".', '\"Песнь Тиффин\".', 29981),
(168855, 'ruRU', '\"Вестник рассвета\".', '\"Вестник рассвета\".', 29981),
(168854, 'ruRU', '\"Гнев Андуина\".', '\"Гнев Андуина\".', 29981),
(168853, 'ruRU', '', 'Как мы назовем корабль, $n?', 29981),
(168852, 'ruRU', '', 'Я предпочитаю не раскрывать свои секреты, лорд-адмирал.', 29981),
(168851, 'ruRU', '', 'Так быстро? Как это возможно?', 29981),
(168850, 'ruRU', '', 'К вечеру управимся. Или раньше, если мне мешать не будут.', 29981),
(168849, 'ruRU', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t Вы активировали |cFFFF0000|Hspell:286480|h[разряд защиты от взлома]|h|r! Введите код отключения, который подходит к вашему \"Разряжатору\"!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t Вы активировали |cFFFF0000|Hspell:286480|h[разряд защиты от взлома]|h|r! Введите код отключения, который подходит к вашему \"Разряжатору\"!', 29981),
(168848, 'ruRU', '', 'Ладно. Но ты у меня наслушаешься... За каждую царапину!..', 29981),
(168847, 'ruRU', 'И не подумаю.', '', 29981),
(168846, 'ruRU', '', 'Ты, я так понимаю, не отстанешь?', 29981),
(168845, 'ruRU', 'Только взгляни на него! Ты построила этот прекрасный корабль и не хочешь выйти на нем в море?', '', 29981),
(168844, 'ruRU', '', 'Я отошла от дел.', 29981),
(168843, 'ruRU', 'Покажешь мне боцмана опытнее – возьму его. Ты хотела лучших? Ты и есть лучшая.', '', 29981),
(168842, 'ruRU', 'Ну, ты же слышала, что он сказал.', 'Ну, ты же слышала, что он сказал.', 29981),
(168841, 'ruRU', '', 'Не нравится мне, как этот молодой человек на меня смотрит.', 29981),
(168840, 'ruRU', '', 'Я в свое время долго была на виду, так что тихая старость меня вполне устраивает.\n\nДа и Сэлу большие толпы не по душе.', 29981),
(168839, 'ruRU', 'Есть у меня еще кое-кто на примете, $n. Как поговоришь со всеми, встретимся в порту Туманных Приливов.', '', 29981),
(168838, 'ruRU', 'Прекрасно! О лучшей команде я и мечтать не мог. Собирайтесь – и за мной.', '', 29981),
(168837, 'ruRU', '', 'С этого бы и начинал... капитан.', 29981),
(168836, 'ruRU', 'М-м... Полагаю, что да.', '', 29981),
(168835, 'ruRU', '', 'Альянса? Так ты хочешь сказать, что мы сможем отомстить Орде?', 29981),
(168834, 'ruRU', 'Они и останутся твоей командой! Вы все вместе будете служить вместе под флагом Альянса.', '', 29981),
(168833, 'ruRU', '', 'Это что, по-твоему, комплимент?! Я – капитан! А гарпунщики – моя команда.', 29981),
(168832, 'ruRU', 'Розалин, мне нужен надежный старпом. А надежней тебя никого быть не может!', '', 29981),
(168831, 'ruRU', '', '...стать твоим КЕМ?!', 29981),
(168830, 'ruRU', '', 'Да вы что, издеваетесь?', 29981),
(168829, 'ruRU', 'Ты об этом пожалеешь!', '', 29981),
(168828, 'ruRU', '', 'В этих шарах содержится некая сила. Возможно, если снять оболочку...', 29981),
(168827, 'ruRU', '', 'Пф!', 29981),
(168826, 'ruRU', '', 'Глаза выглядят добротно. Я выжму из них несколько капель и...', 29981),
(168824, 'ruRU', '', 'Здравствуй, $gчужестранец:чужестранка;.\n\nЧем тебе могут услужить Вольные гарпунщики? Может, загарпунить пару чудищ?', 29981),
(168823, 'ruRU', 'Ну что ж, ребятки. Похоже, я ухожу в плавание.', '', 29981),
(168822, 'ruRU', 'Хм. И то верно.', '', 29981),
(168821, 'ruRU', 'Мы вполне справимся с обороной города.', 'Мы вполне справимся с обороной города.', 29981),
(168820, 'ruRU', 'Вы, сэр, уже которую неделю разве что по попугаям стреляете.', 'Вы, сэр, уже которую неделю разве что по попугаям стреляете.', 29981),
(168819, 'ruRU', 'А кто же будет охранять врата?', '', 29981),
(168818, 'ruRU', 'Тандред Праудмур ищет канонира себе в команду. Что скажешь?', 'Тандред Праудмур ищет канонира себе в команду. Что скажешь?', 29981),
(168817, 'ruRU', 'И откуда у них столько попугаев?\n\nТьфу. Что тебе нужно, $n?', '', 29981),
(168816, 'ruRU', 'Проклятые пираты!', '', 29981),
(168815, 'ruRU', 'И потом, как же я откажу брату лорд-адмирала?', '', 29981),
(168814, 'ruRU', 'Жрецы моря запятнали свое имя. Может, я смогу это исправить.', '', 29981),
(168813, 'ruRU', 'Признаться, я слишком давно не выходил в море...', '', 29981),
(168812, 'ruRU', 'Тандред Праудмур ищет жреца моря себе в команду. Что скажешь?', 'Тандред Праудмур ищет жреца моря себе в команду. Что скажешь?', 29981),
(168811, 'ruRU', 'Вижу, тебе есть, что сказать, $n.\n\nЧем могу помочь?', '', 29981),
(168810, 'ruRU', 'Остальных наберем в лагере Вольных гарпунщиков. Там и встретимся.', '', 29981),
(168809, 'ruRU', 'В канониры я возьму только лейтенанта Таренфолда. Думаю, он все еще несет службу в Дозорном Холме.', '', 29981),
(168808, 'ruRU', 'Без жреца моря корабль из порта не выйдет. А лучший жрец – это брат Пайк. Он сейчас здесь, в Боралусе.', '', 29981),
(168807, 'ruRU', 'Есть те, кого я хотел бы видеть в команде... Но не всех из них будет легко убедить.', '', 29981),
(168806, 'ruRU', '|TInterface\\Icons\\ABILITY_WARLOCK_INFERNO.BLP:20|t%s выбирает вас целью |cFFFF0000|Hspell:284831|h[Испепеляющей детонации]|h|r! Бегите!', '', 29981),
(168805, 'ruRU', 'Да, я как раз думал о ее поручении.', '', 29981),
(168804, 'ruRU', 'Джайна просила поговорить с тобой.', 'Джайна просила поговорить с тобой.', 29981),
(168803, 'ruRU', '<Тандред задумчиво смотрит на город и не замечает вас.>', '', 29981),
(168802, 'ruRU', 'Приветствую тебя, $n.', '', 29981),
(168800, 'ruRU', 'Огонек убитого эльфа яростно атакует!', '', 29981),
(168799, 'ruRU', '|TInterface\\ICONS\\Spell_Mage_CometStorm.BLP:20|t Вы стали целью заклинания |cFFFF0000|Hspell:287565|h[Лавина]|h|r!', '|TInterface\\ICONS\\Spell_Mage_CometStorm.BLP:20|t Вы стали целью заклинания |cFFFF0000|Hspell:287565|h[Лавина]|h|r!', 29981),
(168798, 'ruRU', 'Обнаружено вмешательство. Включаю защитный протокол.', '', 29981),
(168796, 'ruRU', 'Руки заняты!', '', 29981),
(168795, 'ruRU', 'Эта способность пока не готова.', '', 29981),
(168794, 'ruRU', 'Не могу пока.', '', 29981),
(168793, 'ruRU', 'Погоди.', '', 29981),
(168792, 'ruRU', 'Это не отсюда.', '', 29981),
(168791, 'ruRU', 'Сюда больше не влезет.', '', 29981),
(168790, 'ruRU', 'Здесь это не сделаешь.', '', 29981),
(168789, 'ruRU', 'Я не могу это выбросить.', '', 29981),
(168788, 'ruRU', 'Это – мое, и только мое.', '', 29981),
(168787, 'ruRU', 'Я с этим не управлюсь.', '', 29981),
(168786, 'ruRU', 'Не могу – уровень низковат.', '', 29981),
(168785, 'ruRU', 'Я пока не могу этим пользоваться.', '', 29981),
(168784, 'ruRU', 'Мой уровень недостаточно высок, чтобы это использовать.', '', 29981),
(168783, 'ruRU', 'Это я никогда не смогу использовать.', '', 29981),
(168782, 'ruRU', 'Я не могу выучить это заклинание.', '', 29981),
(168781, 'ruRU', 'Это не моя добыча.', '', 29981),
(168780, 'ruRU', 'Не я добывал – не мне забирать.', '', 29981),
(168779, 'ruRU', 'Нужно подойти поближе.', '', 29981),
(168778, 'ruRU', 'Что-то далековато.', '', 29981),
(168777, 'ruRU', 'Не, не дотянусь.', '', 29981),
(168776, 'ruRU', 'Я не могу это отдать.', '', 29981),
(168775, 'ruRU', 'Я не могу это использовать.', '', 29981),
(168774, 'ruRU', 'Мне бы это сначала надеть или в руки взять.', '', 29981),
(168773, 'ruRU', 'Сначала этот предмет нужно надеть или взять в руки.', '', 29981),
(168772, 'ruRU', 'Сейчас не получится.', '', 29981),
(168771, 'ruRU', 'У меня нет цели.', '', 29981);
