(168714, 'ruRU', 'Прошу! Умоляю!', '', 29981),
(168713, 'ruRU', 'Ну что мне, на колени упасть?', '', 29981),
(168712, 'ruRU', 'Да сжалься же ты!', '', 29981),
(168711, 'ruRU', 'Молодца!', '', 29981),
(168710, 'ruRU', 'Ветра благоволят тебе!', '', 29981),
(168709, 'ruRU', 'Мое уважение!', '', 29981),
(168708, 'ruRU', 'Встретимся в полночь у причала. На мне будет кортик... и треуголка.', '', 29981),
(168707, 'ruRU', 'Ты случайно не сирена? А то я уже готов привязать себя к мачте.', '', 29981),
(168706, 'ruRU', 'Я бы пошел с тобой хоть в кругосветку.', '', 29981),
(168705, 'ruRU', 'Ты, наверное, хорошо рыбачишь? Я сразу попался в твои сети!', '', 29981),
(168704, 'ruRU', 'Не хочешь выпить? Я тут неподалеку знаю двадцать семь отличных баров.', '', 29981),
(168703, 'ruRU', 'Пойдем ко мне? Я тебе... рыбок покажу.', '', 29981),
(168702, 'ruRU', 'Ты случайно не из Друствара? А то я как будто околдован.', '', 29981),
(168701, 'ruRU', 'Добрых волн и верного курса.', '', 29981),
