(168685, 'ruRU', 'Постой на якоре, мне мана нужна.', '', 29981),
(168684, 'ruRU', 'Заходили в нашу гавань \"чужестранки\". Да ну, смотреть не не что. То ли дело наши: куда ни глянь – такие топселя... Прекрасны от форштевня до кормы.', '', 29981),
(168683, 'ruRU', 'В общем, заходят как-то жрец, маг и чернокнижник в бар. Потом заходят в другой бар. Потом в третий... У нас в Кул-Тирасе они на каждом углу.', '', 29981),
(168682, 'ruRU', 'Видел я недавно словарь морских терминов... Бесполезная штука. Ни одного слова из тех, что наш боцман употреблял.', '', 29981),
(168681, 'ruRU', 'Я тут кораблик продаю за недорого, не интересует? Не бит, не крашен, бабушка по выходным в Зандалар плавала.', '', 29981),
(168680, 'ruRU', 'Знаешь, как у нас в Кул-Тирасе утопленников ищут? По всплывающим подсказкам!', '', 29981),
(168679, 'ruRU', 'Меня часто за друстварца принимают: я тоже люблю дров наломать!', '', 29981),
(168678, 'ruRU', 'И почему все сразу думают, что нами, култирасцами, Древние боги помыкают? Да, мы возводим гигантские статуи с щупальцами и вырезаем рожицы осьминогов повсюду, но это же не повод... Или повод?', '', 29981),
(168677, 'ruRU', 'Ты прости уж.', '', 29981),
(168676, 'ruRU', 'Сюда иди, мешок с водорослями!', '', 29981),
(168675, 'ruRU', 'Благодарю.', '', 29981),
(168674, 'ruRU', 'За мной должок будет.', '', 29981),
(168673, 'ruRU', 'Премного благодарен.', '', 29981),
