(168300, 'ruRU', 'Неплохо, дружище.', 'Неплохо, дружище.', 29981),
(168299, 'ruRU', 'Принято.', 'Принято.', 29981),
(168298, 'ruRU', '|cFF0000FF(Задание)|r Чем я могу помочь?', '|cFF0000FF(Задание)|r Чем я могу помочь?', 29981),
(168297, 'ruRU', 'Я узнаю силу в этом обереге. Я почувствовал ее в костях и коре, еще до того, как вы поднялись на гору.\n\nЭто древняя магия. Искаженная, изуродованная.\n\nНужно действовать быстро, иначе она затронет и нас.', '', 29981),
(168296, 'ruRU', 'Беги!', 'Беги!', 29981),
(168295, 'ruRU', 'Ворота не выдержат!', 'Ворота не выдержат!', 29981),
(168294, 'ruRU', 'Помогите!', 'Помогите!', 29981),
(168293, 'ruRU', 'Кто-нибудь, остановите его!', 'Кто-нибудь, остановите его!', 29981),
(168292, 'ruRU', 'Он сейчас прорвется!', 'Он сейчас прорвется!', 29981),
(168291, 'ruRU', 'Альянс уже дрогнул под нашим напором! Запрыгивай, $r! Пора довершить их разгром!', '', 29981),
(168290, 'ruRU', 'Вам... не победить.', 'Вам... не победить.', 29981),
(168289, 'ruRU', 'Орду... не победить...', 'Орду... не победить...', 29981),
(168288, 'ruRU', 'Всех... не перебьешь...', 'Всех... не перебьешь...', 29981),
(168287, 'ruRU', 'Нас уже не остановить.', 'Нас уже не остановить.', 29981),
(168286, 'ruRU', 'Ваши границы слабы!', 'Ваши границы слабы!', 29981),
(168285, 'ruRU', 'Это за Тельдрассил!', 'Это за Тельдрассил!', 29981),
(168284, 'ruRU', 'Эй, $r! Давай запрыгивай и на фронт!', '', 29981),
(168283, 'ruRU', 'Ордынское отродье!', 'Ордынское отродье!', 29981),
(168282, 'ruRU', 'За Альянс!', 'За Альянс!', 29981),
(168281, 'ruRU', 'За Орду!', 'За Орду!', 29981),
(168280, 'ruRU', 'Вас всего лишь горстка. Перебить вас – вопрос времени!', 'Вас всего лишь горстка. Перебить вас – вопрос времени!', 29981),
(168279, 'ruRU', 'Что за жалкое подобие путей снабжения.', 'Что за жалкое подобие путей снабжения.', 29981),
(168278, 'ruRU', 'Эти припасы окажут Орде существенную помощь.', 'Эти припасы окажут Орде существенную помощь.', 29981),
(168277, 'ruRU', 'Альянс... все равно... падет...', 'Альянс... все равно... падет...', 29981),
(168276, 'ruRU', 'Наши друзья из Лиги исследователей нашли эти кости. Скелет выглядит нетронутым и подойдет в качестве вместилища.$b$bБездна стремится поглощать. Захватывать. Разрастаться. Она ответит на наш зов и покорится нам на какое-то время.$b$bСлышал, зандалары благоговеют перед своими мертвыми. Как примитивно для казалось бы развитой цивилизации. И вот теперь их сокрушит тот, на кого они раньше полагались.', '', 29981),
(168275, 'ruRU', 'Я ожидал победы... а не смерти...', 'Я ожидала победы... а не смерти...', 29981),
(168274, 'ruRU', 'За мной... придут другие...', 'За мной... придут другие...', 29981),
(168273, 'ruRU', 'Славная... смерть...', 'Славная... смерть...', 29981),
(168272, 'ruRU', '$R! Запрыгивай побыстрее! Мы уже начали атаку на это чертово место!', '', 29981),
(168271, 'ruRU', 'Сдохни!', 'Сдохни!', 29981),
(168270, 'ruRU', 'Надеялись просочиться в наш тыл?', 'Надеялись просочиться в наш тыл?', 29981),
(168269, 'ruRU', '', 'Тотем отпугнет вульпер, не причиняя им вреда, и тогда ты сможешь заняться уничтожением припасов Орды.', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(168268, 'ruRU', '', 'Вульперы нам не враги, но нельзя им позволить доставлять припасы Орде.', 29981),
(168267, 'ruRU', 'Меня забавляет хорошая драка. Только не помирай слишком быстро.', 'Меня забавляет хорошая драка. Только не помирай слишком быстро.', 29981),
(168266, 'ruRU', 'Тобой полакомится мой волк.', 'Тобой полакомится мой волк.', 29981),
(168265, 'ruRU', 'Прихвостень Альянса!', 'Прихвостень Альянса!', 29981),
(168264, 'ruRU', 'Мы зальем континент вашей кровью!', 'Мы зальем континент вашей кровью!', 29981),
(168263, 'ruRU', 'Что это за ритуал, магистр?', 'Что это за ритуал, магистр?', 29981),
(168262, 'ruRU', 'Командир Телаамон, на нас напал Рокхан из племени Черного Копья!', 'Командир Телаамон, на нас напал Рокхан из племени Черного Копья!', 29981),
(168261, 'ruRU', 'Рокхан? Я слышал об этом темном охотнике. Посмотрим, насколько он силен на самом деле.', '', 29981),
(168260, 'ruRU', 'Галливикс, я пожалею об этом вопросе, но... что ты думаешь об оживлении Дерека Праудмура?', 'Галливикс, я пожалею об этом вопросе, но... что ты думаешь об оживлении Дерека Праудмура?', 29981),
(168259, 'ruRU', '', 'Лилиан помогла мне смириться с тем, кто я есть... и ее ролью в случившемся.', 29981),
(168258, 'ruRU', '', 'Леди Шандриса получит нашу помощь по первому зову.', 29981),
(168257, 'ruRU', 'Лилиан, что ты думаешь о том, что Сильвана оживила Дерека Праудмура?', 'Лилиан, что ты думаешь о том, что Сильвана оживила Дерека Праудмура?', 29981),
(168256, 'ruRU', 'Лилиан, я слышал, ты помогла семье Зеллинга обосноваться в Друстваре.', 'Лилиан, я слышала, ты помогла семье Зеллинга обосноваться в Друстваре.', 29981),
(168255, 'ruRU', 'Бейн, тебя беспокоит, что Сильвана оживила Дерека Праудмура?', 'Бейн, тебя беспокоит, что Сильвана оживила Дерека Праудмура?', 29981),
(168254, 'ruRU', 'Что ты думаешь о том, что Сильвана оживила Дерека Праудмура?', 'Что ты думаешь о том, что Сильвана оживила Дерека Праудмура?', 29981),
(168253, 'ruRU', 'Альянс наивно надеется остановить наши эксперименты. Они забывают, что чума создавалась как раз с помощью сил природы.\n\nНе беспокойся, гигантское дерево нам не помешает.', '', 29981),
(168252, 'ruRU', 'Орда черпает силу для своего оружия из самой земли. Наше древо мудрости поможет залечить эти раны.', '', 29981),
(168251, 'ruRU', '', 'Я не припомню подобного вторжения, но мы так проучим Орду, что им больше не захочется возвращаться!', 29981),
(168250, 'ruRU', 'Теперь еще и огромные злые элементали? Я на это не подписывался!', 'Теперь еще и огромные злые элементали? Я на это не подписывалась!', 29981),
(168249, 'ruRU', 'Ни-и-иша-а!', 'Ни-и-иша-а!', 29981),
(168248, 'ruRU', 'Это еще что такое?!', 'Это еще что такое?!', 29981),
(168247, 'ruRU', 'Это должно было быть легко!', 'Это должно было быть легко!', 29981),
(168246, 'ruRU', 'Я сматываюсь!', 'Я сматываюсь!', 29981),
(168245, 'ruRU', 'Про злых элементалей мне никто ничего не говорил!', 'Про злых элементалей мне никто ничего не говорил!', 29981),
(168244, 'ruRU', 'Я на это не подписывался!', 'Я на это не подписывалась!', 29981),
(168243, 'ruRU', 'А-а-а!', 'А-а-а!', 29981),
(168242, 'ruRU', 'Ульфару привет!', '', 29981),
(168241, 'ruRU', 'Почти приехали!', '', 29981),
(168240, 'ruRU', '', 'Вульперы нам не враги, но Орда нанимает их караваны, чтобы перебрасывать припасы для армии.\n\nЭтому надо положить конец.\n\nНадеюсь, у нас получится напугать караванщиков настолько, что они сами больше не захотят работать с Ордой, чтобы не нажить себе врагов...\n\n<Вакаара вздыхает.> \n\nДипломатия в военное время – дело тонкое.', 29981),
(168239, 'ruRU', 'Только вниз не смотри.', '', 29981),
(168238, 'ruRU', 'Впрочем, тебе повезло: олень из меня первостатейный.', '', 29981),
(168237, 'ruRU', 'Дай мне тотем. Я отпугну вульпер!', 'Дай мне тотем. Я отпугну вульпер!', 29981),
(168236, 'ruRU', '', 'Мы узнали, что Орда нанимает вульперские повозки, чтобы перевозить припасы для армии.\n\nХотя мы этому лисьему народу не враги, нельзя позволить им помогать нашему противнику.\n\nИспользуй этот тотем кричащих песков, чтобы отпугнуть их от припасов, а затем уничтожь их.\n\nУчти, я имею в виду припасы... а не вульпер! Нам просто нужно, чтобы они передумали сотрудничать с Ордой.', 29981),
(168235, 'ruRU', 'Но он сразу заводит что-то про \"приличия\", и я перестаю слушать.', '', 29981),
(168234, 'ruRU', 'Я все пытаюсь убедить Ульфара, что для этих гор нам нужен облик козла.', '', 29981),
(168233, 'ruRU', 'Теперь держись крепче, дорожка тут та еще.', '', 29981),
(168232, 'ruRU', 'Силы несравнимы!', 'Силы несравнимы!', 29981),
(168231, 'ruRU', 'За Орду!', 'За Орду!', 29981),
(168230, 'ruRU', 'Нам нужно подкрепление!', 'Нам нужно подкрепление!', 29981),
(168229, 'ruRU', 'Нас атакуют!', 'Нас атакуют!', 29981),
(168228, 'ruRU', 'Альянс пошел в наступление!', 'Альянс пошел в наступление!', 29981),
(168227, 'ruRU', 'Их защитник явился!', 'Их защитник явился!', 29981),
(168226, 'ruRU', '', 'Атакуйте эту цель!', 29981),
(168225, 'ruRU', '', 'Смерть будет быстрой.', 29981),
(168224, 'ruRU', '', 'За Альянс!', 29981),
(168223, 'ruRU', '', 'Положись на меня.', 29981),
(168222, 'ruRU', '', 'Ну, я их и позаимствовала.', 29981),
(168221, 'ruRU', '', 'Гебиш Костыльбот оставил там ключи.', 29981),
(168220, 'ruRU', '', 'Ты будто становишься машиной!', 29981),
(168219, 'ruRU', '', 'Спокойнее. Разумеется, я распорядилась, чтобы о его семье позаботились. Я что, похожа на монстра?\n\nХотя не отвечай.\n\nЯ дала Зеллингу слово, что его семья будет в безопасности. И я его сдержу, даже если мне придется действовать тайно.', 29981),
(168218, 'ruRU', 'Я с этим не смирюсь, $n. Каждый раз, когда я думаю, что Сильвана зашла слишком далеко, она находит способ зайти еще дальше. Я не вмешиваясь наблюдал за тем, как она совершает одно преступление за другим.\n\nОна не просто оскорбляет память павшего врага. Она оскорбляет этим Орду.\n\nЭто уже слишком. Мы должны что-то предпринять. И как можно скорее.', '', 29981),
(168217, 'ruRU', '', 'Последним деянием моего отца было пробуждение силы Бвонсамди. Зандаларам не впервые взывать к силе мертвых ради собственного блага.\n\nНо от мысли о воскрешении Дерека Праудмура мне не по себе. Это напоминает мне о том, что Зул сделал с моим милым Резаном... Ужасное преступление, разбившее мне сердце.\n\nАльянс должен заплатить за смерть моего отца. Но мы не можем дать ярости застилать нам глаза... или заставить нас забыть о чести, которая делает Зандалар великой державой.', 29981),
(168216, 'ruRU', 'Ох, Альянс будет в бешенстве! Они нам это наверняка припомнят! А знаешь, что это значит?\n\nЧто мой доход от ковки азеритовых доспехов взлетит до небес! Надо удвоить – нет, утроить! – инвестиции в добычу азерита! Как хорошо, что я не плачу своим громилам сверхурочные. Да и вообще не плачу.\n\nА теперь, извини, мне надо потолковать с вождем о спросе и предложении. Брысь!', '', 29981),
(168215, 'ruRU', '', 'Когда я была кадетом, наставники рассказывали мне о храбрости Дерека Праудмура. Все капитаны, которых я знала, мечтали стать такими же героями, как он. \n\nМне больно видеть его таким и знать, что его семья и народ никогда больше его не примут.\n\nИ что я принимала в этом участие.', 29981),
(168214, 'ruRU', '', 'Ничего удивительного. Мы оба знаем, что Королева-банши всегда была на такое способна. Как она любит говорить, это просто стрелы в ее колчане. \n\nЭто ничего для меня не меняет... я сделаю то, что должна.', 29981),
(168213, 'ruRU', '', 'Война – не самая приятная штука. Мне, как и Сильване, это известно слишком хорошо. Тебе придется решить, на что ты пойдешь ради победы... а на что нет.', 29981),
(168212, 'ruRU', 'Конечно! Запрыгивай!', '', 29981),
(168211, 'ruRU', 'Поможешь мне добраться до верховного терноманта?', 'Поможешь мне добраться до верховного терноманта?', 29981),
(168210, 'ruRU', 'Березняк сказал, что тебе нужно помочь добраться до берлоги Ульфара. А то дорожных указателей тут немного.', '', 29981),
(168206, 'ruRU', 'Эй, |3-6($c)! Мы захватываем родину зандаларов! Залезай!', '', 29981),
(168202, 'ruRU', 'Эй, |3-6($c)! Пора показать Орде, что здесь небезопасно! Сюда, солдат! Поможешь нам!', '', 29981),
(168201, 'ruRU', '|TInterface\\Icons\\INV_MISC_ENGGIZMOS_35.BLP:20|t %s включает |cFFFF0000|Hspell:287952|h[Генератор червоточин]|h|r!', '|TInterface\\Icons\\INV_MISC_ENGGIZMOS_35.BLP:20|t %s включает |cFFFF0000|Hspell:287952|h[Генератор червоточин]|h|r!', 29981),
(168200, 'ruRU', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t Вы |cFFFF0000|Hspell:284168|h[уменьшились]|h|r, берегитесь!', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t Вы |cFFFF0000|Hspell:284168|h[уменьшились]|h|r, берегитесь!', 29981),
(168199, 'ruRU', 'Слишком просто!', 'Слишком просто!', 29981),
(168198, 'ruRU', 'Сила... и честь...', 'Сила... и честь...', 29981),
(168197, 'ruRU', 'Орда... победит...', 'Орда... победит...', 29981),
(168196, 'ruRU', 'Я погибаю... смертью воина...', 'Я погибаю... смертью воина...', 29981),
(168195, 'ruRU', 'Кровь и гром!', 'Кровь и гром!', 29981),
(168194, 'ruRU', 'За Орду!', 'За Орду!', 29981),
(168193, 'ruRU', 'Победа или смерть!', 'Победа или смерть!', 29981),
(168192, 'ruRU', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t У вас почти не осталось времени! |cFFFF0000|Hspell:286480|h[разряд защиты от взлома]|h|r скоро сработает!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t У вас почти не осталось времени! |cFFFF0000|Hspell:286480|h[Разряд защиты от взлома]|h|r скоро сработает!', 29981),
(168191, 'ruRU', 'Эй, |3-6($c)! Мы атакуем Орду в Назмире! Сюда, солдат! Поможешь нам!', '', 29981),
(168190, 'ruRU', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t Вы |cFFFF0000|Hspell:284168|h[уменьшились]|h|r! Захватите \"Разряжатор\"!', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t Вы |cFFFF0000|Hspell:284168|h[уменьшились]|h|r! Захватите \"Разряжатор\"!', 29981),
(168189, 'ruRU', 'Ты никто передо мной!', 'Ты никто передо мной!', 29981),
(168188, 'ruRU', 'Их защитник у меня на прицеле!', 'Их защитник у меня на прицеле!', 29981),
(168187, 'ruRU', 'Уничтожить цель!', 'Уничтожить цель!', 29981),
(168186, 'ruRU', 'Вижу цель!', 'Вижу цель!', 29981),
(168184, 'ruRU', 'Я ухожу... на Ту Сторону...', 'Я ухожу... на Ту Сторону...', 29981),
(168183, 'ruRU', 'Орда... за нас отомстит...', 'Орда... за нас отомстит...', 29981),
(168182, 'ruRU', 'Не надо было... трогать вуду...', 'Не надо было... трогать вуду...', 29981),
(168181, 'ruRU', 'Это наша земля!', 'Это наша земля!', 29981),
(168180, 'ruRU', 'Смерть врагам Орды!', 'Смерть врагам Орды!', 29981),
(168179, 'ruRU', 'Не с тем ты троллем связываешься!', 'Не с тем ты троллем связываешься!', 29981),
(168178, 'ruRU', '', 'Знаешь, как трудно целый день держать порталы открытыми?\n\nМне это не слишком по душе. Мне больше нравится руководить процессом. Этим недоумкам без руководителя никак нельзя.', 29981),
(168177, 'ruRU', 'Наполнение оберега', 'Наполнение оберега', 29981),
(168176, 'ruRU', 'У орков в моде это \"атмосферное освещение\".\n\nК несчастью для меня, работать в такой обстановке совсем непросто.', 'У орков в моде это \"атмосферное освещение\".\n\nК несчастью для меня, работать в такой обстановке совсем непросто.', 29981),
(168175, 'ruRU', '', 'Когда я присоединилась к Орде, у меня были некоторые сомнения по поводу Отрекшихся, но меня уверили, что они сами выбрали свою участь. Но это...\n\nНочнорожденные многое пережили под гнетом Легиона. Мне довелось наблюдать чудовищные картины... и становится очень грустно от того, насколько все это их напоминает. Это все.', 29981),
(168174, 'ruRU', 'Тебя прислали мои партнеры? Час пробил?', '', 29981),
(168173, 'ruRU', 'Вальтруа, что ты думаешь о воскрешении Дерека Праудмура?', 'Вальтруа, что ты думаешь о воскрешении Дерека Праудмура?', 29981),
(168172, 'ruRU', '', 'Должна признать, зандаларская архитектура весьма занимательна. Но вот запах...', 29981),
(168171, 'ruRU', '', 'Все склонятся перед нашей королевой!', 29981),
(168170, 'ruRU', '', 'Этой землей будет править Азшара!', 29981),
(168169, 'ruRU', '', 'Волны сокрушат тебя!', 29981),
(168168, 'ruRU', '', 'Моя королева... отомсти за меня...', 29981),
(168167, 'ruRU', '', 'Море станет тебе могилой...', 29981),
