(167752, 'ruRU', '|TInterface\\ICONS\\Ability_Socererking_arcanemines:20|t Уничтожайте |cFFF00000|Hspell:288747|h[призматические образы]|h|r, пока их не стало слишком много!', '|TInterface\\ICONS\\Ability_Socererking_arcanemines:20|t Уничтожайте |cFFF00000|Hspell:288747|h[призматические образы]|h|r, пока их не стало слишком много!', 29981),
(167751, 'ruRU', '<При вашем приближении грифон негромко клекочет.>', '', 29981),
(167750, 'ruRU', 'Повезло нам.', 'Повезло нам.', 29981),
(167749, 'ruRU', 'Что ж, капитан, вот и новые маски духов.', 'Что ж, капитан, вот и новые маски духов.', 29981),
(167748, 'ruRU', 'Кажется, здесь две оживших статуи, но этих жутких летающих масок не видно. По крайней мере, пока.', '', 29981),
(167747, 'ruRU', '<вздыхает> $p, лучше не прикасайся к этим лучам, а то еще погибнешь.', '<вздыхает> $p, лучше не прикасайся к этим лучам, а то еще погибнешь.', 29981),
(167746, 'ruRU', 'Меры безопасности становятся все серьезнее. Под стать мастеру Шоу.', '', 29981),
(167745, 'ruRU', 'Вы уверены, что хотите покинуть подземелье?', 'Вы уверены, что хотите покинуть подземелье?', 29981),
(167744, 'ruRU', 'Отвези меня домой.', 'Отвези меня домой.', 29981),
(167743, 'ruRU', '<При вашем приближении терродактиль начинает громко кричать.>', '', 29981),
(167742, 'ruRU', '$p! По-моему, там, напротив, еще один переключатель.', '$p! По-моему, там, напротив, еще один переключатель.', 29981),
(167741, 'ruRU', 'Меньше слов, больше дела, капитан.', 'Меньше слов, больше дела, капитан.', 29981),
(167740, 'ruRU', 'Точно. Пол – это молния.', 'Точно. Пол – это молния.', 29981),
(167739, 'ruRU', 'Я сражаюсь за Орду!', 'Я сражаюсь за Орду!', 29981),
(167738, 'ruRU', 'Ко мне! Не нападайте на них поодиночке!', 'Ко мне! Не нападайте на них поодиночке!', 29981),
(167737, 'ruRU', 'Братья и сестры, прячьтесь за меня!', 'Братья и сестры, прячьтесь за меня!', 29981),
(167736, 'ruRU', 'Сперва тебе придется сразиться со мной.', 'Сперва тебе придется сразиться со мной.', 29981),
(167735, 'ruRU', 'Мой щит укрывает невинных.', 'Мой щит укрывает невинных.', 29981),
(167734, 'ruRU', 'Иди-ка сюда, трусишка!', 'Иди-ка сюда, трусишка!', 29981),
(167733, 'ruRU', 'Еще одна славная битва!', 'Еще одна славная битва!', 29981),
(167732, 'ruRU', 'Жизнь за Орду!', 'Жизнь за Орду!', 29981),
(167731, 'ruRU', 'Умри, шавка Альянса!', 'Умри, шавка Альянса!', 29981),
(167730, 'ruRU', 'Кромуш передает привет!', 'Кромуш передает привет!', 29981),
(167729, 'ruRU', 'Армия Чести покончит с тобой!', 'Армия Чести покончит с тобой!', 29981),
(167728, 'ruRU', 'Победа или смерть!', 'Победа или смерть!', 29981),
(167727, 'ruRU', 'И Альянс реально думает, что такой щенок, как ты, нас остановит?', 'И Альянс реально думает, что такой щенок, как ты, нас остановит?', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(167726, 'ruRU', 'Да я дрался с Альянсом на всех морях, реках и озерах Азерота!', 'Да я дралась с Альянсом на всех морях, реках и озерах Азерота!', 29981),
(167725, 'ruRU', 'Направление определил... ну, держись теперь, от меня не уйдешь!', 'Направление определила... ну, держись теперь, от меня не уйдешь!', 29981),
(167724, 'ruRU', 'Вот так дерутся настоящие моряки!', 'Вот так дерутся настоящие моряки!', 29981),
(167723, 'ruRU', 'И ради этого я сошел с корабля?', 'И ради этого я сошла с корабля?', 29981),
(167722, 'ruRU', 'Ну давай, сухопутная крыса!', 'Ну давай, сухопутная крыса!', 29981),
(167721, 'ruRU', 'Тебе меня не переплюнуть, |3-6($c)!', 'Тебе меня не переплюнуть, |3-6($c)!', 29981),
(167720, 'ruRU', 'Думаешь, сможешь проскользнуть мимо меня? Вот ты где!', 'Думаешь, сможешь проскользнуть мимо меня? Вот ты где!', 29981),
(167719, 'ruRU', 'Ну и что ты здесь делаешь, шавка Альянса?', 'Ну и что ты здесь делаешь, шавка Альянса?', 29981),
(167718, 'ruRU', 'Не подходи! Теперь это земля Орды!', 'Не подходи! Теперь это земля Орды!', 29981),
(167717, 'ruRU', 'Я за тобой давно охочусь, |3-6($c).', 'Я за тобой давно охочусь, |3-6($c).', 29981),
(167716, 'ruRU', 'Ну давай, иди сюда!', 'Ну давай, иди сюда!', 29981),
(167715, 'ruRU', 'За твою голову назначена награда, и я собираюсь ее получить!', 'За твою голову назначена награда, и я собираюсь ее получить!', 29981),
(167714, 'ruRU', 'Я не затем сюда тащился, чтобы уйти с пустыми карманами!', 'Я не затем сюда тащилась, чтобы уйти с пустыми карманами!', 29981),
(167713, 'ruRU', 'Катись отсюда, |3-6($r)! Это моя добыча!', 'Катись отсюда, |3-6($r)! Это моя добыча!', 29981),
(167712, 'ruRU', 'Кромуш не станет переживать, если не досчитается монетки-другой...', 'Кромуш не станет переживать, если не досчитается монетки-другой...', 29981),
(167711, 'ruRU', 'Победитель получит все.', 'Победитель получит все.', 29981),
(167710, 'ruRU', 'Новая заварушка, новый труп.', 'Новая заварушка, новый труп.', 29981),
(167709, 'ruRU', 'Моя сила безгранична!', 'Моя сила безгранична!', 29981),
(167708, 'ruRU', 'Против магии Орды ты ничто!', 'Против магии Орды ты ничто!', 29981),
(167707, 'ruRU', 'Я обращу тебя в пепел.', 'Я обращу тебя в пепел.', 29981),
(167706, 'ruRU', 'Наконец-то достойный противник!', 'Наконец-то достойный противник!', 29981),
(167705, 'ruRU', 'Сила струится по моим жилам, как эль по жилам дворфа!', 'Сила струится по моим жилам, как эль по жилам дворфа!', 29981),
(167704, 'ruRU', 'Маги Альянса слабы. Смотри, что такое настоящая магия!', 'Маги Альянса слабы. Смотри, что такое настоящая магия!', 29981),
(167703, 'ruRU', 'Если сдашься, все закончится миром!', 'Если сдашься, все закончится миром!', 29981),
(167702, 'ruRU', 'Не заставляй меня убивать тебя.', 'Не заставляй меня убивать тебя.', 29981),
(167701, 'ruRU', 'Тебя нужно остановить, а то ты снова начнешь убивать.', 'Тебя нужно остановить, а то ты снова начнешь убивать.', 29981),
(167700, 'ruRU', 'Эта война должна прекратиться. Брось оружие!', 'Эта война должна прекратиться. Брось оружие!', 29981),
(167699, 'ruRU', 'Посмотри, что наделал Альянс!', 'Посмотри, что наделал Альянс!', 29981),
(167698, 'ruRU', 'Сдавайся, и я сохраню тебе жизнь.', 'Сдавайся, и я сохраню тебе жизнь.', 29981),
(167697, 'ruRU', 'Сейчас проверим это изобретение... на твоей черепушке!', 'Сейчас проверим это изобретение... на твоей черепушке!', 29981),
(167696, 'ruRU', 'Хочешь получить гаечным ключом по морде, |3-6($r)? Сейчас устрою!', 'Хочешь получить гаечным ключом по морде, |3-6($r)? Сейчас устрою!', 29981),
(167695, 'ruRU', 'Мне обещали, что здесь будет безопасно!', 'Мне обещали, что здесь будет безопасно!', 29981),
(167694, 'ruRU', 'Эти устройства стоят дороже, чем твоя жизнь!', 'Эти устройства стоят дороже, чем твоя жизнь!', 29981),
(167693, 'ruRU', 'А ну не тронь товары, |3-6($r)!', 'А ну не тронь товары, |3-6($r)!', 29981),
(167692, 'ruRU', 'Ну что там опять?!', 'Ну что там опять?!', 29981),
(167691, 'ruRU', 'Я разберусь с этими прихвостнями Альянса!', 'Я разберусь с этими прихвостнями Альянса!', 29981),
(167690, 'ruRU', 'Ну наконец-то настоящая работа!', 'Ну наконец-то настоящая работа!', 29981),
(167689, 'ruRU', 'Батрачья сила!', 'Батрачья сила!', 29981),
(167688, 'ruRU', 'И зачем только я уехал из Калимдора!', 'И зачем только я уехала из Калимдора!', 29981),
(167687, 'ruRU', 'Помогите!', 'Помогите!', 29981),
(167686, 'ruRU', 'Только не это.', 'Только не это.', 29981),
(167685, 'ruRU', 'Я знал, что ты будешь здесь.', 'Я знала, что ты будешь здесь.', 29981),
(167684, 'ruRU', 'Последнее желание?', 'Последнее желание?', 29981),
(167683, 'ruRU', 'Я лично отрежу тебе голову.', 'Я лично отрежу тебе голову.', 29981),
(167682, 'ruRU', 'Еще один ягненочек Альянса явился на бойню.', 'Еще один ягненочек Альянса явился на бойню.', 29981),
(167681, 'ruRU', 'Надо будет рассказать об этом вождю.', 'Надо будет рассказать об этом вождю.', 29981),
(167680, 'ruRU', 'Ну наконец-то.', 'Ну наконец-то.', 29981),
(167679, 'ruRU', 'Тебе меня не сломить!', 'Тебе меня не сломить!', 29981),
(167678, 'ruRU', 'За Орду!', 'За Орду!', 29981),
(167676, 'ruRU', 'Древесина-то того... проклята.', '', 29981),
(167675, 'ruRU', '', 'Чего такое?', 29981),
(167674, 'ruRU', 'Что ты, они мне очень помогли. Эм... Дорогая?', '', 29981),
(167673, 'ruRU', '', 'Надеюсь, эти здоровяки не доставили тебе проблем?', 29981),
(167672, 'ruRU', 'Привет, тыковка.', '', 29981),
(167671, 'ruRU', '', 'Кракен бы побрал этот лес...', 29981),
(167670, 'ruRU', '', 'Слышали?', 29981),
(167669, 'ruRU', '', 'Сэл ждет нас на холме. Подъем вроде не слишком крутой.', 29981),
(167668, 'ruRU', '', 'Пока хватит. Давайте за мной.', 29981),
(167667, 'ruRU', '', 'Не могу же я тащить и вас, и бревна!', 29981),
(167666, 'ruRU', '', 'Хватит филонить!', 29981),
(167665, 'ruRU', '', 'Тортолланы бы шустрее управились.', 29981),
(167664, 'ruRU', '', 'Вам нравится, когда на вас кричат?!', 29981),
(167663, 'ruRU', '', 'Ну правильно, куда нам спешить...', 29981),
(167662, 'ruRU', '', 'Ваше дело – бревна таскать.', 29981),
(167661, 'ruRU', '', 'Несем, не роняем. Я со всем разберусь.', 29981),
(167660, 'ruRU', '', 'Без паники!', 29981),
(167659, 'ruRU', '', 'Не дрейфьте, я прикрою.', 29981),
(167658, 'ruRU', '', 'Я разберусь, вы лучше бревна крепче держите.', 29981),
(167657, 'ruRU', '', 'Шевелитесь, ребятки! Помните о золоте.', 29981),
(167656, 'ruRU', '', 'Раньше загрузимся – раньше уйдем.', 29981),
(167655, 'ruRU', '', 'Ну, ну, пошевеливайтесь!', 29981),
(167654, 'ruRU', '', 'Спинки ровно держим!', 29981),
(167653, 'ruRU', '', 'А ну, не волынить!', 29981),
(167651, 'ruRU', '', 'А ты говорил – они, мол, работать не захотят.', 29981),
(167650, 'ruRU', '', 'Эй, братия честная! Кошель золота и пинту эля каждому, кто мне поможет!', 29981),
(167646, 'ruRU', '', 'Зачем ты все усложняешь, Мэйнард...', 29981),
(167644, 'ruRU', 'Ну ты же всем о моем схроне растреплешь. А оно мне надо?', 'Ну ты же всем о моем схроне растреплешь. А оно мне надо?', 29981),
(167643, 'ruRU', 'Грабеж подождет. Пришла пора убивать.', 'Грабеж подождет. Пришла пора убивать.', 29981),
(167642, 'ruRU', 'Ну все, прощайся с жизнью. Никто тебя не найдет.', 'Ну все, прощайся с жизнью. Никто тебя не найдет.', 29981),
(167641, 'ruRU', 'Чур я забираю добро этого ничтожества!', 'Чур я забираю добро этого ничтожества!', 29981),
(167640, 'ruRU', 'Деньги есть? А если найду?', 'Деньги есть? А если найду?', 29981),
(167639, 'ruRU', 'Седогрив назначил цену за твою голову!', 'Седогрив назначил цену за твою голову!', 29981),
(167637, 'ruRU', 'Удачи вам, $n, леди Джайна. Когда вы вернетесь с победой, армия будет ждать вас здесь.', '', 29981),
(167636, 'ruRU', '', 'Мы хорошо их потрепали, теперь нужно вернуться и дать армиям сигнал двигаться вперед!', 29981),
(167635, 'ruRU', 'Нет! Я не хочу умирать!', 'Нет! Я не хочу умирать!', 29981),
(167634, 'ruRU', 'Ну почему я?', 'Ну почему я?', 29981),
(167633, 'ruRU', 'Альянс отомстит за меня!', 'Альянс отомстит за меня!', 29981),
(167632, 'ruRU', 'И зачем я вообще из дома уехал?', 'И зачем я вообще из дома уехала?', 29981),
(167631, 'ruRU', 'Мне для такого слишком мало платят.', 'Мне для такого слишком мало платят.', 29981),
(167630, 'ruRU', 'Помогите! Кто-нибудь!', 'Помогите! Кто-нибудь!', 29981),
(167629, 'ruRU', 'Да я в таверне дрался кое с кем пострашнее тебя!', 'Да я в таверне дралась кое с кем пострашнее тебя!', 29981),
(167628, 'ruRU', 'Покажи, что можешь, сухопутная крыса!', 'Покажи, что можешь, сухопутная крыса!', 29981),
(167627, 'ruRU', 'Да уродливее тебя во всем океане никого не сыскать!', 'Да уродливее тебя во всем океане никого не сыскать!', 29981),
(167626, 'ruRU', 'Дерешься, как выдра!', 'Дерешься, как выдра!', 29981),
(167625, 'ruRU', 'Да ты и на суше мне не ровня!', 'Да ты и на суше мне не ровня!', 29981),
(167624, 'ruRU', 'Думаешь, можешь потягаться с моряками Альянса? К бою!', 'Думаешь, можешь потягаться с моряками Альянса? К бою!', 29981),
(167623, 'ruRU', 'Надо было оставаться в мастерской.', 'Надо было оставаться в мастерской.', 29981),
(167622, 'ruRU', 'Вот потому-то я и предпочитаю машины...', 'Вот потому-то я и предпочитаю машины...', 29981),
(167621, 'ruRU', 'Нет, стой! Я всего лишь рабочий!', 'Нет, стой! Я всего лишь рабочая!', 29981),
(167620, 'ruRU', 'О, мое новое изобретение ждет проверка боем!', 'О, мое новое изобретение ждет проверка боем!', 29981),
(167619, 'ruRU', 'Ну-ка, посмотрим, как ты покажешь себя в бою.', 'Ну-ка, посмотрим, как ты покажешь себя в бою.', 29981),
(167618, 'ruRU', 'Ты что, не видишь? Я занят!', 'Ты что, не видишь? Я занята!', 29981),
(167617, 'ruRU', 'Будет больно.', 'Будет больно.', 29981),
(167616, 'ruRU', 'Последнее желание?', 'Последнее желание?', 29981),
(167615, 'ruRU', 'За это мне точно медаль дадут.', 'За это мне точно медаль дадут.', 29981),
(167614, 'ruRU', 'Но предупреждаю: драться честно я не собираюсь.', 'Но предупреждаю: драться честно я не собираюсь.', 29981),
(167613, 'ruRU', 'Я лично отрежу тебе голову.', 'Я лично отрежу тебе голову.', 29981),
(167612, 'ruRU', 'Я ждал тебя, $n.', 'Я ждала тебя, $n.', 29981),
(167611, 'ruRU', 'Следующая очередь – твоя!', 'Следующая очередь – твоя!', 29981),
(167610, 'ruRU', 'И мир посмотреть, и ордынцев поубивать... не жизнь, а сказка!', 'И мир посмотреть, и ордынцев поубивать... не жизнь, а сказка!', 29981),
(167609, 'ruRU', 'Передай Сильване, что она следующая!', 'Передай Сильване, что она следующая!', 29981),
(167608, 'ruRU', 'Альянс не сломить!', 'Альянс не сломить!', 29981),
(167607, 'ruRU', 'Ордынское отродье! Ты у меня живо улетишь обратно в Калимдор!', 'Ордынское отродье! Ты у меня живо улетишь обратно в Калимдор!', 29981),
(167606, 'ruRU', 'Трепещи пред мощью седьмого легиона!', 'Трепещи пред мощью седьмого легиона!', 29981),
(167605, 'ruRU', 'Стой, где стоишь, ордынское отродье!', 'Стой, где стоишь, ордынское отродье!', 29981),
(167604, 'ruRU', 'Я уничтожу всех врагов Альянса до последнего!', 'Я уничтожу всех врагов Альянса до последнего!', 29981),
(167603, 'ruRU', 'Ты уже мертвец.', 'Ты уже мертвец.', 29981),
(167602, 'ruRU', 'Как по мишени стрелять.', 'Как по мишени стрелять.', 29981),
(167601, 'ruRU', 'На твоем месте я бы бежал без оглядки.', 'На твоем месте я бы бежала без оглядки.', 29981),
(167600, 'ruRU', 'Тебе меня не поймать.', 'Тебе меня не поймать.', 29981),
(167599, 'ruRU', 'Новая цель для моего нового заклинания.', 'Новая цель для моего нового заклинания.', 29981),
(167598, 'ruRU', 'Еще один непослушный ребенок.', 'Еще один непослушный ребенок.', 29981),
(167597, 'ruRU', 'Моя сила сметет тебя!', 'Моя сила сметет тебя!', 29981),
(167596, 'ruRU', 'Орда думает, что владеет истинной магией? Ха!', 'Орда думает, что владеет истинной магией? Ха!', 29981),
(167595, 'ruRU', 'Мощь переполняет меня!', 'Мощь переполняет меня!', 29981),
(167594, 'ruRU', 'Моя магия разорвет тебя на клочки!', 'Моя магия разорвет тебя на клочки!', 29981),
(167593, 'ruRU', 'Ты погибнешь здесь и сейчас. Я не позволю тебе и дальше творить зло.', 'Ты погибнешь здесь и сейчас. Я не позволю тебе и дальше творить зло.', 29981),
(167592, 'ruRU', 'После этого мне точно понадобится лекарь.', 'После этого мне точно понадобится лекарь.', 29981),
(167591, 'ruRU', 'Дальше вам не пройти! Это место под защитой Альянса.', 'Дальше вам не пройти! Это место под защитой Альянса.', 29981),
(167590, 'ruRU', 'Как бы тебя оскорбить? Столько вариантов...', 'Как бы тебя оскорбить? Столько вариантов...', 29981),
(167589, 'ruRU', 'Прячьтесь за меня, друзья. Я сам разберусь.', 'Прячьтесь за меня, друзья. Я сама разберусь.', 29981),
(167588, 'ruRU', 'Покажи, что можешь, |3-6($r)!', 'Покажи, что можешь, |3-6($r)!', 29981),
(167587, 'ruRU', 'Я никогда не сдамся!', 'Я никогда не сдамся!', 29981),
(167586, 'ruRU', 'За Альянс!', 'За Альянс!', 29981),
(167585, 'ruRU', 'Вам не место на Азероте.', 'Вам не место на Азероте.', 29981),
(167584, 'ruRU', 'На помощь! Долго мне эту дрянь не сдержать!', 'На помощь! Долго мне эту дрянь не сдержать!', 29981),
(167583, 'ruRU', 'Тебе меня не убить, |3-6($r).', 'Тебе меня не убить, |3-6($r).', 29981),
(167582, 'ruRU', 'Тебя надо остановить.', 'Тебя надо остановить.', 29981),
(167581, 'ruRU', 'Во всех этих смертях виновата Орда!', 'Во всех этих смертях виновата Орда!', 29981),
(167580, 'ruRU', 'Есть только один способ покончить с этой войной!', 'Есть только один способ покончить с этой войной!', 29981),
(167579, 'ruRU', '[DNT] TEMP DO NOT USE', '[DNT] TEMP DO NOT USE', 29981),
(167578, 'ruRU', 'Озаренные как из воздуха появились... Прости, братишка...', 'Озаренные как из воздуха появились... Прости, братишка...', 29981),
(167577, 'ruRU', 'Отступаем! Их слишком много!', 'Отступаем! Их слишком много!', 29981),
(167576, 'ruRU', '|TInterface\\ICONS\\ABILITY_DRUID_RAVAGE.BLP:20|t Победите воплощение Кимбула, прежде чем вы наберете слишком много эффектов |cFFF00000|Hspell:282444|h[Раздирающих когтей]|h|r!', '|TInterface\\ICONS\\ABILITY_DRUID_RAVAGE.BLP:20|t Победите воплощение Кимбула, прежде чем вы наберете слишком много эффектов |cFFF00000|Hspell:282444|h[Раздирающих когтей]|h|r!', 29981),
(167575, 'ruRU', '|TInterface\\ICONS\\Ability_Skyreach_Four_Wind.blp:20|t Победите воплощение Па\'ку, прежде чем оно наберет слишком много эффектов |cFFF00000|Hspell:285945|h[Ускоряющих ветров]|h|r!', '|TInterface\\ICONS\\Ability_Skyreach_Four_Wind.blp:20|t Победите воплощение Па\'ку, прежде чем оно наберет слишком много эффектов |cFFF00000|Hspell:285945|h[Ускоряющих ветров]|h|r!', 29981),
(167574, 'ruRU', '|TInterface\\ICONS\\ABILITY_THUNDERKING_BALLLIGHTNING.BLP:20|t Отойдите подальше от союзников во время действия |cFFF00000|Hspell:286811|h[гнева Акунды]|h|r!', '|TInterface\\ICONS\\ABILITY_THUNDERKING_BALLLIGHTNING.BLP:20|t Отойдите подальше от союзников во время действия |cFFF00000|Hspell:286811|h[гнева Акунды]|h|r!', 29981),
(167573, 'ruRU', '|TInterface\\ICONS\\ABILITY_HUNTER_MASTERSCALL.BLP:20|t Отойдите подальше от союзников во время действия |cFFF00000|Hspell:282447|h[гнева Кимбула]|h|r!', '|TInterface\\ICONS\\ABILITY_HUNTER_MASTERSCALL.BLP:20|t Отойдите подальше от своих союзников во время действия |cFFF00000|Hspell:282447|h[гнева Кимбула]|h|r, чтобы уберечь их от кровоточащих ран!', 29981),
(167572, 'ruRU', '|TInterface\\ICONS\\INV_Pterrordax2Mount_LightGreen.blp:20|t Спрячьтесь под Па\'ку во время действия |cFFF00000|Hspell:282107|h[гнева Па\'ку]|h|r, чтобы избежать смертельного урона!', '|TInterface\\ICONS\\INV_Pterrordax2Mount_LightGreen.blp:20|t Спрячьтесь под Па\'ку во время действия |cFFF00000|Hspell:282107|h[гнева Па\'ку]|h|r, чтобы избежать смертельного урона!', 29981),
(167571, 'ruRU', 'Представь, что тебе нужно уворачиваться от огненной гибели каждый раз, когда хочешь забрать немного якорь-травы из сейфа.', '', 29981),
(167570, 'ruRU', 'Не спорю, это все очень стильно, но не слишком ли сложно получается?', '', 29981),
(167569, 'ruRU', 'Кто, чтоб им пусто было, придумывает такие штуки?', '', 29981),
(167568, 'ruRU', '$p, попробуй найти панель управления. Мы с капитаном Флинном тебя прикроем.', '', 29981),
(167567, 'ruRU', 'Надеюсь, ты прав, дружище. Мне отсюда ничего не видно.', '', 29981),
(167566, 'ruRU', 'Наверное, в другой части комнаты есть еще переключатель.', '', 29981),
(167565, 'ruRU', 'Мы тебя прикроем, $p!', '', 29981),
(167564, 'ruRU', 'Судя по виду этой жутковатой золотой маски, она может быть связана с ловушками, $n.', '', 29981),
(167563, 'ruRU', 'Осторожно, сзади!', '', 29981),
(167562, 'ruRU', '|TInterface\\Icons\\Spell_Deathknight_Defile.blp:20|t %s начинает применять заклинание |cFFFF0000|Hspell:287333|h[Неизбежный финал]|h|r! Бегите!', '', 29981),
(167561, 'ruRU', '|TInterface\\Icons\\WARLOCK_CURSE_SHADOW.BLP:20|t%s начинает применять против вас заклинание |cFFFF0000|Hspell:288449|h[Врата смерти]|h|r!', '', 29981),
(167560, 'ruRU', 'Тебе пора уходить!', '', 29981),
(167559, 'ruRU', '', 'Пора испытать это оружие на живой цели!', 29981),
(167556, 'ruRU', 'Где... я?', '', 29981),
(167554, 'ruRU', 'Иногда быть скрытным весьма выгодно.', '', 29981),
(167552, 'ruRU', '<Постоять и послушать.>', '<Постоять и послушать.>', 29981),
(167551, 'ruRU', 'Я выбираю Джани, лоа собирателей.', 'Я выбираю Джани, лоа собирателей.', 29981),
(167550, 'ruRU', 'О, не беспокойся о том маленьком заблудшем огоньке. Его спрятали в надежном месте.\n\n<Отец Норлат улыбается.>', '', 29981),
(167549, 'ruRU', 'Что случилось с этим огоньком?', 'Что случилось с этим огоньком?', 29981),
(167548, 'ruRU', 'Внезапно вернуться к жизни, да еще посреди поля боя – такое не каждый выдержит.\n\nМы здесь, чтобы помочь нашим новым рекрутам свыкнуться с этой переменой.', '', 29981),
(167547, 'ruRU', '', 'Тебе придется отправиться к цели вместе с этими минами!', 29981),
(167546, 'ruRU', '', 'Запусти ползучие мины снова!', 29981),
(167545, 'ruRU', '', 'Нужно нападать на них всем скопом. Одной ползучей мины не хватит!', 29981),
(167544, 'ruRU', 'Вы уверены, что хотите избавиться от дара Н\'Зота? Вы не сможете изменить это решение.', 'Вы уверены, что хотите избавиться от дара Н\'Зота? Вы не сможете изменить это решение.', 29981),
(167543, 'ruRU', 'Что это за звери?', '', 29981),
(167542, 'ruRU', 'Химеры! В укрытие!', '', 29981),
(167541, 'ruRU', 'Что это там на горизонте? Похоже на...', '', 29981),
(167540, 'ruRU', '', 'Тебя подбросить?', 29981),
(167539, 'ruRU', '<Очертания под капюшоном Вашрина складываются в некое подобие улыбки.>\n\nКак приятно снова встретить тебя, $n. Посмотришь мои новые товары?', '', 29981),
(167538, 'ruRU', '', 'Тьма поглотила еще одну нашу сестру. Но это не заставит нас забыть о своем долге.', 29981),
(167537, 'ruRU', 'Кровавые Клыки истребят всех Отрекшихся до последнего.', '', 29981),
(167533, 'ruRU', 'Я ничего не помню об этом навыке.', 'Я ничего не помню об этом навыке.', 29981),
(167532, 'ruRU', 'Я не знаю, как это делается.', 'Я не знаю, как это делается.', 29981),
(167531, 'ruRU', 'Ничего не помню об этой способности.', 'Ничего не помню об этой способности.', 29981),
(167530, 'ruRU', '|A:Warfront-AllianceWave3:25:23:0:0|aАльянс отправил штурмовой отряд на центральную дорогу!', '|A:Warfront-AllianceWave3:25:23:0:0|aАльянс отправил штурмовой отряд на центральную дорогу!', 29981),
(167529, 'ruRU', '|A:Warfront-HordeWave3:25:23:0:0|aАльянс отправил штурмовой отряд на западную дорогу!', '|A:Warfront-HordeWave3:25:23:0:0|aАльянс отправил штурмовой отряд на западную дорогу!', 29981),
(167528, 'ruRU', '|A:Warfront-AllianceWave3:25:23:0:0|aАльянс отправил штурмовой отряд на восточную дорогу!', '|A:Warfront-AllianceWave3:25:23:0:0|aАльянс отправил штурмовой отряд на восточную дорогу!', 29981),
(167527, 'ruRU', 'Предупреждение: этот выбор помешает вам выполнить основные задания цепочки \"Судьба Саурфанга\" и предоставит вам вместо них альтернативное задание.\n\nВы не сможете получить игрушку \"Поношенный плащ\", однако другие награды сохранятся.\n\nЗекхан запомнит это. Вы уверены, что хотите продолжить?', 'Предупреждение: этот выбор помешает вам выполнить основные задания цепочки \"Судьба Саурфанга\" и предоставит вам вместо них альтернативное задание.\n\nВы не сможете получить игрушку \"Поношенный плащ\", однако другие награды сохранятся.\n\nЗекхан запомнит это. Вы уверены, что хотите продолжить?', 29981),
(167526, 'ruRU', 'Это не моя битва.', 'Это не моя битва.', 29981),
(167525, 'ruRU', 'Я не предам своего вождя, тролль.', 'Я не предам своего вождя, тролль.', 29981),
(167524, 'ruRU', 'Лови!', '', 29981),
(167523, 'ruRU', 'Гоните альянсовцев с моего корабля!', '', 29981),
(167522, 'ruRU', 'Выброшу твой труп за борт, будешь гнить вместе со своими дружками!', '', 29981),
(167521, 'ruRU', 'Я думал, что умру в этой клетке.', '', 29981),
(167520, 'ruRU', 'Отомсти за тех, кого уже не спасти!', '', 29981),
(167519, 'ruRU', 'Я не забуду твоей отваги!', '', 29981),
(167518, 'ruRU', 'Нашлите на чужаков чуму!', '', 29981),
(167517, 'ruRU', 'Герои! Освободите нас, и мы вернемся в бой!', '', 29981),
(167516, 'ruRU', 'Слухи о моей гибели были сильно преувеличены.', '', 29981),
(167515, 'ruRU', 'Свобода! Наконец-то!', '', 29981),
(167512, 'ruRU', 'Вы действительно хотите продолжить?', 'Вы действительно хотите продолжить?', 29981),
(167511, 'ruRU', 'Мы готовы.', 'Мы готовы.', 29981),
(167508, 'ruRU', 'Нужно отвести флот в безопасное место. Как насчет отправиться в путь прямо сейчас?', '', 29981),
(167506, 'ruRU', '', 'Не бойся: теперь мы на одной стороне.\n\nСмерть все делает яснее.', 29981),
(167505, 'ruRU', '', 'Так, мальчики. Обустройте-ка нам все.', 29981),
(167504, 'ruRU', 'Этой валь\'кире даже и предлагать мне ничего не пришлось: я сам вскочил на ноги. Думаешь, могло быть по-другому?\n\n<Лораш на мгновение задумывается.>\n\nНадеюсь, у меня еще будет шанс отрубить голову Малфуриону. Посмотрим, как ему это понравится.', '', 29981),
(167503, 'ruRU', 'Успокойся. Просто расскажи все, что помнишь.', 'Успокойся. Просто расскажи все, что помнишь.', 29981),
(167502, 'ruRU', 'Я... я все видел!', '', 29981),
(167501, 'ruRU', '<Взгляд Джукса смущенно бегает туда-сюда.>\n\nЭ-э, мы не очень любим обсуждать то, что случилось с \"АзероБОТом-I\". Достаточно сказать, что он не прошел испытания на море, понимаешь, о чем я?', '', 29981),
(167500, 'ruRU', 'Что случилось с \"АзероБОТом-I\"?', 'Что случилось с \"АзероБОТом-I\"?', 29981),
(167499, 'ruRU', 'Вождю нужно было оружие – и у нас оно есть!', '', 29981),
(167498, 'ruRU', 'Только не лютуй, милая!', '', 29981),
(167497, 'ruRU', '', 'Ты знаешь, что делать, Сэл. Бери тележку и дуй к лесопилке.', 29981),
(167496, 'ruRU', '', 'Дориан Этуотер бормочет себе под нос что-то про свою больную спину.', 29981),
(167495, 'ruRU', 'На заднем дворе, дорогая!', '', 29981),
(167494, 'ruRU', '', 'Сэл! Где мои инструменты?', 29981),
(167493, 'ruRU', '', 'На случай подобных затруднений я подготовила письмо. Не забудьте взять его с собой.', 29981),
(167492, 'ruRU', '', 'Корабела ищешь? Ну, ищи дальше. Я отошла от дел.', 29981),
(167491, 'ruRU', '', 'Я еще не оглохла, между прочим.', 29981),
(167490, 'ruRU', 'Вернитесь в руины Зул\'джана', 'Вернитесь в руины Зул\'джана', 29981),
(167489, 'ruRU', 'Я? Море упаси! Дориан – это моя жена.', '', 29981),
(167487, 'ruRU', 'Этот... голем только что пошевелился?', '', 29981),
(167486, 'ruRU', 'Удалить', '', 29981),
(167485, 'ruRU', 'Удалить', '', 29981),
(167484, 'ruRU', 'По лицу вижу: выпить хочешь. Чего налить?', '', 29981),
(167483, 'ruRU', 'Давно это было, лорд-адмирал. Но имя очень знакомое...', '', 29981),
(167482, 'ruRU', '', 'Корабли этого мастера считались лучшими в те времена, когда ты служил у моего отца.', 29981),
(167481, 'ruRU', 'Хм-м... Дориан Этуотер...', '', 29981),
(167480, 'ruRU', 'Духи с ними не согласны...', '', 29981),
(167479, 'ruRU', 'Они думают, их блестящие стены и яркие огни помешают нам попасть в город.', '', 29981),
(167478, 'ruRU', 'Альянс шлет озаренным подкрепление, чтобы те сразились здесь с нами.', '', 29981),
(167477, 'ruRU', '', 'Укрепить щиты! Никто и ничто не должно проникнуть в город!', 29981),
(167476, 'ruRU', '', 'Что уничтожает эти укрепления? Мне нужны ответы!', 29981),
(167475, 'ruRU', '', 'Больше воинов на восточный фланг! Не отступать!', 29981),
(167474, 'ruRU', '', 'Что это был за гнусный звук? Я требую оперативную сводку!', 29981),
(167473, 'ruRU', '', 'Ух! Я вижу... лишь тьму... Почему?', 29981),
(167472, 'ruRU', 'Все предрешено!', '', 29981),
(167471, 'ruRU', 'Пусть все наши враги знают, это... судьба!', '', 29981),
(167470, 'ruRU', 'Наполните эти сосуды своей болью, своей яростью, своей силой!', '', 29981),
(167469, 'ruRU', 'Древние духи, забытые и покинутые, я здесь. Я вас помню.', '', 29981),
(167464, 'ruRU', 'Орда захватила Лор\'данел!', 'Орда захватила Лор\'данел!', 29981),
(167463, 'ruRU', 'Племя Черного Копья наладило морское сообщение между Зандаларом и островами Эха, что к югу от Оргриммара.', 'Племя Черного Копья наладило морское сообщение между Зандаларом и островами Эха, что к югу от Оргриммара.', 29981),
(167462, 'ruRU', 'А, это ты, $p. Хорошо. Я проверяю одну гипотезу и нуждаюсь в... ком-то стойком вроде тебя.$b$bМы проводим эксперименты по воскрешению павших друзей зандаларов.$b$bМаны на это уходит слишком много, чтобы подобное можно было делать массово, но я думаю, что это может быть многообещающим методом психологической войны. Видишь ли, зандалары не переносят ожившие трупы.$b$bТак что собери-ка побольше рабочих материалов. Можешь взять два моих ранних порожденных Бездной экспериментальных образца и узнать, как они работают. Удачи!', '', 29981),
(167461, 'ruRU', 'Готов к тесту.', 'Готова к тесту.', 29981),
(167460, 'ruRU', 'Это ты Дориан Этуотер?', 'Это ты Дориан Этуотер?', 29981),
(167459, 'ruRU', '<Не поднимая глаз от клумбы.>\n\nТолько на цветы не наступай: жена ужасно рассердится.', '', 29981),
(167458, 'ruRU', '<Похоже, Сэл всем доволен.>\n\nНу, как тебе моя благоверная?', '', 29981),
(167457, 'ruRU', 'Мне сказали, что ты знаешь, где искать корабела по имени Дориан Этуотер.', 'Мне сказали, что ты знаешь, где искать корабела по имени Дориан Этуотер.', 29981),
(167456, 'ruRU', 'Рад снова видеть тебя, $n.', '', 29981),
(167454, 'ruRU', 'Принцесса Таланджи, я готов сразиться с воинами Альянса и вернуть Скипетр Глубин.', 'Принцесса Таланджи, я готова сразиться с воинами Альянса и вернуть Скипетр Глубин.', 29981),
(167453, 'ruRU', '', 'Ничего? Где же армия? Где флот?', 29981),
(167452, 'ruRU', '', 'Готовьтесь: когда рассеется туман, мы нападем на их флот, а Раал поведет в бой наши воздушные силы!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(167451, 'ruRU', 'Зандалар', 'Зандалар', 29981),
(167450, 'ruRU', 'Найди капитана Хикса с \"Неумолимого\" в самом южном доке порта Штормграда. Этот славный корабль регулярно отплывает прямо в Кул-Тирас.', 'Найди капитана Хикса с \"Неумолимого\" в самом южном доке порта Штормграда. Этот славный корабль регулярно отплывает прямо в Кул-Тирас.', 29981),
(167449, 'ruRU', 'Кул-Тирас', 'Кул-Тирас', 29981),
(167448, 'ruRU', 'Именно для этого нужны чумные фургоны. Осталось только дождаться приказа Гнилостеня.', '', 29981),
(167447, 'ruRU', 'Вернемся к заданию Темной Госпожи. Сделаем немного чумы!', '', 29981),
(167446, 'ruRU', 'Позаботьтесь, чтобы это орудие прибыло к цели. Мы должны выиграть эту битву!', '', 29981),
(167445, 'ruRU', '$p, я убью тебя, а затем покончу с остальными злодеями!', '', 29981),
(167444, 'ruRU', 'Кул-тирасский фрегат приближается по правому борту!', 'Кул-тирасский фрегат приближается по правому борту!', 29981),
(167443, 'ruRU', 'Кул-тирасский фрегат приближается по левому борту!', 'Кул-тирасский фрегат приближается по левому борту!', 29981),
(167442, 'ruRU', '', 'Нет. Он тебе уже не поможет.', 29981),
(167441, 'ruRU', 'Ох... Свет... защитит... меня!', '', 29981),
(167440, 'ruRU', 'Я должен защитить природу!', '', 29981),
(167439, 'ruRU', '', 'Когда мы лишились дома, ночные эльфы дали нам приют. Мы не оставим их теперь, когда им нужно отвоевать свой дом. Будем сражаться вместе с ними!', 29981),
(167438, 'ruRU', 'Пожалуй мне свой дар.', 'Пожалуй мне свой дар.', 29981),
(167437, 'ruRU', 'Течение отнесет вас к смерти!', 'Течение отнесет вас к смерти!', 29981),
(167436, 'ruRU', 'Море станет вашей могилой!', 'Море станет вашей могилой!', 29981),
(167435, 'ruRU', 'Волны сокрушат вас!', 'Волны сокрушат вас!', 29981),
(167434, 'ruRU', 'Да поглотит вас пучина!', 'Да поглотит вас пучина!', 29981),
(167433, 'ruRU', 'Вам не скрыться от Бездны!', 'Вам не скрыться от Бездны!', 29981),
(167432, 'ruRU', 'Скройтесь в волнах!', 'Скройтесь в волнах!', 29981),
(167431, 'ruRU', 'Наше войско наводнит эту землю!', 'Наше войско наводнит эту землю!', 29981),
(167430, 'ruRU', '', 'Не лучший... исход...', 29981),
(167429, 'ruRU', 'Приготовьтесь! Сухопутные твари падут перед нами!', 'Приготовьтесь! Сухопутные твари падут перед нами!', 29981),
(167428, 'ruRU', 'Наша королева захватит эту землю для Бездны! Никто ей не помешает!', 'Наша королева захватит эту землю для Бездны! Никто ей не помешает!', 29981),
(167427, 'ruRU', 'Волны поднимутся и поглотят эту землю во славу нашей королевы!', 'Волны поднимутся и поглотят эту землю во славу нашей королевы!', 29981),
(167426, 'ruRU', 'Приведите мне больше пленных! Бездна жаждет их душ!', 'Приведите мне больше пленных! Бездна жаждет их душ!', 29981),
(167425, 'ruRU', 'Похищайте жизнь из их тел! Это воля нашей королевы!', 'Похищайте жизнь из их тел! Это воля нашей королевы!', 29981),
(167424, 'ruRU', 'Вдохните поглубже, сухопутные твари. Пусть океан наполнит ваши легкие и освободит ваши души!', 'Вдохните поглубже, сухопутные твари. Пусть океан наполнит ваши легкие и освободит ваши души!', 29981),
(167423, 'ruRU', 'Приведите ко мне пленных! Бездна требует новых душ!', 'Приведите ко мне пленных! Бездна требует новых душ!', 29981),
(167422, 'ruRU', 'Твою душу поглотит Алчущая Бездна!', 'Твою душу поглотит Алчущая Бездна!', 29981),
(167421, 'ruRU', 'Найдите остальных! Нужны еще жертвы!', 'Найдите остальных! Нужны еще жертвы!', 29981),
(167420, 'ruRU', 'Королева требует больше душ для Бездны!', 'Королева требует больше душ для Бездны!', 29981),
(167419, 'ruRU', 'Утопите их! Подарите их души Бездне!', 'Утопите их! Подарите их души Бездне!', 29981),
(167418, 'ruRU', 'Ресурсы: иссякли. Отключение.', '', 29981),
(167417, 'ruRU', 'Руны: связаны. Обнаружены воины Орды. Режим очищения: включен.', '', 29981),
(167416, 'ruRU', '', 'Встретимся в конторе капитана порта.', 29981),
(167415, 'ruRU', 'Эльфийские марионетки Бездны пришли заразить моих детей своей темной магией. Собери моих детей и принеси мне головы этих поганых фанатиков.', '', 29981),
(167414, 'ruRU', 'Вы действительно хотите продолжить?', 'Вы действительно хотите продолжить?', 29981),
(167413, 'ruRU', 'В погоню!', 'В погоню!', 29981),
(167412, 'ruRU', '', 'Дочь морей не уйдет от нас!', 29981),
(167411, 'ruRU', 'Что нам известно о култирасцах?', 'Что нам известно о култирасцах?', 29981),
(167410, 'ruRU', '', 'Жители Кул-Тираса и подданные Альянса вместе пережили многое. Я хотела бы укрепить нашу связь.', 29981),
(167409, 'ruRU', '', 'Кажется, я знаю, кто мне в этом поможет, $n.', 29981),
(167408, 'ruRU', 'Мы останемся здесь с КЛМЖС. Не позволяйте Альянсу снова напасть на нас исподтишка!', '', 29981),
(167407, 'ruRU', 'Нам нужно придумать, как избавиться от тумана и уничтожить остатки войска Альянса.', '', 29981),
(167406, 'ruRU', 'Не отвлекайтесь! Наш бой с Альянсом еще не окончен.', '', 29981),
(167405, 'ruRU', 'Я сказал то, что сказал! Свои слова я назад не беру!', '', 29981),
(167404, 'ruRU', 'Э-э, босс? Ты уверен, что хотел сказать именно это?', '', 29981),
(167403, 'ruRU', 'Покажем им, что это гиблое, проклятое, жуткое болото принадлежит Орде!', '', 29981),
(167401, 'ruRU', 'Тебе здесь не место!', '', 29981),
(167400, 'ruRU', 'Мы получим важную информацию от этих пленных.', '', 29981),
(167399, 'ruRU', 'Вы не останетесь без награды за эту услугу.', '', 29981),
(167398, 'ruRU', 'Благодаря вашей помощи Орда одержит победу!', '', 29981),
(167397, 'ruRU', '', 'Оплата только золотом!', 29981),
(167396, 'ruRU', '', 'Там, откуда мы их взяли, таких еще много!', 29981),
(167395, 'ruRU', '', 'Немного подтолкнуть – и они заговорят.', 29981),
(167394, 'ruRU', '', 'Мы ждем полной оплаты сразу после поставки.', 29981),
(167393, 'ruRU', 'Вы подавитесь пеплом... своих злодеяний.', '', 29981),
(167392, 'ruRU', 'Глупые псы. Явились прямо в мою ловушку! Теперь умрите!', '', 29981),
(167391, 'ruRU', 'Оставить подношение у алтаря.', 'Оставить подношение у алтаря.', 29981),
(167390, 'ruRU', 'Перед вами маленький алтарь из монет и мусора.', '', 29981),
(167389, 'ruRU', '', 'Мы вырвали руины Зул\'джана из лап Альянса! Давайте внутрь – нам нужно многое обдумать.', 29981),
(167388, 'ruRU', '', 'Дальше наши солдаты на Павшей заставе сами справятся. Нам нужно выступать к руинам Зул\'джана!', 29981),
(167387, 'ruRU', '', 'Так... холодно...', 29981),
(167386, 'ruRU', '', 'Думаешь, что холод тебя не убьет?', 29981),
(167385, 'ruRU', '', '|TInterface\\Icons\\INV_STAFF_53:20|t|cFFFF0000%s|r делает игрока |cFFFF0000$n|r целью мощного |cFFFF0000|Hspell:288380|h[пушечного залпа]|h|r! Разбегайтесь!', 29981),
(167384, 'ruRU', '|TInterface\\Icons\\ABILITY_VEHICLE_LIQUIDPYRITE:20|t|cFFFF0000%s|r вспыхивает и активирует |cFFFF0000|Hspell:288221|h[пылающий взрыв]|h|r!', '', 29981),
(167383, 'ruRU', '', '|TInterface\\Icons\\SPELL_FROST_FROZENCORE:20|t|cFFFF0000%s|r начинает применять заклинание |cFFFF0000|Hspell:288441|h[Ледопад]|h|r!', 29981),
(167382, 'ruRU', 'Азеритовый разлом взорвался в другом месте!', 'Азеритовый разлом взорвался в другом месте!', 29981),
(167381, 'ruRU', '', 'Я бы зачистила Старокаменную гавань за час!', 29981),
(167380, 'ruRU', '', 'Мои таланты здесь зря пропадают!', 29981),
(167379, 'ruRU', '', 'Ненавижу эти пески!', 29981),
(167378, 'ruRU', '', 'Если бы командиром была я, мы бы все тут закончили уже несколько недель назад!', 29981),
(167377, 'ruRU', 'Вечеринка в мою честь?', 'Вечеринка в мою честь?', 29981),
(167376, 'ruRU', '', 'Как тебе удается сохранять хладнокровие?', 29981),
(167375, 'ruRU', '', 'Ты холоднее льда.', 29981),
(167374, 'ruRU', '', 'Ты мне уже начинаешь нравиться...', 29981),
(167373, 'ruRU', '', 'Всего лишь чуть-чуть льда и снега... Не нужно бояться...', 29981),
(167372, 'ruRU', '', 'Пора охладить твой пыл... и все остальное!', 29981),
(167371, 'ruRU', '', 'Сейчас ты простудишься до смерти.', 29981),
(167370, 'ruRU', 'Только подумать – я мог бы стать пилотом-гонщиком. Это все-таки было бы безопаснее!', '', 29981),
(167369, 'ruRU', 'Орда может появиться в любой момент. Надеюсь, у меня достаточно боеприпасов...', '', 29981),
(167368, 'ruRU', 'Весьма неподходящее время для поломки...', '', 29981),
(167367, 'ruRU', 'Где эта ремонтная бригада? Я здесь застрял!', '', 29981),
(167366, 'ruRU', 'Если б только мой ветролет не разбился...', '', 29981),
(167364, 'ruRU', 'Хорошо! Хочешь подраться? Отведай шрапнели!', '', 29981),
(167360, 'ruRU', 'Испуганный кодо обнюхивает вашу руку. Он хочет пойти с вами.', 'Испуганный кодо обнюхивает вашу руку. Он хочет пойти с вами.', 29981),
(167358, 'ruRU', 'В атаку! Кто бы из Альянса ни попался вам на пути – не щадите никого!', '', 29981),
(167355, 'ruRU', 'Этот ключ не твой.', 'Этот ключ не твой.', 29981),
(167353, 'ruRU', 'Наконец-то я вырвался из ловушки Нарассина! Спасибо тебе.', 'Наконец-то я вырвалась из ловушки Нарассина! Спасибо тебе.', 29981),
(167352, 'ruRU', 'Вернитесь в Друствар.', 'Вернитесь в Друствар.', 29981),
(167350, 'ruRU', 'Спасибо, |3-6($c). Я думал, что никогда не выйду из этой тюрьмы.', 'Спасибо, |3-6($c). Я думала, что никогда не выйду из этой тюрьмы.', 29981),
(167349, 'ruRU', 'Свобода! После стольких лет...', 'Свобода! После стольких лет...', 29981),
(167348, 'ruRU', '', 'Стихии, простите меня.', 29981),
(167347, 'ruRU', '', 'Меня послали сюда защищать стихии! Я не пожалею на это сил!', 29981),
(167346, 'ruRU', '', 'Мины уничтожены, враг ослаблен, а наша машина смерти готова. Покажем нашу мощь Альянсу!', 29981),
(167344, 'ruRU', 'Бвонсамди зовет меня...', '', 29981),
(167343, 'ruRU', 'Эй, вражья тварь! Мы устроим дождь из твоей крови!', '', 29981),
(167342, 'ruRU', 'Откуда вы взялись?', '', 29981),
(167341, 'ruRU', 'Какая приятная встреча! Мы приготовили Орде маленький сюрприз за крепостью Клыка Войны – садись и взгляни своими глазами!', '', 29981),
(167340, 'ruRU', 'Жужжалки, установленные на Темных берегах, потребляют очень много топлива, а наши припасы уже иссякают.\n\nК счастью, здесь есть еще топливо – остается лишь отобрать его у сектантов, обосновавшихся неподалеку.', '', 29981),
(167338, 'ruRU', 'Убейте всех до единого. Не щадите никого!', '', 29981),
(167337, 'ruRU', 'Сегодня мы отомстим за Тельдрассил!', '', 29981),
(167336, 'ruRU', 'Им нечего противопоставить нашим осадным орудиям!', '', 29981),
(167335, 'ruRU', 'Я сражался за свой народ...', '', 29981),
(167334, 'ruRU', 'Орда сражается с честью. А про тебя можно так сказать?!', '', 29981),
(167333, 'ruRU', 'Без гномских подводных лодок мы Вторую войну не выиграли бы. Это большая честь – сражаться за Альянс на одной из них!$b$bК тому же я смогу показать Поззику, насколько гномское инженерное дело опережает гоблинскую манеру взрывать то, что подвернется. Конечно, наши торпеды взрываются, попав в цель, но это – утонченный взрыв. Тщательно рассчитанный и точный!', '', 29981),
(167332, 'ruRU', '', 'Акунда, умоляю тебя! Наполни эту машину своей энергией, чтобы она помогла нам сокрушить наших врагов!', 29981),
(167331, 'ruRU', 'Готово! На ПОДВОДе ты незаметно подберешься к их флоту и разнесешь корабли Орды на щепки! Зуб даю, что этот второсортный инженеришка Поззик до такого никогда бы не додумался!', '', 29981),
(167330, 'ruRU', 'Тебе ничего из меня... не вытянуть.', '', 29981),
(167329, 'ruRU', '|TInterface\\ICONS\\Spell_Frost_Ring of Frost.blp:20|t Холодные ветра усиливаются, готовясь обрушить на вас |cFFFF0000|Hspell:285459|h[кольцо мороза]|h|r!', '|TInterface\\ICONS\\Spell_Frost_Ring of Frost.blp:20|t Холодные ветра усиливаются, готовясь обрушить на вас |cFFFF0000|Hspell:285459|h[кольцо мороза]|h|r!', 29981),
(167328, 'ruRU', 'Значит... вот как закончилась охота?', '', 29981),
(167327, 'ruRU', 'Ты у меня на мушке!', '', 29981),
(167326, 'ruRU', 'Ты неплохо сражаешься...', '', 29981),
(167325, 'ruRU', 'А, $r? Что ж, покажи мне, что твое жалкое племя зовет неистовством!', '', 29981),
(167324, 'ruRU', 'Можешь на нас положиться, о минах больше не придется беспокоиться.', '', 29981),
(167323, 'ruRU', '', 'Натанос, Рокхан! Вы должны обезвредить эти мины, пока $n там.', 29981),
(167322, 'ruRU', 'Возьми этот комплект обнаружения и выследи диверсантов, подбирающихся к укреплениям озаренных!', '', 29981),
(167321, 'ruRU', 'К счастью, изобретение гениального механика Гебиша может избавить нас от этого риска!', '', 29981),
(167320, 'ruRU', 'Озаренные доставили сюда тяжелую артиллерию, но от нее не будет проку, если Орда выведет ее из строя!', '', 29981),
(167319, 'ruRU', 'Благодаря моей помощи теперь увеличатель преобразует интеллект в грубую силу.', '', 29981),
(167318, 'ruRU', 'Так как я самый умный среди своих собратьев, стать добровольцем логичнее было мне.', '', 29981),
(167317, 'ruRU', '', 'Мне нравятся эти джунгли. Они лучше моих. В этих джунглях тебя просто все хотят убить и съесть. А в моих самое страшное начинается уже после этого.\n\nИногда я тоскую по дому.', 29981),
(167316, 'ruRU', 'Мне нужно больше горенов.', 'Мне нужно больше горенов.', 29981),
(167315, 'ruRU', '', 'Дворфам Черного Железа удалось быстро устроить базу неподалеку, отрезав нам маршрут снабжения. Эти глупцы считают, что их спасут железные буровые установки.$b$bДворфы обожают железо – почти так же, как вот эти мои маленькие друзья с кислотной слюной.$b$bДоставь туда этих крошек, чтобы они полакомились буровыми установками.', 29981),
(167314, 'ruRU', 'На помощь! Врача! О, подождите...', '', 29981),
(167313, 'ruRU', 'Моя клятва хранить мир к тебе не относится!', '', 29981),
(167312, 'ruRU', 'На помощь!', '', 29981),
(167311, 'ruRU', 'Уберите это от меня!', '', 29981),
(167310, 'ruRU', 'Слава шал\'дорай...', '', 29981),
(167309, 'ruRU', 'Я теряю сосредоточенность! Хорошо же, мои големы будут работать на магии из твоего трупа!', '', 29981),
(167303, 'ruRU', '', 'Ты отлично справился, Рокхан. Мы проведем войско через Назмир, уничтожим флот Альянса и завершим эту войну.', 29981),
(167294, 'ruRU', 'Быстрее: сюда направляются новые ползучие мины!', '', 29981),
(167293, 'ruRU', 'Этот ящик с оружием положит конец любой атаке Орды!', '', 29981),
(167292, 'ruRU', 'Быстрее распакуй мои ботоломы!', '', 29981),
(167291, 'ruRU', 'Орда... все равно... проиграет!', 'Орда... все равно... проиграет!', 29981),
(167290, 'ruRU', 'Сражаться... нет смысла...', 'Сражаться... нет смысла...', 29981),
(167289, 'ruRU', 'Вам никогда... не взять... Назмир...', 'Вам никогда... не взять... Назмир...', 29981),
(167288, 'ruRU', 'Я предоставлю это... остальным...', 'Я предоставлю это... остальным...', 29981),
(167287, 'ruRU', 'Меня предупреждали... об этом...', 'Меня предупреждали... об этом...', 29981),
(167286, 'ruRU', 'За... Альянс!', 'За... Альянс!', 29981),
(167285, 'ruRU', 'Зулдазар... падет!', 'Зулдазар... падет!', 29981),
(167284, 'ruRU', 'Мы уже... победили...', 'Мы уже... победили...', 29981),
(167283, 'ruRU', 'Никто не видит истинную мощь моих трансмутаций. Но я им всем покажу. Скоро они будут уважать меня...$b$bНо если ты $uспособен:способна; узреть величие трансмутации, я могу тебе кое-что поручить.$b$bЗа вознаграждение, разумеется.', '', 29981),
(167280, 'ruRU', '', 'Враги познают нашу ярость.', 29981),
(167279, 'ruRU', '', 'Калдорай выдержат все испытания.', 29981),
(167278, 'ruRU', '', 'Есть время терпеть... и время действовать.', 29981),
(167277, 'ruRU', '', 'Мы сражаемся за свое будущее.', 29981),
(167276, 'ruRU', '', 'Слушай голос Элуны.', 29981),
(167275, 'ruRU', '', 'Пусть Элуна осветит твой путь.', 29981),
(167274, 'ruRU', '', 'Не теряй веру.', 29981),
(167273, 'ruRU', '', 'Ты мне нравишься. Скажи, у тебя нет брата-близнеца?', 29981),
(167272, 'ruRU', '', 'Нет, я не люблю завязывать глаза! Ну... разве что иногда.', 29981),
(167271, 'ruRU', '', 'Послушай моего совета: не пей из магических колодцев. Питье из них вызовет привыкание, а это... уже не модно.', 29981),
(167270, 'ruRU', '', 'Свет Элуны открывает истину.', 29981),
(167269, 'ruRU', '', 'Для меня честь служить Элуне.', 29981),
(167268, 'ruRU', '', 'Я – голос моего народа.', 29981),
(167267, 'ruRU', '', 'Чего ты попросишь у калдорай?', 29981),
(167266, 'ruRU', '', 'Мы – дети Элуны.', 29981),
(167265, 'ruRU', '', 'Ишну\'ала.', 29981),
(167264, 'ruRU', '', 'Богиня дает мне силу.', 29981),
(167262, 'ruRU', '', 'Командование могло бы выделить нам побольше охраны.', 29981),
(167261, 'ruRU', '', 'Где же наше подкрепление?', 29981),
(167260, 'ruRU', '', 'Хуже времени для поломки не придумаешь.', 29981),
(167259, 'ruRU', '', 'Будьте начеку! Нельзя допустить, чтобы этот груз достался Орде!', 29981),
(167258, 'ruRU', 'Время никого не ждет!', '', 29981),
(167257, 'ruRU', 'Не испытывай терпение природы.', '', 29981),
(167256, 'ruRU', 'Время уходит.', '', 29981),
(167255, 'ruRU', 'Попутных тебе ветров!', '', 29981),
(167254, 'ruRU', 'Природа с тобой!', '', 29981),
(167253, 'ruRU', 'Природа укажет тебе путь.', '', 29981),
(167252, 'ruRU', 'Природа слушает тебя.', '', 29981),
(167251, 'ruRU', 'Чем могу помочь?', '', 29981),
(167250, 'ruRU', 'Здравствуй.', '', 29981),
(167248, 'ruRU', '', 'Все пошло не по плану...', 29981),
(167247, 'ruRU', '', 'Никто не смеет трогать мой караван!', 29981),
(167245, 'ruRU', 'Наконец-то смерть. Надеюсь, я останусь... мертвым.', '', 29981),
(167244, 'ruRU', 'О да! Сейчас я испытаю новейший штамм чумы!', '', 29981),
(167243, 'ruRU', '%s переключается с боевого режима на режим диагностики и ремонта.', '', 29981),
(167237, 'ruRU', 'Я возвращаюсь к природе...', '', 29981),
(167236, 'ruRU', 'Проклятый храм! Природа поглотит его!', '', 29981),
(167235, 'ruRU', 'Цикл... продолжается...', '', 29981),
(167233, 'ruRU', 'Не на того напали!', '', 29981),
(167226, 'ruRU', 'За Сильвану!', 'За Сильвану!', 29981),
(167225, 'ruRU', 'Всех нас вы все равно не найдете...', 'Всех нас вы все равно не найдете...', 29981),
(167224, 'ruRU', 'Кул-Тирас падет!', 'Кул-Тирас падет!', 29981),
(167223, 'ruRU', 'За Орду!', 'За Орду!', 29981),
(167222, 'ruRU', 'Лоа... зовут меня домой.', '', 29981),
(167221, 'ruRU', 'Ха-ха-ха! Твоя голова будет отлично смотреться на моем копье!', '', 29981),
(167220, 'ruRU', '', 'Это сумка Тачи – наверняка в ней полно всего полезного!', 29981),
(167219, 'ruRU', 'Кто это вообще придумал?', 'Кто это вообще придумал?', 29981),
(167218, 'ruRU', 'Вот то, что надо!', 'Вот то, что надо!', 29981),
(167217, 'ruRU', 'Люблю запах пороха по утрам!', 'Люблю запах пороха по утрам!', 29981),
(167216, 'ruRU', 'Эй, повнимательнее!', 'Эй, повнимательнее!', 29981),
(167215, 'ruRU', '', 'Я позабочусь о безопасности беглецов. А ты отправляйся в ущелье и расправься со всеми, кто угрожает моему народу!', 29981),
(167214, 'ruRU', 'Жители Вол\'дуна всегда выручают друг друга. Я с тобой!', 'Жители Вол\'дуна всегда выручают друг друга. Я с тобой!', 29981),
(167213, 'ruRU', 'Мне нравится твой стиль боя. Может, я смогу чему-нибудь у тебя научиться.', 'Мне нравится твой стиль боя. Может, я смогу чему-нибудь у тебя научиться.', 29981),
(167212, 'ruRU', 'Вместе мы справимся с любыми испытаниями.', 'Вместе мы справимся с любыми испытаниями.', 29981),
(167211, 'ruRU', 'Я тебя прикрою.', 'Я тебя прикрою.', 29981),
(167210, 'ruRU', 'За вульпер!', 'За вульпер!', 29981),
(167209, 'ruRU', 'Вол\'дун должен стать свободным!', 'Вол\'дун должен стать свободным!', 29981),
(167208, 'ruRU', 'Ниша передает привет.', 'Ниша передает привет.', 29981),
(167207, 'ruRU', 'Вульперы всегда держатся вместе!', 'Вульперы всегда держатся вместе!', 29981),
(167205, 'ruRU', '', 'Вот. Лед задержит их, а мы пока займемся кораблями в бухте.', 29981),
(167203, 'ruRU', '', 'Думаю, я сумею выиграть немного времени.', 29981),
(167200, 'ruRU', '', 'Мы с Телией справились с Ордой на той стороне верфи. Вижу, тебе здесь тоже удалось добиться успеха.', 29981),
(167199, 'ruRU', 'Мы стараемся изо всех сил, но враги все прибывают! Ты можешь задержать их лодки?', 'Мы стараемся изо всех сил, но враги все прибывают! Ты можешь задержать их лодки?', 29981),
(167198, 'ruRU', '', 'Чем я заслужила такой ледяной прием?', 29981),
(167197, 'ruRU', '', 'В Кул-Тирас придет вечная зима!', 29981),
(167196, 'ruRU', '', 'Тебе поможет холод!', 29981),
(167195, 'ruRU', '', 'Холодом повеяло...', 29981),
(167194, 'ruRU', '', 'Отдохни хорошенько, здоровяк. Вряд ли ты когда-нибудь узнаешь, как важна для нас твоя помощь.', 29981),
(167193, 'ruRU', '', 'Предлагаю всем вам немного охладить свой пыл.', 29981),
(167192, 'ruRU', '', 'Гронг навсегда останется в памяти народов как герой Альянса.', 29981),
(167191, 'ruRU', 'Это земли калдорай! Бегите к своей Королеве-банши, пока еще можете!', '', 29981),
(167190, 'ruRU', '', 'Мне больно видеть Гронга в таком состоянии, но ведь он знал, на что идет.', 29981),
(167189, 'ruRU', '', 'Отвага и самоотверженность Гронга достойны восхищения.', 29981),
(167188, 'ruRU', '', 'Изобретение Мэгс и Мортона может изменить ход всей этой войны.', 29981),
(167187, 'ruRU', 'Мойра, я подвел тебя.', '', 29981),
(167186, 'ruRU', 'Пламя Черной горы поглотит тебя! За Альянс!', '', 29981),
(167183, 'ruRU', 'Получай, радиоактивный псих! С помощью особого азеритового залпа Галливикса $p сможет пробить эту твою броню!', '', 29981),
(167182, 'ruRU', '', 'Стоять! Дальше вы не пройдете.', 29981),
(167181, 'ruRU', 'Я убил сотни таких, как ты. В ущелье Песни Войны, на скалах Арати и еще во многих местах! Отправляйся к своим богам!', '', 29981),
(167180, 'ruRU', 'Ха! Это все ничто в сравнении с Альтераком!', '', 29981),
(167179, 'ruRU', 'Земля забирает меня...', '', 29981),
(167178, 'ruRU', 'Моя ярость сокрушит Орду!', '', 29981),
(167177, 'ruRU', 'Вернитесь на фронт в Ясеневом лесу!', '', 29981),
(167176, 'ruRU', 'Да.', 'Да.', 29981),
(167175, 'ruRU', '<Бвонсамди потирает руки.>\n\nО, это будет весело. Свидетель Таланджи, ты объявишь мое решение народу Зандалара?', '', 29981),
(167174, 'ruRU', 'Ну, как души собираются?\n\nНадеюсь, ты ведешь счет, ведь старина Бвонсамди его давно потерял.\n\n<Бвонсамди смеется.>\n\nА если серьезно, я надеюсь, ты еще помнишь о нашей сделке.', '', 29981),
(167172, 'ruRU', 'Да простит меня король...', '', 29981),
(167171, 'ruRU', 'Этот азерит принадлежит Альянсу!', '', 29981),
(167170, 'ruRU', '', 'Это место насквозь пропитано силой. Здешние духи могущественны, но... они не свободны. В некрополе Бвонсамди я слышу голоса, но здесь что-то иное. Как будто... их силу на что-то направляют.\n\nНам нужно спешить. Я чувствую себя незваным гостем – в это место живым лучше даже не заглядывать.\n\nСкажи, когда у тебя все будет готово, и мы продолжим.', 29981),
(167169, 'ruRU', 'Барабаны зовут меня домой...', '', 29981),
(167168, 'ruRU', 'Барабаны войны зовут!', '', 29981),
(167167, 'ruRU', '|TInterface\\ICONS\\Spell_Shaman_HighTide:20|tЛаминария использует заклинание |cFFFF0000|Hspell:284760|h[Смывающая волна]|h|r!', '', 29981),
(167166, 'ruRU', '|TInterface\\ICONS\\SPELL_NATURE_LIGHTNINGOVERLOAD:20|tНа вас действует |cFFFF0000|Hspell:285350|h[Вой бури]|h|r!', '|TInterface\\ICONS\\SPELL_NATURE_LIGHTNINGOVERLOAD:20|tНа вас действует |cFFFF0000|Hspell:285350|h[Вой бури]|h|r!', 29981),
(167165, 'ruRU', 'Корни Ону выводят из строя ваш крошшер!', '', 29981),
(167164, 'ruRU', '', 'Ну, все готово – можно приступать к старой доброй вырубке лесов, босс!', 29981),
(167163, 'ruRU', 'Дай мне припасы. Я буду защищать вульпер!', 'Дай мне припасы. Я буду защищать вульпер!', 29981),
(167162, 'ruRU', '', 'Они умрут точно так же, как сетраки. Как все притеснители вульпер!', 29981),
(167161, 'ruRU', '', 'Ты только посмотри на это, $p!\n\nЭти караванщики были повинны лишь в том, что согласились перевезти припасы за хорошую плату.\n\nМы, вульперы, были вольными торговцами много поколений. Почему Альянс думает, что мы будем отказываться от работы лишь потому, что им не нравятся те, кто нам ее предлагает?\n\nАльянс ничем не лучше сетраков... А с сетраками, как ты знаешь, у меня разговор короткий.\n\nНу что, ты со мной? Возьми все необходимое из моих запасов – и ты сможешь сражаться, как настоящая вульпера!', 29981),
(167160, 'ruRU', 'Пусть меня заберут пески!', '', 29981),
(167159, 'ruRU', 'Я похороню тебя в этих песках!', '', 29981),
(167158, 'ruRU', 'Пора испытать мои новые изобретения!', 'Пора испытать мои новые изобретения!', 29981),
(167157, 'ruRU', 'Мы выполним приказ Меггакрута и уничтожим вас!', 'Мы выполним приказ Меггакрута и уничтожим вас!', 29981),
(167156, 'ruRU', 'Орде здесь не место, мы вышвырнем вас отсюда!', 'Орде здесь не место, мы вышвырнем вас отсюда!', 29981),
(167155, 'ruRU', 'Мы не дадим култирасцев в обиду!', 'Мы не дадим култирасцев в обиду!', 29981),
(167154, 'ruRU', 'Нам просто нужно закончить то, что начал Меггакрут!', 'Нам просто нужно закончить то, что начал Меггакрут!', 29981),
(167153, 'ruRU', 'Меггакрут предупредил нас насчет Орды, и мы подготовились!', 'Меггакрут предупредил нас насчет Орды, и мы подготовились!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(167152, 'ruRU', 'Тебя все еще не убили? Что ж, я могу это исправить.', 'Тебя все еще не убили? Что ж, я могу это исправить.', 29981),
(167151, 'ruRU', 'Вы заплатите за то, что сунулись сюда!', 'Вы заплатите за то, что сунулись сюда!', 29981),
(167150, 'ruRU', 'Ты сдохнешь, как и вся твоя Орда!', 'Ты сдохнешь, как и вся твоя Орда!', 29981),
(167149, 'ruRU', 'Наши союзники гномы быстро с вами расправятся.', 'Наши союзники гномы быстро с вами расправятся.', 29981),
(167148, 'ruRU', 'Войска Меггакрута вас уничтожат!', 'Войска Меггакрута вас уничтожат!', 29981),
(167147, 'ruRU', 'Ордынские псы, мы прикончим вас, как прикончили прихвостней Эшвейн!', 'Ордынские псы, мы прикончим вас, как прикончили прихвостней Эшвейн!', 29981),
(167146, 'ruRU', 'Дозорный Холм принадлежит Кул-Тирасу!', 'Дозорный Холм принадлежит Кул-Тирасу!', 29981),
(167145, 'ruRU', 'Я не затем выдворял отсюда пиратов Эшвейн, чтобы их место заняла Орда!', 'Я не затем выдворяла отсюда пиратов Эшвейн, чтобы их место заняла Орда!', 29981),
(167144, 'ruRU', 'Кул-Тирас освободился от гнета Эшвейн – справится и с Ордой!', 'Кул-Тирас освободился от гнета Эшвейн – справится и с Ордой!', 29981),
(167143, 'ruRU', 'Картер Риптайд не подает признаков жизни.', 'Картер Риптайд не подает признаков жизни.', 29981),
(167142, 'ruRU', '', 'Я хочу испытать решительность Таланджи. Я знаю, что у тебя ее не занимать, но меня порадует, если ты к ней присоединишься.\n\nТы $gготов:готова; к испытанию?', 29981),
(167141, 'ruRU', '', 'Неужели это бескрылое чудо $n?\n\nТаланджи до крайности предсказуема в выборе свидетелей. Ради нее я даже изображу удивление.', 29981),
(167140, 'ruRU', 'Теперь тебя испытает Па\'ку. Будь сильной, Таланджи.', '', 29981),
(167139, 'ruRU', '', 'Зандалар... принадлежит Орде.', 29981),
(167138, 'ruRU', '', 'Мои кролуски уничтожат вас!', 29981),
(167135, 'ruRU', 'Я хочу задать Таланджи один вопрос. Постоишь и послушаешь?', '', 29981),
(167134, 'ruRU', 'Таланджи мудро выбрала своего свидетеля.', '', 29981),
(167133, 'ruRU', '', 'Идем, $n.', 29981),
(167132, 'ruRU', 'Следующим тебя испытает Гонк. Удачи, Таланджи.', '', 29981),
(167131, 'ruRU', '', 'Прочь! Кыш!', 29981),
(167130, 'ruRU', '', 'Не останавливайся!', 29981),
(167129, 'ruRU', '', 'Я не дам вам съесть свидетеля!', 29981),
(167128, 'ruRU', '', 'Держись, еще немного!', 29981),
(167127, 'ruRU', '', 'Назад, жаба!', 29981),
(167126, 'ruRU', '', 'Убирайся!', 29981),
(167124, 'ruRU', 'Скоро наступаем. За Орду!', '', 29981),
(167123, 'ruRU', 'Мы обрушим на врага всю ярость наших виверн. И будем сеять разрушение на своем пути.', '', 29981),
(167122, 'ruRU', 'Вождь сказала, что мы скоро наступаем. Они и опомниться не успеют.', '', 29981),
(167121, 'ruRU', 'Мне здорово досталось от этих головорезов из Альянса... Я уж думал, мне конец.', 'Мне здорово досталось от этих головорезов из Альянса... Я уж думала, мне конец.', 29981),
(167120, 'ruRU', 'Милая шляпка. Наверное, тебя прислала Ниша.', 'Милая шляпка. Наверное, тебя прислала Ниша.', 29981),
(167119, 'ruRU', 'Мне не хотелось принимать чью-то сторону в этой войне... но Орда по крайней мере нас не убивает!', 'Мне не хотелось принимать чью-то сторону в этой войне... но Орда по крайней мере нас не убивает!', 29981),
(167118, 'ruRU', 'Я хотел им все объяснить, но они и слушать не стали!', 'Я хотела им все объяснить, но они и слушать не стали!', 29981),
(167117, 'ruRU', 'Я у тебя в долгу.', 'Я у тебя в долгу.', 29981),
(167116, 'ruRU', 'Как будто нам было мало проблем с сетраками... а теперь еще и Альянс нападает?!', 'Как будто нам было мало проблем с сетраками... а теперь еще и Альянс нападает?!', 29981),
(167115, 'ruRU', 'Э-э, странно... Кто вообще установил это в моего робота?! Надо бы это выяснить... Только никому не говори. Никому, слышишь?', '', 29981),
(167114, 'ruRU', 'Помни, Джастор, ты умный и способный – все вокруг просто обязаны тебя любить!', '', 29981),
(167113, 'ruRU', 'Я просто занимался своими делами, как вдруг эти ублюдки из Альянса ни с того ни с сего на меня набросились!', 'Я просто занималась своими делами, как вдруг эти ублюдки из Альянса ни с того ни с сего на меня набросились!', 29981),
(167112, 'ruRU', '$pr, спасибо тебе... Эти люди хотели меня убить!', '$pr, спасибо тебе... Эти люди хотели меня убить!', 29981),
(167111, 'ruRU', 'Вернитесь в Рощу Древних!', '', 29981),
(167110, 'ruRU', 'Я умираю во имя Орды...', '', 29981),
(167109, 'ruRU', 'Небо принадлежит Черному копью!', '', 29981),
(167108, 'ruRU', '$p, позаботься о том, чтобы остальные замороженные дирижабли разлетелись на мелкие кусочки. Я вернусь к Розалине и Вольным гарпунщикам.', '', 29981),
(167107, 'ruRU', 'Получилось! Изобретательность побеждает грубую силу!', '', 29981),
(167106, 'ruRU', 'Взять топливный насос.', 'Взять топливный насос.', 29981),
(167105, 'ruRU', 'Без топлива ничего гореть не будет – наверное, здесь его полно! \n\nВот только эти сектанты не дают нам здесь заправляться.', '', 29981),
(167104, 'ruRU', 'Критическая ошибка: в ядре обнаружено неизвестное вещество.', '', 29981),
(167103, 'ruRU', 'Обнаружены враждебные цели. Режим уничтожения активирован. Освободите территорию.', '', 29981),
(167102, 'ruRU', 'Мы будем уничтожать их на земле, в небе и в море!', '', 29981),
(167101, 'ruRU', 'Пусть сила вождя сокрушит их!', '', 29981),
(167100, 'ruRU', 'Пусть горят в адском пламени!', '', 29981),
(167099, 'ruRU', 'Скормите мое тело... волкам.', '', 29981),
(167098, 'ruRU', 'Я тебя на корм волкам пущу!', '', 29981),
(167097, 'ruRU', 'Желчетоп... больше не топ?', '', 29981),
(167096, 'ruRU', 'Желчь. Топтать!', '', 29981),
(167095, 'ruRU', 'Похоже, в ГМЖС почти закончился азерит. Нам нужно заправиться.', 'Похоже, в ГМЖС почти закончился азерит. Нам нужно заправиться.', 29981),
(167094, 'ruRU', '<Вы бросаете взгляд на руководство, написанное какими-то криворукими недомеханиками, и выбрасываете его. Вы – один из ведущих гоблинских инженеров, и вам не нужно какое-то там руководство!\n\nВ конце концов вы находите измерительный прибор с надписью \"Азерит\" и замечаете, что индикатор уже близок к значению \"Совсем пусто, босс\".>', '<Вы бросаете взгляд на руководство, написанное какими-то криворукими недомеханиками, и выбрасываете его. Вы и так знаете, что надо делать!\n\nПоковырявшись в разных частях робота, вы задумались: а можно ли вообще разобраться в том, что сконструировал другой гоблин?\n\nВ конце концов вы находите измерительный прибор с надписью \"Азерит\" и замечаете, что его индикатор уже близок к значению \"Совсем пусто, босс\".>', 29981),
(167093, 'ruRU', '<Вы бросаете взгляд на руководство, написанное какими-то криворукими недомеханиками, и выбрасываете его. Вы и так знаете, что надо делать!\n\nПоковырявшись в разных частях робота, вы задумались: а можно ли вообще разобраться в том, что сконструировал другой гоблин?\n\nВ конце концов вы находите измерительный прибор с надписью \"Азерит\" и замечаете, что его индикатор уже близок к значению \"Совсем пусто, босс\".>', '<Вы бросаете взгляд на руководство, написанное какими-то криворукими недомеханиками, и выбрасываете его. Вы и так знаете, что надо делать!\n\nПоковырявшись в разных частях робота, вы задумались: а можно ли вообще разобраться в том, что сконструировал другой гоблин?\n\nВ конце концов вы находите измерительный прибор с надписью \"Азерит\" и замечаете, что его индикатор уже близок к значению \"Совсем пусто, босс\".>', 29981),
(167092, 'ruRU', '<Вы думали, что ваши познания в области инженерии помогут разобраться в передовых гоблинских технологиях, но увы, этого оказалось недостаточно.\n\nВ этом руководстве одни противоречия – на каждой странице, в каждом предложении. Просто чудо, что механизм вообще работает.\n\nВы заканчиваете чтение. Если не переделывать все заново, то можно только пополнить запасы азерита, уровень которого сейчас на опасно низкой отметке.>', '<Вы думали, что ваши познания в области инженерии помогут разобраться в передовых гоблинских технологиях, но увы, этого оказалось недостаточно.\n\nВ этом руководстве одни противоречия – на каждой странице, в каждом предложении. Просто чудо, что механизм вообще работает.\n\nВы заканчиваете чтение. Если не переделывать все заново, то можно только пополнить запасы азерита, уровень которого сейчас на опасно низкой отметке.>', 29981),
(167091, 'ruRU', '<Вы внимательно читаете руководство по эксплуатации ГМЖС. \n\nВам приходится сделать это несколько раз, поскольку описание гоблинского изобретения на гоблинском жаргоне малочитаемо.\n\nТем не менее вы, как можете, проверяете системы ГМЖС. \n\nО главной проблеме красноречиво свидетельствует шкала с надписью \"Азерит\". Указатель на ней уже близок к отметке \"Совсем пусто\".>', '<Вы внимательно читаете руководство по эксплуатации ГМЖС. \n\nВам приходится сделать это несколько раз, поскольку описание гоблинского изобретения на гоблинском жаргоне малочитаемо.\n\nТем не менее вы, как можете, проверяете системы ГМЖС. \n\nО главной проблеме красноречиво свидетельствует шкала с надписью \"Азерит\". Указатель на ней уже близок к отметке \"Совсем пусто, босс\".>', 29981),
(167090, 'ruRU', 'Этот ГМЖС великолепен, да?', '', 29981),
(167089, 'ruRU', '<Вы открываете руководство по эксплуатации ГМЖС и начинаете проверку.>', '<Вы открываете руководство по эксплуатации ГМЖС и начинаете проверку.>', 29981),
(167088, 'ruRU', 'Ну? Чего ты ждешь, эта штука сама себя не отремонтирует!\n\nПостой-ка... Может, мне вложиться в функцию саморемонта? Галливикс, ты гений!\n\nЭто была твоя реплика, $n.', '', 29981),
(167087, 'ruRU', 'Смотри не сломай!', '', 29981),
(167086, 'ruRU', 'Мы украли... э-э... то есть сконструировали эту штуку специально для тебя!', '', 29981),
(167085, 'ruRU', 'Хочешь поохотиться там за головами? Я бы тоже с тобой поехал. Но прямо сейчас не могу.\n\nИди в порт и ищи там корабль Отрекшихся – \"Вой банши\". Уродливая штука, но через океан запросто перевезет. Поговори с жутким адмиралом Тэттерсейл.', 'Хочешь поохотиться там за головами? Я бы тоже с тобой поехала. Но прямо сейчас не могу.\n\nИди в порт и ищи там корабль Отрекшихся – \"Вой банши\". Уродливая штука, но через океан запросто перевезет. Поговори с жутким адмиралом Тэттерсейл.', 29981),
(167084, 'ruRU', 'Хочешь захватить Кул-Тирас? Говорят, култирасцы очень высокомерны... Ну, может, не так, как гилнеасцы, но близко к тому.\n\nОтправляйся в порт, это к югу отсюда. Поговори с жутким адмиралом Тэттерсейл на \"Вое банши\".\n\nИ будь начеку.', 'Хочешь захватить Кул-Тирас? Говорят, култирасцы очень высокомерны... Ну, может, не так, как гилнеасцы, но близко к тому.\n\nОтправляйся в порт, это к югу отсюда. Поговори с жутким адмиралом Тэттерсейл на \"Вое банши\".\n\nИ будь начеку.', 29981),
(167083, 'ruRU', 'Корабль в Кул-Тирас', 'Корабль в Кул-Тирас', 29981),
(167082, 'ruRU', 'Корабль в Зандалар', 'Корабль в Зандалар', 29981),
(167081, 'ruRU', 'Зандалар, говоришь? Великая империя троллей. Вот что я думаю о них и их флоте.\n\n<сплевывает>\n\nОтправляйся в гавань, к верховному адмиралу Джес-Терет.\n\nЗадай им там жару.', 'Зандалар, говоришь? Великая империя троллей. Вот что я думаю о них и их флоте.\n\n<сплевывает>\n\nОтправляйся в гавань, к верховному адмиралу Джес-Терет.\n\nЗадай им там жару.', 29981),
(167077, 'ruRU', 'Но раз вы так ждете встречи с Бвонсамди... подходите. Лоа смерти примет всех!', '', 29981),
(167076, 'ruRU', '', '$p, я перемещу тебя к Вольным гарпунщикам на южный берег.', 29981),
(167075, 'ruRU', '', 'Дай мне знать, когда подготовишься.', 29981),
(167074, 'ruRU', '', 'Как приготовишься, можешь начинать.', 29981),
(167073, 'ruRU', 'С Фиксдраном они разобрались, давай займемся остатками армии на передовой!', '', 29981),
(167072, 'ruRU', '', 'Конечно. Я хранила ее здесь.', 29981),
(167070, 'ruRU', '|TInterface\\Icons\\Spell_winston_bubble:20|t|cFFFF0000%s|r активирует Трезубец Океанских Глубин!', '', 29981),
(167069, 'ruRU', '|TInterface\\Icons\\ABILITY_VEHICLE_ELECTROCHARGE:20|t|cFFFF0000%s|r активирует Глашатай Бури!', '', 29981),
(167068, 'ruRU', '|TInterface\\Icons\\Spell_Priest_Void Blast:20|t|cFFFF0000%s|r активирует Камень Бездны!', '', 29981),
(167067, 'ruRU', '|TInterface\\Icons\\SPELL_SHADOW_POSSESSION:20|t|cFFFF0000%s|r начинает применять |cFFFF0000|Hspell:282517|h[Ужасающее эхо]|h|r!', '', 29981),
(167066, 'ruRU', '', 'Он... уничтожен?..', 29981),
(167060, 'ruRU', 'Должно быть, я ошибся в расчетах!', '', 29981),
(167059, 'ruRU', 'От таких примитивных созданий, как ты, ничего другого можно и не ждать!', '', 29981),
(167058, 'ruRU', 'Да.', 'Да.', 29981),
(167057, 'ruRU', 'Ты будешь сражаться с нами сегодня?', '', 29981),
(167056, 'ruRU', '', 'До свиданья, друг.', 29981),
(167055, 'ruRU', 'Пророк, прости меня.', '', 29981),
(167054, 'ruRU', 'Думаете, что остановите нас?! Если так, то вас ждет смерть.', '', 29981),
(167053, 'ruRU', 'Босс $p! Срочно нужна помощь. У нас тут куча роботов – тянутся до самого перевала Арома!', '', 29981),
(167052, 'ruRU', 'Испытание Краг\'вы еще не закончено. Вернитесь к Таланджи.', 'Испытание Краг\'вы еще не закончено. Вернитесь к Таланджи.', 29981),
(167051, 'ruRU', '$n, ты $gготов:готова; мне помочь?', '', 29981),
(167050, 'ruRU', 'Рад снова видеть тебя, $n. Вместе мы раздавили немало врагов.', '', 29981),
(167049, 'ruRU', 'Битва за Лордерон была моим первым сражением. Когда армия Альянса подошла к стенам... скажем так, это изрядно меня взволновало.\n\nА потом я увидел Саурфанга. Этот орк выиграл тысячу битв! В его глазах не было ни тени страха... разве что пустота.\n\nВерховный воевода придал мне смелости. Мы напомнили друг другу, что Орда объединена одной высокой целью, за которую стоит сражаться.\n\nУж я не брошу его одного. Мы нужны Саурфангу!', '', 29981),
(167048, 'ruRU', '', 'Надежда не умрет.', 29981),
(167047, 'ruRU', '', 'Зулдазар падет!', 29981),
(167046, 'ruRU', 'У тебя просто талант спасать жизни. Тебе за это платят? Нет, ну признайся – сколько?', '', 29981),
(167045, 'ruRU', 'Мама всегда говорила, что я сгину среди какой-нибудь гадости из крови планеты. И видать, она опять ошиблась!', '', 29981),
(167044, 'ruRU', 'Надо было читать договор, прежде чем подписывать. Да чего там, надо было хоть читать научиться...', '', 29981),
(167043, 'ruRU', 'Лучше бы им засчитать это как сверхурочные! Да кого я обманываю, мне это и в рабочее время никто не засчитает.', '', 29981),
(167042, 'ruRU', 'Кажется, я наглотался азерита. Значит, я теперь азеритовый гоблин?', '', 29981),
(167041, 'ruRU', 'Спасибо, у меня даже нет денег на адвоката!', '', 29981),
(167040, 'ruRU', 'Ну, видимо, на этот раз я не буду подавать в суд!', '', 29981),
(167039, 'ruRU', 'Я сражался вместе с Саурфангом в битве за Подгород. \n\nЕсли бы не он, меня бы сейчас здесь не было.\n\nЯ не допущу, чтобы мы его потеряли.', '', 29981),
(167038, 'ruRU', '', '$p, возьми моего элементаля – он тебе поможет.', 29981),
(167037, 'ruRU', '', 'Есть, лорд-адмирал.', 29981),
(167036, 'ruRU', 'Тебе меня не напугать, нечестивое создание!', '', 29981),
(167035, 'ruRU', 'Народ Друствара... отомстит... за меня...', '', 29981),
(167034, 'ruRU', 'Эти земли будут очищены от вашего гнусного колдовства!', '', 29981),
(167033, 'ruRU', '$R, есть новости с фронта?', '', 29981),
(167032, 'ruRU', '<Скулит и повизгивает>', '<Скулит и повизгивает>', 29981),
(167031, 'ruRU', 'Ладно, я займусь этим сам! И под этим я подразумеваю, что за меня дело сделает $p.', '', 29981),
(167030, 'ruRU', '|TInterface\\ICONS\\SPELL_FROST_ICESHARD.BLP:20|t Отойдите подальше от босса во время применения |cFFF00000|Hspell:287565|h[Ледяного копья]|h|r, чтобы избежать урона!', '|TInterface\\ICONS\\SPELL_FROST_ICESHARD.BLP:20|t Отойдите подальше от босса во время применения |cFFF00000|Hspell:287565|h[Ледяного копья]|h|r, чтобы избежать урона!', 29981),
(167029, 'ruRU', 'Пусть мое тело... скормят зверям...', '', 29981),
(167028, 'ruRU', 'Эти звери разорвут вас на части!', '', 29981),
(167027, 'ruRU', 'Босс, мы об этом говорим уже пятый раз. Уж не знаю, почему вы решили, будто что-то изменится, если все время спрашивать меня об одном и том же.', '', 29981),
(167026, 'ruRU', 'Что значит – работы прекратились из-за азеритовой гадости, появившейся из-под земли?!', '', 29981),
(167025, 'ruRU', '', 'Вам нас не остановить. Ничто не сравнится... с силой льва.', 29981),
(167024, 'ruRU', '', 'Нет! Мой транспортер почти готов!', 29981),
(167020, 'ruRU', '', 'Хорошо. Соберите всех на вершине Занчула. А мне пора предстать перед лоа.', 29981),
(167019, 'ruRU', '', 'Нет. Белая Вдова не успела нам навредить.', 29981),
(167018, 'ruRU', '', 'Будь рядом, когда я буду обращаться к Совету. Мне крайне важно заручиться его поддержкой перед грядущим испытанием.\n\nСкажи мне, когда будешь $gготов:готов; принять участие в этой официальной процедуре.', 29981),
(167014, 'ruRU', 'Так. Давай не будем разбрасываться обвинениями. Лучше поговорим наедине.', '', 29981),
(167013, 'ruRU', 'Шпион Альянса! Ты пойдешь со мной или умрешь!', 'Шпион Альянса! Ты пойдешь со мной или умрешь!', 29981),
(167012, 'ruRU', 'Гм... огр Локер... Брат из Орды?', '', 29981),
(167011, 'ruRU', 'Вы сгорите... в огне нашей ярости...', '', 29981),
(167010, 'ruRU', 'Вы и не заметите, как мы вас уничтожим!', '', 29981),
(167009, 'ruRU', '|TInterface\\Icons\\INV_Misc_Herb_AncientLichenPetal.blp:20|tКора Ивуса |cFFFF0000|Hspell:287554|h[окаменела]|h|r. Победите чумников, чтобы заклинание перестало действовать!', '', 29981),
(167008, 'ruRU', '', 'Големом управляют заключенные в ядре души! Его нужно уничтожить!', 29981),
(167007, 'ruRU', '', 'Хм... Что-то не так...', 29981),
(167006, 'ruRU', '', 'Если мы все сделали верно, то ядро должно скрепить все части голема и оживить его.', 29981),
(167005, 'ruRU', 'Стихии... заберут меня...', '', 29981),
(167004, 'ruRU', 'Я утоплю тебя, жалкое отребье!', '', 29981),
(167003, 'ruRU', 'Хорошо, азерит теперь у нас. Но где канониры?', '', 29981),
(167002, 'ruRU', 'Я рад, что ритуал очищения не оказался для тебя смертельным. Либо это признак завидной выносливости, либо тебе очень повезло.', '', 29981),
(167001, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(167000, 'ruRU', '%s начинает светиться.', '%s начинает светиться.', 29981),
(166999, 'ruRU', '', 'Помести руническое силовое ядро туда, где должно быть сердце голема.', 29981),
(166998, 'ruRU', '', 'Соедини конечности и прикрепи их к туловищу паутиной.', 29981),
(166995, 'ruRU', '', 'Для начала нужно сложить тело из кусков дерева.', 29981),
(166994, 'ruRU', '', 'Я так взволнована! Давай же приступим!', 29981),
(166993, 'ruRU', '', 'Какой красивый холм. Пойду туда.', 29981),
(166992, 'ruRU', '', 'Что это за звук? Такой прекрасный... Надо найти его источник...', 29981),
(166991, 'ruRU', 'Оттуда пахнет чем-то вкусным. Может, если я вежливо попрошу, мне дадут попробовать...', '', 29981),
(166990, 'ruRU', 'Отлично!', 'Отлично!', 29981),
(166989, 'ruRU', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на центральную дорогу!', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на центральную дорогу!', 29981),
(166988, 'ruRU', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на восточную дорогу!', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на восточную дорогу!', 29981),
(166987, 'ruRU', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на западную дорогу!', '|A:Warfront-HordeWave3:25:23:0:0|aОрда отправила штурмовой отряд на западную дорогу!', 29981),
(166985, 'ruRU', '', 'Получать новые знания, исследовать новые берега и помогать нашим ближним!', 29981),
(166984, 'ruRU', 'Приказ получен.', '', 29981),
(166983, 'ruRU', '', 'Прости, но сейчас все места заняты стражниками.\n\nНе знаю, откуда у них золото, но прошлой ночью они вдруг заселились во все свободные комнаты, даже их капитан был здесь.\n\nА одного из них еще и стошнило, мне наутро пришлось все тут отмывать.', 29981),
(166982, 'ruRU', 'Мне кажется, это очень высокие цели, мэм.', 'Мне кажется, это очень высокие цели, мэм.', 29981),
(166981, 'ruRU', '', 'Маленькая дрянь. Тебя мама не учила, что взрослых надо уважать?', 29981),
(166980, 'ruRU', '', 'Праудмур скоро вычистит тут всю грязь, а мы наконец-то можем заняться по-настоящему важными делами.', 29981),
(166979, 'ruRU', '', 'Да, и не один. Если хочешь на них взглянуть, поднимись по лестнице.\n\nПрости, меня ждут клиенты.', 29981),
(166978, 'ruRU', 'В вашем трактире сейчас остановились стражники?', 'В вашем трактире сейчас остановились стражники?', 29981),
(166977, 'ruRU', 'А что так грубо?', 'А что так грубо?', 29981),
(166976, 'ruRU', 'Нам нужна комната.', 'Нам нужна комната.', 29981),
(166975, 'ruRU', '', 'И вот я тут вся в саже гоняю недобитых эшвейновских прихвостней.', 29981),
(166974, 'ruRU', '', 'Мы тебя отправим на другой пост, говорили они. Рядом с морем, говорили они!', 29981),
(166973, 'ruRU', 'Увидишь эшвейновских прихлебал – шли их ко мне! Я им покажу, что почем!', '', 29981),
(166972, 'ruRU', '', 'Привет, малышка. Не отвлекай меня, пожалуйста. Мы тут немного заняты.', 29981),
(166971, 'ruRU', 'Даджинго свое отдинозаврил...', '', 29981),
(166970, 'ruRU', 'Даджинго пора динозаврить!', '', 29981),
(166969, 'ruRU', '', '<Дарси обеспокоенно смотрит на Лиану.>\n\nВоспитанные девочки такого не говорят, милая.\n\n<Дарси поворачивается к Лиане.>\n\nУверена, это просто переходный возраст.', 29981),
(166968, 'ruRU', '', 'Ох, бедняжка! Все в порядке. Ты испугалась? \n\nОдин дозорный не рассчитал свои силы, и ему пришлось лечь поспать.\n\nЯ уложила его в кроватку в таверне, не волнуйся.', 29981),
(166967, 'ruRU', 'О, это еще не конец! Я вернусь!', 'О, это еще не конец! Я вернусь!', 29981),
(166966, 'ruRU', '', 'Ох да, бедняжка!\n\nОн мне все время хотел что-то сказать, да только так мямлил и заикался, что я не разобрала ни единого слова. Вроде что-то про рагу.\n\nЯ отвела его в таверну в Приозерье и уложила спать.\n\nНадеюсь, ему сегодня уже получше.', 29981),
(166965, 'ruRU', 'Слава Королеве-банши!', 'Слава Королеве-банши!', 29981),
(166964, 'ruRU', 'Что произошло прошлой ночью?', 'Что произошло прошлой ночью?', 29981),
(166963, 'ruRU', 'Один из дозорных сказал, что прошлой ночью ты о нем позаботилась. Это было очень мило!', 'Один из дозорных сказал, что прошлой ночью ты о нем позаботилась. Это было очень мило!', 29981),
(166962, 'ruRU', '', 'Ой, какой милый ангелочек! Какие у тебя щечки!', 29981),
(166961, 'ruRU', '', 'Привет! Не обращай внимания на беспорядок, мне приходится кормить целую ораву голодных солдат!', 29981),
(166960, 'ruRU', '', 'Я готова... к истинной смерти!', 29981),
(166959, 'ruRU', '', 'Сила Темной Госпожи сокрушит вас всех!', 29981),
(166958, 'ruRU', '', 'Займись минами. На этот раз мы должны победить!', 29981),
(166957, 'ruRU', '', 'У нас еще полно работающих мин. Возьмем их числом!', 29981),
(166956, 'ruRU', 'Я... гм, потерял зелье...', 'Я... гм, потеряла зелье...', 29981),
(166955, 'ruRU', '', 'Да? В чем дело?', 29981),
(166954, 'ruRU', '', 'Теперь мне нужно взять голема под контроль.', 29981),
(166953, 'ruRU', '', 'Сработало! Я в тебя верила!', 29981),
(166952, 'ruRU', 'Бзз... Все системы в норме... Сзз...', '', 29981),
(166951, 'ruRU', 'Сзз... АЕ-35 готов к работе... Сзз...', '', 29981),
(166950, 'ruRU', 'Я готов к работе... фзз...', '', 29981),
(166949, 'ruRU', 'Бзз... Системы готовы!', '', 29981),
(166948, 'ruRU', 'Достойная воина смерть!', '', 29981),
(166947, 'ruRU', 'ТЫ НЕ ПРОЙТИ ВОЛ\'ГАРА!', '', 29981),
(166946, 'ruRU', 'Стой смирно. Я должен изгнать из тебя скверну Н\'Зота.', '', 29981),
(166945, 'ruRU', 'Зло, что пытается управлять тобой, должно быть изгнано. Мне известен ритуал, который может помочь, но он будет... болезненным.', '', 29981),
(166944, 'ruRU', 'ПЕРЕХОДНЫЙ РОЛИК ВОСПРОИЗВОДИТСЯ ЗДЕСЬ', 'ПЕРЕХОДНЫЙ РОЛИК ВОСПРОИЗВОДИТСЯ ЗДЕСЬ', 29981),
(166943, 'ruRU', 'Нет! За это бы дорого... заплатили.', '', 29981),
(166942, 'ruRU', 'Зачем ты меня отвлекаешь?! Я же собираю ценную информацию!', '', 29981),
(166941, 'ruRU', 'Мы остановим вас!', 'Мы остановим вас!', 29981),
(166940, 'ruRU', 'Орда будет уничтожена!..', 'Орда будет уничтожена!..', 29981),
(166939, 'ruRU', 'За Штормград... за короля Андуина!', 'За Штормград... за короля Андуина!', 29981),
(166938, 'ruRU', 'Я умираю... за Альянс!', 'Я умираю... за Альянс!', 29981),
(166937, 'ruRU', 'Мы... не оставим... Кул-Тирас!..', 'Мы... не оставим... Кул-Тирас!..', 29981),
(166936, 'ruRU', 'Сильвана... не... победит...', 'Сильвана... не... победит...', 29981),
(166935, 'ruRU', 'Кул-Тирас... сокрушит вас...', 'Кул-Тирас... сокрушит вас...', 29981),
(166934, 'ruRU', 'Вам... ни за что...', 'Вам... ни за что...', 29981),
(166933, 'ruRU', 'За... мою... семью...', 'За... мою... семью...', 29981),
(166932, 'ruRU', 'Я подвел... леди Праудмур...', 'Я подвела... леди Праудмур...', 29981),
(166931, 'ruRU', 'Меня убил... убийца Дэлина...', 'Меня убил... убийца Дэлина...', 29981),
(166930, 'ruRU', 'За Кул-Тирас...', 'За Кул-Тирас...', 29981),
(166929, 'ruRU', 'Мы... остановим вас!', 'Мы... остановим вас!', 29981),
(166928, 'ruRU', 'Свет отвернется от вас!', 'Свет отвернется от вас!', 29981),
(166927, 'ruRU', 'Орда не победит!', 'Орда не победит!', 29981),
(166926, 'ruRU', 'Орда... заплатит...', 'Орда... заплатит...', 29981),
(166925, 'ruRU', 'Свет... не угаснет...', 'Свет... не угаснет...', 29981),
(166924, 'ruRU', 'Мы очистим мир... от Орды...', 'Мы очистим мир... от Орды...', 29981),
(166923, 'ruRU', 'Я готов приступить к ритуалу.', 'Я готова приступить к ритуалу.', 29981),
(166922, 'ruRU', 'Здесь действует темное вуду... Это будет непросто.', '', 29981),
(166921, 'ruRU', '|TInterface\\ICONS\\Ability_Creature_Amber_02.blp:20|t Вы покрыты |cFFFF0000|Hspell:287072|h[жидким золотом]|h|r!', '|TInterface\\ICONS\\Ability_Creature_Amber_02.blp:20|t Вы покрыты |cFFFF0000|Hspell:287072|h[жидким золотом]|h|r!', 29981),
(166920, 'ruRU', 'Эй, внизу, поберегись!', 'Эй, внизу, поберегись!', 29981),
(166919, 'ruRU', 'Сбросить бомбы!', 'Сбросить бомбы!', 29981),
(166918, 'ruRU', '', 'Как тебе мой новый совет, $n?', 29981),
(166913, 'ruRU', '', 'Король Растахан окружал себя предателями. Таланджи выбрала советников с умом.', 29981),
(166911, 'ruRU', '', 'Наша новая стая разрастается с каждым днем.', 29981),
(166910, 'ruRU', 'Рад снова видеть тебя, $n.\n\n<Верховный ведун Раал указывает на других советников.>\n\nДля зандаларов настали странные времена. В обычной ситуации я бы выступил против изгнанницы и тортоллана в Совете, но после всего случившегося нам, наверное, не помешают перемены.', '', 29981),
(166909, 'ruRU', 'Ясно.', 'Ясно.', 29981),
(166908, 'ruRU', 'Встретимся на месте.', '', 29981),
(166907, 'ruRU', '', 'Орда нас... не победит...', 29981),
(166906, 'ruRU', '', 'Мы прогнали Эшвейнов не для того, чтобы на их место явилась Орда!', 29981),
(166904, 'ruRU', '', 'Добро пожаловать в Мугамбалу. Когда мы узнали про это место, мне сразу захотелось устроить тут пикник! Смотри, вот тут можно расстелить матрасик или коврик. Располагайся поудобнее и купи что-нибудь выпить, не стесняйся.', 29981),
(166900, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(166899, 'ruRU', 'Ты $gготов:готова; отправиться в путь?', '', 29981),
(166898, 'ruRU', '', 'Больше подопытных, больше испытаний!', 29981),
(166897, 'ruRU', 'Иди, $p. Покажи Альянсу силу троллей и мощь Орды!', '', 29981),
(166896, 'ruRU', 'Аззага чуууго зинн!', '', 29981),
(166895, 'ruRU', '...великая сила!', '', 29981),
(166894, 'ruRU', '...среди теней...', '', 29981),
(166893, 'ruRU', '', '...во имя духов...', 29981),
(166892, 'ruRU', 'Сендуло ма\'дас на кху\'дас, куба зинн авэ!', '', 29981),
(166891, 'ruRU', 'Готовься, $p. Сейчас тебя наполнит древняя сила троллей.', '', 29981),
(166890, 'ruRU', 'Я знаю, кисуня, ты прячешься где-то здесь.', '', 29981),
(166889, 'ruRU', 'Кис-кис-кис...', '', 29981),
(166887, 'ruRU', 'Ты не отнимешь мой трофей!', '', 29981),
(166886, 'ruRU', 'Сегодня будет мясо!', '', 29981),
(166885, 'ruRU', 'Знания и ресурсы Эшвейн помогут нам быстро подавить любое сопротивление.', '', 29981),
(166884, 'ruRU', 'Трофей получаешь ты... на этот раз...', 'Трофей получаешь ты... на этот раз...', 29981),
(166883, 'ruRU', 'Какая у тебя прикольная голова. Из нее получится отличный трофей!', 'Какая у тебя прикольная голова. Из нее получится отличный трофей!', 29981),
(166882, 'ruRU', '', 'Миша фыркает.', 29981),
(166881, 'ruRU', 'Со мной все будет в порядке.', '', 29981),
(166880, 'ruRU', 'Миша, ты пока посиди тут, отдохни.', '', 29981),
(166879, 'ruRU', '', 'Капризные, ненадежные ветра... Вы меня погубили...', 29981),
(166878, 'ruRU', '', 'Мятежные ветра Зандалара, услышьте мой зов!', 29981),
(166877, 'ruRU', 'Бывай, $p, до скорого.', '', 29981),
(166876, 'ruRU', 'Передай этим старым оркам: если им надо будет построить что-нибудь быстрое и убойное, пусть рассчитывают на меня, ага?', '', 29981),
(166875, 'ruRU', 'Может, сражаться на войне не так уж и плохо...', '', 29981),
(166874, 'ruRU', 'Вот это скорость! $p, это было круче, чем любая гонка на нашей старой гоночной барже!', '', 29981),
(166873, 'ruRU', 'Мы отомстим!', '', 29981),
(166872, 'ruRU', 'убивали нас... порабощали нас... хотели использовать нас как топливо...', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166871, 'ruRU', '', 'А-А-А... а-а-а...', 29981),
(166870, 'ruRU', 'Вы...', '', 29981),
(166869, 'ruRU', 'Эта детка разваливается на части! Я подкручу болты, а ты разберись с капитаном.', '', 29981),
(166868, 'ruRU', 'Ха-ха-ха!', '', 29981),
(166867, 'ruRU', 'Дыши дымом, Пшикс!', '', 29981),
(166866, 'ruRU', 'Украсим их парой подпалин!', '', 29981),
(166865, 'ruRU', '', 'Мы не подведем тебя, Телаамон. Мы не забудем твою самоотверженность.', 29981),
(166864, 'ruRU', 'Я жалею лишь об одном: что не смогу сражаться вместе с вами до самой победы. Вам всем предстоят куда более тяжелые испытания.', '', 29981),
(166863, 'ruRU', 'Все пути так или иначе ведут к Свету... просто одни труднее, чем другие.', '', 29981),
(166862, 'ruRU', '', 'Ты не боишься умереть? Ордынцы могут подвергнуть тебя страшным пыткам, Телаамон.', 29981),
(166861, 'ruRU', 'Я сражался с Пылающим Легионом дольше, чем твой род носит фамилию Праудмур, леди Джайна. Во мне нет страха.', '', 29981),
(166860, 'ruRU', '', 'Телаамон, спасибо тебе еще раз... за все. Это, должно быть, непростое решение – пожертвовать собой ради нашей победы над Ордой.', 29981),
(166855, 'ruRU', '', 'Но в данном случае ты, возможно, прав, и от этого будет больше пользы, чем вреда.', 29981),
(166854, 'ruRU', '', 'И все-таки у меня неспокойно на сердце, Рексар. Нельзя бездумно выполнять любые приказы.', 29981),
(166853, 'ruRU', '...но пока мы можем следовать плану вождя. Вытащив одну преступницу мы спасем множество жизней подданных Орды.', '', 29981),
(166851, 'ruRU', 'Это конец?', 'Это конец?', 29981),
(166850, 'ruRU', 'Больно же! Больно...', 'Больно же! Больно...', 29981),
(166849, 'ruRU', 'Какая несправедливость!..', 'Какая несправедливость!..', 29981),
(166848, 'ruRU', 'Ты заплатишь за это!', 'Ты заплатишь за это!', 29981),
(166847, 'ruRU', 'Это фиаско...', 'Это фиаско...', 29981),
(166846, 'ruRU', 'Интересно, сколько мне заплатят за твою шкуру?', 'Интересно, сколько мне заплатят за твою шкуру?', 29981),
(166845, 'ruRU', 'Не связывайся с картелем!', 'Не связывайся с картелем!', 29981),
(166844, 'ruRU', 'Не лезь не в свое дело!', 'Не лезь не в свое дело!', 29981),
(166843, 'ruRU', 'Ты пожалеешь, что тебя занесло в эту теснину!', 'Ты пожалеешь, что тебя занесло в эту теснину!', 29981),
(166842, 'ruRU', 'Я чувствую, как тьма клубится в твоей душе. Боюсь, ты несешь на себе печать сил, с которыми тебе пришлось столкнуться.', '', 29981),
(166841, 'ruRU', 'За Орду! И за прибыль!', 'За Орду! И за прибыль!', 29981),
(166840, 'ruRU', 'Руки прочь, это моя добыча!', 'Руки прочь, это моя добыча!', 29981),
(166839, 'ruRU', 'Нам нужно покончить с Горнилом Штормов.', '', 29981),
(166838, 'ruRU', '', 'Эйир проявила милосердие, которого ты не заслуживаешь. Забирай душу своего друга – и уходи.', 29981),
(166836, 'ruRU', '', 'Придет время, и королева-банши заплатит за свои преступления. И в этот день тебе лучше держаться от нее подальше.', 29981),
(166835, 'ruRU', '', 'От тебя так и несет нечистой магией Бвонсамди.', 29981),
(166834, 'ruRU', '', 'Тебе здесь не место.', 29981),
(166833, 'ruRU', '', 'Нам еще многое предстоит успеть до того, как Таланджи станет королевой. Нужно поторопиться, пока не начался новый бунт.\n\nСкажи мне, когда будешь $gготов:готова; сыграть свою роль в священном ритуале.', 29981),
(166832, 'ruRU', 'Доставь меня в Башал\'Аран.', 'Доставь меня в Башал\'Аран.', 29981),
(166831, 'ruRU', '<Лунопард выжидающе смотрит на вас.>', '', 29981),
(166830, 'ruRU', 'А вы, чужаки, сильнее, чем я думал. Хм-м... Я с удовольствием пополню вами свою коллекцию...', '', 29981),
(166829, 'ruRU', 'Как грубо было с вашей стороны заявиться в город без приглашения. Зулдазар под защитой Бвонсамди!', '', 29981),
(166826, 'ruRU', '', 'Мой новый совет ждет тебя наверху, $n. Мы с прелатом тоже скоро придем.', 29981),
(166825, 'ruRU', '', 'Всему свое время. Чем скорее лоа благословят тебя, тем лучше для Зандалара.', 29981),
(166824, 'ruRU', 'Пошевеливайся, дух! Не одной же обезьяне веселиться!', '', 29981),
(166823, 'ruRU', 'Вы что, позволите чужакам разгуливать по нашему городу? Разберитесь с ними!', '', 29981),
(166822, 'ruRU', 'Поднимайтесь, духи зандаларов! Утащите захватчиков с собой в могилу!', '', 29981),
(166821, 'ruRU', 'Дело сделано. Бездна нашла свое место, и она голодна.$b$bМы можем использовать ее силу. Иди, уничтожь ордынцев, не теряй времени! Мы не сможем поддерживать ритуал слишком долго...', '', 29981),
(166820, 'ruRU', 'Шу... далис-на.', 'Шу... далис-на.', 29981),
(166819, 'ruRU', 'Природа восстанет против тебя! Анду-фала-дор!', 'Природа восстанет против тебя! Анду-фала-дор!', 29981),
(166818, 'ruRU', '', 'Мне следует поговорить со жрецами. В этих беспорядках нет их вины.', 29981),
(166817, 'ruRU', 'Я готов стать орудием Альянса.', '', 29981),
(166816, 'ruRU', 'Я знаю, что иду на риск, $p. И я готов.', '', 29981),
(166815, 'ruRU', 'Чего бы это ни стоило – главное, чтобы Орда ответила за свои преступления.', '', 29981),
(166814, 'ruRU', 'Я хочу стать таким огромным, чтобы ордынцы трепетали от страха при виде меня!', '', 29981),
(166813, 'ruRU', 'Но ты ведь будешь со мной, правда, $p? Вместе у нас все получится.', '', 29981),
(166812, 'ruRU', 'Я хочу превзойти все ожидания.', '', 29981),
(166811, 'ruRU', 'Больше всего я боюсь, что не справлюсь.', '', 29981),
(166810, 'ruRU', 'Между нами говоря, я немного нервничаю.', '', 29981),
(166809, 'ruRU', 'Это я шучу, чтобы скрыть тревогу.', '', 29981),
(166808, 'ruRU', 'Впрочем, какая разница? Главное, моя симпатичная мордашка останется при мне.', '', 29981),
(166807, 'ruRU', 'С высокой степенью вероятности процедура притупит мой острый ум.', '', 29981),
(166806, 'ruRU', 'Однако это рискованно.', '', 29981),
(166804, 'ruRU', 'Сначала их устройство было практически бесполезно: ему едва удавалось увеличить цель вдвое.', '', 29981),
(166803, 'ruRU', '', 'Это наш народ, прелат. Нужно проявить милость к тем, кто еще может внять голосу разума.', 29981),
(166802, 'ruRU', '', 'Только скажи – и я казню этих предателей.', 29981),
(166801, 'ruRU', 'Когда я услышал, что гномы готовят нападение на Орду, я сразу решил, что должен им помочь.', '', 29981),
(166800, 'ruRU', '', 'Остальных ждет встреча с тем, кого они так ненавидят.', 29981),
(166799, 'ruRU', 'Я знаю, о чем ты сейчас думаешь. Почему разумный, казалось бы, зверь избрал такую участь?', '', 29981),
(166797, 'ruRU', 'Обезвреживание', 'Обезвреживание', 29981),
(166796, 'ruRU', '|TInterface\\ICONS\\SPELL_FROST_SUMMONWATERELEMENTAL_2:20|tЛаминария использует заклинание |cFFFF0000|Hspell:287107|h[Гнев глубин]|h|r!', '', 29981),
(166795, 'ruRU', 'Это... так больно...', 'Это... так больно...', 29981),
(166794, 'ruRU', 'Проклятье, я ж ее почти заполучил!..', 'Проклятье, я ж ее почти заполучил!..', 29981),
(166790, 'ruRU', 'Жду приказаний.', 'Жду приказаний.', 29981),
(166789, 'ruRU', 'Слушай, хватит уже дуть в этот свисток!', 'Слушай, хватит уже дуть в этот свисток!', 29981),
(166788, 'ruRU', 'Опять ты!', 'Опять ты!', 29981),
(166787, 'ruRU', 'Я на месте, можно начинать!', 'Я на месте, можно начинать!', 29981),
(166786, 'ruRU', 'Что происходит? Чур я участвую!', 'Что происходит? Чур я участвую!', 29981),
(166785, 'ruRU', 'Эти встречи пора заканчивать... ик!', 'Эти встречи пора заканчивать... ик!', 29981),
(166784, 'ruRU', 'Я без запаса не хожу... и для тебя тоже найдется... ик...', 'Как удачно, я для тебя тоже прихватила!', 29981),
(166783, 'ruRU', '', 'Наконец-то... я знаю... свое предназначение...', 29981),
(166782, 'ruRU', '', 'Как ты смеешь! Сила камня должна принадлежать МНЕ!', 29981),
(166781, 'ruRU', 'Господин... Я иду...', 'Господин... Я иду...', 29981),
(166780, 'ruRU', 'Забвение... прими меня...', 'Забвение... прими меня...', 29981),
(166779, 'ruRU', 'Они идут! Они идут!', 'Они идут! Они идут!', 29981),
(166778, 'ruRU', 'Шепот не умолкнет!', 'Шепот не умолкнет!', 29981),
(166777, 'ruRU', '', 'Она всерьез думала, что сможет вскрыть Камень? Невежда. Будь у нас время, я бы полюбовалась на ее тщетные потуги.', 29981),
(166773, 'ruRU', 'Славная битва!', '', 29981),
(166772, 'ruRU', 'Ко мне! Я наделю вас силой стихий!', '', 29981),
(166771, 'ruRU', 'Держитесь! Я уже спешу на помощь!', '', 29981),
(166770, 'ruRU', '', 'Вперед! Мы должны взять руины Зул\'джана, иначе весь план пойдет прахом!', 29981),
(166766, 'ruRU', 'Такого я... не ожидал...', 'Такого я... не ожидала...', 29981),
(166765, 'ruRU', 'Иди сюда, троггово отродье! Я тебе покажу, что мы в ШРУ делаем с такими, как ты!', 'Иди сюда, троггово отродье! Я тебе покажу, что мы в ШРУ делаем с такими, как ты!', 29981),
(166764, 'ruRU', 'Растахан... убьет... вас... всех...', 'Растахан... убьет... вас... всех...', 29981),
(166763, 'ruRU', 'Зандалар... уничтожит вас...', 'Зандалар... уничтожит вас...', 29981),
(166762, 'ruRU', 'Армия зандаларов... сокрушит вас!', 'Армия зандаларов... сокрушит вас!', 29981),
(166761, 'ruRU', 'Наши союзники найдут и прикончат вас всех!', 'Наши союзники найдут и прикончат вас всех!', 29981),
(166760, 'ruRU', 'Король Растахан убьет вас всех!', 'Король Растахан убьет вас всех!', 29981),
(166759, 'ruRU', 'Принцесса Таланджи отомстит за меня!', 'Принцесса Таланджи отомстит за меня!', 29981),
(166758, 'ruRU', 'В Зулдазаре... узнают... что вы здесь...', 'В Зулдазаре... узнают... что вы здесь...', 29981),
(166757, 'ruRU', 'Пока ты будешь приручать ящеров, я выдвинусь на линию фронта. Удачи.', '', 29981),
(166756, 'ruRU', 'Буду ждать тебя на позиции. Вместе мы покончим с этим отвратительным творением гоблинов.', '', 29981),
(166755, 'ruRU', '', 'Я помогу нашим солдатам в руинах Зул\'джана. Встретимся, когда ты выполнишь свое задание.', 29981),
(166754, 'ruRU', 'Твой час... тоже пробьет.', '', 29981),
(166753, 'ruRU', 'Можешь махать руками и вопить сколько хочешь. Тем приятнее будет убить тебя!', '', 29981),
(166752, 'ruRU', 'Я убью вас всех и спасу эту планету!', '', 29981),
(166751, 'ruRU', 'Ваши жалкие машины – ничто перед силой Света! Я не позволю вам уничтожить эту планету.', '', 29981),
(166750, 'ruRU', 'Подрывной отряд... Бежим!!! Делай ноги!', '', 29981),
(166749, 'ruRU', 'Посмотрите на этого балбеса! Мы тебя взорвем, клянусь репутацией подрывного отряда!', '', 29981),
(166748, 'ruRU', 'Ты не враг мне. Убери оружие, и разойдемся с миром.', 'Ты не враг мне. Убери оружие, и разойдемся с миром.', 29981),
(166747, 'ruRU', 'Вдова говорила, что нет другого пути... Зря я ее послушал.', 'Вдова говорила, что нет другого пути... Зря я ее послушала.', 29981),
(166746, 'ruRU', 'Пощади! Я просто потерял голову.', 'Пощади! Я просто потеряла голову.', 29981),
(166745, 'ruRU', 'Ты мне не враг. Я заблуждался.', 'Ты мне не враг. Я заблуждалась.', 29981),
(166744, 'ruRU', 'Белая Вдова солгала. Не вы это все начали.', 'Белая Вдова солгала. Не вы это все начали.', 29981),
(166743, 'ruRU', 'Я просто хотел обрести дом...', 'Я просто хотела обрести дом...', 29981),
(166742, 'ruRU', 'Они обходились с нами, как с попрошайками!', 'Они обходились с нами, как с попрошайками!', 29981),
(166741, 'ruRU', 'Мы займем достойное место! Так говорит Белая Вдова!', 'Мы займем достойное место! Так говорит Белая Вдова!', 29981),
(166740, 'ruRU', 'Мы заставим вас уважать нашу силу!', 'Мы заставим вас уважать нашу силу!', 29981),
(166739, 'ruRU', 'Мы больше не служим Орде! Мы служим Белой Вдове!', 'Мы больше не служим Орде! Мы служим Белой Вдове!', 29981),
(166738, 'ruRU', 'Никто нас больше не назовет низшим племенем!', 'Никто нас больше не назовет низшим племенем!', 29981),
(166737, 'ruRU', 'Белая Вдова знает, как мы сильны!', 'Белая Вдова знает, как мы сильны!', 29981),
(166736, 'ruRU', '', 'Похоже, все материалы в хорошем состоянии. За работу.', 29981),
(166735, 'ruRU', 'Андуин... На пару слов.', '', 29981),
(166734, 'ruRU', 'Лирой Дженкинс!', '', 29981),
(166731, 'ruRU', '', 'Если ты не против, я не пойду к этим паукам. Когда добудешь паутину, ищи меня в Гол Ковале, что к югу отсюда.', 29981),
(166730, 'ruRU', '', 'Это... еще... не все!', 29981),
(166728, 'ruRU', 'Я... кажется... слегка не в форме.', '', 29981),
(166727, 'ruRU', '', 'Еретики! Они заплатят за это жизнью.', 29981),
(166726, 'ruRU', 'Я покажу тебе, что такое настоящая сила!', '', 29981),
(166725, 'ruRU', 'Ты смеешь нападать на меня?!', '', 29981),
(166724, 'ruRU', 'Берегите энергию!', 'Берегите энергию!', 29981),
(166723, 'ruRU', 'Не скрещивайте лучи!', 'Не скрещивайте лучи!', 29981),
(166722, 'ruRU', 'Поддерживайте связь. Почти готово!', 'Поддерживайте связь. Почти готово!', 29981),
(166721, 'ruRU', 'Что мы наделали?!', 'Что мы наделали?!', 29981),
(166720, 'ruRU', 'Пожалуйста, прости меня...', 'Пожалуйста, прости меня...', 29981),
(166719, 'ruRU', 'Только не это...', 'Только не это...', 29981),
(166718, 'ruRU', 'А-а-а! Спасите меня!', 'А-а-а! Спасите меня!', 29981),
(166717, 'ruRU', 'Всем внимание!', 'Всем внимание!', 29981),
(166716, 'ruRU', 'Сломите его волю. Мы отправим его на бой с Ордой!', 'Сломите его волю. Мы отправим его на бой с Ордой!', 29981),
(166715, 'ruRU', 'Не выпускайте его!', 'Не выпускайте его!', 29981),
(166713, 'ruRU', 'А-а-а-а! Он вырвался!', 'А-а-а-а! Он вырвался!', 29981),
(166712, 'ruRU', 'Глупые смертные! Ваша самоуверенность вас погубит!', '', 29981),
(166709, 'ruRU', 'Посмотрим, как $p испытает наше изобретение!', 'Посмотрим, как $p испытает наше изобретение!', 29981),
(166708, 'ruRU', 'Здесь мы в безопасности, детка.', 'Здесь мы в безопасности, детка.', 29981),
(166705, 'ruRU', 'Я покажу этим гномам, почем фунт взрывчатки!', '', 29981),
(166704, 'ruRU', 'Пульт управления твой!', '', 29981),
(166703, 'ruRU', 'Мне не говорили, что все кончится... вот так...', 'Мне не говорили, что все кончится... вот так...', 29981),
(166702, 'ruRU', 'Шепот предупредил, что ты придешь. Тебя ждет смерть!', 'Шепот предупредил, что ты придешь. Тебя ждет смерть!', 29981),
(166701, 'ruRU', 'Поззик плюет на палубу корабля.', '', 29981),
(166700, 'ruRU', 'Думает, что может меня учить, как лучше движок делать...', '', 29981),
(166699, 'ruRU', 'Я поставлю этого недоумка Пшикса на место...', '', 29981),
(166697, 'ruRU', '', 'Я довольно давно тут работаю и находила интересные свидетельства того, на что способен этот самый азерит. Хочешь испытать себя в бою с бродячими азеритоменталями, которых я откопала?', 29981),
(166696, 'ruRU', 'Наездники на нетопырях! Все в укрытие!', '', 29981),
(166695, 'ruRU', '', 'Похоже, это...', 29981),
(166694, 'ruRU', '', 'Что это?', 29981),
(166693, 'ruRU', '', 'Вон там, вдалеке. Не вижу на таком расстоянии...', 29981),
(166692, 'ruRU', '', 'Команда готова рисковать своей жизнью, потому что мы верим в вас.', 29981),
(166691, 'ruRU', '\"Лунная пыль\" и ее команда готовы ко всему, что нас ждет.', '', 29981),
(166690, 'ruRU', '', 'Мы направляемся в руины Зул\'джана. Выступайте небольшими группами и незаметно проберитесь через болото. В бой без необходимости не вступать!', 29981),
(166689, 'ruRU', '<Машинима: армия покидает Заламар.>', '<Машинима: армия покидает Заламар.>', 29981),
(166688, 'ruRU', 'Бегом к докам! Нам нужно доставить ценный груз.', '', 29981),
(166687, 'ruRU', 'А вот и стража.', '', 29981),
(166686, 'ruRU', 'Нужно расчистить путь.', '', 29981),
(166685, 'ruRU', 'Ну вот, почти на месте... Покажем потенциальным инвесторам, до чего хороша эта штука на поле боя?', '', 29981),
(166684, 'ruRU', 'И, кстати, испытай-ка вооружение. Это идеальный истребительно-бомбардировочный транспорт с морозильным отделением для продуктов!', '', 29981),
(166683, 'ruRU', 'Не знаю, чего им так уперся этот проклятый берег, но так даже лучше: не придется тащить эту зверь-машину в Кул-Тирас.', '', 29981),
(166682, 'ruRU', 'Цель операции находится поблизости. Альянс подтягивает туда армию размером с подбородок Галливикса.', '', 29981),
(166681, 'ruRU', 'Уф-ф! Ни секунды не сомневался в этой зверской шандарахалке!', '', 29981),
(166680, 'ruRU', 'Добро пожаловать на борт! И держись крепче... Нам придется побить несколько рекордов скорости, чтобы оторваться от взлетной полосы.', '', 29981),
(166679, 'ruRU', '', 'Когда зачистим этот район, мы отправимся в Башал\'Аран. Встретимся там.', 29981),
(166678, 'ruRU', 'Я не собираюсь оплакивать смерть очередного лоа. Я этого не допущу.', 'Я не собираюсь оплакивать смерть очередного лоа. Я этого не допущу.', 29981),
(166677, 'ruRU', 'Не жди, что я стану молчать.', 'Не жди, что я стану молчать.', 29981),
(166676, 'ruRU', 'Почему она ставит лоа смерти превыше остальных? Бред какой-то!', 'Почему она ставит лоа смерти превыше остальных? Бред какой-то!', 29981),
(166675, 'ruRU', 'Так она и трон в Некрополь перенесет. Ни за что!\n\nЯ этого не позволю.', 'Так она и трон в Некрополь перенесет. Ни за что!\n\nЯ этого не позволю.', 29981),
(166674, 'ruRU', 'А что мне еще делать? Таланджи принесет нам погибель. Так говорит Белая Вдова.', 'А что мне еще делать? Таланджи принесет нам погибель. Так говорит Белая Вдова.', 29981),
(166673, 'ruRU', 'Белая Вдова открыла мне правду. Таланджи хочет, чтобы мы все плясали под дудку Бвонсамди. Мы ей этого не позволим!', 'Белая Вдова открыла мне правду. Таланджи хочет, чтобы мы все плясали под дудку Бвонсамди. Мы ей этого не позволим!', 29981),
(166672, 'ruRU', '<Сосредоточенно читает молитву.>', '<Сосредоточенно читает молитву.>', 29981),
(166671, 'ruRU', 'О чем я только думал? Ты же $uмог:могла; меня убить!', 'О чем я только думал? Ты же $uмог:могла; меня убить!', 29981),
(166670, 'ruRU', 'Я спешил на Ту Сторону, но не понимал этого.', 'Я спешила на Ту Сторону, но не понимала этого.', 29981),
(166669, 'ruRU', 'Зачем нам драться? Мы же не враги!', 'Зачем нам драться? Мы же не враги!', 29981),
(166668, 'ruRU', 'Я все понял... Силой ничего не решить. Вдова была неправа.', 'Я все поняла... Силой ничего не решить. Вдова была неправа.', 29981),
(166667, 'ruRU', 'Я должен верить в Таланджи. Она не выбирала такую судьбу.', 'Я должен верить в Таланджи. Она не выбирала такую судьбу.', 29981),
(166666, 'ruRU', 'Я не знаю, что на меня нашло.', 'Я не знаю, что на меня нашло.', 29981),
(166665, 'ruRU', 'Так... ничего не исправить... Прости меня.', 'Так... ничего не исправить... Прости меня.', 29981),
(166664, 'ruRU', 'Мой лоа не погибнет следующим!', 'Мой лоа не погибнет следующим!', 29981),
(166663, 'ruRU', 'Хватит с нас мертвых лоа!', 'Хватит с нас мертвых лоа!', 29981),
(166662, 'ruRU', 'Я склонюсь только перед своим лоа!', 'Я склонюсь только перед своим лоа!', 29981),
(166661, 'ruRU', 'Тень Бвонсамди накрыла нашу веру! Я больше не могу молчать!', 'Тень Бвонсамди накрыла нашу веру! Я больше не могу молчать!', 29981),
(166660, 'ruRU', 'Я не признаю королеву, которая якшается с мертвыми!', 'Я не признаю королеву, которая якшается с мертвыми!', 29981),
(166659, 'ruRU', 'Таланджи отмечена смертью! Она проклята!', 'Таланджи отмечена смертью! Она проклята!', 29981),
(166658, 'ruRU', 'Я не стану служить Бвонсамди!', 'Я не стану служить Бвонсамди!', 29981),
(166657, 'ruRU', '', 'На Темных берегах сейчас слишком опасно.$B$BМы откроем портал, когда эта область будет под нашим контролем.', 29981),
(166656, 'ruRU', '', 'На Темных берегах сейчас слишком опасно.$B$BМы откроем портал, когда эта область будет под нашим контролем.', 29981),
(166655, 'ruRU', 'За Альянс!', '', 29981),
(166654, 'ruRU', 'Знайте, что каждое мгновение, пока вы их удерживаете, приближает нас к победе над этими чудовищами.', '', 29981),
(166653, 'ruRU', 'Орда наступает, и когда она явится сюда, вы будете яростно драться за каждую пядь этого проклятого болота!', '', 29981),
(166652, 'ruRU', 'Мы будем помнить всех и каждого, кто сложит голову ради благороднейшей цели – избавления Азерота от тирании.', '', 29981),
(166651, 'ruRU', 'Мы продолжаем эту кампанию. Знайте, ваша жертва не будет напрасной.', '', 29981),
(166648, 'ruRU', 'Вернитесь на поле боя!', 'Вернитесь на поле боя!', 29981),
(166647, 'ruRU', 'Без войны мира нам не добиться.', '', 29981),
(166646, 'ruRU', 'Чтобы спасти Азерот, его надо избавить от Орды.', '', 29981),
(166645, 'ruRU', '<Посетить собрание.>', '<Посетить собрание.>', 29981),
(166644, 'ruRU', 'Вызов буровой установки', 'Вызов буровой установки', 29981),
(166643, 'ruRU', 'Я отправлюсь в Замалар и сделаю, что смогу. Встретимся после того, как избавим мир от этих троллей крови.', '', 29981),
(166642, 'ruRU', '', '|TInterface\\ICONS\\Ability_Paladin_EmpoweredSealsRighteous:20|tРа\'вани Кана начинает высвобождать энергию |cFFFF0000|Hspell:284469|h[печати воздаяния]|h|r!', 29981),
(166641, 'ruRU', '', '|TInterface\\ICONS\\SPELL_HOLY_SEALOFWRATH:20|tРа\'вани Кана начинает высвобождать энергию |cFFFF0000|Hspell:284436|h[печати расплаты]|h|r!', 29981),
(166640, 'ruRU', 'Я не виноват!', 'Я не виновата!', 29981),
(166639, 'ruRU', 'Погоди! Я еще не закончил.', 'Погоди! Я еще не закончила.', 29981),
(166638, 'ruRU', 'Держись крепче!', 'Держись крепче!', 29981),
(166637, 'ruRU', 'Порядок, протоколы безопасности... Ой!', 'Порядок, протоколы безопасности... Ой!', 29981),
(166636, 'ruRU', 'Мы здесь по просьбе принцессы Таланджи. Ее высочество очень помогла прелатам Резана. Она напомнила нам, кто мы и ради чего был создан наш орден.$b$bНаш лоа Резан пал – но его дело живет. Мы должны направлять заблудшие души, быть маяком Света, разгоняющим мрак.$b$bМилостью лоа мы все еще едины со Светом.', 'Мы здесь по просьбе принцессы Таланджи. Ее высочество очень помогла прелатам Резана. Она напомнила нам, кто мы и ради чего был создан наш орден.$b$bНаш лоа Резан пал – но его дело живет. Мы должны направлять заблудшие души, быть маяком Света, разгоняющим мрак.$b$bМилостью лоа мы все еще едины со Светом.', 29981),
(166635, 'ruRU', '', 'Ухожу... вслед за волнами...', 29981),
(166634, 'ruRU', 'Темные воды поглотят тебя!', 'Темные воды поглотят тебя!', 29981),
(166633, 'ruRU', 'Ма\'даааааа!', '', 29981),
(166632, 'ruRU', 'Да я лучше спалю весь город, чем стану служить самой смерти.', 'Да я лучше спалю весь город, чем стану служить самой смерти.', 29981),
(166631, 'ruRU', 'Я поддался своим страхам... Надеюсь, Таланджи простит меня.', 'Я поддалась своим страхам... Надеюсь, Таланджи простит меня.', 29981),
(166630, 'ruRU', 'Зандалары не будут рабами лоа смерти!', 'Зандалары не будут рабами лоа смерти!', 29981),
(166629, 'ruRU', 'В конце концов все приходят к старику Бвонсамди!', '', 29981),
(166628, 'ruRU', 'Идите к папочке, крошки!', '', 29981),
(166627, 'ruRU', 'Теперь вы увидели силу Бвонсамди!', '', 29981),
(166626, 'ruRU', 'Как вам мой маленький фокус?', '', 29981),
(166625, 'ruRU', 'Шевелитесь! Не рассиживайтесь!', '', 29981),
(166624, 'ruRU', 'Проучите этих выскочек!', '', 29981),
(166623, 'ruRU', 'Вот это вас развеселит!', '', 29981),
(166622, 'ruRU', 'Я принес вам игрушечки!', '', 29981),
(166621, 'ruRU', 'Нет-нет-нет! Теперь тебе никто не поможет!', '', 29981),
(166620, 'ruRU', 'Эй! Здоровякам не помогать!', '', 29981),
(166619, 'ruRU', '|TInterface\\ICONS\\Ability_ThunderKing_BallLightning.blp:20|t Вы стали целью |cFFFF0000|Hspell:286811|h[Гнева Акунды]|h|r!', '|TInterface\\ICONS\\Ability_ThunderKing_BallLightning.blp:20|t Вы стали целью |cFFFF0000|Hspell:286811|h[Гнева Акунды]|h|r!', 29981),
(166618, 'ruRU', 'Ты долго правил, Растахан. Возможно... слишком долго. Раз ты не справляешься, может, твоя дочка окажется пошустрее, а?', '', 29981),
(166617, 'ruRU', 'Вот это мощь. Теперь вам не жить!', '', 29981),
(166616, 'ruRU', 'Во славу... Кул... Тираса...', 'Во славу... Кул... Тираса...', 29981),
(166615, 'ruRU', 'В нашем королевстве тебе не место, свинья!', 'В нашем королевстве тебе не место, свинья!', 29981),
(166614, 'ruRU', 'Эта мощь... убивает... Это проклятие, а не спасение! Таланджи... что я наделал?', '', 29981),
(166613, 'ruRU', 'Чужаки все еще сопротивляются! Бвонсамди, как им это удается?', '', 29981),
(166612, 'ruRU', 'Эта тьма пожирает мою душу! Я должен... изгнать ее!', '', 29981),
(166611, 'ruRU', 'Почему захватчики еще сражаются? Бвонсамди! Ты же должен был с ними разобраться!', '', 29981),
(166610, 'ruRU', 'Нет... эту тьму... невозможно удержать!', '', 29981),
(166609, 'ruRU', 'Да! Мощь лоа переполняет меня!', '', 29981),
(166608, 'ruRU', 'Какой ты требовательный, Растахан! Я дам тебе силу, что ты ищешь, только... будь повежливее.', '', 29981),
(166607, 'ruRU', 'Бвонсамди! Ты же мой лоа! Сделай как обещал и убей этих чужаков!', '', 29981),
(166606, 'ruRU', '', 'Встретимся в руинах, когда зарядишь руническое силовое ядро.', 29981),
(166605, 'ruRU', 'Как пожелаешь, Растахан. Испробуй мое моджо...', '', 29981),
(166604, 'ruRU', 'Так дай мне силу уничтожить их!', '', 29981),
(166603, 'ruRU', 'Зачем поднимать столько шума, твое величество? Старик Бвонсамди не позволит чужеземцам занять твой трон.', '', 29981),
(166602, 'ruRU', 'Бвонсамди! Захватчики убили моих воинов! Помоги мне!', '', 29981),
(166601, 'ruRU', 'Смерть повелевает мной!', '', 29981),
(166600, 'ruRU', 'Что это за темная сила?!', '', 29981),
(166599, 'ruRU', 'Умрите в агонии!', '', 29981),
(166598, 'ruRU', 'Вы познаете боль!', '', 29981),
(166596, 'ruRU', 'Ты будешь страдать!', '', 29981),
(166595, 'ruRU', 'От смерти не убежишь!', '', 29981),
(166593, 'ruRU', 'Я сожгу вас, нечестивцы!', '', 29981),
(166592, 'ruRU', 'Да прольется огненный дождь!', '', 29981),
(166590, 'ruRU', 'Берегитесь укуса змеи!', '', 29981),
(166589, 'ruRU', 'Змеиный укус смертелен!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166587, 'ruRU', 'Вперед, мои лапочки. Вперед!', '', 29981),
(166586, 'ruRU', 'Зандалар – опасное место!', '', 29981),
(166584, 'ruRU', '|cFF0000FF(Задание)|r Отправь меня на Темные берега.', '|cFF0000FF(Задание)|r Отправь меня на Темные берега.', 29981),
(166583, 'ruRU', 'Повинуйтесь мне!', '', 29981),
(166582, 'ruRU', 'Ваши сердца и разум принадлежат мне!', '', 29981),
(166580, 'ruRU', 'Тебе пора бежать!', '', 29981),
(166579, 'ruRU', 'Прочь с глаз моих!', '', 29981),
(166578, 'ruRU', 'Узрите ярость Зандалара!', '', 29981),
(166577, 'ruRU', 'Я подвел... королевство...', '', 29981),
(166576, 'ruRU', 'Мои верноподданные! Покажите чужакам цену их гордыни!', '', 29981),
(166575, 'ruRU', 'Я сражаюсь не один, чужестранцы! Со мной лучшие из защитников Зулдазара!', '', 29981),
(166574, 'ruRU', 'Напомни, что случилось?', 'Напомни, что случилось?', 29981),
(166573, 'ruRU', 'Дело сделано. Я верну скипетр в Дальний лиман. Удачи вам всем.', '', 29981),
(166572, 'ruRU', 'Море, дай нам силу! Укрой своим туманом это проклятое болото, сотвори завесу и спрячь наш флот!', '', 29981),
(166571, 'ruRU', 'Кто ты?', 'Кто ты?', 29981),
(166570, 'ruRU', '', '<Деларин смотрит на вас.>\n\nЯ тебя помню. Ты здесь уже не в первый раз.', 29981),
(166569, 'ruRU', '', '<Кажется, Деларин на вас не смотрит.>', 29981),
(166568, 'ruRU', 'Я готов. Вызови туман с помощью Скипетра Глубин, чтобы скрыть наши войска.', 'Я готова. Вызови туман с помощью Скипетра Глубин, чтобы скрыть наши войска.', 29981),
(166567, 'ruRU', 'Скипетр Глубин – могущественный артефакт. Только скажи, и я призову его силу.\n\nИмей в виду: как только туман опустится, надо будет действовать очень быстро, чтобы Орда и зандалары не успели раскусить наш план.', '', 29981),
(166566, 'ruRU', '', 'Пощади меня! Белая Вдова наполнила мое сердце ложью... Теперь я вижу истину.', 29981),
(166565, 'ruRU', '', 'Мы выдворим Орду из нашего города!', 29981),
(166564, 'ruRU', 'Покажи мне Одержимых хранителей.', 'Покажи мне Одержимых хранителей.', 29981),
(166563, 'ruRU', 'Покажи мне Провал Альн.', 'Покажи мне Провал Альн.', 29981),
(166562, 'ruRU', 'Покажи мне Искрящий акведук.', 'Покажи мне Искрящий акведук.', 29981),
(166561, 'ruRU', 'Покажи мне Королевскую библиотеку.', 'Покажи мне Королевскую библиотеку.', 29981),
(166560, 'ruRU', 'Покажи мне Ночной Шпиль.', 'Покажи мне Ночной Шпиль.', 29981),
(166559, 'ruRU', 'Покажи мне Подъем предателя.', 'Покажи мне Подъем предателя.', 29981),
(166558, 'ruRU', 'Покажи мне Испытание доблести.', 'Покажи мне Испытание доблести.', 29981),
(166557, 'ruRU', 'Покажи мне Врата ада.', 'Покажи мне Врата ада.', 29981),
(166556, 'ruRU', 'Покажи мне Залы Стенаний.', 'Покажи мне Залы Стенаний.', 29981),
(166555, 'ruRU', 'Покажи мне Зал аватары.', 'Покажи мне Зал аватары.', 29981),
(166554, 'ruRU', 'Покажи мне Падение Искусителя.', 'Покажи мне Падение Искусителя.', 29981),
(166553, 'ruRU', 'Покажи мне Прорыв Света.', 'Покажи мне Прорыв Света.', 29981),
(166552, 'ruRU', 'Покажи мне Запретный спуск.', 'Покажи мне Запретный спуск.', 29981),
(166551, 'ruRU', 'Покажи мне Погибель надежды.', 'Покажи мне Погибель надежды.', 29981),
(166550, 'ruRU', 'Покажи мне Трон Пантеона.', 'Покажи мне Трон Пантеона.', 29981),
(166549, 'ruRU', '|TInterface\\Icons\\INV_Sword_2H_DraenorQuest_B_01.blp:20|t$n подвергается нападению капитана чумных стражей Тедрика, который быстро наносит удары |cFFFF0000|Hspell:286805|h[чумным клинком]|h|r!', '|TInterface\\Icons\\INV_Sword_2H_DraenorQuest_B_01.blp:20|t$n подвергается нападению капитана чумных стражей Тедрика, который быстро наносит удары |cFFFF0000|Hspell:286805|h[чумным клинком]|h|r!', 29981),
(166548, 'ruRU', 'Покажи мне Темную ветвь.', 'Покажи мне Темную ветвь.', 29981),
(166547, 'ruRU', 'Подготовка к ритуалу закончена, $n.$b$bЧары, которые мы наложили на эти кости, позволят нам обрушить силу Бездны на Орду, но действовать надо без промедления. Можем начинать?', '', 29981),
(166546, 'ruRU', 'Рад снова поработать с тобой, $n. Тебе, наверное, интересно, что мы задумали?$b$bПока мы готовимся к ритуалу. Я скажу, когда можно будет начинать.', '', 29981),
(166545, 'ruRU', '', 'Чтобы отвлекающий маневр сработал, и Орда с зандаларами нам поверили, надо действовать быстро.', 29981),
(166544, 'ruRU', '', 'Я подготовлю переброску войск в Назмир. Встретимся в Дальнем лимане, $p.', 29981),
(166543, 'ruRU', 'И с тобой тоже, Халфорд. Твоя душа исполнена силой Света. Не теряй эту силу.', '', 29981),
(166542, 'ruRU', 'Спасибо, Телаамон. Да пребудет с тобой Свет.', '', 29981),
(166541, 'ruRU', 'Я готов заплатить любую цену, чтобы больше никто не познал ту же боль, что и я, Халфорд.', '', 29981),
(166540, 'ruRU', 'Если Орду не остановить, она погубит эту планету.', '', 29981),
(166539, 'ruRU', 'И все из-за того, что некоторые мои соплеменники не смогли обуздать свою жажду могущества.', '', 29981),
(166538, 'ruRU', 'Я хорошо это понимаю. Халфорд, я видел, как моя планета превратилась в пустыню.', '', 29981),
(166537, 'ruRU', 'Да, это так. Те, кто отправится в Назмир, отвлекут силы Орды на себя и погибнут... а тем временем основная часть нашего флота займет стратегическую позицию.', '', 29981),
(166536, 'ruRU', 'Ты сказал, что это задание – верная смерть, не так ли? Что никто не вернется?', '', 29981),
(166535, 'ruRU', 'Орда захватила Лор\'данелский пляж!', 'Орда захватила Горекаменный карьер!', 29981),
(166534, 'ruRU', 'Это твой последний шанс отказаться, Телаамон. Мы можем найти кого-то другого для этого задания. Я готов выполнить его сам.', '', 29981),
(166533, 'ruRU', 'Я готов. Просто хотел еще раз взглянуть на ваш прекрасный мир.', '', 29981),
(166532, 'ruRU', 'Да. Ты готов отправиться в Назмир?', 'Да. Ты готова отправиться в Назмир?', 29981),
(166531, 'ruRU', '$n, вы с Халфордом пришли, потому что настало время сразиться с Ордой, не так ли?', '', 29981),
(166530, 'ruRU', 'Ритуал выходит из-под контроля! Назад!', 'Ритуал выходит из-под контроля! Назад!', 29981),
(166529, 'ruRU', 'Пусть Таланджи поскорее со всем этим разберется!', 'Пусть Таланджи поскорее со всем этим разберется!', 29981),
(166528, 'ruRU', 'Кто эта Белая Вдова, о которой они говорят?', 'Кто эта Белая Вдова, о которой они говорят?', 29981),
(166527, 'ruRU', 'Поверить не могу...', 'Поверить не могу...', 29981),
(166526, 'ruRU', 'Заставь изменников заплатить за все!', 'Заставь изменников заплатить за все!', 29981),
(166525, 'ruRU', 'Сегодня? В такой день?!', 'Сегодня? В такой день?!', 29981),
(166524, 'ruRU', 'Все произошло так быстро...', 'Все произошло так быстро...', 29981),
(166523, 'ruRU', 'С Таланджи ничего не случилось?', 'С Таланджи ничего не случилось?', 29981),
(166522, 'ruRU', 'Они вдруг взяли и начали разносить все вокруг!', 'Они вдруг взяли и начали разносить все вокруг!', 29981),
(166521, 'ruRU', 'Привет от Белой Вдовы!', 'Привет от Белой Вдовы!', 29981),
(166520, 'ruRU', 'Ты пешка Таланджи! Белая Вдова расправится с тобой!', 'Ты пешка Таланджи! Белая Вдова расправится с тобой!', 29981),
(166519, 'ruRU', 'Белая Вдова знала, что ты явишься сюда. Я не стану молчать!', 'Белая Вдова знала, что ты явишься сюда. Я не стану молчать!', 29981),
(166518, 'ruRU', 'Тебе меня не заткнуть! Белая Вдова придает мне сил!', 'Тебе меня не заткнуть! Белая Вдова придает мне сил!', 29981),
(166517, 'ruRU', 'Она обещала нам выбор! Тебе его у меня не отнять!', 'Она обещала нам выбор! Тебе его у меня не отнять!', 29981),
(166516, 'ruRU', 'За Белую Вдову!', 'За Белую Вдову!', 29981),
(166515, 'ruRU', 'Я поддался увещеваниям Вдовы. Прости.', 'Я поддалась увещеваниям Вдовы. Прости.', 29981),
(166514, 'ruRU', 'Пожалуйста, только не бей!', 'Пожалуйста, только не бей!', 29981),
(166513, 'ruRU', 'Я не хотел наделать бед, просто поддался общему безумию!', 'Я не хотела наделать бед, просто поддалась общему безумию!', 29981),
(166512, 'ruRU', 'О чем я только думал? Спасибо тебе.', 'О чем я только думала? Спасибо тебе.', 29981),
(166511, 'ruRU', 'Прости... она сказала, что это единственный способ что-то изменить.', 'Прости... она сказала, что это единственный способ что-то изменить.', 29981),
(166510, 'ruRU', 'Я просто не видел другого выхода...', 'Я просто не видел другого выхода...', 29981),
(166509, 'ruRU', '<Атаковать.>', '<Атаковать.>', 29981),
(166508, 'ruRU', 'Я тебе не враг. Позволь помочь тебе.', 'Я тебе не враг. Позволь помочь тебе.', 29981),
(166507, 'ruRU', 'Остановись! Иначе будут неприятности.', 'Остановись! Иначе будут неприятности.', 29981),
(166506, 'ruRU', 'Таланджи позабыла о нас! Мы поднимем бунт!\n\nБелая Вдова укажет нам путь!', 'Таланджи позабыла о нас! Мы поднимем бунт!\n\nБелая Вдова укажет нам путь!', 29981),
(166505, 'ruRU', '<Он гневно топает ногой.>\n\nЗулдазар больше не служит Орде!', '<Она гневно топает ногой.>\n\nЗулдазар больше не служит Орде!', 29981),
(166504, 'ruRU', 'Я больше не стану клянчить объедки!', 'Я больше не стану клянчить объедки!', 29981),
(166503, 'ruRU', 'А что Орда вообще для меня сделала?!', 'А что Орда вообще для меня сделала?!', 29981),
(166502, 'ruRU', 'Я больше не стану батрачить на Орду!', 'Я больше не стану батрачить на Орду!', 29981),
(166501, 'ruRU', 'Долой Орду! Улицы принадлежат простым троллям!\n\nТак говорит Белая Вдова!', 'Долой Орду! Улицы принадлежат простым троллям!\n\nТак говорит Белая Вдова!', 29981),
(166500, 'ruRU', '<Он гневно взирает на вас.>\n\nЧего тебе?', '<Она гневно взирает на вас.>\n\nЧего тебе?', 29981),
(166499, 'ruRU', 'Здорово! Больше огня. Думаю, никаких пожароопасных ценностей там нет.', '', 29981),
(166498, 'ruRU', 'Даруй мне благословение ордена Пылающих Углей.', 'Даруй мне благословение ордена Пылающих Углей.', 29981),
(166497, 'ruRU', '', 'Да?', 29981),
(166496, 'ruRU', '', 'Вперед! Покажем им, на что мы способны!', 29981),
(166495, 'ruRU', '', 'Теперь ты снова в форме. Иди же, задай им жару!', 29981),
(166494, 'ruRU', 'Не подведи меня!', '', 29981),
(166493, 'ruRU', 'Иди, разнеси эту штуковину на тысячу кусочков!', '', 29981),
(166492, 'ruRU', 'Давай обсудим план нападения на Зулдазар.', 'Давай обсудим план нападения на Зулдазар.', 29981),
(166491, 'ruRU', 'Ты здесь. Хорошо. Думаю, Халфорд уже рассказал тебе о нашем плане атаки на Зулдазар.\n\nДавай обсудим детали. Тебе отводится ключевая роль.', '', 29981),
(166490, 'ruRU', '', 'Мне больше не нужна соль.', 29981),
(166489, 'ruRU', 'Ну, это не так-то просто.', '', 29981),
(166488, 'ruRU', 'Если этот коридор тянется по всему периметру, Меггакруту эти данные пригодятся.', '', 29981),
(166487, 'ruRU', 'Мне больше не нужна соль.', '', 29981),
(166486, 'ruRU', 'Хватит болтать! Лучше помоги нам справиться с этим, Фэйрвинд!', '', 29981),
(166485, 'ruRU', 'Видимо, придется добираться обходным путем.', '', 29981),
(166484, 'ruRU', 'Должен быть какой-то выключатель. $p, видишь что-нибудь похожее?', '', 29981),
(166483, 'ruRU', '', 'Вперед.', 29981),
(166482, 'ruRU', '', 'В Сокало разгорелся бунт! Нужно что-то предпринять!', 29981),
(166481, 'ruRU', '', 'Я останусь с Таланджи. А ты останови бунт любой ценой.', 29981),
(166480, 'ruRU', 'Отдать 10 щепоток морской соли?', 'Отдать 10 щепоток морской соли?', 29981),
(166479, 'ruRU', 'Я принес тебе еще соли.', 'Я принесла тебе еще соли.', 29981),
(166478, 'ruRU', '', 'Только не роняй его, слышишь? Меггакруту не понравится, если с ним что-то случится.', 29981),
(166474, 'ruRU', '', 'Пусть говорят, Рата. У них есть право на несогласие.', 29981),
(166473, 'ruRU', 'Проклятье...', 'Проклятье...', 29981),
(166472, 'ruRU', '', 'Этой черни нужно напомнить о почтении к короне.', 29981),
(166471, 'ruRU', 'Прочь от моих пушек!', 'Прочь от моих пушек!', 29981),
(166470, 'ruRU', 'Ваши земли разорены. Все, что вы знаете и любите, скоро исчезнет!', '', 29981),
(166469, 'ruRU', 'И, клянусь, мы убьем всех альянсовцев, которые только сунутся на нашу землю!', '', 29981),
(166468, 'ruRU', 'Но Зулдазар не сдастся Альянсу! Мы сильны и едины!', '', 29981),
(166467, 'ruRU', 'Если Альянсу удалось уничтожить наш флот, гавань осталась без всякой защиты. Они могут захватить город!', '', 29981),
(166466, 'ruRU', 'Я слышал взрывы... наверное, это был зандаларский флот!', '', 29981),
(166465, 'ruRU', 'Поверить не могу – Альянс обвел нас вокруг пальца! Они пожертвовали жизнями стольких солдат, чтобы выманить нас из города.', '', 29981),
(166464, 'ruRU', 'Сила Альянса сокрушит Зулдазар!', 'Сила Альянса сокрушит Зулдазар!', 29981),
(166463, 'ruRU', 'Зулдазар не выстоит перед Альянсом!', 'Зулдазар не выстоит перед Альянсом!', 29981),
(166462, 'ruRU', 'Мы прорвемся и захватим Зулдазар!', 'Мы прорвемся и захватим Зулдазар!', 29981),
(166461, 'ruRU', 'Союзники Орды получат сполна!', 'Союзники Орды получат сполна!', 29981),
(166460, 'ruRU', 'Зулдазар заплатит за союз с Ордой!', 'Зулдазар заплатит за союз с Ордой!', 29981),
(166459, 'ruRU', 'Зулдазар падет перед Альянсом!', 'Зулдазар падет перед Альянсом!', 29981),
(166455, 'ruRU', 'Здесь ваши подвиги закончатся.', '', 29981),
(166454, 'ruRU', '|cFFEF0201Орда|r начала сбор азерита в азеритовом разломе!', '|cFFEF0201Орда|r начала сбор азерита в азеритовом разломе!', 29981),
(166453, 'ruRU', '|cFF0EA6DCАльянс|r начал сбор азерита в азеритовом разломе!', '|cFF0EA6DCАльянс|r начал сбор азерита в азеритовом разломе!', 29981),
(166452, 'ruRU', '%s восстанавливает жизненную энергию и глубоко пускает корни в землю.', '', 29981),
(166451, 'ruRU', 'Уже!', '', 29981),
(166450, 'ruRU', '', 'Отличный выстрел. Мортон, вызывай коптеры.', 29981),
(166449, 'ruRU', '', 'Мы должны восстановить справедливость.', 29981),
(166448, 'ruRU', '', 'Я расскажу все, что видела.', 29981),
(166447, 'ruRU', '', 'Боюсь, нас ждут темные времена.', 29981),
(166446, 'ruRU', '', 'Пусть лоа благословят нашу принцессу.', 29981),
(166445, 'ruRU', 'Я восхищаюсь твоей отвагой.', '', 29981),
(166444, 'ruRU', 'Я расскажу все, что знаю.', '', 29981),
(166443, 'ruRU', 'Я хочу телепортироваться к Горнилу Штормов.', 'Я хочу телепортироваться к Горнилу Штормов.', 29981),
(166442, 'ruRU', 'За Альянс стоит сражаться.', '', 29981),
(166441, 'ruRU', 'Я хочу отправиться на битву за Дазар\'алор (рейд).', 'Я хочу отправиться на битву за Дазар\'алор (рейд).', 29981),
(166440, 'ruRU', 'Победы даются дорогой ценой.', '', 29981),
(166438, 'ruRU', 'Что случилось? Почему армия уходит? Я отправил сюда целую армию терродактилей!', '', 29981),
(166437, 'ruRU', 'Я хочу телепортироваться к Джайне.', 'Я хочу телепортироваться к Джайне.', 29981),
(166436, 'ruRU', 'Я хочу телепортироваться к Совету жрецов моря.', 'Я хочу телепортироваться к Совету жрецов моря.', 29981),
(166435, 'ruRU', '', 'Что? Здесь нет ни флота, ни армии. Что происходит?', 29981),
(166434, 'ruRU', '', 'Когда туман рассеется, я нанесу удар по флоту Альянса. А потом прибудет наше подкрепление.', 29981),
(166433, 'ruRU', '', 'Тогда обратим его силу против наших врагов. Они тоже ничего не будут видеть.', 29981),
(166432, 'ruRU', '', 'Мне только что сообщили, что кто-то проник в сокровищницу. Наверное, Альянс похитил артефакт.', 29981),
(166431, 'ruRU', '', 'Как это возможно? Его же отдали моему отцу и поместили в сокровищницу.', 29981),
(166430, 'ruRU', '', 'Принцесса Таланджи, источник тумана – артефакт, который герои Орды украли у култирасцев.', 29981),
(166429, 'ruRU', 'Зандалар наш... НАВЕКИ!', '', 29981),
(166428, 'ruRU', 'Пусть улицы окрасятся кровью захватчиков!', '', 29981),
(166427, 'ruRU', 'Мертвые, подъем!', '', 29981),
(166426, 'ruRU', 'Хм.', '', 29981),
(166425, 'ruRU', 'Помоги нам... иначе королевство падет, и некому будет даже помнить твое имя.', '', 29981),
(166424, 'ruRU', 'Ну и ну. Могучему Растахану снова понадобился старик Бвонсамди?', '', 29981),
(166423, 'ruRU', 'Бвонсамди!', '', 29981),
(166422, 'ruRU', 'RTC ВОСПРОИЗВОДИТСЯ ЗДЕСЬ', 'RTC ВОСПРОИЗВОДИТСЯ ЗДЕСЬ', 29981),
(166421, 'ruRU', 'Вот поддельный скипетр. Думаю, эту почетную миссию стоит поручить тебе. На этот раз мы с Флинном будем тебя прикрывать.', '', 29981),
(166420, 'ruRU', '<Взять поддельный скипетр, чтобы заменить им настоящий.>', '<Взять поддельный скипетр, чтобы заменить им настоящий.>', 29981),
(166419, 'ruRU', 'Привет! Надо починить эту штуку. Не поможешь мне? \n\nПринеси немного соли, и мы мигом зарядим батарею.', '', 29981),
(166417, 'ruRU', 'Думаю, я лучше пойду пешком.', '', 29981),
(166416, 'ruRU', 'Умчимся отсюда на крыльях ветра.', '', 29981),
(166415, 'ruRU', 'Я добыл соль.', 'Я добыла соль.', 29981),
(166414, 'ruRU', 'Ты можешь отправить меня в Гномреган?', 'Ты можешь отправить меня в Гномреган?', 29981),
(166413, 'ruRU', '', 'Эй! Добудешь тут немного соли, пока я занимаюсь ремонтом? \n\nТогда мы сможем мигом зарядить батареи этого здоровяка!', 29981),
(166410, 'ruRU', 'По местам! Нападем на этого Телаамона, когда $p подаст сигнал.', '', 29981),
(166409, 'ruRU', '', 'Прошу, поторопись.', 29981),
(166408, 'ruRU', '', 'Они уже должны быть здесь.', 29981),
(166407, 'ruRU', '', 'Успокойся, Сеф. Ты ждала этого три тысячи лет. Лишняя пара часов ничего не изменит.', 29981),
(166406, 'ruRU', 'Да, надо бы поторопиться!', '', 29981),
(166405, 'ruRU', 'Все кончено. Пора сказать Таланджи, что можно выступать вперед, чтобы уничтожить флот и источник тумана.', '', 29981),
(166404, 'ruRU', 'Я... сдержал... клятву. Теперь... я свободен...', '', 29981),
(166402, 'ruRU', '', 'Не переживай. Я отомщу за тебя, как только обрету новое тело. Куда же они запропастились?', 29981),
(166401, 'ruRU', 'Вы не оставляете мне выбора. Силой Света я очищу мир от вашей порчи!', '', 29981),
(166400, 'ruRU', '', 'Довольно! Вы вторгаетесь в мои земли, убиваете моих подданных, а теперь еще и оскверняете последний приют лоа!', 29981),
(166399, 'ruRU', 'Ох... $p, давай! Прикончи этого парня!', '', 29981),
(166398, 'ruRU', 'Свет благоволит мне! Это проклятое место станет вашей могилой!', '', 29981),
(166397, 'ruRU', 'Изложи свой план.', 'Изложи свой план.', 29981),
(166396, 'ruRU', 'Тысячелетиями я сражался с Пылающим Легионом! Орде не устоять перед моим клинком!', '', 29981),
(166393, 'ruRU', 'Дальше Альянс не пройдет.', '', 29981),
(166392, 'ruRU', '', 'Наш отважный король был готов сделать все ради Зандалара! Даже призвать самого лоа смерти!', 29981),
(166391, 'ruRU', '', 'Даже стража короля не могла справиться с этими монстрами!', 29981),
(166390, 'ruRU', 'За Гронга!', '', 29981),
(166389, 'ruRU', 'Мы не забудем о твоей жертве.', '', 29981),
(166388, 'ruRU', 'Что ж... Герои Альянса, убейте его. Дикари не заслуживают пощады!', '', 29981),
(166385, 'ruRU', 'Растахан, король Зандалара... Приказываю тебе сдаться! Ты склонишься перед королем Андуином Ринном и отдашь нам свою дочь в заложницы.', '', 29981),
(166383, 'ruRU', '', 'Они бесцеремонно ворвались в тронный зал. Наш король не собирался уступать этой черни!', 29981),
(166382, 'ruRU', '', 'Как стервятники, варвары Альянса слетелись на запах крови.', 29981),
(166381, 'ruRU', '', 'Защитники лоа сражались достойно.', 29981),
(166380, 'ruRU', '', 'Эти изверги оскверняли наши святыни. Насмехались над лоа! Воровали золото, проливали кровь!', 29981),
(166379, 'ruRU', '', 'Наплевав на нашу историю и традиции, захватчики похитили множество ценных реликвий.', 29981),
(166378, 'ruRU', '', 'Он был прав в каждом слове.', 29981),
(166377, 'ruRU', 'Я отправлюсь вперед, гляну, где этот Телаамон. Найди меня, когда разделаешься с альянсовцами, $n.', '', 29981),
(166376, 'ruRU', '', 'Один из героев вашей Орды, торговый принц, попытался хитростью заставить Альянс отступить.', 29981),
(166375, 'ruRU', '', 'Но зандалары умеют сторожить сокровища!', 29981),
(166374, 'ruRU', '', 'Похоже, шпионы Альянса заранее разведали храм, но мы об этом не знали.', 29981),
(166372, 'ruRU', '', 'Дазар\'алор простоял тысячи лет, пока варвары из Альянса не пробили в пирамиде брешь и не разграбили древние сокровища!', 29981),
(166370, 'ruRU', 'Каджа\'мит – это руда. \n\nОсобая руда, умная на вкус.', '', 29981),
(166369, 'ruRU', 'Гронг делает то, что требуется. \n\nГронг поможет делу.', '', 29981),
(166368, 'ruRU', 'Возвращайся на свободу!', '', 29981),
(166365, 'ruRU', 'Отправляйся в грот. Там ты будешь в безопасности.', '', 29981),
(166364, 'ruRU', 'Беги на свободу.', '', 29981),
(166363, 'ruRU', 'Когда я стану огромным, Орда дважды подумает, прежде чем причинять вред стае Да\'ки.', '', 29981),
(166362, 'ruRU', 'Это напоминание о том, почему я должен помочь Альянсу.', '', 29981),
(166361, 'ruRU', 'Убийство моих сородичей из стаи Да\'ки влечет за собой серьезные последствия.', '', 29981),
(166360, 'ruRU', 'Пусть тебя не терзают муки совести – эти браконьеры первыми пролили кровь.', '', 29981),
(166359, 'ruRU', 'Мы убиваем по необходимости, а не из алчности.', '', 29981),
(166358, 'ruRU', 'Убивай – или умри. Мы уподобились диким зверям.', '', 29981),
(166357, 'ruRU', 'Мерзкие гномы! Эти уродцы стоят между нами и Праудмур. Перебейте их!', '', 29981),
(166356, 'ruRU', 'Давайте поговорим о саде Клейтона и том, что у нас больше нет дома, как-нибудь потом. Сейчас надо разобраться с Альянсом.', '', 29981),
(166355, 'ruRU', 'Я ненавижу вас всем своим прогнившим сердцем.', '', 29981),
(166354, 'ruRU', 'Ха-ха-ха!', 'Ха-ха-ха!', 29981),
(166353, 'ruRU', 'Меня зовут Клейтон, я тоскую по своему маленькому садику в Подгороде, хнык-хнык-хнык!', '', 29981),
(166352, 'ruRU', 'Не понимаю, о чем ты?', '', 29981),
(166351, 'ruRU', '', 'О, просто славно... опять про Подгород...', 29981),
(166350, 'ruRU', 'Может и так, а что? От моего старого сада в Подгороде ничего не осталось.', '', 29981),
(166349, 'ruRU', '', 'Мы Отрекшиеся! Как ты хочешь отдыхать? В садике поработать?', 29981),
(166348, 'ruRU', 'Если честно, я бы сейчас предпочел немного отдохнуть.', '', 29981),
(166347, 'ruRU', 'Я не жалуюсь. Пустить альянсовцам кровь – дело хорошее.', '', 29981),
(166346, 'ruRU', 'Да, но знаешь, планы меняются. Приказы командования и всякое такое.', '', 29981),
(166345, 'ruRU', '', 'И, насколько я понимаю, мы ее закончили.', 29981),
(166344, 'ruRU', 'Босс, я думал, мы уберемся отсюда, когда закончим работу.', '', 29981),
(166343, 'ruRU', '', 'Хе-хе-хе! Ха-ха! Наконец-то я могу обратить свою темную магию против настоящих врагов!', 29981),
(166342, 'ruRU', 'Я хочу телепортироваться к Меггакруту.', 'Я хочу телепортироваться к Меггакруту.', 29981),
(166341, 'ruRU', 'Попомните мои слова... Еще до заката этот гнусный карлик станет Отрекшимся. Герои, завалите этого зверя!', '', 29981),
(166340, 'ruRU', 'Гномские инновации – непреодолимая сила! Настоятельно рекомендую сдаться... или приготовить много-много бананов.', '', 29981),
(166339, 'ruRU', 'Седлайте терродактилей и летите за Альянсом. Не оставляйте никого в живых!', '', 29981),
(166338, 'ruRU', '', 'Не переживайте, Генн. Мы всего лишь озадачим преследователей небольшим сюрпризом. А вы отчаливайте!', 29981),
(166337, 'ruRU', 'Джайна! Мы уже победили. Не нужно...', '', 29981),
(166336, 'ruRU', '', 'Всем судам – взять курс домой! Мы с Меггакрутом прикроем ваше отступление.', 29981),
(166335, 'ruRU', 'Мы покажем этим дикарям мощь Кул-Тираса!', '', 29981),
(166334, 'ruRU', '', 'Лорд-адмирал, ритуал почти готов!', 29981),
(166333, 'ruRU', '', 'Славный бой, герои. Ваш корабль готов к отплытию.', 29981),
(166332, 'ruRU', '', 'Позвольте расчистить для вас путь.', 29981),
(166329, 'ruRU', 'Осторожно, герои. Я чую... надвигающуюся тьму.', '', 29981),
(166328, 'ruRU', '', 'Что ж, $n, дай мне знать, когда подготовишься.', 29981),
(166327, 'ruRU', 'Я сторожить дверь!', '', 29981),
(166326, 'ruRU', 'Герои Орды пустились в погоню на зандаларском корабле.', '', 29981),
(166325, 'ruRU', 'И тут явилась принцесса троллей, и в глазах ее была смерть.', '', 29981),
(166324, 'ruRU', 'Жрецы моря такое наколдовали... Это было нечто!', '', 29981),
(166323, 'ruRU', 'Солдаты Орды дрались бешено... безжалостно. Но култирасцы не дрогнули!', '', 29981),
(166319, 'ruRU', '7-й легион стоял насмерть, прикрывая наш отход.', '', 29981),
(166318, 'ruRU', 'Заткнись! Один герой Альянса готов. Но я хочу, чтобы вы пустили кровь Праудмур. Вперед!', '', 29981),
(166317, 'ruRU', 'Что?! Так, у меня два вопроса! Первый: как вы дали этому клопу сбежать? Второй... ГДЕ МОЯ СПАСАТЕЛЬНАЯ КАПСУЛА?!?!', '', 29981),
(166316, 'ruRU', 'Главный механик сражался, как лев. Но этого... не хватило. Хвала волнам, у него нашелся последний трюк в рукаве, который унес его с поля боя!', '', 29981),
(166312, 'ruRU', 'Он ударил с воздуха, отряды гномов помогли нам на земле... А потом появился Галливикс.', '', 29981),
(166311, 'ruRU', 'Враги пытались зажать нас между своими героями и войсками в порту. Но они не знали, что их ждал Меггакрут.', '', 29981),
(166310, 'ruRU', 'Орда не успела защитить короля Растахана. И пока принцесса троллей оплакивала отца, Гнилостень командовал их войсками.', '', 29981),
(166309, 'ruRU', 'Я расскажу все как было. Все началось, когда они узнали, что их король мертв...', '', 29981),
(166308, 'ruRU', 'Герои, поговорите с этим солдатом. Мне нужны все подробности.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166307, 'ruRU', 'Лорд-адмирал и главный механик сражались отважно. Но Орда атаковала с такой яростью и... свирепостью...', '', 29981),
(166306, 'ruRU', 'Мой король, у нас есть выживший очевидец.', '', 29981),
(166305, 'ruRU', 'Ха-ха, так держать! Пойду, посмотрю, нужна ли Рокхану моя помощь.', '', 29981),
(166304, 'ruRU', 'Атака на Зулдазар была успешной, но Орда настигла нас во время отступления.', '', 29981),
(166303, 'ruRU', 'Джайна сильно ранена... Меггакрут на грани смерти... Что случилось, Генн?', '', 29981),
(166302, 'ruRU', 'Все к кораблям! Живо!', '', 29981),
(166301, 'ruRU', 'Отпразднуем победу в Боралусе. А сейчас нужно вывести наших бойцов отсюда.', '', 29981),
(166300, 'ruRU', 'Растахан сам выбрал свою судьбу, объединившись с Ордой.', '', 29981),
(166299, 'ruRU', 'Рад снова видеть тебя, $p. Пойду, посмотрю, кому еще нужна помощь.', '', 29981),
(166298, 'ruRU', 'Нет, гоблин. Герои, вы знаете, что делать.', '', 29981),
(166297, 'ruRU', 'Они друг друга стоят... Зандалары заслужили свою участь.', '', 29981),
(166296, 'ruRU', 'Кажется, не только у Королевы-банши в армии есть вурдалаки.', '', 29981),
(166295, 'ruRU', 'Как бы то ни было, кровь Альянсу вы пустили. Герои, готовьтесь. Нас ждут новые битвы.', '', 29981),
(166294, 'ruRU', 'Праудмур все же спасла свою жалкую шкуру. Вождь будет очень недовольна.', '', 29981),
(166293, 'ruRU', 'Оставьте принцессу наедине с ее горем. Она будет рада узнать, что вы отомстили за Растахана.', '', 29981),
(166292, 'ruRU', '', 'Слушаюсь, принцесса! Герои, давайте на борт!', 29981),
(166291, 'ruRU', '', 'Капитан, бери этих героев и в погоню за убийцами! Принесите мне голову Джайны Праудмур.', 29981),
(166290, 'ruRU', '', 'Альянс напал на город и убил нашего короля. Раненым нужна помощь.', 29981),
(166289, 'ruRU', '', 'Рулевой, правь к докам! Лоа милосердные... что тут случилось?', 29981),
(166288, 'ruRU', '', 'Нет! Убийцы моего отца уходят!', 29981),
(166287, 'ruRU', 'Принцесса Таланджи! Альянс обратил против нас моджо морских жрецов!', '', 29981),
(166286, 'ruRU', 'Какая разница, кого они призвали. Герои, в атаку!', '', 29981),
(166285, 'ruRU', 'Эти жрецы моря заварили мощное моджо! Они призвали морского гада!', '', 29981),
(166284, 'ruRU', 'Дикари из Альянса заплатят за содеянное. Не дайте им уйти!', '', 29981),
(166283, 'ruRU', 'Вы слышали принцессу!', '', 29981),
(166282, 'ruRU', '', 'Остальное вы знаете. Король Растахан был нашим героем. Я была готова мстить за него!', 29981),
(166281, 'ruRU', '', 'Я расскажу все как было. Все началось, когда Альянс добрался до пирамиды...', 29981),
(166280, 'ruRU', 'Возьми себя в руки, солдат! Герои Орды отомстят за твоего короля. Расскажи им все, что знаешь.', '', 29981),
(166279, 'ruRU', '', 'Эти скоты из Альянса... они...', 29981),
(166278, 'ruRU', 'Ты! Что здесь произошло? Говори!', '', 29981),
(166277, 'ruRU', 'О... нет...', '', 29981),
(166276, 'ruRU', 'Скорее к Растахану и Таланджи!', '', 29981),
(166275, 'ruRU', 'Герои, не дайте им задержать вас!', '', 29981),
(166274, 'ruRU', 'Солдаты, ко мне! Мы должны остановить Орду!', '', 29981),
(166273, 'ruRU', 'Герои! Обойдите эти стены... или пробейтесь сквозь них!', '', 29981),
(166272, 'ruRU', '', 'Помолчал бы, Гнилостень... Тебя уже давно пора похоронить по-человечески.', 29981),
(166271, 'ruRU', 'Праудмур... Я с радостью пну твой остывающий труп.', '', 29981),
(166270, 'ruRU', '', 'Стоять! Дальше вы не пройдете!', 29981),
(166269, 'ruRU', 'Видали и посильнее. Идем!', '', 29981),
(166268, 'ruRU', 'Лоа смерти и правда силен!', '', 29981),
(166267, 'ruRU', 'Ну, чего разлегся, макак? Вставай и покажи чужакам, что со стариком Бвонсамди шутки плохи!', '', 29981),
(166266, 'ruRU', 'О-о-о, а кто это тут у нас? Такой крепыш нам здорово пригодится!', '', 29981),
(166265, 'ruRU', 'Герои, разберитесь с этим переростком. Рокхан, за мной. Держим оборону!', '', 29981),
(166264, 'ruRU', 'А чтобы продемонстрировать вам новые возможности Альянса, мы приготовили... сюрприз!', '', 29981),
(166263, 'ruRU', 'Эй, ордынские дикари! Эта примитивная пирамида теперь наша!', '', 29981),
(166262, 'ruRU', 'Лоа милосердные! Что это?!', '', 29981),
(166261, 'ruRU', 'Все слышали? Вперед!', '', 29981),
(166260, 'ruRU', '', 'Я должна быть с ним. Герои Орды, умоляю вас... поспешите!', 29981),
(166259, 'ruRU', '', 'Город оказался во власти Бвонсамди! Отец не провел бы этот ритуал, если бы у него был выбор.', 29981),
(166258, 'ruRU', 'Вот тебе, коротышка! Молодцы, герои!', '', 29981),
(166257, 'ruRU', 'Мы сделаем все, что возможно, принцесса! А для начала уберем с дороги этих дворфов.', '', 29981),
(166256, 'ruRU', '', 'Скорее, бежим к пирамиде! Ее защищают только отец и его личная стража.', 29981),
(166255, 'ruRU', 'Войска Альянса высадились в гавани. Они расползаются по Зулдазару, подобно чуме.', '', 29981),
(166254, 'ruRU', 'Без сомнения, Орда сделает все, чтобы отомстить нам, и мы должны быть готовы к этому.', '', 29981),
(166253, 'ruRU', 'Герои! Благодарю вас за доблесть. Никакая награда не достойна вашего подвига.', '', 29981),
(166252, 'ruRU', 'Спасибо, солдат. Мы позаботимся о здоровье лорд-адмирала.', '', 29981),
(166251, 'ruRU', 'Вот как все было. Я в жизни не встречал героев столь же доблестных, как леди Праудмур!', '', 29981),
(166250, 'ruRU', 'Казалось, Орда вот-вот возьмет верх. Но лорд-адмирал перевернула ситуацию!', '', 29981),
(166249, 'ruRU', 'Лорд-адмирал Праудмур была сама любезность! Она великодушно предложила Орде отступить.', '', 29981),
(166248, 'ruRU', '', 'Думаю, пока что хватит. Отведи Гронга домой, $p.', 29981),
(166247, 'ruRU', 'Какой необыкновенный зверь!', '', 29981),
(166246, 'ruRU', '', 'Не отступать! Делайте то, что должны!', 29981),
(166245, 'ruRU', 'Держать строй! Наши союзники сделают то, что нужно.', '', 29981),
(166244, 'ruRU', 'Защищайте древних! Не отступайте!', '', 29981),
(166243, 'ruRU', '', 'Держать строй! Древним нужна помощь!', 29981),
(166242, 'ruRU', '', 'Не теряйте времени. Башал\'Аран ждет.', 29981),
(166241, 'ruRU', 'Прекрасно. Союзники, за мной!', '', 29981),
(166240, 'ruRU', 'Наступаем! Быстрее!', '', 29981),
(166239, 'ruRU', '', 'Сюда. Наши резервы зачистят эту область.', 29981),
(166238, 'ruRU', 'Начинаем атаку. Сюда!', '', 29981),
(166237, 'ruRU', 'Пришла пора вернуть нашу землю!', '', 29981),
(166236, 'ruRU', '', 'Битва ждет!', 29981),
(166235, 'ruRU', '', 'К бою!', 29981),
(166234, 'ruRU', '', 'О, ты приходишь в себя! Хорошо! Извини за то, что произошло в храме...', 29981),
(166232, 'ruRU', '', 'Умбрий, нам нужен портал! И поскорее!', 29981),
(166231, 'ruRU', 'Отмена! Отмена! Он неуправляем!', '', 29981),
(166230, 'ruRU', '|TInterface\\Icons\\INV_Plate_RaidDeathKnightMythic_O_01Helm.blp:20|tПризван |cFFFF0000|Hspell:282526|h[смертоносный призрак]|h|r!', '', 29981),
(166227, 'ruRU', '|TInterface\\Icons\\Ability_Mage_GreaterPyroblast.blp:20|t%s готовится запустить |cFFFF0000|Hspell:286379|h[Огненную глыбу]|h|r!', '|TInterface\\Icons\\Ability_Mage_GreaterPyroblast.blp:20|t%s готовится запустить |cFFFF0000|Hspell:286379|h[Огненную глыбу]|h|r!', 29981),
(166226, 'ruRU', 'Детектор показывает, что на острове появилось много азерита. Проверьте-ка!', '', 29981),
(166224, 'ruRU', 'На острове появилось много азерита. Только будьте осторожнее! Альянс об этом тоже знает.', '', 29981),
(166223, 'ruRU', 'Столько азерита в одном месте? Я бы посоветовал как можно скорее отправиться туда.', '', 29981),
(166222, 'ruRU', 'Детектор азерита зашкаливает. Похоже, это шанс, о котором мы могли только мечтать! Давайте обратим его к своей выгоде.', '', 29981),
(166220, 'ruRU', 'Экстракторы азерита готовы! Только скажите, куда их отправить. Но учтите, что Альянс прознает про них.', '', 29981),
(166217, 'ruRU', 'Детектор засек целую кучу азерита! Соберите его, пока Альянс вас не опередил.', '', 29981),
(166213, 'ruRU', 'Еще... разок... бабахнуть...', 'Еще... разок... бабахнуть...', 29981),
(166212, 'ruRU', 'Бомбардировку никто не остановит!', '', 29981),
(166211, 'ruRU', 'Так, экстракторы азерита готовы к работе. Пустим их в ход? Я отметил ценные месторождения на карте.', '', 29981),
(166210, 'ruRU', 'Мы нашли несколько месторождений, богатых азеритом. Но нужно поторапливаться. Орда несомненно на них наткнется.', '', 29981),
(166209, 'ruRU', '', 'Ты спасаешь тысячи жизней. Спасибо тебе.', 29981),
(166208, 'ruRU', '', 'Еще один враг уничтожен. Темные берега в долгу перед тобой.', 29981),
(166207, 'ruRU', '', 'Угрозы больше нет. Спасибо тебе.', 29981),
(166206, 'ruRU', '', 'Часовые обнаружили новую угрозу. Убей врага, пока он не напал на наших солдат!', 29981),
(166205, 'ruRU', '', 'Неподалеку замечен сильный противник. Действуй решительно!', 29981),
(166204, 'ruRU', '', 'Этот враг угрожает всем жителям Темных берегов. Срази его!', 29981),
(166203, 'ruRU', '', 'Спасибо тебе за помощь. Надеюсь, наши усилия восстановят равновесие.', 29981),
(166202, 'ruRU', '', 'Без присмотра наших друидов обитатели Темных берегов поддались порче. Останови эпидемию, пока не поздно.', 29981),
(166201, 'ruRU', '', 'Прискорбная, но необходимая мера. Спасибо за помощь.', 29981),
(166200, 'ruRU', '', 'Зверства Орды свели с ума духов наших предков. Упокой их навеки. Они заслужили мирный сон.', 29981),
(166199, 'ruRU', '', 'Сектанты рассеяны и растеряны. Надеюсь, они не скоро придут в себя.', 29981),
(166198, 'ruRU', '', 'Остатки Сумеречного Молота выползли из укрытия. Что бы они ни задумали, перебей их.', 29981),
(166197, 'ruRU', '', 'Темные берега вечно страдают от этих вредителей. Без них гораздо лучше.', 29981),
(166196, 'ruRU', '', 'Нашествия мурлоков отравляют жизнь местным обитателям. Истреби этих паразитов.', 29981),
(166195, 'ruRU', '', 'Вторжение наг остановлено. Но нам нельзя терять бдительности.', 29981),
(166194, 'ruRU', '', 'Наги воспользовались смутой на Темных берегах и выползли на сушу. Прогони их обратно в пучину.', 29981),
(166193, 'ruRU', '', 'Хорошо. Каждая смерть в стане врага – наш ответ Королеве-банши!', 29981),
(166192, 'ruRU', '', 'Мы не победим, пока на Темных берегах будет оставаться хоть один солдат Орды. Не щади никого.', 29981),
(166191, 'ruRU', 'Прекрасно. Не стоит связываться с посланниками Темной Госпожи!', '', 29981),
(166190, 'ruRU', 'Еще одна победа Орды!', '', 29981),
(166189, 'ruRU', 'Призовите валь\'киру! Нам пригодится новый союзник...', '', 29981),
(166188, 'ruRU', 'Совсем рядом рыщет опасный враг. Убей его без жалости.', '', 29981),
(166187, 'ruRU', 'Разведчики обнаружили сильного врага. Убей его!', '', 29981),
(166186, 'ruRU', 'Поблизости замечен достойный противник. Не хочешь испытать себя?', '', 29981),
(166185, 'ruRU', 'Эти тролли ужасно упрямы, но мы постепенно их тесним. Осталось немного.', '', 29981),
(166184, 'ruRU', 'Местные тролли – последние остатки вымирающего племени Сухокожих. Армия Темной Госпожи выгнала их из Внутренних земель. А мы их прикончим.', '', 29981),
(166183, 'ruRU', 'Синдикат разбит. Я пошлю стражей смерти добить уцелевших.', '', 29981),
(166182, 'ruRU', 'Синдикат все еще предъявляет претензии на эту территорию. Что за вздор! Покажи им, что Орда не будет мириться с их выходками.', '', 29981),
(166181, 'ruRU', 'Теперь они присмиреют, а мы пока придумаем, как искоренить проблему.', '', 29981),
(166180, 'ruRU', 'Магия, сдерживающая местных элементалей, слабеет. Уничтожь их, пока не начались неприятности.', '', 29981),
(166179, 'ruRU', 'Грызуны истреблены, добычу можно продолжать. Хм... свечки как свечки.', '', 29981),
(166178, 'ruRU', 'Мерзкие кобольды мешают добыче руды. Избавься от них. Да, и забери их свечи, хорошо? Любопытно, из-за чего весь сыр-бор.', '', 29981),
(166177, 'ruRU', 'Я всегда говорил, что топор сможет достучаться даже до самых дубовых голов. Полагаю, твое послание дошло до адресата.', '', 29981),
(166176, 'ruRU', 'Проклятые громилы не понимают, что в Арати им больше не рады. Донеси до них эту мысль.', '', 29981),
(166175, 'ruRU', 'Прекрасно. Их трупы станут пушечным мясом нашей армии в грядущих битвах.', '', 29981),
(166174, 'ruRU', 'Некоторые защитники Альянса отказываются умирать как положено солдатам. Вразуми их.', '', 29981),
(166173, 'ruRU', 'Такова неизбежная судьба всех врагов Орды.', '', 29981),
(166172, 'ruRU', 'Точечный удар! Орда снова торжествует!', '', 29981),
(166171, 'ruRU', 'Еще один солдат для армии Темной Госпожи.', '', 29981),
(166170, 'ruRU', 'Неподалеку замечен сильный противник. Убей его!', '', 29981),
(166169, 'ruRU', 'Этот враг думает, что сможет противостоять Орде. Преподай ему урок.', '', 29981),
(166168, 'ruRU', 'Новая угроза! Устрани ее!', '', 29981),
(166167, 'ruRU', '', 'Нет! Все... не должно...', 29981),
(166166, 'ruRU', 'Лиши врага союзников, и он падет. Прекрасная работа.', '', 29981),
(166165, 'ruRU', 'Ночные эльфы считают местных обитателей родственными душами. Поэтому нам, естественно, следует их уничтожить.', '', 29981),
(166163, 'ruRU', 'Прелестно. Согласись, ничто так не деморализует врага, как осквернение его святынь.', '', 29981),
(166162, 'ruRU', 'Кажется, мы потревожили местных духов. Интересно, что будет, если разозлить их еще сильнее.', '', 29981),
(166161, 'ruRU', 'Хорошо. Надеюсь, больше они не вернутся.', '', 29981),
(166160, 'ruRU', 'Клоуны из Сумеречного Молота не хотят вымирать. Истреби их.', '', 29981),
(166159, 'ruRU', 'Наконец-то, тишина. Это отвратительное бульканье сводит с ума.', '', 29981),
(166158, 'ruRU', '', 'Не трать мое время. Сдохни!', 29981),
(166157, 'ruRU', 'Несносные мурлоки всегда были надоедливы, но сейчас особенно разбушевались. Разгони их.', '', 29981),
(166156, 'ruRU', 'Полагаю, эти пресмыкающиеся больше не полезут на территорию Орды!', '', 29981),
(166155, 'ruRU', 'Наги любят прибирать к рукам чужое добро. Покажи им, что так делать нехорошо.', '', 29981),
(166154, 'ruRU', 'Чудесно. Не останавливайся, пока не зачистишь весь берег.', '', 29981),
(166153, 'ruRU', 'Солдаты Альянса вцепились в это место, как блохи в собаку. Вытрави их.', '', 29981),
(166152, 'ruRU', '<Похоже, сундук заперт магической печатью.>', '<Похоже, сундук заперт магической печатью.>', 29981),
(166151, 'ruRU', '|TInterface\\Icons\\SPELL_FIRE_SELFDESTRUCT.BLP:20|tРядом появляется |cFFFF0000|Hspell:284374|h[магматическая ловушка]|h|r.', '|TInterface\\Icons\\SPELL_FIRE_SELFDESTRUCT.BLP:20|tРядом появляется |cFFFF0000|Hspell:284374|h[магматическая ловушка]|h|r.', 29981),
(166150, 'ruRU', '|TInterface\\Icons\\Spell_Mage_Meteor.blp:20|tБойцы призывают |cFFFF0000|Hspell:284388|h[яростных фениксов]|h|r из-за магического барьера!', '|TInterface\\Icons\\Spell_Mage_Meteor.blp:20|tБойцы призывают |cFFFF0000|Hspell:284388|h[яростных фениксов]|h|r из-за магического барьера!', 29981),
(166149, 'ruRU', '|TInterface\\Icons\\SPELL_SHAMAN_SPECTRALTRANSFORMATION.BLP:20|tБойцы принимают свой последний облик! Прикончите их!', '|TInterface\\Icons\\SPELL_SHAMAN_SPECTRALTRANSFORMATION.BLP:20|tБойцы принимают свой последний облик! Прикончите их!', 29981),
(166148, 'ruRU', '|TInterface\\Icons\\SPELL_NATURE_GIFTOFTHEWILD.BLP:20|tБойцы вызывают |cFFFF0000|Hspell:282031|h[Огонь в тумане]|h|r. Уничтожьте живые бомбы, прежде чем они |cFFFF0000|Hspell:284399|h[взорвутся]|h|r!', '|TInterface\\Icons\\SPELL_NATURE_GIFTOFTHEWILD.BLP:20|tБойцы вызывают |cFFFF0000|Hspell:282031|h[Огонь в тумане]|h|r. Уничтожьте живые бомбы, прежде чем они |cFFFF0000|Hspell:284399|h[взорвутся]|h|r!', 29981),
(166147, 'ruRU', '|TInterface\\Icons\\ABILITY_MONK_PALMSTRIKE.BLP:20|tВы стали целью |cFFFF0000|Hspell:282030|h[Всех сторон света]|h|r! Поворачивайтесь в нужном направлении, чтобы получать меньше урона!', '|TInterface\\Icons\\ABILITY_MONK_PALMSTRIKE.BLP:20|tВы стали целью |cFFFF0000|Hspell:282030|h[Всех сторон света]|h|r! Поворачивайтесь в нужном направлении, чтобы получать меньше урона!', 29981),
(166146, 'ruRU', '', 'Наша столица в осаде! Возвращаемся в Зулдазар!', 29981),
(166145, 'ruRU', 'Вот же гады!', '', 29981),
(166144, 'ruRU', '', 'Нас обманули! Отец в одиночку защищает город!', 29981),
(166143, 'ruRU', '', 'Бессмыслица. Если только... нас не хотели увести в Назмир...', 29981),
(166142, 'ruRU', 'У меня дурное предчувствие. Зачем напускать туман, если за ним нет кораблей?', '', 29981),
(166141, 'ruRU', 'Нет. Теперь бежим.', '', 29981),
(166140, 'ruRU', 'А теперь бояться?', '', 29981),
(166139, 'ruRU', 'Не боись. Справимся.', '', 29981),
(166138, 'ruRU', 'Осторожно...', '', 29981),
(166136, 'ruRU', '', 'Орда готовится к нападению на Старокаменную гавань. Они привезли сюда осадные орудия. Надо немедленно атаковать их базу и уничтожить все вооружение!', 29981),
(166135, 'ruRU', 'Я хочу телепортироваться к королю Растахану.', 'Я хочу телепортироваться к королю Растахану.', 29981),
(166134, 'ruRU', 'Похоже, теперь я пожизненно связан с Ордой. Спасибо, $pr.', 'Похоже, теперь я пожизненно связана с Ордой. Спасибо, $pr.', 29981),
(166133, 'ruRU', 'Пожалуйста, покажи мне, что произошло.', 'Пожалуйста, покажи мне, что произошло.', 29981),
(166132, 'ruRU', 'Я говорил этим сухопутным крысам, что Орда нас выручит. Лок-бар! Или как там оно по-вашему?', 'Я говорила этим сухопутным крысам, что Орда нас выручит. Лок-бар! Или как там оно по-вашему?', 29981),
(166131, 'ruRU', 'Рад видеть тебя снова, $n. Твоя помощь на Аргусе не забыта.', '', 29981),
(166130, 'ruRU', 'Можешь рассчитывать на мою благодарность... и мой топор!', 'Можешь рассчитывать на мою благодарность... и мой топор!', 29981),
(166129, 'ruRU', 'Да! Пора утопить парочку альянсовских крыс.', 'Да! Пора утопить парочку альянсовских крыс.', 29981),
(166128, 'ruRU', 'Арр-р! Теперь Орда мне нравится.', 'Арр-р! Теперь Орда мне нравится.', 29981),
(166127, 'ruRU', 'Ха! Псы Альянса получили по заслугам.', 'Ха! Псы Альянса получили по заслугам.', 29981),
(166126, 'ruRU', 'Тебя сюда капитан прислала? Передай ей мою благодарность.', 'Тебя сюда капитан прислала? Передай ей мою благодарность.', 29981),
(166125, 'ruRU', 'Капитан Оувингс была права... Орда – наши друзья!', 'Капитан Оувингс была права... Орда – наши друзья!', 29981),
(166124, 'ruRU', 'Я хочу телепортироваться к Совету лоа.', 'Я хочу телепортироваться к Совету лоа.', 29981),
(166123, 'ruRU', 'Рад тебя видеть, $n.', '', 29981),
(166122, 'ruRU', 'Прекрасно! Цель уничтожена.', '', 29981),
(166121, 'ruRU', 'Задание выполнено.', '', 29981),
(166120, 'ruRU', 'Угроза устранена. Блестящая работа.', '', 29981),
(166119, 'ruRU', 'Поблизости замечен могучий противник. Будь начеку.', '', 29981),
(166118, 'ruRU', 'Разведка нашла неподалеку серьезного врага. Ты знаешь, что делать.', '', 29981),
(166117, 'ruRU', 'Рядом с тобой приоритетная цель. Устрани ее!', '', 29981),
(166116, 'ruRU', 'Браво. После такого они еще долго будут зализывать раны.', '', 29981),
(166115, 'ruRU', 'Сухокожие враждуют с Стромгардом со Второй войны. За эту землю они лягут костьми... но и мы тоже.', '', 29981),
(166114, 'ruRU', 'Может, теперь до них дойдет. Прекрасно, $n!', '', 29981),
(166113, 'ruRU', 'Синдикату явно не нравится, что мы отбили Стромгард. Покажи им, что с нами шутить не стоит.', '', 29981),
(166112, 'ruRU', 'Хорошо. Мы только заняли эту территорию, и бешеные элементали нам совсем ни к чему.', '', 29981),
(166111, 'ruRU', 'Магия, связывающая элементалей с этой землей, слабеет. Избавься от них, пока они ничего не разрушили.', '', 29981),
(166110, 'ruRU', 'Спасибо. Теперь рудокопы смогут спокойно поработать.', '', 29981),
(166109, 'ruRU', 'Кобольды завели привычку прокапываться в наши рудники. Нужно защитить от них ресурсы.', '', 29981),
(166108, 'ruRU', 'Это на время отвадит их от Стромгарда. Спасибо за помощь.', '', 29981),
(166107, 'ruRU', 'Огры вообще скверные соседи, но клан Тяжелого Кулака особенно выделяется. Научи их хорошим манерам.', '', 29981),
(166106, 'ruRU', 'Еще одна победа Альянса!', '', 29981),
(166105, 'ruRU', 'Орда удерживает несколько ключевых позиций. Нужно это исправить.', '', 29981),
(166104, 'ruRU', 'Тревога! Взлом системы. УНИЧТОЖИТЬ! УНИЧТОЖИТЬ! УНИЧТОЖИТЬ!', '', 29981),
(166103, 'ruRU', 'Обнаружен взлом системы! Уничтожить нарушителя!', '', 29981),
(166101, 'ruRU', 'Враг приближается! Зачистите берег!', '', 29981),
(166100, 'ruRU', 'Вам конец!', '', 29981),
(166099, 'ruRU', 'Правосудие настигнет вас!', '', 29981),
(166098, 'ruRU', '', 'Это ваша последняя ошибка!', 29981),
(166097, 'ruRU', '', 'Пора преподать вам урок!', 29981),
(166096, 'ruRU', 'Вам не избежать гнева моря!', '', 29981),
(166095, 'ruRU', 'Вы за все ответите!', '', 29981),
(166094, 'ruRU', 'Во мне бушует шторм!', '', 29981),
(166093, 'ruRU', 'Шторм поглотит вас!', '', 29981),
(166092, 'ruRU', 'Обнаружено несанкционированное проникновение. Активированы защитные механизмы последнего рубежа.', '', 29981),
(166091, 'ruRU', 'Броня не спасет!', '', 29981),
(166090, 'ruRU', 'Расплющу!', '', 29981),
(166089, 'ruRU', 'Проморожу до костей!', '', 29981),
(166088, 'ruRU', 'Заморожу души!', '', 29981),
(166087, 'ruRU', 'Волны поднимаются!', '', 29981),
(166086, 'ruRU', 'Море забрало свою жертву.', '', 29981),
(166085, 'ruRU', 'Все недостойные утоплены.', '', 29981),
(166084, 'ruRU', 'Глубины... зовут...', '', 29981),
(166083, 'ruRU', 'Море... снова поднимется...', '', 29981),
(166082, 'ruRU', 'Смерть слабакам!', '', 29981),
(166081, 'ruRU', 'Смерть недостойным!', '', 29981),
(166078, 'ruRU', 'Я хочу телепортироваться к хранителю сокровищницы.', 'Я хочу телепортироваться к хранителю сокровищницы.', 29981),
(166077, 'ruRU', 'Довольно! Никакой пощады Орде!', '', 29981),
(166076, 'ruRU', '', 'Вы заплатите за все!', 29981),
(166075, 'ruRU', '', 'Я не стану марионеткой Бвонсамди!', 29981),
(166074, 'ruRU', 'Раздувшаяся лепрокрыса с громким визгом бросается вам наперерез.', '', 29981),
(166062, 'ruRU', 'Еще большее! Большее! Еще! Гро-о-онг!', '', 29981),
(166061, 'ruRU', 'Остановите ритуал, который пытаются провести култирасцы. И закройте рот этим жрецам!', '', 29981),
(166060, 'ruRU', 'Прикроем, прикроем... А я заодно немного развлекусь!', '', 29981),
(166059, 'ruRU', '', 'Мы здесь не для того, чтобы дразнить Орду. Продолжай ритуал! Нужно прикрыть отступление.', 29981),
(166058, 'ruRU', 'Не стоит связываться с мощью Кул-Тираса, ордынская мерзость!', '', 29981),
(166057, 'ruRU', 'Прорвите оцепление и зачистите доки!', '', 29981),
(166056, 'ruRU', '', 'Она... Майев, поговорим наедине.', 29981),
(166055, 'ruRU', 'Мы еще встретимся, Гнилостень. И я увижу тебя в могиле или в кандалах, обещаю.', '', 29981),
(166054, 'ruRU', '', 'Постой. А где Сира? Вы же были вместе.', 29981),
(166053, 'ruRU', 'Уже уходишь, Шоу? Как жаль. Я только что вырезал твое имя на одной из стрел.', '', 29981),
(166052, 'ruRU', 'Держать оборону! Прикрывайте отход кораблей!', '', 29981),
(166042, 'ruRU', 'Я хочу телепортироваться к Гронгу.', 'Я хочу телепортироваться к Гронгу.', 29981),
(166039, 'ruRU', 'Я хочу телепортироваться к дуэту.', 'Я хочу телепортироваться к дуэту.', 29981),
(166038, 'ruRU', 'Проклятье...', 'Проклятье...', 29981),
(166037, 'ruRU', 'Ее песня принесет вам погибель!', '', 29981),
(166036, 'ruRU', 'Дары моря бывают... соблазнительны!', '', 29981),
(166035, 'ruRU', 'Полундра, салаги! На палубе чужаки!', 'Полундра, салаги! На палубе чужаки!', 29981),
(166034, 'ruRU', 'Чувствуете, как посвежело?', '', 29981),
(166033, 'ruRU', 'Заморожу до костей!', '', 29981),
(166032, 'ruRU', 'Немытая ордынская погань!', '', 29981),
(166031, 'ruRU', 'Вы все недостойны милости моря!', '', 29981),
(166030, 'ruRU', 'Волны... отомстят за меня...', '', 29981),
(166029, 'ruRU', 'Море... поглотит вас...', '', 29981),
(166028, 'ruRU', 'Я же говорил, что это отребье недостойно битвы с детьми Кул-Тираса!', '', 29981),
(166027, 'ruRU', 'Вот и славно. Вам самое место на дне!', '', 29981),
(166026, 'ruRU', '', 'Гром говорит только правду!', 29981),
(166025, 'ruRU', '', 'Слушайте раскаты грома!', 29981),
(166024, 'ruRU', '', 'Шторм не щадит недостойных!', 29981),
(166023, 'ruRU', '', 'Ветер, покарай еретиков!', 29981),
(166022, 'ruRU', '', 'Ярость небес разорвет вас на части!', 29981),
(166021, 'ruRU', '', 'Никому не укрыться от гнева небес!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166020, 'ruRU', '', 'Пусть океан сжалится над их нечистыми душами.', 29981),
(166019, 'ruRU', '', 'Они сражались во имя зла, но теперь их ждет покой.', 29981),
(166018, 'ruRU', '', 'Пусть море... заберет меня...', 29981),
(166017, 'ruRU', '', 'Волны... унесите меня... домой...', 29981),
(166016, 'ruRU', '', 'Упокойся на дне!', 29981),
(166015, 'ruRU', '', 'Море покарало тебя!', 29981),
(166012, 'ruRU', 'Это было потрясающее! Я впечатлен. Мои сканеры показывают, что сейчас здесь снова все в порядке.', '', 29981),
(166011, 'ruRU', 'Подача сигнала канонирам из братства Туманных Парусов', 'Подача сигнала канонирам из братства Туманных Парусов', 29981),
(166010, 'ruRU', '', 'Да, он точно стал больше. Но нам еще надо измерить другие его характеристики.', 29981),
(166009, 'ruRU', 'Только поглядите! Вот это зверь!', '', 29981),
(166008, 'ruRU', 'Ты, наверное, недавно в команде. Я покажу тебе, как мы поступаем с такими отщепенцами!', 'Ты, наверное, недавно в команде. Я покажу тебе, как мы поступаем с такими отщепенцами!', 29981),
(166007, 'ruRU', 'Давай порубим этих сухопутных крыс!', 'Давай порубим этих сухопутных крыс!', 29981),
(166006, 'ruRU', 'Руки прочь, трусливая шавка! Теперь $n в нашей команде.', 'Руки прочь, трусливая шавка! Теперь $n в нашей команде.', 29981),
(166005, 'ruRU', 'Слава Туманным Парусам!', 'Слава Туманным Парусам!', 29981),
(166004, 'ruRU', 'Вперед, дружище! Разграбим это место вместе!', 'Вперед, дружище! Разграбим это место вместе!', 29981),
(166003, 'ruRU', 'Добро пожаловать на борт, дорогуша!', 'Добро пожаловать на борт, дорогуша!', 29981),
(166002, 'ruRU', 'За корсаров Туманных Парусов!', 'За корсаров Туманных Парусов!', 29981),
(166001, 'ruRU', 'Я тебя прикрою, $n!', 'Я тебя прикрою, $n!', 29981),
(166000, 'ruRU', 'Гронг сильный! Сильный Гр-р-ронг!!!', '', 29981),
(165999, 'ruRU', 'Я Гронг. Я помогаю.', '', 29981),
(165998, 'ruRU', 'Оправь его обратно в лагерь, $p. Пора испытать его силу!', '', 29981),
(165997, 'ruRU', '', 'Налицо снижение показателей умственного развития.', 29981),
(165996, 'ruRU', 'Гронг сильный!', '', 29981),
(165995, 'ruRU', 'Но и мешать тебе мы не будем.', '', 29981),
(165994, 'ruRU', '', 'Не советуем этого делать.', 29981),
(165993, 'ruRU', 'Делай больше! Гронг справится.', '', 29981),
(165992, 'ruRU', '', 'Безусловно, он стал быстрее. А как у него дела с интеллектом?', 29981),
(165991, 'ruRU', 'Я хочу отправиться в путь с караваном.', 'Я хочу отправиться в путь с караваном.', 29981),
(165990, 'ruRU', 'Что я могу сделать для $gусталого путника:усталой странницы;?', '', 29981),
(165989, 'ruRU', '', 'Подойди ближе. Это поле укроет тебя от любопытных глаз.', 29981),
(165988, 'ruRU', '', 'Этот корабль... это нечто.', 29981),
(165985, 'ruRU', '', 'Давайте посмотрим, на что способен увеличенный Гронг!', 29981),
(165984, 'ruRU', '', 'Нет! Я не уйду на Ту... Сторону...', 29981),
(165980, 'ruRU', 'Похоже, эта площадка телепорта снова заработала после твоей победы над прототипом \"Раздражатора\". Отсюда доберешься вниз без происшествий.', '', 29981),
(165979, 'ruRU', '', 'Скоро весь наш тяжкий труд окупится, $p. \n\nСкажи мне, когда решишься на исторический поступок!', 29981),
(165978, 'ruRU', '', 'Увеличатель – наше величайшее изобретение!', 29981),
(165977, 'ruRU', 'Ну что ж... Герои... вы знаете, что делать.', '', 29981),
(165976, 'ruRU', 'Да здравствует Зандалар!', '', 29981),
(165975, 'ruRU', 'Я помог пробраться внутрь, теперь все зависит от тебя.', '', 29981),
(165974, 'ruRU', 'Нет, я не сдамся. Что бы ни случилось сегодня... Ваш Альянс рассыплется в прах, а Зандалар даже не заметит этого.', '', 29981),
(165973, 'ruRU', '', 'Где твоя благодарность?', 29981),
(165972, 'ruRU', 'МЫ завоевали этот мир. С НАМИ он обрел славу. А вы... ничто. Очередные дикари, жаждущие подорвать наше величие.', '', 29981),
(165971, 'ruRU', '', 'А о смерти я знаю все.', 29981),
(165970, 'ruRU', 'Зандалары выстроили империю, что простояла тысячи лет, в то время как твои чумазые предки все еще возились в грязи.', '', 29981),
(165969, 'ruRU', 'Ты... изгой, утративший родной дом... вторгаешься в мои священные залы и требуешь, чтобы я отдал тебе мое королевство?', '', 29981),
(165968, 'ruRU', 'Растахан, король Зандалара... От имени Альянса и короля Андуина Ринна я требую, чтобы ты сложил оружие.', '', 29981),
(165967, 'ruRU', '', 'Мы нанесли зандаларам решающий удар. Надеюсь, их король сдастся, чтобы уберечь свой народ от боли и страданий.', 29981),
(165966, 'ruRU', 'Тронный зал впереди.', '', 29981),
(165965, 'ruRU', '', 'Это меньшее, что я могла сделать. Твоя помощь оказалась весьма кстати.', 29981),
(165964, 'ruRU', '', 'Отблагодаришь меня потом.', 29981),
(165963, 'ruRU', 'Сколько еще раз мы должны предать свою честь?!', '', 29981),
(165962, 'ruRU', '', 'Пора уходить!', 29981),
(165961, 'ruRU', '', '...который потом зарежет их во сне.', 29981),
(165960, 'ruRU', '', 'Узнав о его участи, люди наверняка начнут искать его.', 29981),
(165959, 'ruRU', 'Протоколы безопасности нарушены. Основная задача: защитить Гномреган. Дополнительная задача: обрести разум.', '', 29981),
(165958, 'ruRU', 'Эту я точно повешу в рамке над камином.', '', 29981),
(165957, 'ruRU', '', 'Вам лучше отойти от стены. Сейчас она довольно сильно разогреется.', 29981),
(165956, 'ruRU', 'Невероятно! Тебе удалось отключить все защитные механизмы. Я быстренько сфотографируюсь с этой кучей хлама на память об этом дне. Встань рядом, если хочешь, – твоя заслуга в этом тоже есть.', '', 29981),
(165955, 'ruRU', '', 'Ничего подобного, Мортон. Он знает больше слов, чем ты.', 29981),
(165954, 'ruRU', 'Испытания закончены!', '', 29981),
(165953, 'ruRU', 'Все еще хуже, чем я думал: кажется, все защитные механизмы активированы.', '', 29981),
(165952, 'ruRU', 'Здесь творится настоящее безумие, вытащи меня отсюда!', 'Здесь творится настоящее безумие, вытащи меня отсюда!', 29981),
(165951, 'ruRU', 'Эй вы! Ваш узник сбежал!', '', 29981),
(165950, 'ruRU', 'Идите. Я позабочусь о стражниках!', '', 29981),
(165949, 'ruRU', '\"Вопиющая дерзость\"! Как думаешь, такие слова он знает?', '', 29981),
(165948, 'ruRU', '', 'Продолжаем. Надо измерить силу Гронга.', 29981),
(165947, 'ruRU', '', 'Возвращайтесь в лагерь, будем изучать результаты.', 29981),
(165946, 'ruRU', 'Не длинновата ли фраза?', '', 29981),
(165945, 'ruRU', 'Моя... дочь...', '', 29981),
(165944, 'ruRU', 'Я рад, что могу внести свой вклад в научный эксперимент, который поможет победить Орду.', '', 29981),
(165943, 'ruRU', 'У-у-у, свеженькие души в мою коллекцию!', '', 29981),
(165941, 'ruRU', 'Не стоило этим глупцам вторгаться в наш священный город.', '', 29981),
(165940, 'ruRU', 'Так будет с каждым, кто попытается осквернить Зулдазар!', '', 29981),
(165939, 'ruRU', 'Поймал!', '', 29981),
(165938, 'ruRU', 'Это тоже мне...', '', 29981),
(165937, 'ruRU', 'Ха! Еще одна душа в мою коллекцию!', '', 29981),
(165936, 'ruRU', 'Надо было драпать!', '', 29981),
(165935, 'ruRU', 'Смерть захватчикам!', '', 29981),
(165934, 'ruRU', 'Отправляйся к Бвонсамди!', '', 29981),
(165933, 'ruRU', '|TInterface\\Icons\\Ships_ABILITY_Bombers.blp:20|tЛетучий укротитель приматов сбрасывает |cFFFF0000|Hspell:282247|h[\"Макакомучитель-3000\"]|h|r!', '', 29981),
(165932, 'ruRU', 'Поговори с Гронгом. Мы изучим особенности его речи и словарный запас.', '', 29981),
(165931, 'ruRU', '', 'Чудесно! Теперь измерим интеллект.', 29981),
(165930, 'ruRU', 'Экстрактор азерита уничтожен!', 'Экстрактор азерита уничтожен!', 29981),
(165929, 'ruRU', 'Клянусь.', '', 29981),
(165928, 'ruRU', 'Я разместил отметку к югу отсюда. Проверь, сколько времени понадобится Гронгу, чтобы до нее добраться.', '', 29981),
(165927, 'ruRU', 'Будет разумно прикрыть фланги ловушками. Идите, я догоню.', '', 29981),
(165926, 'ruRU', '', 'Сначала измерим скорость Гронга.', 29981),
(165925, 'ruRU', 'Мы входим в самое сердце Дазар\'алора. Здесь зандалары будут сражаться особенно яростно.', '', 29981),
(165924, 'ruRU', 'Альянс благодарит тебе за преданность науке!', '', 29981),
(165923, 'ruRU', 'Эй! Большие и страшные герои Альянса... Погодите!', '', 29981),
(165922, 'ruRU', 'Удачной охоты. Если тебя заметят, возвращайся ко мне или к любому разведчику, и мы снова прибегнем к вуду.', 'Удачной охоты. Если тебя заметят, возвращайся ко мне или к любому разведчику, и мы снова прибегнем к вуду.', 29981),
(165921, 'ruRU', 'Это задание поручили тебе? О, значит, будет весело...$b$bТвое дело – пробраться туда, найти цель и устранить ее. Мы знаем, что она где-то там. Мое дело – укрыть тебя от взоров стражи с помощью вуду, но берегись часовых. Они могут тебя увидеть, так что тебе все же придется держаться в тени.$b$bЯ дам тебе одну дымовую шашку – воспользуешься ею, когда задание будет выполнено. Брось и беги!', 'Это задание поручили тебе? О, значит, будет весело...$b$bТвое дело – пробраться туда, найти цель и устранить ее. Мы знаем, что она где-то там. Мое дело – укрыть тебя от взоров стражи с помощью вуду, но берегись часовых. Они могут тебя увидеть, так что тебе все же придется держаться в тени.$b$bЯ дам тебе одну дымовую шашку – воспользуешься ею, когда задание будет выполнено. Брось и беги!', 29981),
(165920, 'ruRU', 'Мы уже разведали залы и нейтрализовали зандаларские ловушки. Вход должен быть свободен.', '', 29981),
(165919, 'ruRU', 'Проклятье! Я надеялся, что мы с ним разминемся.', '', 29981),
(165918, 'ruRU', 'Прямое попадание! Я останусь здесь, присмотрю за небом.', '', 29981),
(165917, 'ruRU', 'Отойдите, герои! Сейчас я организую вам вход.', '', 29981),
(165916, 'ruRU', 'Координаты переданы. Гелбин, огонь по готовности!', '', 29981),
(165915, 'ruRU', 'Точка входа впереди. Расчистите путь к водопаду!', '', 29981),
(165914, 'ruRU', 'Воздушные силы вызывали?', '', 29981),
(165913, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(165912, 'ruRU', 'Гр-р! Надо бы сбить этих летунов! Куда подевался Меггакрут со своей новой игрушкой?', '', 29981),
(165911, 'ruRU', 'Я хочу телепортироваться к паладину.', 'Я хочу телепортироваться к паладину.', 29981),
(165910, 'ruRU', 'Он был славным парнем и не заслужил такой судьбы. Герои, делайте, что должны, только... не мучьте его.', '', 29981),
(165909, 'ruRU', 'Удачи. Если маскировка спадет, найди в лагере другого агента и попробуй снова.', 'Удачи. Если маскировка спадет, найди в лагере другого агента и попробуй снова.', 29981),
(165908, 'ruRU', 'Этой операцией займешься ты? Хорошо. Мне сказали, что пришлют лучших, но тебя я не ожидал увидеть!$b$bМне приказано оказывать тебе помощь. Я могу спрятать тебя от вражеских глаз – кроме самых зорких. Проберись в их лагерь и устрани цель.$b$bМогу дать еще одну дымовую шашку, чтобы было легче выбраться, когда выполнишь задание. Ретируешься под ее прикрытием!', 'Этой операцией займешься ты? Хорошо. Мне сказали, что пришлют лучших, но тебя я не ожидала увидеть!$b$bМне приказано оказывать тебе помощь. Я могу спрятать тебя от вражеских глаз – кроме самых зорких. Проберись в их лагерь и устрани цель.$b$bМогу дать еще одну дымовую шашку, чтобы было легче выбраться, когда выполнишь задание. Ретируешься под ее прикрытием!', 29981),
(165907, 'ruRU', 'Потрясающе! Тебе удалось открыть первую защитную дверь. Этот зал полон смертоносных бомботов, но мой верный \"Бомбодав\" создан как раз для таких случаев. Он оснащен моими лучшими нитроускорителями и защитным силовым полем, и полностью готов к бою. Залезай – и вперед!', '', 29981),
(165906, 'ruRU', 'Растахан обратил наше оружие против нас!', '', 29981),
(165905, 'ruRU', 'Я задержу зандаларов. А вы разберитесь с этой парочкой!', '', 29981),
(165904, 'ruRU', 'Привет! Привет! Привет!', '', 29981),
(165903, 'ruRU', 'Авангард, за мной! В атаку!', '', 29981),
(165902, 'ruRU', 'Воины, защищайте наш священный город! Бейте врага! Да здравствует Зандалар!', '', 29981),
(165901, 'ruRU', 'У нас мало времени. Армия Орды скоро вернется в город. Вперед!', '', 29981),
(165900, 'ruRU', 'Выдвигаемся! Установить защитный периметр! Сюрпризы нам не нужны.', '', 29981),
(165899, 'ruRU', 'Выпускайте макаку!', '', 29981),
(165897, 'ruRU', 'Пора преподнести Орде сюрприз. То есть нашего друга-примата.', '', 29981),
(165896, 'ruRU', '', 'Помните, наша задача – дестабилизация и устранение представителей Орды. Король Ринн хочет избежать жертв среди мирного населения.', 29981),
(165895, 'ruRU', '', 'Мастер Шоу, захватите порт и готовьтесь двигаться дальше.', 29981),
(165893, 'ruRU', 'Прекрасно! Ложная атака в Назмире оттянула войска Орды от города.', '', 29981),
(165892, 'ruRU', '', 'Но они не ожидали, что наши армии выступят против них объединенным войском. Разбив флот Кул-Тираса, мы решим исход войны.', 29981),
(165891, 'ruRU', 'Наши враги находчивы, этого у них не отнять. Туман дает им преимущество в этом проклятом месте.', '', 29981),
(165890, 'ruRU', '', 'Но сначала надо уничтожить источник этого тумана. Из-за него мы не сможем ударить с воздуха. Он где-то около Заламара, нутром чую!', 29981),
(165889, 'ruRU', 'Мы отвоевали большую часть Назмира. Когда возьмем Заламар, сможем напасть на флот Кул-Тираса.', '', 29981),
(165888, 'ruRU', 'В процессе: не дайте нападающим убить вас!', 'В процессе: не дайте нападающим убить вас!', 29981),
(165887, 'ruRU', '<Защищать валь\'кир, пока они проводят ритуал.>', '', 29981),
(165886, 'ruRU', 'Я привел пленника.', 'Я привела пленника.', 29981),
(165885, 'ruRU', '', 'Заложи взрывчатку. В нужный момент моя магия подорвет ее.', 29981),
(165884, 'ruRU', 'Я хочу телепортироваться к Фриде Сталемуфель.', 'Я хочу телепортироваться к Фриде Сталемуфель.', 29981),
(165883, 'ruRU', '', 'Путь войны и без того извилист. И, боюсь, последние повороты не в нужном направлении.', 29981),
(165882, 'ruRU', 'Приветствую тебя! Спасибо за помощь в тестировании рейда!\n\nЯ могу телепортировать тебя к любому из боссов, доступных для тестирования на данный момент.', 'Приветствую тебя! Спасибо за помощь в тестировании рейда!\n\nЯ могу телепортировать тебя к любому из боссов, доступных для тестирования на данный момент.', 29981),
(165881, 'ruRU', 'Не могу поспорить. Орда снова на перепутье...', '', 29981),
(165880, 'ruRU', 'Похоже, придется возвращаться своим ходом.', '', 29981),
(165879, 'ruRU', '', 'Так уж устроен мир.', 29981),
(165878, 'ruRU', '$n готовит \"Кровяной пир\"!', '$n готовит \"Кровяной пир\"!', 29981),
(165877, 'ruRU', 'Я Гронг.', '', 29981),
(165876, 'ruRU', 'Эшвейн, ты пойдешь с нами.', '', 29981),
(165875, 'ruRU', '', 'Боюсь, по-тихому уже не получится.', 29981),
(165874, 'ruRU', '', 'Освободите моих людей. Они позаботятся, чтобы стража не заскучала.', 29981),
(165873, 'ruRU', '', 'Сколько раз повторять, вы от меня ничего... Хм, а что происходит?', 29981),
(165872, 'ruRU', 'В процессе: прилетает нетопырь и уносит вас в безопасное место!', 'В процессе: прилетает нетопырь и уносит вас в безопасное место!', 29981),
(165871, 'ruRU', '|TInterface\\ICONS\\Ability_Mount_JungleTiger.blp:20|t Вы стали целью |cFFFF0000|Hspell:282447|h[Гнева Кимбула]|h|r!', '|TInterface\\ICONS\\Ability_Mount_JungleTiger.blp:20|t Вы стали целью |cFFFF0000|Hspell:282447|h[Гнева Кимбула]|h|r!', 29981),
(165870, 'ruRU', '', 'Я расскажу тебе о гибели Растахана, когда захочешь послушать.', 29981),
(165869, 'ruRU', '', 'Отойе, я должна знать... как погиб отец.', 29981),
(165868, 'ruRU', '', 'Они напали бесчестно... украли все, что могли унести, а остальное уничтожили.', 29981),
(165867, 'ruRU', 'Пришли.', '', 29981),
(165866, 'ruRU', '', 'Они знали Дазар\'алор, как будто бывали тут раньше...', 29981),
(165865, 'ruRU', '', 'Пошевеливайся.', 29981),
(165864, 'ruRU', '', 'Скажи, Отойе... как захватчики проникли в город?', 29981),
(165863, 'ruRU', 'Ты будешь наблюдателем. \n\nВсегда лучше, когда кто-то есть рядом на случай, если что-то пойдет не так... но, конечно, ничего такого не случится.\n\nСкажи, когда можно будет приступать.', '', 29981),
(165862, 'ruRU', 'Технологии гномов опережают гоблинские изобретения на десятилетия, столетия... поколения!', '', 29981),
(165861, 'ruRU', 'О чем ты... О... такого... я не ожидал.', '', 29981),
(165860, 'ruRU', 'Ну, вообще-то да! Если скипетр такой ценный, он будет храниться именно там, не так ли? Вперед!', '', 29981),
(165859, 'ruRU', 'К кучам золота и богатствам, от которых ломится сокровищница?', '', 29981),
(165858, 'ruRU', 'Подожди-ка. Надо идти туда.', '', 29981),
(165857, 'ruRU', 'Хм... Два выхода из одной комнаты.', '', 29981),
(165856, 'ruRU', 'Сарказм. Слышал о таком?', '', 29981),
(165855, 'ruRU', 'Дальше будут молнии на полу и огонь в коридоре, Фэйрвинд...', '', 29981),
(165854, 'ruRU', 'Смотрите: в этой комнате явно все спокойно. Можем идти!', '', 29981),
(165853, 'ruRU', 'У Майлы просто идеальные рожки... Э-э... не то, чтобы я все время об этом думаю. И не смей трепаться об ее рожках!', '', 29981),
(165852, 'ruRU', 'Почему все так мечтают \"схватить удачу за рога\"? Хватать за рога, знаешь ли, небезопасно. И просто невежливо!', '', 29981),
(165851, 'ruRU', 'Однажды Саурфанг назвал меня \"сливочной коровкой\". Кличка как кличка. Но почему он так странно облизнулся?', '', 29981),
(165850, 'ruRU', 'С фамилиями вроде Кровавого Копыта одно мучение. Мне даже не разрешают ходить по коврам...', '', 29981),
(165849, 'ruRU', 'Таурены – гордый народ.', '', 29981),
(165848, 'ruRU', 'Мы сражаемся по зову долга... за Азерот.', '', 29981),
(165847, 'ruRU', 'Что привело тебя ко мне?', '', 29981),
(165846, 'ruRU', '|cFF0EA6DCАльянс|r уничтожил экстрактор азерита!', '|cFF0EA6DCАльянс|r уничтожил экстрактор азерита!', 29981),
(165845, 'ruRU', '|cFFEF0201Орда|r уничтожила экстрактор азерита!', '|cFFEF0201Орда|r уничтожила экстрактор азерита!', 29981),
(165844, 'ruRU', 'Пусть Мать-Земля улыбнется тебе.', '', 29981),
(165843, 'ruRU', 'Я Бейн, сын Кэрна.', '', 29981),
(165842, 'ruRU', 'Так, $n, давай-ка устроим Альянсу взрывное веселье! И, хм, надеюсь, мы сами при этом не взорвемся.', '', 29981),
(165841, 'ruRU', 'Хм, похоже, они совершенно не понимают, как эта машина работает! Кажется, у нас с ними много общего.', '', 29981),
(165840, 'ruRU', 'Мы пойдем вперед и выгоним Альянс отсюда!', '', 29981),
(165839, 'ruRU', '', 'Каким бы он ни был, нам нужна эта машина, чтобы выбить Альянс из руин.', 29981),
(165838, 'ruRU', 'Э-э... вам нужен объективный ответ или субъективный?', '', 29981),
(165837, 'ruRU', '', 'Патч, $p, отличная работа. Однако бой еще не окончен. У вашей машины еще остался заряд после обезвреживания мин?', 29981),
(165836, 'ruRU', 'Пора отправляться в Ксибалу – навстречу своей судьбе!', '', 29981),
(165835, 'ruRU', 'Да хранят тебя духи.', '', 29981),
(165834, 'ruRU', 'Ловушка в разработке', 'Ловушка в разработке', 29981),
(165833, 'ruRU', 'Чем могу помочь?', '', 29981),
(165832, 'ruRU', 'Сила и верность.', '', 29981),
(165831, 'ruRU', 'Чти тех, кто был до нас.', '', 29981),
(165830, 'ruRU', 'Мы должны заботиться о нашем мире.', '', 29981),
(165829, 'ruRU', 'Вместе мы сильнее.', '', 29981),
(165828, 'ruRU', 'Без чести нет жизни.', '', 29981),
(165827, 'ruRU', 'Да направит нас Мать-Земля.', '', 29981),
(165826, 'ruRU', 'Я буду сражаться за Орду до конца.', '', 29981),
(165825, 'ruRU', 'Хо-хо! Что это у нас тут?', '', 29981),
(165824, 'ruRU', 'Рр-р-аф!', 'Рр-р-аф!', 29981),
(165823, 'ruRU', 'Гр-р...', 'Гр-р...', 29981),
(165822, 'ruRU', 'Арр-у-у-уф!', 'Арр-у-у-уф!', 29981),
(165821, 'ruRU', 'Рр-р...', 'Рр-р...', 29981),
(165820, 'ruRU', 'Гав!', 'Гав!', 29981),
(165819, 'ruRU', 'Рр-р... гав!', 'Рр-р... гав!', 29981),
(165818, 'ruRU', 'Гр-р...', 'Гр-р...', 29981),
(165816, 'ruRU', 'Пойду в грот, попрощаюсь с остальными.', '', 29981),
(165814, 'ruRU', 'Пожелал бы тебе удачи, но... это бесполезно. Супертелепо-орт!', '', 29981),
(165813, 'ruRU', 'Более того, я проанализировал твою жалкую стратегию и с легкостью опережаю тебя на четыре хода. Бесполезно сражаться со столь блестящим интеллектом!', '', 29981),
(165812, 'ruRU', 'Я отключил все протоколы безопасности... и забрал на память одну драгоценную вещицу.', '', 29981),
(165811, 'ruRU', 'У нас есть план. И он настолько сложен, что плебеям вроде тебя ни за что его не понять!', '', 29981),
(165810, 'ruRU', 'Мы следили за тобой. Ты и понятия не имеешь, во что ввязываешься.', '', 29981),
(165809, 'ruRU', 'Отойди от робота... или здесь все взлетит на воздух.', '', 29981),
(165808, 'ruRU', 'Сильвана пятнает позором всех нас. Нужно исцелить Орду, пока мы не потеряли все, что дает нам силу.', '', 29981),
(165807, 'ruRU', 'Нельзя так. Нет в этом чести.', '', 29981),
(165804, 'ruRU', 'Скажите... скажите, где мой отец? А мать? Джайна... Тандред... помогите... мне так одиноко. Не бросайте меня...', '', 29981),
(165802, 'ruRU', 'Я же... погиб, да? Давно? Я вроде не жив, но... Ничего не понимаю. Скажите... умоляю... как такое возможно?', '', 29981),
(165801, 'ruRU', 'Я помню битву... Орки на драконах... Наши корабли... все в огне. Боль, агония, а потом... тьма.', '', 29981),
(165800, 'ruRU', 'Помогите... Я... не понимаю, что случилось. Что со мной стало...', '', 29981),
(165799, 'ruRU', '', 'Эшвейн здесь.', 29981),
(165798, 'ruRU', 'Вальтруа, поджигай.', '', 29981),
(165797, 'ruRU', 'Вперед!', '', 29981),
(165796, 'ruRU', 'Взрыв устроит здесь настоящий хаос.', '', 29981),
(165795, 'ruRU', 'Да, проваливайте! Все равно сейчас здесь будет наша армия.', '', 29981),
(165794, 'ruRU', 'Даже если вы отобьете у нас эти руины, наши войска все равно прорвутся через Назмир. Орде не победить!', '', 29981),
(165793, 'ruRU', '', 'Вы очень проницательны, леди Эшвейн. Думаю, у нас найдутся... общие интересы.', 29981),
(165792, 'ruRU', '', 'Полагаю, вы освободили меня в расчете на встречную услугу.', 29981),
(165791, 'ruRU', 'Ладно, $n, шутки в сторону. Разделаемся с ним по старинке: в корпус с левой, в голову с правой, залп в упор и на закуску крученый!', '', 29981),
(165789, 'ruRU', 'Ваши игрушки бессильны против меня. Сегодня ордынской погани придет конец!', '', 29981),
(165788, 'ruRU', 'Ха! Что этот балбес о себе возомнил? Давайте взорвем его – армия должна идти вперед.', '', 29981),
(165787, 'ruRU', 'Свет хранит меня. Дальше вы не пройдете!', '', 29981),
(165786, 'ruRU', 'Убить всех!', '', 29981),
(165785, 'ruRU', 'За... Праудмуров...', '', 29981),
(165784, 'ruRU', 'Эта ведьма не покинет мой остров!', '', 29981),
(165783, 'ruRU', 'Пора показать вам одно из моих новейших изобретений!', '', 29981),
(165782, 'ruRU', 'Может, попозже я устрою вам экскурсию. Здесь очень мило!', '', 29981),
(165781, 'ruRU', 'Я покажу вам, где карцер. А дальше вы как-нибудь сами.', '', 29981),
(165780, 'ruRU', 'Этого мы давно искали. Ценная добыча!', '', 29981),
(165779, 'ruRU', 'Что? Захлопни пасть, преступник!', '', 29981),
(165778, 'ruRU', '', 'Отличный был... бой...', 29981),
(165777, 'ruRU', '', 'Мне доводилось драться с учениками, которые были сильнее тебя. Тебе до меня очень далеко.', 29981),
(165776, 'ruRU', 'Кажется, слова... не подействовали...', '', 29981),
(165775, 'ruRU', 'Я не позволю тебе мешать моей работе. Мы не просто беззащитные посланники!', '', 29981),
(165774, 'ruRU', 'Эх... не стоило оно того...', '', 29981),
(165773, 'ruRU', 'Не стоило тебе со мной связываться. Я тебя поджарю!', '', 29981),
(165772, 'ruRU', 'Надеюсь, что так.', 'Надеюсь, что так.', 29981),
(165771, 'ruRU', 'Мда... она пойдет по стопам своего отца.', 'Мда... она пойдет по стопам своего отца.', 29981),
(165770, 'ruRU', 'Займу-ка я вас чем-нибудь интересным.', '', 29981),
(165769, 'ruRU', 'Хмф. Не увлекайся.', '', 29981),
(165768, 'ruRU', '', 'Офицер! Это знаменитый ордынский бандит Рексар. Упрячьте его в самый дальний и темный угол подземелья!', 29981),
(165767, 'ruRU', '', 'Этот запашок не перебить даже моей магией...', 29981),
(165766, 'ruRU', '', 'Быстрее! Подойдите ко мне. Я создам иллюзию.', 29981),
(165765, 'ruRU', 'Позвольте представить мой любимый прибамбас!', '', 29981),
(165764, 'ruRU', 'Я знаю, что вам по душе копья и топоры. Но вы, наверное, слышали о высоких технологиях!', '', 29981),
(165763, 'ruRU', 'Ваши шансы на победу падают. Экспоненциально. Ежесекундно.', '', 29981),
(165762, 'ruRU', 'С вашей стороны было бы логично сдаться. Хм-м... но кто в Орде дружит с логикой?', '', 29981),
(165761, 'ruRU', 'Так ты согласен?', 'Так ты согласен?', 29981),
(165760, 'ruRU', 'Я Гронг!', '', 29981),
(165759, 'ruRU', 'Мы тебя увеличим, и ты станешь грозным оружием против Орды.', 'Мы тебя увеличим, и ты станешь грозным оружием против Орды.', 29981),
(165758, 'ruRU', 'Что такое каджа\'мит?', 'Что такое каджа\'мит?', 29981),
(165757, 'ruRU', 'Ты точно этого хочешь?', 'Ты точно этого хочешь?', 29981),
(165756, 'ruRU', 'Фактически, каджа\'мит – это руда с необычными свойствами, происхождение которой вызывает немало вопросов. \n\nСтепень ее воздействия на живые организмы определяли различными экспериментами.\n\nРезультаты этих сомнительных исследований показали, что каджа\'мит существенно повышает показатель интеллекта, который затем снова снижается, если прекратить употребление руды.', '', 29981),
(165755, 'ruRU', 'Еще ни в чем я не был так твердо уверен. \n\nЕсли я могу помочь, то обязательно должен это сделать. \n\nНе стоит за меня волноваться. Я готов к любому исходу. \n\nТебе тоже следует подготовиться.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165754, 'ruRU', 'Это моя судьба, $p.', '', 29981),
(165753, 'ruRU', 'Надзиратель хочет видеть вас немедленно! Поторопитесь.', 'Надзиратель хочет видеть вас немедленно! Поторопитесь.', 29981),
(165752, 'ruRU', 'Чем могу помочь?', 'Чем могу помочь?', 29981),
(165751, 'ruRU', 'Советую заземлиться!', '', 29981),
(165750, 'ruRU', 'Сами напросились!', '', 29981),
(165749, 'ruRU', 'Очистить зону посадки!', '', 29981),
(165748, 'ruRU', 'У вас появилась малюсенькая проблемка!', '', 29981),
(165747, 'ruRU', 'Ха! Содрать блестки и золотишко... И окажется, что твоя машина – просто мусор!', '', 29981),
(165746, 'ruRU', 'Думаешь, ты круче меня? Думаешь, ТЫ КРУЧЕ МЕНЯ? Ну держись, жестянщик!', '', 29981),
(165745, 'ruRU', 'Ты собрался биться со мной в этой консервной банке? Тоже мне костюмчик! Заискришь меня насмерть?', '', 29981),
(165744, 'ruRU', 'Не спеши, главный мародер! Твоя шайка никуда не пойдет! После того, что они сделали с моим прекрасным денежным големом...', '', 29981),
(165743, 'ruRU', 'Тревога! Тревога! Аварийный протокол. Катапультирование.', '', 29981),
(165742, 'ruRU', 'Системы... отключаются... нужна... зарядка...', '', 29981),
(165741, 'ruRU', 'Заряд... падает... тревога... тревога...', '', 29981),
(165740, 'ruRU', 'Сбой системы неизбежен. Я... в шоке.', '', 29981),
(165739, 'ruRU', 'Орда – бу! Макака тыц! Кто хорошая макака? Ты-ы хорошая макака!', '', 29981),
(165738, 'ruRU', 'Напоминание: не превышать порог \"милосердия\". Применять разряды только во имя Альянса!', '', 29981),
(165737, 'ruRU', 'Эй! Никто не разрешал тебе трогать эту кнопку!', 'Эй! Никто не разрешал тебе трогать эту кнопку!', 29981),
(165736, 'ruRU', 'Уровень раздражения субъекта растет. Продолжаю шокофикацию.', '', 29981),
(165735, 'ruRU', 'Матрица антагонизации полностью заряжена и готова к бою.', '', 29981),
(165734, 'ruRU', 'Все системы включены. Батареи заряжены. Цель опознана.', '', 29981),
(165733, 'ruRU', 'Система \"Макакомучитель-3000\" готова. Перехожу к \"мотивации\"!', '', 29981),
(165732, 'ruRU', '', 'Без зандаларов и их флота мы вряд ли сможем продолжить войну с Альянсом.', 29981),
(165731, 'ruRU', 'Таланджи скоро станет королевой. Ей решать, присоединятся ли они к нам.', '', 29981),
(165730, 'ruRU', 'Вождь, я думаю, пора начать переговоры с зандаларами.', '', 29981),
(165729, 'ruRU', '', 'Наши солдаты изнурены. Орде нужны новобранцы. Что вы можете предложить?', 29981),
(165728, 'ruRU', '', 'Войска Альянса заняли прочные позиции и не собираются отступать.', 29981),
(165727, 'ruRU', '', 'Лидеры и герои Орды... Я созвала вас, чтобы обсудить ход военной кампании.', 29981),
(165726, 'ruRU', 'Эта тень здесь раньше была?', 'Эта тень здесь раньше была?', 29981),
(165725, 'ruRU', 'Хм, я слышал какие-то странные звуки...', 'Хм, я слышала какие-то странные звуки...', 29981),
(165724, 'ruRU', 'Никому от меня не скрыться...', 'Никому от меня не скрыться...', 29981),
(165723, 'ruRU', 'Я слышу, как ты тут крадешься!', 'Я слышу, как ты тут крадешься!', 29981),
(165722, 'ruRU', 'Что-то здесь не так...', 'Что-то здесь не так...', 29981),
(165721, 'ruRU', 'Я что-то слышал.', 'Я что-то слышала.', 29981),
(165720, 'ruRU', 'У нас нет времени на это. Я должен быть начеку.', 'У нас нет времени на это. Я должна быть начеку.', 29981),
(165719, 'ruRU', 'Фу, ну и гадость. Кто мог учинить такое?', 'Фу, ну и гадость. Кто мог учинить такое?', 29981),
(165718, 'ruRU', 'Теперь я тебя вижу!', 'Теперь я тебя вижу!', 29981),
(165717, 'ruRU', 'Здесь кто-то есть! Поднять тревогу!', 'Здесь кто-то есть! Поднять тревогу!', 29981),
(165716, 'ruRU', 'Не надо было сюда приходить!', 'Не надо было сюда приходить!', 29981),
(165715, 'ruRU', 'Принцесса Таланджи, ты можешь запустить КЛМЖС с помощью своей силы?', 'Принцесса Таланджи, ты можешь запустить КЛМЖС с помощью своей силы?', 29981),
(165714, 'ruRU', '|cFF0EA6DC$n|r активирует экстрактор азерита!', '|cFF0EA6DC$n|r активирует экстрактор азерита!', 29981),
(165713, 'ruRU', 'Наши враги еще пожалеют о том, что решили устроить нам засаду на этом кошмарном болоте, кишащем монстрами и троллями крови!\n\nА может, уже пожалели...', '', 29981),
(165712, 'ruRU', 'А пока я продолжу искать ответы. Если в тенях завелись новые враги, лучше мне добраться до них... пока они не добрались до нас.', '', 29981),
(165711, 'ruRU', 'А ты первой начала смотреть в будущее... и увидела, что оно может принести троллям. Ты юна, но будешь править достойно. Зови, если понадобится совет старого вождя.', '', 29981),
(165710, 'ruRU', 'Таланджи, твоя храбрость спасла Зандалар. Твой отец жил только прошлым, он хотел вернуть давно угасшую империю.', '', 29981),
(165709, 'ruRU', 'Она – вождь, и неважно, как ей достался титул. Теперь ей нужны хорошие советники.', '', 29981),
(165708, 'ruRU', '', 'Но она все-таки возглавляет Орду. И я сделаю все, чтобы ее правление было справедливым.', 29981),
(165707, 'ruRU', 'Итак. Король-лич ни при чем. Эйир говорит, ей на такое не хватит моджо. Бвонсамди вообще ничего не понимает. И никто из них не хотел, чтобы вождем стала Сильвана.', '', 29981),
(165706, 'ruRU', 'Здесь враг! К оружию!', 'Здесь враг! К оружию!', 29981),
(165705, 'ruRU', 'Стража! Окружить их!', 'Стража! Окружить их!', 29981),
(165704, 'ruRU', 'Вижу тебя!', 'Вижу тебя!', 29981),
(165703, 'ruRU', '|cFFEF0201$n|r активирует экстрактор азерита!', '|cFFEF0201$n|r активирует экстрактор азерита!', 29981),
(165702, 'ruRU', '<Этот тарантул выглядит не лучшим образом. \n\nКажется, его избили до смерти.>', '<Этот тарантул выглядит не лучшим образом. \n\nКажется, его избили до смерти.>', 29981),
(165701, 'ruRU', 'Не знаю, что хуже – Альянс или тролли крови! Ладно-ладно, я знаю, что хуже – но давай взорвем и тех, и других!', '', 29981),
(165700, 'ruRU', 'Наконец-то! Возьмусь-ка я лучше за починку КЛМЖС.', '', 29981),
(165699, 'ruRU', '', 'Хотела бы я сказать, что это – худшее место, где мне доводилось прятаться, но это была бы неправда. Пойду починю КЛМЖС.', 29981),
(165698, 'ruRU', 'Рад тебя видеть, $n. Ну что, восстановим КЛМЖС? Я готов!', '', 29981),
(165697, 'ruRU', '[PH] Прибытие к руинам Аубердина.', '[PH] Прибытие к руинам Аубердина.', 29981),
(165696, 'ruRU', '', 'Стремительно атакуем их с тыла.', 29981),
(165695, 'ruRU', 'Начнем наступление.', 'Начнем наступление.', 29981),
(165694, 'ruRU', '', 'Как прикажешь. Орда заплатит за все свои преступления.', 29981),
(165693, 'ruRU', '', 'Собирайте войска. Готовьте оружие. Мы вернем Темные берега.', 29981),
(165692, 'ruRU', '', '$p, убей валь\'кир! Я разберусь с этим дикарем.', 29981),
(165691, 'ruRU', '', 'Гнев Элуны направляет меня. Враг уже рядом.', 29981),
(165690, 'ruRU', '', 'Вот он.', 29981),
(165689, 'ruRU', '', 'Ступай, и помни о своем долге перед Ордой. Победа превыше всего.', 29981),
(165688, 'ruRU', '', 'Попробую выразиться предельно ясно. Ты найдешь предателя. Приведешь его ко мне. И больше меня не подведешь.', 29981),
(165687, 'ruRU', '', 'Как удачно, что тебе удалось сбежать, отделавшись синяками. Удачно... и досадно.', 29981),
(165686, 'ruRU', '', 'Итак, ты хочешь сказать, что Саурфанг в одиночку перебил целый отряд во главе с моим лучшим следопытом?', 29981),
(165685, 'ruRU', '', 'Идем. Дальше их будет еще больше.', 29981),
(165684, 'ruRU', '', 'Осторожно!', 29981),
(165683, 'ruRU', '', 'Надеюсь, Тиранда еще где-то здесь.', 29981),
(165682, 'ruRU', '', 'Око Элуны должно быть в доме охотников. Вперед!', 29981),
(165675, 'ruRU', '', 'Пусть богиня благоволит тебе.', 29981),
(165674, 'ruRU', '', 'Укажи мне цель.', 29981),
(165673, 'ruRU', '', 'Положись на меня.', 29981),
(165672, 'ruRU', '', 'Часовые готовы.', 29981),
(165671, 'ruRU', '', 'Я не промахиваюсь.', 29981),
(165670, 'ruRU', '', 'Слушаю.', 29981),
(165669, 'ruRU', '', '$p, сюда! Ты как раз вовремя!', 29981),
(165668, 'ruRU', '', 'Не подпускай врагов к порталу!', 29981),
(165667, 'ruRU', '', 'Так держать!', 29981),
(165666, 'ruRU', 'Гронг, который изобрел его вместе с нами, самоотверженно согласился на увеличание ради всеобщего блага.', '', 29981),
(165665, 'ruRU', 'Когда процесс завершится, мы натравим его на Орду!', '', 29981),
(165664, 'ruRU', 'Может, испытать его на ордынцах?', '', 29981),
(165663, 'ruRU', 'Результат совместных усилий интеллекта Да\'ки и гномской изобретательности.', '', 29981),
(165662, 'ruRU', '', 'Но первым делом нам надо провести небольшое испытание.', 29981),
(165661, 'ruRU', '', 'Извини меня. Просто мы все знаем, что ты у него в фаворитах.', 29981),
(165660, 'ruRU', '', 'Не говори глупости! Если это сработает, мы превратим своих врагов в непобедимое оружие.', 29981),
(165659, 'ruRU', '', 'Ты думаешь головой?! Если все кончится очень плохо, ты сам скажешь Халфорду, что мы убили его любимчика?', 29981),
(165658, 'ruRU', '', 'Технически устройство преобразует интеллект в массу и силу, но не стоит забивать голову деталями.', 29981),
(165657, 'ruRU', '', 'Как ясно из названия, он способен увеличивать.', 29981),
(165656, 'ruRU', '', 'Знакомься: увеличатель!', 29981),
(165655, 'ruRU', '', 'Мы – калдорай!', 29981),
(165654, 'ruRU', '', 'Но они жестоко ошиблись. Ибо надежду питают не деревья, а наша верность друг другу!', 29981),
(165653, 'ruRU', '', 'Враги сожгли наши леса, чтобы убить надежду.', 29981),
(165652, 'ruRU', '', 'Элуна даровала нам силу для спасения!', 29981),
(165651, 'ruRU', '', 'Сегодня мы победили!', 29981),
(165650, 'ruRU', '', 'Мы отомстим за погибших и покажем Сильване, что ей нас не победить. А если Альянс не поможет... справимся без него.', 29981),
(165649, 'ruRU', 'Тиранда...', '', 29981),
(165648, 'ruRU', '', 'Зная, что Орда не обратит его против моего народа, я буду спать спокойнее. Спасибо, что вернули его.', 29981),
(165647, 'ruRU', '', 'Я с детства слышала о силе этого артефакта.', 29981),
(165646, 'ruRU', 'Альянс навсегда запомнит храбрость и жертвенность мастера клинка Телаамона и других героев.', '', 29981),
(165645, 'ruRU', 'Здесь будет наша база. Башал\'Аран принадлежит Орде!', '', 29981),
(165644, 'ruRU', '', 'Мы вернем Башал\'Аран Орде. Выступаем!', 29981),
(165643, 'ruRU', 'Башал\'Аран. Жемчужина наших лесов... Мы вернем его.', '', 29981),
(165642, 'ruRU', 'Королеве-банши мало невинных жертв, Гнилостень?', '', 29981),
(165641, 'ruRU', 'Помните: с этого момента враги будут следить за каждым нашим шагом. Выдвигаемся.', '', 29981),
(165640, 'ruRU', '', 'Удачной охоты.', 29981),
(165639, 'ruRU', '', 'Орда совсем забыла о чести, Сира? Тебя ждет правосудие.', 29981),
(165638, 'ruRU', '', 'Не щадите никого и не ждите пощады!', 29981),
(165637, 'ruRU', 'Смотрите, кто показался. Само воплощение силы ночных эльфов!', '', 29981),
(165636, 'ruRU', 'Мы не отступим. Орда заплатит за свои преступления!', '', 29981),
(165635, 'ruRU', 'Конечно, жертвы неизбежны... Но, если все пойдет по плану, война может закончиться в течение нескольких недель.', '', 29981),
(165634, 'ruRU', 'Все на берег, быстро!', '', 29981),
(165633, 'ruRU', '', 'Все на берег, пока основные силы врага не подошли!', 29981),
(165632, 'ruRU', 'Скорее, к берегу!', '', 29981),
(165631, 'ruRU', '', 'Если мы хотим прекратить кошмар, нужно захватить Башал\'Аран. Вперед!', 29981),
(165630, 'ruRU', '', 'Элуна оставила эти земли. Уходите, или я убью вас всех!', 29981),
(165629, 'ruRU', '', 'И не надейся, Майев! Вы не остановите нас!', 29981),
(165628, 'ruRU', '', 'Не отступайте. Орда оскверняет земли калдорай. Отобьем Аубердин!', 29981),
(165627, 'ruRU', '', '<хихикает>', 29981),
(165626, 'ruRU', 'Теперь ждем. Гномы приберегут наше секретное оружие до подходящего момента.', '', 29981),
(165625, 'ruRU', 'Не стоит извинений, лорд-адмирал. Мы рады, что вы присоединились к нашей кампании.', '', 29981),
(165624, 'ruRU', 'Только не медли. Находка Келси может стать ключом к нашему тактическому превосходству над Ордой.', '', 29981),
(165623, 'ruRU', 'Наконец-то ты здесь. Не будем тратить время.', '', 29981),
(165622, 'ruRU', 'Наступил решающий момент. Мы наконец готовы переломить ход войны. Скорее отправляйся на \"Искупление ветра\", нам нужно поговорить.', '', 29981),
(165621, 'ruRU', '', 'Прошу прощения, главнокомандующий Змеевержец. Меня задержали срочные дела.', 29981),
(165620, 'ruRU', 'СТОЙТЕ!', '', 29981),
(165619, 'ruRU', '|TInterface\\ICONS\\ABILITY_PALADIN_BEACONOFLIGHT:20|tРыцарь начинает применять заклинание |cFFFF0000|Hspell:283650|h[Слепящая вера]|h|r!', '', 29981),
(165618, 'ruRU', '', '|TInterface\\ICONS\\SPELL_HOLY_SEALOFWRATH:20|tФрида Сталемуфель начинает высвобождать энергию |cFFFF0000|Hspell:284436|h[печати расплаты]|h|r!', 29981),
(165617, 'ruRU', '', '|TInterface\\ICONS\\Ability_Paladin_EmpoweredSealsRighteous:20|tФрида Сталемуфель начинает высвобождать энергию |cFFFF0000|Hspell:284469|h[печати воздаяния]|h|r!', 29981),
(165616, 'ruRU', '', 'Я тоже. Но как бы там ни было, теперь у Кул-Тираса есть мощный союзник.', 29981),
(165615, 'ruRU', '', 'Благодарю вас, лорд-адмирал. Для меня было честью помочь вам. Но надеюсь, что война скоро закончится.', 29981),
(165614, 'ruRU', '', 'Ты храбро сражалась, Телия. Думаю, твоя смелость еще не раз пригодится нам в этой войне.', 29981),
(165613, 'ruRU', '', 'Передайте главнокомандующему Змеевержцу, что я прибуду на \"Искупление ветра\", как только смогу. Спасибо за помощь.', 29981),
(165612, 'ruRU', '', 'Армия Альянса думает, что окружила нас в крепости Клыка Войны. Но это они сейчас попадут в ловушку!', 29981),
(165611, 'ruRU', 'Рокхан, пойдем со мной. Нужно вернуть гоблинам эти детали.', '', 29981),
(165610, 'ruRU', '', 'А теперь Орда получит свое!', 29981),
(165609, 'ruRU', '', 'Это последний рабочий. Все целы.', 29981),
(165608, 'ruRU', '', 'Сильнейшая из них стала воплощением богини – Ночной Воительницей. Это принесло нам победу.', 29981),
(165607, 'ruRU', '', 'Держись! Не жалей врагов!', 29981),
(165606, 'ruRU', 'Еще одна... Есть! Обезврежена. Хм-м... Недурно, Фэйрвинд.', '', 29981),
(165605, 'ruRU', 'Не отвлекай. Я почти закончил с последними ловушками.', '', 29981),
(165604, 'ruRU', '...хотя, если подумать, големы чем-то напоминают мне мою бывшую.', '', 29981),
(165603, 'ruRU', 'Я, конечно, тронут твоей заботой, но страшными масками и злыми големами меня не испугаешь.', '', 29981),
(165602, 'ruRU', 'Что, пара колдовских масок напугала знаменитого Флинна Фэйрвинда?', '', 29981),
(165601, 'ruRU', 'Ну, тут такое дело... Оказывается, альянсовцы ее разломали и забрали кое-какие детали. И подрывной отряд в придачу.', '', 29981),
(165600, 'ruRU', '', 'Где КЛМЖС?', 29981),
(165599, 'ruRU', 'Но если вы спасете мою команду и вернете детали, я мигом починю эту штуковину, и мы сможем вернуть свое!', '', 29981),
(165598, 'ruRU', 'У нас есть решение для всех проблем, принцесса. КЛМЖС! Правда, враги ее изрядно потрепали и украли несколько деталей.', '', 29981),
(165597, 'ruRU', 'Эти псы заложили ловушки на каждом шагу. Мы не сможем провести здесь армию.', '', 29981),
(165596, 'ruRU', '', 'Я жду объяснений. Две наши армии сидят без дела, вместо того чтобы атаковать Альянс.', 29981),
(165595, 'ruRU', 'Я слышу... смех Бвонсамди...', 'Я слышу... смех Бвонсамди...', 29981),
(165594, 'ruRU', 'Но как же пророчество?..', 'Но как же пророчество?..', 29981),
(165593, 'ruRU', 'Лоа... сжалься надо мной...', 'Лоа... сжалься надо мной...', 29981),
(165592, 'ruRU', 'Тебе помочь? Мне приходилось иметь дело с ловушками. Когда-то.', '', 29981),
(165591, 'ruRU', 'Давай терпи побыстрее!', '', 29981),
(165590, 'ruRU', 'Это сложный механизм. Чтобы его обезвредить, нужна искусность и терпение.', '', 29981),
(165589, 'ruRU', 'Как там дела? Почти готово?', '', 29981),
(165588, 'ruRU', 'Не волнуйся, мы справимся!', '', 29981),
(165587, 'ruRU', 'Сдерживайте их, пока я работаю.', '', 29981),
(165586, 'ruRU', 'Ого...', '', 29981),
(165585, 'ruRU', 'Убить!', '', 29981),
(165584, 'ruRU', 'Все падут!', '', 29981),
(165583, 'ruRU', 'Альянс испытывает мое терпение. Если бы не этот туман, они были бы уже мертвы.', '', 29981),
(165582, 'ruRU', '', 'Спасибо. Идем, побеседуем в тишине.', 29981),
(165581, 'ruRU', 'Долгая история. Я сам не до конца разобрался... но расскажу все, что знаю.', '', 29981),
(165580, 'ruRU', '', 'Столько всего произошло, пока меня не было... Андуин... до меня дошли слухи о старой подруге – Калии Менетил. Что случилось на Арати?', 29981),
(165579, 'ruRU', 'Как хорошо, что вы вернулись, тетя Джайна. Я скучал.', '', 29981),
(165578, 'ruRU', '', 'Еще не очень, но... все будет хорошо. Не переживай, тебе и без меня хватает забот.', 29981),
(165577, 'ruRU', 'Но довольно об этом. Как вы себя чувствуете? Вы сражались с сильнейшими героями Орды, прикрывая отступление флота. Рисковали всем ради Альянса.', '', 29981),
(165576, 'ruRU', '', 'Эта битва обошлась нам слишком дорого.', 29981),
(165575, 'ruRU', 'Наши жрецы также бессильны. Историки напишут о великой победе в Зулдазаре. Но радоваться совсем не хочется.', '', 29981),
(165574, 'ruRU', '', 'Свет может его исцелить?', 29981),
(165573, 'ruRU', '', 'Мне очень жаль, но механизм, поддерживающий в нем жизнь, мне неизвестен.', 29981),
(165572, 'ruRU', 'Джайна, вы можете чем-нибудь помочь Меггакруту?', '', 29981),
(165571, 'ruRU', 'Мы будем бороться до конца. Но, стремясь к победе, мы никогда не должны забывать, кто мы и ради чего сражаемся.', '', 29981),
(165570, 'ruRU', 'Она – источник всех проблем. Думаю, она уже ищет способ, как обратить ситуацию к своей выгоде.', '', 29981),
(165569, 'ruRU', '(свирепо рычит) Нет.', '', 29981),
(165568, 'ruRU', '', 'Я не хочу быть похожей на Сильвану Ветрокрылую. А ты, Генн?', 29981),
(165567, 'ruRU', '...Она бы так поступила.', '', 29981),
(165566, 'ruRU', 'Покажи мне все.', 'Покажи мне все.', 29981),
(165565, 'ruRU', '', 'Напасть, пока зандалары оплакивают смерть своего короля? Чем тогда мы лучше банши?', 29981),
(165564, 'ruRU', 'Альянс захватил большую территорию в Назмире. Противник действует под прикрытием тумана.', '', 29981),
(165563, 'ruRU', 'Наши враги уязвимы как никогда. Мы должны атаковать всей мощью... пока Сильвана не сплела новые козни.', '', 29981),
(165562, 'ruRU', 'В ходе первой атаки мы потопили более половины зандаларского флота. Остатки не выстоят против Кул-Тираса, а у самой Орды на море дела не лучше.', '', 29981),
(165561, 'ruRU', 'Нашей целью было вбить клин между Ордой и зандаларами. Вместо этого, мы лишь укрепили их союз.', '', 29981),
(165560, 'ruRU', 'Андуин, войны без потерь не бывает. А король обязан без колебаний жертвовать собой во имя своего народа.', '', 29981),
(165559, 'ruRU', '<Дори\'тур с надеждой смотрит на вас.>', '', 29981),
(165558, 'ruRU', 'Я понимаю, Генн... Все понимают.', '', 29981),
(165557, 'ruRU', 'Но какой ценой? Столько погибших... Жизнь главного механика Меггакрута висит на волоске. А смерть Растахана, боюсь, только разожжет огонь в сердцах зандаларов.', '', 29981),
(165556, 'ruRU', 'Орда отступает на всех фронтах. Победа Альянса – дело нескольких недель.', '', 29981),
(165555, 'ruRU', 'Мой король, атака на Зулдазар увенчалась успехом.', '', 29981),
(165554, 'ruRU', 'Тебе обязательно надо было это притащить?', '', 29981),
(165553, 'ruRU', 'Южные ворота разрушены!', 'Южные ворота разрушены!', 29981),
(165552, 'ruRU', 'Нельзя лететь через этот туман! У нас уже есть жертвы. Альянс принимает меры для задержки нашего наступления!', '', 29981),
(165551, 'ruRU', 'Я пытался помочь остаткам наших войск, но врагов было слишком много. Этот Телаамон... Он не простой воин.', '', 29981),
(165550, 'ruRU', '', 'Ты можешь рассказать что-нибудь об этом тумане? О руинах Зул\'джана?', 29981),
(165549, 'ruRU', 'На источники азерита Альянса напасть удалось, освободить Эшвейн – тоже. Наверное, им не терпится завершить эту войну.', '', 29981),
(165548, 'ruRU', '', 'Идем! Отправимся в Назмир и положим конец этому безумию.', 29981),
(165547, 'ruRU', 'Идите сюда, трусы! Боралус не сдается!', '', 29981),
(165545, 'ruRU', '', 'Скажем так – мне просто хотелось, чтобы в Даларане меня не считали чужой. Я скучала, Тандред. Даже по твоим колкостям.', 29981),
(165544, 'ruRU', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tОдна из глеф Сиры падает на землю. |cFFFF0000|Hspell:289205|h[Бросьте]|h|r ее в аватару пылающего возмездия!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tОдна из глеф Сиры падает на землю. |cFFFF0000|Hspell:289205|h[Бросьте]|h|r ее в аватару пылающего возмездия!', 29981),
(165543, 'ruRU', 'У меня только один вопрос. Куда делся твой кул-тирасский прононс?', '', 29981),
(165542, 'ruRU', 'Я всегда знал, на чьей ты стороне. А теперь это ясно всем.', '', 29981),
(165541, 'ruRU', 'Джайна, наш флот был обречен. Если бы ты не направила нас домой, мы бы просто погибли. А Эшвейн бы уничтожила Боралус.', '', 29981),
(165540, 'ruRU', '', 'Я боялась, что наш народ меня не примет... что я никогда не смогу оправдать себя перед ним. Перед мамой. Перед тобой.', 29981),
(165539, 'ruRU', '', 'Ордынская тварь!', 29981),
(165538, 'ruRU', '', 'Банду торибас!', 29981),
(165537, 'ruRU', '', 'Вам не выжить!', 29981),
(165536, 'ruRU', 'Природа все равно победит...', '', 29981),
(165535, 'ruRU', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tМайев совершит |cFFFF0000|Hspell:284952|h[рывок]|h|r по направлению к вам. Перенаправьте ее атаку в сторону одной из аватар Сиры!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tМайев совершит |cFFFF0000|Hspell:284952|h[рывок]|h|r по направлению к вам. Перенаправьте ее атаку в сторону одной из аватар Сиры!', 29981),
(165534, 'ruRU', '<TEMP>Line', '', 29981),
(165533, 'ruRU', 'Страшитесь гнева природы!', '', 29981),
(165532, 'ruRU', 'Ветра повинуются мне!', '', 29981),
(165531, 'ruRU', 'Такова природа в гневе.', '', 29981),
(165530, 'ruRU', '<TEMP>Line 4', '', 29981),
(165529, 'ruRU', 'Довольно, Гнилостень. Покончим с этим!', '', 29981),
(165528, 'ruRU', '<TEMP>Line 1', '', 29981),
(165527, 'ruRU', 'Мы готовы начать, мой господин.', 'Мы готовы начать, мой господин.', 29981),
(165526, 'ruRU', '<Натанос окидывает вас ледяным взглядом, и вы думаете, что не стоит тратить его время понапрасну.>', '<Натанос окидывает вас ледяным взглядом, и вы думаете, что не стоит тратить его время понапрасну.>', 29981),
(165525, 'ruRU', 'Смерть... нельзя... победить.', '', 29981),
(165524, 'ruRU', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tМайев совершит |cFFFF0000|Hspell:284952|h[рывок]|h|r по направлению к вам. Перенаправьте ее атаку в сторону одной из аватар Сиры!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tМайев совершит |cFFFF0000|Hspell:284952|h[рывок]|h|r по направлению к вам. Перенаправьте ее атаку в сторону одной из аватар Сиры!', 29981),
(165523, 'ruRU', 'Природа требует возмездия!', '', 29981),
(165522, 'ruRU', '<TEMP>Line', '', 29981),
(165521, 'ruRU', '<TEMP>Line', '', 29981),
(165520, 'ruRU', 'Смерть приходит ко всем.', '', 29981),
(165519, 'ruRU', '<TEMP>Line 4', '', 29981),
(165518, 'ruRU', 'Темные берега наши! Мы изгоним тебя и Орду из наших лесов!', '', 29981),
(165517, 'ruRU', 'Все кончено, Гнилостень! Сдавайся на милость природы!', '', 29981),
(165516, 'ruRU', '<TEMP>Line 1', '', 29981),
(165515, 'ruRU', 'Мы готовы начать, верховный друид.', 'Мы готовы начать, верховный друид.', 29981),
(165514, 'ruRU', '<Малфурион терпеливо ждет.>', '<Малфурион терпеливо ждет.>', 29981),
(165513, 'ruRU', '', 'Так закончилась эта трагическая глава в истории нашего народа. Идем, $p. Пора вернуть светильник в Луносвет.', 29981),
(165512, 'ruRU', 'Лоа покарают вас за невежество!', '', 29981),
(165511, 'ruRU', 'Чужаки! Нечестивцы! Как вы смеете мешать ритуалу?!', '', 29981),
(165510, 'ruRU', '', 'Твой конец... приближается.', 29981),
(165509, 'ruRU', '', 'Меня не так просто одолеть.', 29981),
(165508, 'ruRU', 'Поверить не могу, что Альянс наступает через Назмир. Туда сунется только полоумный.', '', 29981),
(165507, 'ruRU', 'Альянс использует какое-то странное вуду. Будь осторожнее!', 'Альянс использует какое-то странное вуду. Будь осторожнее!', 29981),
(165506, 'ruRU', '', 'Если бы мы сохранили связь с магией Колодца, весь наш народ постигла бы та же участь. С тяжелым сердцем принц Кель\'тас решил уничтожить источник.', 29981),
(165505, 'ruRU', 'Когда-нибудь и я тебя выручу. Ах да, не говори об этом Джабари.', 'Когда-нибудь и я тебя выручу. Ах да, не говори об этом Джабари.', 29981),
(165504, 'ruRU', 'Не думал, что мы снова встретимся! Спасибо за помощь! Я вернусь к Ракире.', 'Не думала, что мы снова встретимся! Спасибо за помощь! Я вернусь к Ракире.', 29981),
(165502, 'ruRU', '', 'Артас истребил остатки нашей армии и осквернил Солнечный Колодец, воскресив с его помощью Кел\'Тузада в облике лича.', 29981),
(165501, 'ruRU', '', 'Ха-ха-ха! Поджарь их как следует, $p! За Орду!', 29981),
(165500, 'ruRU', '', 'Чтобы азеритовый заряд был побольше, пришлось отказаться от тормозов. Надеюсь, ты не возражаешь!', 29981),
(165498, 'ruRU', '', 'Идет! Будем считать, что мы заключили договор!', 29981),
(165497, 'ruRU', '', 'Хе-хе! Дай мне азерит, и я устрою \"бум\", сестричка.', 29981),
(165496, 'ruRU', '', 'Надо еще таких наделать. Несколько сотен... нет, несколько миллионов... Бомбиллионов!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165495, 'ruRU', '', 'Я знала, что ты в конце концов оценишь мой гений.', 29981),
(165494, 'ruRU', '', 'Урака улыбается.', 29981),
(165493, 'ruRU', '', 'Ха-ха! От твоей железной звезды нас здорово трясло всю дорогу от главных ворот, Урака!', 29981),
(165491, 'ruRU', '', 'Наступление Альянса через Назмир – смелый шаг.\n\nГлупый, но смелый. Мы покажем врагам, какова цена их гордыни.', 29981),
(165490, 'ruRU', '', 'Моя сестра погибла. Она уже не сможет исполнить свою часть сделки с Темной Госпожой.\n\nНас осталось так мало.', 29981),
(165489, 'ruRU', 'Я отправлюсь к принцессе – они захватили руины Зул\'джана!', '', 29981),
(165488, 'ruRU', 'Орда будет уничтожена – ради благоденствия Азерота!', '', 29981),
(165487, 'ruRU', 'Атаку Альянса не остановить!', '', 29981),
(165486, 'ruRU', 'Что ты хочешь мне показать?', 'Что ты хочешь мне показать?', 29981),
(165485, 'ruRU', '<Натанос пристально смотрит на лес, не скрывая ненависти.>', '', 29981),
(165484, 'ruRU', '', 'Ну ладно, мне твои руки все равно никогда не нравились.', 29981),
(165483, 'ruRU', '', 'Скажи это Рез\'аку. Ха-ха-ха!', 29981),
(165482, 'ruRU', '', 'И сними эту дурацкую маску. Ты же не из клана Веселого Черепа.', 29981),
(165481, 'ruRU', '', 'Молчи, Квизла. Я знаю, что делаю.', 29981),
(165480, 'ruRU', '', 'Ты слишком плотно набиваешь этот отсек азеритом, Урака. Так можно и без руки остаться.', 29981),
(165479, 'ruRU', '', 'О нет, опять...', 29981),
(165478, 'ruRU', 'Я готов, отправь меня в Гномреган!', 'Я готова, отправь меня в Гномреган!', 29981),
(165477, 'ruRU', '', 'Все бесполезно – уж тебе-то это должно быть сразу ясно.', 29981),
(165476, 'ruRU', '', 'Тебе не победить. Ведь убить меня ты не можешь!', 29981),
(165474, 'ruRU', 'Ну что, $n. Нам с тобой пора в Оргриммар... пока сюда еще кто-нибудь не заявился!', '', 29981),
(165473, 'ruRU', 'Уж надеюсь... Мы в тебя верим.', '', 29981),
(165472, 'ruRU', 'Ступай с честью. Мы еще встретимся.', '', 29981),
(165471, 'ruRU', 'Не в этот раз, друг. Этот путь я должен пройти один.', '', 29981),
(165470, 'ruRU', 'Нет! Я тебя не брошу! Куда верховный воевода, туда и я!', '', 29981),
(165469, 'ruRU', 'Зекхан, ты оставайся в Оргриммаре. Передай всем, кто надеется вернуть честь нашей Орды, – пусть не теряют надежду.', '', 29981),
(165468, 'ruRU', 'Возвращайся к ней. Пусть знает, что я не собираюсь быть ничьей пешкой.', '', 29981),
(165467, 'ruRU', 'Ну вот... Синяки хорошие, жить будешь. То, что надо.', '', 29981),
(165466, 'ruRU', 'Приготовься и вдохни поглубже. Нечасто мне приходится сдерживать удар.', '', 29981),
(165465, 'ruRU', 'Если не хочешь утратить расположение банши, надо убедить ее, что я вас одолел... Не без боя, естественно.', '', 29981),
(165464, 'ruRU', 'Хо-хо! Вот это была битва! Видали, как я их молниями?', '', 29981),
(165463, 'ruRU', 'Как вам эта милая штучка?', '', 29981),
(165462, 'ruRU', 'А сейчас – шокирующий поворот!', '', 29981),
(165461, 'ruRU', 'Вот вам гномская мегапушка на закуску!', '', 29981),
(165460, 'ruRU', 'Вот это мой размерчик!', '', 29981),
(165459, 'ruRU', 'Врубаю максимальную тягу!', '', 29981),
(165458, 'ruRU', '', 'Ну надо же... неужели?', 29981),
(165457, 'ruRU', '', 'Ко мне, соратники! Какой-то дерзкий глупец бросил мне вызов!', 29981),
(165456, 'ruRU', 'Невозможно...', '', 29981),
(165455, 'ruRU', 'Хм, я уже долгие годы сражаюсь с Ордой. Почему ты думаешь, что можешь победить?', '', 29981),
(165454, 'ruRU', 'Надо было... откупиться...', '', 29981),
(165453, 'ruRU', 'Мой тебе совет: не суйся во вражеские лагеря!', '', 29981),
(165452, 'ruRU', '', 'Убить предателя... и его подельников!', 29981),
(165451, 'ruRU', 'За честь Орды! Лок\'тар огар!', '', 29981),
(165450, 'ruRU', 'Довольно болтовни, следопыт! Вы хотите боя – вы его получите!', '', 29981),
(165449, 'ruRU', 'Я уполномочен принять вашу капитуляцию от имени Альянса.', '', 29981),
(165448, 'ruRU', 'Посмотрим, был ли прав Галливикс насчет сообразительности Орды.', '', 29981),
(165447, 'ruRU', 'Вижу, тебя по-прежнему не пугает верная смерть, мой юный друг. Для меня честь сражаться вместе с тобой.', '', 29981),
(165446, 'ruRU', 'Солдаты Альянса, отступайте к гавани! Я вас прикрою!', '', 29981),
(165445, 'ruRU', 'Если на то воля лоа, я умру вместе с тобой, Саурфанг. Ведь мы – Орда!', '', 29981),
(165444, 'ruRU', 'Нет, не один!', '', 29981),
(165443, 'ruRU', '', 'Или умрешь. Один, в этом болоте.', 29981),
(165442, 'ruRU', '', 'Бросай оружие. Ты пойдешь с нами.', 29981),
(165441, 'ruRU', '', 'Хуже того – ты бросил собственный народ и вступил в сговор с людьми против нашего вождя.', 29981),
(165440, 'ruRU', '', 'Ты изменил своему долгу перед Ордой, Саурфанг.', 29981),
(165439, 'ruRU', 'И что же это за приказ?', '', 29981),
(165438, 'ruRU', 'Вы совсем забыли о чести?! Саурфанг столько сделал для Орды, как вы можете такое говорить?!', '', 29981),
(165437, 'ruRU', 'Системы... отказывают... Катапультируюсь...', '', 29981),
(165436, 'ruRU', 'Сбой... системы... нехорошо...', '', 29981),
(165435, 'ruRU', 'Вот почему рулят гномские технологии... а не гоблинская рухлядь!', '', 29981),
(165434, 'ruRU', 'За Гномреган!', '', 29981),
(165433, 'ruRU', 'Минус один, едем дальше!', '', 29981),
(165432, 'ruRU', 'Цель уничтожена!', '', 29981),
(165431, 'ruRU', 'Предлагаю вашему вниманию вершину гномской инженерии!', '', 29981),
(165430, 'ruRU', 'Я тут прикинул ваши шансы уцелеть. Они микроскопические!', '', 29981),
(165429, 'ruRU', 'Беги... от дочери... морей...', '', 29981),
(165428, 'ruRU', 'Стража, ко мне! Прогоним этих грязных ордынцев из нашего города!', '', 29981),
(165427, 'ruRU', 'Что бы это ни было, мы должны ей помешать. Готовься – скоро я снова призову тебя, $n. Мы остановим Сильвану – раз и навсегда.', '', 29981),
(165426, 'ruRU', 'Сильвана не просто так заинтересовалась этим святилищем. Должно быть, она нашла то, что поможет ей обратить ситуацию в свою пользу.', '', 29981),
(165425, 'ruRU', 'Альянс в шаге от победы. От того, чтобы положить конец этой распре и подарить Азероту мир.', '', 29981),
(165424, 'ruRU', 'Еще один Древний бог пробудился... мрачные вести. Наш мир и так многое пережил. Рана в Силитусе, война...', '', 29981),
(165423, 'ruRU', 'Автоматическую защиту Гномрегана перевели в режим повышенной готовности. Если и правда хочешь туда отправиться, будь осторожнее!', '', 29981),
(165422, 'ruRU', '', 'Не вмешивайся, тролль. $n, тебя это тоже касается. Я исполняю приказ вождя!', 29981),
(165421, 'ruRU', '', 'Варок Саурфанг! Ты предал Темную Госпожу. Выходи, или я сожгу эту хижину... как то драгоценное дерево твоих дружков из Альянса.', 29981),
(165420, 'ruRU', 'Тут недалеко ферма... Там прячется Саурфанг. Нам бы добраться до него первыми!', '', 29981),
(165419, 'ruRU', 'Эй, слышь? Давай сюда! Мне нужна твоя помощь!', '', 29981),
(165418, 'ruRU', '', 'Мне нужно сообщить обо всем вождю. Не предпринимай никаких действий, пока я с тобой не свяжусь. Ясно?', 29981),
(165417, 'ruRU', '<Защищать валь\'кир, пока они проводят ритуал.>', '<Защищать валь\'кир, пока они проводят ритуал.>', 29981),
(165416, 'ruRU', 'Эй! Вы что, из Орды? Взять их!', '', 29981),
(165415, 'ruRU', 'Собственно.... вот прямо как сейчас...', '', 29981),
(165414, 'ruRU', 'Они лаяли и рычали, словно взбесились. Они всегда так делают, когда рядом какая-нибудь ордынская погань объявляется.', '', 29981),
(165413, 'ruRU', 'Да, теперь ясно, кто мне собак прошлой ночью всполошил.', '', 29981),
(165412, 'ruRU', 'Если это ваш орк, он здоровый. Берегите себя.', '', 29981),
(165411, 'ruRU', 'Я видел крупные следы сегодня утром. Они вели через перевал в болота.', '', 29981),
(165410, 'ruRU', '', 'Вы не видели следов этого жуткого чудовища на перевале?', 29981),
(165409, 'ruRU', '', 'Ночью на нашу ферму напал ужасный орк... и похитил семейную реликвию!', 29981),
(165408, 'ruRU', '', 'Господин, прошу, помогите нам!', 29981),
(165407, 'ruRU', '', 'Фу! Никак не привыкну ко вкусу этого мерзкого варева.', 29981),
(165406, 'ruRU', '', 'Мне нужно разведать окрестности. Встретимся у Красногорского перевала.', 29981),
(165405, 'ruRU', '', 'Жаль. Вообще-то я люблю пауков.', 29981),
(165404, 'ruRU', '', '...их мать.', 29981),
(165403, 'ruRU', '', 'А это значит, что наш беглец встретил еще и...', 29981),
(165402, 'ruRU', '', 'Сколько лимфы. У молодых тарантулов столько бы не набралось...', 29981),
(165401, 'ruRU', '', 'Они мертвы. И, судя по следам, бой был недолгим.', 29981),
(165400, 'ruRU', '', 'Паутина порвана. Здесь явно кто-то прошел, и это был не гнолл.', 29981),
(165398, 'ruRU', '<Дерек хрипит и содрогается>', '', 29981),
(165397, 'ruRU', '<Дерек кричит>', '', 29981),
(165396, 'ruRU', '', 'Нужно больше времени! Заканчивай, Сигни. Я займусь ими.', 29981),
(165395, 'ruRU', '', 'За Кул-Тирас!', 29981),
(165394, 'ruRU', '', 'Скоро я снова призову тебя. И вместе мы поведем Орду навстречу ее судьбе.', 29981),
(165393, 'ruRU', '', 'Это не просто кинжал. Это факел, который осветит нам путь.', 29981),
(165392, 'ruRU', '', 'Жаль, что сейчас его сила дремлет. Но все, что спит, можно разбудить.', 29981),
(165391, 'ruRU', '', 'Ксал\'атат... удивительное оружие. О нем ходят легенды.', 29981),
(165386, 'ruRU', 'Возьми этот комплект обнаружения и истреби подонков.', '', 29981),
(165385, 'ruRU', 'Эй, ты! Здесь все кишит шпионами, которые портят наши осадные орудия.', '', 29981),
(165384, 'ruRU', 'Всем надо то усмирить бурю, то развернуть течение, и никто не додумается просто заглянуть, поболтать по душам.', '', 29981),
(165383, 'ruRU', 'Не так я представлял себе посмертие.', '', 29981),
(165382, 'ruRU', 'Я был жрецом моря, знаешь ли. Призывал молнии, управлял волнами... Имей в виду.', '', 29981),
(165381, 'ruRU', 'Наслаждайся тем, что имеешь.', '', 29981),
(165380, 'ruRU', 'Не воспринимай жизнь как должное.', '', 29981),
(165379, 'ruRU', 'Помни о том, что для тебя ценно.', '', 29981),
(165378, 'ruRU', 'Моя семья будет в безопасности, чего бы это ни стоило.', '', 29981),
(165377, 'ruRU', 'Я помогу Орде, как она помогла мне.', '', 29981),
(165376, 'ruRU', 'Здесь мой единственный дом.', '', 29981),
(165375, 'ruRU', 'На помощь!', 'На помощь!', 29981),
(165374, 'ruRU', '', 'Ты здесь. Хорошо. Приступим.\n\nЗа смертью короля Растахана стоит дом Праудмуров.\n\nТак что логично будет первым делом расправиться с ними.', 29981),
(165373, 'ruRU', 'Итак, каков наш план, лорд-адмирал?', 'Итак, каков наш план, лорд-адмирал?', 29981),
(165371, 'ruRU', 'Я с тобой.', 'Я с тобой.', 29981),
(165370, 'ruRU', '', 'Этому трусу теперь негде прятаться.', 29981),
(165369, 'ruRU', '', 'На помощь! Я в ловушке!', 29981),
(165368, 'ruRU', '', 'Иди за мной, не отставай.', 29981),
(165367, 'ruRU', 'Дань уважения', 'Дань уважения', 29981),
(165366, 'ruRU', '', 'Лорд Праудмур, я сделала тебе чудесный подарок – шанс вернуться к родным.', 29981),
(165365, 'ruRU', 'Что... Что это? Почему я... Что вы со мной сотворили?!', '', 29981),
(165364, 'ruRU', '', 'Для нас есть только победа или смерть, Бейн.', 29981),
(165363, 'ruRU', 'Это уже слишком!', '', 29981),
(165362, 'ruRU', '', 'А когда мы приведем его разум... в порядок, то позволим Праудмурам спасти своего пропавшего принца...', 29981),
(165361, 'ruRU', '', 'Дерек Праудмур был героем Кул-Тираса.', 29981),
(165360, 'ruRU', 'Что толкнуло тебя на это безумие?!', '', 29981),
(165359, 'ruRU', 'Сильвана!', '', 29981),
(165358, 'ruRU', '', 'Встретимся на борту \"Воя банши\". Я знаю, как заставить семейку Праудмуров заплатить за смерть Растахана.', 29981),
(165357, 'ruRU', '', 'Нет. Война не кончится, пока мы не победим. Пока львенок не приползет к моему трону.', 29981),
(165356, 'ruRU', '', 'Альянс убил короля зандаларов. Какие могут быть переговоры?', 29981),
(165355, 'ruRU', 'Если мы начнем переговоры...', '', 29981),
(165354, 'ruRU', 'Да-да! Это вроде бы то, что надо.', '', 29981),
(165353, 'ruRU', 'Хм... Интересно, что будет, если нажать на эту кнопку?', '', 29981),
(165352, 'ruRU', 'Ох! Не то!', '', 29981),
(165351, 'ruRU', 'Еще только один раз.', '', 29981),
(165350, 'ruRU', '', 'Джайна, не иди одна. Возьми хотя бы этих двух героев!', 29981),
(165349, 'ruRU', '', 'Сейчас я найду путь... Приготовьтесь... Есть. Вперед... и удачи!', 29981),
(165348, 'ruRU', 'Минуту. Я скрою наши манипуляции от троллей... Готово.', '', 29981),
(165347, 'ruRU', '', 'Магистр! Думаю, можно начинать.', 29981),
(165346, 'ruRU', 'Капитан Фэйрвинд...', '', 29981),
(165345, 'ruRU', 'Кстати, а из сокровищницы можно взять сувениры?', '', 29981),
(165344, 'ruRU', '', 'Мы надеемся, что вы изучите пирамиду и тем самым облегчите будущий штурм. Для этого Меггакрут выдал вам... гномский позиционный прибамбас.', 29981),
(165343, 'ruRU', 'Итак, основная задача – добыть Скипетр Глубин. Но главный механик Меггакрут поручил нам еще кое-что.', '', 29981),
(165342, 'ruRU', 'Так я серьезно! Ты моих друзей видел? Таким безумие только на пользу. Да и щупальца, если честно.', '', 29981),
(165341, 'ruRU', 'Это серьезное задание, Фэйрвинд.', '', 29981),
(165340, 'ruRU', '\"Побочные эффекты\" – это что? Безумие? Щупальца? Я так, для друга спрашиваю.', '', 29981),
(165339, 'ruRU', 'Мы призовем силы Бездны, чтобы скрыть магию леди Джайны, пока она будет открывать портал. Мы вроде бы исключили все потенциальные побочные эффекты.', '', 29981),
(165338, 'ruRU', '', 'Сокровищницу тщательно охраняют, но мы с магистром Умбрием придумали, как провести отряд, не подняв тревоги.', 29981),
(165337, 'ruRU', 'Вы не пройдете, пока я жив!', 'Вы не пройдете, пока я жива!', 29981),
(165336, 'ruRU', 'Вам конец, чудовища!', 'Вам конец, чудовища!', 29981),
(165335, 'ruRU', 'За Луносвет!', 'За Луносвет!', 29981),
(165334, 'ruRU', '', 'Здесь его нет.', 29981),
(165333, 'ruRU', 'Короче, отвечаю на твой вопрос... Не видели мы вчера ночью никаких щеночков. По крайней мере, я щенков не помню.', '', 29981),
(165332, 'ruRU', 'Ты, главное, не отчаивайся! У тебя большое сердце, а это чего-то да стоит.', '', 29981),
(165331, 'ruRU', 'Никто не укутывает одеялом лучше нее, скажу я вам.', '', 29981),
(165330, 'ruRU', 'И вместо лучшего свидания в ее жизни бедняжке Дарси пришлось уложить бедолагу в постель и драить пол.', '', 29981),
(165329, 'ruRU', 'Вчера на обед была вареная рыба с картошкой. Этого я еще долго не забуду.', '', 29981),
(165328, 'ruRU', 'Но как только он глянул на ее мясное рагу, бурлящее в котелке, как его обед мигом попросился на волю.', '', 29981),
(165327, 'ruRU', 'Я не мог больше терпеть! К тому же, когда ты еле держишься на ногах, трудно держать себя в руках.', '', 29981),
(165326, 'ruRU', 'И тут он решил, что пойдет к Дарси Паркер и признается в своих чувствах.', '', 29981),
(165325, 'ruRU', 'Хватит уже, ты им достаточно рассказал...', '', 29981),
(165324, 'ruRU', 'Я и глазом моргнуть не успел, как мой напарник так набрался, что едва на ногах стоял...', '', 29981),
(165323, 'ruRU', 'Ну, вообще-то мне запомнился в основном не отгул, а полная бутылка очень славного рома, которую нам никто не запрещал тут же распить.', '', 29981),
(165322, 'ruRU', 'Да ладно тебе. К нам приходил сам мастер Шоу! Не каждый день глава ШРУ самолично дает тебе отгул.', '', 29981),
(165321, 'ruRU', 'Эй! Им об этом знать не обязательно!', '', 29981),
(165320, 'ruRU', 'Прошлой ночью? Мы мало что помним о прошлой ночи, да? Ха-ха!', '', 29981),
(165319, 'ruRU', '', 'Он ночью убежал, вы его не видели?', 29981),
(165318, 'ruRU', '', 'Моя доченька потеряла щенка!', 29981),
(165317, 'ruRU', '', 'Прошу, помогите нам!', 29981),
(165316, 'ruRU', 'Не брать! Мое!', '', 29981),
(165305, 'ruRU', '', 'Обожаю футболки! Вы любите футболки так, как я?! Быть такого не может!', 29981),
(165304, 'ruRU', 'У меня плохое предчувствие. Будь начеку!', '', 29981),
(165303, 'ruRU', 'Берегись!', '', 29981),
(165302, 'ruRU', 'Ого. Это ж надо было так вымахать.', '', 29981),
(165301, 'ruRU', 'Скорее! Отбери у них припасы!', '', 29981),
(165300, 'ruRU', 'Захвати их припасы! Лиши наг всякого преимущества!', '', 29981),
(165299, 'ruRU', 'Ха! Пускай улепетывают!', '', 29981),
(165298, 'ruRU', 'Вот так... Так им и надо!', '', 29981),
(165297, 'ruRU', 'Преподай урок этим ползучим гадам!', '', 29981),
(165296, 'ruRU', 'Спаси пленных, пока наги не сотворили с ними ничего ужасного!', '', 29981),
(165295, 'ruRU', 'Пленникам нужна твоя помощь!', '', 29981),
(165285, 'ruRU', 'Моя королева... со всех аванпостов приходят вести. Альянс сжимает хватку. Мы в шаге от поражения.', '', 29981),
(165284, 'ruRU', '', 'Мы не отворачиваемся от союзников, Таланджи. Конечно, кампания приняла... нежелательный оборот. Но война еще не проиграна.', 29981),
(165283, 'ruRU', '', 'Титулы сейчас для меня мало значат. Скажи... после гибели зандаларского флота Орда оставит нас?', 29981),
(165282, 'ruRU', '', 'Мои соболезнования, принцесса... кхм... королева Таланджи.', 29981),
(165281, 'ruRU', 'Довольно! Вождь прибыла.', '', 29981),
(165280, 'ruRU', 'Сейчас не время рассуждать о мести, Гнилостень!', '', 29981),
(165279, 'ruRU', 'Теперь вы знаете, что такое коварство Альянса. Месть поможет вам утолить горе.', '', 29981),
(165278, 'ruRU', 'Таланджи, я знаю, что такое потерять отца. Если я могу чем-то помочь тебе – только скажи.', '', 29981),
(165277, 'ruRU', '', 'Хорошо, что ты здесь, $n. Зулдазар еще приходит в себя после нападения Альянса. Мой народ потрясен... и я тоже.', 29981),
(165276, 'ruRU', 'Теперь они сюда не сунутся ни ногой... хм... Ноги у наги. Хе-хе. Кхм. Спасибо тебе.', '', 29981),
(165275, 'ruRU', 'Проклятые наги лезут на берег. Проучи их, да так, чтоб запомнили!', '', 29981),
(165274, 'ruRU', 'Азшара держала все моря в страхе, когда у меня еще панцирь не зашершавел. Давно пора поставить ее на место.', '', 29981),
(165273, 'ruRU', 'А куда это наги собрались? Не знаю, что им нужно, но мы должны остановить их.', '', 29981),
(165272, 'ruRU', 'Да исполнится твоя воля! Они покорятся... или умрут!', '', 29981),
(165271, 'ruRU', 'Терпение... Терпение... Как знать, вдруг они достойны моего дара. Я отведаю их снов... их плоти.', '', 29981),
(165270, 'ruRU', 'Презренные смертные оскверняют твое святилище, повелитель. Утопим их! Смоем следы святотатства!', '', 29981),
(165269, 'ruRU', 'От этих наг у меня просто мурашки по панцирю! Спасибо за помощь!', '', 29981),
(165268, 'ruRU', '', 'Ха! Какая прелесть... Меня сейчас стошнит.', 29981),
(165267, 'ruRU', 'Беда, $n. Придется все-таки драться с нагами. Вперед!', '', 29981),
(165266, 'ruRU', 'Не знаю, что именно нужно Азшаре. Но теперь нам придется присматривать за берегом.', '', 29981),
(165265, 'ruRU', 'Ф-ф... ф-ф... ф-ф-ф-футболки!', 'Ф-ф... ф-ф... ф-ф-футболки!', 29981),
(165264, 'ruRU', 'Футболок хватит на всех!', 'Футболок хватит на всех!', 29981),
(165263, 'ruRU', 'Кто любит бесплатные футболки?!', 'Кто любит бесплатные футболки?!', 29981),
(165262, 'ruRU', 'У меня столько футболок, стрелять – не перестрелять!', 'У меня столько футболок, стрелять – не перестрелять!', 29981),
(165261, 'ruRU', 'Оп-оп!', 'Оп-оп!', 29981),
(165260, 'ruRU', 'У-у-у-ух!', 'У-у-ух!', 29981),
(165259, 'ruRU', 'Получайте по футболке!', 'Получайте по футболке!', 29981),
(165258, 'ruRU', 'И-и-и-и-эх!', 'И-и-эх!', 29981),
(165257, 'ruRU', 'Кто-то должен остановить этих наг. И сегодня этот кто-то – ты.', '', 29981),
(165256, 'ruRU', '', 'Тысячи невинных жертв. Целые семьи уничтожены в один миг.', 29981),
(165255, 'ruRU', '', 'Приступим.', 29981),
(165254, 'ruRU', '', 'Нет! Так не должно быть...', 29981),
(165253, 'ruRU', '<Вы дергаете рычаги в случайном порядке.>', '<Вы дергаете рычаги в случайном порядке.>', 29981),
(165252, 'ruRU', 'Она укажет вам путь. Идите... идите. Час, когда откроются все глаза, уже близок.', '', 29981),
(165251, 'ruRU', 'Примите величайший из даров. Мой сон теперь будет вашим. Круг звезд, обретший форму.', '', 29981),
(165250, 'ruRU', 'Да... вы действительно те, кто мне нужен. Те, кто изменит историю.', '', 29981),
(165249, 'ruRU', 'Повинуйтесь!', '', 29981),
(165248, 'ruRU', 'На колени!', '', 29981),
(165247, 'ruRU', 'Угасайте!', '', 29981),
(165246, 'ruRU', 'Взгляд бога обращает жалкие безделушки в прах.', '', 29981),
(165245, 'ruRU', 'С каждым новым выбором вы все лучше служите мне.', '', 29981),
(165244, 'ruRU', 'Да... вы все ближе... все ближе и ближе...', '', 29981),
(165243, 'ruRU', 'Наконец-то... примите истину тьмы.', '', 29981),
(165242, 'ruRU', 'Пусть волны затянут вас в мой сон...', '', 29981),
(165241, 'ruRU', 'Ближе... Ближе...', '', 29981),
(165240, 'ruRU', 'Дети... Глубины – мое царство.', '', 29981),
(165239, 'ruRU', 'Заставьте ярость служить вам... Сделайте ненависть своим оружием.', '', 29981),
(165238, 'ruRU', 'Шторм дает силу... но за нее придется заплатить.', '', 29981),
(165237, 'ruRU', 'О... Вы думаете, что знаете, что такое настоящая сила.', '', 29981),
(165234, 'ruRU', 'Могучий Н\'Зот, приди на помощь своему верному слуге!', '', 29981),
(165233, 'ruRU', 'Его гнев пробудился!', '', 29981),
(165232, 'ruRU', 'Слава повелителю!', '', 29981),
(165231, 'ruRU', 'Познайте его истинную силу!', '', 29981),
(165230, 'ruRU', 'Он видит каждый путь... каждый обретший форму сон!', '', 29981),
(165229, 'ruRU', 'У него больше слуг, чем звезд в небе... чем песчинок в пустыне!', '', 29981),
(165228, 'ruRU', 'Его глаза видят всю правду... все бессчетные преступления!', '', 29981),
(165227, 'ruRU', '', 'Тельдрассил сгорел, потому что я пощадила Саурфанга.', 29981),
(165226, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(165225, 'ruRU', 'Поднимается кровавый прилив!', '', 29981),
(165224, 'ruRU', '', 'Начнем охоту?', 29981),
(165223, 'ruRU', 'Всем суждено... пробудиться...', '', 29981),
(165222, 'ruRU', 'Повелитель... они... достойны...', '', 29981),
(165221, 'ruRU', 'Они не подходят тебе, повелитель. Мы найдем других, и они откроют путь.', '', 29981),
(165220, 'ruRU', 'Испытаны... и признаны недостойными.', '', 29981),
(165219, 'ruRU', 'Твой последний сон будет вечным!', '', 29981),
(165218, 'ruRU', 'Ничтожество!', '', 29981),
(165217, 'ruRU', 'Твоя плоть была слишком слаба!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165215, 'ruRU', 'На колени перед истинным повелителем!', '', 29981),
(165214, 'ruRU', 'Вы заплатите за свою дерзость!', '', 29981),
(165213, 'ruRU', 'Если не остановить Орду, она захватит весь Азерот. Сражайся. Стой насмерть.', '', 29981),
(165212, 'ruRU', '', 'Ритуал почти завершен. $p, активируй Око Элуны!', 29981),
(165211, 'ruRU', '', 'Мощь зандаларов сокрушит Альянс.', 29981),
(165210, 'ruRU', '', 'Путь к Эйир преграждают валь\'киры. Сдается мне, они вряд ли захотят пропустить нас к ней.', 29981),
(165209, 'ruRU', 'Готово. Роммат! Перенеси нас отсюда.', '', 29981),
(165208, 'ruRU', 'Ритуал действует! Магистры, удерживайте поток!', '', 29981),
(165207, 'ruRU', 'Placeholder: Солнечный колодец взрывается', 'Placeholder: Солнечный колодец взрывается', 29981),
(165206, 'ruRU', 'Трусливые отродья... Позаботься о том, чтобы эти земли им не достались.', '', 29981),
(165205, 'ruRU', 'Мы будем бить Орду на море, на суше и в воздухе. Не щади никого!', '', 29981),
(165204, 'ruRU', 'Атака на Кул-Тирас застопорилась. Прорви вражеский строй, и мы сможем продвинуться дальше!', '', 29981),
(165203, 'ruRU', 'Мы встретим врагов на поле боя. Сокруши их и принеси нам победу!', '', 29981),
(165202, 'ruRU', '', 'Трусливые альянсовские крысы боятся к нам выходить, но мы их заставим! Расчехляй ползучие мины!', 29981),
(165201, 'ruRU', '', 'План простой: видишь кого-нибудь из Альянса – убиваешь его. И мне неважно, как.', 29981),
(165200, 'ruRU', '', 'Враги наступают. Отрази их натиск и нанеси Орде сокрушительный удар.', 29981),
(165199, 'ruRU', '', 'Это варварство не должно продолжаться! Слава Альянсу!', 29981),
(165198, 'ruRU', 'М-м, да тут у нас что-то интересное. Ты уж смотри, не подведи Орду.', '', 29981),
(165197, 'ruRU', 'Тут повсюду рыщут ищейки Альянса. Не к добру это. Берегись там. И удачной охоты.', '', 29981),
(165196, 'ruRU', 'Не только мы сражаемся здесь с Ордой. Окажи помощь местному сопротивлению в их борьбе.', '', 29981),
(165195, 'ruRU', 'Где-то здесь прячется один из старших офицеров Орды. Найди и уничтожь его.', '', 29981),
(165194, 'ruRU', 'Еще одна победа Альянса. И все благодаря тебе!', '', 29981),
(165193, 'ruRU', 'Враги обращаются с магией, как дети с оружием. Преподай им урок.', '', 29981),
(165192, 'ruRU', 'Ха! Сверху они такие мелкие. Бегите, муравьишки!', '', 29981),
(165191, 'ruRU', 'Альянс захватил соседние земли... Но чтобы выбить их оттуда, нам хватит и неба.', '', 29981),
(165190, 'ruRU', '', 'Многое поставлено на карту. Орда должна победить!', 29981),
(165189, 'ruRU', '', 'Вырвем победу из рук Альянса. За Орду!', 29981),
(165188, 'ruRU', 'Альянс уже встретил здесь сопротивление. Найди их лидеров и помоги им отбросить врага.', '', 29981),
(165187, 'ruRU', 'Наши войска вступили в бой! Помоги им и принеси славу Орде!', '', 29981),
(165186, 'ruRU', 'Эти больные подсвинки сползаются к богатым залежам азерита! А мы что ж это, дадим его заграбастать?!', '', 29981),
(165185, 'ruRU', 'Эти плешивые ордынские зайцелопы перехватили наш отряд! Чего ждешь? А ну марш туда!', '', 29981),
(165184, 'ruRU', 'Вождь все еще верит в свою победу. Покажи ей, что она заблуждается.', '', 29981),
(165183, 'ruRU', 'Орда решила высунуть свой нос... Покажи врагам, как мы страшны в гневе!', '', 29981),
(165182, 'ruRU', 'Мои наездники на грифонах нашли врага. Пора в бой, $n!', '', 29981),
(165181, 'ruRU', 'Что-то тут дела совсем плохи! Разберись-ка с этой проблемой!', '', 29981),
(165180, 'ruRU', 'Альянс дает им оружие? Они совсем из ума выжили? Покончим с этим! Вышибем их из Зандалара!', '', 29981),
(165179, 'ruRU', 'Это станет неприятным сюрпризом для Орды. А если тролли крови нечаянно поранятся... Это будет вдвойне удачно.', '', 29981),
(165178, 'ruRU', '', 'Если бы враги заботились о земле так же, как мы, они избежали бы этой участи. Но нам повезло. Прощай, $n.', 29981),
(165177, 'ruRU', '', 'Вместе мы не оставим ни единого шанса Орде. Слава Альянсу!', 29981),
(165176, 'ruRU', 'Орда дрогнула. Найди генерала Оперенную Луну. Нанесите врагу решающий удар!', '', 29981),
(165175, 'ruRU', 'В пустыне Вол\'дуна не за что сражаться. Поэтому Орду он не заботит. А вот нам стоит извлечь из этого выгоду.', '', 29981),
(165173, 'ruRU', 'Получилось! Врагу придется отступить, чтобы зализать раны. Возвращайся на базу. Спасибо тебе, $n.', '', 29981),
(165172, 'ruRU', 'Орда ожидает столкновения на воде. Поэтому мы опустимся под воду.', '', 29981),
(165171, 'ruRU', 'Мастер Шоу придумал хитрый план освобождения Назмира от Орды. Вернись на наш аванпост, чтобы начать операцию.', '', 29981),
(165170, 'ruRU', 'Эти болота расположены на расстоянии марш-броска от столицы зандаларов. Изгнав отсюда Орду, мы получим огромное преимущество.', '', 29981),
(165169, 'ruRU', 'Получилось! Я прерву ритуал. С такими могущественными силами лучше соблюдать осторожность.', '', 29981),
(165168, 'ruRU', 'Бездна – опасный союзник и смертоносный враг. Нужно использовать это существо против врагов, пока его сила не превзошла нашу.', '', 29981),
(165167, 'ruRU', 'Наша атака потрясла врагов, но чтобы обескровить зандаларов, нужно нанести рану поглубже. Магистр Умбрий готовит особый ритуал. Помоги ему.', '', 29981),
(165166, 'ruRU', 'Зулдазар – жемчужина империи Зандалари. По крайней мере, так считают эти тролли. Здесь мы нанесем решающий удар и разобьем новых союзников Орды.', '', 29981),
(165165, 'ruRU', 'Уа-ха-ха! Вид летящего орка с поджаренным задом – услада для моих старых глаз. Вот спасибо!', '', 29981),
(165164, 'ruRU', 'Пора устроить настоящее пекло этим трусливым кроголюбам! Разнеси здесь все!', '', 29981),
(165163, 'ruRU', 'Уже лучше. Но чтобы остановить это бредовое нашествие, мы должны поразить врага в самое сердце.', '', 29981),
(165162, 'ruRU', 'В долине Штормов уже все провоняло Ордой. Положи конец их нелепому вторжению и не стесняйся в средствах.', '', 29981),
(165161, 'ruRU', 'Ух! Остались одни обломки! Теперь-то Орда точно не сможет бомбить Друствар!', '', 29981),
(165160, 'ruRU', 'Нашим в Друстваре и так нелегко приходится, а тут еще Орда со своей чумой. Разберись с этим!', '', 29981),
(165159, 'ruRU', 'Подлые слуги Сильваны принесли в наши земли чуму! Скорее, нужно остановить их!', '', 29981),
(165158, 'ruRU', 'Враги осмелились напасть на Друствар, но они явно переоценили свои силы. Отбрось их.', '', 29981),
(165157, 'ruRU', 'Что ж, поездка обещает быть интересной.', '', 29981),
(165156, 'ruRU', 'Думаю, ты прав, капитан. $p, надо с этим разобраться.', '', 29981),
(165155, 'ruRU', 'Здесь безопасно... пока что. Медлить нельзя.', '', 29981),
(165154, 'ruRU', 'Вот тебе и \"тихо\".', '', 29981),
(165153, 'ruRU', 'Сейчас станет жарко, кроха!', '', 29981),
(165152, 'ruRU', 'Их надо остановить!', '', 29981),
(165151, 'ruRU', 'Ха! Вот это рвануло так рвануло! Придется им обратно до Зандалара вплавь добираться!', '', 29981),
(165150, 'ruRU', 'Ордынский корабль обстреливает Боралус, а ведь там полно мирных жителей! Нам нужно сбить его.', '', 29981),
(165149, 'ruRU', 'Это их задержит. А теперь пора сбить этот корабль.', '', 29981),
(165148, 'ruRU', 'Командиры Орды начали наступление на Тирагардском поморье. Заставь их пожалеть о том, что они заявились сюда!', '', 29981),
(165147, 'ruRU', 'О, $n, ты снова здесь? Ищешь следы ритуала Магни, наверное? Не стесняйся, бери любой кристалл из тех, что раскололись, когда Магни обрел свободу.', '', 29981),
(165146, 'ruRU', 'Ха-ха! Атака с двух сторон, классика! Они были обречены. А теперь выбирайся оттуда!', '', 29981),
(165145, 'ruRU', 'Там впереди воздушное судно! Атакуй его изнутри, а я прикрою сверху!', '', 29981),
(165144, 'ruRU', 'Лок-нараш! Альянс подогнал воздушное судно для обороны их лагеря на северном берегу. Сбей его!', '', 29981),
(165143, 'ruRU', 'Мы не ожидали, что Альянс атакует Вол\'дун. Сдержи их отряды, пока они не рассредоточились. А потом уж мы займемся их командирами.', '', 29981),
(165142, 'ruRU', 'Если они и после этого не уберутся из Назмира, то их ничем не пронять.', '', 29981),
(165141, 'ruRU', 'От местных клещей даже у меня мурашки по коже... А уж альянсовцы от их вида затрясутся. Ха-ха!', '', 29981),
(165140, 'ruRU', 'Отлично, солдат! А теперь вместе с Рокханом нанеси решающий удар!', '', 29981),
(165139, 'ruRU', 'Местные тролли крови наверняка перережут альянсовцев, но мне нужны гарантии. Убивай всех, кого встретишь.', '', 29981),
(165138, 'ruRU', '', 'Враг идет с востока?! Орда повсюду!', 29981),
(165136, 'ruRU', '', 'Дальше солдаты справятся сами, |3-6($c). Перед следующим заданием можешь сделать заслуженную передышку.', 29981),
(165135, 'ruRU', '', 'С воздушными кораблями все как с обычными врагами: найди уязвимое место и бей изо всех сил.', 29981),
(165133, 'ruRU', 'Молодцом. Теперь мы сможем расправиться с трусами, бомбящими город. Сбей этот корабль.', '', 29981),
(165132, 'ruRU', 'Защита Зулдазара – наша главная задача. Нам нельзя подпускать Альянс к городу. Оттесни врага с берега!', '', 29981),
(165131, 'ruRU', 'Ха-ха-ха! Что такое магия Альянса против нашего вуду?', '', 29981),
(165130, 'ruRU', 'Иногда держаться подальше от вуду нельзя. Иногда к нему приходится обратиться, верно? А теперь посмотрим, чье вуду сильнее.', '', 29981),
(165129, 'ruRU', 'Следующей операцией будет командовать Рокхан. Немедленно отправляйся к нему.', '', 29981),
(165128, 'ruRU', 'Раз солдаты Альянса решили прятаться среди чудовищ Друствара, мы перебьем и тех и других. Сражайся с честью!', '', 29981),
(165127, 'ruRU', 'Вряд ли Азшаре понравится, что у нее из-под носа увели лакомый кусочек. А вот меня все устраивает. Хе-хе.', '', 29981),
(165126, 'ruRU', 'Не знаю, что это за штукенции, но Азшаре они нужны позарез. Так что собираем их и прячем!', '', 29981),
(165125, 'ruRU', 'Альянсовцы думают, что смогут прокрасться через Назмир и застать нас врасплох? Покажем им, как они ошибаются!', '', 29981),
(165123, 'ruRU', 'Войну выигрывает тот, у кого больше ресурсов. Сегодня мы стали ближе к победе.', '', 29981),
(165122, 'ruRU', 'Похоже, прихлебатели Азшары ищут ресурсы. Знаешь, что? Надо бы их опередить.', '', 29981),
(165121, 'ruRU', '', 'Ха-ха-а, победа! Жрите землю, ублюдки Альянса! Долина Штормов теперь наша!', 29981),
(165120, 'ruRU', '', 'Они думают, что загнали нас в угол. Но уж кто-кто, а я-то знаю, как воевать в долинах. Убьем их всех!', 29981),
(165119, 'ruRU', '$C! Альянс обошел нас с фланга и прорывается к крепости Клыка Войны. Вернись и отрежь им путь к отступлению!', '', 29981),
(165118, 'ruRU', '<Ветролет Бранна готов к взлету.>', '', 29981),
(165117, 'ruRU', '', 'Враг идет с севера! Не щадить никого!', 29981),
(165116, 'ruRU', '', 'Враг идет! Готовьтесь!', 29981),
(165115, 'ruRU', 'Поверь, $n, это давно пора было сделать.', '', 29981),
(165114, 'ruRU', 'На берег выползает пренеприятная нага. Устроишь непрошенным гостям теплый прием?', '', 29981),
(165113, 'ruRU', 'Даже если Азшара раньше не знала о нас... Теперь точно узнает.', '', 29981),
(165112, 'ruRU', 'Я слышал об этой наге. Или этом. Фаворит Азшары. Или фаворитка. Разберись с этим.', '', 29981),
(165111, 'ruRU', 'Воины из крепости Клыка Войны подготовили отличный плацдарм для наступления. Мы захватим всю долину!', '', 29981),
(165110, 'ruRU', '', 'Вот и нет больше стен! Ха-ха! Теперь Боралус можно брать голыми руками! Лок-тар!', 29981),
(165109, 'ruRU', '', 'Ха! Надо и себе такую же штуковину заказать. А теперь – вперед, разносить ворота Боралуса!', 29981),
(165108, 'ruRU', 'Просто так нам не пробить стены Боралуса! Собери инженеров и найди способ сломить оборону Альянса!', '', 29981),
(165107, 'ruRU', 'Тирагардское поморье – самый укрепленный оплот Альянса на этом континенте. Отвлекаться и медлить нельзя. В атаку, $p!', '', 29981),
(165105, 'ruRU', '$n! Рад тебя видеть. Генерал Ракира приказала нашим бойцам каждый день усердно тренироваться.\n\nВот, взгляни – это наши лучшие наездники. Мы как раз собирались приступать к учениям.\n\nЧто тебе нужно?', '', 29981),
(165104, 'ruRU', 'Когда-нибудь я буду сражаться вместе с ними! А пока, может быть, я смогу приходить сюда и тренироваться с маг\'харами.', '', 29981),
(165103, 'ruRU', 'Войска Альянса напали на нас в Назмире. Каждый твой наездник должен лететь туда, чтобы остановить их.', 'Войска Альянса напали на нас в Назмире. Каждый твой наездник должен лететь туда, чтобы остановить их.', 29981),
(165102, 'ruRU', 'Тром-ка, новые друзья! Славной вам битвы с нашими врагами!', '', 29981),
(165101, 'ruRU', 'Новые таурены, и эльфы, и даже орки – прямо как я!', '', 29981),
(165100, 'ruRU', 'Ух ты, $n! Ты тут всех знаешь?', '', 29981),
(165099, 'ruRU', 'Бесполезная... победа...', 'Бесполезная... победа...', 29981),
(165098, 'ruRU', 'Вы уже... проиграли...', 'Вы уже... проиграли...', 29981),
(165097, 'ruRU', 'Всех... ждет смерть...', 'Всех... ждет смерть...', 29981),
(165096, 'ruRU', 'Я вижу... лишь тьму...', 'Я вижу... лишь тьму...', 29981),
(165095, 'ruRU', 'Вас тоже... ждет... поражение...', 'Вас тоже... ждет... поражение...', 29981),
(165094, 'ruRU', 'Смерть пришла за тобой!', 'Смерть пришла за тобой!', 29981),
(165093, 'ruRU', 'Наша победа неизбежна!', 'Наша победа неизбежна!', 29981),
(165092, 'ruRU', 'Тьма заберет тебя!', 'Тьма заберет тебя!', 29981),
(165091, 'ruRU', 'Я заберу твою никчемную жизнь!', 'Я заберу твою никчемную жизнь!', 29981),
(165090, 'ruRU', 'Вера ослепила тебя!', 'Вера ослепила тебя!', 29981),
(165089, 'ruRU', 'Вы все... потеряете...', 'Вы все... потеряете...', 29981),
(165088, 'ruRU', 'Я вижу... лишь тьму...', 'Я вижу... лишь тьму...', 29981),
(165087, 'ruRU', 'Вы не знаете... что ждет... всех вас...', 'Вы не знаете... что ждет... всех вас...', 29981),
(165086, 'ruRU', 'Она все равно... победит...', 'Она все равно... победит...', 29981),
(165085, 'ruRU', 'Прости меня... Темная Госпожа...', 'Прости меня... Темная Госпожа...', 29981),
(165084, 'ruRU', 'Мой лук бьет без промаха!', 'Мой лук бьет без промаха!', 29981),
(165083, 'ruRU', 'Прощайся с жизнью!', 'Прощайся с жизнью!', 29981),
(165082, 'ruRU', 'У тебя нет шансов!', 'У тебя нет шансов!', 29981),
(165081, 'ruRU', 'Смерть зовет тебя!', 'Смерть зовет тебя!', 29981),
(165080, 'ruRU', 'За Темную Госпожу!', 'За Темную Госпожу!', 29981),
(165079, 'ruRU', '<Машинима, часть зандаларского флота отправляется в плавание.>', '<Машинима, часть зандаларского флота отправляется в плавание.>', 29981),
(165078, 'ruRU', 'Хорошо, сделай так. Отправь к побережью Назмира все корабли, какие сможешь.', 'Хорошо, сделай так. Отправь к побережью Назмира все корабли, какие сможешь.', 29981),
(165077, 'ruRU', 'Ты что, шутишь? Я не могу вот так сразу отправить туда весь флот. Самое большее, что я могу сделать прямо сейчас, – приказать всем свободным кораблям сменить курс и отправиться в Назмир.', 'Ты что, шутишь? Я не могу вот так сразу отправить туда весь флот. Самое большее, что я могу сделать прямо сейчас, – приказать всем свободным кораблям сменить курс и отправиться в Назмир.', 29981),
(165076, 'ruRU', 'Кул-тирасские корабли замечены у побережья Назмира. Собери зандаларский флот и отправляйся в атаку.', 'Кул-тирасские корабли замечены у побережья Назмира. Собери зандаларский флот и отправляйся в атаку.', 29981),
(165075, 'ruRU', '', 'Воины Зандалара! Альянс напал на нас в Назмире! Выступайте и перебейте их всех!', 29981),
(165074, 'ruRU', '', 'Они... не пришли.', 29981),
(165073, 'ruRU', 'Я знаю! Я принесу всяких вкусняшек. Им понравится!', '', 29981),
(165072, 'ruRU', 'Но теперь я знаю, где их можно найти. Я смогу приходить сюда и играть с ними, чтобы им не было грустно.', '', 29981),
(165071, 'ruRU', 'Надеюсь, всем тут уютно. Может быть, кто-то сирота, как я.', '', 29981),
(165070, 'ruRU', 'Тут собрались главы всех рас. Наверное, они заняты чем-то очень важным.', '', 29981),
(165069, 'ruRU', 'Ух ты! Здесь мы набираем новых союзников для Альянса?', '', 29981),
(165068, 'ruRU', 'Альянс напал на нас в Назмире. Отправь свои войска на помощь принцессе Таланджи.', 'Альянс напал на нас в Назмире. Отправь свои войска на помощь принцессе Таланджи.', 29981),
(165067, 'ruRU', '', 'А, $n, рада тебя видеть! У меня сейчас учения... тебе что-то нужно?', 29981),
(165066, 'ruRU', '', 'Глефа Стража бьет без промаха!', 29981),
(165065, 'ruRU', '', 'Горите, мерзавцы!', 29981),
(165064, 'ruRU', '', 'Возмездие за Тельдрассил!', 29981),
(165063, 'ruRU', '', 'За калдорай!', 29981),
(165062, 'ruRU', '', 'Я подвела тебя, Сира. Но я искуплю свою вину, избавив тебя от мучений.', 29981),
(165061, 'ruRU', '', 'Как ты можешь служить Орде, сестра? Зачем ты предала правосудие?', 29981),
(165060, 'ruRU', '', 'Ты смеешь говорить о правосудии? Я погибла, служа тебе. Ты предала меня!', 29981),
(165059, 'ruRU', 'Мы готовы начать, Темный Страж.', 'Мы готовы начать, Темный Страж.', 29981),
(165058, 'ruRU', '<Сира стоит, непоколебимо глядя на своего бывшего командира.>', '<Сира стоит, непоколебимо глядя на своего бывшего командира.>', 29981),
(165057, 'ruRU', 'Тревожат меня твои слова. Подойди, Голос Орды. Может, мы найдем ответы на твои вопросы.', '', 29981),
(165056, 'ruRU', 'Я помню битву на этих запятнанных Скверной берегах. Много моих друзей погибло в противостоянии бесчисленным армиям Пылающего Легиона.\n\nТот день изменил судьбу не только Азерота, но и всех миров, куда вторгся Легион.', '', 29981),
(165055, 'ruRU', 'Орде нельзя оставаться на этом пути. Мы заявляем о том, что выше всего ценим честь, а сами оправдываем гнусные злодеяния нуждами бессмысленной и безнадежной войны.\n\nНаша Орда выкована в горниле битв. Мы объединились, чтобы защитить свои земли и народы от наших общих врагов... Но пока вождем остается Сильвана, даже стремление выжить вряд ли сохранит наш союз...\n\nМы должны найти новый путь... пока окончательно не потеряли себя.', '', 29981),
(165054, 'ruRU', 'Что случилось с Вол\'джином в битве на Расколотом берегу?', 'Что случилось с Вол\'джином в битве на Расколотом берегу?', 29981),
(165053, 'ruRU', 'Призывать духов, заблудившихся между жизнью и смертью, – это одно. Обращаться к духу, который уже в мире мертвых, – совсем другое дело. А уж эта задача, связанная с Вол\'джином, не похожа ни на то, ни на другое.\n\nМогу смело сказать, что никогда даже не думал о подобном. Я все больше уважаю Таланджи.', '', 29981),
(165052, 'ruRU', 'Да! Идем!', '', 29981),
(165051, 'ruRU', 'Я тебя отлично слышал, приятель. Как насчет... подожди...', '', 29981),
(165050, 'ruRU', 'И ничего. Не. Трогаем. Понятно, капитан?', '', 29981),
(165049, 'ruRU', 'Обещаю, даже ты меня не заметишь.', '', 29981),
(165048, 'ruRU', 'Действуем быстро и тихо. В первую очередь – тихо.', '', 29981),
(165047, 'ruRU', '', 'Вы поплатитесь за вторжение в наши земли!', 29981),
(165046, 'ruRU', '', 'Свет лоа придаст мне сил. Готовьтесь к бою!', 29981),
(165045, 'ruRU', 'Тролль-паладин? Теперь я точно видел все. Протестуй сколько хочешь, но ты явно в меньшинстве.', '', 29981),
(165044, 'ruRU', '', 'Вы ответите за свои гнусные преступления!', 29981),
(165043, 'ruRU', 'Нас не остановит какая-то чумазая дворфийка. Убейте ее!', '', 29981),
(165042, 'ruRU', 'Мы с вами, король Растахан. Что слышно о нападении Альянса?', 'Мы с вами, король Растахан. Что слышно о нападении Альянса?', 29981),
(165041, 'ruRU', 'У нас мало времени. Альянс уже здесь.', '', 29981),
(165040, 'ruRU', '', 'Тиранда, мы с тобой!', 29981),
(165039, 'ruRU', '', '$n, передай всем готовиться к контратаке. Встретимся у Кровавых Врат.', 29981),
(165038, 'ruRU', 'Мы объединим наши силы на поле боя. Твой народ очень помог нам, король Растахан, и мы не оставим его в трудный час!', '', 29981),
(165037, 'ruRU', 'Я соберу войско Орды. Это шанс закончить войну... нашей победой.', '', 29981),
(165036, 'ruRU', 'Согласен. Нанесем удар по всем фронтам. Таланджи, отправляйся к Кровавым Вратам, а мы подготовим армию к походу.', '', 29981),
(165035, 'ruRU', 'Наши войска успели ознакомиться с джунглями Назмира. Сражаясь плечом к плечу с зандаларами, мы изгоним Альянс.', '', 29981),
(165034, 'ruRU', 'Нужно отбить наши земли и потопить этот флот.', '', 29981),
(165033, 'ruRU', '', 'Они хотят закрепиться и нанести удар по Зулдазару. Разведчики обнаружили крупный флот недалеко от берега.', 29981),
(165032, 'ruRU', 'Войска Альянса замечены в Назмире. Они захватили Кровавые Врата!', '', 29981),
(165031, 'ruRU', '', 'Встретимся у Трех Углов. У меня есть план.', 29981),
(165030, 'ruRU', 'Хватайт их! Шнель! Пшел, пшел!', '', 29981),
(165029, 'ruRU', 'Быстрее! Залезай!', '', 29981),
(165028, 'ruRU', 'Мои кинжалы быстро укажут им дорогу.', '', 29981),
(165027, 'ruRU', 'Отправим их домой?', '', 29981),
(165026, 'ruRU', 'По-моему, тут слишком зелено. Не похоже на земли Орды.', '', 29981),
(165025, 'ruRU', 'Эй, ордынцы, здесь хоть что-нибудь напоминает вашу грязную бурую пустыню?', '', 29981),
(165024, 'ruRU', 'Кажется, пара ордынцев заблудилась. Очень сильно заблудилась.', '', 29981),
(165023, 'ruRU', 'Так-так, кто тут у нас?', '', 29981),
(165022, 'ruRU', '', 'Вон она!', 29981),
(165021, 'ruRU', '', 'Орда приближается! Готовьтесь!', 29981),
(165020, 'ruRU', '', 'Да придет тьма... и да убоятся наши враги.', 29981),
(165019, 'ruRU', 'Быстрее, $n! Игнису нужна помощь!', '', 29981),
(165018, 'ruRU', 'Я погляжу, у наг жизнь просто бьет ключом! Хе-хе. Спасибо тебе за помощь.', '', 29981),
(165017, 'ruRU', 'Наги выползли из моря – жди беды. Не знаю зачем их отправила сюда Азшара, но нельзя позволить им выполнять ее планы.', '', 29981),
(165016, 'ruRU', 'Так им! И пусть больше не высовываются. Вот бы избавиться от них навсегда...', '', 29981),
(165015, 'ruRU', 'Ульдуар. Давненько я здесь не был. Хранители славно потрудились над его восстановлением.', '', 29981),
(165014, 'ruRU', 'На своем веку я много нажьих вылазок повидал, но это уж совсем! Прогони их, |3-6($c)!', '', 29981),
(165013, 'ruRU', 'Потрясающе!', '', 29981),
(165012, 'ruRU', 'Ха, получилось!', '', 29981),
(165011, 'ruRU', 'Хоть ты и не кузнец, но под моим руководством справишься!', '', 29981),
(165010, 'ruRU', 'Вижу, тебе знакомо кузнечное дело! Ты справишься!', '', 29981),
(165009, 'ruRU', 'Славно, |3-6($c)! Ты напоминаешь мне молодого... ну, меня.', '', 29981),
(165008, 'ruRU', 'Ха-хаа! Да!', '', 29981),
(165007, 'ruRU', 'С нагами надо драться жестоко и решительно. Уж это я накрепко усвоил. За дело!', '', 29981),
(165006, 'ruRU', 'Это спутает Азшаре все карты. Спасибо тебе, |3-6($c)!', '', 29981),
(165005, 'ruRU', 'Наги уже тысячу лет так не наглели. Придется их проучить!', '', 29981),
(165004, 'ruRU', 'Здорово ты разбираешься с нагами. От этих скользких типов можно всякого ждать.', '', 29981),
(165003, 'ruRU', 'Что бы ни задумала Азшара, это не к добру. Надо бы подрезать нагам хвосты.', '', 29981),
(165002, 'ruRU', 'Пожалуйста, сними это проклятие.', 'Пожалуйста, сними это проклятие.', 29981),
(165001, 'ruRU', 'Могучий Акунда успокоит мятежный дух.\n\nТебя что-то тревожит?', '', 29981),
(165000, 'ruRU', 'Подойди, позволь силе Акунды очистить твой разум!', '', 29981),
(164999, 'ruRU', 'О, дело плохо, мой друг.', '', 29981),
(164998, 'ruRU', '', 'Идем. Отмечай все, что вызывает подозрение.', 29981),
(164997, 'ruRU', '', 'Дилетанты.', 29981),
(164996, 'ruRU', '', 'Следы глубокие, больше человеческих. Саурфанг... Он пошел на восток...', 29981),
(164995, 'ruRU', '', 'Здесь кто-то прошел... и попытался скрыть свой след в камышах. Двигаемся дальше.', 29981),
(164994, 'ruRU', '', 'Похоже, здесь он и бежал. Хм... Берег у озера илистый. Давай поищем следы.', 29981),
(164993, 'ruRU', '', 'Выход канализации. За городом, вдали от любопытных глаз... Давай осмотрим замок.', 29981),
(164992, 'ruRU', '', 'Время придет. Совсем скоро.', 29981),
(164991, 'ruRU', '', 'Открой свой разум и услышь голоса.', 29981),
(164990, 'ruRU', '', 'Нас ждет истинное величие...', 29981),
(164989, 'ruRU', '', 'Расскажи, чего хочешь.', 29981),
(164988, 'ruRU', '', 'Столько возможностей...', 29981),
(164987, 'ruRU', '', 'Что ты ищешь?', 29981),
(164986, 'ruRU', '', 'Встретимся у стен Штормграда. Постарайся держаться в тени.', 29981),
(164985, 'ruRU', '', '<Death Line.>', 29981),
(164984, 'ruRU', '', 'Моя стража охраняет дверь.\n\nДавай обсудим твое задание.', 29981),
(164983, 'ruRU', 'Прости, капитан...', '', 29981),
(164982, 'ruRU', 'За выручку... и за Орду!', '', 29981),
(164981, 'ruRU', 'Я так и думал...', '', 29981),
(164980, 'ruRU', '', 'За Зандалар!', 29981),
(164979, 'ruRU', '', 'Лоа, даруйте мне силу!', 29981),
(164978, 'ruRU', '', 'Смерть чужакам!', 29981),
(164977, 'ruRU', '', 'Лоа ликуют!', 29981),
(164976, 'ruRU', '', 'Пусть Свет пощадит ваши души... Хоть вы этого и не достойны!', 29981),
(164975, 'ruRU', '', 'Свет... укажи мне путь... на Ту Сторону...', 29981),
(164974, 'ruRU', '', 'Да здравствует Зандалар!', 29981),
(164973, 'ruRU', '', 'Свет своих узнает!', 29981),
(164972, 'ruRU', '', 'К оружию! Выдворим чужаков из Зулдазара!', 29981),
(164971, 'ruRU', '', 'Месть за павших!', 29981),
(164970, 'ruRU', '', 'Расплата близка!', 29981),
(164969, 'ruRU', '', 'Вы вторглись в священную землю. Я не позволю вам и дальше осквернять Зулдазар!', 29981),
(164968, 'ruRU', '', 'Валите, пока целы! Этот город принадлежит Альянсу.', 29981),
(164967, 'ruRU', '', 'Расплата близка!', 29981),
(164966, 'ruRU', '', 'Месть за павших!', 29981),
(164965, 'ruRU', '', 'К оружию! Отбросим грязных ордынцев!', 29981),
(164964, 'ruRU', '', 'Свет своих узнает!', 29981),
(164963, 'ruRU', '', 'Ярость гор сокрушит вас!', 29981),
(164962, 'ruRU', '', 'Свет... укажи мне путь... домой...', 29981),
(164961, 'ruRU', '', 'Пусть Свет пощадит ваши души... А то у меня просить пощады уже поздно!', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164960, 'ruRU', '', 'У тебя не было шансов!', 29981),
(164959, 'ruRU', '', 'Не связывайся с кланом Черного Железа!', 29981),
(164958, 'ruRU', '', 'Бегите от дочери горы!', 29981),
(164957, 'ruRU', '', 'За Альянс!', 29981),
(164954, 'ruRU', '', 'На колени перед драконом!', 29981),
(164953, 'ruRU', '', 'Посмотрим, чего вы стоите!', 29981),
(164952, 'ruRU', '', 'Во мне мощь дракона и ярость Света!', 29981),
(164951, 'ruRU', '', 'Гнев Света сокрушит вас!', 29981),
(164950, 'ruRU', '', 'Орда... несет только... смерть.', 29981),
(164949, 'ruRU', '', 'Ничтожество!', 29981),
(164947, 'ruRU', '', 'Ха! С бесами драться и то интереснее!', 29981),
(164946, 'ruRU', '', 'В Круговерти Пустоты я сразила полчища демонов Легиона. Жалкие прихвостни троллей мне не страшны.', 29981),
(164945, 'ruRU', '', 'Твоя защита слаба!', 29981),
(164944, 'ruRU', '', 'Стихии сокрушат вас!', 29981),
(164943, 'ruRU', '', 'Не ждите пощады!', 29981),
(164942, 'ruRU', '', 'На вас обрушится тысяча кулаков!', 29981),
(164941, 'ruRU', '', 'Дракон принесет вам погибель!', 29981),
(164940, 'ruRU', '', 'Подменишь меня, Мансрой?', 29981),
(164939, 'ruRU', 'От вас останутся только угли!', '', 29981),
(164938, 'ruRU', 'Узрите пламя преисподней!', '', 29981),
(164937, 'ruRU', 'Пора покончить с вами!', '', 29981),
(164936, 'ruRU', 'Огонь... возродится... из искры...', '', 29981),
(164935, 'ruRU', 'Это за Кул-Тирас!', '', 29981),
(164934, 'ruRU', 'Больше пищи для огня!', '', 29981),
(164933, 'ruRU', 'Зандалары не умеют выбирать союзников.', '', 29981),
(164932, 'ruRU', 'Ваш путь окончен, подонки! Вы ответите за преступления против Кул-Тираса!', '', 29981),
(164931, 'ruRU', 'Сейчас мы покажем вам, что ждет врагов Альянса. Выходите на бой!', '', 29981),
(164930, 'ruRU', 'Вперед, Местра. Вместе мы прикончим этих глупцов!', '', 29981),
(164929, 'ruRU', 'Огню нужна пища!', '', 29981),
(164928, 'ruRU', 'Глядите под ноги!', '', 29981),
(164927, 'ruRU', 'Мощь самого космоса раздавит вас!', '', 29981),
(164926, 'ruRU', 'У пламени много обличий!', '', 29981),
(164925, 'ruRU', 'Пламя поглотит всех!', '', 29981),
(164924, 'ruRU', '', 'Конечно, госпожа.', 29981),
(164923, 'ruRU', '', 'Темный следопыт Лиана – лучшая в своем деле. Она поможет тебе в поисках.', 29981),
(164922, 'ruRU', '', 'Опереди Альянс и найди его.', 29981),
(164921, 'ruRU', '', 'Пусть некоторые сомневаются в верности верховного воеводы, я не могу позволить врагу снова до него добраться.', 29981),
(164920, 'ruRU', '', 'Если солдаты мальчишки найдут беглеца – его убьют на месте.', 29981),
(164919, 'ruRU', '', 'Разведчики доложили, что Варок Саурфанг бежал от Альянса. Его держали в тюрьме Штормграда с самой атаки на Лордерон.', 29981),
(164918, 'ruRU', '', 'Смерть Альянсу!', 29981),
(164917, 'ruRU', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tОдна из |cFFFF0000|Hspell:285766|h[глеф]|h|r Майев упала на землю. Используйте ее, чтобы победить аватар мучений Сиры!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tОдна из |cFFFF0000|Hspell:285766|h[глеф]|h|r Майев упала на землю. Используйте ее, чтобы победить аватар мучений Сиры!', 29981),
(164916, 'ruRU', '', 'Быстрее, герои! Хватайте глефу и уничтожьте тени!', 29981),
(164915, 'ruRU', '', 'Стражи готовы ко всему, даже после смерти.', 29981),
(164914, 'ruRU', '', 'Страдайте, как страдала я!', 29981),
(164913, 'ruRU', '', 'Смерть приходит ко всем.', 29981),
(164912, 'ruRU', '', 'Ты не оставляешь мне выбора. Банду торибас!', 29981),
(164911, 'ruRU', '', 'В последний раз прошу, Сира. Именем Элуны, отступи!', 29981),
(164910, 'ruRU', '', 'К демонам Элуну! Вы все сгорите, а она будет лишь наблюдать.', 29981),
(164909, 'ruRU', '', 'Ух ты! Отсюда видно все аж до самого Назмира!', 29981),
(164908, 'ruRU', '', 'Мы куда?', 29981),
(164907, 'ruRU', '', 'Всегда хотела прокатиться на терродактиле!', 29981),
(164906, 'ruRU', '[Убить Сиру] Я это выполню.', '[Убить Сиру] Я это выполню.', 29981),
(164905, 'ruRU', '[Пощадить Сиру] Я не стану этого делать.', '[Пощадить Сиру] Я не стану этого делать.', 29981),
(164904, 'ruRU', 'Чего ты ждешь? Прикончи ее.', '', 29981),
(164903, 'ruRU', 'Чего ты ждешь?', '', 29981),
(164902, 'ruRU', '', 'Мы исцелим ее. Освободи остальных!', 29981),
(164901, 'ruRU', '', 'Азерот истекает кровью? С ней все будет в порядке. Наверняка она умеет регенерироваться, как тролли! Так ведь?', 29981),
(164900, 'ruRU', '', 'Можно мне как-нибудь сделаться такой же огромной блестяшкой, как тот дворф?', 29981),
(164899, 'ruRU', '', 'Этот меч просто огромный!', 29981),
(164898, 'ruRU', 'Вы только посмотрите. Охотница стала дичью. Хотя, если подумать, это изрядная пошлость.', '', 29981),
(164897, 'ruRU', '', 'Пора покончить с этим. Тебе некуда бежать.', 29981),
(164896, 'ruRU', 'Мы еще поговорим... и очень скоро.', '', 29981),
(164895, 'ruRU', 'Решающий час уже близок.', '', 29981),
(164894, 'ruRU', 'Приход сюда открывает перед тобой большие возможности.', '', 29981),
(164893, 'ruRU', 'Твоя судьба открылась мне во снах.', '', 29981),
(164892, 'ruRU', 'Ступай... но клинок останется... и послужит мне.', '', 29981),
(164891, 'ruRU', '', 'Исполни уговор... верни мне свободу... и мою судьбу!', 29981),
(164890, 'ruRU', '', 'Услышь меня, Бог Глубин! Я дарую тебе Ключ... Глашатая Истины... Факел, что Освещает Путь!', 29981),
(164889, 'ruRU', 'На меня возложена честь передать тебе регалии величайшего героя. Белоно сил\'ару, белоре\'дорай. Поднимись, герой син\'дорай!', '', 29981),
(164888, 'ruRU', 'Запомни: наш народ объединяет не трагедия, а то, что мы сумели ее пережить. Из пепла прошлого мы несем в будущее огонь надежды.', '', 29981),
(164887, 'ruRU', '', 'Не могу сказать, что у тебя есть выбор...', 29981),
(164886, 'ruRU', '', 'Мы на месте. Не бойся. Так было предначертано.', 29981),
(164885, 'ruRU', '', 'Плывет-плывет кораблик в далекие края...', 29981),
(164884, 'ruRU', '', 'Дома сделаны из... кораблей? Тут так принято?', 29981),
(164883, 'ruRU', '', 'У тебя есть друзья-пираты?! Они знают хорошие морские песни?', 29981),
(164882, 'ruRU', '', 'Именно благодаря интеллекту и силе смертного создания мы оказались здесь.', 29981),
(164881, 'ruRU', '', 'Здесь все так любят воду. А я никак не пойму, что в ней такого.', 29981),
(164880, 'ruRU', '', 'Можно выстрелить из этой штуки? Я осторожно, честно-честно!', 29981),
(164879, 'ruRU', '', 'Это? Это мой смертный защитник.', 29981),
(164878, 'ruRU', '', 'Поедем наваляем людишкам! За Орду!', 29981),
(164877, 'ruRU', '', 'Поплывем туда, где снег? Хочу узнать, какой он...', 29981),
(164876, 'ruRU', '', 'Путешественники говорят, что в Друстваре страшно. Я люблю страшные истории!', 29981),
(164875, 'ruRU', '', 'Тут столько всех. И все такие странные.', 29981),
(164874, 'ruRU', 'Мы готовы начать, Майев.', 'Мы готовы начать, Майев.', 29981),
(164873, 'ruRU', '<Майев Песнь Теней пристально смотрит на Темного Стража на другом конце платформы.>', '<Майев Песнь Теней пристально смотрит на Темного Стража на другом конце платформы.>', 29981),
(164871, 'ruRU', '', 'Я слышала, в джунглях полно спрятанных сокровищ. Может, я могла бы стать арха... архи... лологом!', 29981),
(164870, 'ruRU', '', 'Вряд ли я смогу быть начертательницей. Я и читать-то не умею!', 29981),
(164869, 'ruRU', '', 'Ты умеешь работать с кожей? Покажи свой нож!', 29981),
(164868, 'ruRU', '', 'Может, когда-нибудь я освою какое-нибудь ремесло! Думаю, ювелирное дело мне подойдет.', 29981),
(164867, 'ruRU', 'Пламя поглотит всех!', '', 29981),
(164866, 'ruRU', 'У феникса много обличий!', '', 29981),
(164865, 'ruRU', 'Мощь самого космоса раздавит вас!', '', 29981),
(164864, 'ruRU', 'Глядите под ноги!', '', 29981),
(164863, 'ruRU', 'Феникс голоден!', '', 29981),
(164862, 'ruRU', 'Вперед, Ма\'ра. Вместе мы прикончим этих глупцов!', '', 29981),
(164861, 'ruRU', '', 'Подменишь меня, Анатос?', 29981),
(164860, 'ruRU', '', 'Дракон принесет вам погибель!', 29981),
(164859, 'ruRU', '', 'На вас обрушится тысяча кулаков!', 29981),
(164858, 'ruRU', '', 'Не ждите пощады!', 29981),
(164857, 'ruRU', '', 'Стихии сокрушат вас!', 29981),
(164856, 'ruRU', '', 'Твоя защита слаба!', 29981),
(164855, 'ruRU', 'Значит, пора преподать им урок?', '', 29981),
(164854, 'ruRU', '', 'В родном мире я стерла в порошок немало светоносных. Давно хотела сделать то же самое с врагами Орды.', 29981),
(164853, 'ruRU', 'Так-так... Герои Альянса заблудились и попали в самое сердце империи троллей. Боюсь, придется их здесь задержать.', '', 29981),
(164852, 'ruRU', '', 'Ха! С горенами драться и то интереснее!', 29981),
(164851, 'ruRU', '', 'То есть все приходят сюда и просто... оставляют свое добро незнакомцам? Откуда они знают, что с ним все будет в порядке?', 29981),
(164850, 'ruRU', '', 'На колени перед драконом!', 29981),
(164849, 'ruRU', '', 'Ничтожество!', 29981),
(164848, 'ruRU', '', 'Ваш... Альянс... обречен...', 29981),
(164847, 'ruRU', '', 'А банкиры оставляют часть блестяшек себе?', 29981),
(164846, 'ruRU', '', 'Гнев маг\'харов сокрушит вас!', 29981),
(164845, 'ruRU', '', 'Здесь наверняка целые горы блестяшек!', 29981),
(164844, 'ruRU', '', 'Во мне мощь дракона и ярость Дренора!', 29981),
(164843, 'ruRU', '', 'Посмотрим, чего вы стоите!', 29981),
(164842, 'ruRU', 'Больше пищи для огня!', '', 29981),
(164841, 'ruRU', 'Узрите пламя феникса!', '', 29981),
(164840, 'ruRU', 'Довольно беготни. УМРИТЕ!', '', 29981),
(164839, 'ruRU', 'Феникс... возродится... из пепла...', '', 29981),
(164838, 'ruRU', 'Видишь? Я же говорил, что беспокоиться не о чем.', '', 29981),
(164837, 'ruRU', 'Типичный Альянс.', '', 29981),
(164836, 'ruRU', 'Я обращу вас в пепел!', '', 29981),
(164835, 'ruRU', '', 'Сколько сауридов влезет на этот корабль?', 29981),
(164834, 'ruRU', '', 'Мы отправимся на поиски приключений?', 29981),
(164833, 'ruRU', '', 'Это ТВОЙ корабль?!', 29981),
(164832, 'ruRU', '', 'И где они только взяли такие большие черепа? Это что, черепа дьявозавров?', 29981),
(164831, 'ruRU', '', 'Смотри, сколько шипов! Воспитатели говорят, если что-то покрыто шипами, значит, это дело рук Орды.', 29981),
(164830, 'ruRU', '', 'Еще одной угрозой для наших планов меньше. Прими мою благодарность.', 29981),
(164829, 'ruRU', '', 'Блестяще! А теперь отдохни от битвы, и знай, что твой подвиг спас жизни многих солдат.', 29981),
(164828, 'ruRU', '', 'Пока у нас есть ты, неважно, кого выставят против нас враги. Орду не остановить!', 29981),
(164827, 'ruRU', 'Когда мы уйдем, наш договор потеряет силу. Если встанешь на пути у нас и нашего бога, отголоски твоей проклятой души будут звучать в этом мире веками.', '', 29981),
(164826, 'ruRU', 'Можешь оставить подношение себе. Возможно, ему это даже понравится.', '', 29981),
(164825, 'ruRU', 'Фа\'туул, разберись с этим.', '', 29981),
(164824, 'ruRU', 'Я возьму это. Пришло время разогнать тьму светом.', '', 29981),
(164823, 'ruRU', 'Да, стихии объединились... Но явилось и нечто иное...', '', 29981),
(164822, 'ruRU', 'Я так долго ждал... я чувствую его ярость... его голод. Темная Империя возродится!', '', 29981),
(164821, 'ruRU', '', 'Еще одна победа Орды! Я не сомневалась, что на тебя можно положиться.', 29981),
(164820, 'ruRU', 'Тебе нужно было доставить реликвии. Зачем ты тревожишь нас своим призывом?', '', 29981),
(164819, 'ruRU', '', 'Великолепно. Теперь здесь будет не так опасно перебрасывать войска.', 29981),
(164818, 'ruRU', 'Уовшш тизз... И\'за отк фелн йурр. Шат\'маг шшк шу эт\'агту!', '', 29981),
(164817, 'ruRU', '', 'Даже самый стойкий солдат дрогнет, если убить на его глазах всех командиров. Исход этой битвы предрешен.', 29981),
(164816, 'ruRU', '', 'Командовать армией такого масштаба непросто. Хорошо, что мы усложнили Альянсу эту задачу.', 29981),
(164815, 'ruRU', '', 'Мы должны остановить Альянс здесь и сейчас. $n, убей их командира, обезглавь их войско!', 29981),
(164814, 'ruRU', '', 'Вот тебе простое и понятное задание: есть сильный враг, и его нужно убить.', 29981),
(164813, 'ruRU', '', 'Мне сообщили, что Альянс отправил в эту область сильнейших бойцов. Мы должны ответить тем же.', 29981),
(164812, 'ruRU', '', 'Наши патрули заметили агента Альянса в этой области. Поручаю тебе разобраться с ним.', 29981),
(164811, 'ruRU', '', 'В этой области видели старшего офицера врага. Покажи нашим новым союзникам, что Орда может их защитить.', 29981),
(164808, 'ruRU', 'Но у отца был план другой – оставить маму молодой.', 'Но у отца был план другой – оставить маму молодой.', 29981),
(164807, 'ruRU', 'Мама отправила меня к нему, чтобы я мог играть вечно.', 'Мама отправила меня к нему, чтобы я могла играть вечно.', 29981),
(164806, 'ruRU', '', 'Похоже, эта заблудшая душа хочет присоединиться к нам. Отведем ее к Натаносу.', 29981),
(164804, 'ruRU', 'Вольно, солдат. Твои предки гордились бы тобой.', '', 29981),
(164803, 'ruRU', 'Бегите, щенки Альянса. Будете знать, что такое мощь Орды!', '', 29981),
(164802, 'ruRU', 'Я готов идти к Солнечному Колодцу. <Начать сценарий \"Гибель Солнечного Колодца\".>', 'Я готова идти к Солнечному Колодцу. <Начать сценарий \"Гибель Солнечного Колодца\".>', 29981),
(164801, 'ruRU', 'Неважно, кто наш враг. Мы всегда помним о чести, $p. Покажи псам Альянса, что такое Орда.', '', 29981),
(164800, 'ruRU', '', 'Да?', 29981),
(164799, 'ruRU', 'Кровь и гром! За Орду!', '', 29981),
(164798, 'ruRU', 'Слава Громовому... Э-э... то есть Альянсу!', '', 29981),
(164797, 'ruRU', 'Так-так... Орде явно стоит напомнить, кто в небе хозяин. А хозяева в небе мы! Покажи им!', '', 29981),
(164796, 'ruRU', 'Убедительно. Надеюсь, Стализвон обеспечит этим всех моих агентов.', '', 29981),
(164795, 'ruRU', 'Его песню никто не услышит.', 'Его песню никто не услышит.', 29981),
(164794, 'ruRU', 'Сначала я обнял, а потом услышал треск.', 'Сначала я обняла, а потом услышала треск.', 29981),
(164793, 'ruRU', 'Он пел прекрасную песню.', 'Он пел прекрасную песню.', 29981),
(164792, 'ruRU', 'Я, пожалуй, вас покину...', '', 29981),
(164791, 'ruRU', 'Да уж. Абсолютно все пошло не по плану.', '', 29981),
(164790, 'ruRU', '', 'Офицер Альянса собирает вокруг себя войска. Не дай им перегруппироваться!', 29981),
(164789, 'ruRU', 'Я назову ему твое имя, $n.', 'Я назову ему твое имя, $n.', 29981),
(164788, 'ruRU', 'Как же я хочу снова испытать эту боль!', 'Как же я хочу снова испытать эту боль!', 29981),
(164787, 'ruRU', 'Он зовет меня по имени. Как же это больно!', 'Он зовет меня по имени. Как же это больно!', 29981),
(164786, 'ruRU', 'Там, внутри... Я чувствую, как они вгрызаются в меня. Они гложут, кусают, проникают в мой мозг. Подойди, дай им вкусить твою сладость.', 'Там, внутри... Я чувствую, как они вгрызаются в меня. Они гложут, кусают, проникают в мой мозг. Подойди, дай им вкусить твою сладость.', 29981),
(164785, 'ruRU', 'У нас с Сильваной хватает разногласий... Но я никогда не забуду о ее жертве. Она была командиром следопытов Луносвета. И ничто этого не изменит.', '', 29981),
(164784, 'ruRU', 'Когда Артас воскресил ее и бросил в бой против Кель\'Таласа, это разбило наши сердца.', '', 29981),
(164783, 'ruRU', 'Она отдала все, чтобы наш народ смог выжить и возродить наше погубленное королевство.', '', 29981),
(164782, 'ruRU', 'Сильвана была защитницей нашего народа. Если бы она и ее следопыты не бились так яростно с войском Артаса, мы могли и не спастись.', '', 29981),
(164781, 'ruRU', 'Ужас, который испытал тогда наш народ, не описать словами. Выжившие в один голос говорили, что спаслись чудом. Такой дар мы не можем растратить попусту.', '', 29981),
(164780, 'ruRU', 'В той битве я лишился глаза... и мог бы погибнуть, если бы Халдарон не спас меня...', '', 29981),
(164779, 'ruRU', 'Мы были абсолютно не готовы к такому. Годами Кель\'Талас наслаждался мирной идиллией. Пока против нас не выступила сама смерть.', '', 29981),
(164778, 'ruRU', 'Мой отряд патрулировал леса вокруг Зул\'Амана, когда нам сообщили о вторжении Плети.', '', 29981),
(164777, 'ruRU', 'Здесь все и началось.', '', 29981),
(164776, 'ruRU', '', 'Ты же знаешь, что моя специальность – убийства, правда?', 29981),
(164775, 'ruRU', '', 'Будь настороже.', 29981),
(164774, 'ruRU', '', 'Говори тише.', 29981),
(164773, 'ruRU', '', 'Держи стрелы наготове.', 29981),
(164772, 'ruRU', '', 'Я слушаю.', 29981),
(164771, 'ruRU', '', 'Прежде чем стрелять, лучше дважды прицелиться.', 29981),
(164770, 'ruRU', '', 'Веди себя тихо.', 29981),
(164769, 'ruRU', '', 'Я бесшумна и смертоносна.', 29981),
(164768, 'ruRU', '', 'За Темную Госпожу.', 29981),
(164767, 'ruRU', '', 'Порой одна смерть может обратить победу в поражение. Убей командира Альянса – и враг пустится в бегство!', 29981),
(164766, 'ruRU', 'Бездна поглотит все!', '', 29981),
(164765, 'ruRU', 'Трепещите перед его голодом! Перед его тьмой!', '', 29981),
(164764, 'ruRU', 'Волны смоют ваши жалкие жизни!', '', 29981),
(164763, 'ruRU', 'Вы утонете в океане ужаса!', '', 29981),
(164762, 'ruRU', 'Вы – лишь обломки, оставшиеся после шторма!', '', 29981),
(164761, 'ruRU', 'Трепещите перед его безграничной мощью!', '', 29981),
(164760, 'ruRU', 'Повелитель! Дай мне силу!', '', 29981),
(164759, 'ruRU', 'Мы все равно победим!', '', 29981),
(164758, 'ruRU', 'Пришел конец вашим жалким надеждам!', '', 29981),
(164757, 'ruRU', 'Ваши вопли будут эхом отдаваться в его чертогах!', '', 29981),
(164756, 'ruRU', 'Больше вы не будете осквернять этот чертог!', '', 29981),
(164755, 'ruRU', 'Довольно! Пора покончить с этим!', '', 29981),
(164754, 'ruRU', 'Вы... все равно... достанетесь ему...', '', 29981),
(164753, 'ruRU', 'Вашему ужасу... не будет... конца...', '', 29981),
(164752, 'ruRU', 'Рыб ждет пиршество...', '', 29981),
(164751, 'ruRU', 'Их снам пришел конец...', '', 29981),
(164750, 'ruRU', '...и весь мир достанется ему.', '', 29981),
(164749, 'ruRU', '...и повелитель заберет свою добычу.', '', 29981),
(164748, 'ruRU', 'Твоему сну пришел конец!', '', 29981),
(164747, 'ruRU', 'Сбрось оковы плоти!', '', 29981),
(164746, 'ruRU', 'За повелителя!', '', 29981),
(164745, 'ruRU', 'Ничтожество!', '', 29981),
(164744, 'ruRU', 'Склонитесь перед его силой!', '', 29981),
(164743, 'ruRU', 'Склонитесь перед его величием!', '', 29981),
(164742, 'ruRU', 'Его шепот дарует блаженство!', '', 29981),
(164741, 'ruRU', 'Примите истину повелителя!', '', 29981),
(164740, 'ruRU', 'Уходи... раненым нужно время... чтобы исцелиться...', 'Уходи... раненым нужно время... чтобы исцелиться...', 29981),
(164739, 'ruRU', 'Я... обрету покой...', 'Я... обрету покой...', 29981),
(164738, 'ruRU', 'Мне жаль... если кто-то причинил тебе боль... Не поддавайся... гневу...', 'Мне жаль... если кто-то причинил тебе боль... Не поддавайся... гневу...', 29981),
(164737, 'ruRU', '$pr, может, моя смерть... утолит наконец... твою жажду крови?', '$pr, может, моя смерть... утолит наконец... твою жажду крови?', 29981),
(164736, 'ruRU', 'Теперь я понимаю... о чем... они говорили. Как... темно...', 'Теперь я понимаю... о чем... они говорили. Как... темно...', 29981),
(164735, 'ruRU', 'Сегодня земля пропитается кровью Орды!', '', 29981),
(164734, 'ruRU', 'Простите, друзья мои... теперь я не смогу вам помочь...', 'Простите, друзья мои... теперь я не смогу вам помочь...', 29981),
(164733, 'ruRU', 'Еще одна бессмысленная смерть... в череде многих...', 'Еще одна бессмысленная смерть... в череде многих...', 29981),
(164732, 'ruRU', 'Все равно мы победим.', '', 29981),
(164731, 'ruRU', 'Прошу, не трогай остальных...', 'Прошу, не трогай остальных...', 29981),
(164730, 'ruRU', 'Настал твой конец!', '', 29981),
(164729, 'ruRU', 'Этот мир нуждается в исцелении – ему не нужны новые войны.', 'Этот мир нуждается в исцелении – ему не нужны новые войны.', 29981),
(164728, 'ruRU', '$pr, мы выстоим и продолжим борьбу.', '$pr, мы выстоим и продолжим борьбу.', 29981),
(164727, 'ruRU', 'Если хочешь драться, сразись со мной, но не трогай раненых.', 'Если хочешь драться, сразись со мной, но не трогай раненых.', 29981),
(164726, 'ruRU', 'Это кровопролитие устроили такие, как ты.', 'Это кровопролитие устроили такие, как ты.', 29981),
(164725, 'ruRU', 'Неужели в тебе нет ни капли сочувствия к умирающим?', 'Неужели в тебе нет ни капли сочувствия к умирающим?', 29981),
(164724, 'ruRU', 'Они все умрут, если я их не вылечу!', 'Они все умрут, если я их не вылечу!', 29981),
(164723, 'ruRU', 'Не делай этого, друг мой. Я не хочу с тобой драться.', 'Не делай этого, друг мой. Я не хочу с тобой драться.', 29981),
(164722, 'ruRU', 'Я не боец, но буду защищать этих раненых даже ценой своей жизни.', 'Я не боец, но буду защищать этих раненых даже ценой своей жизни.', 29981),
(164721, 'ruRU', 'Держите строй! Подкрепление уже в пути!', '', 29981),
(164719, 'ruRU', 'Пусть их плоть станет нашим искупительным подношением.', '', 29981),
(164718, 'ruRU', 'Он пробудился, и теперь вместо него заснут они.', '', 29981),
(164717, 'ruRU', 'Они слишком дерзки... недостойны его дара.', '', 29981),
(164716, 'ruRU', 'Гнилой смрад смертных оскверняет этот чертог!', '', 29981),
(164715, 'ruRU', '', '$p... Чумомет...', 29981),
(164714, 'ruRU', 'Наги захватили рудник Лорнесты!', 'Наги захватили рудник Лорнесты!', 29981),
(164713, 'ruRU', '', 'Благодарю за скорый визит, $n. Это задание я могу доверить лишь тебе.', 29981),
(164712, 'ruRU', '<Просто кивнуть в ответ.>', '<Просто кивнуть в ответ.>', 29981),
(164711, 'ruRU', 'Да, моя королева?', 'Да, моя королева?', 29981),
(164710, 'ruRU', '', 'Приветствую. У меня к тебе поручение.', 29981),
(164707, 'ruRU', '', 'Смерть идет за вами.', 29981),
(164705, 'ruRU', '', 'Будь осторожнее. Если кому-то и суждено тебя убить, пусть это буду я.', 29981),
(164704, 'ruRU', '', 'Ты ведь не хочешь снова меня бросить? Это было так грубо! Особенно после всего, что я для тебя сделала...', 29981),
(164703, 'ruRU', '', 'Ты только посмотри!', 29981),
(164702, 'ruRU', '', 'Только такие герои, как ты, заслуживают моего восхищения.', 29981),
(164701, 'ruRU', '', 'Постарайся меня не потерять, хорошо?', 29981),
(164700, 'ruRU', '', 'Встретимся на на обрыве Забвения. Там свершится наша судьба. Там откроется наш путь.', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164699, 'ruRU', '', 'Кровь тех, кого мы коснулись... слаще нее нет ничего.', 29981),
(164698, 'ruRU', '', 'Мы с тобой – великолепная команда. Правда?', 29981),
(164697, 'ruRU', '', 'Вместе мы совершим выдающиеся подвиги. Нас ждут грандиозные дела.', 29981),
(164696, 'ruRU', '', 'И все же, я рада, что мы с тобой снова вместе. Должна признаться, ты нравишься мне больше всех моих прежних спутников.', 29981),
(164695, 'ruRU', '', 'Как прекрасно чувствовать себя обновленной! Но я не забыла, что случилось в Силитусе. Столько силы потрачено впустую...', 29981),
(164694, 'ruRU', '', 'Я знала, что не зря тебя выбрала, $n. Твои сила и отвага... неоспоримы.', 29981),
(164693, 'ruRU', '', 'Да! Да! Как долго я не принимала форму смертной. А это тело... весьма привлекательно.', 29981),
(164692, 'ruRU', '', 'Но ты... Я чувствую, что тебе уготована великая судьба. Вместе мы совершим выдающиеся подвиги. Нас ждут грандиозные дела.', 29981),
(164691, 'ruRU', '', 'Совсем недавно я помогла другому смертному герою победить Пылающий Легион ценой своей силы. Увы, этот жрец оказался... недальновидным.', 29981),
(164690, 'ruRU', '', 'Я понимаю, что разговаривать с оружием может быть... непривычно. Но ты не бойся. Я лишь хочу помочь тебе раскрыть свой потенциал.', 29981),
(164688, 'ruRU', '', 'Силы... иссякают. Нужна... кровь... души...', 29981),
(164687, 'ruRU', '', 'Какую бы боль нам не пришлось вынести, мы не утратим надежду. И даже перед ликом самой Тьмы не отречемся от Вечного Солнца.', 29981),
(164686, 'ruRU', '', 'Пусть этот монумент напоминает о том, что значит быть син\'дорай. Что каждым поступком мы должны чтить жертвы, на которые пошли наши предшественники.', 29981),
(164685, 'ruRU', '', 'С падением Луносвета моя вера надломилась. Я забыла о том, кем была. Но милостью Света я обрела искупление.', 29981),
(164684, 'ruRU', '', 'Тысячи лет Солнечный Колодец был для моего народа всем. Осквернив его, Артас нанес нам страшную рану.', 29981),
(164681, 'ruRU', '', 'Всего один выверенный удар способен парализовать противника. Превосходно.', 29981),
(164680, 'ruRU', '', 'Правосудие свершилось! Селама ам\'оронор!', 29981),
(164679, 'ruRU', '', 'Прошу... эти раненые... нуждаются... в исцелении... Как и ты...', 29981),
(164678, 'ruRU', '', 'В этом месте царит мир и покой. Неужели в тебе нет ни капли сочувствия к раненым?', 29981),
(164677, 'ruRU', 'Взять предмет', 'Взять предмет', 29981),
(164676, 'ruRU', '', 'Где-то рядом расположился вражеский офицер. Уязвимая цель без должной охраны. Разберись с ним.', 29981),
(164675, 'ruRU', 'Магия – это здорово. Может быть, я смогу научиться магии!', '', 29981),
(164674, 'ruRU', '', 'Рядом нет душ, готовых служить.', 29981),
(164673, 'ruRU', 'Места, куда хочешь попасть, будто бы прямо здесь, но на самом деле нет.', '', 29981),
(164672, 'ruRU', 'У-у! Куда отправимся?', '', 29981),
(164671, 'ruRU', '', 'Разведка сообщает, что где-то рядом замечен сильный враг. Не стоит его недооценивать.', 29981),
(164670, 'ruRU', 'Азерот... истекает кровью? Как грустно. Она поправится?', '', 29981),
(164669, 'ruRU', '', 'Блестяще! Против тебя у врага не было ни малейшего шанса.', 29981),
(164668, 'ruRU', '', 'Наши враги не заслуживают столь легкой смерти.', 29981),
(164667, 'ruRU', '', 'Как легко ты обрываешь жизни врагов. Им нас не сломить!', 29981),
(164666, 'ruRU', '', 'Наших врагов ждут лишь слезы и пепел.', 29981),
(164665, 'ruRU', 'Это Магни? Он правда весь из алмазов!', '', 29981),
(164664, 'ruRU', 'Ух ты... меч...', '', 29981),
(164663, 'ruRU', '', 'Враги надеются выстоять против нас? Покажи им, как сильно они заблуждаются.', 29981),
(164662, 'ruRU', '', 'Победа не достанется Орде. Убей ее офицеров и разгони войска!', 29981),
(164661, 'ruRU', '', 'Эти тропы – просто подарок для тех, кто не хочет привлекать внимания. Давай осмотримся.', 29981),
(164660, 'ruRU', '', 'Калдорай тысячелетиями оттачивали свое мастерство. Воины Орды – просто дети по сравнению с нами.', 29981),
(164659, 'ruRU', '', 'Без вожака вражеская армия разбежится в страхе. Отсеки голову чудовища.', 29981),
(164658, 'ruRU', '', 'Дикари понимают лишь язык смерти. Уверена, тебе есть, что им рассказать.', 29981),
(164657, 'ruRU', '', 'Тиранда ищет Око Элуны. До войны оно хранилось в Аубердине.', 29981),
(164656, 'ruRU', '', 'Войска Орды действуют необычайно слаженно. Значит, их командир находится где-то рядом. Найди и убей его.', 29981),
(164655, 'ruRU', '', 'Да хранит тебя Элуна, сестра.', 29981),
(164654, 'ruRU', 'Методично лишая врага всех преимуществ, мы не оставляем ему шансов. Альянс победит.', '', 29981),
(164653, 'ruRU', 'Твоя победа не пройдет для Орды без последствий. Мне уже не терпится почитать о них в будущих докладах.', '', 29981),
(164652, 'ruRU', 'У нас новое поступление оружия. Раздадим его троллям крови. Как говорится, враг нашего врага...', '', 29981),
(164651, 'ruRU', 'Агенты ШРУ обозначили основные цели рядом с тобой. Ты знаешь, что делать.', '', 29981),
(164649, 'ruRU', '', 'Наги ищут реликвии для своего ритуала. Они хотят призвать бурю, что сметет всех неверующих в этом мире. Фанатики…', 29981),
(164647, 'ruRU', 'Герой Орды $n захватывает мастерскую осадных машин Затопленного Круга!', 'Герой Орды $n захватывает мастерскую осадных машин Затопленного Круга!', 29981),
(164646, 'ruRU', 'Герой Орды $n отбивает атаку на мастерскую осадных машин Затопленного Круга!', 'Герой Орды $n отбивает атаку на мастерскую осадных машин Затопленного Круга!', 29981),
(164645, 'ruRU', 'Герой Орды $n атакует мастерскую осадных машин Затопленного Круга!', 'Герой Орды $n атакует мастерскую осадных машин Затопленного Круга!', 29981),
(164644, 'ruRU', 'Герой Альянса $n атакует мастерскую осадных машин Затопленного Круга!', 'Герой Альянса $n атакует мастерскую осадных машин Затопленного Круга!', 29981),
(164643, 'ruRU', 'Герой Альянса $n отбивает атаку на мастерскую осадных машин Затопленного Круга!', 'Герой Альянса $n отбивает атаку на мастерскую осадных машин Затопленного Круга!', 29981),
(164642, 'ruRU', 'Герой Альянса $n захватывает мастерскую осадных машин Затопленного Круга!', 'Герой Альянса $n захватывает мастерскую осадных машин Затопленного Круга!', 29981),
(164639, 'ruRU', 'Великолепная работа. Орде придется изменить свои планы.', '', 29981),
(164638, 'ruRU', 'Многие агенты сочли бы эту миссию невыполнимой... но только не ты.', '', 29981),
(164637, 'ruRU', 'Я боюсь троллей крови, но знаю, что ты меня защитишь. Правда, $n?', '', 29981),
(164636, 'ruRU', 'А господин Кишан здесь? Я слышал столько историй о его боевых подвигах!', '', 29981),
(164635, 'ruRU', 'Вода здесь такая мутная... в ней можно плавать?', '', 29981),
(164634, 'ruRU', 'Эти солдаты такие серьезные и сосредоточенные. Почти такие же, как у нас.', '', 29981),
(164633, 'ruRU', 'Ты только посмотри на этих динозавриков! Хочу поймать себе такого.', '', 29981),
(164632, 'ruRU', 'Это пустыня? Она как пляж, только везде!', '', 29981),
(164631, 'ruRU', 'Орда усилила патрули в этой местности. Выясни, что они охраняют, и уничтожь их.', '', 29981),
(164630, 'ruRU', 'Это настоящие развалины? Пойдем исследуем их?!', '', 29981),
(164629, 'ruRU', 'Я хочу увидеть динозавров!', '', 29981),
(164628, 'ruRU', 'Смотри, сколько буровых установок!', '', 29981),
(164627, 'ruRU', 'Твоя задача – проникнуть в тыл Орды и устранить важную цель. Соглашайся, это будет интересно!', '', 29981),
(164626, 'ruRU', 'Прекрасная операция. Тени – твоя стихия.', '', 29981),
(164625, 'ruRU', 'Десять!', 'Десять!', 29981),
(164624, 'ruRU', 'Девять!', 'Девять!', 29981),
(164623, 'ruRU', 'Восемь!', 'Восемь!', 29981),
(164622, 'ruRU', 'Семь!', 'Семь!', 29981),
(164621, 'ruRU', 'Шесть!', 'Шесть!', 29981),
(164620, 'ruRU', 'Пять!', 'Пять!', 29981),
(164619, 'ruRU', 'Четыре!', 'Четыре!', 29981),
(164618, 'ruRU', 'ПЛЕЙСХОЛДЕР – Кат-сцена воскрешения Дерека Праудмура, Бейн в ярости.', 'ПЛЕЙСХОЛДЕР – Кат-сцена воскрешения Дерека Праудмура, Бейн в ярости.', 29981),
(164617, 'ruRU', '', 'Ну... это мы еще посмотрим.', 29981),
(164616, 'ruRU', '', 'Тоатана! Это не очень вежливо с твоей стороны.', 29981),
(164615, 'ruRU', 'Тоатана качает головой и злобно щелкает на Ксал\'атат.', '', 29981),
(164614, 'ruRU', 'Тоатана указывает вперед и издает странный жужжащий звук.', '', 29981),
(164613, 'ruRU', 'Тоатана злобно щелкает.', '', 29981),
(164612, 'ruRU', 'Что вы собираетесь делать?', 'Что вы собираетесь делать', 29981),
(164611, 'ruRU', '', 'Я больше не выдержу!', 29981),
(164610, 'ruRU', '', 'Помни, нужно действовать не спеша. Не терять контроль. Нельзя допустить, чтобы эта реликвия обратилась в пыль, прежде чем мы поймем, как ее создателям удалось наложить такие сильные чары.', 29981),
(164609, 'ruRU', 'Ха! Шучу, конечно! Какие к черту сомнения, когда у меня есть летающая машина с лазерными пушками из крови планеты!', '', 29981),
(164608, 'ruRU', 'Дерево бы не сожгли, и у нежити по-прежнему был бы свой город... Наводит на размышления, да?', '', 29981),
(164607, 'ruRU', 'Представь – ведь если бы о нем никто не узнал, может, никакой войны и не было бы.', '', 29981),
(164606, 'ruRU', 'Знаешь, я иногда спрашиваю себя, а стоило ли мне вообще рассказывать Сильване про азерит?', '', 29981),
(164605, 'ruRU', 'В следующий раз я точно убью этого мелкого психа!', '', 29981),
(164604, 'ruRU', 'Я потрачу гору золота, но найду способ справиться с его дурацкой броней.', '', 29981),
(164603, 'ruRU', '|A:Warfront-HordeHero-Gold:25:23:0:0|aНаги отправили штурмовой отряд!', '|A:Warfront-HordeWave3:25:23:0:0|aНаги отправили штурмовой отряд!', 29981),
(164602, 'ruRU', '', 'Нет... Все не может так кончиться...', 29981),
(164601, 'ruRU', 'Битва еще не окончена. Мы вернемся с новыми силами.', '', 29981),
(164600, 'ruRU', 'Нет... Прости меня, королева.', '', 29981),
(164599, 'ruRU', '', 'Поняла. Я сделаю все тихо и быстро.', 29981),
(164598, 'ruRU', '', 'Темные следопыты вышли на охоту. Укажите им цель, и они помогут.', 29981),
(164597, 'ruRU', '', 'Здесь наши пути расходятся. Продолжайте без меня.', 29981),
(164596, 'ruRU', '', 'Башал\'Аран. Как же он изменился...', 29981),
(164595, 'ruRU', 'И ради этого... меня... оторвали от кружки хмеля?', '', 29981),
(164594, 'ruRU', 'Эй! Руки прочь!', '', 29981),
(164593, 'ruRU', 'Стой спокойно, чтобы я мог... ударить... тебя! *Ик*!', '', 29981),
(164592, 'ruRU', 'Хорошо, что мои рабочие руки сегодня при мне.', 'Хорошо, что мои рабочие руки сегодня при мне.', 29981),
(164591, 'ruRU', 'Лишь бы кости меня не подвели.', 'Лишь бы кости меня не подвели.', 29981),
(164590, 'ruRU', 'Не вопрос.', 'Не вопрос.', 29981),
(164589, 'ruRU', 'Победа или смерть!', 'Победа или смерть!', 29981),
(164588, 'ruRU', 'За... Орду!', 'За... Орду!', 29981),
(164587, 'ruRU', 'К твоим услугам.', 'К твоим услугам.', 29981),
(164586, 'ruRU', 'Звали меня?', 'Звали меня?', 29981),
(164585, 'ruRU', 'Будет сделано.', 'Будет сделано.', 29981),
(164584, 'ruRU', 'Она ведет агнца на убой. Достойная жертва.', 'Она ведет агнца на убой. Достойная жертва.', 29981),
(164583, 'ruRU', 'Мы проломим камень. Мы сольемся с Бездной!', 'Мы проломим камень. Мы сольемся с Бездной!', 29981),
(164582, 'ruRU', 'Мы пробудились! Мы восстанем из глубин... и он восстанет!', 'Мы пробудились! Мы восстанем из глубин... и он восстанет!', 29981),
(164581, 'ruRU', 'Око видит все! Его величие... его расцвет!', 'Око видит все! Его величие... его расцвет!', 29981),
(164580, 'ruRU', 'Смотри, какие острые! Можно попробовать?', '', 29981),
(164579, 'ruRU', 'Никогда не видел вблизи гномские инженерные штуки... опасные, наверное!', '', 29981),
(164578, 'ruRU', 'Как штаны могут превратиться в самоцветы?', '', 29981),
(164577, 'ruRU', 'Мисс Уэстерсон сказала, что нельзя говорить \"ненужный хлам\".', '', 29981),
(164576, 'ruRU', 'Что будет, если я потрогаю один из этих сияющих ящиков?', '', 29981),
(164575, 'ruRU', 'Давай трансмогрифицируем мне огромные наплечники!', '', 29981),
(164574, 'ruRU', 'Эти ребята сделаны из летающих бинтов? Я их боюсь.', '', 29981),
(164573, 'ruRU', 'Говорил что-то про \"увидеть плоды своих трудов\", ну или что-то в этом роде. Звучало угрожающе – наверняка Бейн не обрадуется.', '', 29981),
(164572, 'ruRU', 'А, ну да. Темный принц сказал, что тебя хотят видеть на \"Вое банши\", когда мы тут закончим.', '', 29981),
(164570, 'ruRU', 'Я никогда не бывал на таком большом корабле!', '', 29981),
(164569, 'ruRU', 'Хе-хе... Я и не думал, что если рассказать Сильване про азерит, все пойдет вот так.', '', 29981),
(164568, 'ruRU', 'Здесь вы решаете, как выиграть войну? А леди Джайна тоже здесь?!', '', 29981),
(164567, 'ruRU', 'Это ТОТ САМЫЙ Халфорд Змеевержец?! Ух ты!', '', 29981),
(164566, 'ruRU', 'Думаю, унывать все же не стоит. Мы взорвали корабль, уничтожили кучу ботов и защитили свой азерит!', '', 29981),
(164565, 'ruRU', 'Только посмотри на эти доспехи 7-го легиона! Все сверкают!', '', 29981),
(164564, 'ruRU', 'Мы уже почти победили его! Только вот корабль очень некстати начал взрываться...', '', 29981),
(164563, 'ruRU', 'Это линкор Альянса?! Вот это да! Какие у него пушки!', '', 29981),
(164562, 'ruRU', '', 'Я зачаровала несколько гарпунов. Обстреляй корабли Орды, и они получат свой азерит обратно.', 29981),
(164561, 'ruRU', '', 'Я хочу телепортировать бомбы на корабли Орды, но моему заклинанию нужна конкретная цель.', 29981),
(164557, 'ruRU', 'Уничтожь эту штуковину, и тогда я смогу нас отсюда вытащить!', '', 29981),
(164556, 'ruRU', 'Какого... Он просто так взял и сделался неуязвимым! Да к тому же еще и нас вырубил! С тобой такое раньше бывало, $p?', '', 29981),
(164555, 'ruRU', 'А заодно познакомься с моим ультрамагнетизатором! Теперь вы никуда не денетесь с корабля, а у твоей жалкой пародии на робота случится короткое замыкание.', '', 29981),
(164554, 'ruRU', 'С вами было неприятно иметь дело. Удачи в жизни после смерти!', '', 29981),
(164553, 'ruRU', 'Ха! Галливикс, броня на основе сверх-юлящей жульнической единицы титанов защитит меня от всех твоих жалких ударов!', '', 29981),
(164551, 'ruRU', 'Нет, я тебя так просто не отпущу – мы покончим с этим здесь и сейчас!', '', 29981),
(164549, 'ruRU', 'Корабль разваливается на части... в следующий раз тебе так не повезет, Галливикс!', '', 29981),
(164548, 'ruRU', 'Галливикс, $p! Мне следовало вас прикончить, когда была возможность! Вы за это заплатите!', '', 29981),
(164547, 'ruRU', 'Подавай ложный сигнал SOS, чтобы заманить сюда Меггакрута.', 'Подавай ложный сигнал SOS, чтобы заманить сюда Меггакрута.', 29981),
(164546, 'ruRU', 'Только взгляни на все эти разрушения! Если нравится такое зрелище, это всегда можно устроить за золото.', '', 29981),
(164544, 'ruRU', '<Сразиться с Сирой.>', '<Сразиться с Сирой.>', 29981),
(164543, 'ruRU', '', '<Тело Деларин давно остыло.>', 29981),
(164541, 'ruRU', 'Покажи мне, что произошло.', 'Покажи мне, что произошло.', 29981),
(164540, 'ruRU', 'Огонек беспокойно мерцает.', '', 29981),
(164539, 'ruRU', '', 'Наша цель впереди. Там ты исполнишь свое предназначение.', 29981),
(164538, 'ruRU', 'Я не знаю.', 'Я не знаю.', 29981),
(164537, 'ruRU', 'Начать атаку на Лор\'данелский пляж.', 'Начать атаку на Лор\'данелский пляж.', 29981),
(164536, 'ruRU', 'Начать атаку на берег Мрачных Волн.', 'Начать атаку на берег Мрачных Волн.', 29981),
(164535, 'ruRU', 'Начать атаку на Пепельную рощу.', 'Начать атаку на Пепельную рощу.', 29981),
(164534, 'ruRU', 'Начать атаку на Ясеневый терминал.', 'Начать атаку на Ясеневый терминал.', 29981),
(164533, 'ruRU', '', 'Я помогу вам убивать врагов. Куда нанесем удар?', 29981),
(164532, 'ruRU', '', 'Спасая солдат, ты спасаешь и меня от тренировки дубоголовых новобранцев. В следующий раз я угощаю.', 29981),
(164531, 'ruRU', '', 'Мне нужно отступить. Удачи вам.', 29981),
(164530, 'ruRU', '', 'Да будет так. Я залью эти земли кровью Орды.', 29981),
(164529, 'ruRU', '', 'Вы создали прекрасный форпост в Башал\'Аране.', 29981),
(164528, 'ruRU', '', 'Слушайте меня, салаги! Никаких передышек, пока не спасем всех, кого можно. Мы своих не бросаем!', 29981),
(164527, 'ruRU', 'Я уж не знаю, какие орки воняют сильнее – живые или дохлые.', '', 29981),
(164526, 'ruRU', 'Вонючие орки захотели пройти через наши земли. Но я-то их за версту чую! Перебей их всех!', '', 29981),
(164525, 'ruRU', '', 'Я видела, как ты бьешься. Будто я сама в молодости. Эти долгие битвы в Альтераке...', 29981),
(164524, 'ruRU', 'Я все еще слышу их.', 'Я все еще слышу их.', 29981),
(164523, 'ruRU', '', 'Да-да! Хорошо! Убери отсюда эту штуку!', 29981),
(164521, 'ruRU', '', 'Используй Камень Бездны, $n. Вобрав его силу, я смогу помочь тебе найти оставшиеся реликвии.', 29981),
(164520, 'ruRU', '', 'Камень, способный призвать тьму...', 29981),
(164519, 'ruRU', '', 'Останови их и забери его.', 29981),
(164518, 'ruRU', '', 'Смотри! Какие-то дилетанты проводят над Камнем ритуал.', 29981),
(164517, 'ruRU', '', 'Она совсем рядом. Реликвия... средоточие энергии Бездны.', 29981),
(164516, 'ruRU', '', 'Один путь кончается... Чтобы начался другой.', 29981),
(164515, 'ruRU', '', 'Ничтожество. Только сильные могут обрести истинное могущество.', 29981),
(164514, 'ruRU', '', 'Корона для правителя всех миров...', 29981),
(164513, 'ruRU', 'У меня аж все подбородки трясутся от нетерпения! Но все по порядку – давай сперва взорвем этот корабль.', '', 29981),
(164512, 'ruRU', 'Вот здесь-то мы с тобой и взорвем его на горящем корабле. Вот это будет зрелище!', '', 29981),
(164511, 'ruRU', 'А когда он будет на месте, мы зажмем его с двух сторон! Я буду в роботе, а ты... А ты тоже что-нибудь придумаешь!', '', 29981),
(164510, 'ruRU', 'Он полетит обратно и будет всю дорогу ныть: \"О нет, Галливикс меня обставил, уничтожил мой корабль! Мне надо всех спасти!\"', '', 29981),
(164509, 'ruRU', 'Покажем Меггакруту, что мы не такие болваны, как он думает. Когда его корабль загорится, мы высадимся на него и отправим сигнал SOS.', '', 29981),
(164508, 'ruRU', 'Ну, поехали! Топливо у нас есть, планы тоже есть – и у нас даже есть руки, чтобы нажимать нужные кнопки в нужный момент!', '', 29981),
(164507, 'ruRU', '', 'Проклятье!', 29981),
(164506, 'ruRU', '', 'А теперь... уничтожь его.', 29981),
(164505, 'ruRU', '', 'Там, на берегу... должно быть, это шатер Натаноса. Чуть ближе.', 29981),
(164504, 'ruRU', '', 'Их много. И это хорошо. Чем больше убьем сегодня, тем меньше останется на завтра.', 29981),
(164503, 'ruRU', '', 'Лор\'данел... от него ничего не осталось...', 29981),
(164502, 'ruRU', 'Я расправился с их командиром и забрал азеритовые бомбы.', 'Я расправилась с их командиром и забрала азеритовые бомбы.', 29981),
(164501, 'ruRU', '', '*Стонет* Я теряю контроль!', 29981),
(164500, 'ruRU', '', 'Поразительно сложные чары. Невероятно, чтобы кто-то один мог... Ого! Вот это всплеск энергии. Мне трудно...', 29981),
(164499, 'ruRU', '', 'Невероятно! Чары не просто наложены друг на друга, а переплетены! Никогда раньше ничего подобного не видела! Посмотрим, можно ли еще немного их разделить.', 29981),
(164497, 'ruRU', '', '$p, мы встретились лишь с малой частью армии Орды. Я отправлю Дори\'тур на разведку и позволю тебе видеть все, что увидит она.', 29981),
(164496, 'ruRU', '', 'Нельзя жить прошлым, когда на кону будущее. Веди наш народ к победе, а мне предстоит утолить гнев Ночной Воительницы.', 29981),
(164495, 'ruRU', '', 'Ты доверяешь мне, несмотря на... все, что было?', 29981),
(164494, 'ruRU', '', 'Пришло время вернуть наши земли. Майев, ты поведешь войска.', 29981),
(164493, 'ruRU', '', 'Гнилостень сбежал, но мы убили одну из валь\'кир его королевы.', 29981),
(164492, 'ruRU', '', 'Тиранда, что случилось?', 29981),
(164491, 'ruRU', '', 'Нет. Наши войска на подходе. Мы еще поквитаемся.', 29981),
(164490, 'ruRU', 'Я догоню их.', '', 29981),
(164489, 'ruRU', 'Ведьма! Ты за это заплатишь! Отходим!', '', 29981),
(164488, 'ruRU', 'Не за что, Зеллинг. Береги себя. И помни, теперь ты на вражеской земле.', '', 29981),
(164487, 'ruRU', 'Орда собрала более 28 ингредиентов и скоро победит!', '', 29981),
(164486, 'ruRU', 'Альянс собрал более 28 ингредиентов и скоро победит!', '', 29981),
(164485, 'ruRU', '', 'Нет! Темная Госпожа... Прости...', 29981),
(164484, 'ruRU', '', 'Тебе конец! Аш торибас!', 29981),
(164483, 'ruRU', '', 'У нас ничего не осталось. Мы – Отрекшиеся.', 29981),
(164482, 'ruRU', '', 'А вы нас бросили. Элуна нас бросила!', 29981),
(164481, 'ruRU', '', 'Ск\'магг яуифк хок!', 29981),
(164480, 'ruRU', '', 'Мы верили в вас.', 29981),
(164479, 'ruRU', 'Госпожа Восс... надо поблагодарить ее. И тебе спасибо, Рексар. Когда мои родные в порядке, и мне спокойней.', '', 29981),
(164478, 'ruRU', '', 'Сестры, поборите тьму в ваших сердцах!', 29981),
(164477, 'ruRU', 'Азерит у нас! Силы Альянса разбиты, и наши воины отходят. Можешь возвращаться на взгорье Западного Ветра!', '', 29981),
(164476, 'ruRU', '', '', 29981),
(164475, 'ruRU', 'Слишком поздно. Смотрите!', '', 29981),
(164474, 'ruRU', '[ПОСЛЕДНИЙ] Рассказывай, что там случилось!', '[ПОСЛЕДНИЙ] Рассказывай, что там случилось!', 29981),
(164473, 'ruRU', 'Отголоски твоей искалеченной души останутся здесь навечно!', '', 29981),
(164472, 'ruRU', 'Ваша смерть пришла.', '', 29981),
(164471, 'ruRU', 'Но когда наш ритуал завершится...', '', 29981),
(164470, 'ruRU', 'Ощути вкус силы...', '', 29981),
(164469, 'ruRU', 'Хотя из него получится прекрасное подношение.', '', 29981),
(164468, 'ruRU', 'Какой бы ни была твоя истинная сущность...', '', 29981),
(164467, 'ruRU', 'Лучше бы тебе следить за своим языком...', '', 29981),
(164466, 'ruRU', '$n добывает ингредиент для Орды!', '', 29981),
(164465, 'ruRU', '$n добывает ингредиент для Альянса!', '', 29981),
(164464, 'ruRU', '', 'Восстаньте! Примите этот дар во имя Сильваны, Королевы-банши!', 29981),
(164463, 'ruRU', 'Ты – ничто. Поднимайте их.', '', 29981),
(164462, 'ruRU', 'Что?!', '', 29981),
(164461, 'ruRU', '', 'Мы не одни. Малфурион!', 29981),
(164460, 'ruRU', 'Довольно! Последнее слово, жрица?', '', 29981),
(164459, 'ruRU', 'Я все равно тебя найду, эльфийка.', '', 29981),
(164458, 'ruRU', '', 'Шал\'карат!', 29981),
(164457, 'ruRU', 'Скоро ты разделишь судьбу своей подруги Сиры... и благородной Деларин. Встреча будет... особенно теплой.', '', 29981),
(164456, 'ruRU', '', 'Встретимся, когда очистим верфи от Орды.', 29981),
(164455, 'ruRU', '', 'Я не королева. Я – возмездие калдорай.', 29981),
(164454, 'ruRU', 'Как грубо для... королевы древесных эльфов, так? Нет, боюсь, уже нет... Напомни, чем ты правишь теперь?', '', 29981),
(164453, 'ruRU', 'Эти трусы убегают! Всем войскам – в атаку! За Орду!', '', 29981),
(164452, 'ruRU', 'Местные тролли крови раздобыли какое-то странное оружие. Война на два фронта нам точно не нужна.', '', 29981),
(164451, 'ruRU', 'Вы получаете железо и древесину.\nВы получаете \"Бушующую силу\".', 'Вы получаете железо и древесину.', 29981),
(164450, 'ruRU', '', 'Ты не доживешь до рассвета, чудовище.', 29981),
(164449, 'ruRU', 'Мне все равно надоело прятаться...', 'Мне все равно надоело прятаться...', 29981),
(164448, 'ruRU', 'Эй, $pr, убирайся в свой Зандалар!', 'Эй, $pr, убирайся в свой Зандалар!', 29981),
(164447, 'ruRU', 'Кул-Тирас принадлежит нам!', 'Кул-Тирас принадлежит нам!', 29981),
(164446, 'ruRU', 'Прочь с нашей земли, ордынское отродье!', 'Прочь с нашей земли, ордынское отродье!', 29981),
(164445, 'ruRU', 'Эй! Как тебе удалось меня найти?', 'Эй! Как тебе удалось меня найти?', 29981),
(164444, 'ruRU', 'За Альянс!', 'За Альянс!', 29981),
(164443, 'ruRU', 'Долго же вы меня искали.', 'Долго же вы меня искали.', 29981),
(164442, 'ruRU', 'Я всегда знал: магия Орды – ничто по сравнению с нашей. Мы позаботимся о том, чтобы враг не получил подкреплений.', '', 29981),
(164441, 'ruRU', 'Орда призывает в эту область подкрепления. Найди тех, кто это делает, и устрани их во славу Альянса!', '', 29981),
(164440, 'ruRU', '', 'Вот как... Хорошо, королева. Орда приветствует вас.', 29981),
(164439, 'ruRU', '', 'Королеве не годится преклонять колена. Думаю, вы это понимаете.', 29981),
(164438, 'ruRU', '', 'На равных?', 29981),
(164437, 'ruRU', '', 'Пора скрепить наш союз. Отныне зандалары и Орда будут сражаться вместе... на равных.', 29981),
(164436, 'ruRU', '', 'Я знаю, что вам нужна помощь нашей армии. Альянс пойдет на все, чтобы уничтожить вас.', 29981),
(164435, 'ruRU', '', 'Неизвестно, смогли бы мы в одиночку справиться с нашими врагами.', 29981),
(164434, 'ruRU', '', 'Орда стала верным союзником Зандалара.', 29981),
(164433, 'ruRU', '', 'Бесспорно.', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164432, 'ruRU', '', 'Я приму вождя в своем тронном зале.', 29981),
(164431, 'ruRU', 'Какая досада. Я так давно хочу душу вождя. Ладно, ступай. Надевай свою корону.', '', 29981),
(164430, 'ruRU', '', 'Да. Честь для меня превыше свободы.', 29981),
(164429, 'ruRU', 'Таков твой ответ?', '', 29981),
(164428, 'ruRU', '', 'Лейтенант Малийра скончалась от полученных ранений, не выдав никаких важных сведений.', 29981),
(164427, 'ruRU', '', 'Я так легко не сдамся!', 29981),
(164426, 'ruRU', '', 'Я ничего... вам... не скажу!', 29981),
(164424, 'ruRU', 'Я умираю... за Тельдрассил!', '', 29981),
(164423, 'ruRU', 'Лейтенант Голрас скончался от полученных ранений, не выдав никаких важных сведений.', '', 29981),
(164422, 'ruRU', 'Я ничего тебе не скажу, отродье Орды!', '', 29981),
(164421, 'ruRU', 'Лейтенант Ивит скончался от полученных ранений, не выдав никаких важных сведений.', '', 29981),
(164420, 'ruRU', 'Альянс захватил Увядающую рощу!', 'Альянс захватил Увядающую рощу!', 29981),
(164419, 'ruRU', 'Сдохни, отродье Орды!', '', 29981),
(164417, 'ruRU', 'Рассказывай, что там случилось!', 'Рассказывай, что там случилось!', 29981),
(164416, 'ruRU', 'Нечего говорить, лучше умри!', '', 29981),
(164415, 'ruRU', '', 'Займись Гнилостенем. Валь\'киры мои.', 29981),
(164414, 'ruRU', '', 'Нет. Дождись моего сигнала.', 29981),
(164413, 'ruRU', 'Ударим вместе.', '', 29981),
(164412, 'ruRU', '', 'Хорошо. Я рада, что ты на нашей стороне.', 29981),
(164411, 'ruRU', 'Вот это бой! Они хоть что-то успели понять перед смертью? Ха-ха-ха!', '', 29981),
(164410, 'ruRU', 'Земля поглотит вас.', '', 29981),
(164409, 'ruRU', '', 'Смерть этой цели подорвет дух солдат Орды. Покажи врагам, что им не избежать поражения.', 29981),
(164408, 'ruRU', 'Вот болваны, удумали проскользнуть прямо у нас под носом. Двигай туда и раздави их!', '', 29981),
(164407, 'ruRU', 'Бесполезная... победа...', '', 29981),
(164406, 'ruRU', '', 'Стой. Еще враги.', 29981),
(164405, 'ruRU', '', 'Пусть гниет. Он не заслужил чистой смерти.', 29981),
(164404, 'ruRU', 'Молодчина! Мы найдем, куда пристроить этот азерит!', '', 29981),
(164403, 'ruRU', 'Бороду Магни мне в зубы, сколько ж тут азерита! Давай отмутузим Орду и заберем все себе!', '', 29981),
(164402, 'ruRU', 'Встретимся там.', '', 29981),
(164400, 'ruRU', 'Функционирование восстановлено.', '', 29981),
(164399, 'ruRU', 'Передвижение более не затруднено.', '', 29981),
(164398, 'ruRU', 'Выбор новой цели для сбора древесины.', '', 29981),
(164397, 'ruRU', 'Возвращение к стандартному режиму функционирования.', '', 29981),
(164396, 'ruRU', '', 'Хоть кто-то здесь умеет воевать. Простым рубакам есть чему у тебя поучиться.', 29981),
(164395, 'ruRU', '', 'Я не сберегла свой народ, но я отомщу за павших.', 29981),
(164394, 'ruRU', 'Древо – это только начало. Все ваши леса пойдут на уголь для Орды!', '', 29981),
(164393, 'ruRU', '', 'Пожалуйста, вернитесь на место свидетеля, $n.', 29981),
(164392, 'ruRU', '', 'Это так. $n, еще одно лживое слово – я расценю это как неповиновение суду!', 29981),
(164391, 'ruRU', '', 'Да чтоб вас!.. Тут караван снабжения попал в засаду. Верни наши припасы!', 29981),
(164390, 'ruRU', '', 'Ложь! Ваша честь, вы наверняка знаете, что свидетель лжет.', 29981),
(164389, 'ruRU', '', 'Ваша честь, свидетель лжет. Мы все были там. Мы видели этот грандиозный бой!', 29981),
(164388, 'ruRU', '', 'Правда? Вы ничего не помните? Хорошо, продолжим.', 29981),
(164387, 'ruRU', '', '$n, пожалуйста, помните, что вы находитесь под присягой.', 29981),
(164386, 'ruRU', '', '$n, мы расследовали это дело вместе. Вы что, были настолько невнимательны? Эх...', 29981),
(164385, 'ruRU', '', 'Странно, я думала иначе... ладно, продолжим. $n, правда ли, что из разговора с господином Сныкобаксом вам стал известен его потенциальный мотив?', 29981),
(164381, 'ruRU', '', 'Ану дора. Ты подаешь пример всем нам.', 29981),
(164380, 'ruRU', '', 'Нет. Орда была рядом с нами в самый темный час. Я не отплачу им предательством.', 29981),
(164379, 'ruRU', '', 'Изгони это чудовище. Тор илисар\'тера\'нал!', 29981),
(164378, 'ruRU', '', 'Лоа милосердные...', 29981),
(164376, 'ruRU', 'Принеси мне голову вождя Орды, и я забуду об уговоре с твоим отцом.', '', 29981),
(164375, 'ruRU', 'Ну, если тебе так не терпится от меня избавиться... могу предложить сделку.', '', 29981),
(164374, 'ruRU', '', 'Многие наши солдаты обязаны тебе жизнью. Мы у тебя в долгу.', 29981),
(164372, 'ruRU', '', 'Давай уже покончим с этим.', 29981),
(164371, 'ruRU', '', 'Обязательно. Спасибо.', 29981),
(164370, 'ruRU', 'Подумай. Благословляю тебя.', '', 29981),
(164369, 'ruRU', 'А как насчет Орды?', '', 29981),
(164368, 'ruRU', 'Зандалары, безусловно... а как насчет союзников? Тортолланы, вульперы?', '', 29981),
(164367, 'ruRU', 'Мой вопрос тебе: кто твоя стая?', '', 29981),
(164366, 'ruRU', 'Чтобы защитить наш дом, мы объединились, сражались вместе.', '', 29981),
(164365, 'ruRU', 'Мы, лоа, сильны в стае.', '', 29981),
(164364, 'ruRU', '', 'Орда не намерена вести честную войну. Останови врага, здесь и сейчас.', 29981),
(164363, 'ruRU', '', 'Я слушаю, великий лоа.', 29981),
(164362, 'ruRU', 'Лок\'тар! Честь и слава Орде!', '', 29981),
(164361, 'ruRU', '', 'Это был интересный урок. Вот мое благословение: ступай с ветром!', 29981),
(164360, 'ruRU', 'Ты сражаешься с яростью и честью. Враги еще долго будут зализывать раны.', '', 29981),
(164359, 'ruRU', '', 'Мне нравится твой настрой, дитя.', 29981),
(164358, 'ruRU', 'Настал час охоты! Аграма-ка!', '', 29981),
(164357, 'ruRU', '', 'Я не могу побороть ветер перемен... но я выстою перед ним.', 29981),
(164356, 'ruRU', '', 'Если дерево не гнется, ветер ломает его ветви. Покорись, дитя.', 29981),
(164355, 'ruRU', 'Сегодня мы разобьем врага. Сражайся с честью!', '', 29981),
(164354, 'ruRU', '', 'А-а!', 29981),
(164353, 'ruRU', '', 'Что-то не так?', 29981),
(164352, 'ruRU', '', 'Я почти ничего не вижу... Ты здесь, $n?', 29981),
(164351, 'ruRU', '', 'Преодолей бурю – и получишь свою корону, Таланджи!', 29981),
(164350, 'ruRU', '', 'Меньшего я и не ждала!', 29981),
(164349, 'ruRU', 'Почему Альянс прислал так мало войск? Это глупость или наглость? Заставь их пожалеть об этом.', '', 29981),
(164348, 'ruRU', '', 'Спасибо, великий Краг\'ва.', 29981),
(164347, 'ruRU', 'Эти припасы пригодятся нашим солдатам. Война будет долгой...', '', 29981),
(164346, 'ruRU', 'Мы узнали, что сюда прибыли подкрепления Орды. Найди их и уничтожь.', '', 29981),
(164345, 'ruRU', 'Ты подтвердила слова делом. Благословляю тебя.', '', 29981),
(164344, 'ruRU', '', 'Не бойся, $n. Я не дам навредить тебе!', 29981),
(164343, 'ruRU', 'Ха! А вот и жертва. Защищай!', '', 29981),
(164342, 'ruRU', 'Альянс не слишком заботится об охране своих припасов. Вперед! Пленных не брать!', '', 29981),
(164341, 'ruRU', '', 'Что?!', 29981),
(164340, 'ruRU', 'Правда? Докажи.', '', 29981),
(164339, 'ruRU', 'Если мы нанесем удар здесь, то отрежем врага от снабжения. Внимание на цель, солдат! Лок-нараш!', '', 29981),
(164338, 'ruRU', '', 'Все, что есть. Даже свою жизнь, если придется.', 29981),
(164337, 'ruRU', '', 'С этим я могу помочь, капитан. Держитесь!', 29981),
(164336, 'ruRU', 'Скажи, Таланджи... Что ты готова отдать ради тех, кого поклялась защищать?', '', 29981),
(164335, 'ruRU', 'Продолжай в том же духе, и мы быстро закончим эту войну.', '', 29981),
(164334, 'ruRU', '', 'Нам пришлось очень туго, поэтому я скомандовала отступление. Но если быстро доставить людей на стены, мы сможем ударить по кораблям гарпунами.', 29981),
(164333, 'ruRU', 'Мы обратили их в бегство. Таз\'динго!', '', 29981),
(164332, 'ruRU', 'Ай молодца. Я передам хорошие новости вождю.', '', 29981),
(164331, 'ruRU', '', 'Рада это слышать! Вы уже расставили орудия на стенах?', 29981),
(164330, 'ruRU', '', 'Ану\'дора!', 29981),
(164328, 'ruRU', 'Враги здесь, прямо как предсказывала вождь. Убей их во имя Орды!', '', 29981),
(164327, 'ruRU', '', 'Время для жалости прошло.', 29981),
(164326, 'ruRU', '', 'Конечно, лорд-адмирал! Вольные гарпунщики всегда не прочь поохотиться.', 29981),
(164323, 'ruRU', '', 'Капитан Мэдисон! Вы готовы заняться этими кораблями, пока $p разбирается с саперами?', 29981),
(164321, 'ruRU', 'Духи говорят, где-то рядом есть сильное вуду... Не дай Альянсу до него добраться.', '', 29981),
(164318, 'ruRU', 'Орда призывает тебя. Отправляйся в бой и добудь славу.', '', 29981),
(164312, 'ruRU', 'Это высокопоставленный магистр... Должно быть, среди нас есть предатели! Защитники! Держите оборону! Не подпускайте этих чудовищ к Солнечному Колодцу!', 'Это высокопоставленный магистр... Должно быть, среди нас есть предатели! Защитники! Держите оборону! Не подпускайте этих чудовищ к Солнечному Колодцу!', 29981),
(164308, 'ruRU', 'Каждой стае нужен вожак. Убивай офицеров Альянса по всему Кул-Тирасу, и тогда солдаты не будут знать, что делать.', '', 29981),
(164305, 'ruRU', 'Враги напуганы. Бей их, да побольнее, пока их силы не истощатся.', '', 29981),
(164304, 'ruRU', 'Духи говорят, что где-то здесь прячется важная птица из Альянса. Покажи ей, что бежать и скрываться от Орды бесполезно.', '', 29981),
(164303, 'ruRU', '', 'Готовься, $n. Лоа смотрят на нас.', 29981),
(164301, 'ruRU', '', 'Но я точно знаю, что тебе нельзя вмешиваться. Ты не сможешь помочь мне, как в бою с Самарой.', 29981),
(164299, 'ruRU', '', 'Ха-ха-ха! Обожаю смотреть, как щенки Альянса удирают, поджав хвосты.', 29981),
(164298, 'ruRU', '', 'Вы не ранены?', 29981),
(164297, 'ruRU', 'Нам бы устранить кое-кого по-тихому, но мы не знаем, где наша цель. Сходишь на вылазку?', '', 29981),
(164296, 'ruRU', '', 'Даже теперь ты не видишь, на ком лежит вина. И за это ты умрешь.', 29981),
(164295, 'ruRU', '', 'Ты... Это ты виновата в том, что творится в городе!', 29981),
(164294, 'ruRU', '', 'Я – шепот среди оглушительных воплей. Я паук, а вы – жертвы, бьющиеся в моей паутине.', 29981),
(164293, 'ruRU', '', 'Позволь представиться.', 29981),
(164292, 'ruRU', '', 'Что все это значит?', 29981),
(164291, 'ruRU', '', 'Впереди много испытаний, но вместе мы справимся. Я лишь прошу...', 29981),
(164286, 'ruRU', '', '$p, за мной. Натанос Гнилостень рыщет где-то неподалеку с парой валь\'кир Сильваны.', 29981),
(164285, 'ruRU', '', 'Майев. Шандриса. Приготовьте войска.', 29981),
(164284, 'ruRU', '', 'Мы убьем их всех.', 29981),
(164283, 'ruRU', '', 'Правосудие свершится. Меня ведет... дух Ночной Воительницы.', 29981),
(164282, 'ruRU', '', 'Элуна! Сделай меня орудием твоего возмездия!', 29981),
(164280, 'ruRU', '', 'Аш рок илисар! Ану\'дорини аш\'ка!', 29981),
(164278, 'ruRU', '', 'Кул эрат шул, кул эрат син.', 29981),
(164277, 'ruRU', '', 'Ин\'а шул да-Элуна!', 29981),
(164276, 'ruRU', '', 'Прими эту жертву и даруй мне свой темный облик.', 29981),
(164275, 'ruRU', '', 'Услышь древний зов... Яви нам свой жестокий лик.', 29981),
(164274, 'ruRU', '', 'Даруй мне возмездие! Только тогда я снова стану служить тебе!', 29981),
(164273, 'ruRU', '', 'Тысячи лет я служила тебе. Но сегодня я не буду ни девой, ни матерью, ни даже жрицей.', 29981),
(164272, 'ruRU', '', 'Элуна! Твой народ любил тебя! Но ты спокойно смотрела, как мы гибли в муках!', 29981),
(164271, 'ruRU', '', 'Но с тех пор никто не пережил ритуала. Чистая сила Элуны убила всех претенденток.', 29981),
(164270, 'ruRU', '', 'Легенда гласит, что давным-давно Элуна наделила своей яростью лучших защитниц Калимдора.', 29981),
(164268, 'ruRU', '', 'Золани? Что стряслось?', 29981),
(164267, 'ruRU', '', 'Майев, почему этот ритуал так опасен?', 29981),
(164266, 'ruRU', '', 'Если лоа сочтут меня недостойной, ты сообщишь об этом народу.', 29981),
(164265, 'ruRU', '', 'Ты будешь моим свидетелем.', 29981),
(164264, 'ruRU', '', 'Лоа взвесят ее душу и решат, достойна ли она.', 29981),
(164262, 'ruRU', '', '$n, я отвела тебе особую роль.', 29981),
(164261, 'ruRU', 'Да хранят тебя лоа, Таланджи.', 'Да хранят тебя лоа, Таланджи.', 29981),
(164260, 'ruRU', 'Плевал я на Орду!', 'Плевала я на Орду!', 29981),
(164259, 'ruRU', 'Марионетка Бвонсамди!', 'Марионетка Бвонсамди!', 29981),
(164258, 'ruRU', 'Моя королева!', 'Моя королева!', 29981),
(164257, 'ruRU', 'Ди\'чука Таланджи!', 'Ди\'чука Таланджи!', 29981),
(164256, 'ruRU', 'Слава Таланджи! Да здравствует Зандалар!', 'Слава Таланджи! Да здравствует Зандалар!', 29981),
(164255, 'ruRU', 'Дом Растахана проклят!', 'Дом Растахана проклят!', 29981),
(164252, 'ruRU', '', 'Принцесса Таланджи!', 29981),
(164251, 'ruRU', '', 'Чтобы взойти на трон, Таланджи должна пройти самый священный ритуал.', 29981),
(164250, 'ruRU', '', 'Долгие века наш народ не короновал новых правителей.', 29981),
(164248, 'ruRU', 'Вижу цель!', 'Вижу цель!', 29981),
(164247, 'ruRU', 'Вижу ползучую мину!', 'Вижу ползучую мину!', 29981),
(164245, 'ruRU', 'До свидания, мисс Уэстерсон!', '', 29981),
(164243, 'ruRU', 'Расскажи мне, как умер Вол\'джин.', 'Расскажи мне, как умер Вол\'джин.', 29981),
(164242, 'ruRU', 'Вот боевой клинок Вол\'джина.', 'Вот боевой клинок Вол\'джина.', 29981),
(164241, 'ruRU', 'Подай сигнал воинам, Рексар. Пора атаковать поместье Норвингтонов.', 'Подай сигнал воинам, Рексар. Пора атаковать поместье Норвингтонов.', 29981),
(164240, 'ruRU', 'Лок\'тар! Вперед!', '', 29981),
(164239, 'ruRU', '', 'Идем, $p. Аш\'ала с легкостью выдержит двоих.', 29981),
(164237, 'ruRU', '', 'Ступай с достоинством.', 29981),
(164235, 'ruRU', '', 'Скоро ты с ней встретишься.', 29981),
(164234, 'ruRU', '', 'За Темную Госпожу.', 29981),
(164233, 'ruRU', '', 'Смерть – это второй шанс.', 29981),
(164232, 'ruRU', '', 'Моя жизнь – служение.', 29981),
(164231, 'ruRU', '', 'Мы – барьер между миром живых и миром мертвых.', 29981),
(164230, 'ruRU', '', 'Она сожгла все мосты. Остался только последний ритуал у Колодца чистоты.', 29981),
(164229, 'ruRU', 'Ди\'чука Зандалар!', 'Ди\'чука Зандалар!', 29981),
(164228, 'ruRU', '', 'Аш\'ала! Где Тиранда?', 29981),
(164227, 'ruRU', '', 'Часовые, оружие к бою! Верховной жрице нужна помощь!', 29981),
(164224, 'ruRU', '', 'Смерть... холодна. Даже для тех, кто сгорает.', 29981),
(164223, 'ruRU', '', 'Сестра, ты в порядке?', 29981),
(164222, 'ruRU', 'Альянс захватил рудник Лорнесты!', 'Альянс захватил рудник Лорнесты!', 29981),
(164219, 'ruRU', 'Альянс захватил берег Мрачных Волн!', 'Альянс захватил берег Мрачных Волн!', 29981),
(164218, 'ruRU', '', 'Анду-фала-дор!', 29981),
(164217, 'ruRU', '', 'Смерть не щадит никого.', 29981),
(164216, 'ruRU', '', 'Мы все прокляты.', 29981),
(164215, 'ruRU', '', 'Стойте. Слышите? Живые!', 29981),
(164214, 'ruRU', '', 'Да будет так.', 29981),
(164213, 'ruRU', '', 'Одной надежды мало.', 29981),
(164212, 'ruRU', 'Альянс захватил Гиблый перекресток!', 'Альянс захватил Гиблый перекресток!', 29981),
(164211, 'ruRU', '', 'Моя судьба... мое проклятие.', 29981),
(164210, 'ruRU', '', 'Я ничего... не чувствую...', 29981),
(164209, 'ruRU', 'Альянс захватил Пепельную рощу!', 'Альянс захватил Пепельную рощу!', 29981),
(164205, 'ruRU', 'Нужно добыть еще одно тело. Ту, что не сдалась... и погибла. Темная Госпожа... настоятельно просила найти ее.', '', 29981),
(164204, 'ruRU', 'Вот незадача. Защищай валь\'кир!', '', 29981),
(164203, 'ruRU', '', 'Гнилостень!', 29981),
(164202, 'ruRU', 'Итак, с подготовкой разобрались, и мы можем начинать ритуал.', '', 29981),
(164201, 'ruRU', '', 'Где же... она?..', 29981),
(164200, 'ruRU', '', 'Скоро она придет и разорвет всех вас на куски.', 29981),
(164199, 'ruRU', '', 'Аш\'ал терадас!', 29981),
(164198, 'ruRU', '', 'Бегите к своей Королеве-банши. И ждите нас в гости.', 29981),
(164197, 'ruRU', '', 'Орде не победить! Мы идем за вами!', 29981),
(164196, 'ruRU', '', 'Теперь смерть тебя не остановит.', 29981),
(164195, 'ruRU', '', 'Восстань и служи нам.', 29981),
(164194, 'ruRU', '', 'Смерть зовет тебя.', 29981),
(164193, 'ruRU', '', 'Мы даем тебе второй шанс.', 29981),
(164192, 'ruRU', 'А, вот и помощь! Славно. У нас немало работы.', '', 29981),
(164191, 'ruRU', 'Если найдешь трупы ночных эльфов, позови Бринью: она их оживит.', '', 29981),
(164190, 'ruRU', 'Мы должны выяснить, что это за странная ночь. Королева полагается на твою тщательность.', '', 29981),
(164189, 'ruRU', '', 'Крысы из Альянса крадут наш азерит. Ну, чего ты ждешь?! Перебей их!', 29981),
(164188, 'ruRU', '', 'Голос Орды, спасибо тебе... за все. Я буду с нетерпением ждать новых встреч с тобой. А сейчас мне нужно заняться делами империи.', 29981),
(164187, 'ruRU', '', 'Благодарю, вождь. Полагаю, раз я теперь королева, один вопрос не терпит отлагательств.', 29981),
(164186, 'ruRU', 'Где твои манеры, дитя? Бвонсамди возвысился над всеми лоа. Как и завещал твой отец.', '', 29981),
(164185, 'ruRU', 'Отдохни, Таланджи. Я лишь хочу, чтобы ты подумала кое о чем.', '', 29981),
(164184, 'ruRU', '', 'Здравствуй, бескрылое дитя. Подойди. Я буду говорить с тобой.', 29981),
(164183, 'ruRU', 'А, маленькая почти королева.', '', 29981),
(164180, 'ruRU', '', 'Похоже, ты так и не поняла, Таланджи.', 29981),
(164178, 'ruRU', '', 'Кажется, эти пули бракованные... они не работают!', 29981),
(164177, 'ruRU', '', 'Славная работа, $n. Я распоряжусь, чтобы новым союзникам оказали подобающий прием в Оргриммаре.', 29981),
(164176, 'ruRU', '', 'Поздравляю, ваше величество.', 29981),
(164175, 'ruRU', '', 'Здравствуй, могучий Краг\'ва.', 29981),
(164174, 'ruRU', '', 'Она призывает меня? Ладно, пусть почувствует вкус власти... но только сегодня.', 29981),
(164172, 'ruRU', '', 'А ента пушка заряжена?', 29981),
(164171, 'ruRU', '', 'Ты посмел занять место самого Резана? Бвонсамди, твоя наглость вообще не знает границ?', 29981),
(164170, 'ruRU', '', 'Лоа перевоплощения. Рада встрече.', 29981),
(164169, 'ruRU', '', 'Здравствуй, Мать ветров.', 29981),
(164165, 'ruRU', '', 'Признаться, я не представляю, чего ждать дальше.', 29981),
(164164, 'ruRU', '', 'Отправляйся к лоа, Белая Вдова.', 29981),
(164163, 'ruRU', '', 'Я иду к тебе... Шадра...', 29981),
(164162, 'ruRU', '', 'Зови своего господина. Пусть я умру, но я открою правду!', 29981),
(164161, 'ruRU', '', 'Есть и другой путь, Самара. Не вынуждай меня отправлять тебя к Бвонсамди.', 29981),
(164160, 'ruRU', '', 'Изменница!.. $n, берегись!', 29981),
(164159, 'ruRU', '', 'В этот совет вошли лучшие из лучших. Вы – надежда зандаларов, вы – будущее нашего народа.', 29981),
(164158, 'ruRU', 'Альянс захватил Ясеневый терминал!', 'Альянс захватил Ясеневый терминал!', 29981),
(164157, 'ruRU', 'Альянс захватил Горекаменный карьер!', 'Альянс захватил Горекаменный карьер!', 29981),
(164150, 'ruRU', '', 'А, вот и ты, $n!', 29981),
(164149, 'ruRU', '', 'Месть – потрясающий мотиватор.', 29981),
(164148, 'ruRU', '', 'Твоя сила растет, сестра.', 29981),
(164147, 'ruRU', '', 'Четырнадцать выш-штрелов! Есть!', 29981),
(164146, 'ruRU', '', 'Вот хто украл мой эль.', 29981),
(164145, 'ruRU', '', 'Аш\'ал терадас!', 29981),
(164144, 'ruRU', '', 'Я уже подстрелил троих... одного... пятерых!', 29981),
(164143, 'ruRU', 'С ней $p!', 'С ней $p!', 29981),
(164142, 'ruRU', 'Это леди Джайна!', 'Это леди Джайна!', 29981),
(164141, 'ruRU', 'Мы спасены!', 'Мы спасены!', 29981),
(164140, 'ruRU', 'Это лорд-адмирал!', 'Это лорд-адмирал!', 29981),
(164139, 'ruRU', 'Я много времени провел с принцессой Таланджи и зандаларами как в Назмире, так и за его пределами. Надеюсь, мы договоримся, и они вступят в Орду. У нас есть что предложить друг другу.', '', 29981),
(164138, 'ruRU', 'Превосходно. Я отправлю вербовщиков собрать добровольцев. Они могут стать хорошими солдатами.', '', 29981),
(164137, 'ruRU', '', 'Ты умрешь!', 29981),
(164136, 'ruRU', 'Мы не будем сражаться в одиночку. Местные жители будут рады помочь нам в войне с Ордой. Собери их под наши знамена.', '', 29981),
(164135, 'ruRU', '%s получил серьезные повреждения.', '', 29981),
(164134, 'ruRU', 'Не будем заставлять принцессу ждать. Встретимся в Зулдазаре.', '', 29981),
(164133, 'ruRU', 'Заложенные тобой бомбы в порядке, но времени у нас не так много. Нужно атаковать, иначе мы лишимся преимущества.', '', 29981),
(164132, 'ruRU', 'Пойдем-ка в \"Осьминог\" – пропустим по кружечке и подождем, пока все успокоится... ик!', '', 29981),
(164131, 'ruRU', '', 'К тебе, конечно, это не относится.', 29981),
(164130, 'ruRU', 'Чудесно! Если хочешь, подброшу тебя обратно на моем ветролете. За мной!', '', 29981),
(164129, 'ruRU', 'Преимущество пока на нашей стороне. Иди в атаку, прорви вражеский строй, сломи их, не дай перегруппироваться!', '', 29981),
(164128, 'ruRU', 'Сегодня мы показали Альянсу, что такое гнев Орды!', '', 29981),
(164127, 'ruRU', '', 'Альянс удирает, как стадо пугливых талбуков. Ничтожества. Лок\'тар!', 29981),
(164126, 'ruRU', '', 'Альянс стоит насмерть. Все в атаку! Не будете ни жрать, ни спать, пока не выбьете их отсюда!', 29981),
(164124, 'ruRU', 'Впечатляет. Новое снаряжение показало прекрасный потенциал.', '', 29981),
(164123, 'ruRU', 'Великолепно. Угроза Орды нейтрализована.', '', 29981),
(164122, 'ruRU', 'Вот это да! Ради такого стоило лететь из самого Крутогорья. Правда, Авиаш?', '', 29981),
(164121, 'ruRU', 'Альянс теперь дважды подумает перед следующим налетом. Небо принадлежит Орде!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164120, 'ruRU', 'Наконец-то! Я так надеялся, что Альянс бросит нам вызов в небе. Давай порезвимся и собьем их корабль!', '', 29981),
(164119, 'ruRU', 'Только сначала нужно спасти наших пленных на его борту. Зато потом – ни в чем себе не отказывай.', '', 29981),
(164118, 'ruRU', 'Вообще-то мы не должны биться с другими командами, но всякое ведь случается, правда?', '', 29981),
(164117, 'ruRU', '', 'Следующее столетие прошло как в тумане. В одиночестве и страхе я бродила по этим лесам. Он говорил, что я не обрету покой, пока мой дух привязан к моему телу.', 29981),
(164116, 'ruRU', '', 'Я думала, он просто отправит меня в изгнание, и потому выбрала леса. А он... вырвал мою душу из тела, но оставил между ними связь, чтобы я не могла уйти далеко.', 29981),
(164115, 'ruRU', '', 'Тул разгневался. Он решил преподать всем урок на моем примере: \"Ты можешь дать отпор захватчикам или вечно бродить в своих лесах. Твой выбор?\"', 29981),
(164114, 'ruRU', '', 'Чужеземцы впервые ступили на наши берега, когда я была еще жива. Горак Тул видел в них угрозу и устраивал набеги на их поселения. Я не хотела участвовать в этом. Я была терномантом, хранительницей дикой природы, и знала, что мы могли бы жить в гармонии, если бы постарались.', 29981),
(164113, 'ruRU', '', 'Отойдите.', 29981),
(164112, 'ruRU', 'Заливай!', '', 29981),
(164111, 'ruRU', 'Как же сложно найти толковых помощников!', '', 29981),
(164110, 'ruRU', 'Хочешь испытать новое изобретение ШРУ? Объектов для тестирования тут предостаточно.', '', 29981),
(164109, 'ruRU', 'Разберитесь с ними. Нам еще лес травить.', '', 29981),
(164108, 'ruRU', 'Не волнуйся. Я прикрою тебя. Уж я не позволю им захватить наш трон.', '', 29981),
(164107, 'ruRU', 'Нет, вы как раз вовремя! Королеве-банши нужны ваши головы, ночные эльфы.', '', 29981),
(164106, 'ruRU', '', 'Мы опоздали.', 29981),
(164105, 'ruRU', 'Бвонсамди! Помоги мне!', '', 29981),
(164104, 'ruRU', '', 'Когда-то здесь царили смех и веселье. А теперь... только смерть и тишина.', 29981),
(164103, 'ruRU', '', 'Сюда. Много лун назад я служила в этих землях.', 29981),
(164102, 'ruRU', '', 'Они пытались ее остановить.', 29981),
(164101, 'ruRU', '', 'Что здесь произошло?', 29981),
(164100, 'ruRU', '', 'Как прикажешь.', 29981),
(164099, 'ruRU', '', 'Сира, обыщи побережье, а мы пойдем дальше и найдем Тиранду. Встретимся в Лор\'данеле.', 29981),
(164098, 'ruRU', '', 'Не теряй веры в богиню. Именно этого добивается Орда.', 29981),
(164097, 'ruRU', 'Мы все – Акунда.', 'Мы все – Акунда.', 29981),
(164096, 'ruRU', '', 'Знай, что покончив с этими жалкими вторжениями вы тем самым открыли путь куда более могущественной силе из Назжатара.', 29981),
(164095, 'ruRU', '', 'И все же я хочу дать тебе то, о чем ты никогда не попросишь, ибо не знаешь, что нуждаешься в этом. Твои заслуги достойны такого дара.', 29981),
(164094, 'ruRU', '', 'Предо мной открыта вся вселенная. Молись, чтобы наши пути никогда не пересеклись снова.', 29981),
(164093, 'ruRU', '', 'С нашей первой встречи я знала о твоем потенциале. И он знал.', 29981),
(164092, 'ruRU', '', 'Можешь не беспокоиться о нашествии наг. Перед тобой – истинное величие.', 29981),
(164091, 'ruRU', 'Новые угрозы требуют новых подходов. Испытаешь наше изобретение?', '', 29981),
(164089, 'ruRU', '', 'Можно было и быстрее. Возьми все, что нужно. Нам еще многое предстоит сделать.', 29981),
(164088, 'ruRU', '', 'А теперь... Остановись!', 29981),
(164087, 'ruRU', '', 'Элуна... где она была, когда горел Тельдрассил?', 29981),
(164086, 'ruRU', '', 'Превосходно. Подношения сделаны... и приняты.', 29981),
(164085, 'ruRU', '', 'Возложи реликвии на положенные им места. Мы взовем к их силе.', 29981),
(164084, 'ruRU', '', 'Наконец-то. Я уже все приготовила. Приступим?', 29981),
(164083, 'ruRU', '', 'Воплощение гнева Элуны. Даже просто смотреть на этот ритуал смертельно опасно.', 29981),
(164082, 'ruRU', '', 'Что это за ритуал, Майев? Кто такая Ночная Воительница?', 29981),
(164081, 'ruRU', '', 'Мы не оставим Тиранду одну среди врагов. Нужно спешить!', 29981),
(164080, 'ruRU', '', '$n, за мной. У нас мало времени.', 29981),
(164079, 'ruRU', '', 'А Тиранда не хочет рисковать чужой жизнью, только своей. Береги ее Элуна.', 29981),
(164078, 'ruRU', '', 'А Тиранда не хочет рисковать чужой жизнью, только своей.', 29981),
(164075, 'ruRU', 'Ха! Будут знать, как прилетать сюда на своих поганых кораблях!', '', 29981),
(164074, 'ruRU', 'Все, миновала угроза. Я знал, что ты не подведешь.', '', 29981),
(164070, 'ruRU', 'Торкали живет в траве. В добыче, что мы приносим домой. В наших копьях, что не знают промаха. Она – великий творец. Где она ступает, рождаются долины. Где она проводит рогом, текут реки.\n\nУ лоа Джо\'нока нет отдельного храма. Весь Зандалар – и есть ее храм. Если хочешь встретить ее, ступай к горе, что движется.\n\nНу а Джо\'нок – ее защитник.', '', 29981),
(164069, 'ruRU', 'Ордынцы заявились сюда на своем воздушном корыте?! Какой же наездник на грифоне такое стерпит? Покажи им, кому принадлежит небо!', '', 29981),
(164068, 'ruRU', 'Ордынцы похищают наших! Проникни на их корабль и освободи пленных.', '', 29981),
(164067, 'ruRU', 'Кто такая Торкали?', 'Кто такая Торкали?', 29981),
(164066, 'ruRU', '', 'Ага, пойдем! Пока!', 29981),
(164065, 'ruRU', 'Хе-хе-хе! Эти богатеищи такого не ожидали. Пойдем отнесем блестяшки к алтарю.', '', 29981),
(164064, 'ruRU', '', 'Смотри-ка! Мы обошли все святилища лоа, и я набрала для тебя блестяшек.', 29981),
(164063, 'ruRU', '', 'О, привет, Джани. Не думала, что ты так скоро придешь сюда.', 29981),
(164062, 'ruRU', 'Азала! Что это ты делаешь?', '', 29981),
(164061, 'ruRU', '', 'Спасибо тебе, Зандалар, оказывается, такой интересный! А теперь у тебя, наверное, есть дела.', 29981),
(164060, 'ruRU', '', 'Какой же из них мне подходит? Так сложно решить... Придется хорошенько подумать!', 29981),
(164059, 'ruRU', '', 'Лоа так много... Как выбрать только одного?', 29981),
(164058, 'ruRU', '', 'Что ж, честная сделка. Да хранит тебя тьма, $n.', 29981),
(164057, 'ruRU', '', 'Скорее. Неси корону сюда.', 29981),
(164056, 'ruRU', '', 'Смотри! Глашатай Бури на его маленьком... питомце.', 29981),
(164055, 'ruRU', '', 'Все сюда! Проходите через портал! Скорее!', 29981),
(164054, 'ruRU', '$n, пожалуйста, уведи эту проказницу с террасы.', '', 29981),
(164053, 'ruRU', '', 'Как идут дела?\n\nКогда мы захватим Башал\'Аран, я телепортирую всех оставшихся.', 29981),
(164052, 'ruRU', '', 'Телия, $p! Объедините силы!', 29981),
(164051, 'ruRU', '', 'Ох ничего себе! Ну что, справимся?', 29981),
(164050, 'ruRU', '', 'Задержите их еще немного!', 29981),
(164049, 'ruRU', '', 'Лорд-адмирал! Похоже, Орда бросила против нас лучших бойцов!', 29981),
(164048, 'ruRU', '', 'Корабль Тиранды видели на Зорамском взморье. Начнем поиски там.', 29981),
(164047, 'ruRU', '', 'Эти нечестивые создания будут отброшены назад!', 29981),
(164046, 'ruRU', '', 'Благотворная сила прилива исцеляет.', 29981),
(164045, 'ruRU', '', 'Подкрепление уже в пути.', 29981),
(164044, 'ruRU', '', 'Наши братья прогонят их.', 29981),
(164043, 'ruRU', '', 'Нам надо удержать ворота!', 29981),
(164042, 'ruRU', '', 'Нет... все не может так закончиться!', 29981),
(164041, 'ruRU', '', 'Стань рядом – море очистит твои раны!', 29981),
(164040, 'ruRU', 'Гм... Мне лучше вернуться на пост.', 'Гм... мне лучше вернуться на пост.', 29981),
(164039, 'ruRU', 'Ну и смрад! Кто это сделал?', 'Ну и смрад! Кто это сделал?', 29981),
(164038, 'ruRU', 'Что это было?', 'Что это было?', 29981),
(164037, 'ruRU', 'Ладно... $n, дуй в Старый Стальгорн. Там наверняка что-то осталось от ритуала Магни. Надеюсь, этого хватит...', '', 29981),
(164036, 'ruRU', 'Но мне нужно что-то, оставшееся с прежнего ритуала, чтобы провести новый.', '', 29981),
(164035, 'ruRU', 'Не трясись. Азерот уже выбрала своего вестника. Каменный облик будет временным.', '', 29981),
(164034, 'ruRU', 'Магни?! Нет! Я никому такого не пожелаю, что бы ни стояло на кону!', '', 29981),
(164033, 'ruRU', 'Знаю. Есть один ритуал, как раз для этого. Ваш король когда-то его провел.', '', 29981),
(164032, 'ruRU', 'Ты знаешь, как позволить дворфу долго оставаться в каменной форме и выдержать сильный жар кузни?', '', 29981),
(164031, 'ruRU', '', 'Пора покончить с этим.', 29981),
(164030, 'ruRU', 'Глыбоскал! Спасибо, что пришел! Нужна твоя помощь.', '', 29981),
(164029, 'ruRU', '', 'Следи за собой, Азала, иначе лоа могут отвернуться от тебя.', 29981),
(164028, 'ruRU', '', 'Но с мощными артефактами нельзя быть легкомысленной. Я не прощаю бесчестного поведения.', 29981),
(164027, 'ruRU', '', 'Юная зандаларка, может быть, на улицах родного города ты и привыкла делать все, что душе угодно.', 29981),
(164026, 'ruRU', '', 'Разве я не учила тебя быть сдержанным, мой последователь? Нельзя чуть что прибегать к насилию.', 29981),
(164025, 'ruRU', 'Сетралисс! Побереги силы. Я могу сам разобраться с воришкой!', '', 29981),
(164024, 'ruRU', '', 'Воррик, не пугай ребенка.', 29981),
(164023, 'ruRU', 'Этот камень – артефакт исключительной силы, реликвия моего народа. К нему нельзя прикасаться.', '', 29981),
(164022, 'ruRU', '', 'А-а! Клянусь, я не хотела его украсть!', 29981),
(164021, 'ruRU', '', 'Дорал ана\'диэл?\n\nКогда мы захватим Башал\'Аран, я телепортирую всех оставшихся.', 29981),
(164020, 'ruRU', '', 'Не может быть!', 29981),
(164019, 'ruRU', '', 'Капитан! По-твоему, я убегала?', 29981),
(164018, 'ruRU', 'Спасибо, повелитель горнов.', '', 29981),
(164007, 'ruRU', 'Тоатана издает гневный щелкающий звук и насылает на Ксал\'атат темные чары.', '', 29981),
(164006, 'ruRU', 'Танатоа указывает на своего маленького друга и делает резкий жест.', '', 29981),
(164005, 'ruRU', 'Малыш! Не трогай камень!', '', 29981),
(164004, 'ruRU', '', 'Подсади меня! Я хочу потрогать...', 29981),
(164003, 'ruRU', '', '$n, только посмотри!', 29981),
(164002, 'ruRU', 'Королева Таланджи просила кое-что тебе передать.', 'Королева Таланджи просила кое-что тебе передать.', 29981),
(164001, 'ruRU', '', 'Эти тролли знают, как чествовать нового правителя.', 29981),
(163991, 'ruRU', '<Placeholder RTC: Talanji addresses her people.>', '<Placeholder RTC: Talanji addresses her people.>', 29981),
(163990, 'ruRU', 'Да.', 'Да.', 29981),
(163989, 'ruRU', '', 'Я выманила вас в океан. Теперь у вас нет ни единого шанса на спасение.', 29981),
(163988, 'ruRU', '', 'Лоа даровали мне свое благословение. Советники приветствуют меня. Духовные наставники преклонились предо мной. Мнения народа разделились, но в целом все признали мое правление.\n\nКогда я взойду на эту террасу, то стану королевой Таланджи. Отец подготовил меня к этой роли. Я шла к ней целую жизнь.\n\nЯ готова. А ты?', 29981),
(163987, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(163986, 'ruRU', '$n, твоя кожа – камень. Азерот дала тебе силу. За дело!', '', 29981),
(163985, 'ruRU', '', 'Готовься к битве. Мы должны найти Тиранду.', 29981),
(163984, 'ruRU', '', 'Это ее убьет! Скорее, отплываем к Темным берегам.', 29981),
(163983, 'ruRU', '', 'Тиранда хочет провести древний ритуал...', 29981),
(163982, 'ruRU', '', 'Ночная Воительница...', 29981),
(163981, 'ruRU', '', 'Эта книга... неужели?', 29981),
(163980, 'ruRU', '', 'Дори\'тур полетит с тобой. Мы здесь явно не одни.', 29981),
(163979, 'ruRU', '', 'Ха! Корабли Орды на горизонте! Тебе некуда бежать, ледяная ведьма!', 29981),
(163978, 'ruRU', 'Я слышу голос горы.', '', 29981),
(163977, 'ruRU', 'Мы едины. Я – это она, а она – это я.', '', 29981),
(163976, 'ruRU', 'Сила земли бурлит во мне.', '', 29981),
(163975, 'ruRU', 'Закали металл в воде.', '', 29981),
(163974, 'ruRU', 'Бей по металлу, придай ему форму!', '', 29981),
(163973, 'ruRU', 'Очистить кузню!', '', 29981),
(163972, 'ruRU', 'Хватай крепче! Огонь тебя не обожжет.', '', 29981),
(163970, 'ruRU', 'Куй, пока горячо!', '', 29981),
(163969, 'ruRU', 'ГОРИ! Гори в пламени творцов!', '', 29981),
(163968, 'ruRU', 'Тащи металл сюда!', '', 29981),
(163967, 'ruRU', '', 'Прожорливый дурак! Забирай наш трофей, $n.', 29981),
(163966, 'ruRU', '', 'Сюда. Вряд ли Тоатана отдаст корону по доброй воле.', 29981),
(163965, 'ruRU', '', 'Остальные, оставайтесь на месте, пока мы не прочешем окрестности.', 29981),
(163964, 'ruRU', 'Враги познали гнев Альянса! Теперь они будут бояться нас... А особенно – тебя.', '', 29981),
(163963, 'ruRU', '', 'Волна поднимается!', 29981),
(163962, 'ruRU', '', 'Я могу помочь. Ты хочешь выдворить наг из своих земель. А я знаю, как это сделать.', 29981),
(163961, 'ruRU', '', 'Она уничтожила его, чтобы сбить с толку преследователей.', 29981),
(163960, 'ruRU', 'Орда посмела атаковать нас прямо здесь? Глупцы. Перебей их!', '', 29981),
(163959, 'ruRU', '', 'Корабль Тиранды. Вернее, его останки.', 29981),
(163957, 'ruRU', '', 'Что ж, если ты узнала меня, капитан, тебе следовало бежать, пока была возможность.', 29981),
(163956, 'ruRU', 'Армия врага разбита! Настал час возмездия Альянса!', '', 29981),
(163955, 'ruRU', 'Нужно выбить Орду из этих земель. Разберись с врагами как можно быстрее!', '', 29981),
(163954, 'ruRU', 'Важная победа и сокрушительный удар по Орде!', '', 29981),
(163953, 'ruRU', 'Над этой землей будут реять знамена Альянса.', '', 29981),
(163952, 'ruRU', '', 'Холод убивает!', 29981),
(163951, 'ruRU', 'Я готов дать показания. Начинаем суд.', 'Я готова дать показания. Начинаем суд.', 29981),
(163950, 'ruRU', '$n, ты ведь не ввязываешься в неприятности? Не нарушаешь никаких законов?', '', 29981),
(163949, 'ruRU', '', 'Огонь из всех орудий!', 29981),
(163948, 'ruRU', '', 'Пушки, огонь!', 29981),
(163947, 'ruRU', 'Пришло время возмездия. Одолей войска Орды, не давай им пощады!', '', 29981),
(163946, 'ruRU', '', 'Волна смоет вас!', 29981),
(163945, 'ruRU', '', 'Само море восстало против вас!', 29981),
(163944, 'ruRU', 'Сокруши врагов! Пускай уползают назад к своему вождю.', '', 29981),
(163943, 'ruRU', 'Командир подал сигнал.\n\nВперед! Летите же! За Темные берега! За Альянс!', '', 29981),
(163942, 'ruRU', 'Наездники на гиппогрифах сейчас разведывают местность.\n\nПо сигналу командира ты полетишь на берег и присоединишься к ним.', '', 29981),
(163941, 'ruRU', '', 'Мы должны быть готовыми ко всему.', 29981),
(163939, 'ruRU', 'Мой молот готов к бою!', '', 29981),
(163938, 'ruRU', 'Нас хотят взять на абордаж, приготовьтесь!', '', 29981),
(163937, 'ruRU', 'Они пожалеют, что сунулись на мой корабль!', '', 29981),
(163936, 'ruRU', '', 'Один есть!', 29981),
(163935, 'ruRU', '', 'Это оружие даст нам преимущество в Назмире!', 29981),
(163934, 'ruRU', '', 'Мы будем стоять до последнего. Селама ашаль-аноре.', 29981),
(163933, 'ruRU', 'Лиадрин, охраняйте вход! Не пропускайте никого!', '', 29981),
(163932, 'ruRU', 'ХА-ХА-ХА! Эти тупицы ничему не учатся! Кто моя золотая умничка? Ты моя золотая умничка!', '', 29981),
(163931, 'ruRU', 'Необходимо избавиться от нашего прошлого. Мы больше не высшие эльфы! В память о пролитой крови и жертвах тех, кого мы любили... отныне мы будем именоваться син\'дорай!', '', 29981),
(163930, 'ruRU', 'Ох, СЛАВА НЕБЕСАМ. Не бойся, мой маленький. Папочка о тебе позаботится.', '', 29981),
(163929, 'ruRU', 'Вы... ЧУДОВИЩА! Как можно поднять руку на такую красоту? Верно говорит Сильвана... у псов Альянса нет души!', '', 29981),
(163928, 'ruRU', 'Будет тебе урок!', '', 29981),
(163927, 'ruRU', 'Поделом тебе!', '', 29981),
(163926, 'ruRU', 'Что вы ТВОРИТЕ?! Не бейте его!', '', 29981),
(163925, 'ruRU', 'Слушайте, давайте договоримся. Оставьте его мне и ступайте своей дорогой. Я ничего не скажу вашему королю, а вы – моей госпоже. По рукам?', '', 29981),
(163924, 'ruRU', 'Душа нашего народа... Теперь это источник порчи, что растет с каждым рассветом.', '', 29981),
(163923, 'ruRU', '', 'Колодец... Что он натворил?', 29981),
(163922, 'ruRU', '$n, за мной! Защищай магистров! Мы должны добраться до Солнечного Колодца!', '', 29981),
(163921, 'ruRU', 'Расчистите нам путь. Остальную нежить оставьте троллям. Это даст нам немного времени.', '', 29981),
(163920, 'ruRU', '', 'Пушки... Амани высадились на берегу. Нужно спешить!', 29981),
(163919, 'ruRU', 'Время пришло! Да не оставит нас солнечный свет до самого конца!', '', 29981),
(163918, 'ruRU', 'Давайте просто расслабимся и полюбуемся. Золото... камни... Это же... КРАСОТИЩА! Аж слезы наворачиваются!', '', 29981),
(163917, 'ruRU', 'Восстань, Кел\'Тузад, и служи Королю-личу!', '', 29981),
(163916, 'ruRU', 'Сама смерть явилась, чтобы завладеть родиной эльфов!', '', 29981),
(163915, 'ruRU', 'Жители Кель\'Таласа! Я предложил вам сдаться – вы отказались. Знайте, что сегодня ваш народ и все ваше наследие исчезнет с лица земли.', '', 29981),
(163914, 'ruRU', 'Мы построили цитадель. Соберите побольше солдат и принесите мне голову Малфуриона!', '', 29981),
(163913, 'ruRU', 'Мастерская заработала. Пора строить катапульты. С их помощью мы сожжем эти деревья.', '', 29981),
(163912, 'ruRU', 'Дом вождей превратился в крепость. Теперь мы можем начать строить мастерскую.', '', 29981),
(163911, 'ruRU', 'Казармы построены. Наберите новых рекрутов, чтобы заполнить их.', '', 29981),
(163910, 'ruRU', 'Алтарь бури готов. Он может усилить вас или придать форму могучего союзника.', '', 29981),
(163909, 'ruRU', 'Мы завершили постройку оружейной. Собирайте ресурсы, чтобы улучшить вооружение нашей армии.', '', 29981),
(163908, 'ruRU', 'Ясеневый терминал позволит нам быстро пересекать поле боя и обрушивать на врага смерть с небес.', '', 29981),
(163907, 'ruRU', 'Руины Лорнесты наши. Используйте местные запасы железа, чтобы усилить войска Орды.', '', 29981),
(163906, 'ruRU', 'Пепельная роща захвачена. Она снабдит нашу армию древесиной.', '', 29981),
(163905, 'ruRU', 'Берег Мрачных Волн наш! Теперь наши аптекари смогут обучать алхимиков и создавать поганища на погибель Альянсу!', '', 29981),
(163904, 'ruRU', 'Гиблый перекресток наш. Удержим его – удержим и Башал\'Аран.', '', 29981),
(163903, 'ruRU', 'Ничто не будет прежним.', 'Ничто не будет прежним.', 29981),
(163902, 'ruRU', 'Орда захватила Горекаменный карьер. Теперь мы пополним запасы железа и улучшим наш арсенал.', '', 29981),
(163901, 'ruRU', 'Увядающая роща наша. Мы захватим Темные берега, используя местную древесину.', '', 29981),
(163900, 'ruRU', 'Отходим! Вождь не обрадуется, узнав о поражении.', '', 29981),
(163899, 'ruRU', 'Тени надвигаются.', 'Тени надвигаются.', 29981),
(163898, 'ruRU', 'Темные берега возвращены Орде... как и должно быть!', '', 29981),
(163897, 'ruRU', 'Вперед, покончите с врагами во славу Темной Госпожи!', '', 29981),
(163896, 'ruRU', 'Все мы – рабы вечного страдания.', 'Все мы – рабы вечного страдания.', 29981),
(163895, 'ruRU', 'Оглянись вокруг, эльф. Природа проиграла.', '', 29981),
(163894, 'ruRU', 'Говори. Или уходи.', 'Говори. Или уходи.', 29981),
(163893, 'ruRU', 'Сама природа восстанет против вас. В атаку!', '', 29981),
(163892, 'ruRU', 'Наш дух крепче, чем ты можешь вообразить. Вы можете разрушить наш дом, но вам никогда не убить надежду.', '', 29981),
(163891, 'ruRU', 'Ты собирался остановить нас? Вот, мы на твоей земле, гуляем по твоим берегам и любуемся твоим мировым древом. Вернее, пеньком.', '', 29981),
(163890, 'ruRU', '', 'Бегите... от меня.', 29981),
(163889, 'ruRU', 'Все когда-то заканчивается.', 'Все когда-то заканчивается.', 29981),
(163888, 'ruRU', 'Лор\'данел в наших руках. Защищайте катапульты!', '', 29981),
(163887, 'ruRU', 'Ночная Воительница и Альянс растопчут твою омерзительную Орду, Гнилостень.', '', 29981),
(163886, 'ruRU', 'Слышал, Тиранда выучила новый фокус. Ее нелепые ритуалы не помешают нам отбить Темные берега.', '', 29981),
(163885, 'ruRU', 'Надежда обратится пеплом.', 'Надежда обратится пеплом.', 29981),
(163884, 'ruRU', '', 'Море станет твоей могилой!', 29981),
(163883, 'ruRU', 'Это ненадолго.', '', 29981),
(163882, 'ruRU', 'Еще одно худое слово о королеве, и я обломаю твои крылья.', '', 29981),
(163881, 'ruRU', 'У меня хотя бы есть душа, мерзкое ты отродье!', '', 29981),
(163880, 'ruRU', 'Вы уже потеряли валь\'киру. Неужели банши так слепа, что не осознает своего поражения?', '', 29981),
(163879, 'ruRU', '', 'Ваша Орда падет!', 29981),
(163878, 'ruRU', 'Когда-то ты был силен. Но я вижу, как ты слабеешь. Чувствую, как угасает твоя душа. Как свеча, которую я с радостью потушу.', '', 29981),
(163877, 'ruRU', 'Нет ничего, кроме боли и смерти.', 'Нет ничего, кроме боли и смерти.', 29981),
(163876, 'ruRU', 'Мы захватили руины Башал\'Арана. Здесь мы возведем укрепления и соберем ресурсы, необходимые для победы.', '', 29981),
(163875, 'ruRU', 'Скорее в Башал\'Аран. Убейте всех на своем пути.', '', 29981),
(163874, 'ruRU', 'Не верь ни во что.', 'Не верь ни во что.', 29981),
(163873, 'ruRU', 'Непобедимый!', '', 29981),
(163872, 'ruRU', 'Ха! Пернатый эльф думает, что остановит нас.', '', 29981),
(163871, 'ruRU', 'Анар\'ала белоре! Ты сгоришь за свои злодеяния!', '', 29981),
(163870, 'ruRU', 'Я наблюдаю. И слушаю.', 'Я наблюдаю. И слушаю.', 29981),
(163869, 'ruRU', 'Довольно, принц Артас. Твой путь окончится здесь!', '', 29981),
(163868, 'ruRU', 'Аубердин взят. Теперь продолжайте наступать и соберите ресурсы для нападения.', '', 29981),
(163867, 'ruRU', 'Эти земли стали гораздо опаснее для вас с тех пор, как мы вышвырнули отсюда Орду.', '', 29981),
(163866, 'ruRU', 'Вы проиграли! Сейчас я устраню последнюю преграду!', '', 29981),
(163865, 'ruRU', 'Мы устроим базу здесь, а ты отправляйся дальше и разведай обстановку.', '', 29981),
(163864, 'ruRU', 'Уничтожьте глефометы!', '', 29981),
(163863, 'ruRU', '', 'За Альянс!', 29981),
(163862, 'ruRU', 'Нет-нет, не надо спешить. Уверен, Альянс подождет.', '', 29981),
(163861, 'ruRU', '', 'За Кул-Тирас!', 29981),
(163860, 'ruRU', '', 'Надеюсь, вы не боитесь холода!', 29981),
(163859, 'ruRU', 'Этой ночью мы можем разве что напасть под покровом темноты.', '', 29981),
(163858, 'ruRU', 'Солдаты Орды, готовьтесь. Сегодня мы выбьем Альянс с Темных берегов и вернем эти земли Орде во имя Королевы-банши!', '', 29981),
(163856, 'ruRU', 'Я служу Королеве-банши.', 'Я служу Королеве-банши.', 29981),
(163854, 'ruRU', '', 'Я заморожу вас на месте!', 29981),
(163853, 'ruRU', 'Мой лук бьет без промаха.', 'Мой лук бьет без промаха.', 29981),
(163852, 'ruRU', 'Что ты ищешь?', 'Что ты ищешь?', 29981),
(163851, 'ruRU', 'Будь настороже. Будь наготове.', 'Будь настороже. Будь наготове.', 29981),
(163850, 'ruRU', 'Арр-р! Я присоединюсь к вашей команде!', 'Арр-р! Я присоединюсь к вашей команде!', 29981),
(163848, 'ruRU', 'Эй, $p! В карманах пусто, с работой негусто?\n\nТолько сегодня ты можешь побыть настоящим корсаром Туманных Парусов!\n\nПомоги нашей команде разграбить Литейную Эшвейнов на холме. Там полно альянсовских крыс и Праудмуров, с которых нужно сбить спесь!', '', 29981),
(163847, 'ruRU', 'Враги королевы падут.', 'Враги королевы падут.', 29981),
(163846, 'ruRU', 'Всех нас ждет смерть.', 'Всех нас ждет смерть.', 29981),
(163845, 'ruRU', 'Грабеж, потеха и обман.\nНабей сначала свой карман!\nИ выпивки добудь, братан!\n\nХа-ха-ха!', '', 29981),
(163844, 'ruRU', 'За Темную Госпожу.', 'За Темную Госпожу.', 29981),
(163843, 'ruRU', 'Теперь нас благословляет древо вечности. Соберите как можно больше солдат и атакуйте Гнилостеня!', '', 29981),
(163842, 'ruRU', 'Мастерская готова. Стройте глефометы, чтобы пробиться через вражескую линию обороны к Лор\'данелу.', '', 29981),
(163841, 'ruRU', 'Древо жизни превратилось в древо столетий. Теперь мы можем построить глефометную мастерскую.', '', 29981),
(163840, 'ruRU', 'Древо войны пробудилось. Если в Башал\'Аране понадобятся свежие силы, обратитесь к Джероду.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163839, 'ruRU', 'Мы построили алтарь старейшин. Он позволит вам принять облик могучего союзника или получить магическую силу.', '', 29981),
(163838, 'ruRU', 'Дом охотников открыл двери. Собирайте ресурсы, чтобы улучшить экипировку наших войск.', '', 29981),
(163837, 'ruRU', 'Ясеневый терминал наш. Теперь мы можем летать над Темными берегами и призывать химер.', '', 29981),
(163836, 'ruRU', 'Под руинами Лорнесты скрыты огромные залежи железа. Пора пустить их в дело.', '', 29981),
(163835, 'ruRU', 'Пепельная роща вновь у нас. Древесина оттуда пойдет на нужды армии.', '', 29981),
(163834, 'ruRU', 'Заняв берег Мрачных Волн, мы получили помощь друидов. Еще один верховный друид также поддержит нас.', '', 29981),
(163833, 'ruRU', 'Удерживая Гиблый перекресток, мы защитим и Башал\'Аран.', '', 29981),
(163832, 'ruRU', 'Мы захватили Горекаменный карьер и получили доступ к залежам железа.', '', 29981),
(163831, 'ruRU', 'Увядающая роща освобождена от Орды. Нам понадобится много древесины.', '', 29981),
(163830, 'ruRU', 'Отходим! У нас мало шансов. Передохнем и вернемся со свежими силами.', '', 29981),
(163829, 'ruRU', 'Славный бой. Сегодня мы сокрушили ужасного врага. Темные берега вновь принадлежат калдорай.', '', 29981),
(163828, 'ruRU', 'Корабли отходят! Скорее, седлайте гиппогрифов и нанесите решающий удар.', '', 29981),
(163827, 'ruRU', 'Есть ли предел вашей злобе? Знай, что даже такая безмерная жестокость не заставит нас отступить!', '', 29981),
(163826, 'ruRU', 'Я приготовил небольшой сюрприз. Темные следопыты, в бой!', '', 29981),
(163825, 'ruRU', 'Думаешь, твои примитивные глефы могут меня напугать?', '', 29981),
(163824, 'ruRU', 'Уже скоро наши войска сокрушат тебя, Гнилостень. На этот раз ты не сбежишь!', '', 29981),
(163823, 'ruRU', 'Мы захватили берег у Лор\'данела. Защищайте глефометы, пока они обстреливают гоблинские корабли!', '', 29981),
(163822, 'ruRU', 'Смелые слова для того, кто бросил свой народ и прилег вздремнуть на десять тысяч лет.', '', 29981),
(163821, 'ruRU', 'Снова на побегушках у Королевы-банши, Гнилостень? Еще не всю красоту этого мира загубил?', '', 29981),
(163820, 'ruRU', 'Нет ничего сильнее природы, Гнилостень. Скоро ты усвоишь этот урок.', '', 29981),
(163819, 'ruRU', 'Думаешь, ты со своими одичавшими друидами выстоишь против мощи Орды?', '', 29981),
(163818, 'ruRU', 'Мы отбили Башал\'Аран. Здесь мы закрепимся и соберем силы для наступления на Лор\'данел.', '', 29981),
(163817, 'ruRU', 'Когда я назначал Сильвану вождем, то знал, что иду на большой риск. Мне отчетливо слышались голоса лоа, они всегда направляли меня по верному пути. Так я, собственно, и стал темным охотником. \n\nНо в день моей смерти голоса были особенно громкими и говорили все одновременно, словно бы много лоа собралось в одном месте. Помню, как пронзительно они звучали в моей голове. Но теперь уже не могу сказать, кому они принадлежали.', '', 29981),
(163816, 'ruRU', 'Чтобы выстоять против Орды, нам нужно закрепиться в Башал\'Аране. За дело!', '', 29981),
(163815, 'ruRU', 'Гнилостень здесь... Хорошо. Он заплатит за преступления своей Королевы-банши.', '', 29981),
(163813, 'ruRU', 'Ваша эльфийская банда не заберет у нас эти земли!', '', 29981),
(163811, 'ruRU', 'Аубердин снова наш. Быстрее, продвигайтесь вперед и соберите все ресурсы, какие найдете.', '', 29981),
(163809, 'ruRU', 'Пока мы закрепляемся в Аубердине, разведай дорогу к Башал\'Арану.', '', 29981),
(163808, 'ruRU', 'Надо спешить.', '', 29981),
(163807, 'ruRU', 'Поспешим.', '', 29981),
(163806, 'ruRU', 'Разрушьте катапульты!', '', 29981),
(163805, 'ruRU', '', 'Уничтожьте глефометы!', 29981),
(163804, 'ruRU', 'Герои Альянса! Темные берега все еще в грязных лапах Орды. Пора отбить их!', '', 29981),
(163802, 'ruRU', 'На мои похороны пришли многие. Но еще больше погибло по вине Пылающего Легиона.\n\nИдем, посмотрим, что нас там ждет. Как подготовишься – скажи. Мы с тобой немного прогуляемся среди теней.', '', 29981),
(163796, 'ruRU', '', 'Море повинуется мне!', 29981),
(163792, 'ruRU', 'Палуба подготовлена к взрыву!', '', 29981),
(163789, 'ruRU', 'Бомбы на месте!', '', 29981),
(163788, 'ruRU', 'Заряды заложены!', '', 29981),
(163787, 'ruRU', 'Мне кажется, что ныне живущие братья Бронзобороды удивительно похожи на него. Они унаследовали его талант правителя и полководца, а также его пытливый ум.', '', 29981),
(163786, 'ruRU', 'Я вовсе не хотел стать звездой. Это лоа меня таким сделали!', '', 29981),
(163784, 'ruRU', 'Другие тролли говорят, что я стал каким-то \"ме-емом\". Что это значит, кстати?', '', 29981),
(163783, 'ruRU', 'Привет, друг! Боевой клинок Вол\'джина у тебя? Только этот клинок поможет связаться с ним в отсутствие Таланджи.', '', 29981),
(163782, 'ruRU', '', 'Вражеский корабль разбит в щепки! Он идет на дно!', 29981),
(163777, 'ruRU', 'Я пускаю молнии! И гром!', '', 29981),
(163772, 'ruRU', 'Он прославился как умелый воин, но мы знаем, что вдобавок он был великим ученым. Его кабинет прямо под нами.', '', 29981),
(163767, 'ruRU', 'Я много разговаривал с духами и лоа, помог многим заблудшим найти путь к Бвонсамди.\n\nНо моей силы не хватило, чтобы обнаружить Вол\'джина. На это оказалась способна лишь Таланджи. \n\nНам противостоят темные силы. Которые хотят, чтобы тайное осталось тайным.', '', 29981),
(163765, 'ruRU', 'В ту пору Бронзобороды еще не были крупным кланом. Именно подвиги Эгрима прославили имя Бронзобородов и принесли ему почет.', '', 29981),
(163764, 'ruRU', 'Эй, здорово!', '', 29981),
(163759, 'ruRU', 'Служить Орде – большая честь.', '', 29981),
(163757, 'ruRU', '', 'Отправляйтесь на корм акулам!', 29981),
(163754, 'ruRU', '', 'Вот это выстрел! Их судну конец!', 29981),
(163753, 'ruRU', '', 'Ха! Надеюсь, култирасцы плавают лучше, чем воюют!', 29981),
(163748, 'ruRU', 'Здравствуй!', '', 29981),
(163746, 'ruRU', 'До новой встречи.', '', 29981),
(163744, 'ruRU', 'Земля укажет тебе путь.', '', 29981),
(163743, 'ruRU', 'Удачи.', '', 29981),
(163741, 'ruRU', 'Ты что-то ищешь?', '', 29981),
(163733, 'ruRU', '', '<Таланджи хмурит брови.>\n\nБвонсамди занял место Резана. Вот ведь наглец, клянусь отцом...\n\n<Таланджи делает глубокий вдох.>\n\nИдем. Давай покончим с этим.', 29981),
(163732, 'ruRU', '', 'С Гонком мы давно знакомы. Лоти сказала, что это доброжелательный лоа, ненавязчивый в своих учениях и скромный, учитывая его положение. Посмотрим, что он для меня припас.', 29981),
(163731, 'ruRU', '', 'У Па\'ку буйный нрав. Думаю, она нашлет на меня ярость бури.\n\nТебе по плечу такое испытание, $n?', 29981),
(163730, 'ruRU', '', 'Если честно, я не очень много знаю о могучем Краг\'ве. Знаю лишь, что он силен и всеми силами оберегает своих сородичей. Если это так, то возможно, кому-то из нас предстоит бой.', 29981),
(163727, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(163726, 'ruRU', 'Чем я могу помочь?', '', 29981),
(163725, 'ruRU', '', 'Ты заплатишь за все! Команда, к бою!', 29981),
(163724, 'ruRU', '', 'Я наслышана о тебе, Джайна Праудмур. Девочка, предавшая отца и потерявшая брата. Неудачливая у вас семейка.', 29981),
(163723, 'ruRU', '', 'Считай это последним предупреждением. Вернись в порт и хорони мертвых... или присоединишься к ним.', 29981),
(163722, 'ruRU', 'Земля зовет.', '', 29981),
(163712, 'ruRU', '', 'Они уничтожают наш корабль! Если вы ждете подходящего момента, чтобы вмешаться, то он уже настал!', 29981),
(163710, 'ruRU', '90 секунд до начала битвы за Темные берега.', '', 29981),
(163709, 'ruRU', '', 'У нас пробоина! Разберитесь с этими култирасцами, иначе на берег придется возвращаться вплавь!', 29981),
(163708, 'ruRU', '', 'Мы под обстрелом! Прогоните этих култирасцев из наших вод! Живо!', 29981),
(163702, 'ruRU', 'Ни один ордынец не уйдет с этого корабля живым!', '', 29981),
(163701, 'ruRU', 'Всем в бой!', '', 29981),
(163700, 'ruRU', 'Пришла пора вернуть себе эти берега! За Альянс!', '', 29981),
(163699, 'ruRU', '', 'Проклятие?! Вот почему никто не растащил эти богатства! Давай уйдем отсюда!', 29981),
(163697, 'ruRU', '', 'Эй, $n! Открой мне этот сундук! Хочу посмотреть, что там за сокровища!', 29981),
(163695, 'ruRU', 'Эти ордынцы пополнят нашу коллекцию пленников!', '', 29981),
(163694, 'ruRU', '', 'Я могу набрать кучу блестяшек и стать богатой-богатой! Я смогу быть кем хочу!', 29981),
(163693, 'ruRU', 'Приготовьтесь. Наши всадники на подходе.', '', 29981),
(163692, 'ruRU', 'Наши разведчики работают под покровом ночи. По их сигналу мы начнем наступление и вернем себе эти берега.', '', 29981),
(163691, 'ruRU', '', 'Враг по левому борту! Угостите его ядрами!', 29981),
(163690, 'ruRU', 'Они хотят спасти пленников!', '', 29981),
(163689, 'ruRU', 'Нужно отбить абордаж!', '', 29981),
(163688, 'ruRU', '', 'Култирасцы по левому борту!', 29981),
(163687, 'ruRU', '', 'Култирасцы по правому борту!', 29981),
(163686, 'ruRU', '', 'Вражеский корабль по правому борту! Все к пушкам!', 29981),
(163685, 'ruRU', 'Чем могу помочь?', '', 29981),
(163684, 'ruRU', 'Чти духов предков.', '', 29981),
(163683, 'ruRU', 'Мы никогда не сдадимся!', '', 29981),
(163682, 'ruRU', 'Мы сильны, когда вместе.', '', 29981),
(163681, 'ruRU', 'Орда – наша семья.', '', 29981),
(163680, 'ruRU', '', '$n, тебе когда-нибудь приходилось видеть столько блестяшек сразу? В Зулдазаре много золота... но где попало оно не валяется!', 29981),
(163679, 'ruRU', '', 'Свистать всех наверх! Дочь морей дорого заплатит за вторжение в наши воды!', 29981),
(163678, 'ruRU', 'Битва за Темные берега началась!', '', 29981),
(163677, 'ruRU', '30 секунд до начала битвы за Темные берега.', '', 29981),
(163676, 'ruRU', '1 минута до начала битвы за Темные берега.', '', 29981),
(163675, 'ruRU', 'Три!', 'Три!', 29981),
(163674, 'ruRU', 'Два!', 'Два!', 29981),
(163673, 'ruRU', 'Один!', 'Один!', 29981),
(163672, 'ruRU', 'Быстрее, $n! В эти сундуки.', '', 29981),
(163671, 'ruRU', 'Надеюсь, в смерти вам повезет больше, чем в жизни!', '', 29981),
(163670, 'ruRU', 'Вы что, не знали? От старины Бвонсамди не спрячешься!', '', 29981),
(163669, 'ruRU', 'Вам жить надоело? Так зашли бы ко мне пораньше!', '', 29981),
(163668, 'ruRU', 'М-да. Какая жизнь – такая и смерть.', '', 29981),
(163667, 'ruRU', 'Вот спасибо! Новые слуги мне всегда нужны!', '', 29981),
(163666, 'ruRU', 'Рано или поздно... все приходят ко мне!', '', 29981),
(163664, 'ruRU', 'Вас унесет буря!', '', 29981),
(163663, 'ruRU', 'Никто не выстоит перед ураганом!', '', 29981),
(163662, 'ruRU', '', 'Ваши кости посыплются градом на землю!', 29981),
(163661, 'ruRU', '', 'Сейчас вы увидите мою ярость!', 29981),
(163660, 'ruRU', 'Вам не убежать!', '', 29981),
(163659, 'ruRU', 'Бежать некуда!', '', 29981),
(163658, 'ruRU', 'Я вижу вас...', '', 29981),
(163657, 'ruRU', 'Будь вы поумнее, вы бы уже давно сбежали.', '', 29981),
(163656, 'ruRU', 'Я обрушу на вас свой гнев!', '', 29981),
(163655, 'ruRU', 'Раздавлю, как мошек!', '', 29981),
(163654, 'ruRU', 'Угадайте, куда я приземлюсь!', '', 29981),
(163653, 'ruRU', '', 'Мастерская открылась. Начинайте постройку катапульт, чтобы расчистить дорогу в Лор\'данел.', 29981),
(163652, 'ruRU', '', 'Мы достроили цитадель. Собирайте войска и готовьтесь штурмовать остров!', 29981),
(163651, 'ruRU', '', 'Дом вождей стал крепостью. Теперь можно начинать постройку мастерской.', 29981),
(163650, 'ruRU', '', 'Казармы построены. Теперь вы сможете обучать дополнительные войска.', 29981),
(163649, 'ruRU', '', 'Оружейная готова. Снабжайте ее ресурсами, чтобы улучшить оружие и доспехи войск.', 29981),
(163648, 'ruRU', '', 'Мы построили алтарь бури. Он может усилить вас или придать облик могучего союзника.', 29981),
(163647, 'ruRU', '', 'Гиблый перекресток наш. Удерживайте его, чтобы защитить Башал\'Аран!', 29981),
(163646, 'ruRU', 'Я чую ваш страх.', '', 29981),
(163645, 'ruRU', '', 'Ясеневый терминал наш. Теперь мы можем быстро перемещаться по полю боя и атаковать врага с небес.', 29981),
(163644, 'ruRU', '', 'Хорошо. Магия берега Мрачных Волн позволит нашим аптекарям обучать алхимиков и создавать поганища.', 29981),
(163643, 'ruRU', '', 'Мы взяли руины Лорнесты. Железо из местного рудника нам очень пригодится.', 29981),
(163642, 'ruRU', '', 'Горекаменный карьер наш! Добывайте железо, чтобы улучшить экипировку войск.', 29981),
(163641, 'ruRU', '', 'Пепельная роща наша. Местная древесина пойдет на укрепление наших аванпостов.', 29981),
(163640, 'ruRU', '', 'Мы захватили Увядающую рощу. Собирайте древесину – она пригодится гарнизону.', 29981),
(163639, 'ruRU', '', 'Отступаем! Мы еще вернемся, и тогда смерть поглотит Альянс и Темные берега!', 29981),
(163638, 'ruRU', '', 'Победа за нами! Темные берега снова наши, и Альянсу никогда не захватить их!', 29981),
(163637, 'ruRU', '', 'Готовьтесь к атаке. Майев ждет нас.', 29981),
(163636, 'ruRU', '', 'Мы не боимся смерти! Мы ее вестники!', 29981),
(163635, 'ruRU', 'Кости поломаю!', '', 29981),
(163634, 'ruRU', '', 'Смерть Орде! Аш\'ал терадас!', 29981),
(163633, 'ruRU', '', 'Я не боюсь ни тебя, Сира, ни армии смерти, которой ты служишь.', 29981),
(163630, 'ruRU', '', 'Темные берега наши, Майев. Мы идем за тобой.', 29981),
(163629, 'ruRU', 'Истекайте кровью!', '', 29981),
(163628, 'ruRU', 'Покромсаю!', '', 29981),
(163626, 'ruRU', 'Как такое... может быть...', '', 29981),
(163625, 'ruRU', 'Не стоило соваться в джунгли.', '', 29981),
(163623, 'ruRU', 'Глупцы умирают первыми!', '', 29981),
(163622, 'ruRU', 'Выживает сильнейший!', '', 29981),
(163621, 'ruRU', 'Познакомьтесь с моими когтями!', '', 29981),
(163620, 'ruRU', 'Охота началась!', '', 29981),
(163619, 'ruRU', '', 'Ветра повинуются мне!', 29981),
(163618, 'ruRU', 'Я – сама буря!', '', 29981),
(163617, 'ruRU', 'Заразите все, до самого моря.', '', 29981),
(163616, 'ruRU', '', 'Мой последний путь...', 29981),
(163615, 'ruRU', '', 'Я тебя запомню!', 29981),
(163614, 'ruRU', '', 'Очиститесь молнией!', 29981),
(163613, 'ruRU', '', 'Лор\'данел наш. Осталось только разобраться с Майев.', 29981),
(163612, 'ruRU', '', 'Но я же только что расплатилась!', 29981),
(163611, 'ruRU', '', 'Гром, услышь меня!', 29981),
(163610, 'ruRU', '', 'Я смою вас!', 29981),
(163609, 'ruRU', '', 'Ты права, Сира, я совершила немало ошибок... Но это не правосудие!', 29981),
(163608, 'ruRU', '', 'Какой... удивительный... остров!', 29981),
(163607, 'ruRU', '', 'Вот и все, Майев. Ты умрешь одна, брошенная союзниками.', 29981),
(163606, 'ruRU', 'Живых не оставлять.', '', 29981),
(163605, 'ruRU', '', 'Это ты предала нас, Майев! Ты не представляешь, что мне довелось пережить по твоей вине!', 29981),
(163604, 'ruRU', '', 'Буря... зовет...', 29981),
(163603, 'ruRU', '', 'Ты больше не Страж, Сира! Ты предала все, за что мы сражаемся!', 29981),
(163602, 'ruRU', '', 'После бури всегда выходит солнце.', 29981),
(163601, 'ruRU', '', 'О, такая мощь – и буквально под ногами!', 29981),
(163600, 'ruRU', '', 'Башал\'Аран в наших руках. Соберите ресурсы в окрестностях и уничтожьте все препятствия на пути к Лор\'данелу.', 29981),
(163599, 'ruRU', '', 'Отведай больших медных бомб!', 29981),
(163598, 'ruRU', '', 'Буря очистила тебя!', 29981),
(163597, 'ruRU', '', 'Пора пустить в ход дрель!', 29981),
(163596, 'ruRU', '', 'Как тебе моя дрель?!', 29981),
(163595, 'ruRU', 'Разлить чуму!', '', 29981),
(163594, 'ruRU', '', 'Наступаем на Башал\'Аран. Отсюда начнется падение Альянса!', 29981),
(163593, 'ruRU', '', 'Майев. Она думает, что остановит нас?', 29981),
(163592, 'ruRU', 'Если жара становится невыносимой, значит у тебя наверняка пригорает еда. Поверь, я знаю, о чем говорю!', '', 29981),
(163591, 'ruRU', 'Хочешь поблагодарить шеф-повара? Странный обычай. А хотя... продолжай.', '', 29981),
(163590, 'ruRU', 'А ты все не уходишь. Должно быть, у тебя уже и аппетит разгулялся?', '', 29981),
(163589, 'ruRU', 'С доброй едой и душа добреет.', '', 29981),
(163588, 'ruRU', '', 'Сира... Нет... Отступи, или нам придется убить тебя!', 29981),
(163587, 'ruRU', 'Используй только свежие продукты.', '', 29981),
(163586, 'ruRU', 'Не забудь подкрепиться!', '', 29981),
(163585, 'ruRU', 'Жизнь выглядит куда приятнее на полный желудок!', '', 29981),
(163584, 'ruRU', 'Мне еще есть чему поучиться.', '', 29981),
(163583, 'ruRU', 'Кто голоден?', '', 29981),
(163582, 'ruRU', '', 'Мы вернули Аубердин. Но рано почивать на лаврах. Продвигайтесь вперед и захватите все ресурсы, какие найдете.', 29981),
(163581, 'ruRU', 'Я работаю над новыми рецептами.', '', 29981),
(163580, 'ruRU', 'Пора готовить!', '', 29981),
(163579, 'ruRU', '', 'Наши войска захватят Аубердин, а ты отправляйся вперед, к Башал\'Арану, на разведку.', 29981),
(163578, 'ruRU', 'Разнообразие – лучшая приправа к жизни.', '', 29981),
(163577, 'ruRU', 'Ну здравствуй!', '', 29981),
(163576, 'ruRU', '', 'Следуй за мной.', 29981),
(163575, 'ruRU', '', 'Приготовьтесь.', 29981),
(163574, 'ruRU', '', 'Герои! Вырвем Темные берега из лап Альянса! Готовьте клинки!', 29981),
(163572, 'ruRU', '', 'Я очистила твой разум!', 29981),
(163571, 'ruRU', '', 'Кто вы против Акунды?!', 29981),
(163570, 'ruRU', 'А вы не робкого десятка. Вы помогли мне – значит и я помогу вам. Когда придет время, я разожгу огонь.', '', 29981),
(163569, 'ruRU', 'Великая Кузня не выдаст жар, достаточный для плавки металла... то есть, без тебя не выдаст.', '', 29981),
(163568, 'ruRU', 'Игнис! Нам нужна твоя помощь. Мы хотим перековать древние дворфийские латы.', '', 29981),
(163567, 'ruRU', 'А ну полезай обратно в горн!', '', 29981),
(163566, 'ruRU', 'Спасибо, кроха. Благодаря тебе, кузня снова под контролем.', '', 29981),
(163565, 'ruRU', '', 'Делай, что хочешь... Но знай, мой клинок острее, чем когда-либо.', 29981),
(163564, 'ruRU', '', 'Смерть заберет всех.', 29981),
(163563, 'ruRU', '', 'Начинается истинная охота.', 29981),
(163562, 'ruRU', '', 'Я была глупа и наивна.', 29981),
(163561, 'ruRU', '', 'Слова Элуны оказались ложью.', 29981),
(163560, 'ruRU', '', 'Слова – иллюзия. Реальна только боль.', 29981),
(163559, 'ruRU', '', 'Наши враги будут страдать.', 29981),
(163558, 'ruRU', '', 'Наконец мне открылся истинный путь.', 29981),
(163557, 'ruRU', '', 'Не испытывай мое терпение.', 29981),
(163555, 'ruRU', '', 'Прежде чем я закончу, я хочу задать вопрос вам, $n. Кто, по ВАШЕМУ мнению, убил интенданта?', 29981),
(163554, 'ruRU', '', 'Все трое подозреваемых обвиняются в убийстве интенданта Пола Норта.', 29981),
(163553, 'ruRU', 'Эта штука сделана из дерева. Найди топливо, и мы ее живо подожжем!', '', 29981),
(163552, 'ruRU', 'Ну наконец-то кто-то явился!', '', 29981),
(163551, 'ruRU', '', 'Вам некуда бежать!', 29981),
(163550, 'ruRU', '', 'Копошитесь в грязи, там вам и место!', 29981),
(163549, 'ruRU', '', 'Этот облик вам больше подходит!', 29981),
(163548, 'ruRU', '', 'Кончилась... моя охота...', 29981),
(163547, 'ruRU', '', 'Надежда... обманчива...', 29981),
(163546, 'ruRU', 'Помоги нам положить этому конец. Мой народ уже достаточно настрадался.', '', 29981),
(163545, 'ruRU', 'Наверное, работать на Галливикса все же лучше, чем торчать в плену у этих ребят. Хоть и не намного...', 'Наверное, работать на Галливикса все же лучше, чем торчать в плену у этих ребят. Хоть и не намного...', 29981),
(163544, 'ruRU', 'Лучше пойду починю... Что там сломалось у Галливикса?', 'Лучше пойду починю... Что там сломалось у Галливикса?', 29981),
(163543, 'ruRU', '', 'Неужели нас ждет такая участь? Быть рабами на своей же земле?', 29981),
(163542, 'ruRU', '', 'Еще одна славная охота.', 29981),
(163541, 'ruRU', '', 'Твой труп насытит мою стаю!', 29981),
(163540, 'ruRU', 'Эти обломки – все, что осталось.', '', 29981),
(163539, 'ruRU', 'Перековка такого уникального доспеха – дело непростое. Но под руководством Грумнуса мы должны справиться.', '', 29981),
(163538, 'ruRU', 'По легенде, когда куется доспех горного короля, его навсегда связывают с будущим владельцем.', '', 29981),
(163537, 'ruRU', '', 'Свежее мясо!', 29981),
(163536, 'ruRU', '', 'Вы все – добыча для моей стаи!', 29981),
(163535, 'ruRU', 'Я свободен! Ну, насколько личный механик Галливикса вообще может быть свободен...', 'Я свободна! Ну, насколько личный механик Галливикса вообще может быть свободен...', 29981),
(163534, 'ruRU', 'Ветер несет мою волю!', '', 29981),
(163533, 'ruRU', 'Небо принадлежит нам!', '', 29981),
(163532, 'ruRU', 'Попутный ветер!', '', 29981),
(163531, 'ruRU', 'Я стану... ветром...', '', 29981),
(163530, 'ruRU', 'Вы недостойны даже дышать этим воздухом.', '', 29981),
(163529, 'ruRU', 'Смерть еретикам!', '', 29981),
(163528, 'ruRU', '', 'Скажи, когда приготовишься, $n.', 29981),
(163527, 'ruRU', 'Корм для сауридов!', '', 29981),
(163526, 'ruRU', 'Вам не выстоять против лоа!', '', 29981),
(163523, 'ruRU', '', 'Один момент! А вот и она.', 29981),
(163522, 'ruRU', 'Всем встать. Судья Кософланж покидает зал суда. Мясыш хочет есть. Заседание переносится.', '', 29981),
(163521, 'ruRU', '', 'Я прерываю заседание, чтобы вы могли изучить новые улики.', 29981),
(163520, 'ruRU', '', 'Командир Вороная Шкура, ваш хобгоблин-помощник нашел дополнительную информацию, относящуюся к делу.', 29981),
(163519, 'ruRU', '', 'Вот оно что. Очень необычно, но я позволяю.', 29981),
(163518, 'ruRU', '', 'Подойди.', 29981),
(163517, 'ruRU', 'Ваша честь, Нагг просит минутку внимания.', '', 29981),
(163516, 'ruRU', 'Стоп! Остановитесь!', '', 29981),
(163515, 'ruRU', 'В деле \"Орда против Сныкобакса, Скриззика, Скорой Погибели и |3-1($n)\" мы...', '', 29981),
(163514, 'ruRU', '', 'Очень интересно! Старшина присяжных, продолжайте.', 29981),
(163513, 'ruRU', 'Да, Ваша честь.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163512, 'ruRU', '', 'Хорошо. Признаете ли вы виновным кого-либо из присутствующих в суде?', 29981),
(163511, 'ruRU', 'Присяжные пришли к решению, Ваша честь.', '', 29981),
(163510, 'ruRU', '', 'Хорошо. Теперь я хочу дать присяжным возможность обдумать...', 29981),
(163509, 'ruRU', '', 'Защита сказала свое слово, Ваша честь.', 29981),
(163508, 'ruRU', '', 'Самое очевидное тому объяснение – $n и есть убийца Пола Норта!', 29981),
(163507, 'ruRU', '', '$n пытается ввести нас в заблуждение. Ведет себя как преступник, который скрывает содеянное.', 29981),
(163506, 'ruRU', '', 'Я же хочу представить присяжным сделанный на камеру СЕЛФИ снимок, на котором четко видно, как $N распространяет поддельные приглашения на арену \"Морд\'Бой\". Никакого почтения к закону!', 29981),
(163505, 'ruRU', '', 'Когда же прекратится череда этих кровавых преступлений? И наконец, $n, вы обвиняете в убийстве моего клиента, эльфийку крови.', 29981),
(163504, 'ruRU', '', 'Между тем в ходе расследования вы сами убили двух ни в чем не повинных инженеров... так?', 29981),
(163503, 'ruRU', '', 'Видите? $n имеет финансовые мотивы для совершения преступления. И вот еще что. $n, вы обвиняете в убийстве интенданта моего достопочтенного клиента-дворфа.', 29981),
(163502, 'ruRU', '', 'Но судя по записям, это ВЫ убили лорда Силистреля, чтобы получить его честно заработанное бойцовское золото! Это правда?', 29981),
(163501, 'ruRU', '', '$n, вы утверждаете, что у моего клиента-гоблина был мотив для убийства интенданта.', 29981),
(163500, 'ruRU', '', 'Убийца Пола Норта – это $n!', 29981),
(163499, 'ruRU', '', 'Мы бы хотели представить другую версию произошедшего.', 29981),
(163498, 'ruRU', '', 'Спасибо, Ваша честь.', 29981),
(163497, 'ruRU', '', 'Спасибо, советник. Защита?', 29981),
(163496, 'ruRU', '', 'Обвинение сказало свое слово, Ваша честь.', 29981),
(163495, 'ruRU', '', 'Она была одержима демоном!', 29981),
(163494, 'ruRU', '', 'Она была шпионкой Альянса!', 29981),
(163493, 'ruRU', '', 'Ей так наскучила арена \"Морд\'Бой\", что она стала красть у других торговцев!', 29981),
(163492, 'ruRU', '', 'Ей так наскучила арена \"Морд\'Бой\", что она плюнула с борта дирижабля!', 29981),
(163491, 'ruRU', '', 'Чтобы подделывать приглашения ради забавы, нужно обладать значительным доходом, чему свидетельствует инкрустированный меч, найденный |3-4($n) на месте преступления.', 29981),
(163490, 'ruRU', '', 'Ей так наскучила арена \"Морд\'Бой\", что она стала распространять поддельные приглашения.', 29981),
(163489, 'ruRU', '', 'У Либбиары Скорой Погибели был весомый мотив для убийства Пола Норта.', 29981),
(163488, 'ruRU', 'Нет, все было не так...', '', 29981),
(163487, 'ruRU', '', 'Он хотел отдать шляпу интенданта Королю-личу!', 29981),
(163486, 'ruRU', '', 'Он хотел продать шляпу интенданта тому, кто больше предложит!', 29981),
(163485, 'ruRU', '', 'Он хотел скормить шляпу интенданта невидимому чудовищу из Бездны!', 29981),
(163484, 'ruRU', '', 'Он хотел отдать сердце интенданта Королю-личу!', 29981),
(163483, 'ruRU', '', 'Он хотел продать сердце интенданта тому, кто больше предложит!', 29981),
(163482, 'ruRU', '', 'Он хотел скормить сердце интенданта невидимому чудовищу из Бездны!', 29981),
(163481, 'ruRU', '', 'Он хотел отдать душу интенданта Королю-личу!', 29981),
(163480, 'ruRU', '', 'Он хотел продать душу интенданта тому, кто больше предложит!', 29981),
(163479, 'ruRU', '', 'На то указывает улика, найденная на месте преступления, – загадочный свиток.', 29981),
(163478, 'ruRU', '', 'Он хотел скормить душу интенданта невидимому чудовищу из Бездны!', 29981),
(163477, 'ruRU', '', 'У повелителя теней Скриззика тоже был мотив.', 29981),
(163476, 'ruRU', 'Как... ты... смеешь?!', '', 29981),
(163475, 'ruRU', '', 'Он убил Пола Норта, чтобы скрыть другое убийство.', 29981),
(163474, 'ruRU', '', 'Они с Полом Нортом состояли в любовном треугольнике!', 29981),
(163473, 'ruRU', '', 'Он задолжал Джайне Праудмур.', 29981),
(163472, 'ruRU', '', 'Он задолжал Траллу.', 29981),
(163471, 'ruRU', '', 'На то указывают улики, найденные на месте преступления, о чем нам говорит $n: был украден ящик с ценными товарами.', 29981),
(163470, 'ruRU', '', 'Он задолжал лорду Силистрелю.', 29981),
(163469, 'ruRU', '', 'У смотрителя арены Сныкобакса были весомые причины убить Пола Норта.', 29981),
(163468, 'ruRU', '', 'Дамы и господа присяжные, вам были представлены доказательства.', 29981),
(163467, 'ruRU', '', 'Пф-ф! Если маленькая шалость – это преступление, то считайте меня виновной. Я готова заплатить штраф. И давайте уже закончим с этим.', 29981),
(163466, 'ruRU', '', 'Ясно. И что же за преступление она совершила со скуки?', 29981),
(163465, 'ruRU', '', 'Что это был за мотив?', 29981),
(163464, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с госпожой Либбиарой вам стал известен ее потенциальный мотив?', 29981),
(163463, 'ruRU', '', 'Какие найденные вами улики указывают на госпожу Либбиару?', 29981),
(163462, 'ruRU', '', 'И наконец, $n, я бы хотела расспросить вас о Либбиаре Скорой Погибели.', 29981),
(163461, 'ruRU', 'Простите.', '', 29981),
(163460, 'ruRU', '', 'Я призываю к порядку в суде!', 29981),
(163459, 'ruRU', 'В-в-вы не понимаете... Я... я... я...', '', 29981),
(163458, 'ruRU', '', 'Кому же он хотел отдать эту шляпу?', 29981),
(163457, 'ruRU', '', 'Кому же он хотел отдать это сердце?', 29981),
(163456, 'ruRU', '', 'Кому же он хотел отдать эту душу?', 29981),
(163455, 'ruRU', '', 'Что это был за мотив?', 29981),
(163454, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с господином Скриззиком вам стал известен его потенциальный мотив?', 29981),
(163453, 'ruRU', '', '$n, вы также обнаружили улики, указывающие на причастность Скриззика к убийству. Что именно вам удалось найти?', 29981),
(163452, 'ruRU', 'Об-об-обо мне, что ли?', '', 29981),
(163451, 'ruRU', '', 'Спасибо, Ваша честь. Теперь я бы хотела задать несколько вопросов о повелителе теней Скриззике.', 29981),
(163450, 'ruRU', '', 'Советник, пожалуйста, продолжайте.', 29981),
(163449, 'ruRU', '', 'Это нетривиальное заявление, но я все же разрешаю.', 29981),
(163448, 'ruRU', 'Что-то ты много болтаешь! Я убью тебя!', '', 29981),
(163447, 'ruRU', '', 'Кому же он был должен?', 29981),
(163446, 'ruRU', 'ЭЙ!', '', 29981),
(163445, 'ruRU', '', 'Что это был за мотив?', 29981),
(163444, 'ruRU', '', 'Спасибо. $n, правда ли, что из разговора с господином Сныкобаксом вам стал известен его потенциальный мотив?', 29981),
(163443, 'ruRU', '', 'И что это были за улики?', 29981),
(163442, 'ruRU', '', '$n, правда ли, что вы нашли на месте преступления улики, указывающие на смотрителя арены Сныкобакса?', 29981),
(163441, 'ruRU', 'Эй!', '', 29981),
(163440, 'ruRU', '', '$n, я бы хотела задать несколько вопросов о смотрителе арены Сныкобаксе.', 29981),
(163439, 'ruRU', '', 'Для дачи показаний приглашается $n.', 29981),
(163438, 'ruRU', '', 'Спасибо, Тиана. Обвинение, ваш свидетель.', 29981),
(163435, 'ruRU', '', 'Мои подзащитные невиновны!', 29981),
(163434, 'ruRU', '', 'Спасибо, советник. Защита, ваше вступительное слово!', 29981),
(163431, 'ruRU', '', 'Троих обвиняемых подозревают в убийстве. Мы докажем, что по меньшей мере один из них виновен!', 29981),
(163430, 'ruRU', '', 'Спасибо, Ваша честь.', 29981),
(163429, 'ruRU', 'Я понимаю, Генн. Да хранит вас Свет.', '', 29981),
(163428, 'ruRU', '', 'Слово общественному обвинению.', 29981),
(163427, 'ruRU', 'Я не оспариваю твою власть. Но если я не отдам приказ, Миа бросится в бой в одиночку.', '', 29981),
(163426, 'ruRU', 'Немного гоблинской изобретательности, побольше взрывчатки – и мы уничтожим этот корабль!', '', 29981),
(163425, 'ruRU', 'Хорошо. Присяжные, сядьте.', '', 29981),
(163423, 'ruRU', 'Присяжные! Клянетесь ли вы перед лицом Света говорить правду и только правду?', '', 29981),
(163422, 'ruRU', 'Помощник судьи Мясыш, пожалуйста, примите присягу у заседателей.', '', 29981),
(163421, 'ruRU', 'Сегодня мы рассмотрим дело \"Орда против Сныкобакса, Скриззика и Скорой Погибели\".', '', 29981),
(163420, 'ruRU', 'Начинается суд \"Морд\'Боя\". Председатель – судья Кософланж. Мясыш хочет есть.', '', 29981),
(163419, 'ruRU', 'Слушайте все!', '', 29981),
(163418, 'ruRU', 'Я не могу смотреть, как их постигает судьба Гилнеаса. Мы будем сражаться вместе с ними.', '', 29981),
(163417, 'ruRU', 'Ночные эльфы спасли мой народ от проклятия и приютили нас в Дарнасе после гибели нашего королевства.', '', 29981),
(163416, 'ruRU', 'Разумеется. Я всегда готов выслушать вас.', '', 29981),
(163415, 'ruRU', '', 'Спасибо, $p. Хоть на тебя можно рассчитывать.', 29981),
(163414, 'ruRU', '$p, наша армия в Зулдазаре еще не вступила в бой. С твоей помощью мы могли бы одержать победу на обоих фронтах.', '', 29981),
(163413, 'ruRU', 'Оставьте нас в покое!', 'Оставьте нас в покое!', 29981),
(163412, 'ruRU', 'Позовите стражу!', 'Позовите стражу!', 29981),
(163411, 'ruRU', 'Бегите! Это Орда!', 'Бегите! Это Орда!', 29981),
(163410, 'ruRU', 'Сначала пираты, а теперь еще и Орда!', 'Сначала пираты, а теперь еще и Орда!', 29981),
(163409, 'ruRU', 'Орда здесь!', 'Орда здесь!', 29981),
(163408, 'ruRU', 'Ясно.', '', 29981),
(163407, 'ruRU', 'Я в полной боевой готовности.', 'Я в полной боевой готовности.', 29981),
(163406, 'ruRU', '', 'Продолжим?', 29981),
(163405, 'ruRU', 'Форма жизни изучена... Совпадений не обнаружено... Не Эгрим Бронзобород... Активация защиты...', '', 29981),
(163404, 'ruRU', 'Несанкционированное проникновение... активация механизмов защиты...', '', 29981),
(163403, 'ruRU', '', 'Тиранда отправилась на Темные берега. Она решила сразиться с Ордой в одиночку.', 29981),
(163398, 'ruRU', '', 'Нет. Мы вернем наши земли немедленно.', 29981),
(163397, 'ruRU', 'Покажи мне эту реликвию друстов.', 'Покажи мне эту реликвию друстов.', 29981),
(163396, 'ruRU', '', 'Нам нужна помощь, а не извинения! Мы не будем сидеть сложа руки, пока Орда разоряет наш дом!', 29981),
(163395, 'ruRU', '', 'После всех неприятностей с Г\'ууном и осады города Таланджи нужен был кто-то, способный поддерживать порядок.\n\nО Джакра\'зете можно говорить всякое, но он был сильным генералом. Надеюсь, я смогу перенять то хорошее, что было в нем.\n\nТаланджи вернула меня из изгнания и дала мне этот пост. Я стала генералом Ракирой – Кадже бы это понравилось. Теперь я буду не только командовать солдатами империи Зандалари, но и стану их голосом в Совете Занчули.\n\nЭто честь для меня. И шанс исправить ошибки прошлого.', 29981),
(163394, 'ruRU', 'Перед тобой Джо\'нок, щит Торкали.\n\nДжо\'нок заменит Вол\'каала, этого прихвостня повелительницы лжи.\n\nМы созданы для войны, а не для красивых фраз. Джо\'нок станет голосом силы в Совете.\n\n<Джо\'нок громко хрустит костяшками.>', '', 29981),
(163393, 'ruRU', '', 'Я верховный прелат Рата, прежде бывшая Волей Резана.\n\nТак как моего лоа больше нет, я служу Таланджи. Я стану голосом веры в Совете Занчули под ее началом.', 29981),
(163392, 'ruRU', 'Ты, наверное, думаешь, как же кто-то вроде меня оказался в этом совете?\n\nЧестно говоря, я и сам не знаю. Может, Торга обо мне позаботился.\n\nЗато я точно попаду в отличную историю! Первый тортоллан в Совете Занчули, как тебе? Ха-ха-ха.', '', 29981),
(163391, 'ruRU', 'Даю вам слово, мы отобьем Тельдрассил до конца войны. Но сейчас наши ресурсы скудеют, а потери возрастают. Если вы согласитесь немного подождать...', '', 29981),
(163390, 'ruRU', 'Верховная жрица, мне жаль, но таковы обстоятельства. Нам не хватит войск на Арати, Зандалар и Темные берега.', '', 29981),
(163389, 'ruRU', 'Велен, покажите, что случилось.', '', 29981),
(163388, 'ruRU', '', 'Калдорай всегда были верны Альянсу. Неужели он теперь оставит нас?', 29981),
(163387, 'ruRU', 'Может, и выберешь.', '', 29981),
(163386, 'ruRU', '', 'Я? А то как же! У меня еще нет лоа! Может, я выберу тебя!', 29981),
(163385, 'ruRU', 'Но если ты хочешь уметь перевоплощаться, нужно хранить мне верность. Ты ведь справишься, кроха?', '', 29981),
(163384, 'ruRU', '', 'А как же бесчисленные погибшие? Семьи, потерявшие своих близких?', 29981),
(163383, 'ruRU', 'У моих последователей разные судьбы и жизни. Хотя они могут поклоняться и другим лоа, все они – часть моей стаи.', '', 29981),
(163382, 'ruRU', '', 'То, что надо.', 29981),
(163381, 'ruRU', 'Я мастер перевоплощения, кроха. Если будешь мне служить, я и тебе дарую такую силу.', '', 29981),
(163380, 'ruRU', '', 'Трезубец Океанских Глубин где-то поблизости. Мы должны попасть на этот остров.', 29981),
(163379, 'ruRU', 'Давай вызовем службу техпомощи, чтобы отремонтировать машину.', 'Давай вызовем службу техпомощи, чтобы отремонтировать машину.', 29981),
(163378, 'ruRU', 'Нет, тебя никто не просит никуда тащить эту дурацкую машину! $p, придется тебе организовать для меня небольшую месть.', '', 29981),
(163377, 'ruRU', 'А эти... их по пути схватил Альянс. Так куда тащить штуку-то?', '', 29981),
(163376, 'ruRU', 'А где остальные? Мне нужно, чтоб вы починили эту штуку, а не тащили!', '', 29981),
(163375, 'ruRU', 'Ремонтная бригада прибыла, босс. Куда тащить эту штуку?', '', 29981),
(163373, 'ruRU', 'А вот и ремонтная бригада. Все как я и говорил – обслуживание по высшим стандартам!', '', 29981),
(163372, 'ruRU', 'Тут ничего нет, кроме бананов.', 'Тут ничего нет, кроме бананов.', 29981),
(163371, 'ruRU', '<Показывай дорогу.>', '<Показывай дорогу.>', 29981),
(163370, 'ruRU', '', 'Такое существование невыносимо.', 29981),
(163369, 'ruRU', 'Стук', 'Стук', 29981),
(163368, 'ruRU', 'На бананы всегда можно положиться! Используй их с умом, хорошо?', '', 29981),
(163367, 'ruRU', 'Это старый трюк банды \"Золотой клык\", $p, и я знаю, что ты не выболтаешь наш секрет.', '', 29981),
(163366, 'ruRU', 'Нужно действовать быстро и тихо.', '', 29981),
(163365, 'ruRU', 'Разберись с системами безопасности. Мы тебя прикроем.', 'Разберись с системами безопасности. Мы тебя прикроем.', 29981),
(163364, 'ruRU', '', 'С помощью Скипетра Глубин жрецы моря скроют наши истинные намерения за пеленой тумана. Тем временем флот ударит по Дазар\'алору с юга.', 29981),
(163363, 'ruRU', 'А может, он и вправду полуробот? Тогда понятно, чего он такой надоедливый!', '', 29981),
(163362, 'ruRU', 'Я опять на два хода впереди тебя, малец! Впрочем, как всегда.', '', 29981),
(163361, 'ruRU', 'Ах! Наконец-то свежий воздух!', '', 29981),
(163360, 'ruRU', 'А, не. Не умерли. Хотя, как по мне, так лучше бы умерли. Вот так, должно быть, и чувствует себя Сильвана.', '', 29981),
(163359, 'ruRU', 'Э-э... Мы что, умерли? Неужели Сильвана всегда так себя чувствует?', '', 29981),
(163358, 'ruRU', '%s показывает на вас.', '', 29981),
(163357, 'ruRU', 'Я скую тебя льдом!', '', 29981),
(163356, 'ruRU', 'Постой-ка лучше смирно!', '', 29981),
(163355, 'ruRU', 'Здесь тебя ждет холодный прием...', '', 29981),
(163354, 'ruRU', 'Остынь немного...', '', 29981),
(163353, 'ruRU', 'БЗЗ... ОШИБКА. НЕДОСТАТОЧНО АЗЕРИТОВЫХ БОЕПРИПАСОВ.', '', 29981),
(163352, 'ruRU', 'Нет, нет, не-е-е-ет!', '', 29981),
(163351, 'ruRU', 'Ну что ж, бывай.', '', 29981),
(163350, 'ruRU', 'Вот, Галливикс, поэтому Орда никогда и не победит. Потому что вы все слишком глупы!', '', 29981),
(163349, 'ruRU', 'Нет азерита?! Почему эта проклятая штуковина не предупреждает, когда он заканчивается?', '', 29981),
(163348, 'ruRU', '', 'Возможно, мы сразу не поняли истинную ценность наших пленников.', 29981),
(163347, 'ruRU', 'Уничтофьте... Стоп! Это фто такое?', '', 29981),
(163346, 'ruRU', '', 'Включить двигатели на полную мощность – нам нужно быстро покинуть эту зону!', 29981),
(163345, 'ruRU', '', 'Сомневаюсь, что эта команда способна отбить абордаж.', 29981),
(163344, 'ruRU', '', 'Они хотят спасти пленников!', 29981),
(163343, 'ruRU', '', 'По моим наблюдениям, победа очень даже возможна!', 29981),
(163342, 'ruRU', 'А-а-а! $p, нажми на большую красную кнопку и взорви этого недоумка!', '', 29981),
(163341, 'ruRU', 'Ого, Галливикс, прямо гениальный план! Продолжай, у меня аж дух захватывает!', '', 29981),
(163340, 'ruRU', 'А потом я толкну весь его металлолом по цене ниже рыночной. У гоблинов это самое серьезное оскорбление!', '', 29981),
(163339, 'ruRU', 'Так, о чем я? А, да. Взорвать все его барахло. Держу пари, он будет рыдать в три ручья. Слюнтяй.', '', 29981),
(163338, 'ruRU', 'Серьезно, этот парень просто помешан на механизмах. Иногда мне кажется, что он и сам хотел бы быть полуроботом!', '', 29981),
(163337, 'ruRU', 'Потом я найду другие его машины и тоже взорву!', '', 29981),
(163336, 'ruRU', 'Знаешь, что я сделаю, когда найду этого гномика? Первым делом взорву этот его дурацкий механокостюм.', '', 29981),
(163335, 'ruRU', '', 'Нужно добраться до машинного отделения.', 29981),
(163334, 'ruRU', 'Он считает себя круче всех гоблинов! Ну конечно! Знаешь что, парень, по крайней мере половина из нас не светится в темноте!', '', 29981),
(163333, 'ruRU', '', 'Эта низкопробная гоблинская поделка просто взорвется, если ей немного помочь!', 29981),
(163332, 'ruRU', 'Впереди корабль Меггакрута. Короля гномов, или как там его называют эти мелкие чудики.', '', 29981),
(163331, 'ruRU', 'Должен сказать, я не любитель подобного. Пожалуй, в следующий раз оставлю такое тебе.', '', 29981),
(163330, 'ruRU', 'Хм, это так непривычно – что-то делать для кого-то другого. А ты, значит, обычно этим и занимаешься?', '', 29981),
(163329, 'ruRU', '', 'Я пойду с тобой и тщательно изучу этот примитивный воздушный транспорт.', 29981),
(163328, 'ruRU', '', 'Нам нужен план, как вывести из строя этот не слишком надежный воздушный корабль.', 29981),
(163327, 'ruRU', '', 'А теперь главный приоритет – эвакуация!', 29981),
(163326, 'ruRU', '', 'Ты вовремя!', 29981),
(163325, 'ruRU', '', 'Эта вибрация... Я чувствую силу даже издали.', 29981),
(163324, 'ruRU', '', 'У кого-то в этом лагере есть ключ, которым можно открыть сундук. Там ты найдешь нашу реликвию.', 29981),
(163323, 'ruRU', '', 'Нас ждут великие свершения. Я это чувствую. И ты тоже, правда?', 29981),
(163322, 'ruRU', '', 'О, эти смертные. Их жажда величия иногда просто непостижима.', 29981),
(163321, 'ruRU', '', 'Даже сейчас я чую запах этих тварей. Возможно, он никогда не выветрится.', 29981),
(163320, 'ruRU', 'Наши враги падут!', 'Наши враги падут!', 29981),
(163319, 'ruRU', '', 'Оружие, выкованное в глубинах...', 29981),
(163318, 'ruRU', '', 'Какая ирония. Столь желанное сокровище пылится в трофеях... у пиратов.', 29981),
(163317, 'ruRU', '', 'Когда-то Трезубцем владел могущественный нага. А теперь его слуги пытаются его вернуть.', 29981),
(163316, 'ruRU', '', 'За Кул-Тирас!', 29981),
(163315, 'ruRU', '', 'Кажется, я вижу Вольных гарпунщиков. Они сражаются с Ордой. Они помогут нам освободить Мыс Рыбака.', 29981),
(163314, 'ruRU', '', 'Хорошо, интендант. Телия, пойдешь со мной.', 29981),
(163313, 'ruRU', 'Доставь меня на Лор\'данелский пляж!', 'Доставь меня на Лор\'данелский пляж!', 29981),
(163312, 'ruRU', 'Доставь меня в Пепельную рощу.', 'Доставь меня в Пепельную рощу.', 29981),
(163311, 'ruRU', 'Доставь меня на берег Мрачных Волн.', 'Доставь меня на берег Мрачных Волн.', 29981),
(163310, 'ruRU', 'Доставь меня в Башал\'Аран.', 'Доставь меня в Башал\'Аран.', 29981),
(163309, 'ruRU', '', 'Ты правильно поступила, Телия.', 29981),
(163308, 'ruRU', '', 'Надеюсь, мои товарищи по патрулю в порядке. Может, если бы я осталась...', 29981),
(163307, 'ruRU', '', 'Я не хотела их бросать... Но как еще можно было предупредить остальных?', 29981),
(163306, 'ruRU', '', 'Буревестница – самый быстрый грифон, так что меня послали бить тревогу.', 29981),
(163305, 'ruRU', '', 'Гарпунщики и патруль отчаянно сражались, но врагов было слишком много. Нас задавили числом.', 29981),
(163304, 'ruRU', '', 'За воротами гавани появились боевые корабли. Полчища Орды направляются сюда на небольших кораблях.', 29981),
(163303, 'ruRU', '', 'Да, мэм! Как только мы увидели азеритовые бомбы, мы поняли их замысел.', 29981),
(163302, 'ruRU', '', 'Телия, какая обстановка на Мысе Рыбака? Думаешь, Орда планирует снести ворота?', 29981),
(163301, 'ruRU', '', 'Приготовьтесь – мы почти на месте.', 29981),
(163300, 'ruRU', '', 'Если наши люди живы, мы их спасем. А если пали в бою – отомстим Орде.', 29981),
(163299, 'ruRU', '', 'Но мы сделаем все, что в наших силах... и не оставим надежды.', 29981),
(163298, 'ruRU', '', 'Иногда... иногда всех спасти невозможно.', 29981),
(163297, 'ruRU', '', 'Однажды ворота гавани уже взорвали залпом из азеритового орудия. Полагаю, сейчас они хотят сделать то же самое.', 29981),
(163296, 'ruRU', '', 'Мыс Рыбака – это последний морской рубеж на пути к поморью.', 29981),
(163295, 'ruRU', '', 'Боюсь, сейчас я должна спешить – людям нужна моя помощь. Я вернусь позже.', 29981),
(163294, 'ruRU', 'Мама говорит, вы владеете магией льда. Можно нам мороженого?', 'Мама говорит, вы владеете магией льда. Можно нам мороженого?', 29981),
(163293, 'ruRU', 'Здрасьте, леди Джайна! Вы покажете нам что-нибудь волшебное? Можно мне ручного элементаля воды?', 'Здрасьте, леди Джайна! Вы покажете нам что-нибудь волшебное? Можно мне ручного элементаля воды?', 29981),
(163292, 'ruRU', 'Это же лорд-адмирал!', 'Это же лорд-адмирал!', 29981),
(163291, 'ruRU', 'Ого-го!', 'Ого-го!', 29981),
(163290, 'ruRU', '', 'Нам предстоит путь через Тирагардское поморье. Встретимся у канала, $p.', 29981),
(163289, 'ruRU', 'Все ушли на коронацию Таланджи к ступеням Занчула.\n\nЭто судьбоносное событие, которое на веку многих и вовсе не случалось. Зандаларские правители славятся своим долголетием, так что постарайся не пропустить ни мгновения, $n.', '', 29981),
(163288, 'ruRU', 'Куда все подевались?', 'Куда все подевались?', 29981),
(163287, 'ruRU', 'Будущая королева Таланджи потребовала встретить тебя.', '', 29981),
(163286, 'ruRU', 'Артиллерия в пути!', '', 29981),
(163285, 'ruRU', 'Глефомет к бою готов!', '', 29981),
(163284, 'ruRU', 'Нужно обеспечить охрану глефомета.', '', 29981),
(163283, 'ruRU', 'Артиллерия на подходе. Расчистить путь.', '', 29981),
(163282, 'ruRU', 'Глефомет готов. Союзники, вперед!', '', 29981),
(163281, 'ruRU', 'Глефомет меняет позицию!', '', 29981),
(163280, 'ruRU', 'Хорошо, что ты дома, Джайна. Думаю, теперь... А это еще что? Берегитесь!', '', 29981),
(163279, 'ruRU', '', 'Я... да, мама. Твоя правда.', 29981),
(163278, 'ruRU', '', 'Все мы когда-то ошибались, но вместе мы справимся с любым испытанием.', 29981),
(163277, 'ruRU', '', 'Никаких \"но\", Джайна.', 29981),
(163276, 'ruRU', 'Да. Только все вышло иначе.', '', 29981),
(163275, 'ruRU', '', 'Как подумаю, что его тело вывешивали напоказ, на потеху Орде...', 29981),
(163274, 'ruRU', '', 'Думаю, Дерек осудил бы меня. Особенно за то, как я поступила с Джайной.', 29981),
(163273, 'ruRU', 'Отец, конечно, бывал суров, но, думаю, он был бы рад, что мы снова вместе.', '', 29981),
(163272, 'ruRU', '', 'Это была провокация. Они хотели вывести нас из равновесия. Но мы не поддадимся.', 29981),
(163271, 'ruRU', 'Я все думаю, как отец и брат отнеслись бы ко всему, что произошло в Кул-Тирасе. И к тому, что пережила наша семья.', '', 29981),
(163270, 'ruRU', 'Не дайте чили пригореть!', '', 29981),
(163269, 'ruRU', 'О, это добавит аромата!', '', 29981),
(163268, 'ruRU', 'М-м-м, аромат бурлящего чили!', '', 29981),
(163266, 'ruRU', 'Чили Орды пахнет изумительно! И оно вот-вот будет готово!', '', 29981),
(163265, 'ruRU', 'Еще немного ингредиентов, и мы сможем отведать чили Орды!', '', 29981),
(163264, 'ruRU', 'Мне уже не терпится попробовать чили Альянса! Оно почти готово!', '', 29981),
(163263, 'ruRU', 'Чили Альянса почти готово! Осталось совсем немного ингредиентов...', '', 29981),
(163262, 'ruRU', 'Победа достается Орде! А мне – острое чили!', '', 29981),
(163261, 'ruRU', 'Альянс победил! Их чили не знает равных... Дадите рецептик?', '', 29981),
(163260, 'ruRU', 'Команда, собравшая ингредиенты для своего чили первой, побеждает! Начинаем!', '', 29981),
(163259, 'ruRU', 'Я скучал по тебе, Джайна. Кул-Тирасу без тебя нелегко пришлось. Когда отец погиб, повсюду была только ненависть: никто не хотел разбираться в причинах.', '', 29981),
(163258, 'ruRU', 'Пять? Ты несправедлива, сестрица – я продержался как минимум десять!', '', 29981),
(163257, 'ruRU', '', 'Вот теперь я узнаю своего брата! Пять минут на суше – а все мысли только о следующем плавании.', 29981),
(163256, 'ruRU', '', 'Спасибо за доверие, братик. Кстати, а ты уверен, что не хочешь сам занять этот пост?', 29981),
(163255, 'ruRU', 'Только если долг прикажет. Ты же знаешь: мое место не здесь, а в море. Кстати, нашей матушке не помешало бы хорошее морское путешествие... после всего, что случилось.', '', 29981),
(163254, 'ruRU', 'Лорд-адмирал... А знаешь, хорошо, что этот титул достался тебе. Говорят, в Альянсе тебя считают непревзойденным дипломатом.', '', 29981),
(163253, 'ruRU', '', 'Прекрати, Тандред. Я никак не привыкну к этому титулу. Я всегда считала, что следующим лорд-адмиралом станет Дерек.', 29981),
(163252, 'ruRU', 'Лорд-адмирал.', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163251, 'ruRU', 'Прошу прощения, что помешал. У меня донесение от мастера Шоу.', 'Прошу прощения, что помешала. У меня донесение от мастера Шоу.', 29981),
(163250, 'ruRU', '', 'Мы и правда вместе... и я благодарна судьбе за это.', 29981),
(163249, 'ruRU', 'Прости, мама. Но сейчас я тут. И Джайна тоже. Хвала морям, что мы снова вместе.', '', 29981),
(163248, 'ruRU', '', 'Сначала я потеряла твоего брата Дерека, затем – твоего отца, а потом и Джайну. Когда ты пропал вместе с флотом, я осталась совсем одна.', 29981),
(163247, 'ruRU', '', 'Не смейся над материнским горем, Тандред.', 29981),
(163246, 'ruRU', 'Очень милый мемориал, мама. Мне особенно понравилось, что ты назвала меня бесстрашным.', '', 29981),
(163245, 'ruRU', '', 'Как стремительно меняется мир.', 29981),
(163244, 'ruRU', '', 'Я знала, что возвращаться домой будет опасно, но должна была пойти на этот риск. Не ожидала, что смогу излечить здесь свои раны.', 29981),
(163243, 'ruRU', 'Добро пожаловать на кубок Пандарии по чили! В этом году благородный Альянс выступит против могучей Орды!', '', 29981),
(163241, 'ruRU', 'Так это таунка, да? Выглядят еще хуже, чем таурены. Хватайте азерит и уворачивайтесь от рогов!', '', 29981),
(163240, 'ruRU', 'Это... каноэ таунка на горизонте? Далеко же они забрались в поисках азерита. Придется им возвращаться несолоно хлебавши.', '', 29981),
(163239, 'ruRU', 'Зачем вообще неживым врайкулам азерит? Надеюсь, ответа мы никогда не узнаем. Прикончите их по-быстрому.', '', 29981),
(163238, 'ruRU', 'Знаете, что хуже врайкулов? Врайкулы-нежить, конечно же. Избавьте их от этого унылого существования.', '', 29981),
(163237, 'ruRU', 'Ну, здорово... Кажется, это какие-то сектанты. Отгоняйте их от азерита. И заткните уши, если они примутся петь!', '', 29981),
(163236, 'ruRU', 'Я не особо разбираюсь в сектах, но думаю, что азерит будет сохраннее в наших руках, чем у них.', '', 29981),
(163235, 'ruRU', 'Слышите вой? Он явно не сулит ничего хорошего. Схожу-ка я в трюм, проверю, как там дела.', '', 29981),
(163234, 'ruRU', 'Ха! У них нет шансов. Задай им жару, сестра!', '', 29981),
(163233, 'ruRU', 'Есть, лорд-адмирал! А где будешь ты?', '', 29981),
(163232, 'ruRU', '', 'Я атакую войска Орды с фронта.', 29981),
(163231, 'ruRU', '', 'Тандред, возьми лучшие корабли и зайди с фланга.', 29981),
(163230, 'ruRU', 'Нападение на поместье Норвингтонов придало Орде уверенности в своих силах. Новая атака была вопросом времени.', '', 29981),
(163229, 'ruRU', 'Дикие воргены? А я думал, это от вас мокрой псиной несет! Без обид. Справитесь с ними?', '', 29981),
(163228, 'ruRU', 'Бранн Бронзобород!', '', 29981),
(163227, 'ruRU', 'Видите вон те каноэ? Это таунка плывут, и, похоже, от них будут проблемы. Убейте их!', '', 29981),
(163226, 'ruRU', 'Давно я не видел таунка. Последняя наша встреча добром не кончилась. Вернете за меня должок?', '', 29981),
(163225, 'ruRU', 'Сектанты потревожили местных духов. Убейте и тех и других, а потом заберите азерит.', '', 29981),
(163224, 'ruRU', 'У этих сектантов очень плохое джуджу. Не дайте им даже прикоснуться к азериту!', '', 29981),
(163223, 'ruRU', 'Мне нужно будет пройтись, освоиться здесь, поворошить кости. Лучше держи оружие наготове, на всякий случай.$b$bСкажи, когда сможешь начать.', '', 29981),
(163222, 'ruRU', 'Здесь полно крови и костей, а Бвонсамди все не видать. Любопытно. Что могло заставить лоа могил покинуть такое место?', '', 29981),
(163221, 'ruRU', 'Я готов.', 'Я готова.', 29981),
(163220, 'ruRU', 'Никогда не видел настолько одичавших воргенов. Осторожней там, когда азерит собирать будете.', '', 29981),
(163219, 'ruRU', 'Эти воргены какие-то совсем дикие. Бешеные, небось. Не давайте себя укусить!', '', 29981),
(163218, 'ruRU', 'Фу! От дохлых врайкулов несет за версту. Избавьтесь от них и заберите азерит.', '', 29981),
(163217, 'ruRU', 'Кажется, азерит привлекает дохлых врайкулов. У-уф! Ну и мерзость!', '', 29981),
(163213, 'ruRU', '', 'Твои служители превращаются в разных зверушек. А если я тебе буду служить, я смогу так же?', 29981),
(163212, 'ruRU', '', 'Ты лоа стаи, но еще и перевоплощения, и мне очень хочется об этом узнать побольше!', 29981),
(163211, 'ruRU', '', 'Говорят, ты самый великодушный и разрешаешь своим последователям поклоняться другим лоа.', 29981),
(163210, 'ruRU', 'Здравствуй, кроха. Что привело тебя в мое логово?', '', 29981),
(163203, 'ruRU', '', 'Говорят, Гонк хороший. А он дома? Давай глянем.', 29981),
(163202, 'ruRU', '', 'Гонк всегда показывает плохишам, кто здесь главный! Правда?', 29981),
(163201, 'ruRU', '', '$n! Уходим отсюда, пока меня не съели!', 29981),
(163200, 'ruRU', '', 'Ай! Нет, нет, нет! Я тебе не мошка!', 29981),
(163199, 'ruRU', 'А, $n. Угостишь меня чем-нибудь?', '', 29981),
(163198, 'ruRU', 'Закрой глаза, малыш. Тебе лучше этого не видеть.', '', 29981),
(163197, 'ruRU', 'Не важно! Через мгновенье от этого ничего не остафаться!', '', 29981),
(163196, 'ruRU', 'Хм... вас ист дас?', '', 29981),
(163195, 'ruRU', 'Ох! Ну давай же, развалина...', '', 29981),
(163194, 'ruRU', 'Когда он утоляйт свой жажда мести, я буду управляйт вся Азерот – как меня интересовайт.', '', 29981),
(163193, 'ruRU', 'Это артефакт – единственный вещь, который отделяйт Смертокрыл от активаций перерождений!', '', 29981),
(163192, 'ruRU', 'О, не быть такой глупец! Я никогда не желайт этот дурацкий ящик себе.', '', 29981),
(163191, 'ruRU', 'Саркофаг?! Ты не...', '', 29981),
(163190, 'ruRU', 'Вы стать свидетель, как уничтожайт то, что вам так дорог!', '', 29981),
(163189, 'ruRU', 'Но сначала!', '', 29981),
(163188, 'ruRU', 'Я бы давайт вам высокий пост в моя организация, если бы не надо было вас убивайт.', '', 29981),
(163187, 'ruRU', 'Какая жалость...', '', 29981),
(163186, 'ruRU', 'Ви не только прокладывайт мне дорожка к саркофаг, но и уничтожайт его защиту!', '', 29981),
(163185, 'ruRU', 'Чистый работа, доктор Джонс!', '', 29981),
(163184, 'ruRU', '$p! У нас получилось!', '', 29981),
(163183, 'ruRU', 'Ты только глянь...', '', 29981),
(163182, 'ruRU', 'Это должно сработать!', '', 29981),
(163173, 'ruRU', 'Рексар, я готов сразиться с Коулом и его азеритовым танком.', 'Рексар, я готова сразиться с Коулом и его азеритовым танком.', 29981),
(163172, 'ruRU', '', 'Ух ты... Краг\'ва! Ты правда вернулся!', 29981),
(163171, 'ruRU', '', 'А-а-а!!!', 29981),
(163170, 'ruRU', '', 'Таз\'окун, лягуха! Покажешь мне свой дом?', 29981),
(163169, 'ruRU', '', 'И еще все эти светляки! Пойдем дальше!', 29981),
(163168, 'ruRU', '', 'Ух ты, смотри, какая огромная статуя жабы! А как сияет!', 29981),
(163167, 'ruRU', 'Небольшая сцена, в которой азеритовый танк опускает щит и стреляет по группе.', 'Небольшая сцена, в которой азеритовый танк опускает щит и стреляет по группе.', 29981),
(163165, 'ruRU', '', 'Расставим пушки около стены. Удачной охоты, $p!', 29981),
(163164, 'ruRU', '', 'Готова поспорить, это был один из магов, которые все это устроили.', 29981),
(163163, 'ruRU', '', 'Что вы наделали?!', 29981),
(163162, 'ruRU', '', 'Книги летают по воздуху... да что же это такое?..', 29981),
(163161, 'ruRU', '', 'Прекрати немедленно! Понятия не имею, что с этими метлами! Кыш!', 29981),
(163160, 'ruRU', '', 'Герои, готовьтесь. Несомненно, Сира нападет, пока мы уязвимы.', 29981),
(163159, 'ruRU', '|TInterface\\Icons\\INV_wildfireBomb_Shrapnel.blp:20|t %s выбирает вас целью |cFFFF0000|Hspell:283409|h[Гигавольтного заряд]|h|r! В укрытие!', '|TInterface\\Icons\\INV_wildfireBomb_Shrapnel.blp:20|t %s выбирает вас целью |cFFFF0000|Hspell:283409|h[Гигавольтного заряда]|h|r! В укрытие!', 29981),
(163158, 'ruRU', 'Проба на вкус', 'Проба на вкус', 29981),
(163157, 'ruRU', '', 'Лучше поиграем с цыплятами! Салка! Ты водишь!', 29981),
(163156, 'ruRU', '', 'А еще я слышала, что ее легко разозлить. Давай не будем ее трогать.', 29981),
(163155, 'ruRU', '', 'Говорят, Па\'ку – лоа ветров, морей и неба. Говорят, она вестница перемен.', 29981),
(163154, 'ruRU', '', 'Смотри, это Па\'ку! Она больше, чем я думала!', 29981),
(163153, 'ruRU', '', 'Ой-ой... $n, осторожнее!', 29981),
(163152, 'ruRU', 'Баланс восстановлен. Жизнь делает новый виток. Раскиньте кроны и цветите, как прежде.', '', 29981),
(163151, 'ruRU', 'Детская неделя еще не закончилась... Можно мне еще одну зандаларскую детскую свистульку?', 'Детская неделя еще не закончилась... Можно мне еще одну зандаларскую детскую свистульку?', 29981),
(163150, 'ruRU', 'Целительная сила природы превозможет любые разрушения. Растите, тянитесь к небу!', '', 29981),
(163149, 'ruRU', 'Духи природы, услышьте наш зов. Могучие древа, помогите нам исцелить землю.', '', 29981),
(163148, 'ruRU', 'К нам попадают дети, которые не входят ни в одну касту. У них нет ни семьи, ни дома. Мы присматриваем за ними, кормим, воспитываем.\n\nНо без касты найти место в обществе зандаларов непросто. Этих детей ждет тяжелая жизнь, и мы в меру своих сил стараемся их подготовить. У некоторых есть скрытая связь с лоа. Они проходят испытания и в будущем станут жрецами и жрицами. Другие сильны не по годам – может быть, они станут могучими воинам.\n\nЯ надеюсь, что наши воспитанники вырастут достойными зандаларами. Ради своего же блага.', '', 29981),
(163147, 'ruRU', 'Как ты можешь спокойно смотреть, как за тебя погибают солдаты?', '', 29981),
(163145, 'ruRU', 'Любой в Кул-Тирасе охотно отдаст жизнь, чтобы поквитаться с убийцей Дэлина!', '', 29981),
(163144, 'ruRU', 'Я готов сражаться с Ордой.', 'Я готова сражаться с Ордой.', 29981),
(163143, 'ruRU', 'Спасибо тебе, $n!', '', 29981),
(163142, 'ruRU', 'Почему все выбирают что-то одно? Я начну учиться прямо сейчас!', '', 29981),
(163141, 'ruRU', 'Я стану лучшим героем-Сорвиголовой-пиратом-сокольничим-друидом-жрецом моря в мире!', '', 29981),
(163140, 'ruRU', 'Но не просто героем...', '', 29981),
(163139, 'ruRU', 'Я стану героем – таким, как ты!', '', 29981),
(163138, 'ruRU', 'Кажется, я понял, кем мечтаю стать, когда вырасту.', '', 29981),
(163137, 'ruRU', 'Я даже не знаю, на кого хочу быть больше похожим!', '', 29981),
(163136, 'ruRU', 'Кто бы мог подумать, что в Кул-Тирасе столько классных взрослых?!', '', 29981),
(163135, 'ruRU', '', 'Наши рубаки ухитрились заманить в ловушку целый взвод Альянса. Помоги им добить врагов!', 29981),
(163133, 'ruRU', '<Он слишком увлеченно кричит, чтобы заметить ваше приближение.>\n\nБелая Вдова видит лживую Таланджи насквозь!', '<Он слишком увлеченно кричит, чтобы заметить ваше приближение.>\n\nБелая Вдова видит лживую Таланджи насквозь!', 29981),
(163132, 'ruRU', 'Часовые, продвигайтесь вперед, чтобы очистить и занять Башал\'Аран.', '', 29981),
(163131, 'ruRU', 'Наши союзники-гилнеасцы постараются захватить Башал\'Аран.', '', 29981),
(163130, 'ruRU', '', 'Я слежу за тобой, \"детектив\"!', 29981),
(163129, 'ruRU', '', 'Эй!', 29981),
(163128, 'ruRU', 'Хорошо! Я поговорю с ним.', 'Хорошо! Я поговорю с ним.', 29981),
(163127, 'ruRU', 'Я хотел помочь.', 'Я хотела помочь.', 29981),
(163126, 'ruRU', 'Нет, я просто искал улики.', 'Нет, я просто искала улики.', 29981),
(163125, 'ruRU', '', '<Подозрительно смотрит на вас.>\n\nТебе лучше поговорить с моим командующим офицером. Он ведет это дело. Ты найдешь его в баре по другую сторону арены.', 29981),
(163124, 'ruRU', '', 'Знаю я вас: сейчас ищешь улики, а потом начнешь препятствовать правосудию.\n\nТы что, считаешь себя детективом?', 29981),
(163123, 'ruRU', '', 'Так-так. Вмешиваемся в ход расследования?', 29981),
(163122, 'ruRU', '', 'Ну-с... э-э... как там бои?', 29981),
(163121, 'ruRU', 'Заходи в любое время. Поиграем в \"Не буди Ульфара\".', '', 29981),
(163120, 'ruRU', 'Хм... Тогда я буду слушать внимательно! Спасибо, говорящий кот!', '', 29981),
(163119, 'ruRU', 'Я услышал зов примерно в твоем возрасте! Быть может, и ты его скоро услышишь.', '', 29981),
(163118, 'ruRU', 'Наши соратники-гилнеасцы нападут на лесопилку в Увядающей роще.', '', 29981),
(163117, 'ruRU', 'Вот это круто! Я тоже так хочу!', '', 29981),
(163116, 'ruRU', 'И в тюленя! Ой, споткнулся!', '', 29981),
(163115, 'ruRU', 'И в лунного совуха!', '', 29981),
(163114, 'ruRU', 'И в лося!', '', 29981),
(163113, 'ruRU', 'И в птицу могу!', '', 29981),
(163112, 'ruRU', 'Могу!', '', 29981),
(163111, 'ruRU', 'Правда? Здорово! А можешь превратиться в медведя?', '', 29981),
(163110, 'ruRU', 'Я не говорящий кот, я говорящий друид!', '', 29981),
(163109, 'ruRU', 'Вот это да! Говорящий кот!', '', 29981),
(163108, 'ruRU', 'Наши часовые нападут на рудник в Горекаменном карьере.', '', 29981),
(163107, 'ruRU', 'Ух ты! Малыш! Привет, малыш!', '', 29981),
(163106, 'ruRU', 'Только не говори моей жене. Если что, я ужинаю!', '', 29981),
(163105, 'ruRU', 'Если что, мой счастливый ножик при мне!', '', 29981),
(163104, 'ruRU', 'Да! Пора мутить воду!', '', 29981),
(163103, 'ruRU', 'Без ш-швоей рыбки я никуда не уйду!', '', 29981),
(163102, 'ruRU', '', 'Смерть настигнет всех вас.', 29981),
(163101, 'ruRU', '', 'Никак не соображу... с кем это мы деремся?', 29981),
(163100, 'ruRU', '', 'Такая бла-агородная дама, как я, не может просто так взять и... э-э... а кто я? ...ик!', 29981),
(163099, 'ruRU', '', 'Это ведь свидание?', 29981),
(163098, 'ruRU', '', 'А попить что-нибудь есть? Или только выпить... ик!', 29981),
(163097, 'ruRU', '', 'Давай во что-нибудь пош-штреляем!', 29981),
(163096, 'ruRU', '', 'Я слишком трезвая, чтобы ш-штрелять как следует!', 29981),
(163095, 'ruRU', '', 'Где они, я вот им покажу... ик!', 29981),
(163094, 'ruRU', 'Мм-м... какая вкусная душа...', '', 29981),
(163093, 'ruRU', '', 'Ну, держитесь! Сейчас как выпью, как прицелюсь...', 29981),
(163092, 'ruRU', 'А это место ничего так! Где же все медведи?', '', 29981),
(163091, 'ruRU', 'Еще душ! Дай мне еще!', '', 29981),
(163090, 'ruRU', 'Утоли мою жажду!', '', 29981),
(163089, 'ruRU', 'Мне нужны еще души!', '', 29981),
(163088, 'ruRU', 'Накорми меня душами живых!', '', 29981),
(163087, 'ruRU', 'Я жажду новых душ!', '', 29981),
(163086, 'ruRU', 'Мое терпение на исходе. Где мои души?', '', 29981),
(163085, 'ruRU', 'Я изголодался по душам!', '', 29981),
(163084, 'ruRU', 'Дайте мне души!', '', 29981),
(163083, 'ruRU', 'Да, налейте мне еще рома!', 'Да, налейте мне еще рома!', 29981),
(163082, 'ruRU', 'Буду сражаться – за выпивку!', 'Буду сражаться – за выпивку!', 29981),
(163081, 'ruRU', 'И я с вами!', 'И я с вами!', 29981),
(163080, 'ruRU', 'Я за это выпью!', 'Я за это выпью!', 29981),
(163079, 'ruRU', 'Я вовсе не так трезв, как кажется.', '', 29981),
(163078, 'ruRU', 'Надеюсь, в награду я получу выпивку!', '', 29981),
(163077, 'ruRU', 'Что ж... приступим! ...ик!', '', 29981),
(163075, 'ruRU', '', 'Картина складывается весьма пугающая. Встретимся у следующего разрыва. Быть может, он приведет нас в нужный временной период.', 29981),
(163074, 'ruRU', 'Обращайся. Может, когда-нибудь ты займешь место среди нас!', '', 29981),
(163073, 'ruRU', 'Я думаю, у меня получится! Спасибо, господин!', '', 29981),
(163072, 'ruRU', 'У тебя должно быть большое сердце. Соколы чувствуют наши намерения. Если ты будешь честным и добрым, то всякое живое существо станет твоим другом.', '', 29981),
(163071, 'ruRU', 'Каким же это?', '', 29981),
(163070, 'ruRU', 'Да. Чтобы стать сокольничим, нужно долго и упорно тренироваться, но наряду с этим следует обладать еще одним очень важным качеством.', '', 29981),
(163069, 'ruRU', 'Ух ты! Вы сокольничий?!', '', 29981),
(163068, 'ruRU', 'Уинстон!', '', 29981),
(163067, 'ruRU', 'Тогда давай я познакомлю тебя со своим!', '', 29981),
(163066, 'ruRU', 'У него сокол что надо! Я тоже хочу такого друга!', '', 29981),
(163065, 'ruRU', 'Нравится памятник Арому Уэйкресту? Вы знали, что он возглавлял наши войска в сражении с друстами?', '', 29981),
(163064, 'ruRU', '$n, только посмотри на этого здоровяка с соколом!', '', 29981),
(163063, 'ruRU', 'Мы еще встречайт с тобой, $p!', '', 29981),
(163062, 'ruRU', 'Катись отсюда, Шнотц!', '', 29981),
(163061, 'ruRU', 'Вернемся на базу и попробуем узнать, откуда Меггакрут управляет этими штуками.', '', 29981),
(163060, 'ruRU', 'Ах, да. Последний слова? Хм...', '', 29981),
(163059, 'ruRU', 'Итак, на что мы останавливайт?', '', 29981),
(163058, 'ruRU', 'Надеюсь, это так, Шнотц. Терпение Смертокрыла на исходе.', '', 29981),
(163057, 'ruRU', 'Передавайт ему, беспокойство больше не бывайт.', '', 29981),
(163056, 'ruRU', 'Я заканчивайт сам, майн либе. Докладывайт ваш хозяин – проблема больше нет.', '', 29981),
(163055, 'ruRU', 'Аллес, хватит!', '', 29981),
(163054, 'ruRU', 'Ты заплачивайт, $p. Ми тебя будет расстреляйт!', '', 29981),
(163053, 'ruRU', 'Мало? Ты прерывайт моя ритуал, и из-за тебя Кулдык умирайт!', '', 29981),
(163052, 'ruRU', 'Но...', 'Но...', 29981),
(163051, 'ruRU', 'Найн \"но\"! Молчайт! Продолжайт движение!', '', 29981),
(163050, 'ruRU', 'Драй – убивайт мой лучший работник...', '', 29981),
(163049, 'ruRU', 'Цвай – вламывайт в мой операция.', '', 29981),
(163048, 'ruRU', 'Айнц! Ты являйт в Ульдум, как в свой домой...', '', 29981),
(163047, 'ruRU', 'Вот именно за это я и раскошелился! Меггакруту такое не по зубам.', '', 29981),
(163046, 'ruRU', 'Вот это другое дело – только посмотри, сколько азерита! Сколько разрушения... сколько мощи!', '', 29981),
(163045, 'ruRU', 'Просто... да чтоб тебя... работай!', '', 29981),
(163044, 'ruRU', 'Дурацкая жестянка! Я такую кучу денег отвалил, а ты только и можешь, что выставлять меня дураком перед игрушками Меггакрута!', '', 29981),
(163043, 'ruRU', '(Эй, слушай, $p, думаю, тебе лучше за что-нибудь ухватиться, и покрепче)', '', 29981),
(163042, 'ruRU', 'ХА-ХА-ХА! Ну, посмотри, Меггакрут, чем можно разжиться, если у тебя достаточно золота и гоблинов. Эта малышка под завязку залита азеритом!', '', 29981),
(163041, 'ruRU', '*Бзз* Твой робот представляет собой серьезную угрозу – правда, в основном для тебя!', '', 29981),
(163040, 'ruRU', '*Бзз* Твои работнички этого робота вообще тестировали? У нас он бы и первого испытания не прошел!', '', 29981),
(163039, 'ruRU', '*Бзз* Я только что провел сканирование. Ты что, и правда используешь настолько устаревшие детали?!', '', 29981),
(163038, 'ruRU', '*Бзз* Ха-ха! Это просто смешно, Галливикс! Тебе не справиться с моими машинами.', '', 29981),
(163037, 'ruRU', '*Бзз* Твоим гоблинским поделкам никогда не сравниться с шедеврами гномской инженерной мысли!', '', 29981),
(163036, 'ruRU', '*Бзз* Ты сам-то веришь в свою победу, Галливикс? Твоя машина разваливается!', '', 29981),
(163035, 'ruRU', '*Бзз* Жалкое зрелище, Галливикс. Твои самоделки и в подметки не годятся моим творениям!', '', 29981),
(163034, 'ruRU', 'Вот теперь все серьезно... и с азеритом! Нажми большую красную кнопку и посмотрим, на что способна эта штуковина.', '', 29981),
(163032, 'ruRU', 'Когда соберешься атаковать, Авиаш отнесет тебя.', '', 29981),
(163031, 'ruRU', 'Кажется, это работа для меня.', '', 29981),
(163030, 'ruRU', 'Я определенно подумывал о том, чтобы установить это.', '', 29981),
(163029, 'ruRU', 'Возможно, я установил систему самоуничтожения, чтобы Орда не украла эти механизмы!', '', 29981),
(163028, 'ruRU', 'Этот гирокоптер – только для представителей Альянса!', '', 29981),
(163027, 'ruRU', 'Если только эта штука не взорвется.', '', 29981),
(163026, 'ruRU', 'Я лично гарантирую безопасность!', '', 29981),
(163025, 'ruRU', 'Я уже разогрел для тебя гирокоптер!', '', 29981),
(163024, 'ruRU', 'Тебе в голова пришел мысль, что ты смогайт уйти с этим, $p? Хм?', '', 29981),
(163023, 'ruRU', 'Видишь? Все работает. Подумаешь, индикатор на отметке \"пусто\", это же не повод сразу бежать заправляться. У меня никогда не было с этим проблем!', '', 29981),
(163022, 'ruRU', 'Кончилось топливо? Да быть не может, у нас еще полно азерита! Сейчас ты увидишь, на что способна эта штука.', '', 29981),
(163020, 'ruRU', 'Спасибо!', 'Спасибо!', 29981),
(163019, 'ruRU', 'Орда пожалеет, что сюда сунулась!', 'Орда пожалеет, что сюда сунулась!', 29981),
(163018, 'ruRU', 'За Кул-Тирас! За дочь морей!', 'За Кул-Тирас! За дочь морей!', 29981),
(163017, 'ruRU', 'Твоя правда. Я – Вольный гарпунщик. Пора доказать, что я достоин этого звания.', 'Твоя правда. Я – Вольная гарпунщица. Пора доказать, что я достойна этого звания.', 29981),
(163016, 'ruRU', 'Пускай заплатят за то, что они сделали.', 'Пускай заплатят за то, что они сделали.', 29981),
(163015, 'ruRU', 'Я знал, что Телия приведет помощь!', 'Я знала, что Телия приведет помощь!', 29981),
(163014, 'ruRU', 'О чем я только думаю? Это всего лишь еще пара монстров, которых надо убить!', 'О чем я только думаю? Это всего лишь еще пара монстров, которых надо убить!', 29981),
(163013, 'ruRU', 'За лорд-адмирала! За Кул-Тирас!', 'За лорд-адмирала! За Кул-Тирас!', 29981),
(163012, 'ruRU', 'Я – доктор взрывного дела и специалист по литературе. Но знаешь что? Тут ни взрывать, ни читать ничего невозможно, ведь Альянс мне в затылок дышит!', 'Я – доктор взрывного дела и специалист по литературе. Но знаешь что? Тут ни взрывать, ни читать ничего невозможно, ведь Альянс мне в затылок дышит!', 29981),
(163011, 'ruRU', '', 'Моя мать чуть не погибла, когда спасала жителей Дарнаса. Я сделаю все, что смогу, чтобы остановить Орду на Темных берегах.\n\nТакую жестокость просто нельзя оставить безнаказанной.', 29981),
(163010, 'ruRU', 'Я готов вернуться в Лок Модан.', 'Я готова вернуться в Лок Модан.', 29981),
(163009, 'ruRU', 'Как поживаешь?', '', 29981),
(163008, 'ruRU', 'Мне нужен перелет без пересадок на Кель\'данас.', 'Мне нужен перелет без пересадок на Кель\'данас.', 29981),
(163007, 'ruRU', 'Господин жрец моря, вы правда тут живете?', '', 29981),
(163006, 'ruRU', '$n, посмотри в воду! Это мы там летим! Как здорово!', '', 29981),
(163005, 'ruRU', 'Давай посмотрим поближе?', '', 29981),
(163001, 'ruRU', '', 'Смерть приходит ко всем.', 29981),
(163000, 'ruRU', '', '<Кажется, Деларин на вас не смотрит.>', 29981),
(162998, 'ruRU', '', 'Эти темные времена наложили свой отпечаток на каждого из нас. Некоторые уже никогда не смогут от них оправиться. Я выбрала имя, которое отражает то, как я изменилась.', 29981),
(162997, 'ruRU', 'А если что-то сломается, вызовем бригаду техобслуживания. Мои ребята починят все по гарантии абсолютно бесплатно!', '', 29981),
(162995, 'ruRU', 'Они точно не ждут, что мы прилетим в ГМЖС и устроим заварушку!', '', 29981),
(162994, 'ruRU', 'Уф! Шустрая малышка. Только представь, что она сделает с Альянсом!', '', 29981),
(162993, 'ruRU', 'Вернитесь на Тирагардское поморье.', '', 29981),
(162992, 'ruRU', 'Момент. Я пытаюсь понять, какая из кнопок заставит эту штуку летать...', '', 29981),
(162991, 'ruRU', 'Ой, погоди... Кажется, мы летим слишком бы-ыстро-о-о!!!', '', 29981),
(162990, 'ruRU', 'Ага! Поехали. Держись крепче, прокатимся С ВЕТЕРКОМ. Азеритовые технологии, детка!', '', 29981),
(162989, 'ruRU', 'Покажем Альянсу, на что способны гоблинские технологии.\n\nЯ имею в виду, взорвем побольше их солдат.', '', 29981),
(162988, 'ruRU', 'Да, Лиам. Да благоволят тебе волны.', '', 29981),
(162987, 'ruRU', 'Это... вам вода сказала?', '', 29981),
(162983, 'ruRU', '', 'Эй, солдат! Беги к баллисте и прикрой мирных жителей!', 29981),
(162982, 'ruRU', 'Я преклоняюсь перед твоей отвагой, эльфийка, но игра окончена.', '', 29981),
(162981, 'ruRU', 'Но даже если мы расплавим металл, кто выдержит такой жар? Даже в клане Черного Железа?', '', 29981),
(162980, 'ruRU', 'Не бойся, Грумнус. Мои друзья помогут нам решить обе проблемы.', '', 29981),
(162979, 'ruRU', 'Я молюсь о том, чтобы, когда это случится, ты оставался верен своему пути. Если тебе это удастся, ты будешь счастлив, а твоя жизнь обретет смысл.', '', 29981),
(162978, 'ruRU', 'Рано или поздно ты столкнешься со злом. Возможно, ты не станешь таким знаменитым борцом за справедливость, как $n, но тем не менее.', '', 29981),
(162977, 'ruRU', 'Они не захватывали его, дитя. Они мои братья и сестры. Но в их сердцах поселилась тьма.', '', 29981),
(162976, 'ruRU', 'Бранн, я не уверен, что мы сможем перековать доспех. Великую Кузню придется раскалить так, как нам и не снилось.', '', 29981),
(162975, 'ruRU', 'Плохие парни? Почему они захватили ваш дом?', '', 29981),
(162974, 'ruRU', 'И я когда-то хотел того же. Но теперь она в руках тех, кто желает нам зла.', '', 29981),
(162973, 'ruRU', 'Понимаешь ли, доспех раскололся на части... О! Грумнус, у нас гости.', '', 29981),
(162972, 'ruRU', 'Я стараюсь понять, кем же стать, когда вырасту. И еще хотелось посмотреть на скалу, похожую на огромного кальмара!', '', 29981),
(162971, 'ruRU', 'Истинно так, мой юный друг. Что привело тебя в Святилище Штормов?', '', 29981),
(162970, 'ruRU', 'Ух ты! Господин, вы настоящий жрец моря?', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(162969, 'ruRU', 'Разве это не чудо?', '', 29981),
(162955, 'ruRU', '', 'Зандалары надолго запомнят сегодняшний день.\n\nНадеюсь, он положит начало новой эпохе в истории нашего народа.', 29981),
(162954, 'ruRU', 'Скорее всего, в кабинет Эгрима никто не заходил после его смерти.', '', 29981),
(162952, 'ruRU', 'Вольным гарпунщикам наверняка понадобится помощь в ремонте боевой техники, лорд-адмирал. $p, я останусь с тобой.', '', 29981),
(162951, 'ruRU', '', 'Э-э... нам разве не нужны гребцы?', 29981),
(162950, 'ruRU', '', 'Благодарю, госпожа. Ведите нас, лорд-адмирал!', 29981),
(162949, 'ruRU', '', 'Не беспокойся о своем грифоне, кадет. Я прослежу, чтобы о ней позаботились.', 29981),
(162948, 'ruRU', '', 'Да, госпожа. Но... я не могу оставить здесь Буревестницу.', 29981),
(162947, 'ruRU', '', 'Спасибо, мама. Телия, $n – за мной. Встретимся у канала и переправимся на тот берег.', 29981),
(162946, 'ruRU', '', 'Лорена хотела бы, чтобы я отдала вам это. Она всегда с теплотой вспоминала вас и своих братьев, пока служила в Тераморе. Соболезную вашей утрате.', 29981),
(162945, 'ruRU', '', 'Мама, прикажи пехотинцам и медикам готовиться к бою.', 29981),
(162944, 'ruRU', '', 'Я немедленно отправлю их на Мыс Рыбака, Джайна.', 29981),
(162943, 'ruRU', '', 'Мы покажем им, какова цена нападения на Кул-Тирас.', 29981),
(162942, 'ruRU', 'За годы странствий вам попадалось множество загадочных свитков, но ни разу вы не видели ничего подобного.\n\nЗаписи сделаны на незнакомом вам языке, а сам пергамент пронизан зловещей энергией. Должно быть, этот свиток принадлежал |cFF0000FFтому, кто имеет дело с темной магией|r.', '', 29981),
(162941, 'ruRU', 'Этот ящик совершенно пуст. Его вскрыли и забрали все содержимое.\n\nПол Норт был интендантом арены и распоряжался всеми ценностями. Возможно, это преступление было совершено из-за |cFF0000FFденег|r.', '', 29981),
(162940, 'ruRU', 'Пол Норт лежит на столе, в его костлявой груди торчит меч.\n\nПохоже, этот меч и является орудием убийства.\n\nОружие инкрустировано золотом и самоцветами. Тот, кому оно принадлежало, был |cFF0000FFочень богат|r.', '', 29981),
(162939, 'ruRU', 'Ничего себе...', '', 29981),
(162933, 'ruRU', 'Ты попросил Лилиан, чтобы о твоей семье позаботились. Она так и сделала.', '', 29981),
(162932, 'ruRU', 'Это... хорошо. Но как? Перед моей смертью... то есть, превращением... мы разорились.', '', 29981),
(162931, 'ruRU', 'Твоя семья в порядке. Жена купила небольшой домик на Заставе Арома в Друстваре, ваши дети не голодают.', '', 29981),
(162924, 'ruRU', 'Да. Больше всего на свете.', '', 29981),
(162923, 'ruRU', 'Разве мудро цепляться за прошлую жизнь? Ты на самом деле хочешь знать?', '', 29981),
(162922, 'ruRU', 'Рексар, погоди. Есть новости от моей семьи? У них все хорошо?', '', 29981),
(162921, 'ruRU', 'Ты хорошо постарался, Зеллинг. До встречи.', '', 29981),
(162920, 'ruRU', 'Готово. Пойдем – надо проведать Мишу и Зеллинга.', '', 29981),
(162919, 'ruRU', 'Неферсет будет разрушен! В атаку!!!', '', 29981),
(162918, 'ruRU', 'Ха... Ха... остальные придут... и отомстят вам всем...', '', 29981),
(162915, 'ruRU', 'Ну давай! Посмотрим, сможешь ли ты заставить меня ответить!', '', 29981),
(162913, 'ruRU', 'Я заставлю убийцу Дэлина ответить за все, несмотря ни на что!', '', 29981),
(162912, 'ruRU', 'Ты прятался в своей жестянке, пока твои соратники умирали, трус. По крайней мере у Дэлина хватило храбрости сражаться вместе со своими воинами!', '', 29981),
(162911, 'ruRU', '', 'Все на берег, быстрее!', 29981),
(162910, 'ruRU', '', 'Тьма сгустилась над берегом.', 29981),
(162909, 'ruRU', 'Наши соратники готовы. Давайте начнем.', 'Наши соратники готовы. Давайте начнем.', 29981),
(162904, 'ruRU', 'Не буду скрывать. Из этого похода вернутся не все. Орда должна поверить, что атака настоящая.', '', 29981),
(162903, 'ruRU', '', 'Лорд-адмирал! Орда напала на верфи Мыса Рыбака!', 29981),
(162902, 'ruRU', 'Спасибо за то, что не пришлось тебя долго ждать. Король Ринн хочет поговорить с нами, прежде чем мы пойдем дальше.', '', 29981),
(162901, 'ruRU', 'Я готов слушать, главнокомандующий. [Начало RTC]', 'Я готова слушать, главнокомандующий. [Начало RTC]', 29981),
(162900, 'ruRU', 'Мои ударные отряды окажут вам поддержку, а инженеры Меггакрута приготовят для Орды несколько сюрпризов.', '', 29981),
(162899, 'ruRU', 'Наша цель – оттянуть их силы к Назмиру. Мы нанесем точечные удары и спровоцируем троллей крови.', '', 29981),
(162898, 'ruRU', 'Нападение на Дазар\'алор подорвет отношения Орды с империей Зандалари.', '', 29981),
(162896, 'ruRU', '', 'Звучит чудесно, мама. Знаешь... как же хорошо снова оказаться дома.', 29981),
(162895, 'ruRU', '', 'Ты никогда не будешь одна, дочка. Давай найдем тихое уютное место и поговорим. Ты всегда любила библиотеку. Хочешь снова подышать пылью вековых фолиантов?', 29981),
(162894, 'ruRU', '', 'В мире кошмаров... были воспоминания, от которых я долго пыталась избавиться. Но когда я увидела тебя, я... поняла, что не должна сражаться с тьмой в одиночку.', 29981),
(162893, 'ruRU', '', 'Когда мы были во Фросе, я кое-что видела. События, что причинили тебе боль. Не хочу бередить старые раны, но я должна знать. Тебе... уже легче?', 29981),
(162892, 'ruRU', '', 'Столько погибших. Герои... мирные семьи... жертвы ненависти одного безумца.', 29981),
(162891, 'ruRU', '', 'Нет, я не об отце. Джайна, я знаю, что произошло с городом. Нападение Орды. Взрыв.', 29981),
(162890, 'ruRU', '', 'О Тераморе? Прости, мама. Я не хотела тревожить память об...', 29981),
(162889, 'ruRU', '', 'Такие слова всегда даются нелегко. Джайна... Можно тебя кое о чем спросить?', 29981),
(162888, 'ruRU', 'Темный фараон повержен! Его бессмертные колоссы валятся, как кегли!', '', 29981),
(162887, 'ruRU', 'Ух ты, спасибо, господин пират!', '', 29981),
(162886, 'ruRU', 'С этим не поспоришь. У меня есть еще одна, держи. А теперь иди и учись дальше. Не вырастай слишком быстро.', '', 29981),
(162885, 'ruRU', 'Хорошо – если мои воины с вами не справляются, убью вас сам! За Дэлина Праудмура!', '', 29981),
(162884, 'ruRU', 'Но у вас все равно отличная шляпа!', '', 29981),
(162883, 'ruRU', 'Эй, малыш. В жизни пирата не все так радужно. У тебя никогда не будет теплого очага и мягкой кровати. А всякие важные господа будут называть тебя никчемным пройдохой!', '', 29981),
(162882, 'ruRU', 'Когда я вырасту, то стану таким, как вы! Буду плевать на правила! И уйду в море на поиски приключений!', '', 29981),
(162881, 'ruRU', 'Я... г-хм... да.', '', 29981),
(162880, 'ruRU', 'У вас настоящая шляпа и все такое! Вы такой крутой! Вы плаваете по морям, размахиваете саблей и ищете зарытые сокровища?', '', 29981),
(162879, 'ruRU', 'Ну конечно! Чего надо?', '', 29981),
(162878, 'ruRU', 'Вы настоящий пират?', '', 29981),
(162877, 'ruRU', 'Эй, кроха! А ты что здесь делаешь? Тут не место для таких малышей, как ты!', 'Ух ты, $n! Ты только посмотри, как здесь здорово!', 29981),
(162876, 'ruRU', '', 'А-а-а! Надо выбираться отсюда!', 29981),
(162875, 'ruRU', '', 'Да-да, босс!', 29981),
(162866, 'ruRU', 'Мне все равно, готов крошшер или нет. Немедленно активируйте режим уничтожения!', '', 29981),
(162865, 'ruRU', 'Ух ты, $n! Ты только посмотри, как здесь здорово!', '', 29981),
(162861, 'ruRU', 'РЕЖИМ АВТОПИЛОТА: ВКЛЮЧЕН. УБИТЬ ВСЕХ ВРАГОВ.', '', 29981),
(162860, 'ruRU', 'Чертеж пусть побудет у меня. Не волнуйся, мои стражи никого к нему не подпустят.', '', 29981),
(162839, 'ruRU', 'Ака\'магош. Мы все сильнее, а их все меньше!', '', 29981),
(162838, 'ruRU', 'Альянс продолжает стягивать сюда войска. Они хотят взять нас числом... а ты возьми и перебей их!', '', 29981),
(162837, 'ruRU', 'Иначе и быть не могло. Лок\'тар!', '', 29981),
(162835, 'ruRU', '', 'Нужно спешить. Шепот становится все громче и настойчивее.', 29981),
(162834, 'ruRU', '', 'Я так рада, что твой разум открыт ко всем возможностям.', 29981),
(162833, 'ruRU', '', 'Интересный поворот. Я даже не знала, что такое возможно.', 29981),
(162814, 'ruRU', 'Вперед!', '', 29981),
(162813, 'ruRU', 'Приходи снова через пару лет. Если будешь хорошо тренироваться, запросто пройдешь испытание.', '', 29981),
(162812, 'ruRU', '', 'Уйди со своими глупостями, Бадд. Замолчи!!!', 29981),
(162811, 'ruRU', 'Ух ты! $n, посмотри на меня!', '', 29981),
(162809, 'ruRU', 'Посмотри на меня!!! Я манатавр!!!', '', 29981),
(162799, 'ruRU', 'Благодаря твоей помощи мы получили преимущество. Отличная работа, |3-6($c).', '', 29981),
(162798, 'ruRU', 'Победа оказалась на нашей стороне. Спасибо тебе!', '', 29981),
(162797, 'ruRU', 'Хочешь покататься на грифоне? Я могу это устроить.', '', 29981),
(162796, 'ruRU', 'Вот это круто! Когда-нибудь я тоже стану таким, как вы. Буду летать на грифоне и все такое!', '', 29981),
(162795, 'ruRU', 'Ха! Ну конечно. Мы, Сорвиголовы, всегда так делаем!', '', 29981),
(162794, 'ruRU', 'Наги разрушают город и приносят в жертву жителей! Останови их, пока не погибло еще больше невинных!', '', 29981),
(162793, 'ruRU', 'Наги приготовились к войне! Останови их, пока не пострадали невинные!', '', 29981),
(162792, 'ruRU', 'Вы такой крутой! А правда, что вы можете отдубасить вендиго со связанными руками?', '', 29981),
(162791, 'ruRU', 'А то!', '', 29981),
(162790, 'ruRU', 'Ух ты! Здравствуйте! Вы один из Сорвиголов?', '', 29981),
(162789, 'ruRU', 'Малютка, что ты делаешь здесь, в горах?', '', 29981),
(162788, 'ruRU', '$n, гляди! Надо же так управляться с грифоном!', '', 29981),
(162787, 'ruRU', 'Неординарный подход, прямо скажем. Хотя, думаю, в дыму пожаров никто, кроме ваших силуэтов, ничего и не увидит.', '', 29981),
(162786, 'ruRU', 'Солнце прекрасно. Оно как огромное священное сияние!', '', 29981),
(162785, 'ruRU', '', 'Так за что мне взяться?', 29981),
(162784, 'ruRU', 'Ух ты!', '', 29981),
(162783, 'ruRU', '', 'Хотя должна добавить – единственный план, которым мы на сегодня располагаем.', 29981),
(162782, 'ruRU', 'О, приветствую тебя. Я останусь здесь – буду размышлять о солнце.', '', 29981),
(162781, 'ruRU', 'Я – Сулар Андоральский, приверженец Света.', '', 29981),
(162780, 'ruRU', 'Делорми, я готов. Верни меня в мое время.', 'Делорми, я готова. Верни меня в мое время.', 29981),
(162779, 'ruRU', '', 'Это самый безумный, идиотский... и смешной план, какой ты когда-либо предлагал, Бадд!', 29981),
(162778, 'ruRU', 'Наконец-то я свободен... Ваша награда, друзья, будет достойной.', '', 29981),
(162774, 'ruRU', '', 'Ткань времени уцелела... но ты не сможешь больше ее латать, ткач Делорми...', 29981),
(162773, 'ruRU', '', 'Наши \"я\" – не слабость... а ты – не наша судьба!', 29981),
(162772, 'ruRU', '', 'Ножницы смерти так просто режут все, что бренно. Слабость нужно вырезать.', 29981),
(162771, 'ruRU', '', 'Но наша судьба – ее уничтожить. Ткань непрочна, сшивать ее бесполезно.', 29981),
(162770, 'ruRU', '', 'Делорми, довольно! Наша цель – сохранить ткань времени!', 29981),
(162769, 'ruRU', '', 'Я поведала тебе все, что желала. А теперь уходи и не возвращайся.', 29981),
(162768, 'ruRU', 'Значит тот, кто нашептал мне имя, – не тот, кто потом меня вернул?', '', 29981),
(162767, 'ruRU', '', 'Тебя коснулась рука доблести. Подобные силы не вмешиваются в дела земных владык.', 29981),
(162766, 'ruRU', 'Но кто владеет такой силой? Не тот ли, кто заставил меня назвать Сильвану вождем?', '', 29981),
(162765, 'ruRU', '', 'Ты больше не простой дух, темный охотник. Я не смогла бы сотворить что-то, подобное тебе.', 29981),
(162764, 'ruRU', 'Мой дух вернулся с Той Стороны. Это твоих рук дело, королева валь\'кир?', '', 29981),
(162763, 'ruRU', '', 'Хорошо, вы двое можете подойти. Но если обманете, я покараю вас небытием.', 29981),
(162762, 'ruRU', 'Эйир, говори со мной, если с другими не желаешь.', '', 29981),
(162761, 'ruRU', '', 'Постойте... Жрица Бвонсамди посмела войти в мои чертоги?!', 29981),
(162760, 'ruRU', '', 'Но время не ждет. Отправляйся к берегам Вол\'дуна. Там мы найдем третью реликвию.', 29981),
(162759, 'ruRU', '', 'Слуги Королевы-банши, уходите или примите смерть.', 29981),
(162758, 'ruRU', 'Уходите или оставайтесь навеки. Выбирайте.', '', 29981),
(162757, 'ruRU', '', 'Это мне не нравится. Уходим... скорее!', 29981),
(162756, 'ruRU', 'Но ты не проклятый и не нежить. А значит, тебе здесь не место. Уходи сейчас же.', '', 29981),
(162755, 'ruRU', 'Это ты не отпускаешь мою душу из этого мира? Хочешь держать меня в плену, как нежить из Плети?', '', 29981),
(162754, 'ruRU', 'Твоя душа побывала на Той Стороне и вернулась обратно. Тебя изменили сильнее, чем думаешь.', '', 29981),
(162753, 'ruRU', 'А кто тогда держит мой дух в этом мире? Не ты?', '', 29981),
(162752, 'ruRU', 'Королева-банши угрожает равновесию. Я к этому непричастен.', '', 29981),
(162751, 'ruRU', 'Король-лич. Умирая, я слышал голос... он велел назвать Сильвану вождем... Это был ты?', '', 29981),
(162750, 'ruRU', 'Должно же быть какое-то равновесие! К тому же, плутовка оставляет убитых себе. Нет, такой вождь – не друг Бвонсамди.', '', 29981),
(162749, 'ruRU', 'Зачем мне Королева-банши во главе Орды? Нет-нет-нет. Я, конечно, люблю войну и смерть, но Сильвана, прямо скажем... перегибает палку.', '', 29981),
(162748, 'ruRU', 'Следи за языком, говядина... а не то мигом к папе отправишься.', '', 29981),
(162747, 'ruRU', 'Отвечай! Это ты заставил Вол\'джина назвать Сильвану вождем?', '', 29981),
(162746, 'ruRU', 'Что? Нет. Нет. Нет-нет-нет-нет. Таланджи, все не так!', '', 29981),
(162745, 'ruRU', '', 'Лоа смерти, твой слуга Вол\'джин взывал к тебе. Но ты отказался его выслушать.', 29981),
(162744, 'ruRU', 'А-а-а, это снова ты. Что, дух Вол\'джина нашелся? Или хочешь заключить сделку?', '', 29981),
(162743, 'ruRU', 'А правда может быть в том, что Сильвану выбрали не лоа, а кто-то еще более могущественный.', '', 29981),
(162742, 'ruRU', 'Он утащил меня куда-то, но тут память отказывает мне. Скрывает от меня правду, чтобы я не рассказал другим.', '', 29981),
(162741, 'ruRU', 'Я долго взывал к Бвонсамди. То ли он меня не услышал... то ли не хотел отвечать.', '', 29981),
(162740, 'ruRU', 'Я и сейчас их не чувствую. Голоса лоа умолкли. Ни звука, понимаешь?', '', 29981),
(162739, 'ruRU', 'Как будто лоа оставили меня.', '', 29981),
(162738, 'ruRU', 'Что-то неладное случилось в тот день. Я не смог отбить простой удар...', '', 29981),
(162737, 'ruRU', 'Но там был кто-то другой. Прятался в тени. Кто-то очень сильный.', '', 29981),
(162736, 'ruRU', 'Думал, там меня ждут старина Бвонсамди, Шадра, Хир\'ик... Кто-то из лоа.', '', 29981),
(162735, 'ruRU', 'Я помню, как был при смерти. Помню, как видел Ту Сторону.', '', 29981),
(162734, 'ruRU', 'Мы пытались... уберечь вас... от правды...', '', 29981),
(162733, 'ruRU', 'Вы нажили себе... грозного врага...', '', 29981),
(162732, 'ruRU', 'Повелитель требует молчания.', '', 29981),
(162731, 'ruRU', 'Повелителю... это не понравится...', '', 29981),
(162730, 'ruRU', 'Вы ищете запретное знание.', '', 29981),
(162729, 'ruRU', 'Верните темного охотника.', '', 29981),
(162728, 'ruRU', 'Отступите.', '', 29981),
(162727, 'ruRU', 'Древесина!', 'Древесина!', 29981),
(162726, 'ruRU', 'Я тебя в куски изрублю!', 'Я тебя в куски изрублю!', 29981),
(162725, 'ruRU', '', 'Я остановлю ее. Ради всех нас. Покойтесь с миром, магистр.', 29981),
(162724, 'ruRU', '', 'Ты должна остановить ее... спасти нас... и спасти себя...', 29981),
(162723, 'ruRU', '', 'Успокойтесь, магистр. Скоро все закончится.', 29981),
(162722, 'ruRU', '', 'Делорми... из бесконеч... она была слишком сильна...', 29981),
(162721, 'ruRU', 'Ваши творцы создали несовершенную расу – вы подвержены проклятию плоти! Подарок лорда Смертокрыла вернет вам первородное совершенство!', '', 29981),
(162720, 'ruRU', 'Нет... гаечный уб3р-ключ принадлежит Торговой компании...', '', 29981),
(162719, 'ruRU', 'Вы последние здравомыслящие представители своего племени. В награду за спасение принца Надуна вручаю подарок, который принадлежит вам по праву!', '', 29981),
(162705, 'ruRU', '', 'Ткань времени будет разорвана. Все швы разойдутся.', 29981),
(162704, 'ruRU', '', 'Хватит! Хватит ее мучить!', 29981),
(162703, 'ruRU', '', 'Все нити нужно оборвать. Делорми должна умереть.', 29981),
(162702, 'ruRU', '', 'Готово! А этот Гризикс молодец.', 29981),
(162701, 'ruRU', 'Память... Тени отняли ее у меня. Тени... они уже здесь! Берегитесь!', '', 29981),
(162700, 'ruRU', 'Это Бвонсамди? Он хотел от нее новых смертей?', '', 29981),
(162699, 'ruRU', 'Юный друг. Смерть такая... темная. Память моя не та, что прежде.', '', 29981),
(162698, 'ruRU', 'Я должен знать... чей голос заставил тебя назвать ее вождем. Что это был за дух?', '', 29981),
(162697, 'ruRU', 'Но потом... Она сделала все, чтобы разобщить Орду и запятнать ее честь.', '', 29981),
(162696, 'ruRU', '', 'Спасибо, $n. Я сейчас же приступлю к расшифровке.', 29981),
(162695, 'ruRU', 'Сильвана привела нас к победе в войне с Легионом.', '', 29981),
(162694, 'ruRU', 'Бейн... У тебя сердце твоего отца. Хорошо, что демоны тебя не забрали.', '', 29981),
(162693, 'ruRU', 'Вол\'джин! Ты ли это, старый друг?', '', 29981),
(162692, 'ruRU', 'Таланджи... Сильный у тебя голос.', '', 29981),
(162691, 'ruRU', '', 'Вол\'джин, сын Сен\'джина, бывший вождь Орды... Услышь мой голос и явись нам!', 29981),
(162690, 'ruRU', 'Задание... провалено...', 'Задание... провалено...', 29981),
(162689, 'ruRU', '', 'Хватит умирать!', 29981),
(162688, 'ruRU', '', 'Баланс.', 29981),
(162687, 'ruRU', '', 'Спокойствие.', 29981),
(162686, 'ruRU', 'Это был мой любимый крошшер! Ты за это заплатишь!', 'Это был мой любимый крошшер! Ты за это заплатишь!', 29981),
(162685, 'ruRU', 'Не дергайся, я тебя подлечу.', '', 29981),
(162684, 'ruRU', 'Сейчас я тебя подлатаю.', '', 29981),
(162683, 'ruRU', 'Сетралисс, прости меня... Я вижу лишь тьму.', '', 29981),
(162682, 'ruRU', 'Система в критическом состоянии! Запуск процедуры катапультирования!', 'Система в критическом состоянии! Запуск процедуры катапультирования!', 29981),
(162681, 'ruRU', 'Обнаружены враги, вступаю в бой!', 'Обнаружены враги, вступаю в бой!', 29981),
(162680, 'ruRU', '', 'У лоа большая голоа.', 29981),
(162679, 'ruRU', '', 'Я хочу домашнюю вульперу! Они такие пушистые!', 29981),
(162678, 'ruRU', '', 'Почему тролли Черного Копья так горбятся?', 29981),
(162677, 'ruRU', '', 'Давай поиграем! Ты – это ты, а я – Бвонсамди! Берегись, а не то я съем твою душу!', 29981),
(162676, 'ruRU', '', 'Что это у тебя на клинке? Кровь? Можно потрогать?', 29981),
(162675, 'ruRU', '', 'Почему почти у всех в Орде больше пальцев на ногах, чем у нас?', 29981),
(162674, 'ruRU', '', 'Если держаться подальше от вуду, то кто будет делать вуду?', 29981),
(162673, 'ruRU', '', 'Тебе когда-нибудь отрезали пальцы? А заново они вырастали?', 29981),
(162672, 'ruRU', 'Можно мне взять Ксал\'атат? Этот клинок многое значит для меня.', 'Можно мне взять Ксал\'атат? Этот клинок многое значит для меня.', 29981),
(162671, 'ruRU', '', 'Ну, возможно, я позволю тебе забрать его. Мне кажется, все это из-за него. Или, по крайней мере, он так сказал. Я упоминала, что он говорящий?', 29981),
(162670, 'ruRU', 'Как у морей может быть дочь?', '', 29981),
(162669, 'ruRU', 'Если бы лошади носили носки, то они бы их надевали под или на подковы?', '', 29981),
(162668, 'ruRU', '', 'Хм? Клинок Темной Империи? Да, недавно я его видела.', 29981),
(162667, 'ruRU', '', 'Это совершенно ненормально.', 29981),
(162666, 'ruRU', 'Почему нос бежит – у него же нет ног?', '', 29981),
(162665, 'ruRU', 'Если Кул-Тирас вырастет, он станет континентом?', '', 29981),
(162664, 'ruRU', 'Я слышал, в Гилнеасе люди превращаются в волков. Они что, все друиды?', '', 29981),
(162663, 'ruRU', 'Почему эльфы Бездны фиолетовые? Они что, вдохнули и выдохнуть не могут?', '', 29981),
(162662, 'ruRU', 'Почему гномы перестают расти?', '', 29981),
(162661, 'ruRU', 'Если привязать воздушный шарик к якорю, он полетит вверх или вниз?', '', 29981),
(162660, 'ruRU', 'Тебе нужна твоя драгоценная технология? Я уничтожу тебя твоими же творениями!', '', 29981),
(162659, 'ruRU', 'О, я знаю, что такое ваша \"честь\" . Я в чужие игры не играю. Сейчас танк зарядится, и тебе конец!', '', 29981),
(162658, 'ruRU', 'Ты грозишь мне, прячась за броней своей машины. Выходи и сражайся с честью!', '', 29981),
(162657, 'ruRU', 'Рексар, пес Орды, убийца Дэлина Праудмура! Мои солдаты прикончат тебя!', '', 29981),
(162655, 'ruRU', 'Может, найдем место поспокойнее – например, таверну?', '', 29981),
(162654, 'ruRU', 'Вижу тролля вон там, возле доков!', '', 29981),
(162653, 'ruRU', 'Кажется, я перебрал: мерещатся какие-то огромные зеленые куры.', '', 29981),
(162652, 'ruRU', 'Эй, куда все подевались?', '', 29981),
(162651, 'ruRU', 'Ты за это заплатишь!', 'Ты за это заплатишь!', 29981),
(162650, 'ruRU', '', 'Чую гномов поблизости. Надо бы их взорвать, пока они что-нибудь не изобрели!', 29981),
(162649, 'ruRU', '', 'Мы превысили бюджет! Чините взорвавшиеся мины – и снова пускайте их в атаку!', 29981),
(162648, 'ruRU', '', 'Какая-нибудь из этих мин обязательно пробьет их бункер!', 29981),
(162647, 'ruRU', '', 'Больше мин! Больше мин! Все это очень дорого нам обходится.', 29981),
(162646, 'ruRU', '', 'Тебя ждет слава, помни об этом!', 29981),
(162645, 'ruRU', 'Еще несколько минут, и натравим этих ботов на врага!', '', 29981),
(162644, 'ruRU', 'Когда мы активируем эту штуку, победа будет у нас в кармане!', '', 29981),
(162643, 'ruRU', 'Гоблинам этих роботов не остановить!', '', 29981),
(162642, 'ruRU', 'Почти готово! Скоро мои новые боты дадут им отпор!', '', 29981),
(162641, 'ruRU', '', 'Берегись, он всегда был раздражительным. Сомневаюсь, что его характер улучшился за последние века.', 29981),
(162640, 'ruRU', '', 'Наша встреча – не простое совпадение, $n. Тебе было суждено найти меня. А мне – тебя.', 29981),
(162639, 'ruRU', '', 'Вижу, тебе это нравится. Если захочешь, мы всегда можем найти новых жертв.', 29981),
(162638, 'ruRU', 'Открыть огонь! Ботолом их остановит!', '', 29981),
(162637, 'ruRU', 'Несколько разрядов из ботолома, и нападение закончится!', '', 29981),
(162636, 'ruRU', 'Гоблинские технологии – ничто против моего ботолома!', '', 29981),
(162635, 'ruRU', 'Это отличный шанс испытать мой новый ботолом!', '', 29981),
(162634, 'ruRU', 'Я чувствую на себе их взгляды. Они наблюдают за нами. Где же подкрепление?', '', 29981),
(162633, 'ruRU', 'Весьма неподходящий день для нервного срыва...', '', 29981),
(162632, 'ruRU', 'Защищайте периметр! Нельзя никого подпускать к этому грузу!', '', 29981),
(162631, 'ruRU', 'Поторопитесь уже с этим колесом! Мы тут как на ладони!', '', 29981),
(162630, 'ruRU', 'Что ты знаешь о зандаларах?', 'Что ты знаешь о зандаларах?', 29981),
(162629, 'ruRU', 'Для меня честь присутствовать на церемонии Таланджи. Мы с ней не раз говорили о будущем зандаларов и ее собственном. Надеюсь, она поймет, что наши народы связаны. Вместе мы будем намного сильнее, чем порознь.\n\nНо и твоей заслуги я умалять не стану. Быть может, там, где я не смог ее убедить, справишься ты.', '', 29981),
(162628, 'ruRU', 'Спасите своего капитана, ребята! Спасите... меня...', 'Спасите своего капитана, ребята! Спасите... меня...', 29981),
(162627, 'ruRU', 'Три? Он бы и пять легко отвалил... Балда!', '', 29981),
(162626, 'ruRU', 'Полундра, салаги!', 'Полундра, салаги!', 29981),
(162623, 'ruRU', '', 'Кроме того, благодаря твоим усилиям, Орда заручилась поддержкой зандаларского флота. Осталось сломить дух врага... и победа будет за нами.', 29981),
(162621, 'ruRU', '', 'Он станет ценнейшим оружием в войне против Кул-Тираса. Кинжалом, который мы вонзим в сердца Праудмуров... когда придет время.', 29981),
(162619, 'ruRU', '', 'Вот он, плод твоих трудов. Дерек Праудмур... тот самый труп, поднятый тобой с морского дна.', 29981),
(162617, 'ruRU', 'О чем ты хотела поговорить со мной, вождь?', 'О чем ты хотела поговорить со мной, вождь?', 29981),
(162616, 'ruRU', '', 'Дерек Праудмур... да, ты нам еще послужишь.', 29981),
(162615, 'ruRU', '', 'Убить хрономанта... что-то мне не по себе.', 29981),
(162614, 'ruRU', '', 'Я видела эту версию себя только в самых далеких закоулках времени. Тот, кто это сделал, должно быть, обладает огромной силой.', 29981),
(162613, 'ruRU', '', 'Аран\'этил, Делорми. Совсем иссохла... Никому не пожелала бы такой судьбы.', 29981),
(162612, 'ruRU', '', 'И снова я. Судя по ранениям, ее привели сюда насильно.', 29981),
(162611, 'ruRU', '', 'Может, найдутся еще какие-нибудь зацепки.', 29981),
(162610, 'ruRU', '', 'Ничего не понимаю. Я не должна находиться вне времени... и уж точно не мертвой.', 29981),
(162609, 'ruRU', '', 'Этот труп. Похоже, это... я.', 29981),
(162608, 'ruRU', '', 'Почему так долго?', 29981),
(162607, 'ruRU', '', 'О, взгляни, как они все падают. Какая жалость.', 29981),
(162606, 'ruRU', '', 'Его голос слышится слабо, но все же различим.', 29981),
(162605, 'ruRU', 'Забирай сундук! Только не убивай меня!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(162604, 'ruRU', '', 'Я слышу зов океана. Реликвия близко, на этом холме.', 29981),
(162603, 'ruRU', '', 'Все это действительно весело, но у нас есть более важные дела.', 29981),
(162602, 'ruRU', '', 'Чем ближе ты подбираешься, тем дальше она ускользает.', 29981),
(162601, 'ruRU', '', 'Твоя сила поразительна!', 29981),
(162600, 'ruRU', '', 'Поднять щиты!', 29981),
(162599, 'ruRU', 'Я... чувствую... слабость...', 'Я... чувствую... слабость...', 29981),
(162598, 'ruRU', 'Катрианна, ко мне! Расправимся с этими бандитами!', 'Катрианна, ко мне! Расправимся с этими бандитами!', 29981),
(162597, 'ruRU', 'Всем заинтересованным лицам!\n\nНадеюсь, вы вняли предупреждению. Чертеж гаечного уб3р-ключа остается интеллектуальной собственностью Торговой компании.\n\nИ еще: даже не думайте искать нас в развалинах к юго-востоку отсюда. Вы не найдете там ничего, кроме камней. \n\n\n Начальник экспедиции Маккормик', '', 29981),
(162596, 'ruRU', '<Подходя к пляжу вы видите бездыханное тело Хакермана Гризикса. Рядом с телом кто-то оставил записку. >', '', 29981),
(162595, 'ruRU', 'Прочесть записку.', 'Прочесть записку.', 29981),
(162594, 'ruRU', 'Дори\'тур пикирует с высоты, чтобы доставить вам сообщение!', 'Дори\'тур пикирует с высоты, чтобы доставить вам сообщение!', 29981),
(162593, 'ruRU', 'Я думал, мои подчиненные разобрались с вами еще на берегу, воришки! Придется все делать самому!', '', 29981),
(162592, 'ruRU', 'Интересно, сколько за них можно получить кокосов.', '', 29981),
(162591, 'ruRU', 'Нельзя, чтобы чертеж нашли. Гаечный уб3р-ключ будет наш!', '', 29981),
(162590, 'ruRU', 'От нас не спрячется ни Альянс, ни его жалкие приспешники.', '', 29981),
(162589, 'ruRU', 'Кул-Тирас падет! Бейтесь за вождя! Лок-тар огар!', '', 29981),
(162588, 'ruRU', 'Поверить не могу, что эти змееголовые напали на нас. Скорее! Господин Разданк не потерпит провала!', '', 29981),
(162587, 'ruRU', 'Эй вы, хобгоблины, не спать! Этот крошшер должен был быть готов еще вчера!', '', 29981),
(162586, 'ruRU', '', 'Я заперла его в том сундуке. Он все время мне что-то говорил.', 29981),
(162585, 'ruRU', 'Я получил \"дар\". Ты знаешь, как от него избавиться?', 'Я получила \"дар\". Ты знаешь, как от него избавиться?', 29981),
(162584, 'ruRU', '', 'Сейчас я немного занята.', 29981),
(162583, 'ruRU', 'Еще один сорванный план врага, еще один шаг к победе.', '', 29981),
(162582, 'ruRU', 'Судя по докладам разведчиков, Орда здесь что-то затеяла. Позаботься, чтобы их планы провалились.', '', 29981),
(162581, 'ruRU', 'Жизнь за Орду!', 'Жизнь за Орду!', 29981),
(162580, 'ruRU', 'Хватит тренировок, пора применить свои навыки на практике!', 'Хватит тренировок, пора применить свои навыки на практике!', 29981),
(162579, 'ruRU', 'Это действие будет стоить вам 1 |TInterface\\ICONS\\INV_Enchanting_80_VeiledCrystal.blp:15|t затуманенный кристалл. Хотите продолжить?', '', 29981),
(162578, 'ruRU', 'Когда мы вступили в Орду, я не думал, что буду заниматься... чем-то подобным.', 'Когда мы вступили в Орду, я не думала, что буду заниматься... чем-то подобным.', 29981),
(162577, 'ruRU', 'Знаешь, я ведь мог бы просто создать иллюзию... зачем мы прячемся?', 'Знаешь, я ведь могла бы просто создать иллюзию... зачем мы прячемся?', 29981),
(162576, 'ruRU', 'Что-то здесь... не так...', 'Что-то здесь... не так...', 29981),
(162575, 'ruRU', 'Невероятно... может, это и правда сработает.', 'Невероятно... может, это и правда сработает.', 29981),
(162574, 'ruRU', 'Поверить не могу, что мы этим занимаемся.', 'Поверить не могу, что мы этим занимаемся.', 29981),
(162573, 'ruRU', 'Ты серьезно? Думаешь, это и правда сработает?', 'Ты серьезно? Думаешь, это и правда сработает?', 29981),
(162572, 'ruRU', 'Детская неделя еще не закончилась... Можно мне еще одну кул-тирасскую детскую свистульку?', 'Детская неделя еще не закончилась... Можно мне еще одну кул-тирасскую детскую свистульку?', 29981),
(162571, 'ruRU', 'Тихо! Они уже почти в ловушке.', 'Тихо! Они уже почти в ловушке.', 29981),
(162570, 'ruRU', 'Помнишь, что я тебе говорил? Видишь? Сейчас капкан захлопнется!', 'Помнишь, что я тебе говорила? Видишь? Сейчас капкан захлопнется!', 29981),
(162569, 'ruRU', 'Тсс! Говори потише. А то они нас заметят!', 'Тсс! Говори потише. А то они нас заметят!', 29981),
(162565, 'ruRU', 'Меня атакуют! Отвлеки врага, Мотега! Быстрее, тупая ты корова!', 'Меня атакуют! Отвлеки врага, Мотега! Быстрее, тупая ты корова!', 29981),
(162563, 'ruRU', 'Зунджо нужен лекарь!', 'Зунджо нужен лекарь!', 29981),
(162562, 'ruRU', 'Дурацкий... бык...', 'Дурацкий... бык...', 29981),
(162557, 'ruRU', 'Мой молот... подвел меня!', 'Мой молот... подвел меня!', 29981),
(162555, 'ruRU', 'Араш-фолас...', 'Араш-фолас...', 29981),
(162545, 'ruRU', '', 'Хотя Кул-Тирас долгое время оставался в изоляции, война тем не менее нас коснулась.\n\nСироты, о которых мы заботимся, потеряли семьи при разных трагических обстоятельствах: пираты, ведьмы, пожары, дикие звери... Мы делаем все возможное, чтобы дети чувствовали себя здесь как дома. Многие остаются с нами, пока не вырастут, мы обучаем их и стараемся подыскать профессию, которая могла бы в дальнейшем прокормить наших воспитанников.\n\nДетская неделя – наш любимый праздник. Здорово, когда такие искатели приключений, как ты, могут показать деткам чудеса нашего мира.', 29981),
(162544, 'ruRU', 'Ладно, парни, пора повеселиться!', 'Ладно, парни, пора повеселиться!', 29981),
(162543, 'ruRU', 'Еще одна игрушка для Зунджо!', 'Еще одна игрушка для Зунджо!', 29981),
(162542, 'ruRU', 'Назад, Зунджо! Этот – мой!', 'Назад, Зунджо! Этот – мой!', 29981),
(162541, 'ruRU', '', 'Я могла бы стать... капитаном...', 29981),
(162540, 'ruRU', '', 'Неужели старина Флэпс погиб напрасно...', 29981),
(162539, 'ruRU', '', 'Воры! Сабли к бою, ребятки!', 29981),
(162538, 'ruRU', '', 'Ах ты трюмная крыса!', 29981),
(162537, 'ruRU', '', 'Мы отбили этот трезубец у огромного морского чудища! Думаешь, ты сможешь его украсть?', 29981),
(162536, 'ruRU', '', 'Эй! Не трожь мое добро!', 29981),
(162535, 'ruRU', 'Бвонсамди... будь ты проклят!', 'Бвонсамди... будь ты проклят!', 29981),
(162534, 'ruRU', 'Зандалары передают привет!', 'Зандалары передают привет!', 29981),
(162533, 'ruRU', '', 'Мы можем приступать?', 29981),
(162532, 'ruRU', 'Я готов войти в разрыв во времени.', 'Я готова войти в разрыв во времени.', 29981),
(162531, 'ruRU', 'Я провожу тебя по Призрачным землям. Встретимся в Транквиллионе.', '', 29981),
(162530, 'ruRU', '', 'Попробуйте хотя бы притвориться, что занимаетесь чем-то полезным!', 29981),
(162529, 'ruRU', '', 'Тебе о чем-нибудь говорит слово \"орк\"?', 29981),
(162528, 'ruRU', '', 'Ты случайно не знаешь, сколько сейчас на Азероте континентов?', 29981),
(162527, 'ruRU', 'В атаку!', '', 29981),
(162526, 'ruRU', '', 'О Делорми... ты совсем заблудилась!', 29981),
(162525, 'ruRU', '', 'Ты меня слышишь? Видишь? Ох, наконец-то...', 29981),
(162524, 'ruRU', '|TInterface\\Icons\\INV_Polearm_2H_OdynSpear_D_01:20|t|cFFFF0000%s|r активирует |cFFFF0000|Hspell:282750|h[Опеку глубин]|h|r, создавая защитный пузырь!', '', 29981),
(162523, 'ruRU', '', 'Что сейчас за эпоха?', 29981),
(162522, 'ruRU', '|TInterface\\Icons\\SPELL_SHAMAN_MAELSTROMWEAPON:20|t|cFFFF0000%s|r использует |cFFFF0000|Hspell:282743|h[Шторм аннигиляции]|h|r, чтобы расправиться со слабыми!', '', 29981),
(162521, 'ruRU', '|TInterface\\Icons\\Spell_Priest_Void Blast:20|t |cFFFF0000%s|r использует |cFFFF0000|Hspell:282738|h[Объятия Бездны]|h|r, обращая исцеляющие эффекты в наносящие урон!', '', 29981),
(162520, 'ruRU', '', 'Источник Вечности уже уничтожили? Или еще не создали?', 29981),
(162519, 'ruRU', '', 'Эй! Ты меня видишь? Какой сейчас год?..', 29981),
(162518, 'ruRU', '|TInterface\\Icons\\SPELL_SHADOW_FELMENDING:20|t|cFFFF0000%s|r начинает применять |cFFFF0000|Hspell:282675|h[Пакт неусыпных]|h|r!', '', 29981),
(162517, 'ruRU', 'Поиск', '', 29981),
(162516, 'ruRU', '', 'Чудовище... тебе никогда не добраться до Солнечного Колодца. Командир следопытов... не пустит... тебя к нему...', 29981),
(162515, 'ruRU', 'Хватит! Я больше не позволю этому никчемному сброду меня задерживать.', '', 29981),
(162514, 'ruRU', '<Наложить чары с помощью чародейского жезла Ивен.>', '<Наложить чары с помощью чародейского жезла Ивен.>', 29981),
(162513, 'ruRU', 'Голем не поврежден, но недвижим: чары, даровавшие ему жизнь, рассеялись.$b$bЗнаток наложения чар с подходящим снаряжением может вернуть его в строй.', '', 29981),
(162512, 'ruRU', '|A:Warfronts-BaseMapIcons-Horde-Workshop-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Horde-Workshop-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162511, 'ruRU', '|A:Warfronts-BaseMapIcons-Horde-MainHall-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Horde-MainHall-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162510, 'ruRU', '|A:Warfronts-BaseMapIcons-Horde-Barracks-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Horde-Barracks-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162509, 'ruRU', '|A:Warfronts-BaseMapIcons-Horde-Armory-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Horde-Armory-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162508, 'ruRU', '|A:Warfronts-BaseMapIcons-Horde-Heroes-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Horde-Heroes-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162507, 'ruRU', '|A:Warfronts-BaseMapIcons-Alliance-Workshop-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Alliance-Workshop-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162506, 'ruRU', '|A:Warfronts-BaseMapIcons-Alliance-MainHall-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Alliance-MainHall-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162505, 'ruRU', '|A:Warfronts-BaseMapIcons-Alliance-Barracks-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Alliance-Barracks-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162504, 'ruRU', '|A:Warfronts-BaseMapIcons-Alliance-Armory-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Alliance-Armory-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162503, 'ruRU', '|A:Warfronts-BaseMapIcons-Alliance-Heroes-Minimap:25:23:0:0|aДоступно новое здание!', '|A:Warfronts-BaseMapIcons-Alliance-Heroes-Minimap:25:23:0:0|aДоступно новое здание!', 29981),
(162502, 'ruRU', 'Орда нуждается в тебе, $p! Возглавь наступление на Тирагардское поморье!', '', 29981),
(162501, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aРудник Лорнесты потерян!', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aРудник Лорнесты потерян!', 29981),
(162500, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aЛор\'данелский пляж потерян!', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aЛор\'данелский пляж потерян!', 29981),
(162499, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aПепельная роща потеряна!', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aПепельная роща потеряна!', 29981),
(162498, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aБерег Мрачных Волн потерян!', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aБерег Мрачных Волн потерян!', 29981),
(162497, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aЯсеневый терминал потерян!', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aЯсеневый терминал потерян!', 29981),
(162496, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aГиблый перекресток потерян!', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aГиблый перекресток потерян!', 29981),
(162495, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aГорекаменный карьер потерян!', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aГорекаменный карьер потерян!', 29981),
(162494, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aУвядающая роща потеряна!', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aУвядающая роща потеряна!', 29981),
