(162492, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aНа Лор\'данелский пляж напали!', '|A:Warfronts-FieldMapIcons-Horde-Banner-Minimap:25:23:0:0|aНа Лор\'данелский пляж напали!', 29981),
