(162487, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aНа Горекаменный карьер напали!', '|A:Warfronts-FieldMapIcons-Horde-Mine-Minimap:25:23:0:0|aНа Горекаменный карьер напали!', 29981),
(162486, 'ruRU', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aНа Увядающую рощу напали!', '|A:Warfronts-FieldMapIcons-Horde-LumberMill-Minimap:25:23:0:0|aНа Увядающую рощу напали!', 29981),
(162485, 'ruRU', '', 'Я – королева мира! Хе-хе!', 29981),
(162484, 'ruRU', '', 'За работу! Добыча сама себя не отполирует!', 29981),
(162483, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aРудник Лорнесты потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aРудник Лорнесты потерян!', 29981),
(162482, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aЛор\'данелский пляж потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aЛор\'данелский пляж потерян!', 29981),
(162481, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aПепельная роща потеряна!', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aПепельная роща потеряна!', 29981),
(162480, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aБерег Мрачных Волн потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aБерег Мрачных Волн потерян!', 29981),
(162479, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aЯсеневый терминал потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aЯсеневый терминал потерян!', 29981),
(162478, 'ruRU', '', 'Снизу доносятся голоса. Они шепчут мне. Шепчут о начале и конце. Ты слышишь их?', 29981),
(162477, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aГиблый перекресток потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aГиблый перекресток потерян!', 29981),
(162476, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aГорекаменный карьер потерян!', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aГорекаменный карьер потерян!', 29981),
(162475, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aУвядающая роща потеряна!', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aУвядающая роща потеряна!', 29981),
(162474, 'ruRU', 'Во тьме тебя настигнет ее шепот. Не слушай его! Не верь этим лживым словам.', 'Во тьме тебя настигнет ее шепот. Не слушай его! Не верь этим лживым словам.', 29981),
(162473, 'ruRU', 'Эй! Отойди. Не загораживай мне солнце.', '', 29981),
(162472, 'ruRU', '', 'Разве не видно, что я пытаюсь медитировать?', 29981),
(162471, 'ruRU', '', 'Покой...', 29981),
(162470, 'ruRU', '', 'Ой! Все спокойствие куда-то подевалось.', 29981),
(162469, 'ruRU', '', 'Блестящий план.', 29981),
(162468, 'ruRU', '', 'И как мне медитировать, когда рядом прихвостни Альянса?! Придется их убить.', 29981),
(162467, 'ruRU', '', 'Баланс превыше всего. Сначала я помедитировала. А теперь время для насилия. Чтобы все уравновесить.', 29981),
(162466, 'ruRU', '', 'Я спокойна!', 29981),
(162465, 'ruRU', 'Кого убьем следующим?', '', 29981),
(162464, 'ruRU', 'Так... нечестно...', '', 29981),
(162463, 'ruRU', 'Ох, как мне весело!', '', 29981),
(162462, 'ruRU', 'Чарг, давай без лишних слов!', '', 29981),
(162461, 'ruRU', 'Здесь мило. Давайте всех убьем!', '', 29981),
(162460, 'ruRU', 'Эй, Альянс! Какова ваша кровь на вкус? Зуб даю, соленая!', '', 29981),
(162459, 'ruRU', 'В АТАКУ!', '', 29981),
(162458, 'ruRU', '<рычит>', '', 29981),
(162457, 'ruRU', 'Ой.', '', 29981),
(162456, 'ruRU', 'Ты труп.', '', 29981),
(162455, 'ruRU', 'Все... в атаку.', '', 29981),
(162454, 'ruRU', 'Мы вас убьем.', '', 29981),
(162453, 'ruRU', 'Хм. Альянс. Убить.', '', 29981),
(162452, 'ruRU', 'Враги.', '', 29981),
(162451, 'ruRU', 'Как-то непривычно здесь, на поверхности.', '', 29981),
(162450, 'ruRU', 'Что-то мне... нехорошо.', '', 29981),
(162449, 'ruRU', 'Ха! Как тебе?', '', 29981),
(162448, 'ruRU', 'Знать бы еще, почему из всех чудных мест Орду занесло именно сюда?', '', 29981),
(162447, 'ruRU', 'Вы гляньте, раздолье какое! И Орда рядом – будет у кого клыков надергать да доспехи украсить!', '', 29981),
(162446, 'ruRU', 'Пора растрястись!', '', 29981),
(162445, 'ruRU', '', 'Тебе еще не приходилось охотиться с кланом Черного Железа?', 29981),
(162444, 'ruRU', '', 'Похороните меня... под горой...', 29981),
(162443, 'ruRU', '', 'Огонек! Обед!', 29981),
(162442, 'ruRU', '', 'А вот и Орда! Я как раз искала свежие косточки для своей гончей.', 29981),
(162441, 'ruRU', '', 'Наконец-то суша! Зальем эту землю горькими ордынскими слезками!', 29981),
(162440, 'ruRU', '', 'Огонек, взять!', 29981),
(162439, 'ruRU', '', 'Я коллекционировала черепа еще до своей смерти!', 29981),
(162438, 'ruRU', '', 'Мне умирать... не впервой...', 29981),
(162437, 'ruRU', '', 'Еще одна черепушка в коллекцию!', 29981),
(162436, 'ruRU', '', 'Готовьтесь, бойцы! Впереди нас ждет сокровище! И обреченные ордынцы!', 29981),
(162435, 'ruRU', '', 'Наконец-то суша! Эй, народ! Сегодня Орда проставляется! После того, как мы оберем их трупы...', 29981),
(162434, 'ruRU', 'Смерть Альянсу!', '', 29981),
(162433, 'ruRU', '', 'Ха, свежие ордынские черепа для моей коллекции! То, что надо!', 29981),
(162432, 'ruRU', 'Кул-Тирас будет сожжен!', '', 29981),
(162431, 'ruRU', 'Кровь и гром!', '', 29981),
(162430, 'ruRU', '', 'Отдай мне свой череп!', 29981),
(162429, 'ruRU', 'За вождя! За Орду!', '', 29981),
(162428, 'ruRU', 'Лок\'тар огар!', '', 29981),
(162427, 'ruRU', 'Сюда! Пора разделаться с Альянсом!', '', 29981),
(162426, 'ruRU', 'Давай-давай-давай!', '', 29981),
(162425, 'ruRU', 'Вперед, через портал, рубаки!', '', 29981),
(162424, 'ruRU', 'Мои родичи воспоют твои храбрые подвиги!', 'Мои родичи воспоют твои храбрые подвиги!', 29981),
(162423, 'ruRU', 'Я думал, мне крышка. Спасибо!', 'Я думала, мне крышка. Спасибо!', 29981),
(162422, 'ruRU', 'Да благословят тебя боги!', 'Да благословят тебя боги!', 29981),
(162421, 'ruRU', 'Еще никогда наги так не наглели!', 'Еще никогда наги так не наглели!', 29981),
(162420, 'ruRU', 'Я расскажу о твоей доброте остальным!', 'Я расскажу о твоей доброте остальным!', 29981),
(162419, 'ruRU', 'Тебе удалось спасти мне жизнь. Я этого не забуду!', 'Тебе удалось спасти мне жизнь. Я этого не забуду!', 29981),
(162418, 'ruRU', 'Дрели – это так увлекательно!', '', 29981),
(162417, 'ruRU', '', 'Нет, нет, глупое создание...', 29981),
(162416, 'ruRU', '', 'Никто не смеет садиться на Госпожу!', 29981),
(162414, 'ruRU', 'Глупцы.', '', 29981),
(162413, 'ruRU', 'Вместе! За Кель\'Талас!', 'Вместе! За Кель\'Талас!', 29981),
(162412, 'ruRU', '', 'Вперед, всадники!', 29981),
(162411, 'ruRU', 'Я просто хотел... побомбить.', 'Я просто хотел... побомбить.', 29981),
(162410, 'ruRU', 'У меня припасена для тебя бомба!', '', 29981),
(162409, 'ruRU', 'Гилнеас не забудет твоего мужества, Лиам.', '', 29981),
(162408, 'ruRU', '', 'Ты был настоящим народным героем, Лиам. Не таким, как другие принцы. Враги заплатят за твою смерть.', 29981),
(162407, 'ruRU', 'Мы вернемся, Лиам. Клянусь.', '', 29981),
(162406, 'ruRU', 'Его место здесь, среди героев и защитников Гилнеаса.', '', 29981),
(162405, 'ruRU', 'Свет да пребудет с духами наших предков, ибо они позволили моему сыну покоиться в этой священной земле.', '', 29981),
(162404, 'ruRU', '', 'Смелее, братья и сестры! Мы должны продержаться до прибытия подкрепления! За Кель\'Талас!', 29981),
(162403, 'ruRU', 'Стреляйте! Духи помогут нам попасть в цель.', '', 29981),
(162402, 'ruRU', 'Дует попутный ветер, и цель видна!', '', 29981),
(162401, 'ruRU', '', 'Поднимись вверх и останови это воздушное судно Орды!', 29981),
(162400, 'ruRU', '', '$n, грифон готов к полету!', 29981),
(162399, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Лор\'данелский пляж напали!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Лор\'данелский пляж напали!', 29981),
(162398, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aНа Рудник Лорнесты напали!', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aНа Рудник Лорнесты напали!', 29981),
(162397, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aНа Пепельную рощу напали!', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aНа Пепельную рощу напали!', 29981),
(162396, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Берег Мрачных Волн напали!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Берег Мрачных Волн напали!', 29981),
(162395, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Ясеневый терминал напали!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Ясеневый терминал напали!', 29981),
(162394, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Гиблый перекресток напали!', '|A:Warfronts-FieldMapIcons-Alliance-Banner-Minimap:25:23:0:0|aНа Гиблый перекресток напали!', 29981),
(162393, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aНа Горекаменный карьер напали!', '|A:Warfronts-FieldMapIcons-Alliance-Mine-Minimap:25:23:0:0|aНа Горекаменный карьер напали!', 29981),
(162392, 'ruRU', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aНа Увядающую рощу напали!', '|A:Warfronts-FieldMapIcons-Alliance-LumberMill-Minimap:25:23:0:0|aНа Увядающую рощу напали!', 29981),
(162391, 'ruRU', '', 'Здесь мы примем бой. Темные берега принадлежат калдорай!', 29981),
(162390, 'ruRU', '', 'Приготовьтесь.', 29981),
(162389, 'ruRU', '', 'Скорее уничтожьте катапульты!', 29981),
(162388, 'ruRU', '|TInterface\\Icons\\INV_Misc_Herb_AncientLichenPetal.blp:20|tКора Ивуса |cFFFF0000|Hspell:282615|h[окаменела]|h|r. Победите огоньки, чтобы заклинание перестало действовать!', '', 29981),
(162387, 'ruRU', 'Мои битвы... окончены...', 'Мои битвы... окончены...', 29981),
(162386, 'ruRU', 'Попробуй-ка мою сталь!', 'Попробуй-ка мою сталь!', 29981),
(162384, 'ruRU', 'Неплохо. Теперь можно возвращаться в Кул-Тирас.', '', 29981),
(162381, 'ruRU', '', 'Неважно, что нас ждет и сколько еще душ вы загубите. Вам нас не победить!', 29981),
(162380, 'ruRU', '', 'Смерть идет за тобой, Майев! Следопыты, в атаку!', 29981),
(162379, 'ruRU', '', 'Никому не уйти от клинка Стража. Кому, как не тебе, знать об этом!', 29981),
(162378, 'ruRU', '', 'Оставь надежду, Майев. Армия смерти непобедима. Мы растопчем твою ничтожную базу в мелкую пыль.', 29981),
(162377, 'ruRU', '', 'Мы потеряли связь с Аубердином, и я хочу выяснить, в чем дело! Иди же!', 29981),
(162376, 'ruRU', '', 'Сира... Что с тобой сделала банши?', 29981),
(162375, 'ruRU', '', 'Темные берега остались под контролем Орды. Придется вернуться сюда еще раз.', 29981),
(162374, 'ruRU', '', 'Герои, победа за нами! Мы отбили Темные берега, пусть и дорогой ценой. Клянусь, Сильвана заплатит за этот кошмар.', 29981),
(162373, 'ruRU', '', 'Корабли Орды отступили. Путь к Сире теперь свободен. Седлайте гиппогрифов. Пора покончить с этим.', 29981),
(162372, 'ruRU', '', 'Кто ты, чтобы судить меня? Ты забыла, как предала своих сестер? Иди сюда и прими смерть!', 29981),
(162371, 'ruRU', '', 'Сира! Твоя оборона слабеет, а войско разбито! Тебе не избежать возмездия!', 29981),
(162370, 'ruRU', '', 'Мастерская готова. Стройте глефометы – они уничтожат вражеские боевые машины на подступах к Лор\'данелу.', 29981),
(162369, 'ruRU', '', 'Теперь у нас есть древо вечности. Обучите новые войска и выступите вместе с ними против Сиры!', 29981),
(162368, 'ruRU', '', 'Наше древо жизни превратилось в древо столетий. Пора строить глефометную мастерскую.', 29981),
(162367, 'ruRU', '', 'К нам присоединилось древо войны. Теперь Джерод сможет привести в Башал\'Аран еще больше войск.', 29981),
(162366, 'ruRU', '', 'Дом охотников завершен. Снабжайте его ресурсами, чтобы улучшить оружие и доспехи наших войск.', 29981),
(162365, 'ruRU', '', 'Алтарь старейшин готов. Используйте его, чтобы стать сильнее или принять облик могучего союзника.', 29981),
(162364, 'ruRU', '', 'Лор\'данел наш. Остались только Сира и эта уродливая гоблинская конструкция. Защищайте глефометы, они разрушат защиту платформы.', 29981),
(162363, 'ruRU', '', 'Гиблый перекресток наш. Удержите его и защитите Башал\'Аран!', 29981),
(162362, 'ruRU', '', 'Ясеневый терминал перешел к Альянсу. Теперь мы сможем быстро перемещаться по полю боя и призывать химер.', 29981),
(162361, 'ruRU', '', 'Альянс занял берег Мрачных Волн. Теперь мы сможем вербовать друидов и просить о помощи верховного друида.', 29981),
(162360, 'ruRU', '', 'И ты еще смеешь приказывать мне? Ты, бросившая Стражей ради погони за одним-единственным пленником?', 29981),
(162359, 'ruRU', '', 'Сира! Прекрати это безумие и прими достойную смерть. Тебе не остановить волну возмездия.', 29981),
(162358, 'ruRU', '', 'Мы взяли руины Лорнесты. Местные залежи железа пригодятся нашей армии.', 29981),
(162357, 'ruRU', '', 'Горекаменный карьер наш! Добывайте железо, чтобы улучшить вооружение войск.', 29981),
(162356, 'ruRU', '', 'Пепельная роща под нашим контролем. Древесина оттуда пойдет на строительство и укрепление базы.', 29981),
(162355, 'ruRU', '', 'Мы захватили Увядающую рощу. Собирайте древесину, чтобы отстроить наши форпосты.', 29981),
(162354, 'ruRU', '', 'Лагерь в Башал\'Аране позволит нам собрать силы для следующего удара. Отрежьте Орду от ресурсов и оттесните ее до самого Лор\'данела.', 29981),
(162353, 'ruRU', '', 'Нам удалось закрепиться в Аубердине. Не расслабляйтесь! Продвигайтесь дальше и соберите как можно больше ресурсов.', 29981),
(162352, 'ruRU', '', 'Герои! Сегодня мы отобьем Темные берега у Орды. К оружию!', 29981),
(162351, 'ruRU', '|TInterface\\ICONS\\INV_SWORD_48.BLP:20|t Вы были выбраны целью |cFFF00000|Hspell:282618|h[Удара в сердце]|h|r!', '', 29981),
(162342, 'ruRU', 'По сравнению с тобой принцесса Терадрас выглядит, как чудо света!', '', 29981),
(162341, 'ruRU', 'Эй ты... отрыжка огра! Давай сюда!', '', 29981),
(162340, 'ruRU', 'Иные трогги поумней тебя!', '', 29981),
(162339, 'ruRU', 'Орда захватила Гиблый перекресток!', 'Орда захватила Гиблый перекресток!', 29981),
(162338, 'ruRU', '$n захватывает Гиблый перекресток!', '$n захватывает Гиблый перекресток!', 29981),
(162337, 'ruRU', 'Камни... рассыпаются...', 'Камни... рассыпаются...', 29981),
(162336, 'ruRU', 'Камень земли, услышь мой зов! Помоги мне!', 'Камень земли, услышь мой зов! Помоги мне!', 29981),
(162335, 'ruRU', 'Лесной клык влетает в гнездо с победным визгом.', '', 29981),
(162334, 'ruRU', '', 'Роща принадлежит нам!', 29981),
(162333, 'ruRU', 'Защищайте рощу!', '', 29981),
(162332, 'ruRU', 'Там, в тени...', 'Там, в тени...', 29981),
(162331, 'ruRU', 'Что это было?', 'Что это было?', 29981),
(162330, 'ruRU', 'От меня не скрыться...', 'От меня не скрыться...', 29981),
(162329, 'ruRU', 'Кто-то тут шныряет...', 'Кто-то тут шныряет...', 29981),
(162328, 'ruRU', 'Кто идет?', 'Кто идет?', 29981),
(162327, 'ruRU', 'Ты страшнее лепрогнома!', '', 29981),
(162326, 'ruRU', 'Тортолланы побыстрее тебя будут!', '', 29981),
(162325, 'ruRU', 'Твоя мама – МУРЛОЧИХА!', '', 29981);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(162324, 'ruRU', 'Духи... покидают... меня...', 'Духи... покидают... меня...', 29981),
(162323, 'ruRU', 'Я принесу вождю твою голову!', 'Я принесу вождю твою голову!', 29981),
(162320, 'ruRU', 'Йоу-ху!', '', 29981),
(162319, 'ruRU', 'Они... вас поймают...', '', 29981),
(162318, 'ruRU', 'Убийца! Стража!', '', 29981),
(162317, 'ruRU', 'Да, с грузами все в порядке. Они очень пригодятся в нашей кампании против Орды.', '', 29981),
(162316, 'ruRU', 'Селама... ашаль-аноре...', 'Селама... ашаль-аноре...', 29981),
(162315, 'ruRU', 'Шорель-аран ким\'джаель!', 'Шорель-аран ким\'джаель!', 29981),
