(162313, 'ruRU', 'Мне нужна аура для полета!', 'Мне нужна аура для полета!', 29981),
(162307, 'ruRU', 'Неплохо, неплохо. А теперь уходи, быстро!', '', 29981),
(162306, 'ruRU', 'Разведка говорит, что где-то рядом есть важная цель. Найди и уничтожь ее.', '', 29981),
(162304, 'ruRU', 'Боли... больше нет...', 'Боли... больше нет...', 29981),
(162303, 'ruRU', 'За Королеву-банши!', 'За Королеву-банши!', 29981),
