(162301, 'ruRU', 'Мрм-м!..', 'Мрм-м!..', 29981),
(162299, 'ruRU', '|TInterface\\ICONS\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Ящер сосредотачивает внимание на вашей |cFFF00000|Hspell:282209|h[метке жертвы]|h|r!', '|TInterface\\ICONS\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Ящер сосредотачивает внимание на вашей |cFFF00000|Hspell:282209|h[метке жертвы]|h|r!', 29981),
(162298, 'ruRU', 'Из тебя получится чудесное удобрение.', '', 29981),
(162297, 'ruRU', 'Я возделаю это поле боя.', '', 29981),
(162295, 'ruRU', '', 'Фермер Сян-су решил на время забыть о покое и уединении. Сейчас он преподаст пару уроков садоводства!', 29981),
(162259, 'ruRU', 'Орда захватила Ясеневый терминал!', 'Орда захватила Ясеневый терминал!', 29981),
(162258, 'ruRU', '$n захватывает Ясеневый терминал!', '$n захватывает Ясеневый терминал!', 29981),
(162257, 'ruRU', '|TInterface\\ICONS\\INV_Pterrordax2Mount_LightGreen.BLP:20|t Ветра крепчают, готовясь обрушить на вас |cFFFF0000|Hspell:282107|h[гнев Па\'ку]|h|r!', '|TInterface\\ICONS\\INV_Pterrordax2Mount_LightGreen.BLP:20|t Ветра крепчают, готовясь обрушить на вас |cFFFF0000|Hspell:282107|h[гнев Па\'ку]|h|r!', 29981),
(162256, 'ruRU', 'Не смотрите на меня! Не смотрите на меня!', '', 29981),
(162255, 'ruRU', 'Мои штаны... куда они подевались? Хорошо хоть, мое счастливое белье все еще со мной.', '', 29981),
(162254, 'ruRU', 'Эй, эту рубашку мне подарила мама!', '', 29981),
(162253, 'ruRU', 'Второй жилет! Как ты смеешь красть мой второй жилет!', '', 29981),
(162252, 'ruRU', 'Со мной этот трюк не пройдет... Я всегда ношу второй комплект одежды!', '', 29981),
(162251, 'ruRU', 'Мой жилет пропал! Это все ты!', '', 29981),
(162250, 'ruRU', 'Эй, это был мой любимый пиджак!', '', 29981),
(162249, 'ruRU', 'Моя шляпа! Ты об этом пожалеешь...', '', 29981),
(162248, 'ruRU', 'Сюрприз! Я стащил твои штаны!', '', 29981),
(162247, 'ruRU', 'Я сорву с тебя рубашку!', '', 29981),
(162246, 'ruRU', 'Твои сапоги так и просились ко мне в руки.', '', 29981),
(162245, 'ruRU', 'Не против, если я сниму с тебя перчатки?', '', 29981),
(162244, 'ruRU', 'Меня не просто так зовут Робертом Робокрадом!', '', 29981),
(162243, 'ruRU', 'Отменный плащ. Оставлю-ка его себе.', '', 29981),
(162242, 'ruRU', 'Был твой шлем, стал мой!', '', 29981),
(162241, 'ruRU', 'Ха-ха! У меня твоя накидка!', '', 29981),
(162240, 'ruRU', 'Хм... отличные вещички. Давай-ка их сюда!', '', 29981),
(162239, 'ruRU', 'Внезапно!', '', 29981),
(162238, 'ruRU', 'Сзади!', '', 29981),
(162237, 'ruRU', 'Орда захватила рудник Лорнесты!', 'Орда захватила рудник Лорнесты!', 29981),
(162236, 'ruRU', '$n захватывает рудник Лорнесты!', '$n захватывает рудник Лорнесты!', 29981),
(162235, 'ruRU', 'Альянс захватил Лор\'данел!', 'Альянс захватил Лор\'данел!', 29981),
