(162225, 'ruRU', '$n захватывает Увядающую рощу!', '$n захватывает Увядающую рощу!', 29981),
(162224, 'ruRU', 'Двойники Филиппа применяют \"Теневой удар\". Не позволяйте им обойти вас!', 'Двойники Филиппа применяют \"Теневой удар\". Не позволяйте им обойти вас!', 29981),
(162221, 'ruRU', '', 'Также на арене – сэр Филипп Картер Трейси!', 29981),
(162220, 'ruRU', 'Орда захватила Башал\'Аран!', 'Орда захватила Башал\'Аран!', 29981),
(162219, 'ruRU', '$n захватывает Башал\'Аран!', '$n захватывает Башал\'Аран!', 29981),
(162218, 'ruRU', 'А-а! Что за манеры?', '', 29981),
(162217, 'ruRU', 'Хороший сегодня денек, чувствуешь?', '', 29981),
(162216, 'ruRU', '', 'Почтенная публика! Сейчас ваши сердца застучат в бешеном ритме!.. Перед вами главный злодей-любовник – сам Марк собственной персоной!', 29981),
(162215, 'ruRU', 'Дамы и господа, вы только посмотрите на эти бедра! От них невозможно глаз отвести. Перед вами звезда скабрезных любовных романов – сам Марк!', '', 29981),
(162214, 'ruRU', 'Будь начеку!', '', 29981),
(162213, 'ruRU', 'Повсюду вокруг тебя знакомые лица...', '', 29981),
(162210, 'ruRU', 'Тебя.', '', 29981),
(162209, 'ruRU', 'Вокруг.', '', 29981),
(162208, 'ruRU', 'Повсюду.', '', 29981),
(162207, 'ruRU', '$n захватывает руины Аубердина!', '$n захватывает руины Аубердина!', 29981),
(162206, 'ruRU', 'А в этом углу... погодите-ка, кто-то привел на смертельный бой РЕБЕНКА?', '', 29981),
(162205, 'ruRU', '', 'А в этом углу... погодите-ка, кто-то привел на смертельный бой РЕБЕНКА?', 29981),
(162204, 'ruRU', 'Привет!', '', 29981),
(162203, 'ruRU', 'Пожалуйста, позаботься о моем сыне.', '', 29981),
(162202, 'ruRU', 'Я помогу тебе сражаться с нагой.', '', 29981),
(162201, 'ruRU', 'ТЫ! Тебе нужно было защищать моего сына!', '', 29981),
(162200, 'ruRU', 'Ай-ай! Папа, помоги!', '', 29981),
(162199, 'ruRU', 'Ух ты!', '', 29981),
(162198, 'ruRU', 'Хочу потрогать...', '', 29981),
(162197, 'ruRU', 'Что это?', '', 29981),
(162195, 'ruRU', 'У-у! Блестит!', '', 29981),
(162189, 'ruRU', 'Довольно! Пора браться за дело всерьез.', '', 29981),
(162177, 'ruRU', '', 'Добро пожаловать, $n. Зандалары позволили мне использовать эту комнату для изучения древних артефактов – своих и вражеских.$b$bХочешь просто посмотреть? Или, может, узнать об этих реликвиях побольше?', 29981),
(162153, 'ruRU', 'Примени этот связующий камень к инфернальному алхимическому камню. Это поможет сдержать энергию Скверны во время преобразования.', '', 29981);
