UPDATE `broadcast_text_locale` SET `Text1_lang`='Сейчас, конечно, ничего такого не скажешь, ведь я пригласила к ней лучшего сурамарского терапевта и хирурга. О, а вот это – Пепел... иногда он бывает таким пронырой! Обожает лазить везде, куда дотянутся лапки, и таскать игрушки у других котиков, поэтому когда он у нас появился, то очень докучал остальным кошкам. Но Белла не возражает, ведь она познакомилась с ним еще котенком, и мне кажется, она его боготворит. Особенно Пеплу нравится красть мячик у Тенечки, а тот очень расстраивается, ведь это его любимая игрушка. Обычно я не позволяю ему держать такую пакость в моем доме, но раз он его любит, так тому и быть.', `VerifiedBuild`=29981 WHERE (`ID`=145967 AND `locale`='ruRU');
