UPDATE `broadcast_text_locale` SET `Text1_lang`='<Она показывает на третьего детеныша манапарда.>\n\nПосмотрите на нее, сидит так смирно... Должна заметить, у нее потрясающее воображение, когда дело доходит до еды. Вы можете посчитать, что она довольствуется нашей вкусной рыбкой, но нет, мадам Пушелия весьма разборчива, когда дело касается вкусностей. Представляете, ее любимое лакомство... я и сама с трудом в это верю... торт из маны! \n\nВидимо, это логично, поскольку мои родители уго... простите, у-г-о-щ-а-л-и ее этим тортом, когда я была маленькой. Единственный ребенок, единственная кошка... у нас было много общего.', `VerifiedBuild`=29981 WHERE (`ID`=145715 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Эти котята определенно заслуживают лучшего, потому что они лучшие, и я хотела бы поделиться ими со всем миром, но я не могу... поверьте мне, я пыталась. Для меня так важно, что вы здесь и можете их погладить. Хорошо, что я могла гладить еще двух кошек, когда завоевывала доверие Мяу, потому что иначе – мне больно даже думать об этом! – это была бы просто пытка! Представьте себе дом без кошек! Я бы даже не назвала это домом, просто место, где живешь, а если нет кошки, то разве это жизнь? Кстати об этих двух кошках – вон одна из них, мадам Пушелия!', `VerifiedBuild`=29981 WHERE (`ID`=145714 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Поместите чародейское вино прямо... о, я не узнаю вас. И это значит... вы здесь новичок! Позвольте представить вас моим милашкам! \n\n<Она указывает на одного из детенышей манапарда.>\n\nЭто Тенечка. Он всегда теряет игрушки, когда берет их с собой в бесчисленные приключения. Куда ты идешь, малыш? В зверинец, посмотреть на экзотические создания со всего света? Через ароматные Сумеречные виноградники? Возможно, в следующий раз ты вернешься из путешествия с сувениром! Хотя один раз он все же принес мне кое-что после такой вылазки... моего сладкого мальчика Мяу! Однажды я открыла дверь, чтобы впустить Тенечку, и к моему удивлению и удовольствию, он привел с собой маленького друга! А любой друг Тенечки должен стать и моим другом.', `VerifiedBuild`=29981 WHERE (`ID`=145712 AND `locale`='ruRU');
