UPDATE `broadcast_text_locale` SET `Text_lang`='Когда Бизмо со своей командой решил открыть заведение прямо в Подземном поезде, он шел на большой риск. Вбухал в него кучу золота.\n\nИ тогда он решил обустроить VIP-ложу, так называемый \"бумзал\". В ней лучше видно бои, можно приобрести самые лучшие напитки, а главное – в ней по-настоящему чувствуешь себя членом закрытого клуба. Конечно, попасть туда могут только избранные – те, у кого ранг не ниже 6-го.\n\nХочешь попасть в бумзал? Тогда дерись и побеждай!', `VerifiedBuild`=29981 WHERE (`ID`=127272 AND `locale`='ruRU');
