UPDATE `broadcast_text_locale` SET `Text1_lang`='Я была юной девушкой, чистой и непорочной. Молодой следопыт на службе Луносвета, обрученная с благородным лордом – предметом моих мечтаний.$b$bА потом пришел Артас.$b$bЯ пала в битве, когда обезумевший принц оставил ужасный шрам на моей любимой земле. Но тогда я хотя бы обрела покой. Как мне казалось. Но ненадолго. Королева-банши вернула мою душу и обрекла на вечную службу.$b$bПрошу простить меня, если я слишком резка по отношению к глупцам вроде Мургота – тем, кто принимает свою жизнь как должное и верит, что муки могут принести счастье.', `VerifiedBuild`=29981 WHERE (`ID`=115689 AND `locale`='ruRU');
