UPDATE `broadcast_text_locale` SET `Text_lang`='<Главный исследователь смотрит на вас снисходительно.>\n\nА тебе не приходилось слышать о Реликварии, |3-6($r)?\n\nРазумеется, мы ищем власти. Эта земля усеяна множеством бесценных артефактов. Высокорожденные позабыли о тайных искусствах больше, чем мы с тобой узнаем за всю жизнь. Я хочу отыскать забытые реликвии и поставить их силу на службу себе и своему народу.\n\nПрошу тебя, не надо больше вопросов.', `VerifiedBuild`=29981 WHERE (`ID`=107614 AND `locale`='ruRU');
