UPDATE `broadcast_text_locale` SET `Text1_lang`='А, ты про ту старинную историю? Ну что ж, могу рассказать еще разок.$b$b<Рикет поднимает руки и начинает вещать замогильным голосом.>$b$bЛегенда гласит, что он был огромный, как сквернобот, а рожа его могла напугать самого старину Смертокрыла. Еще говорят, что, работая над \"Блескотроном\", он потерял руку. Вместо нее присобачил себе ТАНКА-ПАУКА!$b$b<Рикет еле сдерживает смешок.>$b$bНу а если серьезно, последний раз что-то похожее на правду мне о нем рассказывал один моряк, с которым я познакомилась в Кабестане. Хоть он был и пьян в стельку, что-то из того, что он рассказал, действительно может быть правдой.$b$bЗвать его главный инженер Фут. Может быть, он поможет тебе выйти на след настоящего изобретателя \"Блескотрона\".', `VerifiedBuild`=29981 WHERE (`ID`=105190 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='$c, спасибо, что хочешь нам помочь. Я Фэй Ли, и в Шадо-Пан у меня особая репутация: я постоянно что-то поджигаю. Как правило, врагов. Но иногда и наш монастырь... Господин Тажань Чжу не слишком мною доволен...$b$bПомоги мне завоевать его расположение. Если будешь меня подлечивать, я смогу разбить ледяные стены Асперсия и поджарить его. Стой возле меня, и моя аура гениальности будет восстанавливать твою ману.$b$b<На лице Фэй Ли отражается недобрая усмешка.>$b$bТы хочешь, чтобы я отжигала по полной,или мне лучше осторожничать и не лезть на рожон?', `VerifiedBuild`=29981 WHERE (`ID`=104450 AND `locale`='ruRU');
