UPDATE `broadcast_text_locale` SET `Text_lang`='Я, конечно, против воровства, но басовую примочку можно достать у огров, резвящихся в Кольце Крови. Сомневаюсь, что они тут же полезут в драку, но все же лучше не задерживаться там, когда умыкнешь примочку.\n\nУстройство для считывания лаз-троновых дисков у меня украли пару недель назад. Запах гоблина в моем жилище потом неделю стоял. Поищи устройство на мысе Паросвистов.\n\nУсилитель звука – штука редкая. Кусок обшивки солнечного голема араккоа подойдет в качестве замены.\n\nНужным мне конденсатором обычно оснащаются крошшеры Железной Орды в Таладоре. Поройся в одном из них.\n\nИ, наконец, древесину можно добыть у древних в Горгронде. Если, конечно, боевые дровосеки их всех не перебили.', `Text1_lang`='Я, конечно, против воровства, но басовую примочку можно достать у огров, резвящихся в Кольце Крови. Сомневаюсь, что они тут же полезут в драку, но все же лучше не задерживаться там, когда умыкнешь примочку.\n\nУстройство для считывания лаз-троновых дисков у меня украли пару недель назад. Запах гоблина в моем жилище потом неделю стоял. Поищи устройство на мысе Паросвистов.\n\nУсилитель звука – штука редкая. Кусок обшивки солнечного голема араккоа подойдет в качестве замены.\n\nНужным мне конденсатором обычно оснащаются крошшеры Железной Орды в Таладоре. Поройся в одном из них.\n\nИ, наконец, древесину можно добыть у древних в Горгронде. Если, конечно, боевые дровосеки их всех не перебили.', `VerifiedBuild`=29981 WHERE (`ID`=93780 AND `locale`='ruRU');
