UPDATE `broadcast_text_locale` SET `Text_lang`='Конечно! Кодекс написан на древнем языке натрезимов. Натрезимы, или повелители ужаса, как их называете вы, некогда были просвещенной и могущественной расой. Никто в Великой Запредельной Тьме не мог превзойти их в использовании магии призывов и демонических врат.$b$bВ этой книге рассказывается о том, как открыть демонические врата в другой мир. К сожалению, боюсь, что этот мир больше не существует. Он был уничтожен во время завоевания Зорота, это была демонстрация силы.$b$bБоюсь, эта книга бесполезна. Никому из |3-8($r) |3-8($c) не под силу открыть подобные врата в одиночку.', `VerifiedBuild`=29981 WHERE (`ID`=69290 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Небольшие односторонние порталы в одну из столиц Орды или Альянса.$B$BОсколки так перемешались между собой, что мне сложно сказать, в какие города можно попасть с их помощью. Единственное, чем я могу помочь, так это отделить осколки Похитителей Солнца от осколков Серебряного Союза. Обе фракции оставляют в своих чарах для порталов особый эльфийский знак.$B$BЯ продам тебе осколки, предназначенные для твоей фракции. Подожди, пока они придут в состояние покоя, а дальше уж $gсам:сама; увидишь;, куда можно попасть с их помощью.', `VerifiedBuild`=29981 WHERE (`ID`=69024 AND `locale`='ruRU');
