UPDATE `broadcast_text_locale` SET `Text_lang`='Портняжное дело позволяет изготавливать доспехи, плащи, одежду, сумки, особые нитки и другие предметы из различных типов ткани, которую можно приобрести на аукционе или добыть из гуманоидов. Кроме того, такие материалы как нитки и краски можно приобрести у продавцов товаров для портных.\n\nИскусные портные умеют усиливать свои плащи магической вышивкой.\n\nЗачаровыватели зачастую становятся портными, чтобы распылять созданные ими магические вещи.', `Text1_lang`='Портняжное дело позволяет изготавливать доспехи, плащи, одежду, сумки, особые нитки и другие предметы из различных типов ткани, которую можно приобрести на аукционе или добыть из гуманоидов. Кроме того, такие материалы как нитки и краски можно приобрести у продавцов товаров для портных.\n\nИскусные портные умеют усиливать свои плащи магической вышивкой.\n\nЗачаровыватели зачастую становятся портными, чтобы распылять созданные ими магические вещи.', `VerifiedBuild`=29981 WHERE (`ID`=47141 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Кожевничество дает возможность создавать доспехи, плащи, наборы для повышения характеристик доспехов и другие подобные предметы из кожи, шкур и чешуи. Другие необходимые материалы можно купить у торговцев.\n\nКожевничество удобно изучать вместе со снятием шкур, которое обеспечит тебя необходимым сырьем. Другие необходимые предметы, как, например, нитки и краски, можно купить у торговцев товарами для кожевников.\n\nКожевники с достаточным уровнем навыка также могут создавать улучшения для своих наручей и поножей.', `Text1_lang`='Кожевничество дает возможность создавать доспехи, плащи, наборы для повышения характеристик доспехов и другие подобные предметы из кожи, шкур и чешуи. Другие необходимые материалы можно купить у торговцев.\n\nКожевничество удобно изучать вместе со снятием шкур, которое обеспечит тебя необходимым сырьем. Другие необходимые предметы, как, например, нитки и краски, можно купить у торговцев товарами для кожевников.\n\nКожевники с достаточным уровнем навыка также могут создавать улучшения для своих наручей и поножей.', `VerifiedBuild`=29981 WHERE (`ID`=47140 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Ювелирное дело дает возможность создавать магические кольца, амулеты, аксессуары и ограненные самоцветы.\n\nСамоцветы, которые используются в ювелирном деле, можно купить или получить, просеивая руду, добытую при помощи горного дела, поэтому эти две профессии удобно изучать вместе.\n\nДля создания большинства ювелирных изделий требуется набор ювелира и шлифовальный камень. Эти предметы можно купить у торговцев товарами для ювелиров.', `Text1_lang`='Ювелирное дело дает возможность создавать магические кольца, амулеты, аксессуары и ограненные самоцветы.\n\nСамоцветы, которые используются в ювелирном деле, можно купить или получить, просеивая руду, добытую при помощи горного дела, поэтому эти две профессии удобно изучать вместе.\n\nДля создания большинства ювелирных изделий требуется набор ювелира и шлифовальный камень. Эти предметы можно купить у торговцев товарами для ювелиров.', `VerifiedBuild`=29981 WHERE (`ID`=47139 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Начертание дает возможность создавать магические свитки, символы, предметы для левой руки, карты Новолуния и даже рецепты для других профессий.\n\nЗначительная часть ингредиентов для начертания добывается при помощи измельчения трав, поэтому изучать эту профессию удобно в паре с травничеством.\n\nТебе понадобится набор виртуозного начертателя. Его и другие полезные материалы – например, пергамент – можно приобрести у торговцев товарами для начертания.', `Text1_lang`='Начертание дает возможность создавать магические свитки, символы, предметы для левой руки, карты Новолуния и даже рецепты для других профессий.\n\nЗначительная часть ингредиентов для начертания добывается при помощи измельчения трав, поэтому изучать эту профессию удобно в паре с травничеством.\n\nТебе понадобится набор виртуозного начертателя. Его и другие полезные материалы – например, пергамент – можно приобрести у торговцев товарами для начертания.', `VerifiedBuild`=29981 WHERE (`ID`=47138 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Инженерное дело дает возможность создавать огромное количество полезных, удивительных и просто невероятных вещей: ружья, прицелы, мотоциклы, механических белок и многое другое. Однако, многими из этих предметов, например, очками, механическими дополнениями к поясам, сапогам, перчаткам и плащам, а также ветролетами могут пользоваться лишь инженеры.\n\nЧаще всего сырьем для этой профессии служат металлы и материалы, добываемые при помощи горного дела, поэтому удобно осваивать эти две профессии одновременно.\n\nДля создания многих предметов требуется кузнечный молот. Его и другие необходимые материалы для инженерного дела можно купить у торговцев.', `Text1_lang`='Инженерное дело дает возможность создавать огромное количество полезных, удивительных и просто невероятных вещей: ружья, прицелы, мотоциклы, механических белок и многое другое. Однако, многими из этих предметов, например, очками, механическими дополнениями к поясам, сапогам, перчаткам и плащам, а также ветролетами могут пользоваться лишь инженеры.\n\nЧаще всего сырьем для этой профессии служат металлы и материалы, добываемые при помощи горного дела, поэтому удобно осваивать эти две профессии одновременно.\n\nДля создания многих предметов требуется кузнечный молот. Его и другие необходимые материалы для инженерного дела можно купить у торговцев.', `VerifiedBuild`=29981 WHERE (`ID`=47137 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Наложение чар дает возможность зачаровывать предметы, применяя к ним различные эффекты, распылять предметы и создавать магические жезлы и масла.\n\nЗачаровыватели с достаточно высоким навыком могут зачаровывать собственные кольца, чего больше не может никто.\n\nБольшую часть сырья для наложения чар можно получить при помощи распыления предметов – процесса, при котором предмет уничтожается. Поэтому наложение чар очень удобно изучать в паре с портняжным делом, так как при этом ты сможешь распылять самостоятельно изготовленные предметы для получения сырья.\n\nЗачаровыватели также могут накладывать чары на свитки, чтобы продавать чары или сохранять их для использования в будущем. Свитки и другие чародейские предметы можно купить у торговцев.', `Text1_lang`='Наложение чар дает возможность зачаровывать предметы, применяя к ним различные эффекты, распылять предметы и создавать магические жезлы и масла.\n\nЗачаровыватели с достаточно высоким навыком могут зачаровывать собственные кольца, чего больше не может никто.\n\nБольшую часть сырья для наложения чар можно получить при помощи распыления предметов – процесса, при котором предмет уничтожается. Поэтому наложение чар очень удобно изучать в паре с портняжным делом, так как при этом ты сможешь распылять самостоятельно изготовленные предметы для получения сырья.\n\nЗачаровыватели также могут накладывать чары на свитки, чтобы продавать чары или сохранять их для использования в будущем. Свитки и другие чародейские предметы можно купить у торговцев.', `VerifiedBuild`=29981 WHERE (`ID`=47136 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Кузнечное дело дает возможность ковать разные предметы из металлов, минералов и камней: оружие ближнего боя, кольчужные и латные тяжелые доспехи, сырье для использования в других профессиях и элементы для усовершенствования предметов, такие как точила и шипы для щитов.\n\nПо мере развития обладатель этой профессии овладевает умением добавлять гнезда для самоцветов в свои собственные наручи или перчатки, а также в свои и чужие пояса. В гнезда можно вставлять магические самоцветы, которые усиливают характеристики предметов.\n\nКузнечное дело удобно изучать в паре с горным делом – это позволяет использовать для ковки собственные минералы и руду.', `Text1_lang`='Кузнечное дело дает возможность ковать разные предметы из металлов, минералов и камней: оружие ближнего боя, кольчужные и латные тяжелые доспехи, сырье для использования в других профессиях и элементы для усовершенствования предметов, такие как точила и шипы для щитов.\n\nПо мере развития обладатель этой профессии овладевает умением добавлять гнезда для самоцветов в свои собственные наручи или перчатки, а также в свои и чужие пояса. В гнезда можно вставлять магические самоцветы, которые усиливают характеристики предметов.\n\nКузнечное дело удобно изучать в паре с горным делом – это позволяет использовать для ковки собственные минералы и руду.', `VerifiedBuild`=29981 WHERE (`ID`=47134 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Алхимия дает возможность использовать травы и другие материалы для создания различных полезных эликсиров, зелий, масел, настоев и котлов. Используя эликсиры и настои, ты также получаешь различные преимущества.\n\nПо мере развития обладатель этой профессии также овладевает навыком трансмутации стихийных материалов и определенных минералов для их использования в других профессиях. \n\nИзучать алхимию удобно в паре с травничеством – это позволяет использовать для эликсиров собственные травы.', `Text1_lang`='Алхимия дает возможность использовать травы и другие материалы для создания различных полезных эликсиров, зелий, масел, настоев и котлов. Используя эликсиры и настои, ты также получаешь различные преимущества.\n\nПо мере развития обладатель этой профессии также овладевает навыком трансмутации стихийных материалов и определенных минералов для их использования в других профессиях. \n\nИзучать алхимию удобно в паре с травничеством – это позволяет использовать для эликсиров собственные травы.', `VerifiedBuild`=29981 WHERE (`ID`=47133 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Снятие шкур позволяет снимать и выделывать шкуры убитых существ. Их можно продавать на аукционе или использовать в качестве сырья для кожевничества.\n\nУмелые скорняки зачастую становится знатоками анатомии, что повышает шанс нанести критический удар по цели.\n\nДля снятия шкур требуется специальный нож, который можно приобрести у обычных торговцев либо продавцов кожевенных товаров.', `Text1_lang`='Снятие шкур позволяет снимать и выделывать шкуры убитых существ. Их можно продавать на аукционе или использовать в качестве сырья для кожевничества.\n\nУмелые скорняки зачастую становится знатоками анатомии, что повышает шанс нанести критический удар по цели.\n\nДля снятия шкур требуется специальный нож, который можно приобрести у обычных торговцев либо продавцов кожевенных товаров.', `VerifiedBuild`=29981 WHERE (`ID`=47132 AND `locale`='ruRU');
