UPDATE `broadcast_text_locale` SET `Text_lang`='Вам нравится у нас в Огри\'ла?$B$BНаши огры и днем и ночью делают всякие интересности, и все самое лучшее мы сохраняем для почетных гостей – таких как вы!$B$BТак что не забывайте иногда отдыхать от спасения мира и заглядывайте к нам – посмотреть на товары!$B$BУдачи, $gпарнишка:девчушка;!', `VerifiedBuild`=29981 WHERE (`ID`=21618 AND `locale`='ruRU');
