UPDATE `broadcast_text_locale` SET `Text_lang`='Да, сэр. Огр, сэр. Но дайте же нам шанс, сэр! Ведь мы готовились к этому с того самого дня, когда Стража Небес впервые пролетела над Огри\'ла, сэр!', `VerifiedBuild`=29981 WHERE (`ID`=21449 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='От лица Огри\'ла мы благодарим тебя за твои старания, $n.$B$B*Левая голова Чу-а-лора кивает, а правая улыбается тебе.*$B$BИ не забывай, что, помогая нам здесь, ты также помогаешь защищать наших братьев внизу, для которых ты $gстал:стала; все равно что $gкоролем:королевой;.', `VerifiedBuild`=29981 WHERE (`ID`=21405 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Добро пожаловать в Огри\'ла, |3-6($c).$B$BЗдешние огры смогли обрести большую остроту мышления благодаря магическим эманациям здешних кристаллов. Хотя мы не вполне понимаем, как они работают, мы стали ценить наше новое место обитания и хотим лишь жить спокойно.$B$BЖаль лишь, что демоны, духи Астрала и в особенности черные драконы не дают нам этого самого покоя.', `VerifiedBuild`=29981 WHERE (`ID`=21404 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Гахк новый в Огри\'ла – как и $gмаленький:маленькая:r; |3-6($r). Это как небеса, о которых всегда говорят огры внизу. Но головы Гахка болят от кристалла, который делает Гахк умнее.$B$B*Обе головы Гахка кивают друг другу.*$B$BНаша учиться делать кристалл с темными рунами. Когда наша это уметь, мы разбить порталы демонов!', `VerifiedBuild`=29981 WHERE (`ID`=21401 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Вы прибыли в Огри\'ла совсем недавно, поэтому еще не подверглись излучению кристаллов в достаточной мере, чтобы использовать их максимально эффективно. Да и голова у вас одна.$B$BНо мы провели тут очень много времени, поэтому, как можно догадаться, успели узнать гораздо больше вас.$B$BНедавно мы заинтересовались демонами из лагерей Легиона и даже придумали способ, как навсегда избавиться от них.$B$BПо крайней мере, теория у нас есть.', `VerifiedBuild`=29981 WHERE (`ID`=21396 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='У тебя есть сыновья, |3-6($c)?$B$BПозволь нам кое-что тебе сказать: до того, как мы пришли в Огри\'ла и кристаллы сделали нас умнее, жилось нам куда веселей. Раньше мы бы просто стукнули их по голове и заставили умолкнуть. А теперь они целыми днями жужжат нам про стражей небес Ша\'тар.$B$BНезнание – сила!', `VerifiedBuild`=29981 WHERE (`ID`=21394 AND `locale`='ruRU');
