UPDATE `broadcast_text_locale` SET `Text_lang`='Я никого ниоткуда не отведу! Он может посылать столько писем, сколько ему угодно. Я полностью осведомлен о его \"стратегическом\" плане, и он знает, что у меня с Госпожой полное взаимопонимание по поводу того, что должны делать Странники. Как только мы разберемся с троллями из племени Призрачной Сосны, тогда, и только тогда мы переключим наше внимание на Смертхольм. Я знаю, что Плеть – более серьезная угроза, но Транквиллион пока их сдерживает. Было бы самоубийством игнорировать троллей! Свободен, Сумрак.', `VerifiedBuild`=29981 WHERE (`ID`=12614 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Никак нет! Из Транквиллиона прибыл еще один пакет. Это снова верховный палач Маврен, капитан. И пишет он на этот раз очень цветисто. Он снова просит нас направить Странников в поддержку борьбы против Смертхольма и предлагает вам послать бойца на север, к обители Странников, в леса Вечной Песни, чтобы собрать войска и там.', `VerifiedBuild`=29981 WHERE (`ID`=12611 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Нет, капитан. Гонец из Транквиллиона доставил новое письмо от верховного палача Маврена. Он хочет знать, почему мы не выполнили его приказ и не отозвали Странников, которые работали против троллей из племени Призрачной Сосны.', `VerifiedBuild`=29981 WHERE (`ID`=12610 AND `locale`='ruRU');
