UPDATE `broadcast_text_locale` SET `Text1_lang`='Можете не соглашаться со мной, сколько пожелаете, верховный палач. Конечно, я обдумаю ваш совет. А потом мы приступим к освобождению Кель\'Таласа в соответствии с моим планом. Вскоре мы вернемся к нашей увлекательной беседе.', `VerifiedBuild`=29981 WHERE (`ID`=12573 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Маврин, мне не нужны извинения, мне нужны результаты! Странники недоступны, а от Луносвета мы уже получили все, что можно. Я не могу игнорировать троллей из племени Призрачной Сосны и Зул\'Амана... они уже выстроились у нашей восточной границы!', `VerifiedBuild`=29981 WHERE (`ID`=12572 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Я понимаю, Маврин. Но окончательное решение за мной. Я признательна вам за помощь, но большинство здесь – эльфы крови. Я не стану бездумно рисковать их жизнями!', `VerifiedBuild`=29981 WHERE (`ID`=12571 AND `locale`='ruRU');
