UPDATE `broadcast_text_locale` SET `Text_lang`='Мы уже проходили через это. Нам поможет лишь целенаправленная атака на Смертхольм. Мы не можем позволить себе отвлекаться на другие цели. Я предлагаю вам сообщить вашему капитану Гелиосу, чтобы он прекратил кампанию против племени Призрачной Сосны и сфокусировался на Плети.', `VerifiedBuild`=29981 WHERE (`ID`=12569 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='И вновь я категорически не согласен с вашим видением стратегической ситуации. Ваш план слишком распылит наши силы. Он оставит нам только небольшой отряд для нападения на Смертхольм. Совесть не позволит мне воплотить в жизнь такую стратегию.', `VerifiedBuild`=29981 WHERE (`ID`=12567 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Нет, я права. Смертхольмом мы займемся в последнюю очередь. Сначала надо отвоевать Призрачные земли. Я не пошлю войска сражаться с Дар\'Кханом, пока враги окружают нас и с флангов, и с тыла!', `VerifiedBuild`=29981 WHERE (`ID`=12562 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Подкрепление от Отрекшихся? Подгород обложен Плетью со всех сторон. Нет, эту войну должны выиграть эльфы крови. Мы, Отрекшиеся, находимся здесь в качестве советников и резерва.', `VerifiedBuild`=29981 WHERE (`ID`=12561 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Вы правы, мы должны сосредоточиться на борьбе с Плетью. Забудьте о троллях и деревнях, все внимание на Смертхольм! Как только Дар\'Кхан будет побежден, остальная армия Плети падет очень быстро, лишившись предводителя.', `VerifiedBuild`=29981 WHERE (`ID`=12560 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Госпожа Златилен, мы и есть подкрепление. Может случиться так, что со временем Темная Госпожа пришлет еще солдат. Будет лучше, если вы убедите Луносвет собрать все доступные силы и предоставить их в наше распоряжение.', `VerifiedBuild`=29981 WHERE (`ID`=12559 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Думаю, вы не хуже меня понимаете, но да, нам бы очень не помешало подкрепление. Я считаю, что быстрее было бы вытащить Странников из их бессмысленных стычек с троллями.', `VerifiedBuild`=29981 WHERE (`ID`=12558 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Сколько еще ждать прихода подкрепления Отрекшихся? Наши позиции непрочны. Ваша госпожа пообещала нам новых солдат. Нам необходимо сосредоточиться исключительно на Смертхольме и Плети!', `VerifiedBuild`=29981 WHERE (`ID`=12557 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Если бы ваши Странники прислали нам подкрепление, может, я бы и согласился. Но вместо этого они возятся с племенем Призрачной Сосны на вашей восточной границе. Чем дольше мы будем ждать их, тем сильнее станет Плеть.', `VerifiedBuild`=29981 WHERE (`ID`=12556 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Это война, госпожа Златилен, а на войне всегда кто-то гибнет! Два зиккурата – вот то, что нам нужно отбить любой ценой. Затем мы закрепимся внутри и захватим башню Проклятых и ее господина. Тогда вы получите обратно ваш Кель\'Талас.', `VerifiedBuild`=29981 WHERE (`ID`=12555 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='При всем уважении, миледи, вы не сражались с Плетью столько, сколько я. Именно по этой причине Темная Госпожа приказала мне помочь вам повергнуть Дар\'Кхана, и вам следует принять мое мнение во внимание.', `VerifiedBuild`=29981 WHERE (`ID`=12553 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Маврен, предложенный вами штурм обойдется нам слишком дорого. Здесь нужна более тонкая стратегия, включающая постепенное возвращение окружающей территории. Начать следует с деревень, тогда Смертхольм вскоре будет отрезан от подкреплений.', `VerifiedBuild`=29981 WHERE (`ID`=12552 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Уверен, по возвращении я получу орден. Мы, конечно, понесли некоторые потери, но в целом, мне кажется, мы успешно выполнили задачу. Ты согласна, Валанна?', `VerifiedBuild`=29981 WHERE (`ID`=12545 AND `locale`='ruRU');
