UPDATE `broadcast_text_locale` SET `Text_lang`='Ситуация гораздо более серьезная, чем многие хотели бы думать. Отрекшиеся – наши союзники в борьбе против общего врага, Плети.$B$BПоверь, без них Призрачные земли были бы потеряны и Плеть уже бы наводнила леса Вечной Песни!$B$BНо если мы хотим вернуть наши некогда славные земли, нам понадобится твоя помощь!', `VerifiedBuild`=29981 WHERE (`ID`=12233 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Ну что мне сказать, |3-6($c)? Ты просто герой! Ты не только $gспас:спасла; многих моих людей, но и $gнанес:нанесла; решительный удар племени Призрачной Сосны. Ты точно не хочешь остаться и вступить в ряды Странников?$B$BУдачи тебе, $n.', `VerifiedBuild`=29981 WHERE (`ID`=12216 AND `locale`='ruRU');
