UPDATE `broadcast_text_locale` SET `Text_lang`='Как можно работать в таких условиях?! Да еще вокруг эти мерзкие Отрекшиеся! Горе Транквиллиону, горе Кель\'Таласу!', `VerifiedBuild`=29981 WHERE (`ID`=12129 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Добро пожаловать в Транквиллион, |3-6($c). Прошу извинить за его состояние. Как видишь, у нас тут некоторые неприятности, но Отрекшиеся и их повелительница, Сильвана Ветрокрылая, любезно согласились выручить нас.$B$BЕсли и ты можешь нам помочь – прошу, сделай это. В борьбе с ордами врагов нам пригодится любая помощь.', `VerifiedBuild`=29981 WHERE (`ID`=12108 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Мне сообщили, что ты можешь помочь следопыту Валанне и лейтенанту в Зеб\'Соре.$B$BСпасибо тебе, |3-6($c). Думаю, теперь я могу вернуться обратно в анклав Странников.', `VerifiedBuild`=29981 WHERE (`ID`=12102 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Я уверена – скоро сюда прибудет подкрепление из анклава Странников, и они отведут меня и этого бестолкового офицера в безопасное место. А тебе я здесь околачиваться не советую – из озера и вон той деревни порой доносятся очень уж странные звуки.', `VerifiedBuild`=29981 WHERE (`ID`=12101 AND `locale`='ruRU');
