UPDATE `broadcast_text_locale` SET `Text1_lang`='Ага, хороший вопрос.$B$BЕсли предпочитаешь охотиться на открытых пространствах, в Чумных землях, Азшаре, Пылающих степях, Оскверненном лесу, Силитусе, Зимних Ключах, и даже кратере Ун\'Горо полно элементалей.$B$BЕсли ты из тех, кто смеется в лицо опасностям, тебе, возможно, стоит наведаться в Забытый город. Я слышала, что в его стенах есть много стихийных аномалий. Еще неплохо было бы тебе поискать элементалей, что на службе у дворфовиз клана Черного Железа в глубинах Черной горы.', `VerifiedBuild`=29981 WHERE (`ID`=12087 AND `locale`='ruRU');
