UPDATE `broadcast_text_locale` SET `Text1_lang`='Милорд, большинство благородных син\'дорай, к несчастью, погибло; значит ли это, что тебя вот-вот повысят?.. Я так рада!', `VerifiedBuild`=29981 WHERE (`ID`=12071 AND `locale`='ruRU');
