UPDATE `broadcast_text_locale` SET `Text_lang`='Если ты еще не $gговорил:говорила; с магистром Эроной в Солнечном шпиле, советую сделать это как можно скорее. Тому есть веские причины, и она – как и все мы – нуждается в твоей помощи!', `VerifiedBuild`=29981 WHERE (`ID`=10999 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Когда-то Солнечный шпиль гордо высился над Солнечным Колодцем, но... с тех пор в нашей жизни все изменилось, $n. Однако мы нашли в себе силы жить дальше. С нами всегда так – мы выживаем несмотря ни на что.$B$BЧтобы пережить все потрясения и остаться собой, нужно учиться жить по-новому. Это должны уметь все эльфы крови. Нужно побороть свою тягу к магии, пока еще не поздно.', `VerifiedBuild`=29981 WHERE (`ID`=10763 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text1_lang`='$n! Надеюсь, ты $gготов:готова; приступить к работе. На острове Солнечного Скитальца для тебя найдется много дел.$B$BС тех пор, как Артас и Плеть уничтожили Солнечный Колодец, наш народ плывет по течению своей судьбы. Мы стоим на краю погибели. Но скоро все изменится, |3-6($c). Тебе предстоит многому научиться – и тогда ты сможешь нам помочь.$B$BЗапределье ждет нас!', `VerifiedBuild`=29981 WHERE (`ID`=10758 AND `locale`='ruRU');
