UPDATE `broadcast_text_locale` SET `Text_lang`='Если тебя интересует расписание появления торговцев и караванов на заставе Расщепленного Дерева, ты $gобратился:обратилась; по адресу. К сожалению, я не слишком люблю общаться.$B$BТак что если тебе что-то нужно, давай побыстрее.', `VerifiedBuild`=29981 WHERE (`ID`=8257 AND `locale`='ruRU');
