UPDATE `broadcast_text_locale` SET `Text_lang`='Меня позвал сюда сам вождь Тралл. Я повиновался с радостью. Лучше места, чем Каменор, и не придумаешь. На здешнем перегное растут любые травы, какие только могут понадобиться.', `VerifiedBuild`=29981 WHERE (`ID`=7774 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Невероятно. Твои снадобья не хуже моих. Я больше не могу учить тебя, а вот орк Рогвар из Каменора, думаю, будет рад такому ученику. Ищи его на болоте Печали.', `VerifiedBuild`=29981 WHERE (`ID`=7765 AND `locale`='ruRU');
