UPDATE `broadcast_text_locale` SET `Text_lang`='А, так тебе нужен Пружиннер Шумотор. Есть тут один гном... Знаешь что? Если пойдешь в его мастерскую в Городе Механиков, ничего там не трогай, а главное – не прикасайся к его овечкам! \n\nВзрывающиеся овцы... Это ж надо было такое придумать!', `Text1_lang`='А, так тебе нужен Пружиннер Шумотор. Есть тут один гном... Знаешь что? Если пойдешь в его мастерскую в Городе Механиков, ничего там не трогай, а главное – не прикасайся к его овечкам! \n\nВзрывающиеся овцы... Это ж надо было такое придумать!', `VerifiedBuild`=29981 WHERE (`ID`=6337 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Вы знаете, я могу пронзить орка насквозь или нарезать тролля на кусочки. Могу даже вырезать свои инициалы на боку огра, но вот шкуры сдирать – это не по мне. Поди пойми. \n\nОднако если у вас на это смелости хватает, то поговорите с Марисой Грейнджер в \"Прочной шкуре\" в старом городе.', `Text1_lang`='Вы знаете, я могу пронзить орка насквозь или нарезать тролля на кусочки? Могу даже вырезать свои инициалы на боку огра, но вот шкуры сдирать – это не по мне. Поди пойми. \n\nОднако если у вас на это смелости хватает, то поговорите с Марисой Грейнджер в \"Прочной шкуре\" в старом городе.', `VerifiedBuild`=29981 WHERE (`ID`=6324 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Горло охрипло, а покупатели не находятся? Лучше иди в аукционный дом Оргриммара на Аллее Силы!', `Text1_lang`='Горло охрипло, а покупатели не находятся? Лучше иди в аукционный дом Оргриммара на Аллее Силы!', `VerifiedBuild`=29981 WHERE (`ID`=5422 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Они утеряны, |3-6($r). Манускрипты, написанные эльфийскими мастерами... Их разбросало по всему миру, когда на Кель\'Талас обрушилась Плеть.$B$BСейчас мы ищем эти манускрипты. Ищем для того, чтобы познать сокрытые в них тайны и вернуть нашу былую силу.$B$BЯ ищу десять сочинений Кариэля Винтала. Если вам попадется манускрипт этого автора, позвольте мне ознакомиться с его магическими свойствами, а я взамен изготовлю слияние силы... разумеется, за некоторую плату. Мои цены довольно высоки, но результат того стоит.', `VerifiedBuild`=29981 WHERE (`ID`=5290 AND `locale`='ruRU');
UPDATE `broadcast_text_locale` SET `Text_lang`='Загляни в механическую мастерскую Ногга. Это на Аллее Чести, к северу от Горного дела Ржавого каньона.', `Text1_lang`='Загляни в механическую мастерскую Ногга. Это на Аллее Чести, к северу от Горного дела Ржавого каньона.', `VerifiedBuild`=29981 WHERE (`ID`=4974 AND `locale`='ruRU');
