UPDATE `broadcast_text_locale` SET `Text_lang`='Крадущийся в тени Зуру – вот, кто тебе нужен. Иди к озеру вверх и на запад по Аллее Силы – придешь на Аллею Духов, а там $gсам:сама; увидишь.', `Text1_lang`='Крадущийся в тени Зуру – вот, кто тебе нужен. Иди к озеру вверх и на запад по Аллее Силы – придешь на Аллею Духов, а там $gсам:сама; увидишь.', `VerifiedBuild`=29981 WHERE (`ID`=4809 AND `locale`='ruRU');
